{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u067e\u0627\u062a\u0627 \u0633\u06cc\u0627\u0647", "\u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", "\u0628\u0627\u06af\u062a \u0622\u0631\u062f \u06a9\u0627\u0645\u0644", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0641\u0642\u0637 \u0643\u0627\u0634 \u064a\u0643\u0645 \u0628\u0627 \u0645\u0631\u0627\u0642\u0628\u062a \u0628\u064a\u0634\u062a\u0631\u064a \u062a\u0627 \u062f\u0645 \u062e\u0648\u0646\u0647 \u0628\u064a\u0627\u0631\u0646 \u062e\u0648\u0646\u0647 \u0645\u0627 \u062a\u0648 \u0643\u0648\u0647 \u0646\u0648\u0631 \u0661 \u0643\u0648\u0686\u0647 \u0641\u0627\u0635\u0644\u0633\u062a \u0628\u0627 \u0627\u064a\u0646 \u062d\u0627\u0644 \u064a\u0643\u064a \u0627\u0632 \u0643\u0627\u067e \u0643\u064a\u0643\u0627 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0631\u0628 \u0648 \u062f\u0627\u063a\u0648\u0646 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647", 1]}
{"text": [" \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u062a\u0627 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0627\u062a\u0645 \u0628\u0647 \u0645\u062c\u0645\u0648\u0639\u0647 \u0647\u0627\u06cc \u0646\u0627\u0646 \u0633\u062d\u0631 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648 \u0647\u0633\u062a\u0645 \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0628\u0647 \u0645\u0634\u062a\u0631\u06cc \u0647\u0627 \u0627\u062d\u062a\u0631\u0627\u0645 \u0645\u06cc\u0630\u0627\u0631\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0650\u0645\u0650\u0644", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0635\u0641\u06cc \u0627\u0632 \u0646\u0648\u0646\u0627\u06cc\u06cc \u06a9\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f...\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0650\u0645\u0650\u0644", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", -1]}
{"text": ["\u067e\u064a\u0631\u0627\u0634\u0643\u064a \u0647\u0627 \u0628\u0642\u062f\u0631 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u062f \u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u0643\u0647 \u0628\u0639\u062f \u0627\u0632 \u064a\u0647 \u06af\u0627\u0632 \u0627\u0646\u062f\u0627\u062e\u062a\u064a\u0645\u0634\u0648\u0646 \u062f\u0648\u0631 \u0648\u0627\u0642\u0639\u0627 \u0628\u062f \u0628\u0648\u062f \u0628\u062f\u062a\u0631\u064a\u0646 \u062f\u0648\u0646\u0627\u062a\u064a \u0628\u0648\u062f \u0643\u0647 \u062a\u0627 \u0628\u0647 \u062d\u0627\u0644 \u062f\u064a\u062f\u0647 \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 15 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", -1]}
{"text": ["\u0631\u0648\u0644\u062a \u0646\u0648\u062a\u0644\u0627 \u0628\u062f \u0628\u0648\u062f. \u0639\u06a9\u0633 \u06cc\u0647 \u0686\u06cc\u0632 \u0628\u0648\u062f \u0648 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0622\u0648\u0631\u062f\u0646 \u06cc\u0647 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u0646\u0648\u062a\u0644\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06af\u0627\u0631\u062f\u0646 \u0686\u06cc\u06a9\u0646", 1]}
{"text": ["\u06a9\u0631\u0627\u06cc\u0647 \u062d\u0645\u0644 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u063a\u0627\u0635\u0644\u0647 \u0632\u06cc\u0627\u062f \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 11 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u0633\u0631\u06cc\u0639 \u0648 \u062a\u0627\u0632\u0647. \u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u0632\u0650\u0645\u0650\u0644", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0647 \u0639\u0643\u0633\u0634 \u0647\u0633\u062a \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0686\u064a\u0632 \u062f\u064a\u06af\u0631\u064a \u0627\u0631\u0633\u0627\u0644 \u0643\u0631\u062f\u0646 \u0643\u0647 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0648\u062a\u0644\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u0641\u0631\u0645 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u0686\u0647\u0627\u0631", "\u0634\u0645\u0639 \u0634\u0634", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0628\u06cc\u0627\u062a \u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0641\u0627\u0635\u0644\u0647 \u06f5 \u062f\u0642\u06cc\u0642\u0647\u200c\u0627\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f.\u0633\u0641\u0627\u0631\u0634\u0645\u0645 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f  -__-", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u06cc\u0646\u06af", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062a\u0631 \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u062c\u0639\u0628\u0647 \u0648\u0627\u0698\u06af\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644 \u0622\u0646\u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0639\u0627\u0644\u06cc \u0646\u0628\u0648\u062f \u0628\u0647 \u0646\u0638\u0631\u0645 \u0645\u06cc\u062a\u0648\u0646\u0633\u062a \u0628\u0647\u062a\u0631 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", 1]}
{"text": ["\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062c\u0627 \u0628\u0647 \u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0646\u0635\u0641\u0634  \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062e\u0627\u0644\u062e\u0627\u0644\u06cc", -1]}
{"text": ["\u0686\u064a\u0632\u0643\u064a\u0643 \u0645\u0627\u0631\u0633 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0644\u0637\u064a\u0641 \u0648 \u0643\u0631\u064a\u0645\u064a \u0628\u0648\u062f \u060c \u0686\u064a\u0632\u0643\u064a\u0643 \u0647\u0648\u064a\u062c \u062e\u064a\u0644\u064a \u0646\u0632\u062f\u064a\u0643 \u0628\u0647 \u0647\u0645\u0648\u0646 \u0643\u064a\u0643 \u0647\u0648\u064a\u062c\u062a\u0648\u0646 \u0647\u0633\u062a \u0641\u0643\u0631 \u0645\u064a\u0643\u0646\u0645 \u0646\u0633\u0628\u062a \u0643\u064a\u0643 \u0628\u0647 \u067e\u0646\u064a\u0631 \u0632\u064a\u0627\u062f \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f \u067e\u06cc\u06a9 \u0628\u062f \u0631\u0627\u0646\u0646\u062f\u06af\u06cc \u06a9\u0631\u062f\u0647 \u0627\u062d\u062a\u0645\u0627\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0628\u062f\u0648\u0646 \u0647\u06cc\u0686 \u0622\u0633\u06cc\u0628 \u060c\u0628\u0631\u062e\u0648\u0631\u062f \u0639\u0627\u0644\u06cc \u0648 \u0645\u062d\u062a\u0631\u0645\u0627\u0646\u0647 \u067e\u06cc\u06a9...\n\u0646\u06cc\u0634\u06a9\u0631 \u0647\u0645 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u0644\u0644\u0644\u06cc\u06cc\u06cc\u06cc \u0628\u0648\u062f  \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0632\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f\u0646 . \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f\u060c \u062e\u06cc\u0644\u06cc \u0645\u0631\u0633\u06cc \u0627\u0632 \u0647\u0645\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0686\u0647\u0627\u0631\u06af\u0648\u0634)", "\u0634\u0645\u0639 \u0639\u062f\u062f 2", "\u0634\u0645\u0639 \u0639\u062f\u062f 5", 1]}
{"text": ["\u0647\u0631 \u0631\u0648\u0632 \u0628\u0647\u062a\u0631 \u0627\u0632 \u062f\u06cc\u0631\u0648\u0632\n\u0645\u0627\u0646\u0627 \u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0627\u063a\u0644\u0628 \u0627\u0648\u0642\u0627\u062a \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0631\u0636\u0627\u06cc\u062a \u062f\u0627\u0634\u062a\u0647 \u0627\u06cc\u0645..\u0627\u06cc\u0646\u0628\u0627\u0631 \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u0632\u06cc\u0631\u0627 \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f..\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u062f\u0631 \u0627\u06cc\u0646\u06af\u0648\u0646\u0647 \u062e\u0631\u06cc\u062f\u0647\u0627\u06cc \u063a\u06cc\u0631\u062d\u0636\u0648\u0631\u06cc \u0647\u0645\u06cc\u0634\u0647 \u0627\u0645\u0627\u0646\u062a \u062f\u0627\u0631 \u0628\u0648\u062f\u0647 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0628\u0641\u0631\u0633\u062a\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0645\u0631\u062a\u0628 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0686\u06cc\u062f\u0645\u0627\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0645\u06cc\u06a9\u0633 \u062f\u0633\u0631 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u067e\u06cc\u06a9 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f\u0647 \u0627\u0632 \u0645\u0646 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u06a9\u0631\u062f \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0686\u06a9 \u06a9\u0646\u0645\u060c \u0639\u0644\u062a \u062c\u0648\u06cc\u0627 \u0634\u062f\u0645 \u06a9\u0647 \u06af\u0641\u062a \u0633\u0641\u0627\u0631\u0634 \u0648 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0646 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0647\u0633\u062a \u0648 \u0645\u0631\u0627\u0642\u0628 \u0628\u0627\u0634\u0647 . \u0628\u0646\u062f\u0647 \u062e\u062f\u0627 \u0647\u0645 \u06af\u0641\u062a \u0628\u062e\u0627\u0637\u0631 \u062a\u0648\u0635\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0645\u0633\u06cc\u0631 \u0631\u0627 \u0622\u0631\u0627\u0645 \u0622\u0645\u062f\u0645. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0646\u06cc\u0634\u06a9\u0631 \u0639\u0632\u06cc\u0632 \u06a9\u0647 \u0628\u0647 \u067e\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u067e\u06cc\u06a9 \u0647\u0645 \u0631\u0639\u0627\u06cc\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u0631\u0627\u06cc\u0637 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0633\u0631", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u062d\u0634\u062a\u0627\u0643\n\u064a\u0639\u0646\u064a \u062d\u062a\u0645\u0627 \u0628\u0627\u064a\u062f \u062d\u0636\u0648\u0631\u064a \u062e\u0631\u064a\u062f \u0643\u0631\u062f \u062a\u0627 \u062e\u0631\u064a\u062f \u0645\u0646\u0627\u0633\u0628 \u0643\u0631\u062f\u061f!\n\u062c\u0639\u0628\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0627\u0632 \u0627\u064a\u0646 \u067e\u0627\u0631\u0647 \u062a\u0631 \u0646\u0628\u0648\u062f \u0643\u0647 \u0628\u0627 \u0643\u0644\u064a \u0686\u0633\u0628 \u062c\u0639\u0628\u0647 \u0631\u0648 \u062f\u0631\u0633\u062a \u0643\u0631\u062f\u0647 \u0628\u0627\u0634\u064a\u0646\u061f!\n\u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u062b\u0644 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u064a \u062f\u064a\u06af\u0647 \u0646\u064a\u0633\u062a \u0643\u0647 \u0647\u0645\u064a\u0646\u0637\u0648\u0631\u064a \u0643\u0641 \u062c\u0639\u0628\u0647 \u0628\u06af\u0630\u0627\u0631\u0646 \u0627\u0635\u0648\u0644\u0627 \u062f\u0631 \u0633\u064a\u0646\u064a \u067e\u0644\u0627\u0633\u062a\u064a\u0643\u064a \u0645\u064a\u06af\u0630\u0627\u0631\u0646\n\u0628\u0627\u0639\u062b \u062a\u0627\u0633\u0641", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0639\u062f\u0627\u062f \u0647\u0627 \u0628\u0627 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u0648 \u0645\u0646\u0648 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u0646\u0645\u06cc\u062e\u0648\u0646\u062f\u060c \u0645\u062b\u0644\u0627 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f 9-11 \u0639\u062f\u062f \u0648\u0644\u06cc 14-15 \u062a\u0627 \u0628\u0648\u062f\n\u06cc\u0647 \u0639\u0644\u062a\u0634 \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0647\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u0686 \u0631\u0628\u0637\u06cc \u0628\u0647 \u0639\u06a9\u0633\u0634 \u0646\u062f\u0627\u0634\u062a\u060c \u0628\u062f\u0645\u0632\u0647 \u0646\u0628\u0648\u062f\u0627\u060c \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u060c \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f\u0646 \u0648\u0644\u06cc \u0628\u0627 \u062a\u0635\u0648\u06cc\u0631 \u062e\u0648\u0627\u0646\u0627\u06cc\u06cc \u0646\u062f\u0627\u0634\u062a\u0646. \n\u0648 \u0627\u0644\u0628\u062a\u0647 \u062a\u0627\u0631\u062a \u0647\u0627 \u0628\u0647 \u0637\u0648\u0631 \u062e\u0627\u0635 \u062a\u0639\u0631\u06cc\u0641 \u062a\u0627\u0631\u062a \u0631\u0648 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u060c \u0686\u0631\u0627 \u06a9\u0647 \u06a9\u06cc\u06a9 \u0627\u0633\u0641\u0646\u062c\u06cc \u062f\u0627\u0634\u062a\u0646 \n\u0627\u06af\u0631 \u0642\u0631\u0627\u0631 \u0627\u0633\u062a \u0627\u0633\u0646\u067e\u200c\u0641\u0648\u062f \u0628\u0627\u0639\u062b \u0628\u0634\u0647 \u0645\u0646 \u0646\u06cc\u0627\u0632\u06cc \u0628\u0647 \u062d\u0636\u0648\u0631 \u0641\u06cc\u0632\u06cc\u06a9\u06cc \u0648 \u062e\u0631\u06cc\u062f \u0627\u0632 \u06cc\u06a9 \u0642\u0646\u0627\u062f\u06cc \u0646\u0628\u06cc\u0646\u0645\u060c \u0627\u06cc\u0646 \u062a\u062c\u0631\u0628\u0647 \u062e\u0648\u0628\u06cc \u0646\u0628\u0648\u062f\u060c \u0645\u0637\u0645\u0626\u0646 \u0647\u0633\u062a\u0645 \u062a\u0627\u0631\u062a \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0627 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0631\u0648 \u062a\u0648 \u0642\u0646\u0627\u062f\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u0646\u0645\u06cc\u06a9\u0631\u062f\u0645!\n\u0648 \u0627\u0644\u0628\u062a\u0647 \u0642\u0627\u0637\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u06cc\u06cc \u0647\u0627 \u0686\u0646\u062f\u062a\u0627\u06cc\u06cc\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0648\u062f!\n\u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0639\u06a9\u0633 \u0647\u0627 \u0631\u0648 \u0628\u0647 \u0631\u0648\u0632 \u06a9\u0646\u06cc\u062f. ", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 1.400 \u06af\u0631\u0645\u06cc (9 \u0627\u0644\u06cc 11 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc", "\u062a\u0627\u0631\u062a \u0622\u0644\u0628\u0627\u0644\u0648 1.300 \u06af\u0631\u0645\u06cc (9 \u062a\u0627 11 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0645\u0648\u0646\u062f\u0647 \u0645\u0648\u0646\u062f \u0648 \u0628\u0633\u064a\u0627\u0631 \u0634\u064a\u0631\u064a\u0646\u064a\u0647 \u0627\u0636\u0627\u0641\u064a \u062f\u0627\u0634\u062a \u0648 \u0628\u0631 \u062e\u0644\u0627\u0641 \u062f\u0641\u0639\u0627\u062a \u0642\u0628\u0644 \u0643\u0647 \u062a\u0646\u0648\u0639 \u062f\u0627\u0634\u062a\u060c\u0627\u064a\u0646\u062f\u0641\u0639\u0647 \u0641\u0642\u0637 \u0627\u0632 \u064a\u0643 \u0646\u0648\u0639 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0648\u0646\u06cc \u0631\u0648 \u06a9\u062c \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0686\u06cc\u062f\u0646 !!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u06cc\u0632\u06cc \u06a9 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u06cc\u0645 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0634\u06a9\u0631\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0645\u062a\u0648\u0633\u0637 \u060c \u062e\u0627\u0645\u0647 \u0631\u0648 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0627\u06cc\u062f \u0632\u062f \u062a\u0627 \u067e\u0648\u06a9 \u0634\u0648\u062f \u060c \u062e\u0627\u0645\u0647 \u0628\u06cc\u0634\u062a\u0631 \u062d\u0627\u0644\u0627\u062a \u0645\u0627\u06cc\u0639 \u062f\u0627\u0634\u062a\u060c \u0637\u0645\u0639 \u062e\u0627\u0645\u0647 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u060c \u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0635\u0646 \u0634\u0645\u0639 \u062e\u06cc\u0644\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0632 \u0646\u0638\u0631 \u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u06cc\u06a9 \u0632\u062d\u0645\u062a \u06a9\u0634\u06cc\u062f\u0647 \u0628\u0648\u062f \u0647\u0645\u0647 \u0645\u062d\u062a\u0648\u06cc\u0627\u062a \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0647\u0627\u0631\u0648 \u0645\u062e\u0644\u0648\u0637 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u0647\u0645\u0647 \u0634\u06a9\u0644\u0634\u0648\u0646 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", "\u0633\u0628\u062f \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0637\u0639\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0636\u0639\u06cc\u0641 \u0648 \u0628\u062f\u06cc \u062f\u0627\u0634\u062a \u060c \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0628\u0627 \u0686\u06cc \u062f\u0631\u0633\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u060c \u0641\u0642\u0637 \u067e\u0648\u0644\u062a\u0648\u0646\u0648 \u0645\u06cc\u0631\u06cc\u0632\u06cc\u0646 \u062f\u0648\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 . \u0639\u0627\u0644\u0649 \u0628\u0648\u062f. \u062e\u062f\u0627 \u0642\u0648\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 35 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0639\u0648\u0646\u06cc \u062a\u0627 \u0627\u0648\u0646\u062c\u0627\u06cc\u06cc \u06a9\u0647 \u0645\u0627 \u062e\u0648\u0631\u062f\u06cc\u0645 \u0648 \u0645\u06cc\u062f\u0648\u0646\u06cc\u0645 \u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0646\u06cc\u0633\u062a\n\u0628\u0631\u0627\u06cc \u0645\u0627 \u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647\n\u0648 \u0627\u06cc\u0646\u06a9\u0647 \u06a9\u06cc\u06a9 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u06cc\u062f....\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06f2\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u062f\u06cc\u0631\u062a\u0631 \u0627\u0632 \u062a\u0627\u06cc\u0645 \u062a\u0639\u06cc\u06cc\u0646 \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u0639\u062f\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u06f2\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u062f\u06cc\u0631\u062a\u0631 \u0627\u0632 \u062a\u0627\u06cc\u0645 \u062a\u0639\u06cc\u06cc\u0646 \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u0639\u062f\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0633\u0627\u0644\u0645\u200c\u0646\u0631\u0633\u06cc\u062f\u0647 \u0628\u0648\u062f \u062f\u0633\u062a\u0645 \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0637\u0628\u06cc\u0639\u062a\u0627 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0645\u0637\u0645\u06cc\u0646 \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0645\u062d\u062a\u0648\u06cc\u0627\u062a \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0632\u06cc\u0631 \u0648 \u0631\u0648 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u0634\u06a9\u0644 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f. \u0644\u0637\u06cc\u0641\u0647 \u0647\u0645 \u062c\u0627\u06cc \u062a\u06a9\u0648\u0646 \u062e\u0648\u0631\u062f\u0646 \u0646\u062f\u0627\u0634\u062a \u0648\u06af\u0631\u0646\u0647 \u0627\u0648\u0646 \u0647\u0645 \u0633\u0627\u0644\u0645 \u0646\u0645\u06cc\u0631\u0633\u06cc\u062f. \u0628\u0627\u06cc\u062f \u062f\u0631 \u0645\u0648\u0631\u062f \u062d\u0645\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0642\u062a \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc\u06cc \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u06a9\u0646\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0644\u0637\u06cc\u0641\u0647 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0645\u0627\u0645\u0627 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0627\u06cc\u0646\u062f\u0641\u0639\u0647 \u0636\u0639\u06cc\u0641 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0631\u0627\u0636\u06cc \u06a9\u0646\u0646\u062f\u0647 \u0648 \u062f\u0631 \u062d\u062f \u0646\u0627\u062a\u0644\u06cc \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0644\u0645\u067e\u0647 \u06a9\u0631\u0645\u0627\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u067e\u06cc \u062f\u0627\u0631\u0686\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u062f\u0631\u06cc\u0627\u0641\u062a \u0645\u06cc\u06a9\u0631\u062f\u0645 \u0627\u06cc\u0646\u0628\u0627\u0631 \u0631\u0648\u0644\u062a \u0647\u0627 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 \u0648 \u062d\u062a\u06cc \u0645\u06cc\u062a\u0648\u0646\u0645 \u0628\u06af\u0645 \u0627\u0632 \u0646\u0638\u0631 \u062a\u0627\u0632\u06af\u06cc \u0646\u0627\u0627\u0645\u06cc\u062f\u06a9\u0646\u0646\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0639\u0644\u0648\u0645 \u0646\u06cc\u0633\u062a \u067e\u06cc\u06a9 \u0686\u0647\u200c\u062c\u0648\u0631\u06cc \u0633\u0641\u0627\u0631\u0634\u0648 \u0622\u0648\u0631\u062f \u06a9\u0647 \u06a9\u0644 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.\n\u062e\u0648\u062f \u0642\u0646\u0627\u062f\u06cc \u0647\u0645 \u067e\u0627\u0633\u062e\u06af\u0648 \u0646\u06cc\u0633\u062a.\n\u062a\u0627\u0632\u0647 \u0647\u0632\u06cc\u0646\u0647 \u0628\u0631\u0627\u06cc \u067e\u06cc\u06a9 \u0647\u0645 \u06af\u0630\u0627\u0634\u062a\u06cc\u062f \u0628\u0627 \u0627\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u06cc\u200c\u06af\u06cc\u0631\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0645\u0646 \u0639\u0627\u0634\u0642 \u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u0627\u0646 \u0633\u062d\u0631\u0645\u060c \u0647\u0631 \u0648\u0642\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \n \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0647\u060c\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u0645\u0627\u0646\u062f\u0647 \u0686\u0646\u062f \u0631\u0648\u0632 \u0642\u0628\u0644 \u0631\u0627 \u0628\u0647 \u0645\u0634\u062a\u0631\u064a \u062a\u062d\u0648\u064a\u0644 \u0646\u062f\u0647\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 28 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u062a\u0627 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u0628\u0644 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0648\u0645\u062f\u0647 \u0628\u0648\u062f \u0627\u06cc\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 11 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 30 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062b \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628\n\u0648\u0644\u06cc \u0627\u0632 \u0633\u0627\u0644 \u062c\u062f\u06cc\u062f \u062a\u0627 \u0627\u0644\u0627\u0646 \u0642\u06cc\u0645\u062a \u067e\u06cc\u06a9 \u062f\u0642\u06cc\u0642\u0627 \u062f\u0648 \u0628\u0631\u0627\u0628\u0631 \u0634\u062f\u0647.\n\u06a9\u0645 \u06a9\u0645 \u062f\u0627\u0631\u0647 \u0628\u0647 \u062c\u0627\u06cc\u06cc \u0645\u06cc\u0631\u0647 \u06a9\u0647 \u0646\u0645\u06cc\u0635\u0631\u0641\u0647 \u067e\u06cc\u06a9 \u0628\u06af\u06cc\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", "\u0633\u06cc\u0645\u06cc\u062a", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062f\u0627\u063a \u062f\u0627\u063a \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0631\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0631\u06cc \u062f\u0648\u0645 \u0647\u0633\u062a \u06a9\u0647 \u0635\u0628\u062d \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0634\u0647\u0631\u06a9 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u06cc\u0645 \n\u0646\u0627\u0646 \u0647\u0627 \u0628\u06cc\u0627\u062a \u0648 \u0645\u062e\u0644\u0641\u0627\u062a \u062f\u0627\u062e\u0644 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645 \n\u0648\u0627\u0642\u0639\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f \n\u0645\u0645\u0646\u0648\u0646 \u0645\u06cc\u0634\u0645 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0628\u0641\u0631\u0645\u0627\u06cc\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0628\u062f \u0628\u0648\u062f. \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0627\u0646\u062a\u0638\u0627\u0631 \u0647\u0645\u0686\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647 \u0645\u0648\u0646\u062f\u0647\u200c\u0627\u06cc \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u0645. \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u060c\u0648\u0627\u0633\u0647 \u062f\u0648 \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0648\u062f.. \u0648\u0627\u0642\u0639\u0627 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0645\u0634\u0648\u0646 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0641\u0642\u0637 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0622\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u0645\u0646 \u062a\u0627\u0631\u062a \u0627\u0646\u0648\u0627\u0639 \u0645\u06cc\u0648\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 24 \u0639\u062f\u062f)", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062f\u0631 \u0639\u06a9\u0633 \u0633\u0627\u062f\u0647 \u0627\u0633\u062a \u0648\u0644\u06cc \u0628\u0631\u0627\u06cc \u0645\u0627 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u062a\u0639\u062f\u0627\u062f\u0634 \u0647\u0645 7 \u0639\u062f\u062f \u0628\u0648\u062f \u06a9\u0647 \u0628\u0627 \u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f\u06cc \u06a9\u0647 \u0630\u06a9\u0631 \u0634\u062f\u0647 \u062e\u06cc\u0644\u06cc \u0645\u062a\u0641\u0627\u0648\u062a\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0631\u0633\u062a \u062d\u0645\u0644 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0643\u064a\u0643\u064a \u0643\u0647 \u0622\u0648\u0631\u062f\u0646 \u0631\u0648\u064a \u0643\u064a\u0643 \u0648 \u0643\u0646\u0627\u0631\u0634 \u0643\u0627\u0645\u0644\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645\u0647 \u062e\u0627\u0645\u0647 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u064a\u062f\u0647 \u0628\u0648\u062f\u060c \u0645\u062b\u0644\u0627 \u0643\u064a\u0643 \u062a\u0648\u0644\u062f \u0628\u0648\u062f\u0647\n\u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0631\u0641\u062a\u0627\u0631 \u0627\u0633\u0646\u067e \u0645\u0648\u062f\u0628\u0627\u0646\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0641\u06a9 \u0645\u06cc\u06a9\u0631\u062f\u0645 \u0628\u0632\u0631\u06af\u062a\u0631 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0628\u0627\u0634\u0647.\n\u0627\u06cc\u0646\u06a9\u0647 \u062f\u0648\u0631\u0634 \u0641\u0642\u0637 \u06cc\u0647 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9\u0647 \u0627\u062f\u0645 \u0627\u0630\u06cc\u062a \u0645\u06cc\u0634\u0647. \u0647\u0645\u0634 \u0628\u0627\u06cc\u062f \u0628\u06af\u06cc\u0631\u06cc\u0634 \u0646\u0631\u06cc\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0647 \u0635\u0648\u0631\u062a \u0643\u0627\u0645\u0644\u0627 \u0648\u0627\u0631\u0648\u0646\u0647 \u0648 \u062a\u0645\u0627\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0631\u0633\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0641\u0642\u0637 \u0648\u0642\u062a\u06cc \u0641\u0627\u0635\u0644\u0647 \u062e\u06cc\u0644\u06cc \u0646\u0632\u062f\u06cc\u06a9\u0647 \u060c \u0645\u0628\u0644\u063a\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0645\u062d\u0627\u0633\u0628\u0647 \u0645\u06cc\u0634\u0647 \u0642\u0627\u0628\u0644 \u062f\u0631\u06a9 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc ^_^ \u06a9\u0645\u062a\u0631 \u0627\u0632 \u06f1\u06f5 \u062f\u0642\u06cc\u0642\u0647 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 . \u06a9\u0627\u0645\u0644\u0627\u064b \u0647\u0645 \u0633\u0627\u0644\u0645 \u0628\u0648\u062f\u0646 \u06a9\u06cc\u06a9 \u0647\u0627\u0645 .\n\u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 \u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u06cc\u06a9\u0645 \u062a\u0631\u0634 \u0628\u0627\u0634\u0647 \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u060c \u0632\u06cc\u0627\u062f \u0628\u0627\u0628 \u0637\u0628\u0639 \u0645\u0646 \u0646\u0628\u0648\u062f . \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0647\u0645\u0634\u0648\u0646 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 . \u0645\u0631\u0633\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648 \u0627\u0633\u0646\u067e :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", 1]}
{"text": ["\u0686\u0631\u0627 \u0627\u0646\u0642\u062f\u0631 \u0646\u0627\u0646 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0644\u0641\u062a \u0648 \u0633\u0641\u062a\u0647\u061f\u061f \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0628\u06af\u0630\u0631\u0647 \u0645\u062b\u0644 \u0627\u062c\u0631 \u0645\u06cc\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0632\u0631\u06af", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0637\u0639\u0645 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc\u060c \u0627\u0645\u0627 \u062d\u0645\u0644\u0634\u0648\u0646 \u062a\u0648\u0633\u0637 \u0627\u0633\u0646\u067e \u062e\u0648\u0628 \u0646\u0628\u0648\u062f\u0647 \u0648 \u0647\u0645\u0634\u0648\u0646 \u0628\u0647 \u062f\u0631 \u0648 \u062f\u06cc\u0648\u0627\u0631 \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 1", 1]}
{"text": ["\u0647\u0645 \u067e\u0648\u062f\u06cc\u0646\u06af \u0648 \u0647\u0645 \u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631\u06cc\u0646 \u0628\u0648\u062f\u0646\u060c \u0645\u0631\u0633\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 ! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u067e\u0648\u062f\u06cc\u0646\u06af", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f . \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0648\u0642\u062a\u06cc \u0631\u0633\u06cc\u062f \u06cc\u0647 \u0628\u062e\u0634\u06cc \u0627\u0632 \u062e\u0627\u0645\u0647 \u0648 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u062a\u0632\u06cc\u06cc\u0646 \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u0648 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u0641\u0631\u0645\u200c\u06a9\u06cc\u06a9 \u0627\u0632 \u062f\u0633\u062a \u0631\u0641\u062a\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0628\u0647 \u0645\u0627 \u0631\u0633\u06cc\u062f \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u062f\u0627\u063a\u0627\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0632 \u062f\u0633\u062a \u067e\u06cc\u06a9 \u0634\u0645\u0627 \u0627\u0641\u062a\u0627\u062f\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0646\u06cc\u0648\u0645 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u0627\u0645\u0644\u0627 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1.400 \u06af\u0631\u0645\u06cc (20 \u062a\u0627 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u060c \u0639\u0627\u0644\u06cc \u060c \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062e\u0648\u0634\u0628\u062e\u062a\u0627\u0646\u0647 \u0633\u0627\u0644\u0645 \u0648 \u0633\u0631\u06cc\u0639 \u0628\u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f . \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648\u062e\u0633\u0643 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u06af\u0627\u0646\u0627\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0631\u0686\u0646\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u0648\u0644\u06cc \u062e\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f\n1.30 \u0633\u0627\u0639\u062a \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0627\u06af\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0646\u0648\u0634\u062a\u06cc\u0646 \u06f2\u06f0 \u0639\u062f\u062f. \u0645\u0646 \u0641\u06a9\u0631 \u06a9\u0631\u0648\u0645 \u06f6\u06f5\u06f0 \u06af\u0631\u0645 \u0645\u06cc\u0634\u0647 \u06f1\u06f2 \u0639\u062f\u062f \u0646\u0647 \u06f8 \u062a\u0627. \u0628\u0631\u0627\u06cc \u0647\u0645\u06a9\u0627\u0631\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0644\u0648\u062f\u0645. \u06a9\u0645 \u0627\u0648\u0645\u062f", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0634\u06a9\u0644 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0646\u0648\u0634\u062a\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0628\u0647 \u0628\u062f\u062a\u0631\u06cc\u0646 \u0634\u06a9\u0644 \u0645\u0645\u06a9\u0646 \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u0627\u0628\u0631\u0648\u06cc \u0645\u0646 \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0648\u0646\u0627\u0645 \u0631\u0641\u062a \u0628\u062f \u0628\u0648\u062f \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u0628\u0647\u062a\u0631\u0647 \u062f\u0631 \u062d\u0645\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u0634\u0647\u200c ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "\u0628\u0633\u062a\u0646\u06cc \u0633\u0646\u062a\u06cc \u0646\u0648\u0646\u06cc", 1]}
{"text": ["\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 17 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u0634\u064a\u0631\u064a\u0646\u0649 \u0645\u0648\u0646\u062f\u0647 \u0648\u0643\u064a\u0641\u064a\u062a \u067e\u0627\u064a\u064a\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0634\u0645\u0632\u0647...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9", "\u06a9\u0627\u063a\u0630 \u067e\u0631\u0648\u0646 \u0631\u0646\u06af\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645 \u0628\u0627\u0628\u062a \u0631\u0633\u06cc\u062f\u06af\u06cc \u0628\u0647 \u0646\u0638\u0631  \u0647\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062f\u0648\u0628\u0627\u0631\u0647 \u0639\u0627\u0644\u06cc \u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u062e\u0627\u0631\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0627\u062a\u0627 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u06cc \u062c\u0639\u0628\u0647 \u0648 \u062e\u06cc\u0644\u06cc \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0632\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f\u0646 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u062f\u0648 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u0639\u062f\u062f", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u062a\u0628\u0631\u06cc\u0632\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u0647\u0645\u0647 \u062f\u0627\u0646\u0645\u0627\u0631\u0643\u064a\u0627 \u0627\u0632 \u064a\u0647 \u0645\u062f\u0644 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645\u060c \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0634\u0645\u0627..\n\u0641\u0642\u0637 \u0628\u0627\u0642\u0644\u0648\u0627 \u0634\u06cc\u0631\u0647 \u0627\u0634 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u06af\u0631\u062f)", 1]}
{"text": ["\u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0634\u06a9\u060c \u0647\u0645 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u062f\u060c \u0638\u0627\u0647\u0631 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u067e\u06cc \u062f\u0627\u0631\u0686\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0627\u06cc\u0646 \u0628\u0627\u0631 \u062f\u0648\u0645\u06cc \u0647\u0633\u062a \u06a9\u0647 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u062e\u0631\u06cc\u062f \u0645\u06cc \u06a9\u0646\u0645 \u0648 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0648\u062c\u0648\u062f\u06cc \u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u062f\u0627\u062f\u0645 \u062a\u0645\u0648\u0645 \u0634\u062f\u0647 \u062a\u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062a\u0627\u06cc\u06cc\u062f \u0645\u06cc \u06a9\u0646\u0646 \u0648 \u0628\u0639\u062f \u062e\u0648\u062f \u0642\u0646\u0627\u062f\u06cc \u0632\u0646\u06af \u0645\u06cc \u0632\u0646\u0647 \u0648 \u0645\u06cc\u06af\u0647 \u062a\u0645\u0648\u0645 \u0634\u062f\u0647 \u0648 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u06cc\u06a9 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0645\u06cc\u062f\u0647 \u0648 \u0628\u0627 \u0627\u0635\u0631\u0627\u0631 \u0622\u062f\u0645 \u0631\u0648 \u062a\u062d\u062a \u0641\u0634\u0627\u0631 \u0645\u06cc\u06af\u0630\u0627\u0631\u0646 \u06a9\u0647 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062f\u0627\u0631\u0646 \u0631\u0648 \u0628\u0641\u0631\u0633\u062a\u0646.\u0628\u062c\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0642\u06cc\u0641\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u06a9\u0647 \u067e\u0631 \u0627\u0632 \u062e\u0627\u0645\u0647 \u0633\u062a \u0648 \u0639\u0645\u0644\u0627 \u0633\u0647 \u0686\u0647\u0627\u0631\u0645 \u0648\u0632\u0646 \u062c\u0639\u0628\u0647 \u06a9\u0647 \u062e\u0627\u0645\u0647 \u0628\u0648\u062f \u0631\u0648 \u0631\u06cc\u062e\u062a\u06cc\u0645 \u062f\u0648\u0631 \u0648 \u0641\u0642\u0637 \u0646\u0648\u0646 \u0647\u0627\u0634 \u0631\u0648 \u062a\u0648\u0646\u0633\u062a\u06cc\u0645 \u0628\u062e\u0648\u0631\u06cc\u0645.\n\u0631\u0648\u0644 \u0633\u06cc\u0628 \u0647\u0645 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0634\u06a9\u0631 \u0632\u06cc\u0627\u062f\u06cc \u062f\u0627\u0634\u062a \u062e\u06cc\u0644\u06cc \u062a\u0631\u0634 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0631\u062f \u0648\u0644\u0648\u062a \u0628\u0633\u06cc\u0627\u0631 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u0627\u0632\u0628\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0631\u062f\u0648\u0644\u0648\u062a \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\n\u0627\u0645\u0627 \u0631\u0648\u0644\u062a \u0648 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0639\u0627\u0644\u06cc\u200c\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc\u200c\n\u0641\u0642\u0637 \u06f2 \u0633\u0627\u0639\u062a \u0628\u0639\u062f \u0633\u0641\u0627\u0631\u0634 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u06a9\u0647 \u0686\u0648\u0646 \u0645\u0647\u0645\u0648\u0646 \u062f\u0627\u0634\u062a\u0645 \u0648\u0627\u0642\u0639\u0627 \u062e\u06cc\u0644\u06cc \u0646\u0627\u0631\u0627\u062d\u062a \u0634\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9\u0634 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0644\u0630\u062a \u0628\u0631\u062f\u06cc\u0645 \u0648\u0644\u06cc \u0628\u06cc\u0634\u062a\u0631 \u06af\u06cc\u0644\u0627\u0633\u0627\u06cc \u0631\u0648\u0634 \u062a\u0644\u062e \u0628\u0648\u062f\u0646. \u0634\u0645\u0639\u0647\u0627 \u0647\u0645 \u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633\u06cc \u06a9\u0647 \u06af\u0630\u0627\u0634\u062a\u06cc\u0646 \u0646\u0628\u0648\u062f\u0646 \u0648 \u0628\u062c\u0627\u06cc \u0631\u0646\u06af\u0627\u0631\u0646\u06af\u060c \u0633\u06cc\u0627\u0647 \u0648 \u0642\u0631\u0645\u0632 \u0628\u0648\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0647\u067e\u06cc \u0628\u0631\u0633 \u062f\u06cc", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\n\u0627\u0646\u0642\u062f\u0631 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u0647\u0645\u0648\u0646\u0645\u0648\u0642\u0639 \u067e\u062e\u062a\u0647 \u0628\u0648\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u0645\u0627 \u0632\u062f\u06cc\u062f \u062a\u0648 \u06a9\u0627\u0631 \u0645\u0631\u0628\u0627 \u0641\u0631\u0648\u0634\u06cc\u061f \u062a\u0648\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u062a\u0627 \u0645\u06cc\u0634\u0648\u062f \u0645\u0631\u0628\u0627 \u0632\u062f\u06cc\u062f\n\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0627\u0633\u0645\u0634 \u0631\u0648\u0634\u0647 \u0633\u06cc\u0628 \u0644\u0627\u06cc \u06a9\u0644\u06cc \u0645\u0631\u0628\u0627 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u06a9\u06cc\u06a9 \u06af\u0631\u0641\u062a\u06cc \u062a\u0647\u0634 \u0645\u0631\u0628\u0627 \u0632\u062f\u06cc \n\u0628\u0644\u0647 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u0648\u0632\u0646 \u06a9\u06cc\u06a9\u062a\u0648\u0646 \u0645\u06cc\u0631\u0647 \u0628\u0627\u0644\u0627 \u0648 \u0627\u0646\u06af\u0627\u0631 \u067e\u0648\u0644 \u0645\u0631\u0628\u0627 \u0627\u0632 \u0645\u0627 \u0645\u06cc\u06af\u06cc\u0631\u06cc\u062f.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0641\u0642\u0637 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u06cc\u0646\u06cc \u0645\u0627\u0646\u0646\u062f \u0639\u06a9\u0633\u0634 \u0646\u0628\u0648\u062f \u0648 \u0642\u0633\u0645\u062a\u06cc \u0627\u0632 \u06a9\u06cc\u06a9 \u0628\u0647 \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u0631\u0627 \u06a9\u0645\u06cc \u0628\u062f \u06a9\u0631\u062f\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 1", "\u0634\u0645\u0639 \u0639\u062f\u062f 9", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627.\u0648\u0627\u0642\u0639\u0627 \u062f\u0645\u062a\u0648\u0646 \u06af\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 \u0628\u0627 \u0639\u06a9\u0633 \u0632\u0645\u06cc\u0646 \u062a\u0627 \u0622\u0633\u0645\u0627\u0646 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a\n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0633\u0627\u062f\u0647 \u0628\u062f\u0648\u0646 \u0647\u06cc\u0686 \u062a\u0632\u0626\u06cc\u0646\n\u0628\u0647\u062a\u0631\u0647 \u0627\u0633\u0645\u0634 \u0631\u0627 \u0639\u0648\u0636 \u06a9\u0646\u06cc\u062f \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u00ab\u0631\u0648\u0644\u062a \u0633\u0627\u062f\u0647 \u062e\u0627\u0644\u06cc\u00bb", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u062f\u0627\u06cc\u06cc\u0634 \u062e\u0648\u0628\u0646 \u0645\u0646\u0638\u0645 \u0645\u0631\u062a\u0628 \u0628\u0647 \u0645\u0648\u0642\u0639 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0633\u0627\u062f\u0647", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", 1]}
{"text": ["\u0628\u0639\u0636\u06cc \u0627\u0632 \u0627\u0642\u0644\u0627\u0645 \u0633\u0641\u0627\u0631\u0634 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u062f \u0628\u0647 \u062e\u0635\u0648\u0635 \u0633\u0645\u0628\u0648\u0633\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u06cc\u062a\u0632\u0627 \u0645\u06cc\u0646\u06cc", "\u0633\u0645\u0628\u0648\u0633\u0647", 1]}
{"text": ["\u062e\u062f\u0627\u0631\u0648\u0634\u06a9\u0631 \u0627\u0646\u062f\u0641\u0639\u0647 \u0647\u0631\u0686\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u062a\u0631\u062f \u062a\u0627\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", "\u062c\u0648 100% \u0633\u0627\u062f\u0647", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", "\u062c\u0648 \u062f\u0648 \u0633\u0631", 1]}
{"text": ["\u0627\u0632 \u0647\u0631 \u0646\u0638\u0631 \u0639\u0627\u0627\u0627\u0644\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u06cc\u06a9\u0645 \u0628\u0648\u06cc \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", 1]}
{"text": ["\u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f. \u0627\u0646\u06af\u0627\u0631 \u0632\u0645\u06cc\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0627\u0634\u0647...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u062e\u0627\u0644\u062e\u0627\u0644\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0647\u0645\u0634 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0642\u0627\u0637\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f\u0648 \u0631\u0648\u06cc\u0647 \u06a9\u06cc\u06a9\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u0628\u0631\u0627\u0646\u06cc \u06a9\u0647 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u062d\u062c\u0645 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0635\u0648\u0631\u0627\u062a\u0645\u0648\u0646 \u0641\u0627\u0635\u0644\u0647 \u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f. \u0634\u06a9\u0644\u0627\u062a \u06a9\u0631\u0648\u0633\u0627\u0646 \u062f\u0648 \u062a\u06cc\u06a9\u0647 \u062f\u0627\u062e\u0644\u0634 \u0642\u0631\u0627\u0631 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0633\u0641\u062a \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0637\u0639\u0645 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f. \u0627\u0644\u0628\u062a\u0647 \u0645\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06cc\u06a9\u0646\u0641\u0631\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0639\u062f \u0627\u0632 \u0648\u0627\u0631\u06cc\u0632 \u0648\u062c\u0647 \u0648 \u0642\u0637\u0639\u06cc \u0634\u062f\u0646 \u0633\u0641\u0627\u0631\u0634\u060c \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u0648 \u06af\u0641\u062a\u0646 \u06a9\u0647 \u0633\u0627\u06cc\u0632 \u06cc\u06a9\u0646\u0641\u0631\u0647 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0648 \u0645\u0646 \u0646\u0627\u0686\u0627\u0631 \u0634\u062f\u0645 \u0647\u0632\u06cc\u0646\u0647 \u06cc\u06a9 \u06a9\u06cc\u06a9 \u0645\u062a\u0648\u0633\u0637 \u0631\u0648 \u067e\u0631\u062f\u0627\u062e\u062a \u06a9\u0646\u0645 \u0648 \u0686\u06cc\u0632\u06cc \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062c\u0645 \u0645\u0648\u0631\u062f \u0646\u0638\u0631\u0645 \u0631\u0648 \u062f\u0631\u06cc\u0627\u0641\u062a \u06a9\u0631\u062f\u0645\u200c. \u0627\u06cc\u0646 \u062a\u062d\u0645\u06cc\u0644 \u0628\u0647 \u0645\u0634\u062a\u0631\u06cc \u0634\u0627\u06cc\u0633\u062a\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0646\u06cc\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": [" \u0645\u0645\u0646\u0648\u0646 .\u0627\u06cc\u062f\u0647 \u062e\u0648\u0628\u06cc \u0628\u0648\u062f \u06a9\u0647 \u067e\u06cc\u06a9 \u06a9\u06cc\u06a9 \u0631\u0648 \u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f\u0647 \u0648 \u0628\u0647 \u0631\u0648\u06cc\u062a \u062e\u0631\u06cc\u062f\u0627\u0631 \u0628\u0631\u0633\u0648\u0646\u0647.\u062e\u0648\u062f \u06a9\u06cc\u06a9 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f! \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0627\u0639\u062a \u06f9:\u06f2\u06f0 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c \u0633\u0627\u0639\u062a \u06f1\u06f1:\u06f2\u06f0 \u0634\u0628(!!!!) \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.\n\u0648\u0627\u0642\u0639\u0627\u064b \u0645\u062a\u0627\u0633\u0641\u0645.", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0633\u0641\u0627\u0630\u0634 \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0627 \u0645\u0627\u0634\u06cc\u0646 \u0628\u0641\u0631\u0633\u062a\u06cc\u0646 \u062a\u0627 \u062a\u0648\u06cc \u062d\u0645\u0644 \u0628\u0627 \u0645\u0648\u062a\u0648\u0631 \u06a9\u06cc\u06a9 \u0647\u0627 \u062e\u0631\u0627\u0628 \u0646\u0634\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u06a9\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f \u062a\u0648 \u062c\u0639\u0628\u0647 \u0648 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f\n", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0645\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0648 \u0631\u0648\u0644\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0642\u0637\u0639\u0627 \u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0627\u0634\u0647 \u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0631\u0648\u0627\u062a \u0646\u0647 \u06a9\u0647 4 \u062a\u0627 \u062a\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0630\u0627\u0631\u0647 \u0628\u0639\u062f\u0645 \u0631\u0648\u0644\u062a \u0647\u0627\u06cc \u0627\u0636\u0627\u0641\u0647 \u0648 \u0628\u06cc\u062e\u0648\u062f\u0634 \u0631\u0648 \u0628\u0630\u0627\u0631\u0647 \u062a\u0648 \u062c\u0639\u0628\u0647 \u0628\u0641\u0631\u0633\u062a\u0646 \u0648\u0627\u0633\u0647 \u0645\u0646 \u062e\u06cc\u0644\u06cc \u0646\u0627\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0631\u0648\u0644\u062a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0627\u0635\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", -1]}
{"text": ["\u0645\u0646 \u06f2\u06f4 \u0639\u062f\u062f \u0645\u0648\u0633 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 . \u06f1\u06f2 \u062a\u0627 \u062f\u0648\u0646\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0648 \u06af\u0641\u062a\u0646\u062f \u062a\u0639\u062f\u0627\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062d\u062f\u0648\u062f\u06cc \u0627\u0633\u062a! \u062f\u0631 \u0648\u0627\u0642\u0639 \u062d\u062f\u0648\u062f\u0627 \u0646\u0635\u0641 \u0634\u062f\u0647 \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0645\u0648\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u06cc\u0646. \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u06cc\u0646. \u0645\u0646 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0631\u062f\u0645 \u06a9\u0631\u062c. \u062a\u0645\u0627\u0645 \u0631\u0627\u0647 \u0641\u06a9\u0631 \u0645\u06cc \u06a9\u0631\u062f\u0645 \u062d\u062a\u0645\u0627 \u06a9\u0646\u0627\u0631\u0647 \u0647\u0627\u0634 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647. \u0628\u0639\u062f \u06a9\u0647 \u062f\u06cc\u062f\u0645 \u0638\u0631\u0641 \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0627 \u0686\u0633\u0628 \u0641\u06cc\u06a9\u0633 \u06a9\u0631\u062f \u0628\u0648\u062f\u06cc\u0646 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0648 \u06a9\u06cc\u06a9 \u0633\u0627\u0644\u0645 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u06a9\u0644\u06cc \u0630\u0648\u0642 \u06a9\u0631\u062f\u0645. \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u062a\u0648\u0633\u0637(\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", "\u0634\u0645\u0639 \u0639\u062f\u062f 6", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631 \u062e\u0644\u0627\u0641 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0648\u062c\u0628 \u0646\u0627\u0631\u0627\u062d\u062a\u06cc \u06af\u0631\u062f\u06cc\u062f \u06af\u0648\u06cc\u0627 \u0627\u0632 \u0627\u0639\u062a\u0645\u0627\u062f \u0648 \u0627\u0639\u062a\u0628\u0627\u0631 \u062e\u0648\u062f \u0633\u0648\u0621 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0631\u062f\u0646\u062f \u0644\u0627\u0632\u0645 \u0627\u0633\u062a \u0645\u0631\u062f \u0628\u0631\u062e\u0648\u0631\u062f \u0627\u0633\u0646\u067e \u0642\u0631\u0627\u0631 \u06af\u06cc\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0647\u0632\u06cc\u0646\u0647 \u06cc \u062d\u0645\u0644 \u0627\u0632 \u0641\u0631\u0648\u0634\u06cc \u0647\u0627 \u0646\u0633\u0628\u062a \u0628\u0647 \u0631\u0633\u062a\u0648\u0631\u0627\u0646\u0627 \u0628\u0627\u0644\u0627\u062a\u0631\u0647\u060c \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u0645\u0639\u0645\u0648\u0644\u0627 \u0648\u0642\u062a\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645 \u0645\u06cc \u0631\u0633\u0647 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0628\u0632\u0631\u06af(\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u0627\u0648\u0644 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u06cc\u0647 \u062a\u0627\u062e\u06cc\u0631 \u06f2\u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0627\u06cc \u0648 \u06cc\u0647 \u062a\u0627\u062e\u06cc\u0631 \u06f1\u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a\u060c\u0628\u0627\u0642\u0644\u0648\u0627 \u0628\u0647 \u062c\u0631\u0627\u062a \u0645\u06cc\u06af\u0645 \u062e\u0645\u06cc\u0631 \u062e\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0647\u06cc\u0686 \u0645\u063a\u0632\u06cc \u062a\u0648\u0634 \u0646\u062f\u0627\u0634\u062a\u060c\u0632\u06cc\u0627\u062f\u06cc \u0628\u0631\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0631\u0648\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0628\u0648\u062f\u060c\u0634\u06cc\u0631\u0647 \u0627\u0634 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f \u060c\u062f\u0631 \u06a9\u0644 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645 \u0648 \u0628\u0647 \u06a9\u0633\u06cc \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0646\u0645\u06cc\u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u062a\u06cc\u062a\u0627\u0628\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["Awliii bod ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc 10 \u062f\u0642\u06cc\u0642\u0647 \u0642\u0628\u0644 \u0627\u0632 \u0627\u06cc\u0646 \u06a9\u0647 \u0628\u0631\u0633\u0647 \u0627\u0639\u0644\u0627\u0645 \u0631\u0633\u06cc\u062f\u0646 \u0628\u0631\u0627\u06cc \u0645\u0627 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u0627\u0634 \u0632\u06cc\u0631\u0634 \u0642\u06cc\u062f \u06a9\u0646\u06cc\u062f \u06a9 \u0628\u0627 \u0627\u062f\u0648\u06cc\u0647 \u0641\u0631\u0627\u0648\u0648\u0646 \u062f\u0631\u0633\u062a \u0645\u06cc\u0634\u0647 \u0645\u0646 \u0628\u0647 \u0627\u062f\u0648\u06cc\u0647 \u0622\u0644\u0631\u0698\u06cc \u062f\u0627\u0631\u0645 \u0633\u0631\u0641\u0647 \u0648 \u0646\u0641\u0633 \u062a\u0646\u06af\u06cc \u0645\u06cc\u06af\u06cc\u0631\u0645 .\u062f\u0627\u0631\u0686\u06cc\u0646 \u0648 \u0632\u0646\u062c\u0628\u06cc\u0644 \u062e\u0648\u0634\u0627\u06cc\u0646\u062f \u0647\u0631\u06a9\u0633 \u0646\u06cc\u0633\u062a.\u0645\u0646 \u0641\u06a9\u0631 \u06a9\u0631\u062f\u0645 \u0627\u0632\u0646\u0648\u0646\u0647\u0627\u06cc \u0645\u063a\u0632\u062f\u0627\u0631 \u0645\u0627\u0647 \u0631\u0645\u0636\u0648\u0646\u062a\u0648\u0646 \u0628\u0648\u062f \u0627\u06cc\u0646 \u0647\u0645\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645..\u0648\u06af\u0631\u0646\u0647 \u062f\u0642\u062a \u0645\u06cc\u06a9\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0627\u0647\u0631\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u0639\u062f\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u062a\u0648 \u062c\u0639\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0642\u06cc\u0641\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f \u0628\u0647 \u0646\u0638\u0631\u0645 \u0628\u0647\u062a\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0646\u062f\u0647 \u0646\u0641\u0631\u0633\u062a\u06cc\u062f \u062f\u0645 \u062f\u0631\u0628 \u062e\u0627\u0646\u0647 \u0647\u0627 \u0627\u0639\u062a\u0645\u0627\u062f \u0645\u0634\u062a\u0631\u06cc \u0648 \u0627\u0632 \u062f\u0633\u062a \u0645\u06cc\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u06cc\u0641\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u0628\u0627\u0642\u0644\u0648\u0627...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0641\u06cc\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648\u200c\u062e\u0648\u0628 \u0628\u0648\u062f", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0631\u0632 \u0633\u0641\u06cc\u062f", 1]}
{"text": ["\u0631\u0648\u0644 \u067e\u0627\u064a \u0633\u064a\u0628 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u062c\u0627\u064a \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a  \u0645\u0639\u0631\u0643\u0647 \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0642\u0646\u0627\u062f\u064a \u0639\u0627\u0644\u064a \u0646\u0627\u062a\u0644\u064a \u0648\u0644\u064a \u0645\u064a\u0643\u0627\u062f\u0648\u0647\u0627\u064a \u0628\u0647\u062a\u0631 \u0627\u0632 \u0627\u064a\u0646 \u0632\u064a\u0627\u062f \u062e\u0648\u0631\u062f\u0645 \u0648 \u062a\u0633\u062a\u0634\u0648 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u0646\u0627\u0646 \u0648\u06cc\u0641\u0631\u06cc \u0645\u06cc\u06a9\u0627\u062f\u0648 \u0648\u0627\u0627\u0627\u0642\u0639\u0627 \u0628\u0648\u06cc \u0645\u0627\u0646\u062f\u06af\u06cc \u0645\u06cc \u062f\u0627\u062f \u0648 \u0645\u062d\u062a\u0648\u06cc\u0627\u062a \u062f\u0627\u062e\u0644\u0634 \u0647\u0645 \u0628\u06cc \u0645\u0632\u0647 \u0648 \u0628\u0627 \u067e\u0648\u062f\u0631 \u0646\u0627\u0631\u06af\u06cc\u0644 \u0647\u0627\u06cc \u0633\u0641\u062a \u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0628\u0646\u0648\u06cc\u0633\u06cc\u062f \u062a\u0648\u0644\u062f\u062a \u0645\u0628\u0627\u0631\u06a9 \u0648\u0644\u06cc \u0646\u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646.\n\u0628\u0647 \u067e\u06cc\u06a9 \u06af\u0641\u062a\u06cc\u0645 \u0628\u0631\u06af\u0631\u062f\u0648\u0646\u06cc\u062f \u0628\u0646\u0648\u06cc\u0633\u0646 \u06af\u0641\u062a \u0645\u0646 \u0646\u0645\u06cc\u062a\u0648\u0646\u0645 \u0631\u0641\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u067e\u0648\u062f\u0631\u06cc (\u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u062d\u062f\u0648\u062f \u06cc\u06a9 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631 \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u200c.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0686\u06cc\u067e\u0633 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0631\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0628\u0627 \u0627\u06cc\u0646 \u06a9\u0647 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0645\u0647\u0645\u0648\u0646 \u062f\u0627\u0631\u0645 \u062e\u0648\u0627\u0647\u0634 \u06a9\u0631\u062f\u0645 \u0627\u06af\u0631 \u0645\u06cc\u0634\u0647 \u0632\u0648\u062f\u062a\u0631 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u0646\u062f \u0648\u0644\u06cc \u062e\u06cc\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0647 \u0628\u0627\u062f\u0648\u0645 \u0632\u0645\u06cc\u0646\u06cc", -1]}
{"text": ["\u0628\u06cc\u0634\u062a\u0631\u06cc\u0646 \u0639\u0644\u062a\u06cc \u06a9\u0647 \u0645\u0646 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0646\u0627\u062a\u0644\u06cc \u0631\u0648 \u062f\u0648\u0633 \u062f\u0627\u0634\u062a\u0645 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0634 \u0628\u0648\u062f\u0646 \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0648 \u062a\u0645\u0627\u0645 \u0633\u0627\u06cc\u0632\u0647\u0627 \u06a9\u06cc\u06a9 \u062f\u0627\u0634\u062a \u0648 \u062a\u0648\u0634\u0648\u0646 \u0645\u0648\u0632 \u0646\u0645\u06cc\u0632\u062f..\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0633\u0627\u06cc\u0632 \u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631 \u0627\u0632 \u0637\u0631\u06cc\u0642 \u0627\u0633\u0646\u067e \u0642\u0627\u0628\u0644 \u0633\u0641\u0627\u0631\u0634 \u0646\u06cc\u0633\u062a\u0646.\u0633\u0627\u06cc\u0632\u0634\u0648\u0646 \u0628\u0631\u0627\u06cc \u062e\u0627\u0646\u0648\u0627\u062f\u0647 \u0647\u0627\u06cc \u0627\u06a9\u062b\u0631\u0627 \u062f\u0648 \u0633\u0647 \u0646\u0641\u0631\u06cc \u062d\u0627\u0644 \u062d\u0627\u0636\u0631\u060c\u062e\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af\u0647 \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0647\u0631\u0686\u0646\u062f \u062e\u0648\u0634\u0628\u062e\u062a\u0627\u0646\u0647 \u0647\u0646\u0648\u0632\u0645 \u062a\u06a9\u0647 \u0647\u0627\u06cc \u0645\u0648\u0632 \u0646\u0645\u06cc\u0632\u0646\u0647 \u062a\u0648 \u06a9\u06cc\u06a9 \u0647\u0627\u0634 \u0648\u0644\u06cc \u062a\u0648 \u0645\u0627\u06cc\u0647 \u0627\u06cc \u06a9\u0647 \u0644\u0627\u0628\u0647 \u0644\u0627\u06cc \u0628\u0631\u0634 \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0645\u06cc\u0632\u0646\u0646 \u06cc\u0647 \u0686\u06cc\u0632 \u0645\u0648\u0632\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647.\u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u06cc\u0647 \u0627\u0645\u0627 \u0647\u0645\u0648\u0646 \u06a9\u0627\u0641\u06cc\u0647 \u06a9\u0647 \u06a9\u0633\u0627\u06cc\u06cc\u06a9\u0647 \u0645\u062b\u0644 \u0645\u0646 \u0628\u0647 \u0645\u0648\u0632 \u062d\u0633\u0627\u0633\u06cc\u062a \u062f\u0627\u0631\u0646 \u0646\u062a\u0648\u0646\u0646 \u0628\u062e\u0648\u0631\u0646\u0634.\u0648\u0627\u0642\u0639\u0627 \u062d\u06cc\u0641 \u0686\u0648\u0646 \u0628\u0634\u062e\u0635\u0647 \u0627\u0632 \u0645\u0634\u062a\u0631\u06cc \u0647\u0627\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0646\u0627\u062a\u0644\u06cc \u067e\u0627\u0633\u062f\u0627\u0631\u0627\u0646 \u0648 \u0647\u0631\u0648\u06cc \u0628\u0648\u062f\u0645 \u0648 \u0647\u0641\u062a\u0647 \u0627\u06cc \u062f\u0648 \u062a\u0627 \u06a9\u06cc\u06a9 \u062a\u0648\u0644\u062f \u0645\u06cc\u06af\u0631\u0641\u062a\u0645.\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9\u06cc\u06a9 \u0647\u0627 \u062f\u0631 \u0633\u0627\u06cc\u0632 \u06a9\u0648\u0686\u06cc\u06a9 \u0647\u0645 \u0645\u0648\u062c\u0648\u062f \u0634\u0646 \u0648 \u0645\u0648\u0632\u060c\u0627\u0633\u0627\u0646\u0633 \u0645\u0648\u0632 \u06cc\u0627 \u0647\u0631\u0686\u06cc\u0632 \u0645\u0648\u0632\u06cc \u062f\u06cc\u06af\u0647 \u062a\u0648\u0634\u0648\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0634\u0647 \u06cc\u0627 \u0627\u06af\u0631\u0645 \u0645\u06cc\u0634\u0647 \u062a\u0648 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0630\u06a9\u0631 \u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc \u0642\u0646\u0627\u062f\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0648 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0646 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645  \u0648\u0644\u06cc  \u0628\u0647 \u0647\u06cc\u0686 \u0648\u062c\u0647 \u0645\u0632\u0647 \u0646\u0648\u062a\u0644\u0627 \u0646\u0645\u06cc \u062f\u0627\u062f \u0648 \u06a9\u06cc\u06a9 \u06a9\u0644\u0627 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0647\u0645\u0627\u0646\u0637\u0648\u0631 \u06a9\u0647 \u0627\u0632 \u0627\u0633\u0645\u0634 \u067e\u06cc\u062f\u0627\u0633 \u0628\u0627\u06cc\u062f \u0634\u06a9\u0644 \u0632\u0628\u0627\u0646 \u0628\u0627\u0634\u062f \u0648\u0644\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0628\u0648\u062f.\u0631\u0648\u06cc\u0634 \u0647\u0645 \u06cc\u062c\u0648\u0631 \u0645\u0631\u0628\u0627 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 .\u0628\u0647\u062a\u0631\u0628\u0648\u062f \u0631\u0648\u06cc \u0642\u0633\u0645\u062a \u0628\u0631\u0634\u062a\u0647 \u0627\u0634 \u0686\u06cc\u0632\u06cc \u0646\u0645\u0627\u0644\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0631\u0648\u0644\u062a\u0647\u0627 \u0634\u06a9\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628\u06cc \u062f\u0627\u0634\u062a\u0646\u062f. \u0645\u0646 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646 \u0645\u06cc\u062e\u0648\u0627\u0647\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u06af\u0641\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u06cc\u06a9\u200c\u0647\u0627 \u062a\u0627\u0632\u0647 \u0647\u0633\u062a\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a \u0633\u0641\u06cc\u062f \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": [" \u062f\u0631 \u062d\u064a\u0643 \u0643\u0644\u0627\u0645 \u0647\u0645\u0647 \u0686\u064a \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u067e\u0648\u062f\u0631 \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", "\u06a9\u06cc\u06a9 \u0627\u062a\u0631\u06cc\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0641\u0642\u0637 \u0632\u06cc\u0627\u062f \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u0631\u0627\u0628\u06cc\u0647 (\u0628\u0627\u062f\u0627\u0645\u06cc) \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u06af\u06cc \u0645\u0637\u0644\u0648\u0628 \u0647\u0645\u06cc\u0634\u06af\u06cc \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u060c \u06af\u0631\u0645 \u0628\u0648\u062f \u0648 \u062f\u0631 \u0627\u062b\u0631 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0622\u0633\u06cc\u0628 \u06a9\u0648\u0686\u06cc\u06a9\u06cc \u062f\u06cc\u062f\u0647 \u0628\u0648\u062f.\n\u0645\u062a\u0623\u0633\u0641\u0645 \u0648 \u062f\u06cc\u06af\u0647 \u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u06a9\u06cc\u06a9 \u0646\u0645\u06cc\u062e\u0631\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", "\u0634\u0645\u0639 \u0639\u062f\u062f 7", -1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0648\u06cc\u0698\u0647 \u0627\u0632 \u0628\u0686\u0647 \u0647\u0627\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0627\u0628\u062a \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0639\u0627\u0644\u06cc. \u06a9\u0627\u0631\u062a\u0648\u0646 \u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u0628\u0632\u0631\u06af", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u06cc\u0639\u0646\u06cc \u06cc\u0647 \u0628\u0627\u0631 \u0646\u0634\u062f \u0645\u0648\u062c\u0648\u062f\u06cc \u0646\u0627\u0646 \u0633\u062d\u0631 \u062a\u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062f\u0631\u0633\u062a \u0628\u0627\u0634\u0647. \u0647\u0631\u0628\u0627\u0631 \u0628\u0639\u062f \u0627\u0632 \u062b\u0628\u062a \u0633\u0641\u0627\u0631\u0634 \u0632\u0646\u06af \u0645\u06cc\u0632\u0646\u0646 \u0645\u06cc\u06af\u0646 \u0627\u06cc\u0646\u0648\u200c \u0646\u062f\u0627\u0631\u06cc\u0645\u060c \u0627\u0648\u0646\u0648 \u0646\u062f\u0627\u0631\u06cc\u0645. \u062e\u0628 \u0634\u0645\u0627 \u06a9\u0647 \u0646\u062f\u0627\u0631\u06cc \u06cc\u0647 \u0686\u06cc\u0632\u06cc \u0631\u0648 \u06af\u0632\u06cc\u0646\u0647 \u062a\u0645\u0627\u0645 \u0634\u062f \u0631\u0648 \u0628\u0632\u0646 \u06a9\u0647 \u0645\u0646 \u0646\u0631\u0645 \u0627\u0644\u06a9\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u0645 \u0648 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0645. \u0627\u0632 \u0627\u0648\u0646 \u0628\u062f\u062a\u0631 \u0627\u06cc\u0646\u0647 \u06a9\u0647 \u0648\u0642\u062a\u06cc \u0645\u06cc\u062e\u0648\u0627\u0646 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u06a9\u0646\u0646 \u0628\u0627 \u06cc\u0647 \u062a\u0639\u062f\u0627\u062f \u0627\u0633\u0645 \u0639\u062c\u06cc\u0628 \u063a\u0631\u06cc\u0628 \u0637\u0631\u0641\u06cc \u06a9\u0647 \u0628\u0627\u06cc\u062f \u0633\u0631\u06cc\u0639 \u067e\u0627\u06cc \u062a\u0644\u0641\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc. \u0644\u0637\u0641\u0627 \u0648\u0642\u062a\u06cc \u0686\u06cc\u0632\u06cc \u0631\u0648 \u0646\u062f\u0627\u0631\u06cc \u0646\u0627\u0646 \u0633\u062d\u0631 \u0639\u0632\u06cc\u0632\u060c \u062a\u0645\u0627\u0645 \u0634\u062f\u0646\u0634 \u0631\u0648 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0646. \u0647\u0645\u0686\u0646\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0639\u0636\u06cc \u0686\u06cc\u0632\u0627 \u0645\u062b\u0644 \u06af\u0627\u062a\u0627 \u06cc\u0627 \u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 \u0648\u0627\u0642\u0639\u0627 \u067e\u0627\u06cc\u06cc\u0646 \u0627\u0648\u0645\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062a\u0633\u062a \u0631\u0648\u06af\u0646\u0627", "\u0686\u0627\u0631\u06a9\u06cc \u0686\u0627\u0648\u062f\u0627\u0631", "\u06af\u0627\u062a\u0627", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u06cc\u062a\u0632\u0627\u06cc\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0627\u0631\u062a \u0647\u0627 \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f\u0646 \u062e\u06cc\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0645 .\u0648\u0642\u062a\u06cc \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u062e\u06cc\u0644\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0646\u0627\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 12 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0631 \u062f\u0648 \u0645\u0648\u0631\u062f \u0628\u0647 \u0646\u0633\u0628\u062a \u0642\u06cc\u0645\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u06a9\u062b\u0631 \u0646\u0648\u0646\u200c\u0647\u0627 \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f...\u06af\u0627\u062a\u0627 \u0647\u0645 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06af\u0627\u062a\u0627 \u0631\u0648\u0644\u062a\u06cc", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", "\u0646\u0627\u0646 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0632\u06cc\u0627\u062f \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u062a\u0627 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u062a\u0627\u0632\u0647 \u0648 \u0646\u0631\u0645 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0633\u0645\u0628\u0648\u0633\u0647 \u0627\u06cc\u0646 \u0634\u0639\u0628\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc\u0647.\n\u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0645\u0648\u062f\u0628 \u0648 \u0633\u0631 \u0648\u0642\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0648 \u0631\u062f\u06cc\u0641 \u0627\u0632 \u062c\u0639\u0628\u0647 \u0631\u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0634\u06a9 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u0628\u0647 \u062c\u0627\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc\n(\u0648 \u06cc\u0647 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0647\u0645 \u062f\u0627\u0631\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u06af\u0631 \u0627\u0645\u06a9\u0627\u0646\u0634 \u0647\u0633\u062a \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0622\u067e\u0634\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u0632\u0627\u0631\u06cc\u062f \u0645\u062b\u0644\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0631\u0648 \u062e\u0648\u062f\u0645\u0648\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u0645 \u0627\u0632 \u0686\u0647 \u0645\u062f\u0644 \u0647\u0627\u06cc\u06cc \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0634\u0647)\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u06cc\u062a\u0632\u0627\u06cc\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc... \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627\n\n\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0645\u06a9", 1]}
{"text": ["\u0628\u06cc\u0634\u062a\u0631 \u0634\u0628\u06cc\u0647 \u06cc\u0647 \u0646\u0648\u0646 \u0628\u06cc \u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u06a9\u0631\u0645 \u0631\u0648 \u0628\u0647 \u0635\u0648\u0631\u062a \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0645\u062d\u0633\u0648\u0633 \u0627\u0632 \u06a9\u0646\u0627\u0631\u0634 \u0631\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0627\u0635\u0644\u0627 \u0645\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646 \u0646\u062f\u0627\u0634\u062a \u0627\u0646\u06af\u0627\u0631 \u0646\u0648\u0646 \u0648 \u06af\u0631\u062f\u0648 \u0645\u06cc\u062e\u0648\u0631\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 14 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u06a9\u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0634\u06a9\u0644\u0634\u0627\u0646 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u0634\u062e\u0635 \u0646\u0628\u0648\u062f \u06a9\u0647 \u0633\u0627\u06cc\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u06cc\u0646\u0642\u062f\u0631 \u06a9\u0648\u0686\u06a9 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0628\u0631\u0627\u0646\u06cc \u067e\u06cc\u0646\u0627\u062a \u0628\u0627\u062a\u0631 \u0628\u0634\u062f\u062a \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0631\u0648\u063a\u0646 \u0628\u0647\u0634 \u063a\u0627\u0644\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", 1]}
{"text": ["\u0637\u0628\u0642 \u0645\u0639\u0645\u0648\u0644 \u062c\u0639\u0628\u0647 \u06cc\u0627 \u0627\u0632 \u062f\u0633\u062a \u067e\u06cc\u06a9 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u06cc\u0627 \u0632\u06cc\u0627\u062f\u06cc \u06a9\u062c\u200c\u0634\u062f\u0647 \u0628\u0648\u062f \u060c \u062f\u0648\u062a\u0627 \u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u0627 \u0647\u0645 \u0642\u0627\u0637\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0631\u0648\u06cc \u0647\u0645\u062f\u06cc\u06af\u0647\n\u0628\u0646\u0638\u0631\u0645 \u0628\u0639\u062f \u0627\u06cc\u0646\u0647\u0645\u0647 \u0648\u0642\u062a \u0641\u0639\u0627\u0644\u06cc\u062a \u0628\u0627\u06cc\u062f \u06cc\u0647 \u0641\u06a9\u0631\u06cc \u0628\u0631\u0627\u06cc \u062a\u062d\u0648\u06cc\u0644 \u06a9\u06cc\u06a9\u0647\u0627 \u0628\u06a9\u0646\u06cc\u062f \n\u0648\u0627\u0642\u0639\u0627 \u0628\u0627\u0631 \u067e\u0646\u062c\u0645\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\n\u0646\u0642\u0637\u0647 \u0636\u0639\u0641 \u0628\u0632\u0631\u06af\u06cc\u0647 \u0628\u0631\u0627\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0627\u064a\u0646 \u067e\u0627\u0649 \u0633\u064a\u0628 \u062a\u0643\u0647 \u0627\u0649 \u0627\u0632 \u0628\u0647\u0634\u062a\u0647 \u060c \u0628\u0649 \u0646\u0638\u064a\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u062a\u0631 \u0627\u0632 \u0627\u0646\u062a\u0638\u0627\u0631 \u0628\u0648\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0628\u0627\u0631\u06cc\u06a9\u0644\u0627 \u06a9\u0647 \u062a\u0648\u0648 \u0627\u06cc\u0646 \u0627\u0648\u0636\u0627\u0639 \u06a9\u06cc\u0641\u06cc\u062a\u062a\u0648\u0646 \u062f\u0633\u062a\u062e\u0648\u0634 \u062a\u063a\u06cc\u06cc\u0631 \u0646\u0634\u062f\u0647 \u0648 \u0647\u0646\u0648\u0632 \u0645\u062a\u0631\u06cc\u0627\u0644 \u0645\u0631\u063a\u0648\u0628 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u06a9\u0646\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0643\u064a\u0641\u064a\u062a \u0634\u064a\u0631\u064a\u0646\u064a \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648\u0628\u0647 \u0646\u0638\u0631\u0645  \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0627\u0632 \u0647\u0631 \u0646\u0638\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f .\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0647\u0645\u0634 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639....\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0627\u062e\u0644\u0627\u0642 \u0628\u0648\u062f \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u0647\u0645 \u0645\u0634\u06a9\u0644\u06cc \u0646\u062f\u0627\u0634\u062a \u062e\u0648\u0628 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u0627\u0648\u0644 \u0634\u06a9\u200c\u062f\u0627\u0634\u062a\u0645 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0645 \u0627\u0645\u0627 \u0627\u0644\u0627\u0646 \u0631\u0627\u0636\u06cc \u0648\u200c\u062e\u0648\u0634\u062d\u0627\u0644\u0645\n\u0646\u0648\u0646 \u062a\u0631\u062f \u0648 \u062e\u0648\u0628 \u0648\u200c\u062e\u0648\u0634\u0645\u0632\u0647\n\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645.. \u0645\u0646 \u0628\u0631\u0627\u06cc \u0645\u062f\u06cc\u0631 \u0639\u0627\u0645\u0644 \u0634\u0631\u06a9\u062a \u06a9\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0641\u0627\u0635\u0644\u0647 \u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0634\u06a9\u0631 \u062a\u0627 \u0634\u0631\u06a9\u062a \u0646\u0628\u0648\u062f\u0647.. \u06a9\u06cc\u06a9 \u0644\u0647 \u062f\u0627\u063a\u0648\u0646 \u0628\u0647 \u0647\u0645\u0647 \u06cc \u062c\u0627\u06cc \u0628\u0627\u06a9\u0633 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u0648\u0627\u0642\u0639\u0627 \u0646\u0627\u0631\u0627\u062d\u062a \u06a9\u0646\u0646\u062f\u0647 \u0648 \u062e\u062c\u0627\u0644\u062a \u0627\u0648\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u06af\u0644\u0627\u0628\u06cc \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0633\u0641\u06cc\u062f", -1]}
{"text": ["\u0639\u0627\u0644\u064a \u0639\u0627\u0644\u064a \u062a\u0627\u0632\u0647\u060c \u0645\u0631\u0633\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0633\u062a\u0646\u06cc \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u0646\u06cc\u0634\u06a9\u0631 \u062a\u0646\u0647\u0627 \u0642\u0646\u0627\u062f\u06cc \u0647\u0633\u062a \u06a9\u0647 \u0645\u06cc\u0634\u0647 \u06a9\u06cc\u06a9 \u0647\u0627\u0634 \u0631\u0648 \u062a\u0648 \u0633\u0647 \u0633\u0627\u06cc\u0632 \u0645\u062e\u062a\u0644\u0641 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f \u0648 \u0633\u0627\u06cc\u0632 \u06a9\u0648\u0686\u06cc\u06a9 \u0647\u0645 \u062f\u0627\u0631\u0647 \u06a9\u0647 \u0627\u06cc\u0646 \u0639\u0627\u0627\u0644\u06cc\u0647\u0647\u060c \u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f(\u0641\u0642\u0637 \u06af\u0644\u0647\u0627\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u062c\u0644\u0648\u0634 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646)\u060c\u062f\u0631\u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u062a\u0648\u0633\u0637(\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u062f\u0631 \u062c\u0639\u0628\u0647 \u0686\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644\u06cc\u062a \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646 \u0631\u0627 \u0646\u062f\u0627\u0634\u062a\u0646\u062f . \u0645\u0637\u0645\u0626\u0646\u0627 \u0622\u062e\u0631\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0648\u062f \u0628\u0647\u062a\u0648\u0646 \u0627\u0639\u062a\u0645\u0627\u062f \u06a9\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0645\u06cc\u0648\u0647 \u06a9\u0631\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0645\u06cc\u0648\u0647 \u06a9\u0631\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", "\u0645\u062e\u0644\u0648\u0637 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0628\u0647 \u062e\u0648\u0628\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0648 \u062a\u0627\u0631\u062a \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644\u0634 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u060c\u0644\u0637\u0641\u0627 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u0628\u06cc\u0634\u062a\u0631 \u062f\u0642\u062a \u06a9\u0646\u0646\u062f\u060c\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["aal\u0131 bud", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u062f\u0631 \u0645\u062d\u0644 \u06a9\u0627\u0631 \u062a\u0648\u0632\u06cc\u0639 \u0628\u0634\u0646 \u0628\u0639\u062f \u0627\u0632 \u062a\u0648\u0632\u06cc\u0639 \u0645\u0634\u062e\u0635 \u0634\u062f \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06a9\u0647\u0646\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f\u0646 \u0648 \u0645\u0648\u062c\u0628 \u0622\u0628\u0631\u0648\u0631\u06cc\u0632\u06cc \u0634\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062a\u062e\u0645\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u0686\u0647 \u062e\u0648\u0628\u0647 \u0627\u0646\u0642\u062f\u0631 \u0631\u0627\u062d\u062a \u0645\u064a\u0634\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0647 \u062f\u0648\u0633\u062a \u062f\u0627\u0631\u064a \u0628\u06af\u064a\u0631\u064a. \u0641\u0642\u0637 \u0645\u064a\u0648\u0647 \u0631\u0648\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0648 \u062d\u0631\u0643\u062a \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u0648\u0644\u062a\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u0632\u0647 \u0648 \u0698\u0644\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u06cc\u0641\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0698\u0644\u0647", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0633\u0641\u0627\u0631\u0634\u06cc \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0646\u0634\u062f\u0647 \u06a9\u0647 \u0632\u062f\u06cc\u0646 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u0646\u0641\u0631\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0646 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u0646\u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645.\u0648\u0627\u0642\u0639\u0627 \u0627\u06cc\u0646\u0642\u062f \u062a\u0634\u062e\u06cc\u0635\u0634 \u0633\u062e\u062a\u0647\u061f\u061f\u061f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u062f\u0633\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645.\u0641\u0642\u0637 \u0644\u0627\u06cc \u0646\u0648\u0646 \u0627\u0641\u0637\u0627\u0631\u06cc \u0645\u063a\u0632\u062f\u0627\u0631 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645 \u0641\u0642\u0637 \u067e\u0646\u06cc\u0631 \u0628\u0627\u0634\u0647 \u0646\u0647 \u062e\u0631\u0645\u0627...\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0646 \u0646\u0645\u06cc\u0686\u0633\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0648\u0646 \u0627\u0641\u0637\u0627\u0631\u06cc \u0645\u063a\u0632\u062f\u0627\u0631 \u0647\u0631 \u0639\u062f\u062f", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u062f\u0627\u0626\u0645 \u0634\u0645\u0627 \u0647\u0633\u062a\u0645 \u0648 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0627\u0634\u062f \u0631\u0648 \u0627\u0632 \u0645\u062c\u0645\u0648\u0639\u0647 \u0634\u0645\u0627 \u0646\u062f\u0627\u0634\u062a\u0645 \u0628\u0627\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0622\u0644\u0645\u0627\u0646\u06cc \u067e\u0633\u062a\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0632\u0648\u0644\u0648\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0627\u06cc \u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u062e\u06cc\u0644\u06cc \u0645\u0627\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0628\u0639\u06cc\u062f \u06a9\u0647 \u062f\u0631 \u067e\u0648\u0634\u0634 \u062a\u062e\u0641\u06cc\u0641 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0631\u0648 \u0628\u0647 \u062f\u0633\u062a \u0645\u0634\u062a\u0631\u06cc \u0647\u0627 \u0645\u06cc \u0631\u0633\u0648\u0646\u0647.\n\u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u0627\u06cc\u0646\u062c\u0648\u0631 \u06a9\u0627\u0633\u0628\u06cc \u06a9\u0631\u062f\u0646 \u0628\u0627\u0628 \u0634\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0643\u064a\u0643 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0646\u0631\u0633\u064a\u062f \u0627\u0632 \u0647\u0645 \u067e\u0627\u0634\u064a\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u06cc\u062a \u06a9\u062a", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0641\u0642\u0637 \u0628\u0647\u062a\u0631\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u062d\u0633\u0627\u0633 \u0628\u0648\u062f\u0646 \u06a9\u06cc\u06a9 \u0627\u0632 \u062f\u0642\u062a \u0628\u0627\u0644\u0627\u062a\u0631\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u0648\u062f \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0647\u0627\u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062a\u0645\u0627\u0645 \u062f\u06cc\u0632\u0627\u06cc\u0646 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u067e\u0648\u062f\u0631\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f .\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u067e\u0648\u062f\u0631\u06cc (\u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632  \u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u0648 \u0645\u062e\u0635\u0648\u0635\u0627 \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06af\u0631\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u062e\u06cc\u0644\u06cc !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u06cc\u0641\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062a\u06cc\u062a\u0627\u0628\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u062a\u0627\u0628\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0645\u0646\u0627\u0633\u0628 \u0637\u0628\u0642 \u0633\u0641\u0627\u0631\u0634\n\u062a\u0627\u0632\u0647\n\u062a\u062d\u0648\u06cc\u0644 \u0633\u0631\u06cc\u0639\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u067e\u06cc \u062a\u0645\u0634\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627\u062f\u0627\u0645 \u06a9\u0627\u0645\u0644\u0627 \u06a9\u0647\u0646\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f . \u0636\u0645\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u067e\u06cc\u06a9 \u0628\u0627 25 \u062f\u0642\u06cc\u0642\u0647 \u062a\u0627\u062e\u06cc\u0631 \u0627\u0632 \u062a\u0627\u06cc\u0645 \u0645\u0634\u062e\u0635 \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u0627\u0645 \u0622\u0645\u0631\u06cc\u06a9\u0627\u06cc\u06cc \u062e\u0627\u0645 250 \u06af\u0631\u0645", -1]}
{"text": ["\u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u064a \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u064a\u0627\u062a \u0648 \u0643\u064a\u0641\u064a\u062a \u0628\u0633\u064a\u0627\u0631 \u067e\u0627\u064a\u064a\u0646\n\u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u0646\u0627\u062a\u0644\u064a \u062a\u0648\u0642\u0639 \u0627\u064a\u0646 \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u0645\n\u0622\u0628\u0631\u0648\u0645 \u062c\u0644\u0648\u064a \u0645\u0647\u0645\u0648\u0646 \u0647\u0627\u0645 \u0631\u0641\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\u062a\u0646\u0647\u0627 \u0627\u0634\u06a9\u0627\u0644 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062a\u0648\u0646 \u0627\u06cc\u0646\u0647 \u06a9\u0647 \u0646\u0648\u0646\u0634 \u0646\u0631\u0645\u0647 .\u0627\u06af\u0631 \u0646\u0648\u0646 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u0631\u0645 \u0646\u0628\u0627\u0634\u0647 \u0644\u0630\u06cc\u0630\u062a\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f(\u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631) \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u067e\u0627\u064a \u0633\u064a\u0628\u064a \u0643\u0647 \u0633\u064a\u0628 \u0646\u062f\u0627\u0634\u062a:", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0627\u0646\u062a\u0638\u0627\u0631 \u0645\u06cc\u0631\u0641\u062a \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u062e\u062a\u200c\u0650\u0631\u0648\u0632 \u0628\u0641\u0631\u0633\u062a\u0646\u062f \u0648 \u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0646\u062f\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0630\u06a9\u0631\u06a9\u0646\u06cc\u062f \u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0648\u062f \u0646 \u0633\u0627\u062f\u0647 \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \n\u062f\u0631 \u06a9\u0644 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0627\u0648\u0644 \u0627\u06cc\u0646 \u06a9\u0647 \u0628\u0627 \u0645\u0646 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06a9\u0647 \u0646\u062f\u0627\u0631\u0646 \u0627\u0648\u0646 \u06a9\u06cc\u06a9 \u0648 \u0628\u0627 \u0627\u0648\u0646 \u062d\u062c\u0645 \u0628\u062f\u0645 \u06af\u0641\u062a\u0646 \u0645\u062f\u0644 \u062f\u06cc\u06af\u0647 \u0645\u06cc\u0641\u0631\u0633\u062a\u0646 \u0645\u0646 \u06af\u0641\u062a\u0645 \u0628\u0627\u0634\u0647 \u067e\u0633 \u0627\u06af\u0639 \u0631\u062f\u0648\u0644 \u0648\u062a \u062f\u0627\u0631\u06cc\u062f \u0628\u0641\u0631\u0633\u062a\u06cc\u062f \u0627\u06af\u0647 \u0646\u0647 \u0647\u0645\u0648\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0641\u0631\u0633\u062a\u06cc\u062f \u062f\u0631 \u0622\u062e\u0631\u0645 \u06cc\u0647 \u06a9\u06cc\u06a9 \u0641\u0642\u0637 \u0645\u062d\u0636 \u0627\u06cc\u0646 \u06a9\u0647 \u0642\u0631\u0645\u0632 \u0628\u0648\u062f \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u06a9\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0631 \u062e\u0631\u062f\u0647 \u0628\u0648\u062f \u0627\u0632 \u0631\u0648 \u0638\u0631\u0641\u0634 \u0648 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062c\u0639\u0628\u0647 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u06cc\u0646\u06cc (\u062d\u062f\u0648\u062f 1 \u06a9\u06cc\u0644\u0648\u060c 5 \u0646\u0641\u0631\u0647)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0628\u0647  \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \n\u062e\u0627\u0645\u0647 \u0627\u0634 \u0645\u062b \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0635\u0646 \u0686\u0631\u0628 \u0646\u0628\u0648\u062f\n\u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0647\u0645\u0648\u0646 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0645\u062a\u0623\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0622\u0633\u06cc\u0628 \u062f\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0628\u062f\u0646\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u06cc\u06a9 \u0633\u0645\u062a \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u062a\u0639\u062f\u0627\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u06af\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0686\u0646\u062f\u062a\u0627\u0634\u0648\u0646\u0645 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0646\u062f \u0648 \u062e\u0627\u0645\u0647 \u0647\u0627\u0634\u0648\u0646 \u0627\u0632 \u0628\u06cc\u0646 \u0631\u0641\u062a.\n\u0631\u0648\u06cc \u0627\u06cc\u0646 \u0645\u0648\u0636\u0648\u0639 \u062a\u0627\u06a9\u06cc\u062f \u062f\u0627\u0634\u062a\u0645.\n\u0628\u0627 \u0627\u062d\u062a\u0631\u0627\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0627\u0648\u0646\u0642\u062f\u0631 \u0643\u0647\u0646\u0647 \u0648 \u0628\u064a\u0627\u062a \u0628\u0648\u062f \u0643\u0647 \u0627\u0646\u062f\u0627\u062e\u062a\u0645\u0634 \u062f\u0648\u0631 \u0647\u0645\u0648\u0646 \u0645\u0648\u0642\u0639\n\u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", -1]}
{"text": ["\u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0645\u0645\u0646\u0648\u0646\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0686\u0646\u062f \u0633\u0627\u0644\u0647 \u06a9\u0647 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0633\u062d\u0631 \u0631\u0627 \u0627\u0632 \u0634\u0639\u0628\u0647 \u0647\u0627\u06cc \u0645\u062e\u062a\u0644\u0641 \u062a\u0647\u06cc\u0647 \u0645\u06cc \u06a9\u0646\u0645 \u0648 \u0644\u0630\u062a \u0645\u06cc \u0628\u0631\u0645. \u0627\u0644\u0622\u0646 \u0647\u0645 \u0647\u0645\u0627\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0631\u0627 \u062f\u0627\u0631\u062f. \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0646 \u0627\u0641\u0632\u0627\u06cc\u0634 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0647 \u06a9\u0647 \u0628\u0627\u0639\u062b \u0634\u062f\u0647 \u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u062a\u062d\u062a \u062a\u0627\u062b\u06cc\u0631 \u0642\u0631\u0627\u0631 \u0628\u06af\u06cc\u0631\u062f. \u062e\u0648\u0627\u0647\u0634\u0645\u0646\u062f\u0645 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0641\u0631\u0645\u0627\u06cc\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0627\u0635\u0644\u0647 \u0634\u0631\u06a9\u062a \u062a\u0627 \u0646\u0627\u0646 \u0633\u062d\u0631 \u06f5 \u06a9\u0648\u0686\u0647 \u0627\u0633\u062a.\u06cc\u06a9 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631 \u062f\u0631 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644.\n\u0627\u0633 \u0627\u0645 \u0627\u0633  \u0627\u0633\u0646\u067e \u0627\u06a9\u067e\u0631\u0633 \u0622\u0645\u062f \u06a9\u0647 \u063a\u0630\u0627\u06cc \u0634\u0645\u0627 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f\u0647 \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u06cc\u06a9 \u0631\u0628\u0639 \u0628\u0639\u062f \u067e\u06cc\u06a9 \u063a\u0630\u0627 \u0631\u0627 \u0622\u0648\u0631\u062f \u062a\u0627 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 \u0628\u06cc\u0634 \u0627\u0632 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0646\u0634\u0648\u062f....!!!\u061f\u061f\n\u0645\u0631\u063a \u0647\u0645 \u0628\u0648\u062f \u0645\u0627\u0646\u062f\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u0648\u0642\u0644\u0645\u0648\u0646 \u062f\u0648\u062f\u06cc", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0645\u0631\u063a", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0627\u06cc\u06cc\u0646 \u0627\u0648\u0645\u062f\u0647 \u0646\u0633\u0628\u062a \u0628\u0647 \u062f\u0641\u0639\u0627\u062a \u0627\u0648\u0644\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0645\u06cc \u062a\u0648\u0646\u0645 \u0628\u06af\u0645 \u0647\u0631\u0628\u0627\u0631 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u062a\u0631 \u0645\u06cc\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\u0627\u06cc\u0646 \u0628\u0627\u0631 \u0686\u0646\u062f\u0645 \u0647\u0633\u062a\u0634 \u06a9\u0647 \u0645\u0646 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0633\u0641\u0627\u0631\u0634 \u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648 \u0645\u06cc\u062f\u0647\u0645 \u0648 \u06cc\u06a9 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0631 \u0628\u0631\u0627\u06cc\u0645 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u0634\u0648\u062f.\u0644\u0637\u0641\u0627 \u067e\u06cc\u06a9 \u0631\u0627 \u0628\u0631\u06af\u0631\u062f\u0648\u0646\u06cc\u062f \u0648 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u067e\u0633 \u0628\u06af\u06cc\u0631\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0647\u0645\u0647 \u0646\u0648\u0646\u0647\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \n\u0648\u0642\u062a\u06cc \u063a\u06cc\u0631 \u062d\u0636\u0648\u0631\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc \u062f\u0647\u06cc\u0645 \u0645\u0648\u0638\u0641 \u0628\u0627\u0634\u06cc\u062f \u06a9\u0647 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0641\u0631\u0633\u062a\u06cc\u062f \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0648\u0646\u062f\u0647 \u0647\u0627 \u0631\u0648 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", "\u0647\u0645\u0628\u0631\u06af\u0631\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0644\u0642\u0645\u0647 \u0622\u0644\u0645\u0627\u0646\u06cc \u0633\u0641\u06cc\u062f", -1]}
{"text": ["\u06af\u0631\u0645 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u06a9\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u0631\u0648 \u0646\u067e\u0633\u0646\u062f\u06cc\u062f\u0645\u060c \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u06cc\u062f \u0622\u0628 \u0634\u062f\u0647 \u0648 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u062f\u0631\u0633\u062a\u0647 \u06a9\u0647 \u0647\u0648\u0627 \u06af\u0631\u0645\u0647 \u0627\u0645\u0627 \u0647\u0645\u06cc\u0646 \u0628\u0627\u06cc\u062f \u062f\u0644\u06cc\u0644\u06cc \u0628\u0634\u0647 \u06a9\u0647 \u067e\u06cc\u06a9 \u0628\u06cc\u0634\u062a\u0631 \u062f\u0642\u062a \u06a9\u0646\u0647\u060c \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u0646\u0635\u0641 \u0645\u0648\u0633 \u0631\u0648 \u0627\u0632 \u062f\u0631 \u0648 \u062f\u06cc\u0648\u0627\u0631 \u062c\u0639\u0628\u0647 \u0628\u0627 \u0642\u0627\u0634\u0642 \u067e\u0627\u06a9 \u06a9\u0646\u0645\u060c \u0648 \u06a9\u0644\u06cc \u062c\u0644\u0648 \u0645\u0647\u0645\u0648\u0646\u0645\u0648\u0646 \u062e\u062c\u0627\u0644\u062a \u06a9\u0634\u06cc\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f...\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u0638\u0627\u0647\u0631\u0627 \u0686\u067e \u0634\u062f\u0647 \u0648 \u0686\u06cc\u0632\u06cc \u0627\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u062f\u06cc\u062f\u0647 \u0646\u0645\u06cc\u0634\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0639\u0627\u0627\u0627\u0644\u0649 \u0628\u0648\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f .\n\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0647\u0641\u062a", "\u0634\u0645\u0639 \u062f\u0648", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062a\u064a\u0645 \u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633 \u0622\u0641\u0631\u064a\u0646 \u062f\u0627\u0631\u0646\u062f \u062a\u0648 \u0647\u0645\u0647\u0686\u0649 \u0647\u0645 \u0633\u0631\u0639\u062a \u0647\u0645 \u0643\u064a\u0641\u064a\u062a \u0647\u0645 \u0627\u0631\u0632\u0634 \u0645\u062d\u0635\u0648\u0644 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u062f\u0631 \u06a9\u0648\u062a\u0627\u0647\u062a\u0631\u06cc\u0646 \u0632\u0645\u0627\u0646 \u0645\u0645\u06a9\u0646 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647\u060c \u062a\u0627 \u062d\u0627\u0644\u0627 \u0634\u062f\u0647 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u0646 \u0628\u0627 \u0686\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u062e\u0648\u0631\u06cc\u0646 \u0627\u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646 \u0646\u0628\u0627\u0634\u0647\u061f\u061f \u0627\u06cc\u0646  \u062e\u0648\u062f\u0634\u0647  \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0641\u0642\u0637 \u062e\u0648\u062f\u062a\u0648\u0646 \u0633\u0627\u0639\u062a \u0633\u0641\u0627\u0631\u0634 \u0648 \u0633\u0627\u0639\u062a \u062a\u062d\u0648\u06cc\u0644 \u0631\u0648 \u0686\u06a9 \u06a9\u0646\u06cc\u062f \u0627\u0632 \u0627\u06cc\u0646 \u0628\u0648\u062f \u0627\u06cc\u0646 \u0628\u0627\u06cc\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0686\u0647\u0627\u0631", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", "\u0634\u0645\u0639 \u0635\u0641\u0631", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0632\u0648\u0644\u0628\u064a\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0648\u0644\u064a \u0645\u0642\u062f\u0627\u0631 \u0628\u0627\u0645\u064a\u0647  \u0632\u064a\u0627\u062f \u0628\u0648\u062f\n\u0641\u0642\u0637 \u062a\u0648\u0635\u064a\u0647 \u0645\u064a\u0643\u0646\u0645 \u062c\u0632\u0648 \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u062a\u0648\u0646\u060c \u06af\u0648\u0634 \u0641\u064a\u0644 \u0631\u0627 \u0647\u0645 \u0628\u0647 \u062a\u0646\u0647\u0627\u064a\u064a \u0628\u0631\u0627\u064a \u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u06af\u0630\u0627\u0631\u064a\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u06af\u0648\u0634\u0641\u06cc\u0644 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u062a\u0641\u0627\u0646\u0647 \u0633\u0641\u0627\u0631\u0634 \u0627\u0631\u0633\u0627\u0644\u064a \u0643\u0647\u0646\u0647 \u0628\u0648\u062f \u060c \u062a\u0648\u064a \u0639\u0643\u0633 \u062f\u0648 \u062c\u0648\u0631 \u06af\u0648\u0634\u0641\u064a\u0644 \u0628\u0648\u062f \u0643\u0647 \u0641\u0642\u0637 \u064a\u0643 \u0646\u0648\u0639 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u0642\u062f\u0631 \u0647\u0645 \u0628\u062f\u0648\u0646 \u0634\u064a\u0631\u0647 \u0628\u0648\u062f \u0643\u0647 \u0639\u064a\u0646 \u0646\u0648\u0646 \u0645\u064a\u0645\u0648\u0646\u062f \u062d\u0627\u0644\u062a \u0643\u0644\u064a \u0637\u0639\u0645\u0634\u0645 \u0645\u062a\u0648\u0633\u0637 \u0628\u0647 \u067e\u0627\u064a\u064a\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u0634\u06cc\u0631\u0645\u0627\u0644 \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u0698\u06cc\u06a9\u06cc (\u0686\u0647\u0627\u0631\u06af\u0648\u0634)", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", 1]}
{"text": ["\u0646\u062d\u0648\u0647 \u0648 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f  \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f\u060c \u062e\u0648\u0627\u0647\u0634\u0627  \u067e\u06cc\u06a9 \u0647\u0627\u06cc \u0628\u0627 \u062f\u0642\u062a \u0628\u0641\u0631\u0633\u062a\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0632\u06cc\u0627\u062f \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f\n\u0631\u0648\u0644\u062a \u0648 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u0648\u0627\u0642\u0639\u0627 \u0628\u062f \u0628\u0648\u062f \u0648 \u0632\u0648\u0644\u0628\u064a\u0627 \u0647\u0627 \u0648 \u0628\u0627\u0645\u064a\u0647 \u0647\u0627 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc \u0628\u0647 \u0633\u062e\u062a\u06cc \u0631\u0648\u0634\u0646 \u0634\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0647\u0645 \u06cc\u06a9 \u062a\u06a9\u0647 \u0627\u0634 \u0627\u0641\u062a\u0627\u062f \u0631\u0648\u06cc \u06a9\u06cc\u06a9.\n\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0632\u06cc\u06cc\u0646 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc\u060c \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0632\u0626\u06cc\u0646 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", "\u0634\u0645\u0639 \u0639\u062f\u062f", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0622\u0634\u0641\u062a\u0647 \u0648 \u0634\u0631\u0627\u06cc\u0637 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u06cc\u062f. \u06a9\u0627\u0645\u0644\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0643\u064a\u0643 \u0643\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u0698\u0644\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0646 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0634\u0645\u0627 \u0628\u0647 \u0686\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u06cc\u06af\u06cc\u062f \u0648\u0644\u06cc \u0642\u0637\u0639\u0627 \u0627\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u0634\u062a\u0631\u06cc \u062f\u0627\u062f\u06cc\u062f \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0633\u062a.\u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0628\u0639\u06cc\u062f\u0647 !!!!! \u0628\u06cc\u0646\u0647\u0627\u06cc\u062a \u0628\u062f\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0631\u0628 \u062c\u0639\u0628\u0647 \u0628\u0627\u0632 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0639\u062f\u0627\u062f\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u062e\u0627\u0631\u06cc \u0642\u0628\u0644\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0631\u062f\u0648\u0627\u0646\u062f\u0627\u0632\u0647 \u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u06cc\u0646 \u06f2\u0628\u0627\u0631 \u0627\u062e\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0641\u062a \u0648 \u0628\u062f \u0634\u06a9\u0644 \u0648\u0627\u0646\u062f\u0627\u0632\u0647 \u0645\u062b\u0644 \u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0647\u0627\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0644\u0637\u0641\u0627 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0631\u0648 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0646\u06cc\u062f \u0686\u0648\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f\u0647 \u0648\u062c\u0627\u06cc \u062f\u06cc\u06af\u0647 \u0647\u0645 \u0646\u06cc\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u062e\u0627\u0631\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f\u0645\u0632\u0647 \u0628\u0648\u062f \u0633\u0648\u062e\u062a\u0647 \u062e\u0634\u06a9 \u0631\u0646\u06af \u06a9\u062f\u0631 \u060c\u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0628\u0648\u062f\u0645 \u062e\u06cc\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0643\u0627\u0631\u0627\u0645\u0644 \u0643\u0627\u0645\u0644\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0631\u0627\u0646\u0646\u062f\u0647 \u0627\u0633\u0646\u067e \u0631\u0639\u0627\u064a\u062a \u0646\u0643\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 2", -1]}
{"text": ["Awli ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0647 \u0634\u062f\u062a \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f! \u0627\u06af\u0631\u0686\u0647 \u06a9\u0647 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062c\u0632\u0648 \u0627\u0642\u0644\u0627\u0645 \u067e\u0631\u0641\u0631\u0648\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc\u0627\u0633\u062a \u0648 \u0645\u0639\u0645\u0648\u0644\u0627 \u0646\u0645\u06cc\u0645\u0648\u0646\u0647\u060c\u0627\u0645\u0627 \u0627\u06cc\u0646 \u0648\u0627\u0642\u0639\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u062d\u062c\u0645 \u062e\u0627\u0645\u0647 \u06cc \u062a\u0648\u0634 \u0647\u0645 \u06a9\u0645 \u0628\u0648\u062f\n\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0628\u0639\u0627\u062f\u0634 \u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631 \u0627\u0632 \u0686\u06cc\u0632\u06cc \u0628\u0648\u062f \u06a9 \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc\u0631\u0633\u0647 \u0648 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u0628\u0647 \u0635\u0631\u0641\u0647 \u0646\u0628\u0648\u062f \u0627\u0635\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0631\u0633\u06cc\u062f\u06af\u06cc \u0642\u0646\u0627\u062f\u06cc \u0646\u0627\u062a\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u0627\u0632\u0628\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", "\u062f\u0633\u0631 \u0628\u0644\u0648\u06a9\u0627\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u0642\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0639\u062f\u0634 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06a9\u0647 \u0627\u0633\u0646\u06a9 \u0645\u0648\u0631\u062f \u0646\u0638\u0631 \u0646\u062f\u0627\u0631\u0646\u060c\u0633\u0641\u0627\u0631\u0634 \u0639\u0648\u0636 \u0634\u062f \u060c\u0628\u062c\u0627\u06cc \u0627\u0633\u0646\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u062f\u0648\u0628\u0627\u0631\u0647 \u0628\u0631\u06af\u0631\u062f\u0648\u0646\u062f\u0647 \u0634\u062f \u0648 \u0628\u0627\u0644\u0627\u062e\u0631\u0647 \u0633\u0641\u0627\u0631\u0634 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0633\u0646\u06a9 \u0645\u06cc\u0646\u06cc \u067e\u06cc\u062a\u0632\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0627\u0633\u0646\u06a9 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u0633\u0628\u06a9\u060c \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646\u060c \u06a9\u06cc\u06a9\u0634 \u06a9\u0627\u0645\u0644\u0627 \u0646\u0631\u0645 \u0648 \u067e\u0648\u06a9 \u0648 \u0633\u0628\u06a9\u060c \u06a9\u0631\u0645 \u067e\u0646\u06cc\u0631\u06cc \u0628\u0627 \u0642\u0648\u0627\u0645 \u062e\u0648\u0628 \u0648 \u0637\u0639\u0645 \u0645\u0644\u0627\u06cc\u0645 \u0648 \u0633\u0628\u06a9 \u0648\u0644\u06cc \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0627\u0641\u06cc \u062d\u062c\u06cc\u0645 \u0628\u0648\u062f\n\u0647\u0645 \u0637\u0627\u0647\u0631 \u0648 \u0628\u0631\u0634 \u062a\u0645\u06cc\u0632\u06cc \u062f\u0627\u0634\u062a \u0648 \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0627\u0633\u0646\u067e \u062a\u0645\u06cc\u0632 \u0628\u0648\u062f\n\u062a\u062d\u0648\u06cc\u0644 \u0633\u0631\u06cc\u0639 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0643\u064a\u0643 \u062a\u0648\u0644\u062f \u0645\u0646 \u0627\u0641\u062a\u0636\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u062d \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f\u060c \u062e\u064a\u0644\u064a \u0628\u062f \u0643\u0647 \u0631\u0648\u0632 \u062a\u0648\u0644\u062f \u0622\u062f\u0645 \u0643\u064a\u0643\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0627\u0634\u0647 ", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u0645\u0627\u0644 \u062f\u0648\u0631\u0648\u0632 \u067e\u06cc\u0634 \u0647\u0633\u062a\u0646 \u0627\u0635\u0644\u0646 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u0645 ", "\u062a\u0631 \u0628\u0634\u0642\u0627\u0628\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06a9\u0648\u0686\u06a9", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u064a\u0644\u064a \u0633\u0631\u064a\u0639.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u067e\u0646\u062c \u0633\u062a\u0627\u0631\u0647 \u0628\u0648\u062f\u06cc\u062f \u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0631\u0648\u06cc \u0633\u0627\u0644\u0645 \u0631\u0633\u0648\u0646\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u06a9\u0646\u0645 \u067e\u06cc\u06a9 \u0628\u0627 \u062f\u0642\u062a \u0628\u0631\u0633\u0648\u0646\u0647. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645.\n\u0645\u0631\u0633\u06cc \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0645\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc\n\u0648\u0644\u06cc \u0637\u0639\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0638\u0627\u0647\u0631\u0627 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644 \u0638\u0627\u0647\u0631\u06cc \u0622\u0646 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u062e\u0648\u062f\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0648 \u0638\u0627\u0647\u0631 \u0646\u0627 \u0645\u0646\u0627\u0633\u0628\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0647 \u0628\u0647 \u067e\u06cc\u06a9 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0631\u062f\u0646 \u0648\u0644\u06cc \u0627\u06cc\u0634\u0627\u0646 \u06af\u0641\u062a\u0646\u062f \u062f\u0648\u0631\u062c\u0639\u0628\u0647 \u062e\u0627\u0644\u06cc \u0628\u0648\u062f\u0647 \u0648 \u062a\u0642\u0635\u06cc\u0631 \u0645\u0646 \u0646\u06cc\u0633\u062a!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0647\u0633\u062a\u0646\u062f! \u0645\u0631\u0633\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0634\u064a\u0631\u064a\u0646\u064a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u0628\u0627 \u0646\u064a\u0645 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u064a\u0631 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0643\u0647 \u062c\u0644\u0648\u064a \u0645\u0647\u0645\u0648\u0646\u0627\u0645 \u0632\u0634\u062a \u0634\u062f \u062e\u064a\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062a\u0631\u062a\u06cc\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0646\u06af\u0627\u0645 \u062d\u0645\u0644 \u062e\u06cc\u0644\u06cc \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f ... \u062c\u0639\u0628\u0647 \u0627\u0634 \u0642\u0634\u0646\u06af \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0627\u0646\u062a\u062e\u0627\u0628 \u0645\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0648\u062f \u0648\u0642\u062a\u06cc \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u062e\u06cc\u0644\u06cc \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645\u0647\u06cc \u067e\u0648\u062f\u0631 \u0642\u0646\u062f\u0647\u0627\u06cc \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f . \u0628\u0631\u0627\u06cc \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0627\u0646 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0627\u0645\u0627 \u062e\u06cc\u0644\u06cc \u0638\u0627\u0647\u0631 \u0628\u062f\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u06a9\u0645\u062a\u0631 \u0627\u0632 \u06cc\u06a9 \u0631\u0628\u0639 \u0628\u0639\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0698\u0644\u0647 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u06cc\u0646\u06cc (\u062d\u062f\u0648\u062f 900 \u06af\u0631\u0645\u060c 6 \u0646\u0641\u0631\u0647)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0628\u062f. \u0627\u0632 \u0647\u0641\u062a \u0639\u062f\u062f \u0633\u0647 \u062a\u0627\u0634 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0648 \u0633\u0641\u062a \u0628\u0648\u062f. \u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u0627\u06cc\u0646 \u0634\u0639\u0628\u0647 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u062f\u0627\u0634\u062a\u0645. \u0645\u06cc\u062a\u0648\u0646\u0633\u062a\u06cc\u062f \u0627\u0637\u0644\u0627\u0639 \u0628\u062f\u06cc\u062f \u06a9\u0647 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u06cc\u062f \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0648\u0646\u062f\u0647 \u0647\u0627\u06cc \u0631\u0648\u0632 \u0642\u0628\u0644 \u0631\u0648 \u0628\u0641\u0631\u0633\u062a\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 7 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u06cc\u062a\u0648\u0646\u0633\u062a \u062a\u0627\u0632\u0647 \u062a\u0631 \u0648 \u0628\u0647\u062a\u0631 \u0647\u0645 \u0628\u0627\u0634\u0647..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0647\u0646\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0634\u06a9\u0631\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["2 \u0628\u0627\u0631 \u062a\u0627\u062e\u06cc\u0631 \u0632\u062f\u0645. \u0648\u0627\u0642\u0639\u0627 \u0634\u0627\u0647\u06a9\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u067e\u06cc\u062a\u0632\u0627 \u0645\u06cc\u0646\u06cc", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u06cc\u062a\u0632\u0627\u06cc\u06cc", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u0649 \u0643\u0627\u0634 \u0634\u0631\u0628\u062a \u0631\u0648\u0649 \u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627 \u0643\u0645\u062a\u0631 \u064a\u0627 \u0627\u0635\u0644\u0627 \u0646\u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u062a\u0627 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0647 \u0634\u062f\u062a \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u062f \u0645\u0632\u0647 \u0647\u0645 \u062f\u0648\u0646\u0627\u062a \u0648\u0647\u0645 \u0645\u062e\u0635\u0648\u0635\u0627 \u0647\u0627\u062a \u062f\u0627\u06af \u067e\u064a\u0686 \u0643\u0647 \u0648\u062d\u0634\u062a\u0646\u0627\u0643 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0647\u0645 \u0646\u0648\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0648 \u0647\u0645 \u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0645\u062b\u0644 \u0644\u0627\u0633\u062a\u064a\u0643 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", "\u0647\u0627\u062a \u062f\u0627\u06af \u067e\u06cc\u0686", -1]}
{"text": ["\u06a9\u0644\u0627 \u0645\u0646 \u0641\u0642\u0637 \u0648\u0642\u062a\u0627\u06cc\u06cc \u06a9\u0647 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u0631\u0627\u0636\u06cc\u0645 \u060c \u0628\u0642\u06cc\u0647 \u06cc \u062c\u0627\u0647\u0627 \u0628\u0627 \u0627\u062e\u062a\u0644\u0627\u0641 \u0632\u06cc\u0627\u062f \u0628\u062f\u062a\u0631\u0646 \u060c \u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u0627\u06cc\u0646 \u06a9\u0647 \u0647\u0645\u0647 \u06cc \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0646\u0648\u0646 \u0633\u062d\u0631 \u062e\u0648\u0634\u0645\u0632\u0633 \u0645\u0648\u0627\u062f \u0627\u0648\u0644\u06cc\u0634\u0648\u0646 \u062e\u06cc\u0644\u06cc \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u0633 \u060c \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u060c \u06a9\u0627\u0634 \u0628\u0642\u06cc\u0647 \u06cc \u0631\u0633\u062a\u0648\u0631\u0627\u0646 \u0648 \u0645\u063a\u0627\u0632\u0647 \u0647\u0627\u06cc \u062a\u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0646 \u062c\u0627 \u0628\u0634\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0645\u0631\u063a \u0648 \u0645\u0627\u062a\u0632\u0627\u0631\u0644\u0627", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u0633\u0645\u0628\u0648\u0633\u0647", 1]}
{"text": ["\u062f\u0631 \u062a\u0639\u062f\u0627\u062f \u0627\u0639\u0644\u0627\u0645 \u06a9\u0631\u062f\u0646 \u062d\u062f\u0648\u062f\u0627 \u06f8 \u0639\u062f\u062f\u060c \u0627\u0645\u0627 \u06f6 \u0639\u062f\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u06cc\u0647 \u0645\u062f\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u0646\u062f\u0627\u062f\u0645 \u0648 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u0648\u0646 \u0648\u0627\u0642\u0639\u0627 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646\u06cc \u062f\u0627\u0634\u062a.\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0647\u0645 \u062e\u0648\u0634 \u0628\u0631 \u062e\u0648\u0631\u062f \u0628\u0648\u062f.\u062f\u0631 \u06a9\u0644 \u0645\u0645\u0646\u0648\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 \u0648 \u0645\u06cc\u062e\u0648\u0627\u0647\u0645 \u0645\u0627\u0628\u0642\u06cc \u0647\u0632\u06cc\u0646\u0647 \u0628\u0647 \u062d\u0633\u0627\u0628 \u0645\u0646 \u0628\u0631\u06af\u0631\u062f\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 25 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 6 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0639\u0627\u0644\u06cc \u0648 \u0628\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u06cc\u06af\u060c\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u0633\u0627\u064a\u0632 \u0646\u0635\u0641 \u0628\u0648\u062f \u0648 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a\u062a\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", 1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0628\u0627\u0628\u062a \u062a\u0627\u0632\u06af\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u067e\u06cc\u06a9 \u06a9\u0647 \u0645\u0646\u062a\u0638\u0631 \u0634\u062f \u062a\u0627 \u0627\u0632 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0645\u0637\u0645\u0626\u0646 \u0634\u0648\u062f. \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645. \u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u0645\u0646 \u0628\u0631\u0627\u06cc \u0647\u062f\u06cc\u0647 \u0645\u06cc \u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u0628\u0631\u0645 \u06a9\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u062a\u0648 \u062c\u0639\u0628\u0647 \u0648 \u062e\u0648\u0628 \u0634\u062f \u062f\u06cc\u062f\u0645 \u0648 \u062a\u0645\u06cc\u06cc\u0632 \u06a9\u0631\u062f\u0645 \u0648 \u0627\u0648\u0646 \u06a9\u0648\u06a9\u06cc \u0631\u0627 \u0628\u0631\u062f\u0627\u0634\u062a\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0645\u0632\u0647 \u0646\u062f\u0627\u0634\u062a \u0641\u0642\u0637 \u0642\u0634\u0646\u06af \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627 \u0637\u0628\u0642 \u0645\u0639\u0645\u0648\u0644\u060c\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c\u067e\u06cc\u06a9 \u0647\u0645 \u0627\u0646\u0635\u0627\u0641\u0627 \u06cc\u0647 \u0622\u0642\u0627\u06cc \u0645\u0624\u062f\u0628 \u0648 \u0628\u0627\u0634\u062e\u0635\u06cc\u062a \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u0637\u0628\u0642 \u0645\u0639\u0645\u0648\u0644 \u06a9\u0644\u0647 \u067e\u0627 \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0648 \u062f\u0631\u0628 \u0648 \u062f\u0627\u063a\u0648\u0646 \u0631\u0633\u06cc\u062f\u0646 \u062f\u0633\u062a\u0645\u0648\u0646 \u062c\u0648\u0631\u06cc \u06a9\u0647 \u0646\u0635\u0641 \u0628\u06cc\u0634\u062a\u0631\u0634\u0648\u0646 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u0647\u0627\u06cc \u062c\u0639\u0628\u0647..\u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u0647\u0631\u0645\u0648\u0642\u0639 \u062a\u0648 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0645\u06cc\u0646\u0648\u06cc\u0633\u0645 \u0648 \u062e\u0648\u0627\u0647\u0634 \u0645\u06cc\u06a9\u0646\u0645 \u0628\u0647 \u067e\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u06a9\u0646\u06cc\u062f \u0628\u0627 \u0627\u062d\u062a\u06cc\u0627\u0637 \u0628\u06cc\u0627\u0631\u0647 \u0628\u062f\u062a\u0631 \u0627\u0632 \u0648\u0642\u062a\u0627\u06cc\u06cc \u0645\u06cc\u0634\u0647 \u06a9\u0647 \u06a9\u0644\u0627 \u0686\u06cc\u0632\u06cc \u0646\u0646\u0648\u0634\u062a\u0645\n\u0647\u0631\u0686\u0646\u062f \u0627\u0635\u0648\u0644\u0627 \u0646\u0628\u0627\u06cc\u062f \u0646\u06cc\u0627\u0632\u06cc \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0647\u0645 \u0628\u0627\u0634\u0647.\u0647\u0645\u06cc\u0646 \u06a9\u0647 \u067e\u06cc\u06a9 \u0645\u06cc\u0631\u0647 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0628\u0633\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u06af\u06cc\u0631\u0647 \u06cc\u0639\u0646\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647 \u0648 \u0628\u0627\u06cc\u062f \u0628\u0627 \u0627\u062d\u062a\u06cc\u0627\u0637 \u062d\u0645\u0644 \u0634\u0647 \u062f\u06cc\u06af\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0631 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u200c\u062f\u0645 \u0648 \u0627\u0631\u0633\u0627\u0644\u0634 \u0628\u0627 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0633\u062a \u0628\u062f \u0645\u06cc\u0634\u0647. \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0645\u06cc\u200c\u0631\u0633\u0647 \u0647\u0645 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0645\u06cc\u200c\u0631\u0633\u0647 \u062f\u0633\u062a\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u0649 \u062e\u0648\u0628 \u0641\u0642\u0637 \u0665\u0660\u0660\u0660 \u062a\u0648\u0645\u0627\u0646 \u0647\u0632\u064a\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0627\u0648\u0646\u0645 \u0628\u0631\u0627\u0649 \u0663 \u062a\u0627 \u0643\u0648\u0686\u0647 \u0627\u0648\u0646\u0648\u0631\u062a\u0631 \u0632\u064a\u0627\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0645 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0631\u0633\u0627\u0646\u062f \n\u0641\u0642\u0637 \u062d\u062c\u0645\u0634 \u062e\u06cc\u0644\u06cc \u06a9\u0645\u062a\u0631 \u0627\u0632 \u0639\u06a9\u0633\u0634 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9\u200c \u0648\u0627\u0642\u0639\u0627 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0642\u0628\u0644\u0627 \u0627\u0635\u0644\u0627 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u0646\u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u0698\u06cc\u06a9\u06cc (\u0686\u0647\u0627\u0631\u06af\u0648\u0634)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u06af\u0648\u0634\u0641\u06cc\u0644 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0637\u0639\u0645 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u064a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u062a\u0648\u064a \u062c\u0639\u0628\u0647 \u0628\u0647 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f\u060c\u0645\u0648\u0642\u0639 \u0627\u0631\u0633\u0627\u0644 \u062f\u0642\u062a \u0628\u0634\u0647 \u062e\u064a\u0644\u064a \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "\u0628\u0633\u062a\u0646\u06cc \u0633\u0646\u062a\u06cc \u0646\u0648\u0646\u06cc", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0644\u0628\u0647 \u0647\u0627\u06cc \u062a\u0648\u062a\u0630\u0641\u0631\u0646\u06af\u06cc \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062d\u062c\u0645 \u0627\u0631\u0633\u0627\u0644\u06cc \u06a9\u0645\u062a\u0631 \u0627\u0632 \u062d\u062c\u0645 \u062f\u0631\u06cc\u0627\u0641\u062a\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u062e\u0644\u0648\u0637 \u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u060c \u0634\u0647\u062f\u0634 \u06a9\u0645 \u062a\u0631\u062f \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u062e\u0644\u0648\u0637 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u062e\u0644\u0648\u0637 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0628\u0647 \u0639\u0644\u062a \u0645\u062a\u0646\u0627\u0633\u0628 \u0646\u0628\u0648\u062f\u0646 \u062c\u0639\u0628\u0647 \u0642\u0637\u0639\u0627\u062a \u062a\u0627\u0631\u062a \u0631\u0648\u06cc \u0647\u0645 \u0648 \u062a\u06a9\u0647 \u062a\u06a9\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \n\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0647\u0645 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0641\u0642\u0637 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u060c \u0645\u062e\u0644\u0648\u0637 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644 \u0648 \u0627\u0646\u0648\u0627\u0639 \u062f\u06cc\u06af\u0647 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f \u06cc\u0639\u0646\u06cc \u0645\u0642\u062f\u0627\u0631 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u06a9\u0647 \u0645\u0648\u0631\u062f \u062a\u0638\u0631 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0631 \u0628\u0633\u064a\u0627\u0631 \u0628\u0633\u064a\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \n\u0632\u0648\u0644\u0628\u064a\u0627 \u0648 \u0628\u0627\u0645\u064a\u0647 \u062e\u0634\u0643 \u0648 \u0633\u0648\u062e\u062a\u0647\n\u0648 \u0639\u062f\u0645 \u0631\u0633\u064a\u062f\u06af\u064a \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u06af\u0648\u0634\u0641\u06cc\u0644 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", -1]}
{"text": ["\u0628\u0627\u0645\u06cc\u0647 \u0628\u0644\u0646\u062f \u062e\u06cc\u0644\u06cc \u0633\u0641\u062a \u0628\u0648\u062f \u0637\u0648\u0631\u06cc\u06a9\u0647 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062c\u0648\u06cc\u062f\u0646 \u0646\u0628\u0648\u062f. \u0648\u0644\u06cc \u0628\u0627\u0645\u06cc\u0647 \u0647\u0646\u062f\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u0649 \u06af\u0631\u062f\u0648\u064a\u0649 \u0628\u0633\u064a\u0627\u0631 \u0633\u0641\u062a \u0628\u0648\u062f \u0648 \u0643\u0647\u0646\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0645\u064a\u0631\u0633\u064a\u062f. \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644 \u0646\u0628\u0648\u062f. \u0632\u0648\u0644\u0628\u064a\u0627 \u0648 \u0628\u0627\u0645\u064a\u0647 \u0645\u0639\u0645\u0648\u0644\u0649 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc\u060c \u062f\u0642\u06cc\u0642\u0627 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0645\u0646 \u062a\u0648\u062c\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0633\u0645\u0634 \u06a9\u06cc\u06a9 \u0648 \u0631\u0648\u0644\u062a \u0647\u0633\u062a \u0648\u0644\u06cc \u0627\u0646\u062f\u0627\u0632\u0647 \u06cc\u0647 \u0645\u06cc\u0644\u06cc \u0645\u062a\u0631 \u062e\u0627\u0645\u0647 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u062f\u0633\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0647 \u062e\u0627\u0637\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0627\u0645\u0644 \u067e\u0631 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062d\u0631\u06a9\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062e\u0627\u0645\u0647 \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u0627\u0641\u06cc\u0646 \u0633\u0641\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u06cc\u0641\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u062f \u0648 \u062f\u0648 \u0646\u0648\u0639 \u0645\u062e\u062a\u0644\u0641 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u062f\u0648\u0646 \u0647\u0645\u0627\u0647\u0646\u06af\u06cc \u062f\u0631 \u062c\u0639\u0628\u0647 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u0627\u0632 \u0627\u06cc\u0646 \u0628\u062f \u062a\u0631 \u062f\u0627\u062e\u0644 \u062a\u0647\u0631\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0646\u06cc\u0633\u062a. \u0628\u062f \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0628\u062f.\u0645\u0648\u0646\u062f\u0647 \u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0627\u0635\u0644\u0627 \u0627\u0646\u06af\u0627\u0631 \u0628\u0627 \u067e\u0627 \u0631\u0641\u062a\u064a\u062f \u062a\u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u062e\u064a\u0644\u064a \u0646\u0627\u0631\u0627\u0636\u064a \u0647\u0633\u062a\u0645 \u064a\u0639\u0646\u064a \u0627\u062e\u0631\u064a\u0646 \u0628\u0627\u0631\u0645 \u0645\u062a\u0627\u0633\u0641\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0627\u067e\u06cc\u0648\u0646\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u0627\u0632 \u0646\u0638\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0645\u0632\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u0686\u0646\u062f\u062a\u0627 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0645\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0634\u06a9\u0644 \u062e\u06cc\u0644\u06cc \u0628\u062f\u06cc \u067e\u0628\u062f\u0627 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u06a9\u0647 \u0645\u0646\u0627\u0633\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0647\u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc\n\u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0647 \u0637\u0648\u0631\u06cc \u06a9\u0647 \u0698\u0644\u0647 \u0647\u0627 \u06a9\u0627\u0645\u0644 \u062c\u062f\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06cc\u0631\u0646\u06cc \u0647\u0627 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0627\u0632 \u0628\u06cc\u0646 \u0631\u0641\u062a\u0647 \u0628\u0648\u062f\n\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627 \u0645\u0646\u0627\u0633\u0628 \u0634\u06cc\u0631\u0646\u06cc \u0628\u0647 \u0637\u0648\u0631\u06cc \u06a9\u0647 \u0698\u0644\u0647 \u0647\u0627 \u0628\u0647 \u0631\u0627\u062d\u062a\u06cc \u0627\u0632 \u0634\u06cc\u0631\u0646\u06cc \u062c\u062f\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f.\n\u062e\u0631\u06cc\u062f \u0628\u0647 \u0627\u06cc\u0646 \u0634\u06a9\u0644 \u062a\u0648\u0635\u06cc\u0647 \u0646\u0645\u06cc \u0634\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0698\u0644\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0627\u0645\u0627 \u0628\u0647 \u0646\u0638\u0631\u0645 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0641\u0627\u0635\u0644\u0647 \u06cc \u06a9\u0645 \u0647\u0632\u06cc\u0646\u0647 \u06cc \u067e\u06cc\u06a9 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u0628\u0627 \u062a\u0634\u06a9\u0631 \u0648 \u062e\u062f\u0627\u0642\u0648\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627 \u0627\u0644\u0627\u0646 \u0686\u0646\u062f\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u0634\u062a\u0645 \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u062f \u0628\u0648\u062f\u0647 \u0648 \u0628\u0627\u0631 \u0627\u062e\u0631 \u062e\u0631\u06cc\u062f\u0645 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f! \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0633\u0627\u0642\u0647 \u0639\u0631\u0648\u0633 \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u06cc\u0641\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f .\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u062f\u0633\u0631\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0633\u0631\u0647\u0627 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0628\u0644\u0648\u06a9\u0627\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u062f\u06cc\u0645\u06cc\u0647\u0627 \u0645\u0627\u0644 \u0627\u0633\u0646\u067e \u0641\u0648\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u067e\u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u0648 \u0628\u06cc \u0627\u062d\u062a\u06cc\u0627\u0637 \u062d\u0645\u0644 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u06a9\u0645\u06cc\u062a \u0647\u0631\u062f\u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u062a\u0634\u06a9\u0631\u060c \u0645\u0631\u0633\u06cc \u0625\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0645\u0646 \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645\n\u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u0647\u0645 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\n\u06a9\u0644\u0627 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634 \u062e\u0648\u0628\u0647 \u0628\u0647 \u0646\u0638\u0631\u0645\n\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u06af\u0644 \u0628\u0648\u062f \u0648\u0644\u06cc \u062d\u062f\u0648\u062f \u06f7\u06f0\u066a \u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633 \u0628\u0648\u062f\n\u0648\u0644\u06cc \u0632\u06cc\u0628\u0627 \u0628\u0648\u062f \u062c\u062f\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u0648\u0632 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u06cc\u0646\u06cc (\u062d\u062f\u0648\u062f 900 \u06af\u0631\u0645\u060c 6 \u0646\u0641\u0631\u0647)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u0633\u0627\u0639\u062a \u06f1\u06f0 \u0635\u0628\u062d \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0632\u0645\u0627\u0646 \u062f\u0631\u06cc\u0627\u0641\u062a \u06a9\u06cc\u06a9 \u06a9\u0644\u0627 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u062c\u200c \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u200c\u062a\u0645\u0627\u0645\u06cc \u062a\u0632\u06cc\u06cc\u0646\u0627\u062a \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u0648\u0632 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u06cc\u0646\u06cc (\u062d\u062f\u0648\u062f 900 \u06af\u0631\u0645\u060c 6 \u0646\u0641\u0631\u0647)", "\u0634\u0645\u0639 \u0647\u067e\u06cc \u0628\u0631\u0633 \u062f\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0628\u062f\u062c\u0648\u0631\u064a \u062a\u0643\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0645\u0646\u0627\u0633\u0628 \u0648 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. \u062a\u0646\u0647\u0627 \u0646\u06a9\u062a\u0647 \u0627\u06cc \u06a9\u0647 \u0642\u0627\u0628\u0644 \u062a\u0627\u0645\u0644 \u0627\u0633\u062a \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0628\u0648\u062f \u06a9\u0647 \u06a9\u0645\u06cc \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f. \u0627\u0645\u0627 \u062f\u0631 \u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062a\u0639\u062f\u0627\u062f\u06cc", 1]}
{"text": ["\u062f\u0631 \u0647\u0646\u06af\u0627\u0645 \u0622\u0648\u0631\u062f\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0642\u062a \u0644\u0627\u0632\u0645 \u0635\u0648\u0631\u062a \u0646\u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u0647\u0645 \u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0648\u200c\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0636\u0645\u0646 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f\u06cc \u06a9\u0647 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0628\u0648\u062f \u067e\u0633 \u0627\u0632 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0648\u0646\u0627\u062a \u062f\u0631 \u062c\u0639\u0628\u0647 \u062e\u0648\u062f\u0634 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0645\u06cc\u0632\u0627\u0646\u06cc \u0627\u0632 \u0645\u0627\u06cc\u0639 \u062f\u0648\u0646\u0627\u062a \u0627\u0632 \u0638\u0631\u0641 \u0622\u0646 \u0628\u06cc\u0631\u0648\u0646 \u0632\u062f\u0647 \u0648 \u062f\u0631 \u06a9\u06cc\u0633\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0627\u062a \u062f\u0627\u06af \u067e\u06cc\u0686", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633\u062f\u0627\u0631 (\u0628\u0633\u062a\u0647 \u0627\u06cc)", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0628\u064a \u062c\u0641\u062a\u0634\u0648\u0646 \u0631\u0648\u0643\u0634 \u0634\u0643\u0644\u0627\u062a \u062f\u0627\u0634\u062a\u0646 \u062f\u0631 \u0635\u0648\u0631\u062a\u064a \u0643\u0647 \u064a\u0643\u064a\u0634 \u0648 \u0628\u0627 \u0634\u0643\u0644\u0627\u062a \u062a\u0627\u062e \u0628\u0648\u062f \u0648 \u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u0633\u0631\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0627\u06a9\u0627\u0631\u0648\u0646 \u062a\u0627\u0632\u0647 \u062a\u0627\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", 1]}
{"text": ["Vaghan ali bood ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0628\u0639\u062f \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a \u06a9\u0647 \u0645\u0646 \u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u0633\u0641\u0627\u0631\u0634\u0645 \u0628\u0631\u0633\u0647 \u062a\u0627\u0632\u0647 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06a9\u0647 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0645\u0631\u063a \u0646\u062f\u0627\u0631\u06cc\u0645 \u0644\u0637\u0641\u0627 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0639\u0648\u0636 \u06a9\u0646\u06cc\u062f. \u0628\u0639\u062f \u06a9\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0645 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a \u0647\u0645 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0632\u062f\u0646. \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a \u0632\u06cc\u0627\u062f \u0646\u06cc\u0633\u062a \u0648\u0642\u062a\u06cc \u06a9\u0647 \u0641\u0642\u0637 \u062f\u0648 \u062a\u0627 \u06a9\u0648\u0686\u0647 \u0641\u0627\u0635\u0644\u0647 \u062f\u0627\u0631\u06cc\u0645\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc", -1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0639\u06a9\u0633 \u06a9\u0648\u0686\u0648\u0644\u0648 \u062a\u0631\u0646 \u062a\u0642\u0631\u06cc\u0628\u0627 \u062f\u0648 \u0628\u0646\u062f \u0627\u0646\u06af\u0634\u062a\u0646 \u0627\u0645\u0627 \u062e\u06cc\u0644\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc \u0648 \u062e\u0648\u0634\u06af\u0644\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0633\u0645\u0628\u0648\u0633\u0647 \u0639\u0627\u0644\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0641\u06a9\u0631 \u0645\u06cc \u06a9\u0646\u0645 \u06cc\u0647 \u0644\u0627\u06cc\u0647 \u0646\u0627\u0632\u06a9 \u062a\u0645\u0628\u0631 \u0647\u0646\u062f\u06cc \u062f\u0627\u062e\u0644\u0634 \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0634\u06a9\u0631\u06cc", "\u0633\u0645\u0628\u0648\u0633\u0647", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0648 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u064a\u062f\n\u0637\u0628\u0642 \u0645\u0639\u0645\u0648\u0644\u060c \u0639\u0627\u0644\u0649 \u0648 \u0628\u0627 \u0643\u064a\u0641\u064a\u062a\n\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0634\u06a9\u0631\u06cc", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u062f\u0631 \u0648\u0627\u0642\u0639 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u062c\u0631\u0627\u062a \u0646\u06a9\u0631\u062f\u0645 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u06cc\u06a9\u0646 \u0648 \u067e\u0646\u06cc\u0631", -1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f\u0646\u062f \u0647\u0645\u0634\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a (9 \u062a\u0627\u06cc\u06cc)", "\u0634\u0643\u0644\u0627\u062a \u062a\u0631\u0627\u0641\u0644", 1]}
{"text": ["\u0643\u064a\u0643 \u0627\u0632 \u0635\u0641\u062d\u0647 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062f\u064a\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u064a\u062f\u0647 \u0628\u0648\u062f. \u0646\u0645\u064a\u062f\u0648\u0646\u0645 \u0645\u0634\u0643\u0644 \u0627\u0632 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0628\u0648\u062f\u0647 \u064a\u0627 \u0637\u0631\u064a\u0642\u0647 \u062d\u0645\u0644 \u0627\u0633\u0646\u067e. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u0633\u0648\u0645 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0645\u0634\u06a9\u0644\u0634\u0627\u0646 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0645\u06cc \u0647\u0627\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062a\u06a9\u0646\u0641\u0631\u0647 \u0648 \u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 \u0628\u0648\u062f\u0646 \u0648\u0627\u0642\u0639\u0627 \u062d\u06cc\u0641 \u06a9\u0647 \u0627\u0632 \u0645\u0646\u0648 \u062d\u0630\u0641 \u0634\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u06a9\u0627\u0645\u0644\u0627 \u0634\u06a9\u0644\u0634 \u0639\u0648\u0636 \u0634\u062f\u0647 \u0628\u0648\u062f \u0647\u0645\u0647 \u0634\u06a9\u0644\u0627\u062a\u0634 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u0627\u0628 \u06a9\u06cc\u06a9 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644\u0634 \u0628\u0647\u0645 \u062e\u0648\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0634\u0634", "\u0634\u0645\u0639 \u0633\u0647", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0641\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0631\u0648 \u0642\u0628\u0644\u0627 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u0645 \u0648 \u0637\u0639\u0645\u0634 \u0631\u0648 \u062e\u06cc\u0644\u06cc \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645. \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0627\u0635\u0644\u0627 \u0634\u0628\u06cc\u0647 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0646\u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f. \u0636\u0645\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u0647\u0646\u06af\u0627\u0645 \u062d\u0645\u0644 \u0647\u0645 \u06a9\u0627\u0645\u0644\u0627 \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u062a\u06a9\u0648\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f. \u06a9\u06cc\u06a9 \u0631\u0648 \u0642\u0628\u0648\u0644 \u0646\u06a9\u0631\u062f\u0645 \u0648 \u062f\u0641\u0639\u0647 \u0628\u0639\u062f \u0647\u0645 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0648 \u0628\u062f\u062a\u0631 \u0627\u0632 \u0627\u0648\u0644\u06cc \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645. \u062f\u0641\u0639\u0647 \u0647\u0627\u06cc \u067e\u06cc\u0634 \u062a\u062d\u0648\u06cc\u0644\u0634 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f. \u0646\u0645\u06cc \u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0627\u06cc\u0646 \u062c\u0648\u0631\u06cc \u0634\u062f.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0645\u0642\u0648\u0644 \u0648 \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062f\u0631\u062d\u0627\u0644\u06cc\u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0645\u0627\u062f\u0647 \u0628\u0648\u062f\u060c \u062e\u06cc\u0644\u06cc \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u062a\u062d\u0648\u06cc\u0644 \u0628\u06af\u06cc\u0631\u0646 \u0648 \u0628\u06cc\u0627\u0631\u0646. (\u0646\u0632\u062f\u06cc\u06a9 \u06cc\u06a9 \u0633\u0627\u0639\u062a)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0646\u06cc\u0634\u06a9\u0631 \u06cc\u06a9\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc\u0647\u0627\u06cc \u0645\u0648\u0631\u062f \u0639\u0644\u0627\u0642\u0647 \u0645\u0646 \u0647\u0633\u062a \u060c\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627\u0634 \u0631\u0648 \u062f\u0648\u0633\u062a \u062f\u0627\u0631\u0645 \u0648 \u06cc\u06a9\u06cc \u0627\u0632 \u062e\u0648\u0628\u06cc\u0647\u0627\u0634 \u0627\u06cc\u0646\u0647 \u06a9 \u062a\u0648 \u0627\u06cc\u0646 \u0645\u0627\u0647 \u0631\u0645\u0636\u0627\u0646 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644 \u0631\u0648 \u062c\u062f\u0627 \u062c\u062f\u0627 \u0647\u0645 \u0645\u06cc\u0634\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f.\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0645\u0631\u062a\u0628 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u06a9 \u063a\u06cc\u0631 \u0627\u0632 \u062a\u0627\u0632\u06af\u06cc \u0627\u0646\u0647\u0627 \u0628\u0631\u0627\u0645 \u062e\u06cc\u0644\u06cc \u0627\u0647\u0645\u06cc\u062a \u062f\u0627\u0634\u062a.\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062a\u0627\u0631\u062a \u0622\u0644\u0628\u0627\u0644\u0648 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc..\u062e\u0648\u0634\u062d\u0627\u0644\u0645 \u06a9\u0647 \u06cc\u0647 \u0628\u0627\u0642\u0644\u0648\u0627 \u062e\u0648\u0628 \u0646\u0632\u062f\u06cc\u06a9\u0645\u0648\u0646 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0648\u064a \u0631\u0648\u063a\u0646 \u0628\u062f\u064a \u0645\u064a\u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u0628\u062f\u0645\u0632\u0647 \u062a\u0631\u06cc\u0646 \u06a9\u06cc\u06a9\u06cc \u0628\u0648\u062f \u06a9\u0627 \u0686\u0646\u062f \u0633\u0627\u0644 \u0627\u062e\u06cc\u0631 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 ..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c\u06cc\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u0627\u0648\u0645\u062f\u0647.\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0648\u0627\u0642\u0639\u0627 \u0641\u0642\u0637 \u0627\u06cc\u0646\u062f\u0641\u0639\u0647 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u0628\u0648\u062f\u0647 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0641\u0646\u062f\u0648\u0642 \u0634\u06a9\u0644\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0627\u0633\u0644\u0627\u0645 \u0648 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u062a\u0648\u0646. \u062a\u0639\u062f\u0627\u062f \u0645\u0648\u0633 \u0647\u0627 \u062f\u0631 \u0647\u0631 \u06a9\u06cc\u0644\u0648 \u06f7 \u0639\u062f\u062f \u0628\u0648\u062f \u0646\u0647 \u06f1\u06f2 \u0639\u062f\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0645\u0648\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u0634\u0645\u0627 \u0628\u0639\u06cc\u062f\u0647 \u062e\u0648\u0628\u0647 \u06a9\u0647 \u0627\u0632 \u0634\u0639\u0628\u0647 vip \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 4 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0627\u0641\u062a\u0636\u0627\u062d \u0627\u0646\u0642\u062f\u0631 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u062f \u0628\u0648\u062f \u0647\u0645\u0647 \u0631\u0648 \u0631\u062f \u06a9\u0631\u062f\u0645 \u0631\u0641\u062a \u062d\u062a\u06cc \u0631\u0648\u0645 \u0646\u0634\u062f \u0628\u0628\u062e\u0634\u0645 \u0628\u0647 \u06a9\u0633\u06cc \u0628\u0631\u0627\u06cc \u0686\u06cc \u0627\u0633\u0645.\u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0627\u0646\u0642\u062f\u0631 \u067e\u0633\u0686\u06cc\u062f\u0647 \u062e\u062c\u0627\u0644\u062a \u0627\u0648\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0631\u0627\u0645 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0633\u0627\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u0646\u062f. \u0647\u0641\u062a\u0647 \u06af\u0630\u0634\u062a\u0647 \u0647\u0645 \u062a\u0644\u0641\u0646\u06cc \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0631\u062f\u0648\u0644\u0648\u062a \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646\u062f! \u0686\u0647 \u062e\u0628\u0631\u0647 \u0627\u0648\u0646\u062c\u0627 !!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u06cc \u06a9\u0627\u0634 \u0627\u0631\u0633\u0627\u0644\u0634 \u0631\u0627\u06cc\u06af\u0627\u0646 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062a\u0634\u06a9\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u06cc\u0641\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u062f\u062a\u0631\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062a\u0627 \u0628\u0647 \u062d\u0627\u0644 \u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0648\u062f \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645.\u067e\u0648\u0644\u0645\u0648 \u062f\u0648\u0631\u0631\u06cc\u062e\u062a\u0645.\n \u06a9\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0648 \u062c\u0639\u0628\u0647 \u0646\u0627\u0628\u0648\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \n\u0645\u0648\u0633 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc  \u0647\u0645 \u062c\u0627\u0634 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u0646\u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0698\u0644\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u0633\u0628\u062a \u0628\u0647 \u062f\u0641\u0639\u0627\u062a \u0642\u0628\u0644 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646\u06cc \u062f\u0627\u0634\u062a. \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u06af\u0631\u062f\u0648 \u0646\u062f\u0627\u0634\u062a. \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u06af\u0631\u0648\u0646 \u062a\u0631 \u0634\u062f\u0647. \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645\u06cc\u0646 \u06a9\u06cc\u06a9 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0642\u0628\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u0642\u0631\u0627\u0628\u06cc\u0647 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc\u06cc \u0628\u0648\u062f \u062f\u0631 \u0635\u0648\u0631\u062a \u0627\u0645\u06a9\u0627\u0646 \u06a9\u0645\u06cc \u0628\u0631\u0634\u062a\u0647 \u062a\u0631 \u0628\u0634\u0647 \u0639\u0627\u0644\u06cc \u062a\u0631\u0645 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u0647 \u0628\u0647 \u0647\u0645\u0647 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0645\u062e\u0635\u0648\u0635\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0648 \u06a9\u0647 \u0627\u0632 \u062c\u0645\u0644\u0647 \u0628\u0647\u062a\u0631\u06cc\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u062e\u0627\u0631\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u064a \u0648 \u0628\u0627\u0643\u064a\u0641\u064a\u062a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u062e\u0648\u062f\u0686\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc \u062a\u06a9 \u06af\u0631\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u0698\u0644\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0627\u0646\u0635\u0627\u0641\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ... \u0645\u0627 \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0647\u0633\u062a\u06cc\u0645 .. \u0648\u0627\u0642\u0639\u0627 \u062a\u06a9\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f. \u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 5 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u0627\u0637\u0631\u0627\u0641 \u062c\u0639\u0628\u0647 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u0627\u0647\u0631\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u062e\u0648\u0628 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u062a\u062d\u0648\u06cc\u0644\u06cc \u0628\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u0646\u062f\u0647 \u0645\u063a\u0627\u06cc\u0631\u062a \u062f\u0627\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", -1]}
{"text": ["\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u067e\u0646\u062c \u0633\u062a\u0627\u0631\u0647 \u0646\u0627\u0646 \u062e\u0627\u0646\u0647 \u0627\u06cc \u067e\u0646\u062c \u0633\u062a\u0627\u0631\u0647 \u062d\u0645\u0644 \u062a\u0648\u0633\u0637 \u067e\u06cc\u06a9 ( \u0628\u0627 \u06a9\u0644\u06cc \u062e\u0648\u0627\u0647\u0634 \u0648\u0644\u06cc \u067e\u0646\u062c \u0633\u062a\u0627\u0631\u0647 ) \u062a\u0627 \u0627\u06cc\u0646\u062c\u0627 \u0645\u0645\u0646\u0648\u0646 \u060c \u06a9\u0648\u06a9\u062a\u0644 \u062e\u0644\u0627\u0644 \u062f\u0627\u0631 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u0648 \u0633\u0641\u062a \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0645\u0627\u0644 \u0627\u0645\u0631\u0648\u0632 \u0646\u06cc\u0633\u062a \u060c \u0631\u0628\u0637\u06cc \u0647\u0645 \u0628\u0647 \u062d\u0645\u0644 \u062a\u0648\u0633\u0637 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u063a\u06cc\u0631\u0647 \u0646\u062f\u0627\u0631\u0647 \u062e\u0648\u062f \u0646\u0627\u062a\u0644\u06cc  \u062d\u062a\u0645\u0627 \u0631\u0633\u06cc\u062f\u06af\u06cc \u06a9\u0646\u06cc\u062f. \u062f\u0631 \u06a9\u0644 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0648\u06a9\u062a\u0644 \u062e\u0644\u0627\u0644 \u062f\u0627\u0631", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0641\u0648\u0631\u06cc \u0627\u0648\u0631\u062f\u0646 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0627\u0645\u06cc\u0647 \u06a9\u0645 \u062f\u0627\u0634\u062a\u060c \u0628\u06cc\u0634\u062a\u0631\u0634 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u0627\u062a\u0644\u06cc", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0627\u062f\u0627\u06cc\u0641 \u0645\u062e\u0635\u0648\u0635 \u0646\u0627\u062a\u0644\u06cc", 1]}
{"text": ["\u0686\u0627\u06cc\u06cc\u0645 \u0647\u0646\u0648\u0632 \u062f\u0645 \u0646\u06a9\u0634\u06cc\u062f\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0633\u06cc\u062f \u0686\u0642\u062f\u0631\u0645 \u062e\u0648\u0634\u0645\u0632\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0647\u0627\u0634 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u0648\u0628 \u0648\u0644\u06cc \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc  \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0642\u062a\u06cc \u0631\u0633\u06cc\u062f \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u062a\u0648\u0647\u0645 \u0646\u062a\u0648\u0646\u0633\u062a\u0645 \u0628\u0630\u0627\u0631\u0645 \u062c\u0644\u0648 \u0645\u0647\u0645\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u062a\u0644 \u062e\u0644\u0627\u0644 \u062f\u0627\u0631", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0648\u0627\u0646\u06cc\u0644\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0644\u0637\u06cc\u0641\u0647 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0648\u0646\u0634 \u062e\u064a\u0644\u064a \u0645\u0648\u0646\u062f\u0647 \u0648 \u0633\u0641\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u064a\u0644\u0649 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0646\u062f\u0648 \u0628\u0627 \u06a9\u0631\u0645 \u0631\u0648\u06cc\u0627\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0628\u06cc\u0646\u0638\u06cc\u0631 \n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0644\u0628 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0641\u0634\u0641\u0634\u0647", "\u0634\u0645\u0639 \u0639\u062f\u062f\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0631\u0627\u06cc\u0647 \u062e\u062f\u0645\u0627\u062a  \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.\u06a9\u06cc\u06a9\u0647\u0627\u0634 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u062f\u0633\u062a \u06a9\u0645 \u0628\u0631\u0627\u06cc \u0633\u0647 \u06cc\u0627 \u0686\u0647\u0627\u0631\u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0648\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u0627\u0632\u0628\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u06cc\u06a9 \u062f\u0642\u062a \u0644\u0627\u0632\u0645 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0628\u0633\u062a\u0647 \u0631\u0627 \u0646\u062f\u0627\u0634\u062a\u0647 \u0648 \u06a9\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u062f\u0641\u0631\u0645\u0647 \u0648 \u0627\u0632 \u0646\u0638\u0631 \u0638\u0627\u0647\u0631\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0627\u0633\u062a .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0645\u062c\u06cc\u06a9", -1]}
{"text": ["\u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u0686\u0646\u062f\u0645 \u0627\u0632 \u0627\u0633\u0646\u067e \u06a9\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0627\u06cc\u0646 \u0628\u0627\u0631 \u0647\u0645 \u06a9\u06cc\u06a9\u0645 \u0636\u0631\u0628\u0647 \u062f\u06cc\u062f\u0647 \u0628\u0648\u062f\u060c \u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u0647\u0627\u062a\u0648\u0646 \u06cc \u06a9\u0645 \u062f\u0642\u062a \u06cc\u0627\u062f \u0628\u062f\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0645\u062c\u06cc\u06a9", "\u06a9\u06cc\u06a9 \u0628\u06cc\u0633\u06a9\u0648\u0626\u06cc\u062a \u0627\u0648\u0631\u0626\u0648 \u0646\u06af\u0631\u0648 \u0645\u062a\u0648\u0633\u0637 (\u062d\u062f\u0648\u062f 1 \u06a9\u06cc\u0644\u0648 \u0648 400 \u06af\u0631\u0645\u060c 10 \u0646\u0641\u0631\u0647)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u06a9\u0648\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u063a\u06cc\u06cc\u0631 \u0634\u06a9\u0644 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062d\u0633\u0627\u0628\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a \u0645\u0627 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062a\u0631 \u0627\u0632 \u0642\u06cc\u0627\u0641\u0647 \u062e\u0648\u062f \u0627\u0641\u062a\u0627\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f\n\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0647\u0645 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0633\u06cc\u0628 \u0646\u062f\u0627\u0634\u062a\n\u062f\u0631 \u0686\u06cc\u062f\u0645\u0627\u0646 \u0647\u0645 \u0644\u0637\u0641\u0627\u064b \u0628\u06cc\u0634\u062a\u0631 \u0633\u0644\u06cc\u0642\u0647 \u0628\u0647 \u062e\u0631\u062c \u062f\u0647\u06cc\u062f\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u0637\u0627\u0628 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u06cc\u0641\u06cc \u062a\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0644\u0630\u06cc\u0630\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0648\u0634\u0641\u06cc\u0644 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0633\u0631\u06cc\u0639 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0646\u0627\u0646\u0634 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f\u060c\u0633\u0646\u06af \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0622\u0644\u0645\u0627\u0646\u06cc \u0633\u0641\u06cc\u062f", "\u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a", -1]}
{"text": ["Awlie", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u06cc\u062a\u0631\u0648\u0644", "\u0648\u06cc\u062a", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0648\u0646\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062f\u0631 \u06cc\u06a9 \u06a9\u0644\u0627\u0645 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f. \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u062f \u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0622\u0631\u062f \u06a9\u0627\u0645\u0644", "\u0646\u0627\u0646 \u06af\u0631\u062f\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062e\u0635\u0648\u0635", -1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 18 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627\u0631\u0648 \u0647\u0645\u0647 \u0631\u0648 \u064a\u0643 \u0634\u0643\u0644  \u0627\u0648\u0631\u062f\u0646 \u060c \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u062a\u0631\u0643\u064a\u0628\u064a \u0628\u0627\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 15 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0645 \u0642\u06cc\u0645\u062a \u0648 \u06af\u0631\u0648\u0646 \u06a9\u0631\u062f\u0647 \u0648 \u0647\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u062d\u062c\u0645 \u0634\u0648 \u06a9\u0645 \u06a9\u0631\u062f\u0647 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645 \u062f\u06cc\u06af\u0647 \u0633\u0641\u0627\u0631\u0634 \u0646\u0645\u06cc\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06a9\u0634\u0645\u0634 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0646\u0627\u0646 \u0686\u0627\u067e\u0627\u062a\u0627 \u0628\u0647 \u0642\u062f\u0631\u06cc \u06a9\u0647\u0646\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u0645\u0635\u0631\u0641 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u0686\u0627\u067e\u0627\u062a\u0627 \u0632\u06cc\u062a\u0648\u0646\u06cc", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0645\u062d\u0635\u0648\u0644\u06cc \u06a9\u0647 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u062f\u0631 \u0645\u0646\u0648 \u0645\u0648\u062c\u0648\u062f \u0628\u0648\u062f \u0648 \u067e\u0648\u0644\u0634 \u0631\u0648 \u067e\u0631\u062f\u0627\u062e\u062a \u06a9\u0631\u062f\u0645 \u0648\u0644\u06cc \u0628\u062f\u0633\u062a\u0645 \u0646\u0631\u0633\u06cc\u062f \u0648 \u0628\u0627\u0644\u0627\u062c\u0628\u0627\u0631 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", -1]}
{"text": ["\u062e\u0648\u0634 \u0645\u0632\u0647 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0646 \u062a\u0648\u0649 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u062e\u0648\u0627\u0633\u062a\u0645 \u0634\u0643\u0644\u0627\u062a \u0628\u064a\u0634\u062a\u0631 \u0628\u0627\u0634\u0647 \u0648\u0644\u0649 \u0627\u0632 \u062d\u0627\u0644\u062a \u0645\u0639\u0645\u0648\u0644\u0649 \u0647\u0645 \u0643\u0645\u062a\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u06af\u0627\u062a\u0627", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0645\u062e\u0635\u0648\u0635\u0627 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0646\u06cc\u0631", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0646\u0627\u0646 \u0633\u062d\u0631 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0641\u06cc\u0646\u06af\u0631 \u0641\u0648\u062f \u0633\u0641\u06cc\u062f", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646. \u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062a\u062d\u0648\u06cc\u0644 \u0628\u0627 \u06a9\u0644\u06cc \u062a\u0627\u062e\u06cc\u0631 \u0627\u062e\u0631 \u0647\u0645 \u0647\u0645\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u0631\u0648 \u0647\u0645 \u0627\u0641\u062a\u0627\u062f\u0647 \u0644\u0647 \u0627\u0648\u0631\u062f\u0647 \u062f\u0627\u062f\u0647.\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0627\u0635\u0644\u0627 \u0645\u0632\u0647 \u0647\u0648\u06cc\u062c \u0646\u0645\u06cc\u062f\u0627\u062f .\u0641\u0642\u0637 \u0633\u0648\u0641\u0644\u0647 \u0634\u06a9\u0644\u0627\u062a \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647\u0647\u0647\u0647 \u06a9\u0647\u0646\u0647\u0647\u0647\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0645 \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u0645\u0627\u0644 \u0627\u0645\u0631\u0648\u0632 \u0627\u0633\u062a \u0628\u0641\u0631\u0633\u062a\u06cc\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["Perfect", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0648\u0642\u062a\u06cc \u062c\u0639\u0628\u0647 \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0631\u062f\u06cc\u0645 \u062f\u06cc\u062f\u06cc\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u067e\u064f\u06a9\u06cc\u062f\u0646.\u0645\u0648\u0646\u062f\u0645 \u067e\u06cc\u06a9 \u0686\u062c\u0648\u0631\u06cc \u0622\u0648\u0631\u062f\u0647 \u062c\u0639\u0628\u0647 \u0631\u0648 \u06a9\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u0631\u0648\u0632 \u0627\u0641\u062a\u0627\u062f\u0646.\u0647\u0645\u0647 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0631\u0648 \u0647\u0645 \u0648 \u062e\u0627\u0645\u0647 \u0647\u0627\u06cc \u0631\u0648\u0634\u0648\u0646 \u062c\u062f\u0627 \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646.\u0627\u06cc\u0646\u0627 \u0631\u0648 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u06cc\u0645 \u0628\u0639\u062f \u0627\u0632 \u0634\u0627\u0645 \u0628\u0639\u0646\u0648\u0627\u0646 \u062f\u0633\u0631 \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0648\u0646 \u0628\u0630\u0627\u0631\u06cc\u0645 \u06a9\u0647 \u0628\u0627\u062a\u0648\u062c\u0647 \u0628\u0647 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0646 \u0638\u0627\u0647\u0631\u0634\u0648\u0646 \u0646\u0634\u062f.\u0648\u0642\u062a\u06cc \u0647\u0645 \u0628\u0647 \u067e\u06cc\u06a9 \u0627\u0639\u062a\u0631\u0627\u0636 \u0645\u06cc\u06a9\u0646\u06cc\u0645 \u0645\u06cc\u06af\u0646 \u0645\u0646 \u0627\u0632 \u06a9\u062c\u0627 \u0628\u0627\u06cc\u062f \u0645\u06cc\u0641\u0647\u0645\u06cc\u062f\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647 \u06a9 \u062d\u0648\u0627\u0633\u0645 \u0628\u0627\u0634\u0647 :/ ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0627\u0632 \u062f\u0648 \u0637\u0631\u0641 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644 \u0638\u0627\u0647\u0631\u06cc\u0634 \u0631\u0648 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u060c \u0627\u0632 \u0646\u0638\u0631 \u0645\u0632\u0647 \u0647\u0645 \u0627\u0635\u0644\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u0628\u0627\u0631\u0647\u0627 \u062d\u0636\u0648\u0631\u06cc \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0631\u0648 \u06af\u0631\u0641\u062a\u0645 \u0648\u0644\u06cc \u0627\u06cc\u0646\u200c\u0628\u0627\u0631 \u06a9\u0647 \u062a\u0648 \u0627\u0641\u0631\u0634\u0648\u0646 \u0627\u0646\u0644\u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u062e\u06cc\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062a\u0641\u0627\u0648\u062a\u06cc \u062f\u0627\u0634\u062a \u0648\u0637\u0645\u0639 \u0645\u0648\u0646\u062f\u06af\u06cc \u0645\u06cc\u200c\u062f\u0627\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u0632 \u062e\u062f\u0645\u0627\u062a \u0645\u062a\u0646\u0648\u0639 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u062a\u0634\u06a9\u0631\u0645\u061b \u0648\u0644\u06cc \u0627\u0634\u06a9\u0627\u0644 \u06a9\u0627\u0631 \u0627\u06cc\u0646\u062c\u0627 \u0628\u0648\u062f \u06a9\u0647 \u062f\u0648 \u0639\u062f\u062f \u0627\u0632  \u0645\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0632\u06cc\u0627\u062f \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u060c \u0622\u062f\u0645 \u0628\u0647 \u0627\u06cc\u0646 \u0646\u062a\u06cc\u062c\u0647 \u0645\u06cc \u0631\u0633\u0647 \u062a\u062e\u0641\u06cc\u0641 \u0631\u0627 \u0628\u06cc \u062f\u0644\u06cc\u0644 \u0646\u0632\u062f\u0646. \u0645\u0646 \u0642\u0628\u0644\u0627 \u0647\u0645 \u0627\u0632\u0634\u0648\u0646 \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u0645 \u06a9\u0648\u06a9\u06cc \u0647\u0627\u06cc\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a\u0646\u060c \u0627\u0645\u0627 \u0627\u06cc\u0646\u0628\u0627\u0631 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u0648\u06a9\u06cc \u0647\u0627\u06cc \u0645\u0648\u0631\u062f \u0639\u0644\u0627\u0642\u0647 \u0645\u0627 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0639\u0636\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u062a\u0647\u06cc\u0647 \u06a9\u0631\u062f\u06cc\u0645 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f\u0646. \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0634\u06af\u0644 \u0648 \u067e\u0627\u06cc \u0648 \u06a9\u0631\u0627\u0645\u0628\u0644 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f\u0646. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0627\u0644\u0628\u062a\u0647 \u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0639\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0627\u0648\u0631 \u0646\u06a9\u0631\u062f\u0646\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0627\u0646\u062f\u0627\u0632\u0647 \u0645\u0646\u0627\u0633\u0628 \u0647\u0633\u062a \u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0647\u0633\u062a \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["awliiiiii", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0645\u062c\u0645\u0648\u0639\u0647 \u062e\u0648\u0628 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u0642\u0646\u0627\u062f\u06cc \u0646\u06cc\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0644\u0637\u06cc\u0641\u0647 \u0648\u0627\u0642\u0639\u0627 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f.\u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0627\u0635\u0644\u0627 \u0645\u0646\u0627\u0633\u0628 \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc \u0646\u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0645\u0648\u0633 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u0631\u0648\u0644\u062a \u0646\u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u0648\u0644\u06cc \u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0647\u0627 \u06a9\u0647\u0646\u0647 \u0648 \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f\u0646", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u062a\u0642\u0631\u06cc\u0628\u0646 \u062f\u0648 \u0628\u0631\u0627\u0631 \u0632\u0645\u0627\u0646 \u062a\u0639\u06cc\u06cc\u0646 \u0634\u062f\u0647.\u0627\u0645\u0627 \u0627\u0632 \u0622\u0646 \u0628\u062f\u062a\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0628\u0647 \u0637\u0648\u0631\u06cc \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0628\u0647 \u0647\u0645 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u062a\u0642\u0631\u06cc\u0628\u0646 \u062a\u0645\u0627\u0645 \u0622\u0646 \u0647\u0627 \u0631\u0627 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0627\u0632 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u06cc\u0631\u0648\u0646 \u0622\u0648\u0631\u062f\u0645. \u06a9\u0627\u0641\u06cc \u0628\u0648\u062f \u062c\u0639\u0628\u0647 \u0628\u0632\u0631\u06af\u062a\u0631\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u0646\u062f. \u0628\u0627 \u0627\u0648\u062c\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u06a9\u0647 \u0645\u0647\u0645\u0627\u0646 \u062f\u0627\u0634\u062a\u06cc\u0645 \u0647\u0631 \u062f\u0648 \u0645\u0648\u0636\u0648\u0639 \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0631\u0627\u062d\u062a \u06a9\u0646\u0646\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc 650 \u06af\u0631\u0645", "\u067e\u0627\u06cc \u0645\u06cc\u0648\u0647 \u06a9\u0631\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0627\u0646\u062a\u0642\u0627\u062f \u0646\u062f\u0627\u0631\u0645 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0647\u0645 \u0646\u062f\u0627\u0631\u0645 \u0686\u0648\u0646 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0645\u0647 \u0686\u06cc \u06a9\u0627\u0645\u0644 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0628\u0627 \u062a\u0634\u06a9\u0631 \u0641\u0631\u0627\u0648\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0628\u0627\u0646 1200 \u06af\u0631\u0645\u06cc (20 \u062a\u0627 23 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0646\u06af\u0627\u0631 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0634\u06cc\u0631\u0646\u06cc \u0645\u062e\u0635\u0648\u0635\u0627 \u0631\u0648\u0644\u062a\u06cc\u0634 \u06cc\u062c\u0648\u0631\u06cc \u0628\u0648\u062f \u0627\u0635\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u0648\u0627\u0633\u0647 \u0627\u064a\u0646 \u0643\u0647 \u0627\u0632 \u0646\u064a\u0634\u0643\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c\u0661\u0665\u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0646 \u0647\u0632\u064a\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u062f\u0627\u062f\u0645(\u0647\u0632\u064a\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u062e\u064a\u0644\u064a \u0632\u064a\u0627\u062f \u0628\u0648\u062f)\u0628\u0644\u0643\u0647 \u0643\u064a\u0643 \u0633\u0627\u0644\u0645 \u0648 \u0628\u0627 \u067e\u064a\u0643 \u0645\u0646\u0627\u0633\u0628 \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0647(\u0628\u064a\u0634 \u0627\u0632 \u064a\u0643 \u0633\u0627\u0639\u062a \u0647\u0645 \u0637\u0648\u0644 \u0643\u0634\u064a\u062f)\u0648\u0644\u064a \u0646\u0635\u0641 \u0643\u064a\u0643 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0632\u064a\u064a\u0646 \u0631\u0648\u064a \u0627\u0648\u0646 \u0647\u0645 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f\u060c\u0633\u0627\u064a\u0632 \u0643\u064a\u0643 \u0647\u0645 \u0643\u0648\u0686\u0643 \u0628\u0648\u062f \u0646\u0647 \u0645\u062a\u0648\u0633\u0637!!!!\u0648 \u0641\u0642\u0637 \u0643\u064a\u0643 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647\u060c\u0646\u0647 \u0645\u0648\u0632 \u0648 \u0646\u0647 \u06af\u0631\u062f\u0648 \u0647\u064a\u0686\u064a \u0646\u062f\u0627\u0634\u062a(\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0642\u064a\u0645\u062a \u0627\u0635\u0644\u0627 \u0643\u064a\u0641\u064a\u062a \u0645\u0646\u0627\u0633\u0628 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a)\u060c\u0643\u064a\u0643 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0645\u0646 \u0643\u064a\u0643 \u0631\u0648 \u0648\u0627\u0633\u0647 \u0645\u0647\u0645\u0648\u0646\u064a \u062a\u0648\u0644\u062f \u0645\u064a\u062e\u0648\u0627\u0633\u062a\u0645 \u0643\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u062c\u0631\u0628\u0647 \u062e\u064a\u0644\u064a\u064a\u064a \u0628\u062f\u064a \u0631\u0648 \u0628\u0631\u0627\u0645 \u0631\u0642\u0645 \u0632\u062f\u060c\u0627\u0635\u0644\u0627 \u0627\u0632 \u0646\u064a\u0634\u0643\u0631 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u062f\u0627\u0634\u062a\u0645 \u0648 \u062f\u064a\u06af\u0647 \u0647\u064a\u0686 \u0648\u0642\u062a \u0627\u0632\u0634\u0648\u0646 \u062e\u0631\u064a\u062f \u0646\u0645\u064a\u0643\u0646\u0645!", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u062a\u0648\u0633\u0637(\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u0633\u0648\u0626\u06cc\u0633\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u06a9\u0627\u06a9\u0627\u0626\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0627\u0631\u0632\u0634 \u0635\u0628\u0631 \u06a9\u0631\u062f\u0646 \u0631\u0648 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0639\u0636\u06cc \u0627\u0632 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0647\u0627 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0631\u062e\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0627 \u062f\u06cc\u0648\u0627\u0631\u0647 \u0648 \u0633\u0642\u0641 \u062c\u0639\u0628\u0647 \u0647\u0627 \u0627\u0632 \u0634\u06a9\u0644 \u062e\u0627\u0631\u062c \u0634\u062f\u0647 \u0628\u0648\u062f\n\u0647\u0645\u0686\u0646\u06cc\u0646 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u06af\u0631\u0645\u0627 \u0647\u0645 \u0645\u0642\u062f\u0627\u0631\u06cc \u0634\u0644 \u0628\u0648\u062f\u0646\n\u0639\u0644\u062a\u0634 \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u06cc\u0631 \u0648 \u0628\u06cc\u0631\u0648\u0646 \u0645\u0627\u0646\u062f\u0646 \u0627\u0632 \u06cc\u062e\u0686\u0627\u0644 \u0648 \u0647\u0645 \u062d\u0645\u0644 \u0646\u0627 \u0645\u0646\u0627\u0633\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u0648\u0632\u0646 \u0647\u0627\u06cc \u0627\u0639\u0644\u0627\u0645\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u06a9\u0647 \u062a\u062e\u0641\u06cc\u0641 \u0645\u0646\u0627\u0633\u0628\u06cc \u0647\u0645 \u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0637\u0644\u0648\u0628 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f \u0648 \u0628\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u067e\u0627\u0633\u062e\u06af\u0648\u06cc\u0627\u0646 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062f\u0627\u0634\u062a\u0646\u062f  \u0628\u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u06cc\u062a\u0627\u0644\u06cc\u0627\u06cc\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0631\u0633\u0627\u0644 \u062f\u0631 \u0632\u0645\u0627\u0646 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0648\u062a\u0627\u0647\u06cc \u0635\u0648\u0631\u062a \u06af\u0631\u0641\u062a \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647.\u0628\u0633\u06cc\u0627\u0631 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u062f \u0633\u0641\u0627\u0631\u0634 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 \u062e\u0627\u06a9 \u0642\u0646\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 2 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u062e\u06cc\u0644\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u060c \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0628\u06cc \u0645\u0632\u0647 \u0648 \u0642\u0633\u0645\u062a \u0632\u06cc\u0631\u06cc\u0634 \u0647\u0645 \u06cc\u0647 \u06a9\u06cc\u06a9 \u0634\u0644 \u0648 \u0648\u0644 \u0648 \u0628\u06cc \u0645\u0632\u0647 \u0628\u0648\u062f \u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0647\u0645 \u0647\u06cc\u0686 \u0631\u0628\u0637\u06cc \u0628\u0647 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u062f\u0627\u0634\u062a \u0648 \u0628\u06cc\u0634\u062a\u0631 \u0645\u062b\u0644 \u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u062a\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u060c \u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0645\u06cc\u06af\u0631\u0641\u062a\u0645 \u0648 \u0686\u0648\u0646 \u0627\u0632 \u0644\u06cc\u0633\u062a \u062d\u0630\u0641 \u0634\u062f\u0647 \u0628\u0648\u062f \u0646\u0627\u0686\u0627\u0631\u0627 \u0627\u06cc\u0646 \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u067e\u0634\u06cc\u0645\u0648\u0646 \u0647\u0645 \u0634\u062f\u0645 \u060c \u062f\u0631 \u06a9\u0644 \u0647\u0645 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0646\u0631\u0633\u06cc\u062f \u0648 1\u0633\u0627\u0639\u062a \u0647\u0645 \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0627\u06cc \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0634 \u0622\u0645\u0627\u062f\u0633\u062a \u0648 5\u062f\u0642\u06cc\u0642\u0647 \u0628\u0627 \u0645\u0642\u0635\u062f \u0641\u0627\u0635\u0644\u0647 \u062f\u0627\u0631\u0647  \u062e\u06cc\u0644\u06cc \u0632\u0645\u0627\u0646 \u0632\u06cc\u0627\u062f\u06cc\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0639\u0627\u0644\u06cc\u0647 \u0648 \u0645\u0632\u0647 \u062e\u0648\u0628\u06cc \u062f\u0627\u0631\u0647. \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0645\u06cc\u0631\u0633\u0648\u0646\u0647. \u0633\u067e\u0627\u0633 \u0627\u0632 \u0647\u0631 \u062f\u0648.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648 \u062a\u0634\u06a9\u0631 \n\u062f\u0631 \u062d\u06cc\u0646 \u0627\u0646\u062a\u0642\u0627\u0644 \u06a9\u06cc\u06a9 \u06a9\u0645\u06cc \u06a9\u062c \u0634\u062f\u0647 \u0648 \u06a9\u0645\u06cc \u0622\u0633\u06cc\u0628 \u062f\u06cc\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06af\u0645\u0648\u0646\u0645 \u0627\u0635\u0644\u0627 \u0646\u0645\u06cc \u062f\u0648\u0646\u0646\u062f \u06a9\u0647 \u0644\u0637\u06cc\u0641\u0647 \u0686\u06cc\u0647 \n\u0645\u062b\u0644 \u0633\u0646\u06af \u0628\u0648\u062f\n\u0645\u06cc\u0646\u06cc \u0628\u0631\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647 \u0647\u0645 \u06a9\u062c \u0648 \u06a9\u0648\u0644\u0647 \u0628\u0648\u062f\n\u0628\u0627\u0645\u06cc\u0647 \u0647\u0627 \u0647\u0645 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0628\u0631\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0644\u0637\u06cc\u0641\u0647 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["one of the best", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc", 1]}
{"text": ["\u0646\u0627\u062a\u0644\u06cc \u0647\u0631\u0648\u06cc \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0627\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0628\u0644\u0648\u06a9\u0627\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0632\u0648\u062f \u0647\u0645 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648", "\u0634\u0645\u0639 \u0639\u062f\u062f\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.\u0641\u0642\u0637 \u0642\u0644\u0628 \u0647\u0627\u06cc \u0631\u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u062d\u0631\u06a9\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f.\u0645\u0631\u0631\u0631\u0633\u06cc \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648 \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632\u0647\u0627\u06cc \u0642\u0628\u0644 \u0641\u0631\u0648\u062e\u062a\u0647 \u0646\u0634\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u062d\u0633\u0627\u0628\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0645\u064a\u0648\u0647 \u0627\u064a \u0628\u0633\u064a\u0627\u0631 \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u064a\u0634 \u0627\u0632 \u062d\u062f \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u06a9 \u0646\u0641\u0631\u0647", "\u062f\u0633\u0631 \u0631\u0627\u0632\u0628\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u0627\u0632\u0628\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0631\u0648\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u06a9\u0627\u0645\u0644\u0627 \u062a\u0631\u0634 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u06cc\u06a9 \u0645\u0627\u0647\u0647 \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u062c\u0648\u0631\u06cc \u06a9\u0647 \u0647\u06cc\u0686\u06a9\u0633 \u0646\u062e\u0648\u0631\u062f \u0647\u0645\u0647 \u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648 \u062f\u0633\u0631 \u0647\u0627 \u0628\u0647 \u062c\u0632 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f . \u0627\u0635\u0644\u0627 \u062f\u06cc\u06af\u0647 \u062e\u0631\u06cc\u062f \u0646\u0645\u06cc\u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u0627\u0632\u0628\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0631\u0648\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u06a9\u0631\u0645 \u0641\u0646\u062f\u0642 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0648 \u062a\u0627\u0632\u0647 \u0648\u0627\u0642\u0639\u0627 \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645\n\u062e\u064a\u0644\u064a \u0647\u0645 \u0633\u0631\u064a\u0639 \u0631\u0633\u064a\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0645\u0648\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0641\u0642\u0637 \u06cc\u0647 \u06a9\u0648\u0686\u0648\u0644\u0648 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0632 \u0631\u0648\u06cc \u0633\u06cc\u0646\u06cc \u0645\u0642\u0648\u0627\u06cc\u06cc \u0632\u06cc\u0631\u0634\n\u06a9\u0644\u0627 \u0631\u0627\u0636\u06cc \u0627\u0645 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0648 \u0632\u0645\u0627\u0646 \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc\n\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0647\u0645 \u0643\u064a\u0641\u064a\u062a\u0634 \u0648 \u0628\u0633\u064a\u0627\u0631 \u0633\u0631\u064a\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u06cc \u062a\u0631\u0633\u06cc\u062f\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0627\u0634\u0647 \u0648\u0644\u06cc \u0628\u0631\u0639\u06a9\u0633 \u0647\u0645\u0647 \u0627\u0634 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0642\u0637\u0627\u0628 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc. \u062a\u0627\u0632\u0647 \u0648 \u062a\u0631\u062f. \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u06a9\u0648\u0646 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f \u0646\u0635\u0641 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u062a\u0645\u0627\u0645 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u0637\u0627\u0628 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u06cc \u062a\u0627\u0628\u06cc", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647\u060c \u0641\u0642\u0637 \u06cc\u06a9\u0645 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0645\u062d\u062a\u0648\u0627\u0634 \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u062e\u0635\u0648\u0635 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0633\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0628\u062f\u0648\u0646 \u062a\u0632\u06cc\u06cc\u0646 \u0648...! \u06a9\u0646\u062c\u06a9\u0627\u0648\u0645 \u0627\u06af\u0647 \u0645\u062e\u0635\u0648\u0635 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631\u06cc\u0647 \u0627\u0648\u0646 \u0645\u0646\u0648 \u0633\u0627\u062f\u0647 \u0686\u0647 \u062c\u0648\u0631\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0627\u0632 \u0627\u0633\u0646\u067e\u200c\u0627\u06a9\u0633\u067e\u0631\u0633 \u0647\u0645 \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", "\u062f\u0633\u0631 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u0631\u0632\u0628\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u064a\u06af\u0647 \u0646\u0648\u0646 \u0633\u0648\u062e\u0627\u0631\u064a\u0648 \u0627\u0632 \u0627\u064a\u0646 \u062e\u0648\u0631\u062f\u062a\u0631 \u0646\u0645\u064a\u062a\u0648\u0646\u0633\u062a\u0646 \u0628\u0643\u0646\u0646 \u0648\u0627\u0642\u0639\u0627\u064b \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u200c\u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u062a", "\u062f\u0633\u0631 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0698\u0627\u0645\u0628\u0648\u0646 \u0628\u0648\u0642\u0644\u0645\u0648\u0646 \u062a\u0646\u0647\u0627 \u062f\u0648 \u067e\u0631 \u06a9\u0627\u0644\u0628\u0627\u0633 \u0628\u0648\u0642\u0644\u0645\u0648\u0646 \u0628\u0648\u062f \u062f\u0631 \u06cc\u06a9 \u0646\u0627\u0646 \u0639\u062c\u06cc\u0628 \u06a9\u0647 \u0627\u0646\u06af\u0627\u0631 \u0646\u0627\u0646 \u0633\u0646\u06af\u06a9 \u0622\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u06a9\u0647 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f!!!!!! \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0648 \u062d\u06cc\u0641 \u067e\u0648\u0644", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u06cc\u0686 \u067e\u0633\u062a\u0648 \u0698\u0627\u0645\u0628\u0648\u0646 \u0628\u0648\u0642\u0644\u0645\u0648\u0646", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u06cc\u06a9\u0646 \u0648 \u067e\u0646\u06cc\u0631", -1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0648 \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0628\u0648\u062f.\u06af\u0627\u062a\u0627 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0633\u0627\u062f\u0647", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u062d\u062c\u0645 \u067e\u0646\u06cc\u0631 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0647\u0631\u0628\u0627\u0631 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062b\u0628\u062a \u0645\u06cc\u06a9\u0646\u06cc\u0645 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0645\u0648\u062c\u0648\u062f\u06cc \u0645\u0646\u0627\u0633\u0628 \u0646\u062f\u0627\u0631\u0647 \u0648 \u0632\u0646\u06af \u0645\u06cc\u0632\u0646\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0647\n\u062e\u0628 \u0645\u0634\u062a\u0631\u06cc \u0627\u06af\u0647 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u0647\u0645\u0648\u0646\u0648 \u062b\u0628\u062a \u0645\u06cc\u06a9\u0646\u0647\n\u0627\u06cc\u0646 \u06a9\u0627\u0631 \u0645\u0634\u062a\u0631\u06cc \u0631\u0648 \u0645\u062c\u0628\u0648\u0631 \u0628\u0647 \u062e\u0631\u06cc\u062f \u0686\u06cc\u0632\u06cc  \u06a9\u0647 \u0646\u0645\u06cc\u062e\u0648\u0627\u062f \u06a9\u0631\u062f\u0646\u0647!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627\u06cc\u06cc", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648 (1 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u067e\u0631\u0633\u0646\u0644 \u0645\u062d\u062a\u0631\u0645 \u0646\u0627\u0646 \u0633\u062d\u0631\u060c \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633.\n\u06cc\u06a9 \u062f\u0646\u06cc\u0627 \u0633\u067e\u0627\u0633.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0628\u0647 \u0646\u0633\u0628\u062a \u0645\u0633\u0627\u0641\u062a \u0632\u06cc\u0627\u062f \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06af\u0627\u062a\u0627", "\u062c\u0648 \u062e\u0634\u06a9 \u0634\u0627\u0647\u062f\u0627\u0646\u0647", 1]}
{"text": ["\u0646\u0648\u0646\u200c\u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c \n\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0647\u0645 \u0628\u06cc\u0634\u062a\u0631 \u067e\u0627\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644 \u0628\u0648\u062f \u062a\u0627 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 7 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0648\u062c\u0648\u062f\u064a \u0628\u0647 \u0631\u0648\u0632 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0633\u0641\u0627\u0631\u0634 \u062c\u0627\u064a\u06af\u0632\u064a\u0646 \u0634\u062f \u060c \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0643\u0631\u0648\u0633\u0627\u0646\u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0633\u0628\u0648\u0633 80%", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0644\u0630\u06cc\u0630. \u0642\u06cc\u0645\u062a \u0645\u0646\u0627\u0633\u0628\u06cc \u062f\u0627\u0634\u062a \u0641\u0642\u0637 \u06a9\u0627\u0634 \u0633\u0633 \u0633\u0641\u06cc\u062f \u06cc\u06a9\u0628\u0627\u0631 \u0645\u0635\u0631\u0641 \u0647\u0645 \u0645\u06cc\u06af\u0630\u0627\u0634\u062a \u0686\u0648\u0646 \u0633\u0633 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u06cc\u06a9\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0645\u0631\u063a \u0648 \u0647\u0627\u0644\u0648\u067e\u06cc\u0646\u0648", 1]}
{"text": ["\u0648\u0642\u062a\u06cc \u0642\u0631\u0627\u0631 \u0628\u0627\u0634\u0647 \u0647\u0631 \u062f\u0641\u0639\u0647 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc \u0647\u0631 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0646 \u0628\u0641\u0631\u0633\u062a\u0646 \u0647\u0631\u0686\u0642\u062f\u0631 \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0627\u0634\u0647 \u0627\u0631\u0632\u0634 \u0646\u062f\u0627\u0631\u0647.\u0647\u06cc\u0686 \u062a\u0646\u0627\u0633\u0628\u06cc \u0628\u06cc\u0646 \u0645\u0648\u0627\u0631\u062f \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u0644\u06cc\u0633\u062a \u0633\u0641\u0627\u0631\u0634 \u0628\u0627 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0646\u0647\u0627\u06cc\u062a\u0627 \u0628\u062f\u0633\u062a\u062a \u0645\u06cc\u0631\u0633\u0647 \u0646\u062f\u0627\u0631\u0647 \u0648 \"\u0647\u0631 \u062f\u0641\u0639\u0647\" \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0632\u0646\u06af \u0645\u06cc\u0632\u0646\u0647 \u06a9\u0647 \u0641\u0644\u0627\u0646 \u0645\u0648\u0631\u062f \u0631\u0627 \u0646\u062f\u0627\u0631\u0647 \u0648 \u0645\u0648\u0631\u062f \u062c\u062f\u06cc\u062f \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0645\u06cc\u06a9\u0646\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0646\u0641\u0631 \u0628\u0639\u062f\u06cc \u062f\u0648\u0628\u0627\u0631\u0647 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0632\u0646\u06af \u0645\u06cc\u0632\u0646\u0647 \u06a9\u0647 \u0645\u0648\u0631\u062f \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0634\u062f\u0647 \u0647\u0645 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0648 \u062f\u0631 \u0646\u0647\u0627\u06cc\u062a \u067e\u0648\u0644\u06cc \u06a9\u0647 \u062f\u0627\u062f\u06cc \u06cc\u0627 \u062a\u0628\u062f\u06cc\u0644 \u0628\u0647 \u0627\u0639\u062a\u0628\u0627\u0631 \u0627\u06a9\u0627\u0646\u062a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u06cc\u0634\u0647 \u06cc\u0627 \u06cc\u0647 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0646\u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u06cc \u062a\u062d\u0645\u06cc\u0644 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0647 \u0634\u062f\u062a \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u061b \u062c\u0648\u0631\u06cc \u06a9\u0647 \u0648\u0627\u0642\u0639\u0627 \u0646\u0645\u06cc\u0634\u062f \u062e\u0648\u0631\u062f! \u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u062c\u0627\u06cc\u06cc \u0645\u062b\u0644 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06a9\u06cc\u06a9 \u0628\u0627 \u0627\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0639\u06cc\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u0648 \u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0633\u0648\u0641\u0644\u0647 \u0627\u06cc\u0646\u200c\u062f\u0641\u0639\u0647 \u0628\u0647 \u062e\u0648\u0634\u0645\u0632\u06af\u06cc \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0631\u0627\u0636\u06cc \u06a9\u0646\u0646\u062f\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648 \u0627\u0633\u0646\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", 1]}
{"text": ["\u0645\u0633\u0627\u0641\u062a \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06f1\u06f0\u06f0 \u0645\u062a\u0631 \u060c \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u06f5\u06f0.\u06f0\u06f0\u06f0\u0631\u06cc\u0627\u0644 \u0686\u0631\u0627\u061f\u061f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0627\u06cc\u0646 \u0628\u0627\u0631 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0628\u0631 \u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", 1]}
{"text": ["\u0627\u062f\u0631\u0633 \u0645\u0646 \u0648\u0627\u0636\u062d \u0627\u0633\u062a \u0648 \u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u062f\u0645 \u0631\u0627 \u0628\u0647 \u0627\u06cc\u0646 \u0627\u062f\u0631\u0633 \u0645\u06cc \u062f\u0647\u0645 \u0648\u0644\u06cc \u0627\u06cc\u0646 \u0627\u0642\u0627 \u062e\u06cc\u0644\u06cc \u0627\u0630\u06cc\u062a \u06a9\u0631\u062f\u0646 \n\u06cc\u06a9 \u0628\u0627\u0631 \u0632\u0646\u06af \u0632\u062f\u0646 \u0645\u06cc \u06af\u0646 \u0647\u0645\u0686\u06cc\u0646 \u06a9\u0648\u0686\u0647 \u0627\u06cc \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u0647 \u06cc\u06a9 \u0628\u0627\u0631 \u0632\u0646\u06af \u0632\u062f\u0646 \u0645\u06cc \u06af\u0646 \u0647\u0645\u0686\u06cc\u0646 \u067e\u0644\u0627\u06a9\u06cc \u0646\u06cc\u0633\u062a \u0627\u0635\u0644\u0627\u0646 \n\u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0633\u06cc\u0627\u0631 \u0636\u0639\u06cc\u0641 \u0637\u0631\u0632 \u0635\u062d\u0628\u062a \u0628\u0633\u06cc\u0627\u0631 \u0636\u0639\u06cc\u0641", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", -1]}
{"text": ["\u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0686\u0646\u062f \u0633\u0627\u0644\u0647 \u0634\u0645\u0627 \u0647\u0633\u062a\u0645\u060c\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0628\u0647 \u062c\u0627\u06cc \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u06cc\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f!\u0627\u0646\u0642\u062f\u0631 \u062e\u0634\u06a9 \u0628\u0648\u062f \u06a9\u0647 \u0642\u0627\u0628\u0644 \u0628\u0631\u0634 \u062f\u0627\u062f\u0646 \u0646\u0628\u0648\u062f!\u0631\u0646\u06af \u0622\u0644\u0628\u0627\u0644\u0648\u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u062a\u06cc\u0631\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0632 \u0645\u0648\u0646\u062f\u06af\u06cc!\u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0646\u0633\u0628\u062a \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f!\u0641\u0627\u0635\u0644\u0647 \u0645\u0646 \u062a\u0627 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06f5\u06f0\u06f0 \u0645\u062a\u0631 \u0647\u0645 \u0646\u06cc\u0633\u062a!\u06f5\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0627\u0646 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0645\u0633\u0627\u0641\u062a \u063a\u06cc\u0631 \u0639\u0627\u062f\u0644\u0627\u0646\u0647 \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u0628\u0647 \u0646\u0633\u0628\u062a \u0642\u06cc\u0645\u062a \u0646\u0645\u06cc \u0627\u0631\u0632\u062f \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0648\u0686\u06a9 \u0641\u06a9\u0631 \u06a9\u0646\u0645 \u0628\u06cc\u0634 \u0627\u0632 \u06f2\u06f5 \u062a\u0648\u0645\u0646 \u0646\u0628\u0627\u06cc\u062f \u0628\u0627\u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a (9 \u062a\u0627\u06cc\u06cc)", 1]}
{"text": ["\u0646\u0645\u06cc \u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u0648\u0644\u06cc \u0641\u06a9\u0631 \u0645\u06cc \u06a9\u0646\u0645 \u062a\u0648 cip \u0641\u0631\u0648\u062f\u06af\u0627\u0647 \u0627\u0645\u0627\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0628\u0648\u062f \u067e\u0648\u062f\u06cc\u0646\u06af\u0627\u062a\u0648\u0646 \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u0641\u062a \u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647\u200c\u0646\u0628\u0648\u062f. \u06a9\u06cc\u06a9 \u0627\u0633\u0641\u0646\u062c\u06cc \u0648\u0633\u0637\u0634 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \n\u0642\u0628\u0644\u0627 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0648 \u0634\u0645\u0627\u0631\u0647 \u067e\u06cc\u06a9 \u0646\u0645\u0627\u06cc\u0634 \u062f\u0627\u062f\u0647 \u0646\u0645\u06cc\u0634\u062f\u060c \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0627\u06cc\u0646 \u0645\u0634\u06a9\u0644 \u062d\u0644 \u0634\u062f\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0627\u06af\u0631 \u0628\u0647 \u06af\u0632\u064a\u0646\u0647 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u0639\u0645\u0644 \u0646\u0645\u064a\u0643\u0646\u064a\u062f \u0644\u0637\u0641\u0627 \u062d\u0630\u0641 \u0643\u0646\u064a\u062f\u060c\u0645\u0646 \u062e\u0648\u0627\u0633\u062a\u0645 \u0631\u0648\u064a \u0643\u064a\u0643 \u0627\u0631\u0633\u0627\u0644\u064a \u0686\u064a\u0632\u064a \u0646\u0648\u0634\u062a\u0647 \u0634\u0648\u062f \u062d\u062a\u064a \u0631\u0648\u064a \u0641\u0627\u0643\u062a\u0648\u0631 \u0647\u0645 \u0627\u0648\u0645\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0646 \u0627\u0631\u0633\u0627\u0644\u064a \u0648\u0644\u064a \u0648\u0642\u062a\u064a \u0643\u064a\u0643 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u064a\u062f \u0647\u064a\u0686 \u0645\u062a\u0646\u064a \u0631\u0648\u064a \u0643\u064a\u0643 \u0646\u0648\u0634\u062a\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f\u060c\u0627\u064a\u0646 \u0628\u064a \u062a\u0648\u062c\u0647\u064a \u0634\u0645\u0627\u0631\u0648 \u0645\u064a\u0631\u0633\u0648\u0646\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc (\u0645\u062a\u0648\u0633\u0637\u060c\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u0648\u0642\u062a\u064a \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0647 \u0631\u0648 \u062f\u0633\u062a \u0646\u064a\u0634\u0643\u0631 \u0646\u064a\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", 1]}
{"text": ["\u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u062f. \u062f\u0631 \u0645\u06cc\u06a9\u0633 \u062f\u0633\u0631 \u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u0634\u06cc \u0631\u062f\u0648\u0644\u0648\u062a \u0648 \u0631\u0648\u0644\u062a \u0645\u062e\u0635\u0648\u0635 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u062d\u062a\u0645\u0627 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0628\u0647 \u0647\u0645\u0647\u060c \u0628\u0633\u06cc\u0627\u0631 \u0644\u0630\u06cc\u0630 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062a\u0639\u0627\u062f\u0644 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647.  \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0647\u0645 \u0627\u0632 \u0644\u062d\u0627\u0638 \u062c\u0646\u0633 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u0628\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0647\u0633\u062a \u0648 \u0627\u0632 \u0644\u062d\u0627\u0638 \u0637\u0639\u0645 \u06cc\u06a9 \u0637\u0639\u0645 \u0645\u0644\u0627\u06cc\u0645 \u06af\u0631\u062f\u0648\u06cc\u06cc \u062f\u0627\u0631\u0647. \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0634\u06a9\u0631 \u0632\u0639\u0641\u0631\u0627\u0646\u06cc\u0647 \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0648\u0628\u062a\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0633\u0631", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0627\u0632 \u06cc\u062e\u0686\u0627\u0644 \u0628\u06cc\u0631\u0648\u0646 \u0627\u0648\u0645\u062f\u0647 \u0628\u0648\u062f \u0648 \u0633\u0631\u062f \u0648 \u0633\u0641\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 4 650 \u06af\u0631\u0645", -1]}
{"text": ["\u06a9\u0644 \u062a\u0627\u0631\u062a \u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0628\u0647 \u062e\u0627\u0637\u0631 \u062d\u0645\u0644 \u0628\u062f \u067e\u06cc\u06a9 ", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0646\u06cc\u0648\u0645 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0631\u0648\u0634\u064a \u0646\u064a\u0634\u0643\u0631 \u062e\u064a\u0644\u064a \u0628\u0647 \u0645\u0627 \u0646\u0632\u062f\u064a\u0643\u0647 \u060c (\u062a\u0642\u0631\u064a\u0628\u0627\u0662\u0660\u0660 \u0645\u062a\u0631) \u060c \u062e\u062f\u0648\u062f \u0663\u0660 \u0627\u0644\u064a \u0664\u0660 \u062f\u0642\u064a\u0642\u0647 \u0637\u0648\u0644 \u0643\u0634\u064a\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f. \u06cc\u06a9 \u062a\u0627\u0631\u062a \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0628\u0627\u0646 650 \u06af\u0631\u0645\u06cc (10 \u062a\u0627 12 \u0639\u062f\u062f)", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06a9\u0648\u0686\u06a9) 650 \u06af\u0631\u0645", -1]}
{"text": ["\u06a9\u06cc\u06a9\u200c\u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u062d\u06cc\u0641 \u0646\u06cc\u0634\u06a9\u0631  \u06a9\u0647 \u0647\u0645\u0686\u06cc\u0646 \u0634\u0639\u0628\u0647 \u0627\u06cc \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc.\u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645 \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a \u0627\u0632 \u0632\u0645\u0627\u0646 \u062a\u0639\u06cc\u06cc\u0646 \u0634\u062f\u0647 \u0632\u0648\u062f\u062a\u0631 \u0622\u0645\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc (\u0645\u062a\u0648\u0633\u0637\u060c\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f.\u0627\u0645\u0627 \u06cc\u06a9\u06cc\u0634 \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f  \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u062e\u0644\u0648\u0637 \u0645\u0648\u0633 \u0645\u062e\u0644\u0648\u0637 \u0645\u0648\u0633 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0634 \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0627\u0648\u0631\u062f\u0634.\n\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u062e\u06cc\u0631 \u062f\u0627\u0634\u062a\u060c\u062a\u0627\u0631\u062a \u06a9\u0644\u0627 \u067e\u0627\u0634\u06cc\u062f\u0647 \u0628\u0648\u062f \u062a\u0648 \u0642\u0648\u0637\u06cc \u06a9\u0644\u06cc \u062a\u0648 \u0630\u0648\u0642\u0645\u0648\u0646 \u062e\u0648\u0631\u062f\u060c\u0648\u0644\u06cc \u0628\u0642\u06cc\u0634 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", "(121) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0641\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06a9\u0648\u0686\u06a9) 650 \u06af\u0631\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0634\u0634\u0634\u0634\u0634\u0647 \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f. \u0627\u0644\u0628\u062a\u0647 \u0644\u0648\u062a\u06a9\u0627 \u0631\u0648 \u200c\u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0648\u062f \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0627\u062f\u0645 \u0627\u0645\u0627 \u0648\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0642\u0639\u0627  \u062a\u0631\u062f \u0648 \u0644\u0630\u06cc\u0630 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 \u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0637\u0639\u0645 \u062e\u0648\u0634\u0627\u06cc\u0646\u062f\u06cc \u0646\u062f\u0627\u0634\u062a.", "(111) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06cc\u06a9\u0633 \u0627\u0633\u06a9\u0627\u0631", -1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u062f\u0648 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631 \u0627\u062e\u0631 \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0646\u0631\u0633\u06cc\u062f!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u06a9\u0627 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0642\u06cc\u0645\u062a \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0645\u0637\u0644\u0642\u0627 \u0628\u0647 \u0635\u0631\u0641\u0647 \u0646\u06cc\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0646\u062c\u0631\u0647 \u0627\u06cc \u06af\u0644 (\u06a9\u0648\u0686\u06a9)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647  \u0631\u062f\u0648\u0644\u0648\u062a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f :(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u06cc\u0641\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631\u0639\u0627\u0644\u06cc \u0648\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0644\u0637\u0641\u0627 \u0628\u0631\u0627\u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u0627\u0632 \u062c\u0639\u0628\u0647 \u0647\u0627\u06cc \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u0648\u062f \u062a\u0627 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u0648 \u0627\u0631\u0633\u0627\u0644 \u062e\u0631\u0627\u0628 \u0646\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9\u0647\u0627 \u06cc\u0627\u062f\u0627\u0648\u0631\u06cc \u06a9\u0646\u06cc\u062f \u0628\u0631\u0627\u06cc \u0627\u0648\u0631\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u06cc\u0634\u062a\u0631 \u062f\u0642\u062a \u06a9\u0646\u0646\u062f \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0631\u0648\u06cc\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u062e\u0648\u0634\u0628\u062e\u062a\u0627\u0646\u0647 \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0637\u0648\u0631\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062e\u0631\u062f\u0646\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0633\u0644\u06cc \u062a\u062e\u062a \u067e\u0633\u062a\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0633\u0644\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u062a\u062e\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645 \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u06cc\u06cc\u0633\u06cc \u0628\u0631\u0627\u0645\u0648\u0646 \u0622\u0648\u0631\u062f\u0646 \n\u062a\u0631\u062c\u06cc\u062d \u0645\u06cc \u062f\u0627\u062f\u0645 \u0627\u06af\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f \u0637\u0628\u0642 \u0646\u0638\u0631 \u062e\u0648\u062f\u0645\u0648\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0645\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0646\u0647 \u0647\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u062f\u0644\u0634\u0648\u0646 \u0645\u06cc \u062e\u0648\u0627\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u06af\u0631\u062f\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0639\u0644\u062a \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0627\u0632 \u062c\u0627\u06cc \u062e\u0648\u062f \u062e\u0627\u0631\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644 \u0638\u0627\u0647\u0631\u06cc \u0622\u0646 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0648\u0644\u06cc \u0628\u0647 \u0646\u0638\u0631\u0645 \u067e\u0648\u0644 \u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u062e\u06cc\u0644\u06cc \u0648\u0642\u062a \u0628\u0647 \u062e\u0627\u0637\u0631 \u067e\u0648\u0644 \u0632\u06cc\u0627\u062f \u067e\u06cc\u06a9 \u0645\u0646 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0627\u062a\u0645 \u0645\u0646\u0635\u0631\u0641 \u0645\u06cc\u0634\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0633\u0631\u06cc \u0628\u0631\u0627\u0646\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u06a9\u0627\u06a9\u0627\u0626\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", 1]}
{"text": ["\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0631\u0633\u06cc.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0633\u0631\u06cc\u0639 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0628\u0631\u0627\u06cc \u062a\u0648\u0644\u062f \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645. \u0648\u0644\u06cc \u0648\u0642\u062a\u06cc \u062c\u0639\u0628\u0647 \u0628\u0627\u0632 \u0646\u0634\u062f \u06a9\u06cc\u06a9 \u0627\u0632 \u0647\u0645\u0647 \u0637\u0631\u0641 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc", "\u0634\u0645\u0639 happy", -1]}
{"text": ["\u0647\u0645\u0647 \u06a9\u06cc\u06a9 \u0627\u0648\u0645\u062f\u0647 \u0628\u0648\u062f \u06cc\u06a9 \u0637\u0631\u0641\u0647 \u062c\u0639\u0628\u0647 \u0648 \u062e\u0627\u0645\u0647 \u0647\u0627\u0634 \u0647\u0645\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062c\u0639\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u06f2\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0622\u0648\u0631\u062f\u0645.\n\u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\u060c\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 \u062a\u0645\u0648\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0647\u0645 \u0632\u0646\u06af \u0632\u062f\u0646 \u0628\u0628\u06cc\u0646\u0646 \u0627\u06af\u0647 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0645\u06cc\u062e\u0648\u0627\u0645 \u0628\u062c\u0627\u0634 \u0628\u0631\u0627\u0645 \u0628\u0641\u0631\u0633\u062a\u0646 \u060c\u062c\u0627\u0634 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062e\u06cc\u0633 \u062e\u0648\u0627\u0633\u062a\u0645 \u06a9\u0647 \u0627\u0648\u0646\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 \u0646\u0628\u0648\u062f\n\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u064a\u0646\u064a \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647. \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0647 \u062c\u0627\u06cc \u06cc\u06a9\u06cc \u0627\u0632 \u0645\u0648\u0627\u0631\u062f \u0627\u0631\u0633\u0627\u0644\u06cc \u06a9\u06cc\u06a9 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u0646.\n\u067e\u06cc\u06a9 \u062c\u0644\u0648\u06cc \u062f\u0631 \u0628\u0647 \u0645\u0646 \u0645\u06cc\u06af\u0647 \u062c\u0627\u06cc \u0627\u06cc\u0646 \u0627\u0648\u0646\u0648 \u062f\u0627\u062f\u0646\n\u0648\u0642\u062a\u06cc \u0645\u0648\u0631\u062f\u06cc \u0631\u0648 \u0646\u062f\u0627\u0631\u0646 \u0628\u0627\u06cc\u062f \u0628\u067e\u0631\u0633\u0646 \u06a9\u0647 \u0686\u06cc \u06a9\u0627\u0631 \u06a9\u0646\u06cc\u0645 \u0646\u0645\u06cc\u0634\u0647 \u062e\u0648\u062f\u0634\u0648\u0646 \u0647\u0631 \u0686\u06cc \u062e\u0648\u0627\u0633\u062a\u0646 \u062c\u0627\u0634 \u0628\u0630\u0627\u0631\u0646 \u0628\u0641\u0631\u0633\u062a\u0646 \u06a9\u0647\n\u0627\u0635\u0644\u0627 \u0627\u0632 \u0627\u06cc\u0646 \u0637\u0631\u0632 \u0628\u0631\u062e\u0648\u0631\u062f \u0631\u0627\u0636\u06cc \u0646\u06cc\u0633\u062a\u0645", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0648\u06cc\u0648\u0631\u06a9\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", -1]}
{"text": ["\u06a9\u0648\u06a9\u062a\u0644 \u0641\u0646\u062c\u0648\u0646\u06cc  \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0638\u0627\u0647\u0631 \u062e\u06cc\u0644\u06cc \u0628\u062f\u06cc \u062f\u0627\u0634\u062a \u0627\u0646\u06af\u0627\u0631 \u06a9\u0647 \u0627\u0632 \u062f\u0633\u062a \u0631\u0627\u0646\u0646\u062f\u0647 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0627\u0634\u0647\n\u0648\u0644\u06cc \u0644\u0637\u06cc\u0641\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u062a\u0644 \u0641\u0646\u062c\u0648\u0646\u06cc", "\u0644\u0637\u06cc\u0641\u0647 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0646\u0627\u0646 \u0648 \u0645\u0648\u0627\u062f \u062a\u0627\u0632\u0647\u060c \u062e\u0648\u0634 \u0637\u0639\u0645\u060c \u067e\u0646\u06cc\u0631 \u067e\u0631\u0686\u0631\u0628\u060c \u0645\u0642\u062f\u0627\u0631 \u0634\u0648\u06cc\u062f \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645\u062a\u0631 \u0627\u0632 \u0639\u06a9\u0633. \u062a\u062d\u0648\u06cc\u0644 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0631\u06cc\u0639\u060c \u0686\u0633\u0628 \u062c\u0639\u0628\u0647 \u0628\u0627\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u06cc\u0641\u06cc \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0627\u0627\u0627\u0627\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0635\u0646 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u062f\u062f.\u0627\u06af\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u062a\u0648\u0646 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a \u062a\u0648 \u0644\u06cc\u0633\u062a \u0633\u0641\u0627\u0631\u0634 \u0646\u0630\u0627\u0631\u06cc\u062f \u0644\u0637\u0641\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u0647\u06cc\u0686 \u0627\u0631\u0632\u0634\u06cc \u0628\u0631\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u0646\u0645\u06cc \u06af\u0630\u0627\u0631\u062f \u0645\u0646 \u062f\u0631 \u0628\u062e\u0634 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0646\u06af\u0630\u0627\u0631\u06cc\u062f \u0648\u0644\u06cc \u0647\u06cc\u0686 \u0627\u0647\u0645\u06cc\u062a\u06cc \u0646\u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0645\u0646 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u062f\u0648\u0631 \u0628\u0631\u06cc\u0632\u0645 \u0648 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0627\u0646\u062a\u0638\u0627\u0631 \u0645\u06cc\u0631\u0647 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u0647. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0628\u0647 \u062e\u0648\u0646\u0647 \u0645\u0646 \u062e\u06cc\u0644\u06cc \u0646\u0632\u062f\u06cc\u06a9 \u0648\u0644\u06cc \u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0648\u062f \u0627\u0632\u0634\u0648\u0646 \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u0645 . \u0642\u0637\u0639\u0627 \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc\u0634\u0648\u0646 \u062e\u0648\u0627\u0647\u0645 \u0634\u062f . \u062e\u06cc\u0644\u06cc \u062a\u0631\u062f \u060c \u062a\u0627\u0632\u0647 \u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062a\u0646\u0627\u0633\u0628 \u0648 \u062a\u0646\u0648\u0639 \u0632\u06cc\u0627\u062f . \u067e\u06cc\u06a9\u062a\u0648\u0646 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0645\u0648\u062f\u0628 \u0628\u0648\u062f\u0646 . \n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u06a9\u0647 \u0647\u0631 \u062e\u0631\u06cc\u062f\u06cc \u0631\u0648 \u0628\u0631\u0627\u0645 \u0644\u0630\u062a \u0628\u062e\u0634 \u0645\u06cc \u06a9\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u0637\u0627\u0628 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06af\u0648\u0634\u0641\u06cc\u0644 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u06af\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0627\u0645\u06cc\u0647 \u0648 \u0632\u0648\u0644\u0628\u06cc\u0627 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u06cc \u0646\u0642\u0635\u060c \u0639\u0627\u0644\u06cc\u060c \u062a\u0627\u0632\u0647 \u0648 \u062a\u0631\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0642\u0637\u0627\u0628 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u0627\u0634 \u0628\u0631\u0627\u06cc \u0634\u0631\u06cc\u0646\u06cc \u0648\u0632\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0648 \u0646\u06cc\u0645 \u0647\u0645 \u0628\u0632\u0627\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u06af\u0648\u0634\u0641\u06cc\u0644 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u0637\u0644\u0648\u0628\u06cc \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0641\u0642\u0637 \u06cc\u0647 \u0631\u062f\u06cc\u0641\u0634 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f  \u0628\u0642\u06cc\u0647 \u0631\u062f\u06cc\u0641 \u0647\u0627\u0634 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0628\u0648\u062f  \u0645\u0645\u0646\u0648\u0646 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f  \u0641\u0642\u0637 \u0647\u0631\u0648\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0628\u062f\u06cc\u062f \u06a9 \u0645\u0634\u062a\u0631\u06cc \u0647\u0627\u062a\u0648\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0648 \u0628\u06cc\u0634\u062a\u0631 \u062a\u0631 \u0627\u0645 \u0628\u0634\u0647  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06af\u0648\u0634\u0641\u06cc\u0644 \u0628\u062f \u0628\u0648\u062f.\u0627\u0632 \u0628\u0648\u06cc \u0648\u062d\u0634\u062a\u0646\u0627\u06a9 \u0645\u0648\u0646\u062f\u06af\u06cc \u0631\u0648\u063a\u0646\u0634 \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u0645\u0627\u0644 \u0686\u0646\u062f\u06cc\u0646 \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0648\u062f.\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06af\u0648\u0634\u0641\u06cc\u0644 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0646\u0647 \u06a9\u0645 \u0628\u0648\u062f \u0646\u0647 \u0632\u06cc\u0627\u062f \u0648 \u062a\u0627\u0632\u0647 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0645\u0631\u062a\u0628 \u0631\u0633\u06cc\u062f \u0648 \u0647\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u062a\u0645\u06cc\u0632 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06af\u0648\u0634\u0641\u06cc\u0644 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0627\u0646\u0645\u06cc \u0632\u0646\u06af \u0632\u062f\u0646 \u0648 \u06af\u0641\u062a\u0646 \u062a\u0633\u062a \u0628\u06cc\u0648\u0646\u0627\u0646 \u0645\u0627\u0644 \u0631\u0648\u0632 \u0642\u0628\u0644\u0647 \u0648 \u0645\u0646 \u0642\u0628\u0648\u0644 \u06a9\u0631\u062f\u0645 \u0648\u0644\u06cc \u0646\u0627\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0642\u062f\u06cc\u0645\u062a\u0631 \u0627\u0632 \u0631\u0648\u0632 \u0642\u0628\u0644 \u0628\u0648\u062f \u0648 \u062a\u0627\u0631\u06cc\u062e \u0628\u0633\u062a\u0647 \u062d\u0630\u0641 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u062a\u0633\u062a \u0628\u06cc\u0648\u0646\u0627\u0646", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0628\u0627 \u0639\u06a9\u0633 \u0645\u0648\u062c\u0648\u062f \u062e\u06cc\u0644\u06cc \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", "\u062f\u0633\u0631 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u0631\u0632\u0628\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627\n\u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u0649\n\u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u064a\u062f\n\u0634\u0627\u062f \u0648 \u0633\u0644\u0627\u0645\u062a \u0628\u0627\u0634\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0627\u0648\u0644 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0632\u0646\u06af \u0632\u062f\u0646\u062f \u06af\u0641\u062a\u0646\u062f \u0646\u062f\u0627\u0631\u0646\u062f \u0644\u0637\u0641\u0627 \u0645\u0648\u0627\u0631\u062f\u06cc \u0645\u0647 \u0645\u0648\u062c\u0648\u062f\u06cc \u062a\u0645\u0627\u0645 \u0645\u06cc\u0634\u0648\u062f \u0631\u0627 \u0627\u0632 \u0644\u06cc\u0633\u062a \u062d\u0630\u0641 \u06a9\u0646\u06cc\u062f \u0628\u0639\u062f\u0634\u0645 \u06a9\u0647 \u0628\u062c\u0627\u06cc \u0698\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u06a9\u0645\u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0627\u0645\u06cc\u0647 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0648\u0627\u0642\u0639\u0627 \u062c\u0627\u06cc \u062a\u0627\u0633\u0641 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0641\u0642\u0637 \u0627\u064a\u0646\u0643\u0647 \u0645\u0646 \u062a\u0648\u064a \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u0641\u0642\u0637 \u0646\u064a\u0645 \u0643\u064a\u0644\u0648 \u0628\u0627\u0645\u064a\u0647 \u0628\u0644\u0646\u062f \u0648\u0644\u064a \u0646\u0635\u0641 \u0632\u0648\u0644\u0628\u064a\u0627 \u0648 \u0646\u0635\u0641 \u0628\u0627\u0645\u064a\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0648\u0644\u064a \u062f\u0631 \u0643\u0644 \u0631\u0627\u0636\u064a \u0627\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0627\u06af\u0631 \u0645\u0648\u0631\u062f\u06cc \u0631\u0627 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u06cc\u062f \u0628\u0627 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0646\u06a9\u0646\u06cc\u062f \n\u0645\u0646 \u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0646\u0648\u062a\u0644\u0627 \u0648 \u0642\u0647\u0648\u0647 \u0645\u06cc \u062e\u0648\u0627\u0633\u062a\u0645 \u06a9\u0647 \u0642\u0628\u0644\u0627 \u0647\u0645 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u06af\u0631\u0641\u062a\u0645 \u0628\u0647 \u062c\u0627\u06cc \u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0642\u0647\u0648\u0647 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u0646\u062f\n\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u0645\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628\u0647, \u0645\u0648\u0627\u0631\u062f \u0627\u06cc\u0646 \u0686\u0646\u06cc\u0646 \u0628\u0627\u0639\u062b \u0633\u0644\u0628 \u0627\u0639\u062a\u0645\u0627\u062f \u0645\u0634\u062a\u0631\u06cc \u0645\u06cc \u0634\u0648\u062f\n\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u062a\u0648\u062c\u0647 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0642\u0647\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0646\u0648\u062a\u0644\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0627\u0646\u0645\u0627\u062f\u06a9\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0642\u062f\u06cc\u0645\u06cc \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u062d\u0627\u0644 \u0646\u06a9\u0631\u062f\u0645 \u0627\u0632 \u0627\u06cc\u0646 \u062e\u0631\u06cc\u062f\u060c", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0631 \u0686\u0646\u062f \u06a9\u06cc\u0641\u062a \u0632\u0648\u0644\u0648\u0628\u06cc\u0627 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u062c\u0631\u0628\u0647 \u0627\u0648\u0644 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0646 \u06f2\u06f2\u06f0\u06f0\u06f0\u062a\u0648\u0645\u0646 \u062f\u0627\u062f\u0645 \u0628\u0627\u0628\u062a \u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc\u060c\u0648\u0644\u06cc \u0646\u062f\u0627\u0634\u062a\u0646\u060c\u0632\u0648\u0644\u0628\u06cc\u0627 \u0645\u0639\u0645\u0648\u0644\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u060c\u0627\u0648\u0646 \u06f2\u06f0\u06f0\u06f0\u062a\u0648\u0645\u0646 \u0627\u0636\u0627\u0641\u0647 \u0686\u06cc \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u062f \u0637\u0639\u0645 \u0648 \u0644\u0647\u06cc\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (1 \u0639\u062f\u062f)", "\u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a", -1]}
{"text": ["\u0645\u064a\u0643 \u0643\u0627\u0645\u0644\u0627\u064b \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (1 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0628\u06cc \u0646\u0638\u06cc\u06cc\u06cc\u06cc\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u067e\u06cc\u06a9 \u0628\u0633\u062a\u0647 \u0631\u0648 \u06a9\u062c \u0631\u0633\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647 \u06cc \u06cc\u06a9\u06cc \u0627\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u0642\u06cc\u0647 \u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u0631\u0648 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u06a9\u0648\u0686\u06a9\u06cc \u0628\u0648\u062f\u0646 \u0648 \u062a\u0627\u0632\u0647 \u0647\u0645 \u0646\u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0647\u0632\u064a\u0646\u0647 \u067e\u064a\u0643 \u0632\u064a\u0627\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u06a9\u0648\u06a9\u06cc \u062c\u0648 \u0648 \u0628\u0627\u062f\u0627\u0645", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0627\u0632 \u0628\u0647\u062a\u0631\u064a\u0646 \u0647\u0627\u0633\u062a \u0641\u0642\u0637 \u0645\u0646 \u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0633\u064a\u0628 \u0648 \u062f\u0627\u0631\u0686\u064a\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0631\u0627\u064a \u0645\u0646 \u0645\u0648\u0632 \u0622\u0648\u0631\u062f\u0646 \u0643\u0647 \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0646\u0628\u0648\u062f \u0648 \u0647\u0645 \u0628\u062f \u0628\u0648\u062f \u0628\u0646\u0638\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0633\u064a\u0628 \u0648 \u062f\u0627\u0631\u0686\u064a\u0646", 1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647 \u0645\u06cc\u0646\u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0627\u0634\u0647 \u0644\u0637\u0641\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u06cc\u06a9\u06cc \u0627\u0632 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0647\u0627\u06cc\u06cc \u0628\u0648\u062f\u0645 \u06a9\u0647 \u062a\u0627 \u0627\u0644\u0627\u0646 \u062e\u0648\u0631\u062f\u0645 \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0627\u0645\u0631\u0648\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u0628\u0647 \u062c\u0632 \u0633\u0648\u0641\u0644\u0647 \u0634\u06a9\u0644\u0627\u062a \u0647\u0645\u0647 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f.\n\u067e\u06cc\u06a9 \u0647\u0645 \u0627\u0646\u0642\u062f\u0631 \u062a\u0646\u062f \u0627\u0648\u0645\u062f\u0647 \u0628\u0648\u062f \u06a9\u06cc\u06a9\u200c\u0647\u0627 \u0628\u0647 \u062f\u0631\u0648\u0646 \u0647\u0645 \u0646\u0641\u0648\u0630 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.\u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0647\u06cc\u0686 \u0646\u06cc\u0627\u0632\u06cc \u0628\u0647 \u0627\u0645\u0627\u062f\u0647 \u0633\u0627\u0632\u06cc \u0646\u062f\u0627\u0631\u0647\u060c \u0628\u0639\u062f \u0627\u0632 \u062b\u0628\u062a \u0645\u0648\u0641\u0642 \u06f2\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f\u0647 \u062a\u0627 \u0627\u0639\u0644\u0627\u0645 \u0646\u0642\u0635 \u0648 \u0646\u0628\u0648\u062f\u0646 \u0633\u0641\u0627\u0631\u0634 \u0628\u0634\u0647 \u0628\u0639\u062f \u062a\u062d\u0648\u06cc\u0644 \u06f5\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0627\u06cc \u06a9\u0647 \u062e\u0648\u062f\u0634 \u062c\u0627\u06cc \u0633\u0648\u0627\u0644 \u062f\u0627\u0631\u0647 \u0648\u0642\u062a\u06cc \u0641\u0627\u0635\u0644\u0647 \u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0647\u0645 \u0646\u06cc\u0633\u062a \u0648 \u0646\u06cc\u0627\u0632\u06cc \u0628\u0647 \u062d\u0627\u0636\u0631 \u06a9\u0631\u062f\u0646 \u067e\u0628\u0686\u06cc\u062f\u0647 \u0646\u062f\u0627\u0631\u0647!!! \u0646\u0632\u062f\u06cc\u06a9 \u0628\u0647 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0648 \u0646\u06cc\u0645 \u0628\u0639\u062f \u0627\u0632 \u062a\u0627\u062e\u06cc\u0631 \u0627\u0648\u0644\u06cc\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f\u0647!!\n\u0639\u0645\u0644\u0627 \u0628\u0647 \u0647\u06cc\u0686 \u062f\u0631\u062f\u06cc \u0646\u062e\u0648\u0631\u062f \u0633\u0641\u0627\u0631\u0634 \u0645\u0627 \u0648 \u0627\u06cc\u0646 \u0686\u0646\u062f\u0645\u06cc\u0646 \u0628\u0627\u0631 \u0647\u0633\u062a \u06a9\u0647 \u062a\u0627\u062e\u06cc\u0631 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f\u06cc \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u067e\u06cc\u0634 \u0627\u0648\u0645\u062f\u0647\u060c \u0628\u0627 \u0627\u06cc\u0646 \u0631\u0648\u06cc\u0647 \u0645\u0634\u062a\u0631\u06cc\u0627\u0646 \u062e\u0648\u062f\u062a\u0648\u0646 \u0631\u0648 \u0627\u0632 \u062f\u0633\u062a \u0645\u06cc\u062f\u06cc\u062f!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", -1]}
{"text": ["\u0637\u0639\u0645 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0647\u0633\u062a\u060c \u062f\u0631 \u0648\u0627\u0642\u0639 \u0646\u06a9\u062a\u0647 \u0627\u06cc \u06a9\u0647 \u0645\u062f\u0646\u0638\u0631 \u0645\u0646 \u0642\u0631\u0627\u0631 \u06af\u0631\u0641\u062a \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0631\u0627 \u062f\u0648\u0646\u0647 \u0627\u06cc \u0645\u06cc \u0641\u0631\u0648\u0634\u0646\u062f \u0648 \u062f\u0631 \u062a\u0635\u0648\u06cc\u0631 \u0633\u0647 \u062a\u0627 \u06a9\u0648\u06a9\u06cc \u0647\u0633\u062a \u0648 \u062f\u0631 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0646 \u06a9\u0627\u0641\u06cc \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0646\u0641\u0631\u060c \u0627\u06cc\u0646 \u0632\u06cc\u0627\u062f \u0645\u0641\u0647\u0648\u0645 \u0646\u06cc\u0633\u062a \u0648 \u0628\u0627\u0639\u062b \u0634\u062f \u0645\u0646 \u06a9\u0648\u06a9\u06cc \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0627\u0641\u06cc \u0633\u0641\u0627\u0631\u0634 \u0646\u062f\u0645. \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0647\u0645 \u062e\u0648\u0628\u0646 \u0627\u0645\u0627 \u0628\u0627\u06cc\u062f \u06cc\u06a9 \u0641\u06a9\u0631\u06cc \u0628\u0647 \u062d\u0627\u0644 \u0648\u0627\u0698\u06af\u0648\u0646 \u0634\u062f\u0646 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0628\u06a9\u0646\u06cc\u062f. \u0628\u0631\u0627\u06cc \u0645\u0646 \u06cc\u06a9 \u062f\u0648\u0646\u0647 \u0627\u0634 \u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u067e\u0627\u06cc \u0633\u06cc\u0628\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u062f\u0631 \u06a9\u0644 \u0627\u0632 \u062e\u0631\u06cc\u062f\u0645 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645 \u062c\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0627 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a\u06cc \u06a9\u0647 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u060c \u06a9\u0645 \u062e\u0631\u06cc\u062f\u0645 \u0648 \u0627\u06cc\u0646 \u0645\u0627\u06cc\u0647 \u062f\u0631\u062f\u0633\u0631 \u0634\u062f \u06a9\u0645\u06cc \u062a\u0627 \u0642\u0633\u0645\u062a\u06cc. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u06a9\u0644 \u0633\u0641\u0627\u0631\u0634\u0645 \u0628\u0646\u0638\u0631 \u0686\u067e \u0634\u062f\u0647 \u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u0647\u0627 \u0631\u0648\u06cc \u0647\u0645 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0648\u0642\u062a\u06cc \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f \u062e\u06cc\u0644\u06cc \u062f\u0627\u063a\u0648\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0647 \u062e\u0627\u0637\u0631 \u067e\u06cc\u06a9 \u0628\u0648\u062f \u0644\u0637\u0641\u0646 \u0628\u0647 \u067e\u06cc\u06a9 \u0628\u06af\u06cc\u0646 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062d\u0633\u0627\u0633 \u062a\u0631 \u0627\u0632 \u0642\u0636\u0627 \u0647\u0633\u062a ", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0646 \u0648\u0627\u0633\u0647 \u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0634\u06a9 \u0622\u0645\u0627\u062f\u0647 \u06a9\u0647 \u067e\u06cc\u0627\u062f\u0647 \u062a\u0627 \u062e\u0648\u0646\u0647 \u0645\u0627 \u06f1\u06f0 \u0645\u06cc\u0646 \u0631\u0627\u0647\u0647 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u0633\u067e\u0631\u0633 \u0637\u0648\u0644 \u0645\u06cc\u06a9\u0634\u0647!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "(142) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0633\u0644\u06cc \u062a\u062e\u062a", -1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0642\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0628\u0631\u0633\u0647 \u0646\u0635\u0641 \u06a9\u06cc\u06a9 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u06cc\u0645 \u0647\u0645\u0648\u0646 \u0631\u0648 \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0648\u0646 \u0628\u0630\u0627\u0631\u06cc\u0645 \u0648\u0627\u0642\u0639\u0627 \u062c\u0627\u06cc \u062a\u0627\u0633\u0641 \u062f\u0627\u0631\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "(125) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0648\u0686\u06a9 VIP", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0646\u06af\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u062a\u0627 \u062d\u062f\u0648\u062f\u06cc \u062e\u0631\u062f\u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0686\u0648\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u062f\u0631\u0633\u062a\u06cc \u0686\u06cc\u062f\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0633\u0644\u0641\u0648\u0646 \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647 \u062e\u0648\u0628\u06cc \u06a9\u0634\u06cc\u062f\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "(101) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u0626\u06cc\u0633\u06cc \u0622\u062c\u06cc\u0644\u06cc", "(117) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0646\u06af\u06cc \u0645\u0631\u0628\u0639", 1]}
{"text": ["\u0622\u0642\u0627 \u0627\u06cc\u0646 \u0686\u0647 \u0648\u0636\u0639\u06cc\u0647\u061f! \u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u0641\u062a\u06cc\u0645 \u0648\u0627\u0633\u0647 \u0639\u06cc\u062f \u0628\u0630\u0627\u0631\u06cc\u0645 \u062c\u0644\u0648 \u0645\u0647\u0645\u0648\u0646 \u0628\u0639\u062f \u06cc\u0647 \u0638\u0631\u0641 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0647 \u0634\u062f\u0647 \u06a9\u0647 \u0647\u0645\u0634\u0645 \u0628\u0647 \u0647\u0645 \u0642\u0627\u0637\u06cc \u0634\u062f\u0647 \u0648\u0627\u0633\u0647 \u0645\u0627 \u0622\u0648\u0631\u062f\u0646! \u06cc\u0639\u0646\u06cc \u0639\u0645\u062f\u0627 \u0628\u0631\u062f\u0627\u0631\u06cc \u0628\u0646\u062f\u0627\u0632\u06cc \u0632\u0645\u06cc\u0646 \u0646\u0645\u06cc\u062a\u0648\u0646\u0647 \u0627\u0646\u0642\u062f\u0631 \u062e\u0631\u0627\u0628 \u0648 \u0644\u0647 \u0648 \u0642\u0627\u0637\u06cc \u0628\u0634\u0647! \u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "(117) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0646\u06af\u06cc \u0645\u0631\u0628\u0639", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u0649 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f\u060c \u0628\u0647 \u0647\u0645\u0647 \u062f\u0648\u0633\u062a\u0627\u0646 \u067e\u064a\u0634\u0646\u0647\u0627\u062f \u0645\u064a\u0643\u0646\u0645\u060c \u0645\u0631\u0633\u0649", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "(113) \u062a\u0627\u0631\u062a \u0622\u062c\u06cc\u0644\u06cc \u0634\u06a9\u0644\u0627\u062a", "(129) \u0628\u0627\u0642\u0644\u0648\u0627 \u062f\u0644\u06cc\u0645\u0627\u0646\u062c\u0648 \u0632\u0627\u0646\u062a", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062f\u0631 \u06cc\u06a9 \u06a9\u0644\u0627\u0645 \u00ab\u0627\u0641\u062a\u0636\u0627\u062d\u00bb \u0628\u0648\u062f. \u0645\u0642\u0627\u062f\u06cc\u0631 \u0648\u062d\u0634\u062a\u0646\u0627\u06a9 \u0632\u06cc\u0627\u062f \u062e\u0627\u0645\u0647 \u0628\u0627 \u0646\u0648\u06a9 \u0642\u0627\u0634\u0642 \u0627\u0633\u0627\u0646\u0633 \u067e\u0646\u06cc\u0631\u061f!!!! ... \u0642\u0646\u0627\u062f \u0645\u062d\u062a\u0631\u0645 \u0634\u0645\u0627 \u0631\u0633\u067e\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0627 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0627\u0634\u062a\u0628\u0627\u0647 \u06af\u0631\u0641\u062a\u06cc\u062f !!! .. \u0627\u0632 \u0627\u0648\u0646 \u0627\u0641\u062a\u0636\u0627\u062d\u062a\u0631 \u06a9\u06cc\u06a9 \u0628\u06cc\u0627\u062a \u0648 \u06a9\u0647\u0646\u0647 \u0627\u0634 \u0628\u0648\u062f.. \u0647\u0645\u0647 \u0631\u0648 \u0631\u06cc\u062e\u062a\u0645 \u062f\u0648\u0631 .. \u062d\u06cc\u0641 \u067e\u0648\u0644", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 650 \u06af\u0631\u0645", "\u0627\u0633\u0646\u06a9 \u0633\u0648\u0633\u06cc\u0633 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0633\u0646\u06a9 \u0633\u0648\u0633\u06cc\u0633 \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645 (6 \u062a\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0627\u0641\u062a\u0636\u0627\u062d\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 \u0639\u062f\u062f 7", "\u0634\u0645\u0639 \u0639\u062f\u062f 9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc. \u0628\u0633\u06cc\u0627\u0631 \u0627\u0634\u062a\u0647\u0627 \u0628\u0631\u0627\u0646\u06af\u06cc\u0632. \u0633\u0631\u06cc\u0639 \u0648 \u0633\u0627\u0644\u0645 \u0628\u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f. \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0647\u0645 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0648 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "(102) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0644\u06cc \u0645\u063a\u0632 \u062f\u0627\u0631", "(112) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0631\u06cc\u0632", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0637\u0628\u0642 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0645\u0646 \u0648 \u0628\u0627 \u0647\u0645\u0627\u0647\u0646\u06af\u06cc \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc\u060c \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0628\u0627 \u0622\u0698\u0627\u0646\u0633 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u062f\u0631 \u0627\u06cc\u0646 \u0634\u0644\u0648\u063a\u06cc \u0631\u0648\u0632\u0647\u0627\u06cc \u0622\u062e\u0631 \u0633\u0627\u0644\u060c \u0627\u06cc\u0646 \u0647\u0645\u0627\u0647\u0646\u06af\u06cc \u0631\u0648 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0628\u0647 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u06a9\u0644 \u0645\u0646\u0638\u0648\u0631 \u06a9\u0631\u062f\u06cc\u062f.", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0634.\n\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0647\u0645 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0642\u062a\u064a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0643\u0647\u0646\u0647 \u0648 \u0644\u0647 \u0648 \u0644\u0648\u0631\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0642\u06cc\u0645\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0641\u0627\u0635\u0644\u0647 \u06a9\u0627\u0645\u0644\u0627 \u063a\u06cc\u0631 \u0645\u0646\u0637\u0642\u06cc \u0628\u0648\u062f", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f - \u06a9\u06cc\u06a9 \u0631\u0648 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u0648\u0646\u062f\u0646 \n\u0641\u0642\u0637 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u0645\u0639 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648 \u0627\u0632 \u067e\u0627\u06cc\u0647 \u062c\u062f\u0627 \u0645\u06cc\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u062a\u06cc\u0645 \u062e\u0648\u0628 \u0627\u0633\u0646\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0628\u062f \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0647\u0646\u06af\u0627\u0645 \u062d\u0645\u0644 \u060c\u0639\u0644\u064a\u0631\u063a\u0645 \u062a\u0630\u0643\u0631 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u060c\u0643\u064a\u0643 \u0628\u0647 \u062f\u064a\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u064a\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u0643\u0644 \u0638\u0627\u0647\u0631\u064a\u0634 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0645\u0648\u0632\u06cc\u06a9\u0627\u0644", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u06a9\u0647 \u062f\u063145\u062f\u0642\u06cc\u0642\u0647 \u0628\u06cc\u0627\u0631\u0646 \u0648\u0644\u06cc \u062f\u0631 1\u0633\u0627\u0639\u062a \u0648\u0646\u06cc\u0645 \u0627\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062d\u0644\u0648\u0627 \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc", 1]}
{"text": ["\u0631\u0643\u0648\u062f \u062a\u0627\u062e\u064a\u0631\u0648 \u0628\u0627 \u0661\u0666\u0660 \u062f\u0642\u064a\u0642\u0647 \u062a\u0627\u062e\u064a\u0631 \u0632\u062f\u064a\u062f \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u064a\u062f \u062e\u062f\u0627 \u0642\u0648\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u06cc\u0641\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u06f1\u06f3 \u0639\u062f\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0645\u0646 \u0647\u0631 \u0628\u0627\u0631 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06f9\u06f0 \u062f\u0631\u0635\u062f \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0648 \u062a\u0644\u0641\u0646\u06cc \u0628\u0627\u06cc\u062f \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u06a9\u0646\u0645. \u0627\u0648\u0644\u0627 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646\u06cc \u062a\u0644\u0641\u0646\u06cc \u062e\u06cc\u0644\u06cc \u0628\u062f\u0647 \u0648 \u0622\u062f\u0645 \u0627\u0630\u06cc\u062a \u0645\u06cc\u0634\u0647. \u0627\u0646\u0642\u062f\u0631 \u06a9\u0644\u0627\u0641\u0647 \u0645\u06cc\u0634\u06cc \u06a9\u0647 \u0645\u062c\u0628\u0648\u0631 \u0645\u06cc\u0634\u06cc \u0628\u06af\u06cc \u0646\u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u0627\u0628\u0627 \u0647\u0631 \u0686\u06cc \u0645\u06cc\u062e\u0648\u0627\u06cc\u0646 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u06a9\u0646\u06cc\u062f \u0628\u0631\u0647. \u0648 \u062a\u0645\u0627\u0645 \u0627\u06cc\u0646\u0647\u0627 \u0646\u0647 \u062a\u0642\u0635\u06cc\u0631 \u0645\u0646 \u062e\u0631\u06cc\u062f\u0627\u0631\u0647 \u0648 \u0646\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0644\u06a9\u0647 \u0645\u0634\u06a9\u0644 \u0627\u0632 \u0641\u0631\u0648\u0634\u0646\u062f\u0647 \u0627\u0633\u062a \u06a9\u0647 \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0648 \u0633\u0627\u06cc\u062a \u0632\u062f\u0647 \u0645\u0648\u062c\u0648\u062f\u06cc \u0647\u0633\u062a \u0628\u0647 \u0647\u0631 \u062f\u0644\u06cc\u0644\u06cc \u0627\u062f\u0639\u0627 \u0645\u06cc\u06a9\u0646\u0647 \u0646\u062f\u0627\u0631\u0647. \u0645\u062b\u0644\u0627 \u062c\u0627\u0644\u0628\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u0648\u062c\u0648\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u0634 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a!! \u0627\u0633\u0646\u067e \u0628\u0627\u06cc\u062f \u0641\u0631\u0648\u0634\u0646\u062f\u0647 \u0647\u0627 \u0631\u0648  \u0645\u062c\u0627\u0628 \u06a9\u0646\u0647 \u06a9\u0647 \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0646\u06cc\u0641\u062a\u0647. \u062d\u0627\u0644\u0627 \u06cc\u0627 \u0642\u0628\u0644 \u067e\u0631\u062f\u0627\u062e\u062a \u0645\u0634\u062a\u0631\u06cc \u0645\u0648\u062c\u0648\u062f\u06cc \u0628\u06af\u06cc\u0631\u0647 \u06cc\u0627 \u062f\u0631 \u0635\u0648\u0631\u062a \u0639\u062f\u0645 \u0645\u0648\u062c\u0648\u062f\u06cc \u0645\u062c\u0628\u0648\u0631 \u0628\u0634\u0647 \u062a\u062e\u0641\u06cc\u0641 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0631\u0648\u06cc \u06a9\u0627\u0644\u0627\u06cc \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0628\u062f\u0647. \u0645\u0646 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062a\u062c\u0631\u0628\u0647 \u0628\u062f\u06cc \u062f\u0627\u0634\u062a\u0645 \u0627\u0632 \u062e\u0631\u06cc\u062f\u0647\u0627\u0645...\n\u0636\u0645\u0646\u0627 \u0645\u0646 \u0637\u0628\u0642 \u0639\u06a9\u0633 \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u0635\u0641\u062d\u0647 \u0642\u0646\u0627\u062f\u06cc \u0628\u0627\u0642\u0644\u0648\u0627\u06cc \u062a\u0628\u0631\u06cc\u0632 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u06cc\u06af\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647!! \u06a9\u0647 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0627\u0633\u0645\u0634 \u0686\u06cc\u0647\u060c \u0627\u06af\u0631 \u0644\u0627\u0632\u0645\u0647 \u0639\u06a9\u0633\u0634\u0648 \u0628\u0641\u0631\u0633\u062a\u0645. \u0644\u0637\u0641\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u062a\u0628\u0631\u06cc\u0632", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u06cc\u0641\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0633\u0644\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u062a\u062e\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0641\u0642\u0637 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u06cc\u0647 \u06a9\u0645 \u062c\u0627 \u062f\u0627\u0634\u062a \u062a\u0627\u0632\u0647 \u062a\u0631 \u0628\u0627\u0634\u0646\u062f. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648  \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u06a9\u0648\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062d\u062a\u0645\u0627\u0627\u0627 \u062d\u062a\u0645\u0627 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0646\u06cc\u062f \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0645 \u062a\u0627\u0632\u0647 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0631\u06cc \u0633\u0641\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0646\u062c\u0631\u0647 \u0627\u06cc \u06af\u0644 (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u0647\u0627\u06cc \u062e\u0648\u062f \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0627\u06af\u0631 \u0641\u0627\u0635\u0644\u0647 \u0632\u06cc\u0627\u062f\u06cc \u062a\u0627 \u0642\u0646\u0627\u062f\u06cc \u06cc\u0627 \u0631\u0633\u062a\u0648\u0631\u0627\u0646 \u062f\u0627\u0631\u0646\u062f \u060c \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u0642\u0628\u0648\u0644 \u0646\u06a9\u0646\u0646\u062f \u062a\u0627 \u062f\u0686\u0627\u0631 \u062a\u0627\u062e\u06cc\u0631 \u0646\u0634\u0646 \u060c \u0642\u0646\u0627\u062f\u06cc \u062a\u0627 \u0645\u0646\u0632\u0644 \u0645\u0627 \u067e\u06cc\u0627\u062f\u0647 \u06f1\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0631\u0627\u0647 \u0647\u0633\u062a \u0628\u0627 \u0645\u0648\u062a\u0648\u0631 \u0647\u0645 \u062f\u0631 \u062a\u0631\u0627\u0641\u06cc\u06a9 \u06f5 \u062f\u0642\u06cc\u0642\u0647 \u060c \u062d\u0627\u0644\u0627 \u062f\u06cc\u06af\u0647 \u0646\u0645\u06cc \u062f\u0648\u0646\u0645 \u0639\u0644\u062a \u062a\u0627\u062e\u06cc\u0631 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u0686\u06cc \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u062d\u0648\u06cc\u0644\u06cc \u0628\u0627 \u0639\u06a9\u0633 \u06cc\u06a9\u0633\u0627\u0646 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0641\u0631\u0627\u0648\u0627\u0646 \u0627\u0632 \u0634\u0628\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632\u06cc \u0648 \u067e\u06cc\u06a9 \u0627\u0639\u0632\u0627\u0645\u06cc\u060c \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0628\u0631\u06af\u0631 \u0698\u0627\u0645\u0628\u0648\u0646 1 \u06a9\u06cc\u0644\u0648", "\u0627\u0633\u0646\u06a9 \u0645\u06cc\u0646\u06cc \u067e\u06cc\u062a\u0632\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648 \u062f\u0633\u0631 \u0628\u0631\u0648\u0644\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u062f\u0631 \u0645\u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u0622\u0633\u062a\u0627\u0646\u0647 250 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0646\u06cc\u0632 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0628\u0631\u0648\u0644\u0647 \u06a9\u0648\u0686\u06a9", "\u062e\u0631\u0645\u0627 \u067e\u06cc\u0627\u0631\u0645 250 \u06af\u0631\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u062a \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u06a9\u06cc\u06a9 \u0627\u0633\u0641\u0646\u062c\u06cc \u0622\u0646 \u0645\u0627\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f.\n\u0645\u0639\u0645\u0648\u0644\u0627 \u062f\u0631 \u06a9\u0644\u06cc\u0647 \u06cc \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u062a\u0648\u0644\u062f \u0648 \u0639\u0631\u0648\u0633\u06cc \u0627\u0632 \u06af\u0631\u062f\u0648 \u0648 \u0645\u0648\u0632 \u062f\u0631 \u0644\u0627\u06cc\u0647 \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc \u0634\u0648\u062f\u060c \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0641\u0627\u0642\u062f \u0627\u06cc\u0646 \u0645\u0648\u0627\u062f \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647", -1]}
{"text": ["\u0646\u0648\u0634\u062a\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0631\u0648 \u0646\u0646\u0648\u0634\u062a\u0646\u062f \u0648 \u062d\u062a\u06cc \u0627\u0637\u0644\u0627\u0639 \u0647\u0645 \u0646\u062f\u0627\u062f\u0646\u062f \u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u062a\u0648\u0644\u062f \u0631\u0648 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0645\u06cc\u06af\u06cc\u0631\u0645 \u0648 \u0648\u0627\u0642\u0639\u0627 \u062a\u0627 \u062d\u0627\u0644\u0627 \u0647\u0645\u0686\u06cc\u0646 \u0645\u0634\u06a9\u0644\u06cc \u0631\u0648 \u0646\u062f\u06cc\u062f\u0647 \u0628\u0648\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u0645\u0639 \u0639\u062f\u062f\u06cc", -1]}
{"text": ["\u0645\u06cc\u0632\u0627\u0646 \u062e\u0627\u0645\u0647 \u06a9\u06cc\u06a9 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u06a9\u06cc\u06a9 \u0622\u0632\u0627\u0631 \u062f\u0647\u0646\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc", -1]}
{"text": ["\u062f\u0648\u062a\u0627\u0628\u0644\u0648\u06a9\u0627\u062f \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06cc\u062f\u0648\u0646\u0647 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648 \u0628\u0627 \u0639\u06a9\u0633 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u0686\u0648\u0646 \u062f\u0641\u0639\u0647 \u06cc \u067e\u06cc\u0634 \u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e \u0646\u062f\u0627\u0634\u062a \u0648 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u06a9\u0644\u0627 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a", "\u062f\u0633\u0631 \u06a9\u0631\u0645 \u0641\u0646\u062f\u0642 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0628\u0644\u0648\u06a9\u0627\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u0627\u0645\u0647 \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u06cc\u062e \u0632\u062f\u0647 \u0628\u0648\u062f.\u0644\u0637\u0641\u0627 \u0631\u0633\u06cc\u06cc\u062f\u06af\u06cc \u0634\u0648\u062f\n\u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u0642\u06cc\u0645\u062a\u0634 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u0639\u0645\u0648\u0644\u06cc \u0622\u0648\u0631\u062f\u0646.\n\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u06a9\u0646\u0627\u0641\u0647 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0631\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u067e\u0631\u0633 \u0647\u0645 \u06a9\u0647 \u0633\u0631\u06cc\u0639 \u0648 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u062f\u0645\u0627\u062a \u062e\u0648\u0628\u06cc \u0627\u0631\u0627\u0626\u0647 \u06a9\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0648\u0634\u0641\u06cc\u0644 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0647\u0645\u0647 \u062f\u0633\u062a \u0627\u0646\u062f\u0631\u06a9\u0627\u0631\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0637\u0628\u0642 \u0632\u0645\u0627\u0646 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0646\u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u0637\u0627\u0628 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06af\u0648\u0634 \u0641\u06cc\u0644\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0642\u0637\u0639\u0627\u062a \u062e\u0631\u062f\u0634\u062f\u0647 \u0632\u06cc\u0627\u062f \u062a\u0648\u0634 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u062c\u0627\u06cc \u062a\u0627\u0633\u0641 \u062f\u0627\u0631\u0647 \u0644\u0637\u0641\u0627 \u0628\u06cc\u0634\u062a\u0631\u062f\u0642\u062a \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0648\u0634\u0641\u06cc\u0644 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06af\u0641\u062a\u0647\u200c\u0628\u0648\u062f\u0645 \u06f2 \u0631\u062f\u06cc\u0641\u0634 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0627\u0634\u0647 \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u0645\u06cc \u062f\u06cc\u0631 \u0627\u0648\u0645\u062f \u0627\u0645\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0646\u0647 \u0645\u0648\u0646\u062f\u0647  \u062f\u0631\u06a9\u0644 \u0631\u0627\u0636\u06cc \u0627\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062a\u0634\u06a9\u0631\u0645.\u0647\u0645 \u062a\u0627\u0632\u0647 \u0647\u0645 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06cc\u06a9 \u06a9\u0648\u0686\u0648\u0644\u0648 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0648  \u062c\u0639\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0648 \u06a9\u06cc\u06a9\u0647\u0627 \u0628\u0627\u0647\u0645 \u0642\u0627\u0637\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f.\u0627\u0635\u0646 \u0631\u0627\u0636\u06cc \u0646\u06cc\u0633\u062a\u0645.\u0646\u0633\u0628\u062a \u0628\u0647 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0646\u062a\u0638\u0627\u0631 \u0628\u06cc\u0634\u062a\u0631\u06cc \u062f\u0627\u0634\u062a\u0645..\u062f\u0631 \u0648\u0627\u0642\u0639 \u0647\u0632\u06cc\u0646\u0647 \u06cc \u0645\u0646 \u0633\u0648\u062e\u062a \u0634\u062f...\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u0631\u0648\u0644\u062a\u0634 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c \u0648\u0644\u06cc \u0628\u0642\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644\u06cc \u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0646\u0627\u0646 \u0648\u067e\u0646\u06cc\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0627\u0646\u062f\u0647 \u0648 \u0633\u0641\u062a \u0628\u0648\u062f \u0648 \u067e\u0646\u06cc\u0631 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0645\u06cc \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 6 \u0639\u062f\u062f)", -1]}
{"text": ["\u0648\u0644\u0627 \u062a\u0648 \u0639\u06a9\u0633 \u0686\u0646\u062f \u0645\u062f\u0644 \u0628\u0627\u0645\u06cc\u0647 \u0647\u0633\u062a\u0634 \u0648 \u062a\u0648 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0645 \u0627\u0632 \u0647\u0645\u0647 \u0645\u062f\u0644 \u0628\u0627\u0645\u06cc\u0647 \u0628\u0641\u0631\u0633\u062a\u06cc\u062f \u0648\u0644\u06cc \u0641\u0642\u0637 \u0628\u0627\u0645\u06cc\u0647 \u0645\u0639\u0645\u0648\u0644\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \n\u0628\u0639\u062f \u0639\u06a9\u0633 \u06af\u0630\u0627\u0634\u062a\u0646 \u0646\u0648\u0634\u062a\u0646 \u0639\u06a9\u0633 \u0627\u0631\u0633\u0627\u0644\u06cc \u0627\u0632 \u0637\u0631\u0641 \u0645\u0634\u062a\u0631\u06cc \n\u0634\u0645\u0627\u06a9\u0647 \u0627\u0635\u0644\u0627 \u0647\u0645\u0686\u06cc\u0646 \u0628\u0627\u0645\u06cc \u0627\u06cc \u0646\u062f\u0627\u0631\u06cc\u062f \u0628\u0631\u0627\u06cc \u0686\u06cc \u0639\u06a9\u0633 \u0645\u06cc\u0632\u0627\u0631\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u067e\u0646\u06cc\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0632\u0645\u0644\u200c\u0647\u0627 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0646\u06cc\u0631", "\u0632\u0650\u0645\u0650\u0644", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc\u0648\u0645\u062f\u0646 \u0648\u0644\u06cc \u0628\u0647 \u0633\u0631\u0639\u062a \u0628\u0647 \u062f\u0631 \u0645\u0646\u0632\u0644 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 14 \u0639\u062f\u062f)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (1 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", -1]}
{"text": ["\u0627\u0632 \u067e\u064a\u0643\u062a\u0648\u0646 \u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u064a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0633\u0645\u0628\u0648\u0633\u0647", 1]}
{"text": ["\u0643\u0645\u062a\u0631 \u0627\u0632 \u0646\u064a\u0645 \u0633\u0627\u0639\u062a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0639\u0646\u0648\u0627\u0646 \u0627\u0648\u0644\u06cc\u0646 \u062a\u062c\u0631\u0628\u0647 \u06cc \u0645\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u06cc\u062a\u0648\u0646\u0645 \u0628\u06af\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0628\u0648\u0633 80%", "\u062a\u0633\u062a \u0633\u06cc\u0627\u0647 \u0628\u0632\u0631\u06af (\u062d\u062f\u0648\u062f\u0627 760 \u06af\u0631\u0645)", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633\u062f\u0627\u0631 (\u0628\u0633\u062a\u0647 \u0627\u06cc)", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", "\u0644\u0648\u0627\u0634 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 (\u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0633\u0631\u0639\u062a \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0633\u0641\u0627\u0631\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062c\u0648 \u0648 \u0633\u0628\u0648\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062a\u0633\u062a \u0633\u06cc\u0627\u0647 \u0628\u0632\u0631\u06af (\u062d\u062f\u0648\u062f\u0627 760 \u06af\u0631\u0645)", "\u06af\u0627\u062a\u0627", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062d\u062c\u0645 \u0639\u0627\u0644\u06cc\u060c \u062a\u0634\u06a9\u0631\u060c \u0645\u0631\u0633\u06cc \u0625\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 15 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0637\u0631 \u0646\u062f\u0627\u0634\u062a\u060c\u0628\u0639\u0636\u06cc \u0628\u0627\u0645\u06cc\u0647 \u0647\u0627\u0634 \u0647\u0645\u200c\u0633\u0641\u062a \u0628\u0648\u062f \u06a9\u0627\u0645\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0646\u0627\u0646 \u0632\u06cc\u062a\u0648\u0646 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u0627\u067e\u0627\u062a\u0627 \u0632\u06cc\u062a\u0648\u0646\u06cc", -1]}
{"text": ["\u0631\u0648\u0644\u062a \u0647\u0627 \u06cc\u06a9 \u0633\u0648\u0645\u0634 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0645\u0627\u0628\u0642\u06cc \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u06a9\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f!\n\u0628\u0647 \u0646\u0638\u0631\u0645 \u0642\u0634\u0646\u06af \u0646\u06cc\u0633\u062a \u0627\u06cc\u0646 \u06a9\u0627\u0631 \u0648 \u0627\u0628\u0631\u0648\u06cc \u0627\u062f\u0645 \u0648 \u062c\u0644\u0648 \u0647\u0645\u06a9\u0627\u0631\u0627\u0634 \u0645\u06cc \u0628\u0631\u0647! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 30 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u062d\u0633\u0627\u06cc \u062e\u0648\u0628 \u0628\u0647\u0645\u0648\u0646 \u0645\u06cc\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062a\u0648\u06cc \u0639\u06a9\u0633 \u06a9\u0644\u06cc \u0645\u062f\u0644 \u0645\u06cc\u0646\u06cc \u06a9\u06cc\u06a9 \u0647\u0633\u062a \u0648\u0644\u06cc \u06a9\u0644\u0627 \u06f4\u0645\u062f\u0644 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \n\n\u06a9\u0647 \u0628\u0633\u062a\u0647 \u06a9\u0648\u0686\u06cc\u06a9\u0647 \u062f\u0627\u062e\u0644\u0634 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u0647\u0627 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u062e\u064a\u0644\u064a \u0628\u0647 \u0646\u0633\u0628\u062a \u0639\u0643\u0633 \u0643\u0648\u0686\u0643 \u0628\u0648\u062f \u0628\u0631\u0627\u064a \u0662 \u0646\u0641\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u067e\u0627\u06cc \u0627\u0644\u0628\u0627\u0644\u0648 \u06a9\u0645\u06cc \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0645\u0631\u0633\u06cc \u0627\u0632 \u0628\u0627\u06a9\u0633 \u062e\u0648\u0634\u06af\u0644\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0647\u0627\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0646\u060c \u0647\u06cc\u0686 \u062c\u0627 \u0647\u0645\u0686\u06cc\u0646 \u06a9\u0648\u06a9\u06cc \u0627\u06cc \u0646\u062f\u0627\u0631\u0647\u060c \u0627\u0645\u0627 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u06cc\u06a9\u0645\u06cc \u0627\u0633\u0627\u0646\u0633 \u06af\u06cc\u0644\u0627\u0633 \u062f\u0627\u0634\u062a \u0627\u0646\u06af\u0627\u0631 \u062a\u0648\u0634 \u06a9\u0647 \u062e\u0648\u0634\u0627\u06cc\u0646\u062f \u0645\u0646 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0631\u0627\u0646\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0635\u0644\u0627 \u0645\u0632\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0646\u0645\u06cc\u062f\u0627\u062f \u0627\u0645\u0627 \u062f\u0631 \u06a9\u0644 \u062a\u0627\u0632\u0647 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u0647\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0642\u06cc\u0645\u062a \u062e\u0648\u0628 \u060c \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0645\u0631\u0633\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 2", 1]}
{"text": ["\u062f\u0648\u0633\u062a\u0647 \u0643\u0647 \u0645\u0642\u062f\u0627\u0631 \u0648 \u062d\u062c\u0645 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0641\u0631\u0645\u0627\u0646\u064a\u0647 \u0643\u0644\u0627 \u0643\u0645\u0647 \u0627\u0645\u0627 \u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0633 \u0648 \u0627\u0642\u0627\u064a\u064a \u0643\u0647 \u0627\u0633\u0646\u067e \u0627\u0643\u0633\u067e\u0631\u0633\u0634\u0648\u0646 \u0647\u0633\u062a\u0646 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634 \u0627\u062e\u0644\u0627\u0642\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u200c \u0647\u0627 \u0628\u0647 \u06a9\u0644 \u0686\u067e\u0647 \u0634\u062f\u0647\u060c \u0648 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u06cc\u0633\u062a. \n\u0628\u0647 \u062c\u0632 \u0627\u0648\u0646\u060c \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u062f\u06cc\u06af\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0627\u0646\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0648 \u0646\u06af\u0627\u0647 \u0627\u0648\u0644 \u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631 \u0627\u0632 \u062a\u0635\u0648\u0631\u0645 \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u062f\u0631\u0639\u0645\u0644 \u067e\u0631\u0628\u0631\u06a9\u062a \u0628\u0648\u062f\u0646 \u0648 \u062e\u0648\u0631\u062f\u0646\u0634\u0648\u0646 \u062e\u06cc\u0644\u06cc \u0686\u0633\u0628\u06cc\u062f.\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0645\u062a\u0646\u0648\u0639 \u0628\u0627 \u062d\u0633 \u0648 \u062d\u0627\u0644 \u0635\u0645\u06cc\u0645\u06cc \u0648 \u062f\u0644\u0686\u0633\u0628 \u062e\u0648\u0646\u06af\u06cc.\u0628\u06cc\u0646 \u0634\u0648\u0646 \u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647,\u0627\u0648\u0646\u06cc \u06a9 \u0631\u0648\u0634 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u067e\u0627\u0634\u06cc\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u06cc\u0647 \u062e\u0627\u0645\u0647 \u06af\u0631\u062f \u0647\u0645 \u0631\u0648\u0634 \u0628\u0648\u062f,\u0627\u0648\u0646\u06cc \u06a9 \u0645\u062b\u0644 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u0628\u0648\u062f \u0627\u0645\u0627 \u0631\u0646\u06af\u0634 \u0631\u0648\u0634\u0646\u062a\u0631 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0631\u0648 \u0627\u0632 \u0628\u0642\u06cc\u0647 \u0628\u06cc\u0634\u062a\u0631 \u062f\u0648\u0633 \u062f\u0627\u0634\u062a\u0645(\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0631\u0648\u06cc\u0627\u06cc\u06cc \u0628\u0648\u062f \u0628\u0633 \u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u062e\u0627\u0645\u0647 \u06cc \u0631\u0648\u0634 \u0631\u0648 \u0627\u0635\u0644\u0627 \u062f\u0648\u0633 \u0646\u062f\u0627\u0634\u062a\u0645.\u0628 \u062a\u0631\u0634\u06cc \u0645\u06cc\u0632\u062f)\n\u062f\u0631\u0645\u062c\u0645\u0648\u0639 \u0639\u0627\u0627\u0627\u0627\u0634\u0642 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633\u0645 \u0645\u0646\n\u0641\u0642\u0637 \u06cc\u0686\u06cc\u0632\u06cc.\u0686\u0648\u0646 \u0645\u06cc\u062f\u0648\u0646\u0645 \u0645\u062f\u06cc\u0631\u06cc\u062a \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645 \u0628 \u0633\u0644\u0627\u0645\u062a \u0627\u0647\u0645\u06cc\u062a \u0645\u06cc\u062f\u0646 \u0648 \u0647\u0645 \u062e\u0644\u0627\u0642\u06cc\u062a,\u06cc\u0647 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f\u06cc \u0628\u0631\u0627\u0634\u0648\u0646 \u062f\u0627\u0634\u062a\u0645.\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0646\u0638\u0631\u0627\u062a \u0631\u0648 \u0628\u062e\u0648\u0646\u0646\n\u0645\u0646 \u0648 \u06a9\u0644 \u062e\u0627\u0646\u0648\u0627\u062f\u0647 \u0645 \u0631\u0698\u06cc\u0645 \u06a9\u062a\u0648\u0698\u0646\u06cc\u06a9(ketogenic) \u0631\u0648 \u0628\u0639\u0646\u0648\u0627\u0646 \u0644\u0627\u06cc\u0641 \u0627\u0633\u062a\u0627\u06cc\u0644 \u0645\u0648\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u06cc\u0645.\u0627\u06cc\u0646 \u0644\u0627\u06cc\u0641 \u0627\u0633\u062a\u0627\u06cc\u0644 \u0631\u0648\u0632 \u0628 \u0631\u0648\u0632 \u062f\u0627\u0631\u0647 \u062a\u0648 \u06a9\u0634\u0648\u0631\u0645\u0648\u0646 \u0628\u06cc\u0634\u062a\u0631 \u062c\u0627\u0645\u06cc\u0641\u062a\u0647 \u0648 \u0641\u0631\u0627\u06af\u06cc\u0631 \u0645\u06cc\u0634\u0647.\u062a\u0648 \u0627\u06cc\u0646 \u0631\u0698\u06cc\u0645 \u062a\u0646\u0647\u0627 \u0634\u06cc\u0631\u06cc\u0646 \u06a9\u0646\u0646\u062f\u0647 \u0627\u06cc \u06a9\u0647 \u0645\u06cc\u062a\u0648\u0646\u06cc\u0645 \u0645\u0635\u0631\u0641 \u06a9\u0646\u06cc\u0645 \"\u0627\u0633\u062a\u06cc\u0648\u06cc\u0627\" \u0647\u0633\u062a.\u0641\u0642\u0637 \u0627\u0632 \u06a9\u0631\u0647 \u0648 \u0631\u0648\u063a\u0646 \u0646\u0627\u0631\u06af\u06cc\u0644 \u0645\u06cc\u062a\u0648\u0646\u06cc\u0645 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u0645 \u0628\u0639\u0646\u0648\u0627\u0646 \u0631\u0648\u063a\u0646 \u0648 \u0628\u062c\u0627\u06cc \u0634\u06cc\u0631 \u0627\u0632 \u062e\u0627\u0645\u0647,\u0634\u06cc\u0631\u0628\u0627\u062f\u0627\u0645 \u0648 \u0634\u06cc\u0631\u0646\u0627\u0631\u06af\u06cc\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u06a9\u0646\u06cc\u0645..\u0647\u0645\u0686\u0646\u06cc\u0646 \u0628\u062c\u0627\u06cc \u0622\u0631\u062f\u0647\u0627\u06cc \u0639\u0627\u062f\u06cc \u0627\u0632 \u0622\u0631\u062f\u0628\u0627\u062f\u0627\u0645,\u0622\u0631\u062f \u0646\u0627\u0631\u06af\u06cc\u0644 \u0648 \u06af\u0631\u062f\u0648\u06cc \u067e\u0648\u062f\u0631 \u0634\u062f\u0647 \u0645\u06cc\u062a\u0648\u0646\u06cc\u0645 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u0645.\u0642\u0647\u0648\u0647 \u0648 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e,\u0622\u062c\u06cc\u0644\u0647\u0627,\u06a9\u0631\u0647 \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc,\u06a9\u0631\u0647 \u0628\u0627\u062f\u0627\u0645 \u062f\u0631\u062e\u062a\u06cc \u0648 \u06a9\u0631\u0647 \u0641\u0646\u062f\u0642,\u062e\u0627\u0645\u0647 \u0648 \u067e\u0646\u06cc\u0631 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0648 \u0628\u06cc\u0646 \u0645\u06cc\u0648\u0647 \u0647\u0627 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0648 \u0628\u0644\u0648\u0628\u0631\u06cc \u0648 \u06a9\u062f\u0648\u062d\u0644\u0648\u0627\u06cc\u06cc \u0648 \u0622\u0648\u0648\u06a9\u0627\u062f\u0648 \u0648 \u0646\u0627\u0631\u06af\u06cc\u0644 \u0645\u062c\u0627\u0632 \u0647\u0633\u062a\u0646..\u06a9\u0627\u0634 \u0645\u06cc\u0634\u062f \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0686\u0646 \u062a\u0627 \u06a9\u06cc\u06a9 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u062e\u0648\u0631\u062f\u0646\u0634\u0648\u0646 \u062a\u0648 \u0631\u0698\u06cc\u0645 \u06a9\u062a\u0648 \u0645\u062c\u0627\u0632 \u0628\u0627\u0634\u0647 \u062f\u0631\u0633\u062a \u06a9\u0646\u0647(\u06cc\u0639\u0646\u06cc \u0628\u062c\u0627\u06cc \u0634\u06a9\u0631 \u0628\u0627 \u0627\u0633\u062a\u06cc\u0648\u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646 \u0634\u062f\u0647 \u0628\u0627\u0634\u0646 \u0648 \u0628\u062c\u0627\u06cc \u0622\u0631\u062f \u0639\u0627\u062f\u06cc, \u0628\u0627 \u0622\u0631\u062f \u0628\u0627\u062f\u0648\u0645 \u062f\u0631\u0633\u062a \u0634\u062f\u0647 \u0628\u0627\u0634\u0646) .\u062f\u0631\u062d\u0627\u0644 \u062d\u0627\u0636\u0631 \u0647\u0632\u0627\u0631\u0627\u0646 \u06a9\u062a\u0648\u06cc\u06cc \u062a\u0648 \u0647\u0645\u06cc\u0646 \u062a\u0647\u0631\u0627\u0646 \u062e\u0648\u062f\u0645\u0648\u0646 \u0632\u0646\u062f\u06af\u06cc \u0645\u06cc\u06a9\u0646\u0646 \u06a9 \u062a\u0648 \u062d\u0633\u0631\u062a \u06cc\u0647 \u06af\u0627\u0632 \u0632\u062f\u0646 \u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0633\u062a\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648\u06cc \u06cc\u0647 \u0646\u0641\u0631\u0647 \u0639\u0627\u0627\u0627\u0644\u06cc\u06cc\u06cc \u0628\u0648\u062f.\u062a\u0627\u0631\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u0686\u0642\u062f\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f.\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u062d\u0645\u0644 \u0646\u0627\u062f\u0631\u0633\u062a \u060c \u0648 \u06cc\u0627 \u0632\u0645\u06cc\u0646 \u062e\u0648\u0631\u062f\u0646 \u0628\u0633\u062a\u0647 \u060c \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0628\u0648\u062f\u062f\u062f\u062f!!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": ["\u0648\u0627\u0627\u0627\u0627\u0627\u06cc \u0639\u0627\u0644\u0644\u0644\u0644\u0644\u0644\u06cc \u0645\u0646 \u0639\u0627\u0634\u0642\u0634\u0648\u0646\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u062e\u0648\u0628\u0647\u061b \u0627\u0645\u0627 \u0645\u0646 \u062f\u0631 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u064a\u0634\u062a\u0631 \u0631\u0648\u0644\u062a \u0634\u0643\u0644\u0627\u062a\u064a \u0628\u06af\u0630\u0627\u0631\u0646\u062f\u061b \u064a\u0639\u0646\u064a \u0627\u064a\u0646\u0643\u0647 \u0646\u0633\u0628\u062a \u0631\u0648\u0644\u062a \u0647\u0627\u064a \u0634\u0643\u0644\u0627\u062a\u064a \u0628\u064a\u0634\u062a\u0631 \u0628\u0647 \u062e\u0627\u0645\u0647 \u0627\u064a \u0628\u0627\u0634\u0647 \u0643\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0645\u062f\u064a\u0631\u064a\u062a \u062a\u0648\u062c\u0647 \u0646\u0643\u0631\u062f\u0647. \n\u0642\u0637\u0639\u0627 \u0648\u0642\u062a\u064a \u0666\u0665\u0660 \u06af\u0631\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645\u060c  \u0665\u0660\u0660 \u0643\u064a\u0644\u0648 \u0637\u0644\u0628 \u0646\u0645\u064a\u0643\u0646\u0645 !!!!! \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u0646\u062f \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u06f2 \u0647\u0641\u062a\u0647 \u067e\u06cc\u0634 \u062f\u0631\u0633\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0686\u0648\u0646 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f. \u0627\u0632 \u0646\u06cc\u0634\u06a9\u0631 \u0628\u0639\u06cc\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u0633\u06cc\u062f\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0644\u0637\u0641\u0627 \u06cc\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u06a9\u06cc\u06a9 \u0647\u0627\u0631\u0627 \u062f\u0631\u0633\u062a \u06a9\u0646\u06cc\u0646 . \u06cc\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u0627\u0637\u0644\u0627\u0639 \u062f\u0647\u06cc\u062f \u062f\u0631\u0633\u062a \u062d\u0645\u0644 \u06a9\u0646\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0634\u064a\u0631\u064a\u0646\u0647\u0627 \u0628\u0633\u064a\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u0627\u0639\u062b \u0622\u0628\u0631\u0648\u0631\u064a\u0632\u064a \u0634\u062f \u0627\u0646\u06af\u0627\u0631 \u0634\u064a\u0631\u064a\u0646\u064a\u0647\u0627\u064a \u0642\u062f\u064a\u0645\u064a \u0631\u0648 \u0645\u064a\u062f\u0646 \u0628\u0647 \u062e\u0631\u064a\u062f \u0622\u0646\u0644\u0627\u064a\u0646", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u0628\u062f \u0648 \u0645\u0648\u0646\u062f\u0647  \u0645\u062a\u0627\u0633\u0641\u0645 \u0627\u06af\u0631 \u0645\u0649\u0634\u062f \u0643\u0647 \u067e\u0633 \u0645\u0649\u0641\u0631\u0633\u062a\u0627\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0622\u0644\u0628\u0627\u0644\u0648 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u062f \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", 1]}
{"text": ["\u067e\u064a\u0643 \u062c\u0648\u0631\u0649 \u0643\u064a\u0643 \u0631\u0648 \u0622\u0648\u0631\u062f\u0646 \u0643\u0647 \u062a\u0645\u0627\u0645\u0634 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u067e\u062e\u0634 \u0634\u062f\u0647! \u0627\u0646\u06af\u0627\u0631 \u0627\u0632 \u062f\u0633\u062a\u0634\u0646 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0627\u0634\u0647 \u064a\u0627 \u0636\u0631\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0627\u0634\u0647! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u062a\u0648\u0633\u0637 \u0646\u06cc\u0634\u06a9\u0631 \u062e\u0634\u06a9 \u0648 \u0632\u06cc\u0627\u062f\u06cc \u0628\u0631\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062f\u0627\u0631\u0627\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0627\u062f\u0628\u064a\u0627\u062a \u0632\u0646\u0646\u062f\u0647 \u067e\u064a\u0643", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06cc\u0627 \u0634\u06cc\u0632\u06cc\u0646\u06cc \u062a\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u060c \u06cc\u0627 \u06a9\u0648\u0627\u0644\u06cc\u062a\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u062c\u0627\u06cc \u0633\u0648\u0627\u0644 \u062f\u0627\u0634\u062a!!! \u0646\u062a\u06cc\u062c\u0634 \u0627\u06cc\u0646 \u0645\u06cc\u0634\u0647 \u06a9\u0647 \u0622\u062f\u0645 \u0628\u0647 \u062f\u0627\u062f\u0646 \u0633\u0641\u0627\u0631\u0634 \u0622\u0646\u0644\u0627\u06cc\u0646 \u0645\u062c\u062f\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9 \u06a9\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0644\u0647 \u0634\u062f\u0647 \u0627\u0648\u0631\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u062f \u060c \u062e\u0634\u06a9 \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a  \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": [" \u0634\u064a\u0631\u064a\u0646\u064a \u06af\u0631\u062f\u0648\u064a\u064a \u0637\u0645\u0639 \u0634\u0643\u0631 \u0628\u064a\u0634\u062a\u0631 \u0645\u064a\u062f\u0647 \u062a\u0627 \u06af\u0631\u062f\u0648 \u060c \u06af\u0631\u062f\u0648 \u0627\u0632 \u0643\u0646\u0627\u0631\u0634 \u0631\u062f \u0634\u062f\u0647 \u0648 \u0647\u0632\u064a\u0646\u0647 \u067e\u064a\u0643 \u0628\u0627\u0644\u0627\u0633\u062a \u0628\u0631\u0627\u064a \u0648\u0644\u0646\u062c\u0643", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 3 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648\u062a\u0628\u0631\u06cc\u06a9 \u0639\u06cc\u062f \u0646\u0648\u0631\u0648\u0632 \n\u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u06a9\u0647 \u0628\u0627\u0642\u0644\u0648\u0627  \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0645\u062d\u062a\u0631\u0645 \u0645\u0630\u06a9\u0648\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0647\u0645\u06cc\u0646 \u062f\u0644\u06cc\u0644 \u0645\u062c\u062f\u062f\u0627 \u062f\u0648 \u0628\u0631\u0627\u0628\u0631 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645.\u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0647 \u062e\u0648\u0628\u06cc \u0642\u0628\u0644 \u0646\u0628\u0648\u062f.\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0631\u0633\u06cc\u062f\u06af\u06cc \u0634\u0648\u062f . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0648 \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645\u060c \u0627\u0648\u0644\u0634 \u06a9\u0647 \u0627\u0633\u062a\u067e \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a \u0648 \u06af\u0641\u062a \u06cc\u0647 \u0631\u0642\u0645\u0634 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0648\u0627\u0633\u0634 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u06cc\u0645 \u06a9\u0647 \u0645\u062b\u0644\u0627 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0627\u0644\u0627 \u0648 \u067e\u0627\u0626\u06cc\u0646\u0634 \u06a9\u06cc\u06a9 \u062f\u0627\u0634\u062a!!!\n\u0627\u0648\u0646 \u06cc\u06a9\u06cc \u0631\u0648 \u0647\u0645 \u06cc\u0647 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u06cc\u0645 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u062a\u0645\u0627\u0633 \u0628\u06af\u06cc\u0631\u06cc\u0645 \u062f\u0648\u0628\u0627\u0631\u0647 \u0627\u0648\u0645\u062f\u0646 \u0639\u0648\u0636 \u06a9\u0631\u062f\u0646\u060c \u0648\u0644\u06cc \u062e\u062f\u0627 \u0648\u06a9\u06cc\u0644\u06cc \u062d\u062a\u06cc \u0648\u0627\u0633\u0647 \u06cc\u06a9 \u0631\u06cc\u0627\u0644 \u0627\u0632 \u067e\u0648\u0644\u06cc \u06a9\u0647 \u062f\u0627\u062f\u0645 \u0631\u0627\u0636\u06cc \u0646\u06cc\u0633\u062a\u0645\u060c\n\u0641\u0627\u0635\u0644\u0647 \u062a\u0648\u0636\u06cc\u062d \u062a\u0627 \u0645\u062d\u0635\u0648\u0644 \u0628\u06cc \u0627\u0646\u062f\u0627\u0632\u0647 \u0632\u06cc\u0627\u062f \u0648 \u0646\u0627\u062f\u0631\u0633\u062a\u0647!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0644\u0628\u0646\u0627\u0646\u06cc \u0646\u0648\u0631\u0648\u0632", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u062e\u0631\u0627\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u0637\u0648\u0631 \u0639\u062c\u06cc\u0628\u06cc \u062e\u0648\u0628 \u0648 \u0628\u06cc \u0646\u0638\u06cc\u0631\u0647 \u0648 \u0627\u0632 \u0627\u0648\u0646 \u0639\u062c\u06cc\u0628 \u062a\u0631 \u062a\u062e\u0641\u06cc\u0641\u06cc \u0647\u0633\u062a \u06a9\u0647 \u0628\u0627 \u0627\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0648 \u0642\u06cc\u0645\u062a \u0645\u0646\u0627\u0633\u0628 \u0642\u0646\u0627\u062f\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0645\u06cc\u062f\u0647... \u0627\u0646\u0635\u0627\u0641\u0627 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0627\u062d\u062a\u0631\u0627\u0645 \u0648 \u0627\u0631\u0632\u0634 \u0628\u0647 \u0645\u0634\u062a\u0631\u06cc \u0631\u0627 \u062f\u0631 \u0627\u06cc\u0631\u0627\u0646 \u0642\u0646\u0627\u062f\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u062f\u0627\u0631\u0647... \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0647\u0627 \u062f\u0627\u063a \u0631\u0633\u06cc\u062f\u0646\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0686\u0633\u067e\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u0622\u0648\u0631\u062f\u0646 \u06af\u0631\u062f\u0648 \u0646\u062f\u0627\u0634\u062a \u0648 \u0634\u06a9\u0644\u0634\u0645 \u0647\u06cc\u0686 \u0631\u0628\u0637\u06cc \u0628\u0647 \u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0646\u062f\u0627\u0634\u062a!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0627\u0632 \u0645\u0634\u062a\u0631\u06cc \u0645\u062f\u0627\u0631\u06cc \u062e\u0648\u0628 \u0642\u0646\u0627\u062f\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645 \u0648 \u0647\u0645\u06cc\u0646 \u0637\u0648\u0631 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a \u0639\u0627\u0644\u06cc\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645 \u0648 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0628\u062f\u0631\u062e\u0634\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u0646\u06cc\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0631\u0648\u06cc \u06a9\u06cc\u06a9\u0648 \u062a\u0628\u0631\u06cc\u06a9 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u062f\u0642\u06cc\u0642\u0627 \u0647\u0645\u0648\u0646 \u0642\u0633\u0645\u062a \u06a9\u0634\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062c\u0639\u0628\u0647 \u0648 \u062e\u0627\u0645\u0647 \u0647\u0627 \u067e\u0627\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u06a9\u06cc\u06a9 \u0635\u062d\u06cc\u062d \u0648 \u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u06cc\u0646\u0628\u0627\u0631 \u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f\n\u0632\u0628\u0627\u0646 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f\u060c \u0628\u0627\u062f\u0627\u0645\u06cc \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u0627\u0645 \u0645\u0631\u0628\u0627\u06cc\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645\u060c \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062e\u0648\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0648 \u062f\u0627\u063a\u0648\u0646 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u0627\u06cc\u0646 \u0686\u0647 \u0648\u0636\u0639\u06cc\u0647\u061f \u0622\u0628\u0631\u0648\u0645\u0648\u0646 \u0631\u0648 \u0628\u0631\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0632\u0626\u06cc\u0646 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0628\u0647\u0645 \u0648 \u0645\u0631\u062a\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0628\u0644\u0648\u06a9\u0627\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0644\u0627\u0645  \u062e\u062f\u0645\u062a \u0645\u062c\u0645\u0648\u0639\u0647 \u0646\u0627\u062a\u0644\u06cc . \u0645\u0646 \u0647\u0645 \u062d\u0636\u0648\u0631\u06cc \u0648 \u0647\u0645 \u0628\u0635\u0648\u0631\u062a \u0627\u0646\u0644\u0627\u06cc\u0646 \u0645\u0634\u062a\u0631\u06cc \u0634\u0645\u0627 \u0647\u0633\u062a\u0645 .\u0627\u0632 \u0648\u0642\u062a\u06cc  \u0634\u0639\u0628\u0647 \u0646\u0627\u062a\u0644\u06cc \u062f\u0631 \u0647\u0631\u0648\u06cc \u0627\u0641\u062a\u062a\u0627\u062d \u0634\u062f \u062f\u06cc\u0647 \u062f\u0648\u0631 \u062a\u0645\u0627\u0645 \u0642\u0646\u0627\u062f\u06cc \u0647\u0627\u06cc \u0627\u0637\u0631\u0627\u0641 \u062e\u0637 \u06a9\u0634\u06cc\u062f\u0645 .\u0634\u06cc\u0631\u0646\u06cc \u0647\u0627\u062a\u0648\u0646 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0647\u0633\u062a\u0634.\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0647\u0645\u062a\u0648\u0646 .\u0645\u0641\u062a\u062e\u0631\u0645 \u06a9 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u0646\u06cc \u062f\u0631 \u06a9\u0627\u0646\u0627\u062f\u0627 \u0633\u0631\u0648 \u0645\u06cc\u0634\u0647 .\u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0648 \u0645\u0648\u0646\u062f\u06af\u0627\u0631\u06cc \u0628\u0627\u0644\u0627\u06cc\u06cc \u06a9 \u062f\u0627\u0631\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647 .\u0631\u0641\u062a\u0627\u0631 \u067e\u0631\u0633\u0646\u0644 \u0646\u0627\u062a\u0644\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0633\u062a \u0628\u0647 \u062e\u0635\u0648\u0635 \u0642\u0633\u0645\u062a \u06a9\u06cc\u06a9 \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0645\u0627\u0631\u0648 \u0634\u0631\u0645\u0646\u062f\u0647 \u062e\u0648\u062f\u0634\u0648\u0646 \u0645\u06cc\u06a9\u0646\u0646 .\u0628\u0627 \u0633\u067e\u0627\u0633 \u0641\u0631\u0627\u0648\u0627\u0631\u0646 \u0648 \u0628\u0647 \u0627\u0645\u06cc\u062f \u062f\u06cc\u062f\u0627\u062f\u0631 \u062f\u0648\u0628\u0627\u0631\u0647 .\n\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0627\u0633\u0646\u067e \u0639\u0632\u06cc\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0646\u062f\u0648 \u0628\u0627 \u06a9\u0631\u0645 \u0631\u0648\u06cc\u0627\u0644 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u06cc\u062f\u0645 \u06f1 \u062f\u0648\u0646\u0647 \u0627\u0634\u0648 \u0647\u0645 \u0646\u062a\u0648\u0646\u0633\u062a\u06cc\u0645 \u0628\u062e\u0648\u0631\u06cc\u0645 \u0627\u0632 \u0628\u0633 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0646 \u062f\u0631 \u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u06a9\u06cc\u06a9 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0628\u0639\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06af\u0641\u062a\u0646 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a.\n\u0642\u0631\u0627\u0631 \u0634\u062f \u0628\u0647 \u062c\u0627\u0634 \u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0628\u0641\u0631\u0633\u062a\u0646 \u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646\u06cc \u062f\u0627\u0634\u062a \u0648 \u0627\u0635\u0644\u0627 \u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0646\u0628\u0648\u062f \u06cc\u0647 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0642\u0647\u0648\u0647 \u0627\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0631\u0648\u0634 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u0646. \n\u062f\u0631 \u0636\u0645\u0646 \u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u06f4 \u0639\u062f\u062f \u062f\u0633\u0631 \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0647 \u06a9\u0647 \u06f2 \u0639\u062f\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0648 \u0628\u0639\u062f \u0627\u0632 \u062a\u0645\u0627\u0633 \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0642\u0631\u0627\u0631 \u0634\u062f \u067e\u0648\u0644 \u06a9\u0633\u0631\u06cc \u0627\u0631\u0633\u0627\u0644 \u0628\u0647 \u0627\u0639\u062a\u0628\u0627\u0631\u0645 \u0648\u0627\u0631\u06cc\u0632 \u0628\u0634\u0647 \u06a9\u0647 \u0646\u0634\u062f. \n\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0645 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0647\u0645\u0647 \u0646\u0627\u0647\u0645\u0627\u0647\u0646\u06af\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0641\u06cc\u0646 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u06cc \u0646\u0647\u0627\u06cc\u062a \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u062f \u0637\u0639\u0645\n\u062c\u0648\u0631\u06cc \u06a9\u0647 \u06cc\u06a9\u0645\u0634 \u0631\u0627 \u062e\u0648\u0631\u062f\u06cc\u0645 \u0648 \u0645\u0627\u0628\u0642\u06cc \u0631\u0627 \u062f\u0648\u0631 \u0631\u06cc\u062e\u062a\u06cc\u0645 \n\u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645 \n\u062e\u06cc\u0644\u06cc \u062a\u062c\u0631\u0628\u0647 \u0628\u062f\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0645 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c\u062a\u0627\u0632\u0647 \u0648 \u0645\u0631\u062a\u0628\u060c\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0648 \u0642\u0646\u0627\u062f\u06cc \u0646\u0627\u062a\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0644\u0646\u062f\u0648 \u0628\u0627 \u06a9\u0631\u0645 \u0631\u0648\u06cc\u0627\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0628\u0644\u0648\u06a9\u0627\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0648\u06cc \u067e\u0627\u06cc \u0633\u06cc\u0628\u060c \u0627\u062b\u0631\u06cc \u0627\u0632 \u0633\u06cc\u0628 \u0646\u0628\u0648\u062f. \u0648\u0644\u06cc \u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u062a\u0642\u0631\u06cc\u0628\u0627 \u0633\u0627\u0644\u0645 \u0647\u0645 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648\u0644\u06cc \u0645\u062f\u0644\u0647\u0627\u0634 \u062e\u06cc\u0644\u06cc \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u0647\u0645 \u0645\u06cc\u06a9 \u062f\u0631\u0633\u062a \u062d\u0645\u0644 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0622\u0633\u06cc\u0628 \u0646\u062f\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0627\u06af\u0631 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u062a\u0631 \u0628\u0627\u0634\u0647 \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631\u0647.\n\u062a\u0627\u0632\u0647 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0645\u0642\u062f\u0627\u0631 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f\u0646 \u0648 \u062e\u0627\u0645\u0647 \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062f\u0644 \u0631\u0648 \u0646\u0645\u06cc \u0632\u062f\n\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0628\u0627 \u0642\u0628\u0644 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u0648 \u0627\u0635\u0644\u0627 \u0645\u0646\u0627\u0633\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0633\u0631\u06cc\u0639 \u0648 \u0642\u0628\u0644 \u0627\u0632 \u0632\u0645\u0627\u0646 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f\n\u0641\u0642\u0637 \u067e\u06cc\u06a9 \u062f\u0631\u0628\u200c \u0633\u0627\u062e\u062a\u0645\u0627\u0646 \u0647\u0646\u06af\u0627\u0645 \u0631\u0641\u062a \u0622\u0645\u062f \u0648 \u062a\u062d\u0648\u06cc\u0644 \u0646\u0628\u0633\u062a\u0647 \u0628\u0648\u062f \u06a9\u0647 \u06a9\u0627\u0631 \u062f\u0631\u0633\u062a\u06cc \u0646\u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0644\u0647 \u0648 \u0644\u0648\u0631\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0647\u067e\u06cc \u0628\u0631\u0633 \u062f\u06cc", -1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0632\u062d\u0645\u0627\u062a \u062a\u0627\u0646 - \u0627\u06af\u0631 \u0628\u062a\u0648\u0627\u0646 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0642\u06cc\u0645\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0642\u062f\u0627\u0631 \u0622\u0646 \u0627\u0632 \u06cc\u06a9 \u06cc\u06a9\u06cc\u0644\u0648 \u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u062e\u0627\u0631\u062c \u0645\u06cc\u0634\u0648\u062f \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u0628\u0639\u0646\u0648\u0627\u0646 \u0645\u062b\u0627\u0644 \u0628\u0634\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0646\u06cc\u0645 \u062e\u0631\u06cc\u062f\u0627\u0631\u06cc \u06a9\u0631\u062f \u0628\u0647\u062a\u0631 \u0645\u06cc\u0634\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0627\u0645\u0627 \u0645\u06cc \u062a\u0648\u0646\u0633\u062a \u0628\u0647\u062a\u0631 \u0628\u0627\u0634\u0647 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0645 \u0628\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u0634 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f.\u0641\u0642\u0637 \u0628\u0627\u06cc\u0633\u062a\u06cc \u062c\u0639\u0628\u0647 \u0645\u062a\u0646\u0627\u0633\u0628 \u0686\u06cc\u062f\u0647 \u0645\u06cc\u0634\u062f \u0686\u0648\u0646 \u062c\u0627\u06cc \u062e\u0627\u0644\u06cc \u06cc\u06a9 \u0631\u062f\u06cc\u0641 \u0648\u062c\u0648\u062f \u062f\u0627\u0634\u062a \u0648 \u0638\u0627\u0647\u0631 \u0642\u0634\u0646\u06af\u06cc \u0646\u062f\u0627\u0634\u062a.\u0628\u0627\u0632\u0645 \u0645\u0645\u0646\u0648\u0646...\u062d\u062a\u0645\u0627 \u0628\u0627\u0632\u0645 \u0628\u0647\u062a\u0648\u0646 \u0632\u062d\u0645\u062a \u0645\u06cc\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062a\u0627\u062e\u06cc\u0631 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\u060c \u062a\u0645\u0627\u0645 \u0628\u0631\u0646\u0627\u0645\u0647 \u0631\u06cc\u0632\u06cc \u0627\u0645 \u062e\u0631\u0627\u0628 \u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (1 \u0639\u062f\u062f)", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062c\u0648 \u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062c\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["1 \u0633\u062a\u0627\u0631\u0647 \u062f\u0627\u062f\u0645 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u06af\u0631\u0648\u0646 \u06a9\u0631\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06af\u0631\u0648\u0647 \u0627\u0633\u0646\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647", "\u06af\u0627\u062a\u0627", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0627\u06a9\u06cc\u0641\u06cc\u062a\u060c \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646\u060c \u0633\u0627\u06cc\u0632\u06a9\u0648\u0686\u06a9 \u06cc\u0639\u0646\u06cc \u062d\u0636\u0648\u0631\u06cc \u0647\u0645 \u0645\u06cc\u0631\u0641\u062a\u0645 \u0633\u0627\u06cc\u0632 \u06a9\u0648\u0686\u06a9 \u0647\u0627 \u0631\u0627 \u0645\u06cc\u06af\u0631\u0641\u062a\u0645\u060c \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u067e\u0631\u0633\u0646\u0644 \u062e\u0648\u0628 \u0646\u0627\u0646 \u0633\u062d\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u06cc\u0646 \u0686\u0646\u062f\u0645\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0633\u062a \u06a9\u0647 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0647\u0645 \u0648 \u0628\u0647 \u0645\u062d\u0636 \u0646\u0647\u0627\u06cc\u06cc \u06a9\u0631\u062f\u0646 \u0633\u0641\u0627\u0631\u0634 \u060c \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062a\u0645\u0627\u0633 \u062f\u0627\u0631\u0645 \u06a9\u0647 \u0645\u0648\u0627\u0631\u062f \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0648 \u0628\u0627\u06cc\u062f \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0634\u0648\u062f \u060c ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0628\u0647 \u062c\u0627\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0645\u0631\u063a \u06a9\u0627\u0631\u06cc \u06cc\u06a9 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u062f\u06cc\u06af\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0686\u06cc\u06a9\u0646 \u06a9\u0627\u0631\u06cc", "\u062a\u0633\u062a \u0628\u06cc\u0648\u0646\u0627\u0646", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0645\u06a9", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648 \u062e\u0634\u06a9 \u062e\u0634\u06a9 \u0627\u0635\u0644\u0627 \u062f\u0627\u062e\u0644\u0634 \u067e\u0646\u06cc\u0631 \u0646\u062f\u0627\u0634\u062a \u0645\u0646 \u0642\u0628\u0644\u0627 \u0628\u0627\u0631\u0647\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0635\u0644\u0627 \u0627\u06cc\u0646 \u0645\u0634\u06a9\u0644 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u060c \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f.\n\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631 \u0633\u0627\u06cc\u0632\u0634 \u0648 \u0628\u0631\u0634 \u062e\u06cc\u0644\u06cc \u0627\u0641\u062a\u0636\u0627\u062d \u0648 \u0628\u06cc \u062f\u0642\u062a \n\u0646\u0648\u0646 \u062a\u06cc\u06a9\u0647 \u062a\u06cc\u06a9\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 13 \u0639\u062f\u062f)", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (1 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u0645\u062d\u0635\u0648\u0644\u06cc \u0631\u0627 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f \u062f\u0627\u062e\u0644 \u0627\u067e\u0644\u06cc\u06a9\u06cc\u0634\u0646 \u0627\u0635\u0644\u0627\u062d \u0628\u0641\u0631\u0645\u0627\u06cc\u06cc\u062f \u06a9\u0647 \u0645\u062c\u0628\u0648\u0631 \u0646\u0634\u0648\u06cc\u0645 \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0647\u0648\u0644 \u0647\u0648\u0644\u06a9\u06cc \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u062a\u0633\u062a \u0633\u06cc\u0627\u0647 \u0628\u0632\u0631\u06af (\u062d\u062f\u0648\u062f\u0627 760 \u06af\u0631\u0645)", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0632\u064a\u0646\u0647 5500\u067e\u064a\u0643 \u0628\u0647 \u0646\u0633\u0628\u062a \u0628\u0627\u0644\u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062b\u0645\u06cc\u0646", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633\u062f\u0627\u0631 (\u0628\u0633\u062a\u0647 \u0627\u06cc)", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", -1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0648\u0632\u0646 \u062c\u0639\u0628\u0647 \u064a\u0627 \u0647\u0631 \u0643\u064a\u0643 \u062f\u0631\u062c \u0628\u0634\u0647\u060c \u0645\u064a\u0646\u064a \u0643\u064a\u0643 \u0647\u0627 \u062f\u0631 \u0639\u0643\u0633 \u062e\u064a\u0644\u064a \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0647 \u0645\u0638\u0631 \u0645\u064a \u0631\u0633\u064a\u062f\u0646\u062f. \u0643\u064a\u0641\u064a\u062a \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0648 \u0645\u0634\u0643\u0644\u064a \u0647\u0645 \u0628\u0631\u0627\u0634\u0648\u0646 \u067e\u064a\u0634 \u0646\u064a\u0648\u0645\u062f\u0647 \u0628\u0648\u062f \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u064a\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u067e\u0627\u0649 \u0633\u064a\u0628 \u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u0649\u060c \u0645\u0631\u0635\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062a\u0634\u06a9\u0631 \u0641\u0631\u0627\u0648\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f\n\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0628\u0627\u0632 \u0647\u0645 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u0686\u0646\u062f\u0645 \u06a9\u06cc\u06a9 \u062f\u0631 \u0631\u0627\u0627\u0647 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0631\u0648\u06cc\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f \u0628\u0647 \u06a9\u06cc\u06a9 \u0648 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 HBD \u0646\u0642\u0631\u0647 \u0627\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u064a\u064a\u064a\u064a\u064a\u064a\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "Don't Even Ask", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0627\u06af\u0631 \u06a9\u0645\u06cc \u062a\u0627\u0632\u0647 \u062a\u0631 \u0628\u0648\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0647\u062a\u0631\u06cc \u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648\u200c\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", 1]}
{"text": ["\u067e\u0633 \u0627\u0632 \u06af\u0634\u0648\u062f\u0646 \u06cc\u06a9\u06cc \u0627\u0632 \u062c\u0639\u0628\u0647 \u0647\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u060c \u0627\u062d\u0633\u0627\u0633 \u06a9\u0631\u062f\u0645 \u0632\u0644\u0632\u0644\u0647 \u0627\u06cc \u0634\u0634 \u0648 \u0646\u06cc\u0645 \u0631\u06cc\u0634\u062a\u0631\u06cc \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u062e \u062f\u0627\u062f\u0647 ... \u0628\u0647 \u06af\u0645\u0627\u0646\u0645 \u062c\u0639\u0628\u0647 \u0627\u0632 \u067e\u06cc\u06a9 \u0645\u0648\u062a\u0648\u0631 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0627\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc 650 \u06af\u0631\u0645", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u06a9\u0644\u0627 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f .\u0631\u0648\u06cc \u0647\u0645 \u0686\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0628\u0648\u062f \u062a\u0627 \u062a\u0646\u0648\u0631\u06cc..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc .\n\u062a\u0627\u0632\u0647 \u0648 \u0633\u0627\u0644\u0645 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u060c \u0639\u0627\u0644\u06cc\u060c \u0639\u0627\u0644\u06cc \n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u062a\u0628\u0631\u06cc\u0632\u06cc 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u064a\u0643 \u0647\u0641\u062a\u0647 \u067e\u064a\u0634 \u062f\u0631\u0633\u062a \u0643\u0631\u062f\u0646 \n\u062e\u064a\u0644\u064a \u0627\u0641\u062a\u0636\u0627\u062d \n\u0627\u0632 \u0646\u064a\u0634\u0643\u0631 \u0628\u0639\u064a\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 (\u0637\u0631\u062d \u062f\u06a9\u0648\u0631 \u0645\u062a\u063a\u06cc\u0631)", -1]}
{"text": ["\u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0627\u0648\u0631\u062f\u0646 \u060c \u0641\u0642\u0637 \u062c\u0639\u0628\u0647 \u062e\u06cc\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0648\u0646\u0645 \u0628\u062e\u0627\u0637\u0631 \u0628\u0627\u0631\u0627\u0646 \u0634\u062f\u06cc\u062f \u0628\u0648\u062f \u062a\u0642\u0635\u06cc\u0631\u06cc \u0646\u062f\u0627\u0634\u062a\u0646 ", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0631\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["Mesle hamishe aali", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u067e\u06cc\u06a9\u062a\u0648\u0646 \u06a9\u06cc\u06a9 \u0648 \u0644\u0647 \u0634\u062f\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u06af\u0644\u0627\u0628\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u062a\u0627\u0631\u062a \u0634\u06a9\u0633\u062a\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. \u0645\u0646 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06a9\u0627\u0631\u0628\u0631 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u06cc \u062e\u0648\u0627\u0645 \u06a9\u0627\u0631\u0647\u0627\u0645 \u0633\u0631\u06cc\u0639\u062a\u0631 \u0648 \u0628\u0647\u062a\u0631 \u0627\u0646\u062c\u0627\u0645 \u0628\u0634\u0647. \u0646\u0647 \u0627\u06cc\u0646 \u06a9\u0647 \u0645\u062c\u0628\u0648\u0631 \u0628\u0634\u0645 \u0645\u062c\u062f\u062f\u0648\u0642\u062a \u0628\u06af\u0630\u0627\u0631\u0645 \u0628\u0631\u0645 \u0647\u0645\u0648\u0646 \u06a9\u0627\u0631 \u0631\u0648 \u062f\u0648\u0628\u0627\u0631\u0647 \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \n\u0643\u064a\u0643 \u0627\u0648\u0644\u0627 \u0628\u0627\u062a\u0627\u062e\u064a\u0631 \u0648 \u062b\u0627\u0646\u064a\u0627 \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0648 \u063a\u064a\u0631 \u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u064a\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f\n\u0645\u0646 \u0628\u0631\u0627\u064a \u0645\u0627\u062f\u0631\u0645 \u0647\u062f\u064a\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648 \u0643\u0644\u064a \u0634\u0631\u0645\u062a\u062f\u0647 \u0634\u062f\u0645 \n\u067e\u064a\u0643 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u064a\u0644 \u0646\u06af\u0641\u062a\u0647 \u0628\u0648\u062f\u0647 \u0643\u0647 \u0686\u0643 \u0643\u0646\u064a\u0646 \u060c \u0645\u0627\u062f\u0631 \u0647\u0645 \u0628\u0646\u062f\u0647 \u062e\u062f\u0627 \u0646\u0645\u064a \u062f\u0648\u0646\u0633\u062a\u0647 \u0643\u0647 \u0628\u0627\u064a\u062f \u0643\u0646\u062a\u0631\u0644 \u0643\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u062e\u0631\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0628\u0648\u062f\u0647.\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u062e\u0631\u06cc\u062f\u0627\u0631\u06cc \u0634\u062f\u0647 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u0647 \u0634\u062f\u062a \u062e\u0634\u06a9 \u0628\u0648\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u067e\u0631\u0627\u0632 \u062a\u06a9\u0647 \u0647\u0627\u06cc \u06af\u0631\u062f\u0648\u060c \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062d\u062a\u06cc \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0627\u062d\u062a\u06cc\u0627\u0637 \u0645\u06cc\u06a9\u0631\u062f \u0648 \u0647\u0645\u06cc\u0646 \u0628\u0627\u0639\u062b \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06cc\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0628\u0631\u0633\u0647 \u0628\u062f\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0645\u063a\u0632\u062f\u0627\u0631 (\u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0634\u06cc\u0646\u06cc \u0646\u0648\u0631\u0648\u0632", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u062f\u0644\u06cc\u0644 \u0639\u062f\u0645 \u0645\u0648\u062c\u0648\u062f\u06cc \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u0633\u0641\u0627\u0631\u0634\u0645\u0648 \u062a\u0644\u0641\u0646\u06cc \u0648 \u0628\u062f\u062f\u0646 \u0627\u0645\u06a9\u0627\u0646 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0627\u0641\u06cc \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u06a9\u0646\u0645 \u0648 \u0686\u06cc\u0632\u06cc \u0628\u062e\u0631\u0645 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u0646\u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0641\u06a9\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0633\u0648\u0647\u0627\u0646 \u0639\u0633\u0644\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 17 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f.\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u06cc\u0641\u06cc \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u06a9\u0647 \u062d\u0642 \u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u0647 \u0645\u0627 \u062f\u0627\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u06cc\u0641\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", "\u062a\u0648\u062a \u0628\u0627\u062f\u0627\u0645", "\u062e\u0627\u0646\u06af\u06cc \u0628\u0632\u0631\u06af \u0686\u0647\u0627\u0631 \u062e\u0627\u0646\u0647", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0641\u06a9\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0644\u0628\u0646\u0627\u0646\u06cc \u0645\u062e\u0644\u0648\u0637", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u062f\u0631 \u062d\u06cc\u0646 \u0627\u0646\u062a\u0642\u0627\u0644 \u067e\u0631\u0627\u06a9\u0646\u062f\u0647 \u0634\u062f\u0647 \u0648 \u0628\u0633\u062a\u0647\u200c\u0628\u0646\u062f\u06cc\u200c\u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0698\u06cc\u0645\u06cc", "\u0646\u062e\u0648\u062f\u0686\u06cc \u06af\u0644 \u06af\u0631\u062f", "\u0646\u062e\u0648\u062f\u0686\u06cc \u0686\u0647\u0627\u0631 \u067e\u0631", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u0634\u062a\u0648\u06a9", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0632 \u0628\u0627\u0642\u0644\u0648\u0627 \u062a\u0628\u0631\u06cc\u0632\u06cc \u062e\u0648\u0634\u0645\u0648\u0646 \u0646\u06cc\u0648\u0645\u062f \u06af\u0644\u0627\u0628\u0634\u0645 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f.\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0648 \u0628\u0633\u062a\u0647 \u0628\u0627\u0642\u0644\u0648\u0627 \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645.\u0628\u0627\u0642\u0644\u0648\u0627 \u0641\u0642\u0637 \u0628\u0627\u0642\u0644\u0648\u0627\u06cc \u06cc\u0632\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u0627\u0645\u06cc \u0631\u06cc\u0632", "\u0628\u0627\u0642\u0644\u0648\u0627 \u062a\u0628\u0631\u06cc\u0632 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\n\u0647\u06cc\u0686 \u0642\u0646\u0627\u062f\u06cc \u0628\u0647 \u067e\u0627\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u0645\u06cc\u0631\u0633\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u062a\u0628\u0631\u06cc\u0632 \u06a9\u0648\u0686\u06a9", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0633\u0644\u06cc \u062a\u062e\u062a \u067e\u0633\u062a\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u062c\u06cc\u0644\u06cc \u067e\u0631 \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0628\u0647 \u0646\u0638\u0631\u0645 \u0632\u06cc\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646\u0647. \u0645\u0646 \u0645\u06cc\u06a9\u0627\u062f\u0648 \u062f\u0648\u0633\u062a \u062f\u0627\u0631\u0645 \u0648\u0644\u06cc \u062e\u0648\u0631\u062f\u0646 \u0627\u06cc\u0646 \u0645\u06cc\u06a9\u0627\u062f\u0648 \u0628\u0631\u0627\u0645 \u0633\u062e\u062a\u0647 \u0648\u0627\u0642\u0639\u0627. \u062f\u0631 \u0636\u0645\u0646 \u0645\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u062a\u06a9 \u0646\u0641\u0631\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u067e\u0627\u06cc \u0633\u06cc\u0628 \u06af\u0631\u062f \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f \u06a9\u0647 \u0627\u0644\u0628\u062a\u0647 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0628\u062f \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0686\u06cc\u0632\u06cc \u0646\u0628\u0648\u062f \u06a9\u0647 \u0645\u0646 \u0645\u06cc\u200c\u062e\u0648\u0627\u0633\u062a\u0645.\n\u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9\u200c\u0647\u0627\u06cc \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u062a\u0630\u06a9\u0631 \u0628\u062f\u06cc\u062f \u06a9\u0647 \u062f\u0631 \u062e\u0648\u0646\u0647 \u0631\u0648 \u0622\u0631\u0648\u0645 \u0628\u0628\u0646\u062f\u0646\u062f \u06a9\u0647 \u0637\u0628\u0642\u0647\u200c\u0647\u0627\u06cc \u067e\u0627\u06cc\u06cc\u0646 \u0627\u0630\u06cc\u062a \u0646\u0634\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u0646\u0641\u0631\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0648\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0639\u06a9\u0633\u0634 \u0628\u0648\u062f \u0627\u0648\u0646 \u0646\u0628\u0648\u062f \u06cc\u06a9\u06cc\u0634 \u06a9\u0647 \u0627\u0646\u06af\u0627\u0631 \u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062f\u0627\u062e\u0644\u0634\u0645 \u06cc\u062e \u0632\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", -1]}
{"text": ["\u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u0662 \u0628\u0633\u062a\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u062e\u0648\u062f\u064a \u0633\u0627\u062f\u0647 \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0648\u062a \u0633\u0641\u064a\u062f \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0643\u0647 \u0641\u0642\u0637 \u064a\u0643 \u0628\u0633\u062a\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u062e\u0648\u062f\u064a \u0633\u0627\u062f\u0647 \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0648\u062a \u0633\u0641\u064a\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0627\u0633\u062a. (\u064a\u0643 \u0628\u0633\u062a\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u062e\u0648\u062f\u064a \u0633\u0627\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0646\u0634\u062f\u0647 \u0627\u0633\u062a)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u062e\u0648\u062f\u0686\u06cc \u0633\u0627\u062f\u0647", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0648\u062a \u0633\u0641\u06cc\u062f", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u062e\u0648\u062f\u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u062e\u0648\u062f\u0686\u06cc \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u062f\u0631\u062c\u0647 \u06cc\u06a9 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u062e\u0645\u0647 \u0698\u0627\u067e\u0646\u06cc 250 \u06af\u0631\u0645", "\u062a\u062e\u0645\u0647 \u06a9\u062f\u0648 \u06af\u0648\u0634\u062a\u06cc 250 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0642\u0632\u0648\u06cc\u0646\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0631\u0627\u064a \u0643\u0648\u0643\u064a \u0632\u064a\u0627\u062f\u064a \u0634\u064a\u0631\u064a\u0646 \u0647\u0633\u062a\u060c\u060c \u0648 \u0645\u0632\u0647 \u0628\u0627\u062f\u0627\u0645 \u0647\u0645 \u0646\u0645\u064a\u062f\u0647 \u0627\u0635\u0644\u0627...\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0628\u0627\u062f\u0627\u0645 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0648 \u063a\u06cc\u0631 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \n\u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 .\u0648\u0644\u06cc \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628 \u0646\u0638\u0631 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u0631\u0648\u0644\u062a \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f  \u067e\u06cc\u06a9 \u0647\u0645 \u0628 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0686\u0627\u06a9\u0644\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0644\u06cc\u0648\u0631\u06cc \u062e\u06cc\u0644\u06cc \u0645\u0648\u062f\u0628 \u0628\u0648\u062f \u060c\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0631 \u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647 \u0641\u0631\u0634 \u0628\u0648\u062f  \u0627\u0645\u0627 \u0645\u0627\u0631\u0633 \u062a\u0648\u0634 \u06a9\u0645  \u062a\u0631 \u0628\u0648\u062f .\u062f\u0631 \u06a9\u0644 \u0627\u0648\u06a9\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0643\u0632\u064a\u0643\u064a \u0628\u0633\u064a\u0627\u0631 \u0628\u064a\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\n\u062e\u0627\u0645\u0647 \u0627\u064a \u0647\u0645 \u0645\u0627\u0644 \u0647\u0645\u0648\u0646 \u0631\u0648\u0632 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", -1]}
{"text": ["\u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0627 \u067e\u0633\u062a \u0634\u062f\u0647\u060c \u062f\u0631 \u0637\u0648\u0644 \u0645\u0633\u06cc\u0631 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0648 \u0634\u0631\u0627\u06cc\u0637 \u0646\u06af\u0647\u062f\u0627\u0631\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u062f\u0631 \u0637\u0648\u0644 \u0645\u0633\u06cc\u0631 \u0645\u0646\u0647\u062f\u0645 \u0634\u062f\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0646\u0648\u0634\u062a\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0646\u0627\u062e\u0648\u0627\u0646\u0627 \u0628\u0648\u062f.\n\u0648 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u06a9\u062c \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. \u062a\u0627\u062e\u06cc\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f.\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u0628\u0631\u0627\u06cc \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0636\u0639\u06cc\u0641", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062f\u0645\u062a \u06af\u0631\u0645\n\u062e\u0631\u064a\u062f \u0643\u064a\u0643 \u062a\u0648 \u0631\u0648\u0632 \u0627\u0648\u0644 \u0633\u0627\u0644 \u062e\u064a\u0644\u064a \u0633\u062e\u062a \u0628\u0648\u062f. \u0627\u0645\u0633\u0627\u0644 \u062f\u0631 \u0643\u0645\u0627\u0644 \u0622\u0633\u0627\u064a\u0634 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", "\u0634\u0645\u0639 \u0639\u062f\u062f 1", 1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0631\u06cc\u062f\u0627\u0645 \u0627\u0632 \u0627\u06cc\u0646\u062c\u0627\u0633\u062a \u0648 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0645 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u060c \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0645 \u06a9\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u062e\u0635\u0648\u0635 \u0628\u0631\u0627\u0648\u0646\u06cc\u060c \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f. \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0648\u0628 \u0648 \u0633\u0631 \u0648\u0642\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u061b \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc\u0647\u060c \u0647\u0645 \u062a\u0627\u0632\u0647 \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0635\u0644\u0627 \u0643\u064a\u0641\u064a\u062a \u0645\u0646\u0627\u0633\u0628\u064a \u0646\u062f\u0627\u0634\u062a \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0647\u0645\u0634\u0648\u0646 \u0633\u0641\u064a\u062f \u0648 \u0648\u0627\u0646\u064a\u0644\u064a \u0628\u0648\u062f\u0646 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062d\u062a\u064a \u064a\u0647 \u0631\u062f\u064a\u0641 \u0634\u0643\u0644\u0627\u062a\u064a \u064a\u0627 \u0646\u0633\u0643\u0627\u0641\u0647 \u0627\u064a \u0646\u062f\u0627\u0634\u062a \u0648 \u0627\u0635\u0644\u0627 \u0645\u062b\u0644 \u0639\u0643\u0633 \u0645\u062a\u0646\u0648\u0639 \u0646\u064a\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u0647\u0645\u0634\u0648\u0646 \u062e\u0627\u0645\u0647 \u0633\u0641\u064a\u062f \u0648 \u067e\u0648\u062f\u0631 \u067e\u0633\u062a\u0647 \u0627\u064a \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0643\u0647 \u062d\u062a\u064a \u0645\u062b\u0644 \u0627\u0633\u0645\u0634\u0645 \u0645\u062e\u0644\u0648\u0637 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u062c\u0627\u06cc \u0639\u062f\u062f 2\u060c\u0639\u062f\u062f 3 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0639\u062f\u062f 2", "\u0634\u0645\u0639 \u0639\u062f\u062f 8", -1]}
{"text": ["\u0639\u0627\u0644\u064a. \u0648\u0644\u064a \u0641\u0642\u0637 \u064a\u0643\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f \u0628\u0647 \u062f\u064a\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0631\u06cc\u0639\n\u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u0627\u0634 \u0645\u062b\u0644 \u0639\u06a9\u0633\u0634 \u0628\u0648\u062f \u0645\u062e\u0644\u0648\u0637\u06cc \u06a9\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u0646\u060c \u0648\u0627\u0642\u0639\u0627 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631\u06cc \u06a9\u0647 \u062a\u0648\u0634 \u06cc\u0647 \u062f\u0648\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u0628\u0627\u0634\u0647\u060c \u06a9\u0627\u0631 \u0627\u062e\u0644\u0627\u0642\u06cc \u0633\u062a\u061f \u0627\u0632 \u0634\u0645\u0627 \u0645\u06cc \u067e\u0631\u0633\u0645! :(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062a\u0642\u0631\u06cc\u0628\u0627 \u0646\u0635\u0641 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0634 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f\n\u0645\u0646 \u0646\u0645\u06cc \u062f\u0648\u0646\u0645 \u06cc\u0627 \u062f\u0627\u062e\u0644 \u0645\u063a\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0648 \u0628\u062f \u0686\u06cc\u062f\u0646 \u06cc\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0628\u062f \u0622\u0648\u0631\u062f\u0646\n\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f.\u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u0633\u062d\u0631 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u067e\u06cc\u06a9 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u062f\u0648\u0645 \u0633\u0641\u0627\u0631\u0634 \u0645\u0646\u0648 \u0631\u0648\u06cc \u06a9\u0627\u0646\u062a\u0631 \u0646\u06af\u0647\u0628\u0627\u0646\u06cc \u0631\u0647\u0627 \u06a9\u0631\u062f \u0648 \u0631\u0641\u062a!!!!!!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0645\u0631\u063a \u0633\u062d\u0631", "\u0633\u0645\u0628\u0648\u0633\u0647", 1]}
{"text": ["\u0647\u0631 \u0686\u06cc \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc \u0628\u0644\u0627\u0641\u0627\u0635\u0644\u0647 \u0632\u0646\u06af \u0645\u06cc\u0632\u0646\u0646 \u0645\u06cc\u06af\u0646 \u0646\u0627\u0645\u0648\u062c\u0648\u062f\u0647 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0645\u06cc\u06a9\u0646\u0646 \u0628\u0627 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u062a\u0648 \u0631\u0648 \u062e\u062f\u0627 \u0645\u0646\u0648 \u0645\u0648\u062c\u0648\u062f \u0648 \u063a\u06cc\u0631\u0645\u0648\u062c\u0648\u062f  \u0631\u0648 \u0628\u0647 \u0631\u0648\u0632 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0647\u06cc \u0627\u06cc\u0646 \u0646\u06cc\u0633\u062a \u0648 \u0627\u0648\u0646 \u0646\u06cc\u0633\u062a \u0646\u0634\u0647 \u062e\u06cc\u0644\u06cc \u0636\u062f \u062d\u0627\u0644\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u062c\u0648 100% \u0633\u0627\u062f\u0647", "\u0633\u0628\u0648\u0633 80%", 1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0641\u0642\u0637 \u0645\u0646 \u06f2 \u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06f1 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0627\u06a9 \u0645\u06a9", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (1 \u0639\u062f\u062f)", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644", -1]}
{"text": ["\u0645\u0646 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0639\u0627\u062f\u06cc \u0631\u0648 \u0628\u0631\u0627\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u0646..\u0648\u0644\u06cc \u0627\u06cc\u0646 \u0647\u0645 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f..\u0645\u0645\u0646\u0648\u0646...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0633\u0645\u0628\u0648\u0633\u0647", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u062a\u0648\u062c\u0647\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f \n\u062e\u0648\u0627\u0647\u0634\u0645\u0646\u062f\u0645 \u062f\u0631 \u0635\u0648\u0631\u062a \u0646\u0628\u0648\u062f \u06cc\u06a9\u06cc \u0627\u0632 \u0646\u0627\u0646 \u0647\u0627 \u0622\u0646 \u0631\u0627 \u062f\u0631 \u0645\u0631\u062d\u0644\u0647 \u0633\u0641\u0627\u0631\u0634 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0646\u06cc\u062f \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0639\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0639\u0648\u0636 \u06a9\u0646\u06cc\u062f \u0646\u0627\u0646 \u0645\u0648\u0631\u062f \u0646\u0638\u0631\u0631\u0648", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631\u06cc \u0648 \u0628\u0631\u0628\u0631\u06cc \u0647\u0645\u06af\u06cc \u0628\u06cc\u0627\u0646 \u0628\u0648\u062f\u0646\u062f .\u0648 \u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a\n\u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631\u06cc \u067e\u0646\u062c \u0639\u062f\u062f\u06cc \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0628\u062f\u0648\u0646 \u0630\u06a9\u0631 \u062f\u0644\u06cc\u0644 \u0648 \u06cc\u0627 \u0627\u0639\u0644\u0627\u0645 \u0645\u0648\u0636\u0648\u0639 \u0646\u0627\u0646 \u062f\u0648\u062a\u0627\u06cc\u06cc \u0628\u06cc\u0627\u062a \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u0639\u062f\u062f)", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0633\u0648\u062e\u0627\u0631\u06cc \u06a9\u0634\u0645\u0634 \u0648 \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0648\u0644\u06cc \u0627\u06cc\u0646 \u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u06cc \u0645\u0646\u0648 \u06a9\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u062f\u0648 \u062a\u0627 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u0646\u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0645\u0646 \u062f\u06cc\u0631\u0648\u0632 \u0648\u0642\u062a \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0646\u062f\u0627\u0634\u062a\u0645 \u0648\u0644\u06cc \u0628\u0642\u06cc\u0647 \u0646\u0648\u0646\u0647\u0627 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0647\u0641\u062a \u06af\u06cc\u0627\u0647", "\u0633\u0648\u067e\u0631 \u0633\u06cc\u0627\u0647", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0633\u0628\u0648\u0633 80%", -1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0632\u0647 \u06a9\u06cc\u06a9 \u0628\u0686\u0647 \u06af\u06cc\u0645\u0648\u0646\u0648 \u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u067e\u06cc \u0633\u0627\u0644\u0627\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0628\u0631\u0639\u0643\u0633 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0633\u0627\u0644\u0645 \u0631\u0633\u064a\u062f \u062f\u0633\u062a\u0645 \u060c \u0645\u0631\u0633\u064a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u060c \u062f\u0631 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0645 \u0644\u0647 \u0646\u0634\u0648\u062f \u0648 \u0628\u0631\u0646\u06af\u0631\u062f\u062f \u06a9\u0647 \u0628\u0647 \u062e\u0648\u0628\u06cc \u062f\u0642\u062a \u0634\u062f . \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0633\u0631\u0639\u062a \u0628\u0627\u0644\u0627 \u0648 \u0639\u062f\u0645 \u062f\u0642\u062a \u067e\u06cc\u06a9 \u0645\u0648\u062a\u0648\u0631\u06cc \u0627\u0633\u0646\u067e \u061b \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0648\u0627\u0631\u0648\u0646\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0644 \u0631\u0648\u06cc\u0647 \u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f ..\u0686\u0631\u0627 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u062f\u0631 \u0627\u0648\u0631\u062f\u0646 \u0648 \u062a\u062d\u0648\u06cc\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0642\u062a \u0646\u0645\u06cc\u06a9\u0646\u0646 \u061f \u0627\u06cc\u0646 \u0686\u0646\u062f\u0645\u06cc\u0646 \u0628\u0627\u0631\u06cc \u0647\u0633\u062a \u06a9\u0647 \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0645\u06cc\u0641\u062a\u0647 ! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 2", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0648 \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f.\n\u0646\u062d\u0648\u0647 \u0686\u06cc\u0646\u0634 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.\n\u0627\u0644\u0628\u062a\u0647 \u0686\u0648\u0646 \u0627\u0632 \u062a\u062c\u0631\u0628\u0647 \u062f\u0648\u0633\u062a\u0627\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0631\u062f\u0645 \u0648 \u06cc\u0627\u062f\u062f\u0627\u0634\u062a \u06af\u0630\u0627\u0634\u062a\u0645 \u06a9\u0647 \u062f\u0631\u0635\u0648\u0631\u062a \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u0646 \u0639\u0648\u062f\u062a \u0645\u06cc\u06af\u0631\u062f\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0628\u0647 \u0637\u0631\u0632 \u0639\u062c\u064a\u0628\u064a \u0648 \u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u064a\u0634\u0647 \u0643\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0628\u0631\u06af\u0634\u062a\u0647 \u0648 \u0646\u0627\u0645\u0631\u062a\u0628 \u0628\u0648\u062f\u060c \u0627\u064a\u0646\u0628\u0627\u0631 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a....\u0645\u0631\u062a\u0628 \u0648 \u062f\u0631\u0633\u062a \u0686\u064a\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u064a\u0644\u064a \u0627\u0633\u0646\u067e \u0628\u0627\u0643\u0633 \u0627\u064a\u0646\u062f\u0641\u0639\u0647 \u0631\u0627\u0636\u064a \u0643\u0646\u0646\u062f\u0647 \u0638\u0627\u0647\u0631 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0644\u0647 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645 \u0647\u0645\u0634 \u062a\u0648 \u062c\u0647\u0628\u0647 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u060c \u0645\u0646 \u06cc\u0647 \u0645\u062e\u0644\u0648\u0637 \u0644\u0647 \u0634\u062f\u0647 \u062a\u06cc \u0627\u0632 \u067e\u0648\u062f\u06cc\u0646\u06af \u0648 \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645 \u06a9\u0647 \u062e\u0648\u0634 \u0645\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0644\u0647 \u0634\u062f\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062f\u0648", "\u0634\u0645\u0639 \u0647\u0641\u062a", -1]}
{"text": ["\u067e\u0627\u06cc \u0627\u0644\u0628\u0627\u0644\u0648 \u0637\u0639\u0645 \u0627\u0647\u0646 \u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0637\u0639\u0645\u0634 \u0645\u0639\u0645\u0648\u0644\u064a \u0628\u0648\u062f \u0648\u0644\u064a \u0643\u064a\u0641\u064a\u062a \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0645\u0634 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0686\u0631\u0627 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u062f\u0646\n\u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 HBD \u0646\u0642\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u062a\u0632\u064a\u064a\u0646 \u0631\u0648\u064a \u0643\u064a\u0643 \u0643\u0647 \u0645\u062e\u0635\u0648\u0635 \u064a\u0644\u062f\u0627 \u062f\u0631 \u0639\u0643\u0633 \u064a\u0643 \u062d\u0627\u0641\u0638 \u0631\u0648\u064a \u0643\u064a\u0643 \u0628\u0648\u062f \u062f\u0631 \u0643\u064a\u0643 \u062a\u062d\u0648\u064a\u0644 \u0634\u062f\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0686\u0646\u062f \u0637\u0639\u0645 \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u062a\u0648\u0646 \u062e\u06cc\u0644\u06cc \u0627\u0648\u0648\u0645\u062f\u0647 \u067e\u0627\u06cc\u06cc\u0646....\u06a9\u0627\u0634 \u0628\u0647 \u0627\u06cc\u0646 \u0645\u0648\u0636\u0648\u0639 \u062a\u0648\u062c\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0647\u0646\u062f\u0648\u0627\u0646\u0647 \u0627\u06cc \u0645\u062a\u0648\u0633\u0637", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0627\u0646\u0627\u0631 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u0646 \u06f1\u06f0 \u062a\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u067e\u0648\u0644 \u06f1\u06f0 \u062a\u0627 \u0631\u0648 \u062d\u0633\u0627\u0628 \u06a9\u0631\u062f\u0646.\u0627\u0644\u0627\u0646 \u0686\u0631\u0627 \u06f9 \u062a\u0627 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u061f\u061f!!! \u0647\u0645\u0647 \u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646\u06cc \u0646\u06cc\u0633\u062a.\u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u062a\u0630\u06a9\u0631 \u0628\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u06cc\u0646\u06af \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627", "\u0631\u062f\u0648\u0644\u0648\u062a \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627", "\u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0628\u0631\u0627\u064a \u0627\u0633\u0646\u067e \u0645\u062a\u0627\u0633\u0641\u0645 \u0643\u0647 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0627\u064a\u0646\u0642\u062f\u0631 \u062f\u064a\u0631 \u0645\u064a\u0631\u0633\u0647", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u062f \u0646\u06cc\u0633\u062a \u0627\u0645\u0627 \u0628\u0627\u0642\u0644\u0648\u0627\u0634\u0648\u0646 \u0632\u06cc\u0627\u062f\u06cc \u0639\u0633\u0644\u06cc \u0648 \u062e\u0634\u06a9 \n\u0642\u06cc\u0645\u062a\u0634 \u06a9\u0647 \u0645\u0646\u0627\u0633\u0628\u0647 \u0641\u0642\u0637 \u0686\u0631\u0627 \u0627\u06cc\u0646\u0637\u0648\u0631\u06cc \u0646\u0645\u06cc \u062f\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062a\u0648 \u0627\u0631\u0633\u0627\u0644 \u06a9\u06cc\u06a9 \u062c\u0627\u0628\u0647 \u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u0634\u06a9\u0644\u0634 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0633\u0631\u06cc \u0642\u0628\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0646\u0627\u0631\u06af\u064a\u0644\u064a\u0634 \u062e\u064a\u0644\u064a \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639 \u0639\u0627\u0644\u064a \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u06af\u0644\u0627\u0628\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f\u0646\u062f \u0648\u0644\u064a \u0628\u062f\u0644\u064a\u0644 \u0627\u064a\u0646\u0643\u0647 \u062d\u062c\u0645 \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0628\u0627\u0644\u0627 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u064a\u0643\u064a \u0627\u0632 \u0643\u064a\u0643 \u0647\u0627 \u0643\u0647 \u062e\u0627\u0645\u0647 \u0627\u064a \u0647\u0645 \u0628\u0648\u062f \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0648 \u0638\u0627\u0647\u0631\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f. \u0643\u0647 \u0628\u0627 \u0647\u0645\u0627\u0647\u0646\u06af\u064a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0631\u0627\u0645 \u0639\u0648\u0636\u0634 \u0643\u0631\u062f\u0646\u062f . \u0648\u0644\u064a \u0628\u0627\u0632 \u0647\u0645 \u0643\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0628\u0647 \u0645\u0642\u062f\u0627\u0631 \u0643\u0645\u064a \u0628\u0627\u0632\u0647\u0645 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0643\u0647 \u062f\u064a\u06af\u0631 \u06af\u0630\u0634\u062a\u0645. \u062f\u0631 \u0643\u0644 \u067e\u064a\u0634\u0646\u0647\u0627\u062f \u0646\u0645\u064a\u0643\u0646\u0645 \u0643\u0647 \u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u0627\u064a \u0628\u06af\u064a\u0631\u064a\u0646 \u0643\u0647 \u062e\u0631\u0627\u0628 \u0634\u0647 \u060c \u0648\u0644\u064a \u0628\u0647 \u0634\u062f\u062a \u0643\u0648\u0643\u0649 \u0634\u0643\u0644\u0627\u062a\u064a \u0628\u0627 \u0643\u0631\u0646 \u0628\u0631\u0649 \u067e\u064a\u0634\u0646\u0647\u0627\u062f \u0645\u064a\u0643\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0645\u06cc\u06a9\u0633 700 \u06af\u0631\u0645", "\u06a9\u0631\u0646\u0628\u0631\u06cc", "\u0641\u0646\u062f\u0642", "\u0634\u06a9\u0644\u0627\u062a", "\u0642\u0647\u0648\u0647", 1]}
{"text": ["\u0634\u06a9\u0644 \u06a9\u06cc\u06a9 \u0628\u0627 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a . \u0645\u062a\u0627\u0633\u0641\u0645", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0634\u0645\u0639 \u0634\u0643\u0633\u062a\u0647 \u0628\u0648\u062f \u0648 \u0634\u0645\u0639 \u0633\u0641\u0627\u0631\u0634\u064a \u0645\u063a\u0627\u064a\u0631\u062a \u062f\u0627\u0634\u062a . \n\u0633\u0627\u064a\u0632 \u0643\u064a\u0643 \u0645\u062a\u0648\u0633\u0637 \u0628\u0648\u062f \u0646\u0647 \u0628\u0632\u0631\u06af ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0632\u0631\u06af", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", "\u0634\u0645\u0639 \u0639\u062f\u062f 1", "\u0634\u0645\u0639 \u0639\u062f\u062f 9", -1]}
{"text": ["\u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u0647\u0645 \u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u062f\u0645\u062a \u06af\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u062a\u0631 \u0627\u0632 \u0686\u06cc\u0632\u06cc \u0628\u0648\u062f \u062a\u0648 \u0639\u06a9\u0633 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0642\u0628\u0644 \u0631\u0627 \u0646\u062f\u0627\u0634\u062a \n\u0645\u0627 \u0642\u0628\u0644\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u06cc\u0645 \u06a9\u0647 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u0648 \u06af\u0641\u062a\u0646 \u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a \u0648 \u0627\u06af\u0631 \u0627\u062c\u0627\u0632\u0647 \u0628\u062f\u06cc\u062f \u06cc\u0647 \u06a9\u06cc\u06a9 \u062f\u06cc\u06af\u0647 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u06a9\u0646\u06cc\u0645 \u0648\u0644\u06cc \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0631\u0648 \u0648\u0627\u0633\u0645\u0648\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u062a\u0641\u0645 \u0628\u0631\u0627\u064a \u0627\u0631\u0633\u0627\u0644 \n\u0634\u0628\u064a\u0647 \u062a\u0646\u0647\u0627 \u0686\u064a\u0632\u064a \u0643\u0647 \u0646\u0628\u0648\u062f \u0643\u064a\u0643 \u0628\u0648\u062f\n\u0628\u0627 \u0627\u064a\u0646 \u0647\u0632\u064a\u0646\u0647 \u0627\u064a \u0643\u0647 \u0628\u0631\u0627\u064a \u0627\u0631\u0633\u0627\u0644 \u0645\u064a\u06af\u064a\u0631\u064a\u0646 \n\u0628\u0627 \u0645\u0627\u0634\u064a\u0646 \u0647\u0645 \u0647\u0645\u064a\u0646 \u0642\u064a\u0645\u062a \u0628\u0631\u0627\u064a \u0627\u0631\u0633\u0627\u0644 \u0647\u0632\u064a\u0646\u0647 \u062f\u0627\u0634\u062a \n\u062d\u062f\u0627\u0642\u0644 \u0647\u0632\u064a\u0646\u0647 \u0631\u0627 \u0628\u064a\u0634\u062a\u0631 \u0643\u0646\u064a\u062f \u0643\u0647 \u0628\u0627 \u0645\u0648\u062a\u0648\u0631 \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062e\u0627\u0645\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0631\u0634 \u0628\u0648\u062f . \u0634\u064a\u0631\u064a\u0646\u064a \u0645\u0648\u0646\u062f\u0647 \u0627\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0647 \u0646\u0638\u0631\u0645 \u063a\u0631\u0642 \u062f\u0631 \u0634\u06cc\u0631\u0647 \u0634\u062f\u0647\u060c \u0646\u0647\u061f \u062f\u0648\u062a\u0627 \u062e\u0648\u0631\u062f\u0645 \u0633\u0631\u0645 \u062f\u0627\u0631\u0647 \u06af\u06cc\u062c \u0645\u06cc\u0631\u0647 :))))) ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u0645\u0639 happy birthday \u0634\u06a9\u0633\u062a\u0647 \u0648 \u0646\u0627\u0642\u0635 \u0628\u0648\u062f !!!!!!!! \u062f\u0648 \u062a\u0627 \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a !", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", "\u0628\u0627\u062f\u06a9\u0646\u06a9", "\u0634\u0645\u0639 \u0639\u062f\u062f", "\u0634\u0645\u0639 (Happy Birthday)", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u0698\u0644\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0645\u0646 \u0631\u0648\u0627\u0644 \u0628\u0627\u0630\u0627\u0645 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0631\u0648\u0644\u062a \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u06cc\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0628\u062f \u0628\u0648\u062f . \u0628\u0633\u062a\u0646\u06cc \u062f\u0648\u0631\u0634 \u06cc\u062e \u0632\u062f\u0647 \u0648 \u0648\u0633\u0637\u0634 \u0622\u0628 \u0634\u062f\u0647 \u0648 \u06a9\u06cc\u06a9 \u0628\u06cc \u0646\u0647\u0627\u06cc\u062a \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f .... \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u06cc\u0645 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0648\u06cc\u0648\u0631\u06a9\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0631\u0648 \u0627\u0639\u0645\u0627\u0644 \u06a9\u0631\u062f\u0646\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0627\u0632\u0634\u0648\u0646 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0647\u0631\u0643\u0633\u064a \u0643\u064a\u0643 \u0645\u064a\u062e\u0631\u0647 \u062d\u062a\u0645\u0627 \u0638\u0627\u0647\u0631\u0634 \u0628\u0631\u0627\u0634 \u0645\u0647\u0645\u0647\n\u0643\u064a\u0643\u064a \u0643\u0647 \u064a\u0643 \u062f\u064a\u0648\u0627\u0631\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0648 \u0647\u064a\u0686 \u0634\u0628\u0627\u0647\u062a\u064a \u0628\u0627 \u0639\u0643\u0633 \u0646\u062f\u0627\u0631\u0647 \u0648\u0627\u0642\u0639\u0627 \u0628\u0627\u064a\u062f \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0647\u061f\u061f\u061f\u061f\u061f\u061f\u061f\n\u0647\u0631\u06af\u0632 \u0627\u0632 \u0646\u0627\u062a\u0644\u064a \u062e\u0631\u064a\u062f \u0646\u0645\u064a\u0643\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc", "\u0634\u0645\u0639 \u0639\u062f\u062f\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u06cc\u0641\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0622\u0648\u0631\u062f\u0646\u062f \u062a\u0631\u06a9\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647 \u0648 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0631\u0648\u0634 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0645\u062e\u0635\u0648\u0635\u0627 \u0628\u0631\u0627\u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u0627\u06cc\u062f \u0628\u0634\u0647 \u0686\u0648\u0646 \u06a9\u06cc\u06a9 \u0628\u0627 \u06cc \u0636\u0631\u0628\u0647 \u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u06cc\u0627 \u0628\u0627 \u06cc \u062f\u0633\u062a \u0627\u0646\u062f\u0627\u0632 \u0631\u062f \u06a9\u0631\u062f\u0646 \u0627\u0632 \u0631\u0648\u06cc \u0638\u0631\u0641 \u062a\u06a9\u0648\u0646 \u0645\u06cc\u062e\u0648\u0631\u0647 \u0644\u0637\u0641\u0627 \u0627\u0632 \u0638\u0631\u0648\u0641 \u0628\u0647\u062a\u0631\u06cc \u0628\u0631\u0627\u06cc \u0646\u06af\u0647\u062f\u0627\u0631\u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0645\u0627\u0645 \u062e\u0627\u0645\u0647 \u0647\u0627 \u0648 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc\u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u067e\u0627\u06cc\u06cc\u0646 \u0648\u0627\u0642\u0639\u0627 \u0627\u0641\u062a\u0636\u0627\u062d\u0647 \u0627\u06cc\u0646\u062c\u0648\u0631 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u06f2\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0646 \u0627\u0631\u0632\u0634 \u0646\u062f\u0627\u0631\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u06cc\u06a9 \u067e\u0645 \u067e\u0645 \u0628\u0648\u062f \n \u0639\u06a9\u0633\u0634 \u0628\u0627 \u0627\u0648\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0622\u0648\u0631\u062f\u0646 \u0632\u0645\u06cc\u0646 \u062a\u0627 \u0622\u0633\u0645\u0627\u0646 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u0645\u0632\u0647 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u0628\u0627\u0642\u0644\u0648\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\n\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645. \u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0633\u0639\u06cc \u0645\u06cc\u06a9\u0646\u0645 \u062e\u0648\u0634\u0628\u06cc\u0646 \u0628\u0627\u0634\u0645. \u0648\u0644\u06cc \u0648\u0627\u0642\u0639\u0627 \u0648\u0642\u062a\u06cc \u062f\u0631\u0628 \u062c\u0639\u0628\u0647 \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u0645\u0648\u0646\u062f\u0645 \u0628\u062e\u0646\u062f\u0645 \u06cc\u0627 \u062a\u0639\u062c\u0628 \u06a9\u0646\u0645 \u06cc\u0627 ...\n\u0627\u0628\u0639\u0627\u062f \u062f\u0633\u0631\u0647\u0627 \u062e\u0646\u062f\u0647 \u062f\u0627\u0631\u0647!!! \u06cc\u0647 \u062f\u0633\u0631 86 \u06af\u0631\u0645\u06cc \u0627\u067e\u0631\u0627 (\u0648\u0632\u0646 \u06a9\u0631\u062f\u0645)\u060c \u0628\u0642\u06cc\u0647 \u0647\u0645 120 \u0648 130 \u06af\u0631\u0645\u06cc!!!. \u0642\u06cc\u0645\u062a \u0646\u0633\u0628\u062a \u0628\u0647 \u062d\u062c\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062a\u0627\u0633\u0641 \u0628\u0627\u0631\u0647. \u0645\u062a\u0627\u0633\u0641\u0645...", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u06a9\u0631\u0645 \u0641\u0646\u062f\u0642 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0627\u067e\u0631\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u060c \u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u062a\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0643\u064a\u0643 \u062f\u0628\u0644 \u0686\u0627\u0643\u0644\u062a\u064a \u0643\u0647 \u0627\u0635\u0644\u0627 \u0634\u0643\u0644\u0627\u062a \u0646\u062f\u0627\u0631\u0647. \u062e\u0627\u0645\u0647 \u0631\u0648\u0634 \u0646\u0633\u0643\u0627\u0641\u0647 \u0627\u064a \u0628\u0648\u062f \u0648 \u062f\u0627\u062e\u0644\u0634 \u0643\u064a\u0643 \u0645\u0639\u0645\u0648\u0644\u064a \u0628\u062f\u0648\u0646 \u06af\u0631\u062f\u0648 \u0648 \u064a\u0627 \u0645\u0648\u0632 \u0648 \u064a\u0627 \u0647\u064a\u0686 \u0686\u064a\u0632 \u062f\u064a\u06af\u0647 \u0627\u064a. \u0641\u0642\u0637 \u062a\u0646\u0647\u0627 \u062d\u0633\u0646\u0634 \u0627\u064a\u0646 \u0628\u0648\u062f \u0643\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0627\u0648\u0644 \u0627\u06cc\u0646 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u06af\u0630\u0627\u0634\u062a\u0646 \u0628\u0627 \u0627\u0648\u0646 \u0645\u062f\u0644\u0627\u06cc\u06cc \u06a9\u0647 \u062a\u0648 \u0639\u06a9\u0633 \u0628\u0648\u062f \u06a9\u0627\u0645\u0644\u0627 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \n\u0647\u0631\u0686\u06cc \u0686\u06cc\u0632\u0647 \u0645\u0639\u0645\u0648\u0644\u06cc \u0648 \u0633\u0627\u062f\u0647 \u0628\u0648\u062f \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\n\u0627\u0632 \u0647\u0645\u0647 \u0645\u0647\u0645 \u062a\u0631 \u0645\u0646 \u0628\u0639\u062f\u0647 \u0633\u0641\u0627\u0631\u0634\u0645 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0645 \u0648 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0645 \u0631\u0648\u06cc \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f\u0646 \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0648 \u06a9\u0627\u0645\u0644\u0627 \u062f\u0627\u063a\u0648\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0686\u0648\u0646 \u0628\u0627 \u06cc \u067e\u06cc\u06a9 \u0645\u0648\u062a\u0648\u0631\u06cc\u0647 \u0645\u0639\u0645\u0648\u0644\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u0645\u0646 \u0628\u062e\u0627\u0637\u0631\u0647 \u0686\u0647\u0627\u0631 \u062a\u0627 \u06a9\u0648\u0686\u0647 \u0641\u0627\u0635\u0644\u0647 \u06f3\u06f0\u06f0\u06f0\u062a\u0648\u0645\u0646 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0628\u0627 \u0627\u06cc\u0646 \u06a9\u0627\u0631 \u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0645 \u067e\u0634\u06cc\u0645\u0648\u0646 \u0634\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u0643\u0644 \u0638\u0627\u0647\u0631 \u0643\u064a\u0643 \u0643\u0627\u0645\u0644\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627\u064b \u0633\u0627\u0644\u0645\u060c\u062a\u0627\u0632\u0647 \u0648 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u062f\u0642\u06cc\u0642\u0627 \u0686\u06cc\u0632\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f\u2066\u2069", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0627\u06cc\u0646 \u062a\u0627\u0631\u062a \u0639\u0627\u0644\u06cc\u0647\n\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0646\u0648\u0646 \u062a\u0627\u0631\u062a \u062e\u06cc\u0644\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0644\u0628\u0647 \u0647\u0627\u06cc \u0622\u0646 \u062e\u0634\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", -1]}
{"text": ["\u0645\u0646 \u0643\u0627\u0645\u0644\u0627 \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645\n\u0628\u0628\u062e\u0634\u064a\u062f \u0627\u0634\u062a\u0628\u0627\u0647 \u0646\u0627\u0631\u0636\u0627\u064a\u062a\u064a \u0627\u0639\u0644\u0627\u0645 \u0643\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0631 \u0645\u0648\u0631\u062f \u0646\u0627\u0646 \u0633\u062d\u0631  \u0645\u0639\u0645\u0648\u0644\u0627 \u0645\u0648\u0627\u0631\u062f\u06cc \u062f\u0631 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u0648\u062c\u0648\u062f \u0627\u0633\u062a \u06a9\u0647 \u0628\u0639\u062f \u0645\u0639\u0644\u0648\u0645 \u0645\u06cc\u200c\u0634\u0648\u062f \u06a9\u0647 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0645\u062e\u0644\u0648\u0637 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0634\u06cc\u0631\u06cc", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u0628\u0632\u0631\u06af", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u0628\u0633\u062a\u0647)", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0648\u0627\u0646\u06cc\u0644\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062e\u0634\u06a9 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u062f\u0645\u0632\u0647 \u0628\u0648\u062f. \u0648\u0644\u06cc \u0627\u0632 \u0628\u0642\u06cc\u0647 \u0633\u0641\u0627\u0631\u0634 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", "\u0686\u0627\u067e\u0627\u062a\u0627 \u0632\u06cc\u062a\u0648\u0646\u06cc", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0645\u0631\u063a \u0627\u0633\u0641\u0646\u0627\u062c", 1]}
{"text": ["\u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06f8 \u0639\u062f\u062f \u0628\u0627\u0634\u0647 \u0646\u0647 \u06f6 \u062a\u0627 .\u0627\u06cc\u0646\u0627 \u06f6 \u062a\u0627\u0633\u062a .\u062e\u06cc\u0644\u06cc \u0647\u0645 \u06a9\u0648\u0686\u06cc\u06a9 \u0647\u0633\u062a\u0646 .\u0627\u0635\u0644\u0627 \u0646\u0645\u06cc\u062e\u0648\u0631\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0628\u0627\u0634\u0647.\u0627\u06af\u0631\u0645 \u0647\u0633\u062a \u0644\u0637\u0641\u0627 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u06f6 \u0639\u062f\u062f \u0647\u0633\u062a \u0646\u0647 \u06f8 \u0639\u062f\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0631\u06cc", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u062e\u0627\u0645\u0634 \u0627\u0632 \u062d\u062f \u0645\u0639\u0645\u0648\u0644 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0647\u0645 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0646\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (6-8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647\u060c\u0645\u062e\u0635\u0648\u0635\u0627 \u0631\u0648\u0644\u062a \u0647\u0627\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc", "\u062c\u0648 \u062e\u0634\u06a9 \u062a\u062e\u0645 \u06a9\u0646\u062c\u062f", "\u062c\u0648 \u062e\u0634\u06a9 \u0634\u0627\u0647\u062f\u0627\u0646\u0647", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc\u0627\u062a \u0648 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f \u0628\u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0628\u062f \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", -1]}
{"text": ["\u0628\u0627 \u0647\u0631 \u0628\u0627\u0631 \u0628\u0639\u062f \u0627\u0632 \u062b\u0628\u062a \u0633\u0641\u0627\u0631\u0634 \u062a\u0645\u0627\u0633 \u0645\u06cc\u06af\u0631\u06cc\u0646 \u0641\u0644\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u0647 \u062e\u0628 \u0627\u06af\u0647 \u0646\u062f\u0627\u0631\u06cc\u062f \u0686\u0631\u0627 \u062a\u0648 \u0633\u06cc\u0633\u062a\u0645 \u0646\u0645\u06cc\u0632\u0646\u06cc\u062f \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0686\u0646\u062f \u0628\u0627\u0631 \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0627\u0641\u062a\u0627\u062f\u0647 \u0648\u0627\u0642\u0639\u0627 \u0628\u0631\u0627\u062a\u0648\u0646 \u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (1 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0647\u0631 \u0686\u06cc \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc \u0628\u0644\u0627\u0641\u0627\u0635\u0644\u0647 \u0632\u0646\u06af \u0645\u06cc\u0632\u0646\u0646 \u0645\u06cc\u06af\u0646 \u0646\u0627\u0645\u0648\u062c\u0648\u062f\u0647 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0645\u06cc\u06a9\u0646\u0646 \u0628\u0627 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0622\u0644\u0645\u0627\u0646\u06cc \u0633\u0641\u06cc\u062f", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06af\u0627\u0631\u062f\u0646 \u0686\u06cc\u06a9\u0646", "\u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646+\u0632\u0645\u0627\u0646 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u062a\u062d\u0648\u06cc\u0644 \u0639\u0644\u06cc\u0631\u063a\u0645 \u0641\u0627\u0635\u0644\u0647 \u06cc \u062e\u06cc\u0644\u06cc \u0646\u0632\u062f\u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10-8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u06a9\u0648\u0686\u06cc\u06a9 \u0647\u0633\u062a. \u0628\u0647 \u0646\u0638\u0631\u0645 \u0628\u0627\u06cc\u062f \u0648\u0632\u0646\u0634 \u0631\u0648 \u062d\u062a\u0645\u0627 \u0642\u06cc\u062f \u06a9\u0646\u0646. \u0645\u0646 \u0628\u0631\u0627\u06cc \u0647\u062f\u06cc\u0647 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0648\u0627\u0642\u0639\u0627 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u0627\u064a \u0643\u0627\u0645\u0644\u0627 \u0645\u0639\u0645\u0648\u0644\u064a! \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0686\u064a\u0632 \u062f\u064a\u06af\u0647 \u0628\u0648\u062f \u0643\u0647 \u0627\u0633\u0646\u067e \u0627\u0637\u0644\u0627\u0639 \u062f\u0627\u062f \u062a\u0645\u0627\u0645 \u0643\u0631\u062f\u0646! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u067e\u062e\u0634 \u0648 \u067e\u0644\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0646\u0635\u0641 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627\u064b \u0627\u0632 \u0634\u06a9\u0644 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062e\u0648\u0634\u06af\u0644 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062f\u0644 \u0648 \u0646\u0645\u06cc \u0632\u062f \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0647\u0645\u0634 \u0634\u06a9\u0644\u0627\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062f\u0631 \u0627\u06cc\u0646 \u062f\u0648\u0628\u0627\u0631 \u0627\u062e\u06cc\u0631 \u06a9\u0647 \u0645\u0646 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u0648\u062a\u0644\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0647\u0631 \u062f\u0648 \u0633\u0631\u06cc \u0628\u0647 \u0634\u062f\u062f\u062f\u062f\u062f\u062a \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f\u0646\u060c \u062c\u0648\u0631\u06cc \u06a9\u0647 \u0627\u0646\u062f\u0627\u062e\u062a\u0645\u0634\u0648\u0646 \u062f\u0648\u0631!\n\u0644\u0637\u0641\u0627\u0627\u0627\u0627\u0627\u0627\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u0646... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u0643\u064a\u0643 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062e\u064a\u0644\u0649 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062f\u0648", "\u0634\u0645\u0639 \u067e\u0646\u062c", 1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646\u062f. \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u062a\u0646\u0647\u0627 \u0645\u0632\u0647 \u0627\u06cc\u06cc \u06a9\u0647 \u0646\u062f\u0627\u0634\u062a \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0648\u062e\u0627\u0645\u0647 \u0631\u0648\u0634 \u06a9\u0645\u06cc \u062a\u0631\u0634 \u0648 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u06cc\u0634\u06a9\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u06a9\u06cc\u06a9 \u0645\u0646 \u062f\u0648\u0631 \u062a\u0627 \u062f\u0648\u0631 \u0628\u062e\u0627\u0637\u0631 \u0628\u06cc \u062f\u0642\u062a\u06cc\u0647 \u067e\u06cc\u06a9 \u0634\u0645\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f\n\u0648 \u0645\u0646 \u0627\u0635\u0644\u0627 \u0627\u0632 \u0627\u0631\u0633\u0627\u0644\u062a\u0648\u0646 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645\n\u0634\u0645\u0627 \u0648\u0642\u062a\u06cc \u0627\u0646\u0642\u062f\u0631 \u062a\u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062f\u0627\u0631\u06cc\u062f \u0628\u0627\u06cc\u062f \u0628\u0647 \u0641\u06a9\u0631 \u0627\u0631\u0633\u0627\u0644 \u0627\u0645\u0646\u0634 \u0647\u0645 \u0628\u0627\u0634\u06cc\u062f\n\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0627\u0632 \u0628\u0647 \u0627\u0631\u0633\u0627\u0644 \u062f\u0631\u0633\u062a \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062f\u0627\u0631\u0647 \u062f\u0631 \u063a\u06cc\u0631 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u0631\u0648 \u062c\u0645\u0639 \u06a9\u0646\u06cc\u062f \u06cc\u0627 \u06a9\u06cc\u0641\u06cc\u062a\u062a\u0648\u0646\u0648 \u0628\u0627\u0644\u0627 \u0628\u0628\u0631\u06cc\u062f", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0637\u0639\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u06cc\u0644\u06cc \u0628\u062f \u0648 \u067e\u0627\u06cc\u06cc\u0646\n", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0648\u0642\u062a\u062a\u0648\u0646 \u0628\u062e\u06cc\u0631 \u060c \u062f\u0631 \u0645\u0648\u0631\u062f \u062d\u0645\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0635\u0648\u0635\u0627 \u0627\u06af\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u06cc\u0627 \u06a9\u06cc\u06a9 \u0628\u0627\u0634\u0647 \u0628\u0627\u06cc\u062f \u062a\u062c\u062f\u06cc\u062f \u0646\u0638\u0631 \u0628\u06a9\u0646\u06cc\u062f \u060c \u0648\u0627\u0642\u0639\u0627 \u062d\u0645\u0644 \u0627\u06cc\u0646 \u0645\u0648\u0627\u0631\u062f \u0631\u0648\u0634 \u062e\u0627\u0635 \u0648 \u0627\u0645\u06a9\u0627\u0646\u0627\u062a \u062e\u0627\u0635 \u0645\u06cc \u062e\u0648\u0627\u0647\u062f \u060c \u0627\u0645\u0631\u0648\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0646 \u06a9\u0644\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u0627\u0632 \u0634\u06a9\u0644 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f . \u0645\u06cc \u062f\u0648\u0646\u0645 \u0631\u0627\u0646\u0646\u062f\u0647 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u062a\u0644\u0627\u0634 \u062e\u0648\u062f\u0634 \u0631\u0648 \u06a9\u0631\u062f\u0647 \u0648\u0644\u06cc \u062e\u0648\u0628 \u062d\u0645\u0644 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0633\u062e\u062a\u0647 \u060c \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0627\u0633\u0646\u067e \u062f\u0631 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u062a\u0645\u0647\u06cc\u062f\u0627\u062a\u06cc \u0631\u0648 \u062f\u0631 \u0646\u0638\u0631 \u0628\u06af\u06cc\u0631\u0647 . \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0632\u06cc\u0631 \u06a9\u06cc\u06a9 \u062d\u0627\u0644\u062a \u06cc\u062e \u0632\u062f\u0647 \u062f\u0627\u0634\u062a \u0648 \u0633\u0641\u062a \u0628\u0648\u062f\n\u0628\u0627\u0641\u062a \u06a9\u06cc\u06a9 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0633 \u0628\u0648\u062f\n\u0627\u0646\u06af\u0627\u0631 \u06a9\u06cc\u06a9 \u0645\u0627\u0644 \u0631\u0648\u0632 \u06af\u0630\u0634\u062a\u0647 \u06cc\u0627 \u062f\u0648 \u0631\u0648\u0632 \u06af\u0630\u0634\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", 1]}
{"text": ["\u0628\u0631\u0627\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0631\u0648\u0634\u064a \u0645\u062b\u0644 \u0646\u064a\u0634\u0643\u0631 \u0632\u064a\u0628\u0646\u062f\u0647 \u0646\u064a\u0633\u062a \u0643\u0647 \u062c\u0646\u0633 \u0643\u0647\u0646\u0647 \u0648\u0646\u0648 \u0631\u0648 (\u0686\u064a\u0632 \u0643\u064a\u0643)\u0631\u0648 \u0628\u0631\u0627\u064a \u0645\u0634\u062a\u0631\u064a \u0627\u0631\u0633\u0627\u0644 \u0643\u0646\u0647.\u062a\u0639\u062f\u0627\u062f\u064a \u0627\u0632 \u0686\u064a\u0632\u0643\u064a\u0643\u0647\u0627 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0628 \u0648\u0628\u0642\u064a\u0647 \u0637\u0639\u0645 \u0645\u0648\u0646\u062f\u06af\u064a \u0645\u064a\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0662 \u062f\u0642\u064a\u0642\u0647 \u0646\u0634\u062f \u0631\u0633\u064a\u062f \u062f\u0633\u062a\u0645 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0628\u062f \u0645\u0632\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0648\u0642\u062a\u06cc \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u062f\u06cc\u062f\u0645\u200c\u06a9\u0647 \u06af\u0648\u0634\u0647 \u06a9\u06cc\u06a9 \u062e\u0631\u062f \u0634\u062f\u0647 \u0648 \u0631\u06cc\u062e\u062a\u0647 \u062f\u0627\u062e\u0644 \u0628\u0633\u062a\u0647 \u06a9\u06cc\u06a9 \u06a9\u0647 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645\u200c\u0645\u0634\u06a9\u0644 \u0627\u0632 \u0627\u0631\u0633\u0627\u0644\u0634 \u0628\u0648\u062f\u0647 \u06cc\u0627 \u062e\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0634\u06a9\u0631 \u0648\u0642\u062a\u06cc \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0645\u06cc\u0630\u0627\u0634\u062a\u0647 \u0628\u06cc \u062f\u0642\u062a\u06cc \u06a9\u0631\u062f\u0647 \u0648 \u0628\u0627\u0639\u062b \u0634\u062f\u0647 \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0628\u06cc \u0627\u0641\u062a\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0633\u0641\u06cc\u062f", -1]}
{"text": ["\u06f8\u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0628\u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u06cc\u062f..\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0631 \u062d\u0645\u0644 \u0648\u0646\u0642\u0644 \u0628\u0633\u062a\u0647 \u062f\u0642\u062a \u0634\u0648\u062f \u062a\u0645\u0627\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a 650 \u06af\u0631\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0627\u0641\u062a\u0636\u0627\u062d!!!!!!! \u0627\u06cc\u0646 \u0686\u06cc \u0628\u0648\u062f\u061f\u061f\u061f\u061f\u061f\u061f \u0648\u0627\u0642\u0639\u0627 \u0641\u06a9\u0631 \u06a9\u0631\u062f\u06cc\u062f \u0645\u06cc\u062a\u0648\u0646\u06cc\u062f \u0622\u0631\u062f \u062a\u0641\u062a \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0631\u0648 \u0628\u0647 \u0627\u0633\u0645 \u062d\u0644\u0648\u0627\u06cc \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc \u062a\u0628\u0631\u06cc\u0632 \u0628\u0641\u0631\u0648\u0634\u06cc\u062f \u0628\u0647 \u0645\u0631\u062f\u0645\u061f\u061f\u061f  \u0627\u0633\u0645\u0634 \u062d\u0644\u0648\u0627\u06cc \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631\u06cc\u063a \u0627\u0632 \u0630\u0631\u0647 \u0627\u06cc \u0632\u0646\u062c\u0628\u06cc\u0644 \u0627\u0635\u0644\u0627 \u0646\u0647 \u0639\u0637\u0631 \u0646\u0647 \u0637\u0639\u0645 \u0647\u06cc\u0686 \u0628\u0648\u06cc\u06cc \u0627\u0632 \u0632\u0646\u062c\u0628\u06cc\u0644 \u0628\u0647 \u0645\u0634\u0627\u0645 \u0646\u0645\u06cc \u0631\u0633\u06cc\u062f (\u062e\u0648\u062f\u0645\u0648\u0646 \u0631\u0648\u0634 \u067e\u0648\u062f\u0631 \u0632\u0646\u062c\u0628\u06cc\u0644 \u067e\u0627\u0634\u06cc\u062f\u06cc\u0645 \u062a\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0628\u0634\u0647!!!!) \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u062d\u0644\u0648\u0627\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0628\u0647\u200c\u0642\u062f\u0631\u06cc \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc \u062f\u0627\u0631\u0647 \u06a9\u0647 \u0632\u0628\u0648\u0646 \u0622\u062f\u0645 \u0631\u0648 \u0645\u06cc\u0633\u0648\u0632\u0648\u0646\u0647. \u062f\u0631 \u06cc\u06a9 \u06a9\u0644\u0627\u0645 \u0628\u062f \u062a\u0631\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062a\u062c\u0631\u0628\u0647 \u06a9\u0631\u062f\u0645 \u062e\u0648\u0627\u0647\u0634\u0627\u064b \u0627\u06af\u0631 \u062f\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0627\u0635\u0627\u0644\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062a\u0648\u0646 \u062a\u062c\u062f\u06cc\u062f \u0646\u0638\u0631 \u0646\u0645\u06cc \u06a9\u0646\u06cc\u062f \u062f\u0631 \u0646\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062a\u062c\u062f\u06cc\u062f \u0646\u0638\u0631 \u0628\u0641\u0631\u0645\u0627\u06cc\u06cc\u062f \u0686\u0648\u0646\u06a9\u0647 \u062d\u0644\u0648\u0627\u06cc\u06cc \u06a9\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u06cc\u062f \u06a9\u0648\u0686\u06a9\u062a\u0631\u06cc\u0646 \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0647 \u062d\u0644\u0648\u0627\u06cc \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u062f\u0627\u0634\u062a \u0641\u0642\u0637 \u0622\u0631\u062f \u062a\u0641\u062a \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0648\u06cc \u062e\u0627\u0645\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f\u06cc \u062f\u0627\u0634\u062a \u0648 \u062d\u062a\u06cc \u062f\u0648\u0646\u0647 \u0647\u0627\u06cc \u0634\u06a9\u0631 \u06cc\u0627 \u067e\u0648\u062f\u0631 \u0642\u0646\u062f \u0632\u06cc\u0631 \u062f\u0646\u062f\u0648\u0646 \u0628\u0647\u200c\u0637\u0648\u0631 \u0646\u0627\u062e\u0648\u0634\u0627\u06cc\u0646\u062f\u06cc \u062d\u0633 \u0645\u06cc\u200c\u0634\u062f. \u0646\u0647\u0627\u06cc\u062a\u0627 \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647  \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc  \u0645\u062b\u0644  \u0647\u0645\u0647 \u0642\u0646\u0627\u062f\u06cc \u0647\u0627  \u06a9\u06cc\u0641\u06cc\u062a \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644\u06cc \u062f\u0627\u0634\u062a  \u0648  \u067e\u06cc\u06a9 \u0647\u0645 \u0633\u0627\u0644\u0645 \u0631\u0633\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0633\u0641\u0627\u0631\u0634 \u0627\u0632 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0631\u0627 \u062a\u0648\u0635\u06cc\u0647 \u0646\u0645\u06cc\u06a9\u0646\u0645. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062d\u0644\u0648\u0627 \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f! \u062e\u06cc\u0644\u06cc \u0646\u0631\u0645 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647 \u0634 \u0633\u0628\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062a\u062e\u0645\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u0627\u0645\u0647 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0632\u0634\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u06cc\u0646  \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u06a9 \u062a\u0648\u0644\u062f \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u062e\u0648\u0627\u0647\u0634\u0645\u0646\u062f\u0645 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0644\u0627\u0632\u0645 \u0631\u0627 \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u0647\u06cc\u062f \u0627\u06af\u0631 \u0646\u0645\u06cc\u062a\u0648\u0627\u0646\u06cc\u062f \u06a9\u06cc\u06a9 \u0631\u0627 \u0633\u0627\u0644\u0645 \u0628\u062f\u0633\u062a \u06a9\u0633\u06cc \u0628\u0631\u0633\u0627\u0646\u06cc\u062f \u0644\u0637\u0641\u0627 \u0622\u0646\u0644\u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u0646\u06af\u06cc\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f- \u0627\u0632 \u0631\u0646\u06af \u0642\u0631\u0645\u0632 \u0631\u062f\u0648\u0644\u0648\u062a \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0642\u062f\u06cc\u0645\u06cc\u0647 \u0631\u0646\u06af\u0634 \u067e\u0631\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0632\u0647 \u06a9\u06cc\u06a9 \u0648 \u062e\u0627\u0645\u0634 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", -1]}
{"text": ["\u0648 \u0628\u0627\u0632 \u0647\u0645 \u0628\u0639\u062f \u0627\u0632 \u0627\u06cc\u0646\u0647\u0645\u0647 \u062a\u0627\u06a9\u06cc\u062f \u0628\u0631\u0627\u06cc \u062e\u0631\u0627\u0628 \u0646\u0634\u062f\u0646 \u06a9\u06cc\u06a9\u060c \u0628\u0627\u0632 \u06a9\u06cc\u06a9 \u0627\u0632 \u06cc\u06a9\u0637\u0631\u0641 \u06a9\u0627\u0645\u0644\u0627\" \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062c\u0639\u0628\u0647 \u0648 \u062a\u0645\u0627\u0645 \u062e\u0627\u0645\u0647 \u0647\u0627\u0634 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062c\u0639\u0628\u0647. \u062e\u0648\u0627\u0647\u0634\u0627\" \u0627\u06af\u0631 \u0631\u0627\u0647\u06a9\u0627\u0631\u06cc \u0628\u0631\u0627\u06cc \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f\u0646 \u0627\u06cc\u0646 \u0646\u0648\u0639 \u06a9\u06cc\u06a9 \u0646\u062f\u0627\u0631\u06cc\u062f \u0633\u0641\u0627\u0631\u0634 \u0622\u0646\u0644\u0627\u0646\u0634 \u0631\u0648 \u0628\u0631\u062f\u0627\u0631\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 \u0648\u0627\u0646\u06cc\u0644\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0632\u0634\u062a \u0628\u0648\u062f \u0648\u0644\u06cc \u0637\u0639\u0645 \u0622\u0646 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u062f\u0648 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0641\u0642\u0637 \u0627\u06cc \u06a9\u0627\u0634 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0628\u0639\u062f \u0627\u0632 \u0627\u06cc\u0646 \u06a9\u0647 \u062b\u0628\u062a \u0645\u06cc \u0634\u0647 \u0639\u0648\u0636 \u0646\u0645\u06cc \u06a9\u0631\u062f\u06cc\u0646. \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0628\u0639\u062f \u0628\u0647 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f \u0686\u0648\u0646 \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f. \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["Ba chizi k sefaresh dadam farq dasht\nVa monde bud", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0631 \u0647\u0646\u06af\u0627\u0645 \u062d\u0645\u0644 \u0622\u0633\u06cc\u0628 \u062f\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0627\u0646\u062f\u0627\u0632\u0647 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647\u200c\u062a\u06cc\u0647\u0627\u06cc \u062f\u0627\u062e\u0644 \u0633\u0628\u062f \u0686\u0631\u0627 \u0628\u0632\u0631\u06af \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f \u0646\u0645\u06cc\u062f\u0648\u0646\u0645.  \u0628\u06af\u060c\u062f\u0631\u0628 \u062c\u0639\u0628\u0647 \u062e\u0648\u0628 \u0686\u0633\u0628\u0627\u0646\u062f\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0686\u0633\u0628\u0647\u0627 \u06a9\u0646\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f.\u062f\u0631\u062d\u0645\u0644 \u062f\u0642\u062a \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0632 \u0633\u0628\u062f \u0628\u06cc\u0631\u0648\u0646 \u0631\u06cc\u062e\u062a\u0647 \u0633\u062f\u0647 \u0628\u0648\u062f\u060c\u0645\u0633\u06cc\u0631 \u0637\u0648\u0644\u0627\u0646\u06cc \u062a\u0631 \u0628\u0648\u062f \u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u0633\u0628\u062f \u06a9\u0644\u0627 \u0645\u06cc\u0634\u06a9\u0633\u062a .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0628\u062f \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f\u060c \u0646\u0635\u0641 \u0628\u0633\u062a\u0647 \u0628\u0627\u0642\u0644\u0648\u0627 \u0631\u0627 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0628\u0645 \u0628\u0631\u06cc\u0632\u06cc\u0645 \u062f\u0648\u0631. \u062e\u06cc\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a\u062a\u0648\u0646 \u0627\u0646\u0642\u062f\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f. \u0645\u0631\u062f\u0645 \u0628\u0631\u0627\u06cc \u067e\u0648\u0644 \u062f\u0631 \u0627\u0648\u0631\u062f\u0646 \u0632\u062d\u0645\u062a \u0645\u06cc\u06a9\u0634\u0646\u060c \u062d\u06cc\u0641 \u067e\u0648\u0644 \u06a9\u0647 \u0628\u0647 \u0647\u0645\u0686\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a\u06cc \u062f\u0627\u062f\u0647 \u0645\u06cc\u0634\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062d\u0645\u0644 \u06a9\u06cc\u06a9 \u0628\u0647 \u062e\u0648\u0628\u06cc \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0648 \u0686\u06cc\u062f\u0645\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0627\u0632 \u0637\u0631\u0641\u06cc \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u0634\u06a9\u0631\u06cc \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0628\u0627 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0643\u064a\u0643\u064a \u0643\u0647 \u0628\u0631\u0627\u064a \u0645\u0631\u0627\u0633\u0645 \u0628\u0648\u062f \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0631\u0633\u064a\u062f !\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0646\u062f\u0627\u0634\u062a \u0648 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u062f\u0648\u0645 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u0645 \u067e\u0634\u06cc\u0645\u0648\u0646 \u0634\u062f\u0645 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u0628\u0631\u0627\u06cc \u0645\u0646 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f!\n\u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0628\u0648\u062f\u0647 \u06cc\u0627 \u0627\u0632 \u0627\u0633\u0646\u067e ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0648\u0627\u0646\u06cc\u0644\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0631\u0648\u06cc \u0647\u0645\u062f\u06cc\u06af\u0631 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0645\u0646 \u0628\u0627\u0631\u0647\u0627 \u0647\u0645\u06cc\u0646 \u0645\u0648\u0631\u062f \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u062a\u0627 \u062d\u0627\u0644\u0627 \u0627\u06cc\u0646 \u0645\u0634\u06a9\u0644 \u067e\u06cc\u0634 \u0646\u06cc\u0648\u0645\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0639\u0633\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0647 \u062a\u0627\u0632\u06af\u06cc \u0648 \u0686\u06cc\u062f\u0645\u0627\u0646 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0646\u0628\u0648\u062f ", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u0647 \u0628\u0627\u0642\u0644\u0648\u0627 \u0628\u0647 \u0645\u0642\u062f\u0627\u0631 \u0632\u06cc\u0627\u062f\u06cc \u0627\u0632 \u0633\u06cc\u0646\u06cc \u0648 \u0633\u0644\u0641\u0648\u0646 \u0628\u06cc\u0631\u0648\u0646 \u0632\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0645\u0627\u0645 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0631\u0627 \u06a9\u062b\u06cc\u0641 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f.\n\u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u0637\u0644\u0648\u0628 \u0628\u0648\u062f.", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0634\u0642\u0627\u0628\u06cc", -1]}
{"text": ["ali boodesh", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0631\u06cc\u0646\u06af\u06cc", 1]}
{"text": ["\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.\u0646\u0627\u0646 \u0627\u0634 \u062e\u0634\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f:)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0646\u0627\u062a\u0644\u06cc \u0647\u0645\u0686\u06cc\u0646 \u062a\u0627\u0631\u062a\u06cc \u0628\u0639\u06cc\u062f \u0628\u0648\u062f\n\u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u062e\u0645\u06cc\u0631 \u0632\u06cc\u0631 \u062a\u0627\u0631\u062a \u0633\u0641\u062a \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u062a\u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u060c \u0628\u062e\u0635\u0648\u0635 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0628\u0627\u06cc\u062f \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u0634\u0647 \u062a\u0627 \u062f\u0631  \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0638\u0627\u0647\u0631\u06cc \u0632\u06cc\u0628\u0627 \u062a\u0631 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \n\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0632 \u0646\u0638\u0631 \u062a\u0627\u0632\u06af\u06cc \u0648 \u0637\u0639\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0646\u06af\u0627\u0631 \u0628\u0627 \u0628\u06cc\u0644 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u0646 \u062a\u0648 \u062c\u0639\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u06a9\u0645\u06cc \u0627\u0633\u0646\u067e \u062a\u0627\u062e\u06cc\u0631 \u062f\u0627\u0634\u062a \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f.\u062f\u0631 \u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645.\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0637\u0639\u0645 \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", -1]}
{"text": ["\u0627\u0648\u0646 \u0637\u0631\u062d\u06cc \u06a9 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0646\u0628\u0648\u062f \u0632\u0645\u06cc\u0646 \u062a\u0627 \u0627\u0633\u0645\u0648\u0646 \u0641\u0631\u0642 \u0645\u06cc\u06a9\u0631\u062f \u0686\u0647 \u0648\u0636\u0639\u0634\u0647 \u0627\u062e\u0647 \u0628\u0639\u062f\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9 \u0631\u0648\u0634 \u0628\u0648\u062f \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u06a9\u0646\u0627\u0631 \u062c\u0639\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0646\u06cc\u0645\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u0635\u0641 \u062f\u06cc\u06af\u0647 \u06a9\u0627\u0645\u0644\u0627 \u06a9\u0647\u0646\u0647 \u0648 \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0628\u0648\u062f  .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u064a \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0646\u0633\u0628\u062a\u0627 \u062a\u0627\u0632\u0647 \u0627\u0633\u062a\n\u062f\u0631 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u0645\u0642\u062f\u0627\u0631\u064a \u062a\u0643\u0648\u0646 \u062e\u0648\u0631\u062f\u0647 \u0648 \u064a\u0647 \u0645\u0642\u062f\u0627\u0631 \u0631\u0648\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u067e\u0648\u062f\u0631\u0647\u0627 \u0631\u064a\u062e\u062a\u0647 \u062a\u0648\u064a \u062c\u0639\u0628\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u06a9\u0647 \u0645\u0633\u06cc\u0631 \u062f\u0648\u0631\u06cc \u06a9\u0647 \u067e\u06cc\u06a9 \u0637\u06cc \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0633\u0627\u0644\u0645 \u0631\u0633\u0648\u0646\u062f \u062f\u0633\u062a\u0645\u0648\u0646 \u0648 \u062e\u06cc\u0644\u06cc \u0645\u0648\u062f\u0628 \u0648 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f\u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632\u062a\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647 . \u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0647\u067e\u06cc \u0628\u0631\u0633 \u062f\u06cc", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0647\u0645 \u0686\u0648\u0646 \u062f\u06cc\u06af\u0647 \u0627\u062e\u0631 \u0634\u0628 \u0628\u0648\u062f \u06cc\u06a9\u0645 \u0633\u0641\u062a \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645\u0648\u0646 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u06cc\u0645 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0646\u06af\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u06cc\u062e\u0686\u0627\u0644 \u0628\u0648\u062f \u06a9\u0647 \u0686\u0646\u062f \u0631\u0648\u0632 \u06af\u0630\u0634\u062a\u0647. \u0627\u0632 \u062e\u0631\u06cc\u062f\u0645\u0648\u0646 \u067e\u0634\u06cc\u0645\u0648\u0646 \u0634\u062f\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u062a\u062d\u0648\u06cc\u0644 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f. \u06a9\u06cc\u06a9 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0646\u0642\u0637\u0647 \u0642\u0648\u062a\u0634\u0647 .\u0628\u0647 \u0646\u0633\u0628\u062a \u0642\u06cc\u0645\u062a \u067e\u0627\u06cc\u06cc\u0646\u06cc \u06a9\u0647 \u062f\u0627\u0631\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f. \u0648\u0633\u0637 \u0644\u0627\u06cc\u0647 \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u063a\u06cc\u0631 \u062e\u0627\u0645\u0647 \u0646\u062f\u0627\u0634\u062a  \u0648\u0644\u06cc \u062e\u0628 \u0647\u0645\u0648\u0646\u0637\u0648\u0631 \u06a9\u0647 \u06af\u0641\u062a\u0645 \u0628\u0647 \u0646\u0633\u0628\u062a \u0642\u06cc\u0645\u062a\u0634\u0647 \u062e\u0628. \u062e\u0648\u062f \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0645\u062c\u06cc\u06a9", 1]}
{"text": ["\u06a9\u064a\u06a9 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u064a \u067e\u064a\u06a9 \u062e\u064a\u0644\u064a \u0639\u062c\u0644\u0647 \u062f\u0627\u0634\u062a \u06a9\u0647 \u0628\u0631\u0647 \u067e\u0631\u0648\u0627\u0632 \u06a9\u0647 \u0646\u0645\u064a\u062a\u0648\u0645 \u0628\u06a9\u0646\u0645 \u0628\u064a\u0627\u0645 \u0628\u06af\u064a\u0631\u0645 \u062f\u0648 \u062f\u0642\u064a\u0642\u0647 \u0635\u0628\u0631 \u06a9\u0646 \u062e\u0648\u0628 \u0628\u0631\u0627\u062f\u0631 \u0645\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0642\u0646\u0627\u062f\u064a \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648 \u0627\u0633\u0646\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \n\u0641\u0642\u0637 \u06a9\u0627\u0634 \u0632\u0648\u062f \u0628\u0647 \u0632\u0648\u062f \u0631\u0648\u063a\u0646 \u0631\u0648 \u0639\u0648\u0636 \u06a9\u0646\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u067e\u06cc\u062a\u0632\u0627\u0634 \u0645\u06cc\u0646\u06cc \u0647\u0645 \u0646\u06cc\u0633\u062a \u0644\u0642\u0645\u0647 \u0627\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u067e\u06cc\u062a\u0632\u0627 (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", 1]}
{"text": ["\u0627\u0648\u0644\u0627 \u0634\u0634 \u062a\u06a9\u0647 \u0628\u0648\u062f \u0646\u0647 \u0647\u0634\u062a\u0627\n\u0648\u0644\u06cc \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0647 \u062f\u0644\u06cc\u0644 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0633\u0641\u0627\u0631\u0634\n\u062a\u0645\u0627\u0645\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0631\u0627\u0628 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u06af\u0631\u0645 \u0631\u0633\u06cc\u062f...\u062a\u0634\u06a9\u0631 \u0641\u0631\u0627\u0648\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u067e\u0627\u06cc \u0633\u06cc\u0628 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 6 \u0639\u062f\u062f)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06f5 \u062a\u06a9\u0647 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u06a9\u0644 \u0644\u0627\u06cc\u0647 \u06cc \u0631\u0648\u06cc\u06cc \u0631\u0648 \u0646\u062f\u0627\u0634\u062a \u0645\u0627 \u0628\u0642\u06cc \u0647\u0645 \u062c\u062f\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0627\u0635\u0644\u0627. \u062e\u0627\u0645\u0647 \u062f\u0627\u062e\u0644\u0634 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0637\u0645\u0639 \u0628\u0648\u062f. \u0627\u0635\u0644\u0627 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u062f\u0627\u0634\u0645 \u0647\u0645\u0686\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u062a\u062d\u0648\u06cc\u0644 \u0628\u06af\u06cc\u0631\u0645 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u0628\u0631\u06cc\u0632\u0645 \u062f\u0648\u0631 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10-8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u060c \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0645\u0639 \u0628\u0648\u062f \u0648 \u062f\u0631 \u0632\u0645\u0627\u0646 \u06a9\u0645 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.  \u0633\u067e\u0627\u0633 \u0648 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 24 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0627\u0635\u0644\u0627 \u0645\u0632\u0647 \u0646\u062f\u0627\u0631\u0647\u060c \u062d\u062a\u06cc \u06cc\u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646\u0645 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (1 \u0639\u062f\u062f)", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u067e\u0627\u064a \u0627\u0644\u0628\u0627\u0644\u0648 \u0627\u0635\u0644\u0627 \u0645\u0646\u0627\u0633\u0628 \u0664 \u0646\u0641\u0631 \u0646\u0628\u0648\u062f \u062e\u064a\u0644\u064a \u0643\u0648\u0686\u064a\u0643 \u062a\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0632\u0645\u0627\u0646 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0641\u0642\u0637 \u0648\u0642\u062a\u06cc \u0647\u0645\u0686\u06cc\u0646 \u06a9\u06cc\u06a9\u06cc \u062d\u0645\u0644 \u0645\u06cc\u0634\u0647 \u0628\u0627\u06cc\u062f \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u062f\u0631 \u062d\u0645\u0644 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0634\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648  \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0631\u0627\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc \u062f\u0641\u0639\u0647 \u06cc \u0642\u0628\u0644\u06cc \u06a9 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u06cc\u0646 \u0633\u0631\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0648\u0646\u0642\u062f\u0631 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f.\u067e\u0648\u062f\u06cc\u0646\u06af \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0628\u0647 \u062c\u0627\u06cc \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc\u060c \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u0627\u0645\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0647\u0645\u0647 \u0649 \u0645\u0648\u0627\u0631\u062f \u0639\u0627\u0644\u0649 \u0628\u0648\u062f \u063a\u064a\u0631 \u0627\u0632 \u0643\u0648\u0643\u0649 \u0647\u0627 \u0643\u0647 \u0642\u0628\u0644\u0627\u064b \u0628\u0647\u062a\u0631 \u0628\u0648\u062f.\n\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u0648 \u06af\u064a\u0644\u0627\u0633 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f\n\u0643\u064a\u0643 \u0648 \u0633\u064a\u0628 \u0631 \u0643\u0627\u0631\u0627\u0645\u0644 \u0647\u0645 \u0647\u0645\u064a\u0646\u0637\u0648\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u062e\u0628 \u0627\u0648\u0644 \u0628\u06af\u0645 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \n\u062f\u0648\u0645 \u0628\u06af\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\n\u0633\u0627\u06cc\u0632\u0634 \u0627\u0646\u062f\u0627\u0632\u0647 \u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9\n\u0642\u06cc\u0645\u062a\u0634 \u0627\u0644\u06a9\u06cc \u06af\u0631\u0648\u0646\n\u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u0646\u0647 \u0631\u0627\u0636\u06cc\u0645 \u0646\u0647 \u0646\u0627\u0631\u0627\u0636\u06cc \u0627\u0644\u0628\u062a\u0647 \u0627\u06af\u0631 \u062a\u062e\u0641\u06cc\u0641 \u0627\u0633\u0646\u067e \u0646\u062f\u0627\u0634\u062a\u0645 \u0642\u0637\u0639\u0627 \u0646\u0645\u06cc\u06af\u0631\u0641\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc\u062a\u0648\u0646 \u0631\u0627\u0636\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \n\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648 \u062a\u06a9\u0647 \u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u0632\u06cc\u0631 \u0645\u0648\u0633 \u0642\u0631\u0627\u0631 \u062f\u0627\u0634\u062a \u062a\u0644\u062e \u0628\u0648\u062f \u06a9\u0644\u0627 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", -1]}
{"text": ["\u0639\u06a9\u0633 \u0648 \u0642\u06cc\u0645\u062a \u0628\u0647 \u06af\u0648\u0646\u0647 \u0627\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062f\u0631 \u0633\u0627\u06cc\u0632 \u062f\u0686\u0627\u0631 \u0627\u0634\u062a\u0628\u0627\u0647 \u0634\u062f\u06cc\u0645 \u0648 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u062a\u0631 \u0627\u0632 \u062d\u062f \u062a\u0635\u0648\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0645\u0632\u0647 \u0631\u0648\u0644\u062a \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0631\u0648\u0644\u062a \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u0632\u06cc\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \n\u0627\u0645\u0627 \u0634\u0645\u0639 \u0633\u06cc\u0628\u06cc\u0644 \u0646\u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0686\u0648\u0646 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0634\u062a\u0646 \n\u0628\u0647 \u062c\u0627\u0634 \u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u06a9\u0647 \u06f5\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0646\u0647 \n\u0645\u0645\u0646\u0648\u0646 \u0645\u06cc\u0634\u0645 \u0645\u0627\u0628\u0647 \u0627\u0644\u062a\u0641\u0627\u0648\u062a\u0634\u0648 \u0628\u0647 \u062d\u0633\u0627\u0628\u0645 \u0628\u0631\u06af\u0631\u062f\u0648\u0646\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 \u0633\u06cc\u0628\u06cc\u0644", -1]}
{"text": ["\u0639\u0627\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u06cc \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc", "\u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0637\u0648\u0631\u06cc \u06a9\u0647 \u0627\u0646\u06af\u0627\u0631 \u0622\u0628 \u0634\u062f\u0647  \u067e\u06cc\u06a9 \u0645\u0648\u062a\u0648\u0631\u06cc \u0645\u06cc\u06af\u0641\u062a \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0628\u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646 \u0648", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0647\u062a\u0631\u064a\u0646\u0647\u0647\u0647\u0647\u0647\u0647\u0647 \u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u064a\u0634\u0643\u0631 \u0639\u0632\u064a\u0632 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0641\u0648\u062a\u0648\u0622 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c 650 \u06af\u0631\u0645", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f.\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0647\u0645 \u0628\u0627 \u0633\u0627\u062f\u0647 \u0641\u0631\u0642\u06cc \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u062a\u0628\u0631\u06cc\u0632\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u0628\u0633\u062a\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u062c\u0627\u06cc \u0646\u0648\u0646\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0633\u062a\u0646\u06cc \u0633\u0646\u062a\u06cc \u0646\u0648\u0646\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0648\u06cc \u0633\u06cc\u0646\u06cc \u062f\u0645\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0627\u0645\u06a9\u0627\u0646 \u0628\u0631\u062f\u0627\u0634\u062a\u0646 \u0648\u062c\u0648\u062f\u0634 \u0646\u062f\u0627\u0634\u062a. \u062a\u0639\u062f\u0627\u062f \u0631\u0648 12 \u0639\u062f\u062f\u0630\u06a9\u0631 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0627\u0645\u0627 \u0628\u0631\u0627\u06cc \u0645\u0646 5 \u062a\u0627 \u0622\u0648\u0631\u062f\u0646 \u0648 \u0627\u0646\u062f\u0627\u0632\u0634 \u062e\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af\u062a\u0631 \u0627\u0632 \u0627\u0648\u0646\u06cc \u0628\u0648\u062f \u06a9 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645. \u0622\u0628\u0631\u0648 \u0631\u06cc\u0632\u06cc \u0634\u062f \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0627\u0646 \u0647\u0627\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0645\u062e\u0644\u0648\u0637 \u0645\u0648\u0633 650 \u06af\u0631\u0645", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f .\u0628\u0647 \u062e\u0627\u0637\u0631 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0627\u062f\u0631\u0633\u062a \u0627\u0632 \u0645\u0648\u0627\u062f \u0628\u0627\u0639\u062b \u0634\u062f\u0647 \u0637\u06cc \u0645\u0633\u06cc\u0631 \u06a9\u06cc\u06a9 \u0628\u0647 \u0634\u062f\u062a \u0648\u0627 \u0628\u0631\u0647 \u0648 \u0646\u0635\u0641\u0634 \u062f\u0627\u063a\u0648\u0646 \u0628\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u06cc\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647\n\u0641\u0642\u0637 \u06cc\u0647 \u06a9\u0645 \u062d\u0645\u0644\u0634 \u0645\u0634\u06a9\u0644 \u062f\u0627\u0634\u062a\u0647 \u06a9 \u06f3-\u06f4\u062a\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u06cc\u062f \u0628\u0627\u0698\u0644 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0643\u064a\u0643 \u0647\u0627 \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u064a \u0627\u0635\u0644 \u062a\u0628\u0631\u064a\u0632 \u062e\u064a\u0644\u064a \u062e\u0648\u0628\u0647 \u0648\u0644\u064a \u067e\u064a\u0643 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0627\u0648\u0631\u062f \u0648 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u0648 \u062c\u0639\u0628\u0647 \u0643\u062c \u0634\u062f\u0647 \u0628\u0648\u062f\u060c\u0645\u0646 \u0627\u0645\u062a\u064a\u0627\u0632 \u0643\u0645 \u0628\u0647 \u067e\u064a\u0643 \u0627\u0633\u0646\u067e \u0645\u064a\u062f\u0645 \u0648\u0644\u064a \u0643\u064a\u0641\u064a\u062a \u0643\u064a\u0643 \u0648 \u0637\u0639\u0645\u0634 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0641\u0642\u0637 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062e\u0627\u0645\u0647 \u0647\u0627\u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u06a9\u0627\u0645\u0644\u0627 \u06a9\u0646\u0627\u0631\u0634 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u060c \u0645\u0646 \u0627\u0632\u06cc\u0646 \u0628\u0647 \u0628\u0639\u062f \u0641\u0642\u0637 \u0627\u0632 \u0634\u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06cc \u062e\u0631\u0645 \u060c \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0627\u062a\u0648\u0646 \u060c \u062e\u062f\u0627 \u0628\u0647 \u067e\u0648\u0644\u062a\u0648\u0646 \u0628\u0631\u06a9\u062a \u0628\u062f\u0647 \u060c \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u062a\u062e\u0641\u06cc\u0641\u0627\u062a\u0648\u0646 \u0648 \u062a\u062e\u0641\u06cc\u0641 \u0631\u0648\u0632 \u0632\u0646 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0627 \u0628\u0647 \u0634\u062f\u062a \u0628\u0647 \u0635\u0631\u0641\u0647 \u0634\u062f \u0642\u06cc\u0645\u062a\u0634 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u0646\u06cc\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f... \u06cc\u0627 \u0634\u0627\u0646\u0633 \u0645\u0646 \u0628\u0648\u062f\u0647 \u0686\u0648\u0646 10 \u0635\u0628\u062d \u062e\u0631\u06cc\u062f\u0645 \u06cc\u0627 \u0647\u0645\u06cc\u0634\u0647 \u0627\u06cc\u0646\u0637\u0648\u0631\u06cc\u0647... \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \n\n\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0648 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u0628\u0631\u062e\u0648\u0631\u062f\u0627\u0631 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u06a9 \u0646\u0641\u0631\u0647", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc \u0627\u0632 \u0634\u0645\u0627", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0642\u062a\u06cc \u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u062b\u0628\u062a \u06a9\u0631\u062f\u0645 \u0648 \u0645\u06cc\u0628\u06cc\u0646\u0646 \u0646\u062f\u0627\u0631\u0646 \u0632\u0646\u06af \u0628\u0632\u0646\u0646 \u0628\u06af\u0646 \u0646\u062f\u0627\u0631\u06cc\u0645\u060c \u0648\u0627\u0633\u0647 \u062e\u0648\u062f\u0634\u0648\u0646 \u0647\u0631\u0686\u06cc \u062f\u0648\u0633 \u062f\u0627\u0631\u0646 \u0627\u0631\u0633\u0627\u0644 \u0646\u06a9\u0646\u0646. \u0636\u0645\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc  \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0641\u062a \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0633\u0631\u064a\u0639 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0648 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u064a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0641\u0646\u062f\u0642\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0634\u06a9\u0644\u0627\u062a \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647\u060c \u062a\u0631\u062f \u0648 \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f. \u0628\u06cc \u0646\u0647\u0627\u06cc\u062a \u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0634\u06a9\u0644\u0627\u062a \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u062a\u0627\u0628\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f. \u0646\u0628\u0627\u06cc\u062f \u063a\u06cc\u0631\u062d\u0636\u0648\u0631\u06cc \u062e\u0631\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u064a\u064a\u064a\u064a\u064a \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u060c \u0637\u0639\u0645 \u0643\u064a\u0643 \u0648 \u0633\u0631\u0639\u062a \u0627\u0631\u0633\u0627\u0644 \u0639\u0627\u0644\u064a \u0628\u0648\u062f.\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0643\u064a\u0643 \u062f\u0631 \u0633\u0631\u064a\u0639 \u062a\u0631\u064a\u0646 \u0632\u0645\u0627\u0646 \u0648 \u0643\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0648 \u0627\u0632 \u0637\u0639\u0645\u0634 \u0647\u0645 \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u064a\u0645. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648 \u0627\u0633\u0646\u067e \u0628\u0627\u0643\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0639\u062f\u062f 1", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\u0628\u06cc\u0634 \u0627\u0632 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u0648 \u0646\u0627\u0646 \u062a\u0627\u0631\u062a \u062a\u0631\u062f \u0646\u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647.\u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0627\u0646\u062a\u0638\u0627\u0631\u0645 \u0628\u06cc\u0634 \u0627\u0632\u06cc\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0637\u0648\u0631\u06cc \u06a9\u0647 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f\n\u062c\u0627\u06cc \u0645\u0639\u0630\u0631\u062a \u062e\u0648\u0627\u0647\u06cc \u062e\u0648\u0627\u0647\u0634\u0627\u064b \u06a9\u0627\u0631\u062a\u0648\u0646 \u0631\u0648 \u062f\u0631\u0633\u062a \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u06cc\u0646\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0647\u067e\u06cc \u0628\u0631\u0633 \u062f\u06cc", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647. \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0639\u0632\u06cc\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.\n\u0648\u0644\u06cc \u0633\u0631\u0639\u062a \u062b\u0628\u062a \u0648 \u0627\u0631\u0633\u0627\u0644 \u0633\u0641\u0627\u0631\u0634 \u0628\u0627\u0644\u0627 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0644\u0637\u06cc\u0641\u0647 \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f . \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0628\u0639\u06cc\u062f \u0628\u0648\u062f \u0627\u06cc\u0646\u0642\u062f\u0631 \u0645\u0648\u0646\u062f\u06af\u06cc \u0627\u06cc\u0646 \u0645\u062d\u0635\u0648\u0644", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u0648\u0634\u062a \u0648 \u0642\u0627\u0631\u0686", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0633\u0631\u062f \u0628\u0648\u062f \u0627\u06af\u0647 \u062f\u0627\u063a \u0628\u0648\u062f \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0647\u0645 \u0639\u0627\u0644\u06cc :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0628\u062f\u062a\u0631\u06cc\u0646 \u0628\u0627\u0642\u0644\u0648\u0627\u06cc\u06cc \u06a9\u0647 \u062a\u0627\u0628\u062d\u0627\u0644 \u062e\u0648\u0631\u062f\u0645... \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0646\u0648\u0639 \u0641\u0642\u0637 \u062f\u0648 \u0645\u062f\u0644!\n\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u0641\u06cc\u0628\u0631\u06a9\u0633 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f...\n\u0628\u0627\u0631 \u0622\u062e\u0631\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0627\u0632 \u0634\u0639\u0628\u0647 \u0634\u0647\u0631\u06a9 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u062e\u0635\u0648\u0635 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u0641\u06cc\u0628\u0631\u06a9\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062c\u0648 100% \u0644\u0642\u0645\u0647", -1]}
{"text": ["\u0627\u06af\u0647 \u0647\u0645\u0647 \u06cc \u0633\u0641\u0627\u0631\u0634\u0627 \u0631\u0648 \u0645\u0648\u062c\u0648\u062f \u0628\u0627\u0634\u0647 \u062c\u062f\u0627 \u0628\u0627\u06cc\u062f \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u062a\u0639\u062c\u0628 \u06a9\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0648\u06a9\u0648 \u0633\u0628\u0632\u06cc", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0634\u06cc\u0631\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u0631\u063a \u0648 \u0642\u0627\u0631\u0686", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0627\u0644\u0648\u06cc\u0647", -1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc \u0628\u062f \u0648 \u0634\u06a9\u0644\u0627\u062a\u0634 \u062e\u06cc\u0644\u06cc\u06cc\u06cc \u06a9\u0645 \u0628\u0648\u062f\n\u0646\u0627\u0646 \u0686\u0627\u0648\u062f\u0627\u0631\u0645 \u0628\u0632\u0631\u06af \u0628\u0648\u062f\u060c\u0645\u0646 \u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (1 \u0639\u062f\u062f)", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648\u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u0628\u0632\u0631\u06af", "\u0645\u0627\u062f\u0644\u0646 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u0627\u062f\u0644\u0646 \u06a9\u0631\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 23 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0642\u06cc\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u062f\u0648\u0646\u0627\u062a \u0628\u06cc\u0646\u0638\u06cc\u0631 \u0628\u0648\u062f!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u062c\u0648 \u062e\u0634\u06a9 \u0634\u0627\u0647\u062f\u0627\u0646\u0647", 1]}
{"text": ["\u062a\u0639\u062f\u0627\u062f \u0627\u0639\u0644\u0627\u0645\u06cc \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0633\u062a \u0648 \u06f2\u06f2 \u0639\u062f\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 30 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\u0645\u0646 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0627\u0632 \u0643\u064a\u0641\u064a\u062a \u0645\u062d\u062a\u0648\u0627\u064a \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u062f\u0645 \u0627\u0632 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0648 \u0631\u0633\u064a\u062f\u0646\u0634 \u0631\u0627\u0636\u064a \u0627\u0645 \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0633\u0641\u0627\u0631\u0633 \u0645\u0637\u0627\u0628\u0642 \u0627\u0648\u0646\u0686\u0647 \u0627\u0646\u062c\u0627\u0645 \u062f\u0627\u062f\u0645 \u0646\u0631\u0633\u064a\u062f\n\u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0631\u0647 \u0627\u064a \u0662 \u0628\u0648\u062f \u0648 \u064a\u0643 \u0643\u064a\u0643 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647 \u0648 \u0666\u0669 \u062a\u0648\u0645\u0627\u0646 \u0647\u0645 \u0627\u0632 \u062d\u0633\u0627\u0628\u0645 \u0643\u0633\u0631 \u0634\u062f \u0627\u0645\u0627 \u0633\u0641\u0627\u0631\u0634\u064a \u0643\u0647 \u0628\u0647\u0645 \u0631\u0633\u064a\u062f \u0643\u064a\u0643 \u0635\u0628\u062d\u0627\u0646\u0647 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a \u0648 \u0641\u0642\u0637 \u0645\u0628\u0644\u063a \u0665\u0666 \u062a\u0648\u0645\u0646 \u062f\u0631 \u0641\u064a\u0634 \u062f\u0631\u062c \u0634\u062f\u0647 \u0628\u0648\u062f\n\u0645\u0645\u0646\u0648\u0646 \u0645\u064a\u0634\u0645 \u067e\u064a\u06af\u064a\u0631\u064a \u0643\u0646\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", 1]}
{"text": ["\u062a\u0627 \u062d\u0627\u0644\u0627 \u0628\u0627 \u0627\u06cc\u0646 \u0645\u062d\u0635\u0648\u0644 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0622\u0634\u0646\u0627 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f\u0645\n\n\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062f\u0631 \u0633\u0627\u06cc\u0632 \u0645\u0646\u0627\u0633\u0628 \u062a\u0647\u06cc\u0647 \u0634\u062f\u0647 \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0643\u064a\u0643 \u062f\u0627\u062e\u0644 \u0686\u064a\u0632\u0643\u064a\u0643 \u064a\u062e\u0648\u0631\u062f\u0647 \u062e\u0645\u064a\u0631 \u0628\u0648\u062f \u0648 \u0645\u0632\u0647 \u062e\u0648\u0628\u064a \u0647\u0645 \u0646\u062f\u0627\u0634\u062a \u0648\u0644\u064a \u062f\u0631 \u0643\u0644 \u0628\u0627\u0632 \u0647\u0645 \u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u062f\u0631 \u0622\u06cc\u0646\u062f\u0647 \u0628\u0627\u0632 \u0647\u0645 \u0645\u06cc\u062e\u0631\u0645 \u0627\u0632\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062f\u0631 \u0639\u06a9\u0633 \u0627\u063a\u0631\u0627\u0642 \u0622\u0645\u06cc\u0632 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0632\u0631\u06af\u062a\u0631 \u0627\u0632 \u0648\u0627\u0642\u0639\u06cc\u062a \u0646\u0645\u0627\u06cc\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0648 \u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u0646\u0645\u06cc \u0627\u0631\u0632\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0648\u0642\u062a\u064a \u0628\u0633\u062a\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u064a\u062f \u0647\u0645\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0648 \u0631\u064a\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u060c\u0627\u0635\u0644\u0627 \u062f\u0631\u0633\u062a \u062d\u0645\u0644 \u0646\u0642\u0644 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u060c\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062e\u0648\u0634\u06af\u0644 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062c\u0639\u0628\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0627\u0645\u0644\u0627 \u062e\u064a\u0633 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u064a\u062f \u0648 \u0628\u062f\u0648\u0646 \u067e\u0627\u0643\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0642\u064a\u0645\u062a\u0634 \u0643\u0645\u064a \u0628\u0627\u0644\u0627 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0648\u0627\u0698\u06af\u0648\u0646 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u062f\u0627\u0646\u0645\u0627\u0631\u0643\u064a \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0642\u062a\u064a \u0645\u062d\u0635\u0648\u0644\u0634\u0648\u0646 \u062a\u0627\u0632\u0647 \u0646\u064a\u0633\u062a \u0646\u0628\u0627\u064a\u062f \u0633\u0641\u0627\u0631\u0634 \u0628\u06af\u064a\u0631\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0628\u0631\u06af\u0634\u062a\u0647 \u0648 \u0627\u0635\u0644\u0627 \u062f\u06cc\u06af\u0647 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u06cc\u0633\u062a ", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u06a9\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u062a\u0645\u0627\u0645\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646\u060c \u062d\u062a\u06cc \u0631\u0646\u06af \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0643\u064a\u0643 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0634\u0643\u0644\u064a \u0643\u0647 \u062f\u0631 \u0639\u0643\u0633 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0634\u0628\u064a\u0647 \u0628\u0647 \u0643\u064a\u0643 \u0627\u0631\u0633\u0627\u0644\u064a \u0646\u0628\u0648\u062f\n\u0634\u0645\u0639 \u0647\u0645 \u0627\u0635\u0644\u0627 \u0646\u062a\u0648\u0646\u0633\u062a\u064a\u0645 \u0631\u0648\u0634\u0646 \u0643\u0646\u064a\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0633\u06cc\u0628\u06cc\u0644", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u0627\u0645\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0648 \u062f\u0631 \u0632\u0645\u0627\u0646 \u06a9\u0645\u06cc \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", 1]}
{"text": ["\u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u062d\u062c\u0645 \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u062e\u064a\u0644\u064a \u0632\u064a\u0627\u062f \u0628\u0648\u062f \u0648 \u062d\u062f\u0648\u062f \u0666 \u062a\u0627 \u062c\u0639\u0628\u0647 \u0628\u0648\u062f \u0648\u0644\u064a \u0647\u0645\u06af\u064a \u0628\u0633\u064a\u0627\u0631 \u0644\u0630\u064a\u0630 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u067e\u064a\u0643 \u0647\u0645 \u0645\u0631\u062a\u0628 \u062a\u062d\u0648\u064a\u0644 \u0645\u0627 \u062f\u0627\u062f\u0646\u062f\n\u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u064a\u0634\u0643\u0631 \u0648 \u0627\u0633\u0646\u067e \u0645\u0645\u0646\u0648\u0646\u064a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1.400 \u06af\u0631\u0645\u06cc (20 \u062a\u0627 25 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0637\u0639\u0645\u0634\u0648\u0646 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f  \u0641\u0642\u0637 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u064a\u0634 \u0634\u064a\u0631\u064a\u0646\u064a\u0634 \u0632\u064a\u0627\u062f \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0647 \u0647\u062f\u0641 \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u0628\u0627 \u06a9\u06cc\u06a9 \u0627\u0646\u062a\u062e\u0627\u0628\u06cc \u0645\u063a\u0627\u06cc\u0631\u062a \u062f\u0627\u0634\u062a \n\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0635\u0644\u0627 \u062f\u0631 \u062d\u062f \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u06a9\u06cc\u06a9 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u062f\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f. \u062a\u0645\u0627\u0645 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0647\u0627 \u06a9\u0641 \u062c\u0639\u0628\u0647 \u0628\u0648\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 \u062e\u0627\u06a9 \u0642\u0646\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 2 \u0639\u062f\u062f)", -1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0627\u0633\u0646\u067e \u0648\u0627\u0642\u0639\u0627 \u0628\u0627\u0644\u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0646\u062c\u0631\u0647 \u0627\u06cc \u06af\u0644 (\u06a9\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0628\u06cc \u0646\u0638\u06cc\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0627 \u062e\u0627\u06a9 \u0642\u0646\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0627 \u062e\u0627\u06a9 \u0642\u0646\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u06cc\u062e \u0632\u062f\u0647 \u0628\u0648\u062f... \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u062a\u0628\u0631\u06cc\u0632\u06cc \u0627\u06cc\u0646 \u0645\u0633\u0626\u0644\u0647 \u0628\u0639\u06cc\u062f \u0628\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0627\u0632 \u062e\u0631\u06cc\u062f\u0645 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u06cc\u0633\u062a\u0645. \u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0634\u0645\u0627 \u0627\u0635\u0644\u0627 \u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0633\u062a \u06cc\u0647 \u06a9\u06cc\u06a9 \u0627\u0633\u0641\u0646\u062c\u06cc\u0647 \u0628\u0627 \u0638\u0627\u0647\u0631 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc! \u0627\u0632 \u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0641\u0642\u0637 \u067e\u0648\u062f\u0631\u0627\u0634\u0648 \u062f\u0627\u0634\u062a!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f. \u062e\u06cc\u0644\u06cc \u0645\u0645\u062a\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0645\u0631\u0633\u064a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u064a\u062f \u0648\u0644\u064a \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u062a\u0627\u0632\u0647 \u062a\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0648\u062c\u0648\u062f\u06cc \u06a9\u0647 \u0632\u0646\u06af \u0632\u062f\u0645 \u0648 \u0627\u0637\u0644\u0627\u0639 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062c\u062f\u062f\u06cc \u0647\u0645 \u06a9\u0647 \u0627\u0648\u0631\u062f\u0647 \u0634\u062f \u0628\u0627\u0632 \u0647\u0645 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f \u062f\u06cc\u06af\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0647\u0631\u06af\u0632 \u062e\u0631\u06cc\u062f \u0646\u062e\u0648\u0627\u0647\u0645 \u06a9\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0641\u0639\u0647 \u062f\u0648\u0645\u06cc \u0647\u0633\u062a \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u0648 \u062f\u0631 \u0647\u0631 \u06f2 \u062f\u0641\u0639\u0647 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0627\u0628\u062a\u062f\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0645 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a \u0644\u0637\u0641\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0645\u0648\u062c\u0648\u062f \u0647\u0633\u062a \u062f\u0631 \u0645\u0646\u0648 \u0628\u0627\u0634\u0647 \n\u0628\u0627\u0632\u0645 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\u0636\u0645\u0646 \u0639\u0631\u0636 \u062a\u0634\u06a9\u0631 \u0628\u0627\u0628\u062a \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0637\u0639\u0645 \u0639\u0627\u0644\u06cc \u062f\u0633\u0631 \u0648 \u06a9\u06cc\u06a9\u062a\u0648\u0646\u060c \u0628\u0627\u0628\u062a \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0641\u0646\u062f\u0648\u0642\u06cc \u0627\u06cc \u06a9\u0647 \u0627\u0636\u0627\u0641\u0647 \u06af\u0630\u0627\u0634\u062a\u06cc\u0646 \u0647\u0645 \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u06a9\u0631\u0645 \u0641\u0646\u062f\u0642 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0641\u0646\u062f\u0642\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u0645\u0646 \u06f2\u06f2 \u062a\u0648\u0645\u0627\u0646 \u067e\u0648\u0644 \u0646\u062f\u0627\u062f\u0645 \u0628\u0631\u0627\u06cc \u06f4 \u0639\u062f\u062f \u0627\u0633\u0646\u06a9 \u0642\u0627\u0631\u0686\u06cc \u06a9\u0647 \u0628\u0627\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0628\u0627\u0634\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0628\u0631\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0642\u06cc\u0641\u06cc \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0627\u0633\u0646\u06a9 \u0642\u0627\u0631\u0686 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0641\u062a\u0647 \u0627\u064a \u064a\u0643\u064a \u062f\u0648\u0628\u0627\u0631 \u0627\u0632 \u0646\u0627\u062a\u0644\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u0645\u064a\u06af\u064a\u0631\u064a\u0645 \u062e\u0648\u0628\u0647 \u0648\u0644\u064a \u0627\u064a\u0646\u0628\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0631\u0635\u0644\u0627\u0627\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0647\u0646\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0627\u0646\u062a\u0638\u0627\u0631 \u0628\u06cc\u0634 \u0627\u0632 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0645\u06cc\u0631\u0647 \u0644\u0637\u0641\u0627 \u0631\u0633\u06cc\u062f\u06af\u06cc \u06a9\u0646\u06cc\u0646 \u0686\u0648\u0646 \u0645\u0634\u062a\u0631\u06cc \u062e\u0648\u062f\u062a\u0648\u0646 \u0631\u0648 \u0627\u0632 \u062f\u0633\u062a \u0645\u06cc\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0631\u062e\u0648\u0631\u062f \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u067e\u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0627\u0635\u0644\u0627 \u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633\u0634 \u0646\u0628\u0648\u062f!!! \u0645\u0646 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0648 \u0628\u0628\u0631\u0645 \u0628\u062e\u0648\u0646\u0647 \u06a9\u0633\u06cc \u0648 \u0648\u0627\u0642\u0639\u0627 \u067e\u0634\u06cc\u0645\u0648\u0646 \u0634\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648 \u0627\u062d\u062a\u0631\u0627\u0645 \u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0628\u0647 \u0645\u0648\u0642\u0639 \u0647\u0645 \u0631\u0633\u064a\u062f \u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0648 \u0642\u0646\u0627\u062f\u064a \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u062d\u062a\u0645\u0627 \u0628\u0627\u0632 \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u0627\u0647\u0645 \u062f\u0627\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0648\u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0634\u0645 \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0632 \u0631\u06cc\u062e\u062a \u0627\u0648\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u060c \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f / \u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0648 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 \u0633\u0641\u0627\u0631\u0634\u0627\u062a.\u0628\u0631\u0642\u0631\u0627\u0631 \u0628\u0627\u0634\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0628\u0639\u06cc\u062f \u0627\u0632 \u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0645\u0639\u062a\u0628\u0631 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0641\u0631\u0633\u062a\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u062a\u0627 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0627\u0634\u062a\u0628\u0627\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0644\u0627 \n\u0628\u0647 \u062c\u0627\u06cc 2 \u062a\u0627 \u0686\u06cc\u06a9\u0646 \u06a9\u0627\u0631\u06cc \u062f\u0648\u062a\u0627 \u0627\u0644\u0648\u06cc\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646. \n\u0628\u0627 \u06cc\u06a9 \u0633\u0627\u062f\u0648\u06cc\u0686 \u0686\u06cc\u06a9\u0646 \u06af\u0627\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0686\u06cc\u06a9\u0646 \u06a9\u0627\u0631\u06cc", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0627\u0644\u0648\u06cc\u0647", "\u0686\u0648\u0628\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u063a\u0630\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0631\u062f \u0628\u0648\u062f\u060c \u0645\u0631\u063a \u0648 \u0642\u0627\u0631\u0686 \u0648\u0633\u0637 \u06cc\u062e \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u0631\u063a \u0648 \u0642\u0627\u0631\u0686", -1]}
{"text": ["\u0646\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0646\u0627\u0646 \u062c\u0648 \u06a9\u0647 \u0622\u0648\u0631\u062f\u0646\u062f \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062c\u0648 80% \u0644\u0642\u0645\u0647", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u06af\u0631\u0645 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0628\u0631\u0627\u06cc \u0646\u0627\u0646 \u0633\u062d\u0631.\u0645\u062a\u0627\u0633\u0641\u0645 \u0628\u062e\u0627\u0637\u0631 \u0628\u0631\u0646\u062f\u0634 \u06af\u0631\u0641\u062a\u0645 \u0628\u0633\u06cc\u0627\u0631.\u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0647\u0632\u0627\u0631\u0633\u0627\u0644 \u067e\u06cc\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 14 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 17 \u0639\u062f\u062f)", -1]}
{"text": ["\u062f\u0631\u06a9\u0644 \u0645\u0646 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645 \u0627\u0645\u0627 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u06cc\u06a9\u0628\u0627\u0631 \u0634\u06a9\u0644\u0627\u062a\u0634 \u06a9\u0645\u0647 \u06cc\u06a9\u0628\u0627\u0631 \u0632\u06cc\u0627\u062f \u06cc\u06a9\u0628\u0627\u0631 \u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0633\u0631\u062f \u0634\u062f\u0646 \u06cc\u06a9\u0628\u0627\u0631 \u0627\u06cc\u0646\u0642\u062f\u0631 \u06af\u0631\u0645 \u06a9\u0647 \u0634\u06a9\u0644\u0627\u062a\u0634 \u0628\u0647 \u062f\u0633\u062a \u0645\u06cc\u0686\u0633\u0628\u0647\n\u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06cc\u06a9\u0645 \u0633\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0634\u06a9\u0644\u0627\u062a\u0634 \u06a9\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0622\u0644\u0645\u0627\u0646\u06cc \u0633\u0641\u06cc\u062f", "\u0646\u0627\u0646 \u0628\u0631\u0648\u0686\u0646 \u0645\u062e\u0635\u0648\u0635 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u06cc \u0645\u0646 \u0631\u0648 \u0646\u06cc\u0627\u0648\u0631\u062f\u06cc\u062f (\u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0646\u06cc\u0631", "\u067e\u06cc\u062a\u0632\u0627 (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", -1]}
{"text": ["\u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u06cc\u062f \u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f \u0648\u0644\u06cc \u0641\u0642\u0637 6 \u0639\u062f\u062f \u062f\u0627\u062e\u0644\u0634 \u0628\u0648\u062f...\n\u0639\u062f\u062f \u0631\u0648\u06cc \u0645\u0646\u0648 \u0631\u0627 \u0644\u0627\u0627\u0642\u0644 \u0639\u0648\u0636 \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u06cc\u0647 \u0633\u0627\u0639\u062a \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u0627 \u062b\u0628\u062a \u0634\u062f\u0647 \u062a\u0627\u0632\u0647 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0631\u062f\u0647 \u0646\u0635\u0641 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0631\u0648 \u0646\u062f\u0627\u0631\u0647 \u0648 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u06a9\u0631\u062f\u0647. \u0628\u0639\u062f \u0627\u0632 \u062f\u0648\u0628\u0627\u0631 \u0627\u0639\u0644\u0627\u0645 \u062a\u0627\u062e\u06cc\u0631 \u0648 \u0631\u0641\u062a\u0646 \u0645\u0647\u0645\u0627\u0646\u0627\u0646 \u0628\u0646\u062f\u0647 \u062a\u0627\u0632\u0647 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0631\u0633\u06cc\u062f. \u06af\u0644\u0647 \u0627\u06cc \u0627\u0632 \u067e\u06cc\u06a9 \u0628\u0646\u062f\u0647 \u062e\u062f\u0627 \u0646\u06cc\u0633\u062a. \u06cc\u0647 \u0645\u062c\u0645\u0648\u0639\u0647 \u0628\u06cc \u0646\u0638\u0645\u06cc \u0645\u062b\u0644 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0631\u0648 \u062d\u0630\u0641 \u06a9\u0646\u06cc\u062f \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0644\u0637\u0641\u0627. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062c\u0648 \u062f\u0648 \u0633\u0631", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", -1]}
{"text": ["\u0628\u0627\u0632\u0647\u0645 \u062a\u063a\u064a\u064a\u0631 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0627\u0632 \u0633\u0645\u062a \u0641\u0631\u0648\u0634\u0646\u062f\u0647 \u0647\u0627\u064a \u0627\u0633\u0646\u067e \u0641\u0648\u062f\n\u0627\u064a\u0646\u0633\u0631\u064a \u0628\u0647 \u062c\u0627\u064a \u0643\u064a\u0643 \u0643\u0631\u0627\u0645\u0628\u0644 \u0627\u0644\u0628\u0627\u0644\u0648 \n\u0643\u064a\u0643 \u0643\u0631\u0627\u0645\u0628\u0644 \u0633\u064a\u0628 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\n\u067e\u0627\u064a \u0633\u064a\u0628 \u0647\u0645 \u062e\u064a\u0644\u064a\u064a\u064a \u062e\u0627\u0645 \u0648 \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0639\u0644\u06cc \u0631\u063a\u0645 \u0622\u0645\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u0650 \u0633\u0641\u0627\u0631\u0634\u060c \u0628\u06cc\u0634 \u0627\u0632 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u06a9\u0647 \u062d\u062a\u0651\u06cc \u0627\u0632 \u0632\u0645\u0627\u0646\u0650 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0647\u0645 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0648\u062f!\n\u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u0628\u0647 \u0646\u0638\u0631 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0627\u0635\u0644\u06cc \u062e\u0648\u062f \u0631\u0627 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0647 \u0628\u0648\u062f.\n\u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0645\u0634\u062a\u0631\u06cc \u0642\u062f\u06cc\u0645\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 (\u0627\u0644\u0628\u062a\u0651\u0647 \u0628\u0647\u200c\u0635\u0648\u0631\u062a\u0650 \u062d\u0636\u0648\u0631\u06cc) \u0642\u062f\u0631\u06cc \u0646\u0627\u0627\u0645\u06cc\u062f \u0634\u062f\u0645!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0633\u0628\u06a9 \u0628\u0648\u062f \u0628\u0647 \u062c\u0632 \u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645 \u06a9\u0647 \u0637\u0639\u0645 \u0645\u0648\u0646\u062f\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f \u06a9\u0627\u0645\u0644\u0627\n \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u060c \u0641\u0642\u0637 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u060c \u0644\u0637\u0641\u0627 \u0628\u0637\u0648\u0631 \u067e\u06cc\u0634 \u0641\u0631\u0636 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0647 \u0645\u0648\u062a\u0648\u0631\u0633\u0648\u0627\u0631\u0647\u0627 \u0633\u0641\u0627\u0631\u0634 \u06a9\u0646\u06cc\u062f \u062c\u0639\u0628\u0647 \u0631\u0627 \u0648\u0627\u0631\u0648\u0646\u0647 \u0646\u06a9\u0646\u0646 \u060c \u0646\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0643\u064a\u0643 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0643\u064a\u0643 \u0686\u0633\u0628\u064a\u062f\u0647 \u0628\u0648\u062f \u0648 \u0643\u064a\u0643 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0633\u0647", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0648\u0627\u0642\u0639\u0627 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u062f \u0628\u0648\u062f \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u062f\u0648\u0645\u06cc \u06a9\u0647 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645\u0686\u06cc\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0645\u06cc\u0641\u0631\u0633\u062a\u0647 \u0628\u0631\u0627\u0645\u200c\u0628\u0627\u0631\u0647\u0627 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0641\u06a9\u0631\u200c\u0646\u0645\u06cc\u06a9\u0631\u062f\u0645 \u0628\u0627\u0632\u0645 \u0628\u0627 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0647\u0645 \u0646\u0638\u0631 \u062f\u0627\u062f\u0645 \u0648 \u06af\u0641\u062a\u0645 \u0633\u0641\u062a \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0647\u0645\u0686\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u0628\u0641\u0631\u0633\u062a\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0641\u0631\u0645 \u06a9\u06cc\u06a9\u200c\u0647\u0627 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0639\u0627\u0644\u0649 \u0628\u0648\u062f \u0648\u0644\u0649 \u062c\u0646\u0633 \u0646\u0648\u0646\u0634 \u062c\u0627\u0649 \u0643\u0627\u0631 \u062f\u0627\u0631\u0647 \u062e\u0634\u0643 \u0628\u0648\u062f \u0628\u0639\u062f \u0686\u0631\u0627 \u0643\u0631\u0627\u0645\u0628\u0644 \u0633\u064a\u0628 \u062f\u064a\u06af\u0647 \u062a\u0648 \u0645\u0646\u0648\u062a\u0648\u0646 \u0646\u064a\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644\u0647 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a \u0628\u0647 \u062a\u0645\u0627\u0645 \u0645\u0639\u0646\u0627", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u0648\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0628\u0647 \u0645\u0648\u0642\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 1.100 \u06af\u0631\u0645\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062a\u0627\u0631\u062a \u0641\u0627\u062c\u0639\u0647 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0647\u0646\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u0645\u0627\u0644 \u06cc\u0647 \u0647\u0641\u062a\u0647 \u067e\u06cc\u0634 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u062e\u06cc\u0644\u0644\u0644\u0644\u0644\u0644\u06cc \u0627\u0632 \u0646\u06cc\u0634\u06cc\u06a9\u0631 \u0628\u0639\u06cc\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 5", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u0641\u062a\u0636\u0627\u062d \u0627\u0641\u062a\u0636\u0627\u062d", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631\u0634 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u0627\u0631\u0627 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645. \u062e\u0648\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc 650 \u06af\u0631\u0645", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0639\u0644\u06cc \u0631\u063a\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0635\u0631\u0641\u0627 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0628\u0631\u0627\u06cc\u0645 \u0622\u0648\u0631\u062f\u0646\u062f \u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u0628\u0648\u062f \u062a\u0648\u06cc\u0634 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0639\u0627\u0644\u064a \u0648 \u062a\u0627\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0635\u0648\u0631\u062a \u0648\u0627\u0698\u06af\u0648\u0646 \u0634\u062f\u0647 \u0648 \u06a9\u0627\u0645\u0644\u0627\u064b \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u0649", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u062f\u0631 \u0627\u0646\u062a\u062e\u0627\u0628 \u0633\u0641\u06cc\u0631 \u062f\u0642\u062a \u0641\u0631\u0645\u0627\u06cc\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1.400 \u06af\u0631\u0645\u06cc (20 \u062a\u0627 25 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9\u0645 \u0646\u0648\u0634\u062a\u0647 \u0634\u0648\u062f \u0627\u0645\u0627 \u062e\u0628\u0631\u06cc \u0627\u0632 \u0646\u0648\u0634\u062a\u0647 \u0646\u0628\u0648\u062f. \u0627\u0645\u0627 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648 \u0645\u0645\u0646\u0648\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u062f\u0648\u0631 \u0628\u0648\u062f\u0645 \u0641\u0627\u0635\u0644\u0647 \u0648 \u0637\u06cc \u0632\u0645\u0627\u0646 \u062d\u062f\u0648\u062f\u0627 \u0628\u06cc\u0633\u062a \u062f\u0642\u06cc\u0642\u0647 \u062a\u0648\u0633\u0637 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e\u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc  \u0648 \u0628\u0633\u062a\u0646\u06cc \u0628\u062f\u0648\u0646 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u06af\u06cc\u060c \u0622\u0628 \u0634\u062f\u0646 \u062f\u0631 \u0633\u0644\u0627\u0645\u062a \u0631\u0633\u06cc\u062f\u0646\u062f.\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647  \u0628\u0648\u062f\u0646\u062f \u0648 \u0628\u0627 \u0633\u0644\u06cc\u0642\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0686\u06cc\u062f\u0645\u0627\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.\n\u0627\u0632 \u0645\u062c\u0645\u0648\u0639\u0647 \u062e\u0648\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0634\u06a9\u0631 \u0632\u0639\u0641\u0631\u0627\u0646\u06cc\u0647 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0633\u062a\u0646\u06cc \u0645\u06cc\u0648\u0647 \u0627\u06cc", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0628\u0647 \u062e\u0635\u0648\u0635 \u0628\u0631\u0627\u0648\u0646\u06cc\n\u06a9\u0627\u0634 \u0628\u0631\u0627\u0648\u0646\u06cc \u0628\u0632\u0631\u06af \u0647\u0645 \u0628\u0647 \u0645\u0646\u0648 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u0631\u0648\u0644\u062a \u0633\u0627\u062f\u0647 \u06a9\u0645\u06cc \u0628\u0648\u06cc \u062a\u0646\u062f \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0632\u0648\u062f\u062a\u0631 \u0627\u0648\u0646\u06cc \u06a9\u0647 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0631\u062f\u0645 \u0631\u0633\u06cc\u062f. \u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 5 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0634\u062a\u0628\u0627\u0647 \u0628\u062c\u0627\u06cc \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u067e\u0633 \u0627\u0632 \u062a\u0645\u0627\u0633 \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u06af\u0631\u062f\u0627\u0646\u062f\u0647 \u0634\u062f \u0648 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u0648\u0644\u06cc \u0647\u0631 \u062f\u0648 \u0628\u0627\u0631 \u0628\u0647 \u0647\u06cc\u0686 \u0648\u062c\u0647 \u062f\u0644\u06cc\u0648\u0631\u06cc \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u062f \u0628\u0648\u062f. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u06cc\u0647 \u06a9\u0645 \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 \u0648\u0627\u0646\u06cc\u0644\u06cc", "\u0634\u0645\u0639 \u0634\u06a9\u0644\u062f\u0627\u0631", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0641\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u06af\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0686\u0648\u0646 \u062a\u0639\u062f\u0627\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u0642\u0648\u0637\u06cc \u06a9\u0645 \u0628\u0648\u062f \u0648 \u0648\u062c\u0648\u062f \u0641\u0636\u0627\u0647\u0627\u06cc \u062e\u0627\u0644\u06cc \u0628\u0627\u0639\u062b \u0634\u062f\u0647 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0628\u062e\u0648\u0631\u0646\u062f\u060c \u062e\u0627\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0648 \u06a9\u0644\u0627  \u0628\u0647 \u062f\u0631 \u0642\u0648\u0637\u06cc \u0645\u0627\u0644\u0628\u062f\u0647 \u0628\u0648\u062f. \u0628\u0647 \u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u06cc\u0627\u0647 \u062f\u0627\u0646\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0646 \u06a9\u06cc\u06a9 \u0631\u062f \u0648\u0644\u0648\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06cc\u0647 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0698\u0644\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u06cc\u062f \u0628\u0627\u0698\u0644 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0648 \u0645\u0631\u062a\u0628\u0647 \u0627\u0632 \u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06af\u0631\u0641\u062a\u0645 . \u0647\u0631 \u062f\u0641\u0639\u0647 \u0627\u0632 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0628\u0647\u062a\u0631 \u0628\u0648\u062f. \u06cc\u0639\u0646\u06cc \u0627\u0632 \u062a\u0627\u0632\u06af\u06cc \u06a9\u0645 \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f...\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0628\u0645\u0648\u0646\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0628\u062f \u0644\u0637\u0641\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0631\u0648 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f \u0639\u06a9\u0633 \u06a9\u06cc\u06a9 \u0647\u0645 \u0645\u0648\u062c\u0648\u062f\u0647 \u062a\u0627 \u0628\u0628\u06cc\u0646\u06cc\u062f \u062a\u0627 \u0686\u0647 \u062d\u062f \u062f\u0627\u063a\u0648\u0646 \u0648 \u0644\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0632\u0626\u06cc\u0646 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", -1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\u0662 \u0627\u0633\u0644\u0627\u06cc\u0633 \u0631\u062f\u0648\u0644\u0648\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc (\u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633)", "\u0631\u062f\u0648\u0644\u0648\u062a (\u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633)", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0633\u067e\u0627\u0633 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0648 \u067e\u06cc\u06a9 \u0645\u062d\u062a\u0631\u0645\n\n\u0641\u0642\u0637 \u062f\u0631 \u062e\u0648\u0627\u0633\u062a\u06cc \u06a9\u0647 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062f\u0627\u0631\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u06cc \u0647\u0632\u06cc\u0646\u0647 \u0647\u0627\u06cc \u067e\u06cc\u06a9 \u062f\u0642\u06cc\u0642 \u062f\u0631 \u0627\u067e\u0644\u06cc\u06a9\u0634\u0646 \u062b\u0628\u062a  \u0628\u0634\u0647 \u06a9\u0647 \u0647\u0646\u06af\u0627\u0645 \u0633\u0641\u0627\u0631\u0634 \u0627\u0645\u06a9\u0627\u0646 \u062a\u0635\u0645\u06cc\u0645 \u06af\u06cc\u0631\u06cc \u0648\u062c\u0648\u062f \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647\u060c \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0639\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u062f\u0631 \u0639\u0645\u0644 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0642\u0631\u0627\u0631 \u0628\u06af\u06cc\u0631\u06cc\u0645. \u0645\u062c\u062f\u062f\u0627 \u062a\u0634\u06a9\u0631", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u0633\u062a \u067e\u0631\u062a\u0642\u0627\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0634 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0627\u0633\u0646\u067e \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0628\u0631\u0627\u0645\u0648\u0646 \u0622\u0648\u0631\u062f\u060c \u0641\u0642\u0637 \u06cc\u06a9\u0645 \u0631\u0648\u06cc \u0628\u0639\u0636\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0648\u0646 \u0647\u0645 \u0642\u0627\u0628\u0644 \u0686\u0634\u0645 \u067e\u0648\u0634\u06cc \u0628\u0648\u062f\u060c \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0647 \u062a\u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u062f\u0648 \u062a\u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f\n      \u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0645\u0627\u0645\u0648\u0631 \u067e\u06cc\u06a9\u062a\u0648\u0646 \u0639\u062c\u0644\u0647 \u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0648\u06cc\u0648\u0631\u06a9\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u0647\u0631 \u062f\u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0628\u0627\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646\u062f\u060c \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0647\u0648\u06cc\u062c \u0631\u0648\u06cc \u0622\u0646  \u0648 \u0628\u062e\u0634\u06cc \u0627\u0632 \u062e\u0627\u0645\u0647 \u0628\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u067e\u06cc \u062f\u0627\u0631\u0686\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc\u200c\u0647\u0627 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a\u0646. \u062f\u0627\u062e\u0644 \u06cc\u06a9\u06cc \u0627\u0632 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc\u200c\u0647\u0627 \u0647\u0645 \u067e\u0648\u0633\u062a\u0647 \u062a\u062e\u0645\u200c\u0645\u0631\u063a \u0628\u0648\u062f.\n\u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647\n\u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639\n\u0641\u0642\u0637 \u06a9\u0627\u0634 \u062c\u0639\u0628\u0647 \u0647\u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u0626\u06cc \u0647\u0645 \u0628\u0630\u0627\u0631\u0646\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0632\u0648\u062f \u0628\u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0627\u0645\u0647 \u0645\u0635\u0631\u0641\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0645\u0639\u0645\u0648\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0627 \u0627\u0648\u0646 \u0686\u06cc\u0632\u06cc\u0647 \u06a9\u0647 \u0627\u06cc\u0646\u062c\u0627 \u0646\u0634\u0648\u0646 \u062f\u0627\u062f\u0647 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0646\u06af\u0627\u0631 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633)", 1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645 . \u0641\u0642\u0637 \u0644\u0637\u0641 \u06a9\u0646\u06cc\u062f \u062a\u0639\u062f\u0627\u062f \u0639\u06a9\u0633 \u0648 \u0627\u0631\u0633\u0627\u0644\u06cc \u06cc\u06a9\u06cc \u0628\u0627\u0634\u0647 . \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062c\u0648 \u062f\u0648 \u0633\u0631", "\u0633\u0628\u0648\u0633 80%", 1]}
{"text": ["\u0628\u0627 \u062f\u0648 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648 \u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631 \u0645\u062b\u0644 \u0633\u0646\u06af \u0628\u0648\u062f\u060c \u0628\u06cc\u0627\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644 \u0628\u0627 \u0631\u0648\u063a\u0646 \u0632\u06cc\u062a\u0648\u0646", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", "\u062c\u0648 \u062f\u0648 \u0633\u0631", "\u0646\u0627\u0646 \u063a\u0646\u06cc \u0634\u062f\u0647", -1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0627\u0645\u062a\u06cc\u0627\u0632\u0634 \u0627\u0632 10 \u0639\u062f\u062f 6 \u0647\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u062f \u0628\u062f \u0628\u062f \u0627\u0641\u062a\u0632\u0627\u062d \u0647\u0631 \u0628\u0627\u0631 \u0627\u0632\u06cc\u0646 \u0634\u0639\u0628\u0647 \u0647\u0631\u0686\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645 \u067e\u0634\u06cc\u0645\u0648\u0646 \u0634\u062f\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0639\u062f\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\n\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0627\u0639\u062b \u0645\u06cc\u0634\u0647 \u062f\u06cc\u06af\u0647 \u0633\u0641\u0627\u0631\u0634 \u062a\u06a9\u0631\u0627\u0631 \u0646\u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", -1]}
{"text": ["\u0646\u0627\u0646 \u06a9\u0631\u0648\u0633\u0627\u0646 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (1 \u0639\u062f\u062f)", "\u062a\u0633\u062a \u0633\u06cc\u0627\u0647 \u06a9\u0648\u0686\u06a9 (\u062d\u062f\u0648\u062f\u0627 420 \u06af\u0631\u0645)", -1]}
{"text": ["\u0634\u0645\u0627 \u0628\u06cc \u0646\u0638\u06cc\u0631\u06cc\u062f \u060c\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u0628\u0647 \u062c\u0627\u06cc \u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af \u060c \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u062f\u0648\u0646\u0627\u062a \u0628\u0632\u0631\u06af", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", "\u0644\u0648\u0627\u0634 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0627\u0628\u062a \u062e\u062f\u0645\u0627\u062a \u062e\u0648\u0628\u0634 \u0648 \u0647\u0645\u06cc\u0646 \u0637\u0648\u0631 \u0646\u0627\u0646 \u0633\u062d\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0646\u0627\u067e\u0644\u0648\u0646\u064a \u0628\u0647 \u0627\u064a\u0646 \u0632\u0634\u062a\u064a \u062a\u0627 \u062d\u0627\u0644\u0627 \u0646\u062f\u064a\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0646\u06af\u0627\u0631 \u0628\u0631\u0627\u064a \u064a\u0643 \u0647\u0641\u062a\u0647 \u067e\u064a\u0634 \u0628\u0648\u062f\u0647 \u0643\u0647 \u0661\u0660\u0660 \u0628\u0627\u0631 \u062c\u0627 \u0628\u0647 \u062c\u0627\u0634 \u0643\u0631\u062f\u0647 \u0628\u0627\u0634\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f\u060c \u0648\u0644\u064a \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a \u0633\u0627\u064a\u0632 \u0628\u0633\u064a\u0627\u0631 \u0643\u0648\u0686\u064a\u0643\u064a \u062f\u0627\u0631\u0647 \u060c\u064a\u0643\u0645 \u062a\u0648 \u0630\u0648\u0642 \u0627\u062f\u0645 \u0645\u064a\u062e\u0648\u0631\u0647 :(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0627\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u067e\u0648\u062f\u06cc\u0646\u06af \u0634\u06a9\u0644\u0627\u062a\u06cc \u0634\u0627\u0646 \u062a\u0645\u0627\u0645 \u0645\u06cc \u0634\u0648\u062f.\u0633\u0627\u0639\u062a 10:15 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0644 \u0634\u0639\u0628\u0627\u062a\u0634\u0648\u0646 \u0646\u062f\u0627\u0634\u062a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0641\u0642\u0637 \u0628\u0627\u06cc\u062f \u06af\u0641\u062a \u0641\u0633\u0642\u0644\u06cc \u0647\u0627\u06cc \u062e\u0648\u0634\u0645\u0632\u0647...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06a9\u06cc\u0641\u06cc\u062a \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644\u06cc \u062f\u0627\u0631\u0646\u062f. \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f\u0646\u062f. \u0647\u0631 \u06a9\u062f\u0648\u0645 \u0627\u0632 \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0628\u0647 \u0642\u0637\u0631\u06f6 \u0633\u0627\u0646\u062a \u0628\u0648\u062f\u0646\u062f.\u0648\u0645\u0637\u0627\u0644\u0628\u0647 \u0627\u06cc\u0646 \u0647\u0632\u06cc\u0646\u0647 \u0628\u0631\u0627\u06cc \u0686\u0646\u06cc\u0646 \u062d\u062c\u0645 \u06a9\u0645\u06cc \u0648\u0627\u0642\u0639\u0627 \u0627\u0639\u062a\u0645\u0627\u062f \u0628\u0647 \u0646\u0641\u0633 \u0645\u06cc \u062e\u0648\u0627\u062f. \u062f\u06cc\u06af\u0647 \u0627\u06cc\u0646 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u0646\u0645\u06cc \u062f\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0645\u0627\u0631\u0633 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f \u060c \u0628\u0628\u062e\u0634\u06cc\u062f \u0627\u0632 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0647\u0645 \u0628\u0647\u062a\u0631 \u060c \u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628 \u0648 \u0622\u0644\u0628\u0627\u0644\u0648 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u060c \u0627\u0645\u0627 \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \u062d\u0627\u0644\u0627 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0645\u062f\u0644\u0634\u0647 \u06cc\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f (\u06a9\u0647 \u0628\u0639\u06cc\u062f \u0645\u06cc\u062f\u0648\u0646\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0627\u0634\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633) \u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0645\u0632\u0647 \u0639\u0627\u0644\u06cc \u060c \u062d\u0627\u0644\u0627 \u0642\u06cc\u0645\u062a \u0634\u0627\u06cc\u062f \u06a9\u0645\u06cc \u0628\u0627\u0644\u0627\u0633\u062a \u0646\u0633\u0628\u062a \u0628\u0647 \u0631\u0642\u0628\u0627 \u0648 \u062e\u06cc\u0644\u06cc \u0647\u0627 \u0645\u062d\u0631\u0648\u0645 \u0645\u06cc\u0634\u0646 \u0627\u0632 \u0644\u0630\u062a \u062e\u0648\u0631\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 .\u200c\u200c\u200c...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", 1]}
{"text": ["\u062e\u064a\u0644\u0649 \u062e\u0648\u0628 \u0628\u0648\u062f \u0632\u0648\u062f \u0647\u0645 \u0631\u0633\u064a\u062f \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u064a\u062f \u0648 \u0628\u0627 \u062a\u0634\u0643\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f \u060c \u0647\u0645 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0645 \u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u0647\u0627 \u0647\u0645 \u0633\u0631\u0639\u062a \u0631\u0633\u06cc\u062f\u0646! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0633\u0631\u06cc\u0639 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. \u0628\u0627 \u0639\u06a9\u0633 \u062a\u0641\u0627\u0648\u062a \u062f\u0627\u0631\u062f. \u0646\u0633\u0628\u062a\u0627 \u062a\u0627\u0632\u0647 \u0627\u0633\u062a \u0648\u0644\u06cc \u0637\u0639\u0645 \u0628\u0627\u0642\u0644\u0648\u0627 \u0645\u0639\u0645\u0648\u0644\u06cc. \u0627\u0646\u062a\u0638\u0627\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u062f\u0627\u0634\u062a\u0645 \u06a9\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0644\u0630\u06cc\u0630 \u0628\u0648\u062f\u0646\u062f\u060c  \u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0627\u0633\u062a\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0628\u0627 \u0633\u0644\u06cc\u0642\u0647 \u0686\u06cc\u062f\u0647 \u0645\u0627\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0645\u06cc\u0628\u0627\u06cc\u0633\u062a \u062a\u0634\u06a9\u0631 \u06a9\u0646\u0645. \u0628\u0633\u062a\u0646\u06cc \u0647\u0645 \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0633\u0627\u0641\u062a \u062f\u0648\u0631 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u0622\u0628 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0627\u0646\u06af\u0627\u0631 \u062a\u0627\u0632\u0647 \u0627\u0632 \u0641\u0631\u06cc\u0632\u0631 \u062f\u0631\u0622\u0648\u0631\u062f\u0647 \u0628\u0627\u0634\u0646\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0631\u062a \u0633\u06cc\u0628  \u0644\u0630\u06cc\u0630 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0633\u062a. \u0645\u0645\u0646\u0648\u0646\u0645 \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0648\u0628\u062a\u0648\u0646 \u0648 \u0645\u062c\u0645\u0648\u0639\u0647 \u067e\u0631\u062a\u0644\u0627\u0634 \u0627\u0633\u0646\u067e \u0641\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0633\u062a\u0646\u06cc \u0645\u06cc\u0648\u0647 \u0627\u06cc", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0627\u0633\u062a\u06cc\u0644\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631\u0639\u0627\u0644\u06cc \u0648\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0647\u0645\u0647 \u062a\u0627\u0632\u0647 \u0648\u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f\u0646 \u062f\u0633\u062a \u0634\u0645\u0627 \u062f\u0631\u062f\u0646\u06a9\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0645\u06cc\u0648\u0647 \u06a9\u0631\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0643 \u062f\u0627\u063a\u0648\u0648\u0648\u0648\u0646 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u064a\u064a\u064a\u064a\u062f \u0628\u062f \u0627\u0641\u062a\u0636\u0627\u062d\u062d\u062d \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u062a\u0634\u0643\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0627\u0643\u0633 \u0643\u0647 \u062e\u064a\u0644\u064a \u0645\u0631\u062a\u0628 \u0634\u0631\u064a\u0646\u064a \u0647\u0627\u0631\u0648 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\n\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f\n \u0643\u064a\u0643 \u0634\u0643\u0644\u0627\u062a\u064a \u0637\u0639\u0645 \u062e\u0627\u0635 \u0648 \u0647\u064a\u062c\u0627\u0646 \u0627\u0646\u06af\u064a\u0632\u064a \u0646\u062f\u0627\u0634\u062a \u0648 \u0637\u0639\u0645 \u0645\u0639\u0645\u0648\u0644\u064a \u062f\u0627\u0634\u062a\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc", "\u0634\u06a9\u0644\u0627\u062a", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", "\u0627\u0633\u0646\u06a9 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648 650 \u06af\u0631\u0645 (5 \u062a\u0627 7 \u0639\u062f\u062f)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 650 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u062a\u0644\u0627\u0634\u06cc \u0634\u062f\u0647 \u0628\u0631\u0627\u0645 \u0627\u0648\u0631\u062f\u0646 . \u0628\u0647 \u0647\u06cc\u0686 \u0639\u0646\u0648\u0627\u0646 \u0642\u0627\u0628\u0644 \u062a\u0634\u062e\u06cc\u0635 \u0646\u0628\u0648\u062f \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 . \u0627\u0641\u062a\u0636\u0627\u062d. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0648 \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u060c \u0645\u0645\u0646\u0648\u0646 \u0628\u0627\u0628\u062a \u0647\u0645\u0647 \u0686\u06cc\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062a\u0646 \u062f\u0631\u062e\u0648\u0627\u0633\u062a\u06cc \u0628\u0627 \u0645\u062a\u0646 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f.\u0639\u06a9\u0633 \u06a9\u06cc\u06a9 \u0646\u06cc\u0632 \u0628\u0627 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0644\u06cc\u0631\u063a\u0645 \u062a\u0623\u06a9\u06cc\u062f \u062a\u0644\u0641\u0646\u06cc \u0645\u0627 \u0628\u0647 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f\u060c \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u062d\u0645\u0644 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u06cc\u06a9 \u0637\u0631\u0641 \u062c\u0639\u0628\u0647!\n\u0641\u0642\u0637 \u0627\u0632 \u0631\u0648\u06cc \u0627\u0646\u0633\u0627\u0646 \u062f\u0648\u0633\u062a\u06cc \u0645\u0631\u062c\u0648\u0639 \u0646\u06a9\u0631\u062f\u06cc\u0645!\n\u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u060c", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 \u0648\u0627\u0646\u06cc\u0644\u06cc", 1]}
{"text": ["\u0645\u0646 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u064a \u0631\u0648 \u0628\u0631\u0627\u064a \u0645\u0647\u0645\u0648\u0646 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u0645.\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u0643\u0644 \u062f\u0631\u0633\u062a \u062d\u0633\u0627\u0628\u064a \u0643\u0647 \u0646\u062f\u0627\u0634\u062a \u0627\u0646\u06af\u0627\u0631 \u0627\u0632 \u062a\u0647 \u0645\u0648\u0646\u062f\u0647 \u0647\u0627 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646.\u0648\u0627\u0642\u0639\u0627 \u062a\u0648\u0642\u0639 \u0645\u0646 \u0627\u0632 \u0627\u064a\u0646 \u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0631\u0648\u0634\u064a \u062e\u064a\u0644\u064a \u0628\u064a\u0634\u062a\u0631 \u0628\u0648\u062f.\u062f\u064a\u06af\u0647 \u062d\u0648\u0627\u0633\u0645\u0648 \u062c\u0645\u0639 \u0645\u064a\u0643\u0646\u0645 \u064a\u0647 \u0648\u0642\u062a \u0628\u0631\u0627\u064a \u0645\u0647\u0645\u0648\u0646 \u0627\u0632 \u0627\u064a\u0646\u062c\u0627 \u062e\u0631\u064a\u062f \u0646\u0643\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0698\u06cc\u0645\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", -1]}
{"text": ["\u0627\u0632 \u0633\u0627\u0639\u062a \u06f1\u06f6:\u06f2\u06f0 \u0628\u0646\u062f\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0633\u0627\u0639\u062a \u06f1\u06f9:\u06f3\u06f0 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u062a\u0627\u0632\u0647 \u0628\u0627 \u06a9\u0644\u06cc \u062a\u0645\u0627\u0633 \u0648 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f .\u067e\u06cc\u06a9 \u0647\u0627 \u0634\u0648\u0646 \u0627\u0645 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u06cc\u06a9\u06cc \u062f\u0631\u0648\u063a\u06af\u0648\u062a\u0631 .\n\u0628\u0627 \u067e\u06cc\u06a9 \u062a\u0645\u0627\u0633 \u0645\u06cc\u06af\u06cc\u0631\u06cc \u0645\u06cc\u06af\u0647 \u0645\u0648\u062a\u0648\u0631\u0645 \u062e\u0631\u0627\u0628\u0647 \n\u062a\u0648 \u0631\u0627\u0647\u0645 \n\u0647\u0646\u0648\u0632 \u0633\u0641\u0627\u0631\u0634 \u0622\u0645\u0627\u062f\u0647 \u0646\u0634\u062f\u0647 \n\u062f\u0627\u0631\u0645 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u06af\u06cc\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u06cc\u062f \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u06a9\u0627 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0646\u0632\u062f\u06cc\u06a9 \u06f5\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u0647 \u0627\u0645\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u06cc\u0641\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627\u062a\u0634\u06a9\u0631 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f\n\u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0641\u0642\u0637 \u0648\u0642\u062a\u06cc \u06a9\u06cc\u06a9 \u0631\u0648 \u0622\u0648\u0631\u062f\u0646\u062f \u0627\u0632 \u0648\u0633\u0637 \u0646\u0635\u0641 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0627\u0634 \u067e\u06cc\u06a9 \u0628\u0627 \u0627\u062d\u062a\u06cc\u0627\u0637 \u062d\u0645\u0644 \u06a9\u0646\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u0645\u0627\u0644\u0647 2 \u06cc\u0627 3 \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0648\u062f \u0628\u0637\u0648\u0631\u06cc \u06a9\u0647 \u062e\u0627\u0645\u0647 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0646\u0647 \u067e\u0633 \u06af\u0631\u0641\u062a\u0646\u062f \u0646\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062a\u0648\u0646\u0633\u062a \u06a9\u0627\u0631\u06cc \u0628\u0631\u0627\u0645 \u0628\u06a9\u0646\u0647 \u0647\u0645\u0647 \u0631\u0648 \u0631\u06cc\u062e\u062a\u0645 \u0628\u06cc\u0631\u0648\u0646 \u062f\u0641\u0639\u0647 \u0627\u0648\u0644 \u0648 \u0622\u062e\u0631\u0645 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0646\u0635\u0641 \u062a\u0632\u06cc\u06cc\u0646 \u0631\u0648\u0634 \u0648 \u062e\u0627\u0645\u0647 \u0627\u0634 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u06a9\u0641 \u062c\u0639\u0628\u0647. \u062a\u0645\u0627\u0645 \u0646\u0627\u0631\u0636\u0627\u06cc\u062a\u06cc \u0627\u0632 \u0646\u062d\u0648\u0647 \u062d\u0645\u0644 \u06a9\u06cc\u06a9  \u0627\u0633\u062a\u060c \u0644\u0637\u0641\u0627 \u0631\u0627\u0647\u06a9\u0627\u0631 \u0645\u0646\u0627\u0633\u0628 \u0628\u06a9\u0627\u0631 \u0628\u06af\u06cc\u0631\u06cc\u062f. \u062e\u06cc\u0641 \u0646\u06cc\u0633\u062a \u06a9\u06cc\u0641\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0628\u062e\u0627\u0637\u0631 \u062d\u0645\u0644\u0634 \u060c \u062e\u0631\u0627\u0628 \u0628\u0634\u0647\u061f\u061f!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0632\u0626\u06cc\u0646 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f. \u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u0627\u0645\u0634 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f. \u067e\u06cc\u06a9 \u0647\u0645 \u06cc\u0647 \u062c\u0648\u0631\u06cc \u0627\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0627\u0646\u06af\u0627\u0631 \u0646\u0627\u0631\u0646\u062c\u06a9 \u062a\u0648 \u062c\u0639\u0628\u0647 \u0645\u0646\u0641\u062c\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f. \u062f\u0642\u062a \u062a\u0648 \u0627\u0648\u0631\u062f\u0646\u0634 \u0646\u0645\u06cc\u06a9\u0646\u0646....\u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u062f\u0627\u063a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u062d\u0648\u064a\u0644 \u067e\u064a\u0643 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0643\u064a\u0643 \u0643\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0627\u062f\u0645 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u062f\u0627\u0631\u0647 \u0627\u064a\u0646\u062c\u0648\u0631\u064a \u062a\u062d\u0648\u064a\u0644 \u0628\u06af\u064a\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc\u060c\u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0648 \u0628\u0627 \u062c\u0639\u0628\u0647 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u0634\u0648\u062f. \n\u0644\u0637\u0641\u0627 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0646\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u062e\u06cc\u0644\u06cc \u062f\u0644\u0686\u0633\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u062f\u0648\u0628\u0631\u0627\u0628\u0631 \u0632\u0645\u0627\u0646 \u062a\u0639\u06cc\u06cc\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646 \u0648 \u067e\u06cc\u0634 \u0645\u0647\u0645\u0648\u0646\u0627\u0645 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633)", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631\u06cc\u0646 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062a\u0647\u0631\u0627\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u0647\u0631 \u062f\u0648 \u0633\u0641\u0627\u0631\u0634\u0645 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f. \u0641\u0642\u0637 \u0645\u0634\u06a9\u0644\u06cc \u06a9\u0647 \u062f\u0627\u0634\u062a\u060c \u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f. \u0686\u0648\u0646 \u0633\u0641\u0627\u0631\u0634\u0645 \u0628\u0627 \u0627\u0633\u0646\u067e \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0628\u0647 \u0647\u0631 \u062d\u0627\u0644 \u0648\u0642\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u063a\u0630\u0627 \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0631\u0646\u062f \u0628\u0627\u06cc\u062f \u062a\u0648 \u0633\u0631\u0639\u062a \u0628\u06cc\u0634\u062a\u0631 \u0627\u062d\u062a\u06cc\u0627\u0637 \u06a9\u0646\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0641\u0642\u0637 \u06a9\u0646\u062c\u062f\u06cc \u0647\u0633\u062a  \u0627\u06cc \u06a9\u0627\u0634 \u0645\u062f\u0644\u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u0647\u0645 \u0645\u06cc\u06af\u0630\u0627\u0634\u062a\u06cc\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0633\u0641\u062a \u0628\u0648\u062f. \u0627\u0646\u06af\u0627\u0631 \u06a9\u0647 \u062a\u0627\u0632\u0647 \u067e\u062e\u062a \u0646\u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0631\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0632\u06cc\u0627\u062f\u06cc \u0686\u0631\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647\u0647\u0647 \u0628\u0648\u062f \u062e\u064a\u0644\u064a\u064a\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0643 \u0634\u0643\u0644\u0627\u062a\u064a \u0628\u0647\u062a\u0631 \u0627\u0632 \u0628\u0642\u064a\u0647 \u0628\u0648\u062f \u0648\u0644\u064a \u0647\u064a\u0686 \u0643\u062f\u0627\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f... \n\u0686\u064a\u0632 \u0643\u064a\u0643 \u0646\u0648\u062a\u0644\u0627 \u0627\u0635\u0644\u064a \u0645\u0632\u0647 \u0646\u0648\u062a\u0644\u0627 \u0646\u0645\u064a\u062f\u0627\u062f\u060c\u060c \u0634\u0643\u0644\u0627\u062a \u0645\u0639\u0645\u0648\u0644\u064a \u0628\u0648\u062f..\n\u062f\u0631 \u0643\u0644 \u0628\u062f \u0646\u0628\u0648\u062f....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0631\u062f\u0648\u0644\u0648\u062a (\u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f. \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645... \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0633\u0627\u0644\u0645 \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u067e\u06cc\u0634\u0634\u0627\u067e\u06cc\u0634 \u0639\u0630\u0631 \u062e\u0648\u0627\u0647\u06cc \u06a9\u0631\u062f\u0646 \u0627\u06af\u0647 \u0628\u0627\u0628\u062a \u062f\u0633\u062a \u0627\u0646\u062f\u0627\u0632 \u0645\u0634\u06a9\u0644\u06cc \u067e\u06cc\u0634 \u0627\u0648\u0645\u062f\u0647 \u0628\u0627\u0634... \u0644\u0630\u062a \u0628\u0631\u062f\u0645. \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0647\u0645 \u06a9\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u062a\u0631\u06cc\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647.. \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u06f2 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u06f1.\u06f5 \u06a9\u06cc\u0644\u0648 \u0645\u06cc\u0686\u06cc\u0646\u0647 \u062e\u0628 \u0645\u0639\u0644\u0648\u0645\u0647 \u062a\u06a9\u0627\u0646 \u0645\u06cc\u062e\u0648\u0631\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0644\u0647 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u0643\u064a\u0643 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u0649 \u062f\u0627\u0646\u0645\u0627\u0631\u0643\u0649 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0627\u0641\u062a\u0636\u0627\u062d. \u0648\u0627\u0642\u0639\u0627 \u0628\u0647 \u0686\u0647 \u062d\u0642\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0646\u062f\u0647 \u0628\u0631\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0645\u06cc\u0634\u0648\u062f\u061f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0627\u0648\u0644\u0627 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06a9\u0645 \u062a\u0631 \u0628\u0648\u062f \u062d\u0627\u0644\u0627 \u0646\u0645\u06cc \u062f\u0648\u0646\u0645 \u062a\u0631\u0627\u0632\u0648\u0634\u0648\u0646 \u062e\u0631\u0627\u0628 \u0628\u0648\u062f\u0647 \u06cc\u0627 ... \n\u0628\u0639\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0634 \u0645\u0632\u0647 \u06cc \u0645\u0648 \u0646\u062f\u0647 \u0645\u06cc \u062f\u0627\u062f \u0646\u0645\u06cc \u062f\u0648\u0646\u0645 \u0648\u0627\u0644\u0627 \u06a9\u06cc \u067e\u062e\u062a \u06a9\u0631\u062f\u0646\u061f\u061f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0639\u062f\u062f 8", -1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0622\u0631\u062f \u06a9\u0627\u0645\u0644", "\u0628\u0627\u06af\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", -1]}
{"text": ["\u0645\u0646 \u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0648\u062f \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0627\u062f\u0645 \u06a9\u0647 \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u0648\u0627\u0631\u062f \u0627\u0631\u0633\u0627\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0647\u0645 \u062f\u0631 \u0632\u0645\u0627\u0646 \u06a9\u0648\u062a\u0627\u0647\u06cc \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c \u062f\u0648\u0646\u0627\u062a\u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u06af\u0631\u0645\u061b  \u0645\u0631\u0633\u06cc :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u067e\u06cc\u062a\u0632\u0627 (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", 1]}
{"text": ["\u0628\u0647 \u0647\u06cc\u0686 \u0639\u0646\u0648\u0627\u0646 \u0646\u0648\u0646 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 \n\u0645\u0646 \u0628\u0631\u0627\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc\u060c \u06af\u0631\u0645 \u0648 \u0633\u0631\u06cc\u0639. \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0647\u0627 \u0647\u0645\u0647 \u06a9\u062c \u0648 \u06a9\u0648\u0644\u0647 \u0648 \u0686\u067e\u0644 \u0686\u0648\u067e\u0648\u0644 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0645\u0646 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u0647\u0645\u0647 \u0631\u0648 \u06cc\u0647 \u062f\u0648\u0631 \u062f\u0633\u062a \u0645\u0627\u0644\u06cc \u06a9\u0646\u0645 .\u0627\u06cc\u06a9\u0627\u0634 \u0628\u0647 \u067e\u06cc\u06a9 \u0645\u062d\u062a\u0631\u0645 \u0627\u0637\u0644\u0627\u0639 \u0645\u06cc\u062f\u0627\u062f\u06cc\u062f \u06a9\u0647 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u062a\u0627\u0631\u062a\u0647 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0634\u06a9 \u0646\u06cc\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 24 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 6 \u0639\u062f\u062f)", 1]}
{"text": ["\u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647 \u0628\u064a\u0646\u0638\u064a\u0631 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0633\u0648\u06cc\u062a\u0627\u0644", "\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u062c\u0648 \u062f\u0648 \u0633\u0631", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0648\u0627\u0646\u06cc\u0644\u06cc", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u062f\u0628 \u0648 \u0648\u0638\u06cc\u0641\u0647 \u0634\u0646\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06a9\u0644\u0627\u062a \u062f\u0627\u062e\u0644\u0634 \u0646\u0633\u0628\u0637 \u0628\u0647 \u0642\u0628\u0644 \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u06cc\u0645 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0634\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u067e\u0627\u062a\u0627 \u0633\u06cc\u0627\u0647", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0645\u0646 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0631\u0636\u0627\u06cc\u062a \u062f\u0627\u0631\u0645 \u0627\u0634\u062a\u0628\u0627\u0647\u06cc \u0630\u0633\u062a\u0645 \u062e\u0648\u0631\u062f \u0628\u0647 \u0646\u0627\u0631\u0627\u0636\u06cc \u0647\u0631\u0686\u06cc \u0631\u06cc\u0644\u0648\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0628\u06cc\u062e\u06cc\u0627\u0644 \u0646\u0645\u06cc\u0634\u0647!! \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u062f\u0633\u062a\u062a\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0634\u0627\u064a\u062f \u0638\u0627\u0647\u0631\u0627 \u0645\u064a\u0632\u0627\u0646 \u062e\u0627\u0645\u0647 \u0632\u064a\u0627\u062f \u0628\u0648\u062f \u0627\u0645\u0627 \u0645\u0648\u0642\u0639 \u062e\u0648\u0631\u062f\u0646 \u0645\u062a\u0648\u062c\u0647 \u0633\u0628\u0643\u064a \u0627\u0648\u0646 \u0645\u064a\u0634\u062f\u064a... \u0641\u0642\u0637 \u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u0643\u0647 \u062e\u0648\u062f \u0643\u064a\u0643 \u062a\u0627\u0632\u0647 \u062a\u0631 \u0628\u0627\u0634\u0647 \u0648\u0644\u064a \u062f\u0631 \u0643\u0644 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0639\u062f \u0627\u0632 \u0631\u0633\u064a\u062f\u0646 \u0634\u0631\u064a\u0646\u064a \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc\u062a\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u062d\u062a\u0645\u0627 \u0628\u0627\u0632\u0645 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc \u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0639\u0646\u06cc \u0645\u06cc\u0646\u06cc \u0628\u0647 \u0645\u0639\u0646\u0627 \u0648\u0627\u0642\u0639\u06cc \u06a9\u0644\u0645\u0647 \u062f\u0631\u06a9 \u06a9\u0631\u062f\u0645 \u0648\u0627\u0642\u0639\u0627 \u0633\u0648\u067e\u0631\u0627\u06cc\u0632 \u0634\u062f\u0645 \u0627\u0645\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0627\u06cc\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062f\u0648\u0628\u0644 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9\u200c \u062e\u0645\u06cc\u0631 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", -1]}
{"text": ["\u0633\u0627\u064a\u0632\u0634 \u0643\u0648\u0686\u064a\u0643 \u0628\u0648\u062f \u0648\u0644\u064a \u0628\u0627 \u0643\u064a\u0641\u064a\u062a \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0639\u0643\u0633 \u0628\u0627  \u0628\u0633\u062a\u0647 \u0627\u0631\u0633\u0627\u0644\u064a \u0645\u063a\u0627\u064a\u0631\u062a \u0639\u062c\u064a\u0628\u064a \u062f\u0627\u0634\u062a!!! \n\u0648 \u0646\u0645\u0627\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0686\u067e\u0647 \u0634\u062f\u0647 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u067e\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u062f\u0645 \u0645\u0646\u0632\u0644 \u062a\u062d\u0648\u06cc\u0644 \u0646\u062f\u0627\u062f \u0648 \u0628\u0627\u0644\u0627 \u0646\u06cc\u0627\u0648\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0645\u0646 \u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u067e\u0633 \u0628\u0627\u062f\u0648\u0645\u0634 \u06a9\u062c\u0627\u0633\u062a\u061f\u061f\u061f \u062f\u0631\u06cc\u063a \u0627\u0632 \u06cc\u06a9 \u0628\u0627\u062f\u0627\u0645!!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0634\u0641\u0634\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0645\u0632\u0647 \u0627\u0634 \u0631\u0648 \u0647\u0646\u0648\u0632 \u062a\u0633\u062a \u0646\u06a9\u0631\u062f\u0645. \u0648\u0644\u06cc \u0627\u0648\u0644\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u067e\u06cc\u06a9 \u0642\u0628\u0644 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u06cc\u0627\u0631\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f\u0647 \u0686\u0646\u062f \u062f\u0642\u06cc\u0642\u0647 \u0642\u0628\u0644 \u0645\u06cc\u0632\u0646\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f!!\n\u062f\u0648\u0645\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0648\u06cc \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0631\u0648\u0644\u062a \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u06a9\u0647 \u062a\u0639\u062f\u0627\u062f \u062d\u062f\u0648\u062f\u0627 22 \u0639\u062f\u062f \u06a9\u0647 \u0645\u0646 \u0631\u0648\u06cc \u0627\u0648\u0646 \u062d\u0633\u0627\u0628 \u06a9\u0631\u062f\u0645 \u0645\u0647\u0645\u0648\u0646 \u062f\u0627\u0634\u062a\u0645. \u062e\u0631\u06cc\u062f\u0645 \u062f\u06cc\u062f\u0645 12 \u062a\u0627\u0633\u062a !!! \u06a9\u0627\u0634 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0631\u0648 \u062f\u0631\u0633\u062a \u0628\u0632\u0646\u0646 . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u0646 \u0627\u06cc\u0646 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0647\u0645\u06cc\u0634\u0647 \u0645\u06cc\u06af\u06cc\u0631\u0645 \u0627\u06cc\u0646 \u0633\u0631\u06cc \u0641\u0648\u0642 \u0627\u0644\u0627\u062f\u0647 \u0628\u062f \u0628\u0648\u062f \u062e\u0634\u06a9 \u0628\u0648\u062f \u0628\u062f \u0628\u0648\u062f \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0627\u06cc\u0646 \u0628\u0627\u0631 \u062f\u0648\u0645 \u0648 \u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u062f\u0641\u0639\u0647 \u0622\u062e\u0631\u06cc  \u0647\u0633\u062a \u06a9\u0647 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc \u062f\u0645 \u0648 \u0628\u0647 \u062e\u0627\u0637\u0631 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0645\u0627\u0645 \u06a9\u06cc\u06a9 \u0644\u0647 \u0648 \u0627\u0632 \u0647\u0645 \u067e\u0627\u0634\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\n\n\u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0648\u06cc \u062a\u0648\u0636\u06cc\u062d\u0627\u062a  \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 !!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u063a\u06cc\u0631\u0645\u0646\u0635\u0641\u0627\u0646\u0647 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0639\u0644\u064a\u0631\u063a\u0645 \u062a\u0627\u0643\u064a\u062f \u0645\u0646 \u062f\u0631 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u0628\u062c\u0627\u064a \u0686\u064a\u0632 \u0643\u064a\u0643 \u0633\u0627\u062f\u0647\u060c \u0643\u0627\u0631\u0627\u0645\u0644\u064a \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0628\u062c\u0627\u064a \u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a\u060c \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u064a \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0646!\n\u0628\u0631\u0627\u064a \u0627\u064a\u0646 \u0639\u062f\u0645 \u062f\u0642\u062a \u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u0643\u0647 \u064a\u0643 \u0686\u064a\u0632 \u062f\u064a\u06af\u0647 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u064a\u0645 \u0648 \u064a\u0643 \u0686\u064a\u0632 \u062f\u064a\u06af\u0647 \u062a\u062d\u0648\u064a\u0644 \u0628\u06af\u064a\u0631\u064a\u0645!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc 650 \u06af\u0631\u0645", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a 650 \u06af\u0631\u0645", "\u0645\u0648\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc", "\u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u064a\u0643 \u0643\u0644\u0627\u0645 \u0628\u062f \n \u0645\u0646 \u062a\u0627\u0643\u064a\u062f \u0643\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0631\u0634 \u0639\u064a\u0646\u0627 \u0645\u0627\u0646\u0646\u062f \u062a\u0635\u0648\u064a\u0631 \n \u0627\u0648\u0644\u0627 \u062a\u0639\u062f\u0627\u062f \u0631\u0648 \u0639\u0646\u0648\u0627\u0646 \u0643\u0631\u062f\u064a\u062f \u0643\u0647 \u0628\u064a\u0634\u062a\u0631 \u0627\u0632 \u0661\u0660 \u062a\u0627 \u0646\u0645\u064a\u0634\u0647 \u0627\u0645\u0627 \u0645\u0646 \u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u064a\u0643 \u0641\u0636\u0627\u064a \u06af\u0631\u062f \u0645\u0627\u0646\u0646\u062f \u0646\u0635\u0648\u064a\u0631 \u0628\u0631\u0627\u064a \u0642\u0631\u0627\u0631\u062f\u0627\u062f \u0634\u0645\u0639 \u0628\u06af\u0630\u0627\u0631\u064a\u062f \n \u0636\u0645\u0646 \u0627\u064a\u0646\u0643\u0647 \u062f\u0631 \u062d\u0645\u0644 \u0645\u064a\u0643\u064a \u0643\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f  \n \u0627\u064a\u0646 \u0643\u064a\u0643 \u0628\u0631\u0627\u064a \u062a\u0648\u0644\u062f \u0628\u0648\u062f \n \u0643\u064a\u0643\u064a \u062f\u064a\u06af\u0631\u064a \u062e\u0631\u064a\u062f\u064a\u0645 \u0648 \u0627\u064a\u0646 \u0643\u064a\u0643 \u0631\u0627 \u0643\u0646\u0627\u0631 \u06af\u0630\u0627\u0634\u062a\u064a\u0645 \n \u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u064a\u0643 \u0647\u0627 \u062a\u0627\u0643\u064a\u062f \u0643\u0646\u064a\u062f \u0627\u064a\u0646\u0647\u0627 \u0643\u064a\u0643 \u0647\u0633\u062a\u0646 \u063a\u0630\u0627 \u0646\u064a\u0633\u062a\u0646 \n", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0635\u0648\u0631\u062a\u06cc", "\u0634\u0645\u0639 \u0633\u06cc\u0628\u06cc\u0644", -1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u0649 \u0644\u0642\u0645\u0647 \u0627\u0649 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u0649 \u0639\u0627\u062f\u0649 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f!!!! \u0627\u0632 \u0647\u0645 \u067e\u0627\u0634\u064a\u062f\u0647 \u0628\u0648\u062f \u0637\u0628\u0642\u0647 \u0649 \u067e\u0627\u064a\u064a\u0646\u0649 \u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627! \u0643\u0627\u0634 \u0645\u0649 \u0634\u062f \u0639\u0643\u0633\u0649 \u0643\u0647 \u06af\u0631\u0641\u062a\u0645 \u0631\u0648 \u0627\u0631\u0633\u0627\u0644 \u0643\u0646\u0645 \u0628\u0631\u0627\u062a\u0648\u0646!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062e\u0627\u0645\u0647 \u0647\u0627\u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0627\u0632 \u0647\u0645 \u067e\u0627\u0634\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644 \u0648 \u0638\u0627\u0647\u0631 \u0628\u062f\u06cc \u062f\u0627\u0634\u062a!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0627\u06cc \u062c\u062f\u0627 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c \u0627\u0644\u0628\u062a\u0647 \u0622\u0644\u0645\u0627\u0646\u06cc \u0648 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9\u0645 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0627 \u0633\u0631\u0639\u062a\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u062f\u0648\u0631 \u0627\u0632 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u0628\u0648\u062f \n\u0627\u0632 \u0647\u0645\u0647 \u0686\u06cc \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0648\u0686\u06a9", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u06af\u0631\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 2 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u062d\u062f\u0648\u062f \u0663\u0660 \u0639\u062f\u062f \u0648\u0644\u064a \u0661\u0667 \u062a\u0627 \u0628\u0648\u062f!!!!!!\u0648 \u0648\u0627\u0642\u0639\u0627 \u0632\u0634\u062a\u0647 !!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u06cc\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 30 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u0647\u0631\u062f\u0648\u062a\u0627 \u0633\u0641\u0627\u0631\u0634\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f\u0645\u0632\u0647 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f \u0631\u062f\u0648\u0644\u0648\u062a \u06a9\u0647 \u0645\u0632\u0647 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0645\u06cc\u062f\u0627\u062f \u063a\u06cc\u0631 \u0627\u0632 \u0631\u062f\u0648\u0644\u0648\u062a \u0645\u0646 \u062a\u0627\u0628\u062d\u0627\u0644 \u062b\u0628\u062a \u0646\u0638\u0631 \u0646\u06a9\u0631\u062f\u0645 \u062a\u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648\u0644\u06cc \u0627\u06cc\u0646\u0628\u0627\u0631 \u0648\u0627\u0642\u0639\u0627 \u0628\u062e\u0627\u0637\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u0633\u0627\u06cc\u0631 \u062f\u0648\u0633\u062a\u0627\u0646 \u0627\u0634\u062a\u0628\u0627\u0647 \u0646\u06a9\u0646\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", -1]}
{"text": ["\u0643\u064a\u0643 \u0643\u0627\u0645\u0644\u0627 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0643\u0647 \u0645\u0648\u0646\u062f\u0647 \u0627\u0633\u062a \u0648 \u0627\u0633\u0646\u067e \u0627\u0643\u0633\u067e\u0631\u0633 \u0647\u0645 \u0643\u064a\u0643 \u0631\u0648 \u0643\u062c \u0643\u0631\u062f\u0647 \u0628\u0648\u062f \u062a\u0648 \u0631\u0627\u0647 \u0648 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u0646\u0627\u0646 \u0627\u0647\u0631\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc \u0628\u0648\u062f \u06a9\u0627\u0634 \u062a\u0648 \u0645\u0634\u062e\u0635\u0627\u062a\u0634 \u0630\u06a9\u0631 \u0645\u06cc\u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0627\u0647\u0631\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u0647\u0627\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u062f\u0631 \u062d\u0642\u06cc\u0642\u062a \u062e\u06cc\u0644\u06cc \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u0646\u06cc\u0632 \u0628\u0648\u06cc \u062a\u062e\u0645 \u0645\u0631\u0639 \u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0648\u0686\u06a9", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0646\u062c\u0631\u0647 \u0627\u06cc \u06af\u0644 (\u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0627\u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. \u0622\u0633\u06cc\u0628 \u062e\u0648\u0631\u062f\u0647 \u0648 \u0627\u0632 \u0648\u0633\u0637 \u0646\u0635\u0641 \u0634\u062f\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u062f\u0648\u0644\u0648\u062a \u0647\u0645 \u062e\u0627\u0645\u0647 \u0645\u062e\u0635\u0648\u0635 \u0646\u062f\u0627\u0634\u062a \u0648 \u0641\u0642\u0637 \u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u06a9\u0627\u0634 \u06cc\u06a9 \u06af\u0632\u06cc\u0646\u0647 \u0627\u0646\u062a\u062e\u0627\u0628\u06cc \u0647\u0645 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u0648\u062f \u0645\u062b\u0644\u0627 \u062f\u0648 \u0639\u062f\u062f \u0627\u0632 \u0647\u0631 \u0646\u0645\u0648\u0646\u0647 .......\u0648\u0632\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0628\u0631\u0627\u06cc \u062e\u0627\u0646\u0648\u0627\u062f\u0647 \u06a9\u0645 \u062c\u0645\u0639\u06cc\u062a \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0627\u0644\u0628\u062a\u0647 \u062e\u0648\u0634\u0628\u062e\u062a\u0627\u0646\u0647 \u0627\u06cc\u0646\u062c\u0627 \u06af\u0632\u06cc\u0646\u0647 \u0646\u06cc\u0645 \u0647\u0645 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u06cc\u0646\u06cc \u0628\u0631\u06af\u0631 \u067e\u0646\u06cc\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0633\u0631\u06cc\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u0631\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0627\u0645\u0634 \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0632\u06cc\u06cc\u0646 \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\n\u0648 \u0645\u06cc\u0648\u0647 \u0647\u0627\u06cc \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646\u06cc \u0628\u0631\u062e\u0648\u0631\u062f\u0627\u0631 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u067e\u06cc\u06a9 \u0631\u0648 \u062a\u0634\u0648\u06cc\u0642 \u06a9\u0646\u06cc\u062f . \u06a9\u0627\u0631 \u0628\u0644\u062f \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u062d\u062f\u0648\u062f  \u0645\u062a\u0631\u06cc \u0627\u0635\u0644\u0647 \u0642\u0646\u0627\u062f\u06cc \u0628\u0627 \u0645\u0646\u0632\u0644\u060c \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0648  \u062f\u0642\u06cc\u0642\u0647 \u0628\u0639\u062f \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0633\u0641\u0627\u0631\u0634\u0645 \u0631\u0633\u06cc\u062f.\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0628\u0627\u0642\u0644\u0648\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646.\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9\u062a\u0648\u0646 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0645\u0648\u062f\u0628\u0627\u0646\u0647 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u0649 \u0648 \u0633\u0631\u0648\u064a\u0633 \u0627\u0633\u0646\u067e \u0639\u0627\u0644\u064a\u062a\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u063a\u064a\u064a\u0631 \u0641\u0627\u0643\u062a\u0648\u0631 \u0627\u0632 \u062c\u0627\u0646\u0628 \u0627\u0633\u0646\u067e \u0641\u0648\u062f\n\u0628\u0627 \u0645\u0646 \u062a\u0644\u0641\u0646\u064a \u0686\u064a\u0632\u0643\u064a\u0643 \u0645\u064a\u0648\u0647 \u0647\u0627\u064a \u062c\u0646\u06af\u0644\u064a \u0686\u0643 \u0643\u0631\u062f\u0646\u062f \u0686\u0648\u0646 \u0686\u064a\u0632\u0643\u064a\u0643 \u0646\u064a\u0648\u064a\u0648\u0631\u0643\u064a \u062a\u0645\u0648\u0645 \u0643\u0631\u062f\u0646\u062f \u0648\u0644\u064a \u0628\u0631\u0627\u0645 \u0643\u064a\u0643 \u0633\u064a\u0628 \u0622\u0648\u0631\u062f\u0646\u062f \u0643\u0647 \u0627\u0635\u0644\u0627\u064b \u062e\u0648\u0634\u062d\u0627\u0644\u0645 \u0646\u0643\u0631\u062f \u0645\u0646 \u0663 \u062a\u0627 \u0686\u064a\u0632\u0643\u064a\u0643 \u0645\u064a\u062e\u0648\u0627\u0633\u062a\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062d\u0644\u0648\u0627 \u062e\u0631\u0645\u0627 \u0645\u06cc\u06a9\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u062e\u0648\u0628\u0647 \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0622\u0646\u0644\u0627\u06cc\u0646\u060c \u0686\u06cc\u062f\u0645\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0628\u0647 \u0647\u06cc\u0686 \u0639\u0646\u0648\u0627\u0646 \u0628\u0631\u0627\u0632\u0646\u062f\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0645\u0639\u062a\u0628\u0631\u06cc \u0645\u062b\u0644 \u0646\u0627\u062a\u0644\u06cc \u0646\u06cc\u0633\u062a.\n\u0644\u0637\u0641\u0627 \u062f\u0631 \u0686\u06cc\u062f\u0646 \u0627\u0648\u0646\u0647\u0627 \u062f\u0642\u062a \u0648 \u0633\u0644\u06cc\u0642\u0647 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u0647 \u062e\u0631\u062c \u0628\u062f\u06cc\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 1 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0643 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0641\u0627\u0642\u062f \u0643\u064a\u0641\u064a\u062a \u0628\u0648\u062f.\u0644\u0637\u0641\u0627 \u0628\u0631\u0631\u0633\u064a \u0648 \u0633\u0631\u064a\u0639\u0627 \u0631\u0641\u0639 \u0623\u0634\u0643\u0627\u0644 \u0628\u0641\u0631\u0645\u0627\u064a\u064a\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0627\u0648\u0646\u0642\u062f\u0631\u0627\u0647\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\n\u0648\u0628\u0647 \u0646\u0638\u0631\u0645 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u0628\u0627\u06cc\u062f \u0627\u0646\u0642\u062f \u0633\u0641\u062a \u0628\u0627\u0634\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0628\u0633\u064a\u0627\u0631 \u0628\u0633\u064a\u0627\u0631 \u067e\u0627\u064a\u064a\u0646 \u0645\u0639\u0644\u0648\u0645 \u0646\u064a\u0633\u062a \u0645\u0627\u0644 \u0686\u0646\u062f \u0631\u0648\u0632 \u067e\u064a\u0634 \u0628\u0648\u062f \u0634\u064a\u0631\u064a\u0646\u064a \u062f\u0631\u0633\u062a\u0647 \u0627\u0646\u062a\u0631\u0646\u062a\u064a \u0633\u0641\u0627\u0631\u0634 \u0645\u064a \u062f\u064a\u0645 \u0648\u0644\u064a \u0644\u0637\u0641\u0627 \u062a\u0627\u0632\u0647 \u0627\u0631\u0633\u0627\u0644 \u0643\u0646\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0627 \u0631\u0633\u062a\u0648\u0631\u0627\u0646 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646\u062f \u0648 \u06af\u0641\u062a\u0646\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0647\u0633\u062a. \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0648\u0644\u06cc\u0646 \u0648 \u0622\u062e\u0631\u06cc\u0646 \u0628\u0627\u0631\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062f\u06cc\u06af\u0647 \u0627\u0632 \u0627\u06cc\u0646\u062c\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 . \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f . \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0631\u0648\u0634 \u06a9\u0627\u0645\u0644 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645\u0647 \u06af\u06cc\u0644\u0627\u0633\u0627\u0634 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u062a\u0648 \u062c\u0639\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0645\u0646 \u062f\u06cc\u06af\u0647 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0627\u0632 \u0634\u0645\u0627 \u06a9\u06cc\u06a9 \u0646\u0645\u06cc \u06af\u06cc\u0631\u0645! \u0627\u06cc\u0646\u0647\u0645\u0647 \u062a\u0648 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a\u0645 \u0646\u0648\u0634\u062a\u0645 \u062d\u062a\u0645\u0627\u0627\u0627 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0647 \u0627\u06af\u0647 \u067e\u062e\u062a \u0627\u0645\u0631\u0648\u0632 \u0646\u06cc\u0633\u062a \u0644\u0637\u0641\u0627 \u0628\u0627 \u0637\u0639\u0645 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u062c\u0627\u0628\u062c\u0627 \u06a9\u0646\u06cc\u062f \u062d\u062a\u06cc \u062d\u0627\u0636\u0631 \u0628\u0648\u062f\u0645 \u0645\u0627\u0628\u0647 \u062a\u0641\u0627\u0648\u062a \u0647\u0645 \u0628\u062f\u0645 \u0627\u0648\u0646\u0648\u0642\u062a \u06cc\u0647 \u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u062d\u062a\u06cc \u0645\u0637\u0645\u0626\u0646\u0645 \u0645\u0627\u0644 \u062f\u06cc\u0631\u0648\u0632 \u0647\u0645 \u0646\u0628\u0648\u062f\u0647 \u0627\u0648\u0646\u0642\u062f \u06a9\u0647 \u0637\u0639\u0645\u0634 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f! \u0645\u0646 \u0641\u0642\u0637 \u0628\u0627\u0647\u0627\u0634 \u062a\u0648\u0646\u0633\u062a\u0645 \u0639\u06a9\u0633 \u0628\u06af\u06cc\u0631\u0645 \u0686\u0648\u0646 \u0641\u0642\u0637 \u0628\u0647 \u062f\u0631\u062f \u062f\u0648\u0631 \u0627\u0646\u062f\u0627\u062e\u062a\u0646 \u0645\u06cc \u062e\u0648\u0631\u062f!\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 6", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0631\u0641\u062a\u0627\u0631 \u067e\u064a\u0643 \u0628\u0633\u064a\u0627\u0631 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0648 \u0628\u0633\u062a\u0647 \u0631\u0648 \u062a\u062d\u0648\u064a\u0644 \u0633\u0648\u0644\u064a\u062f\u0627\u0631\u064a\u062a\u064a \u062f\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u062c\u0639\u0628\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0633\u064a\u0627\u0631 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u06af\u0648\u064a\u0627 \u0632\u0645\u064a\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u064a \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u0631\u0631\u0631\u0631\u0645\u0686\u064a\u062f\u0645\u0627\u0646 \u0648 \u062a\u0646\u0648\u0639 \u0639\u0627\u0644\u064a \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0641\u0642\u0637 \u06a9\u0646\u0627\u0631 \u06a9\u06cc\u06a9 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u060c \u0627\u0646\u06af\u0627\u0631 \u06a9\u0647 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u062a\u0631\u0645\u0632 \u0634\u062f\u06cc\u062f\u06cc \u06a9\u0631\u062f\u0647 \u0628\u0627\u0634\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u0646\u0627\u0646 \u0648\u067e\u0646\u06cc\u0631 \u06cc\u0627 \u06a9\u0631\u0648\u0633\u0627\u0646 \u0646\u0648\u0646 \u062e\u0627\u0644\u06cc\u061f! \u0648\u0627\u0642\u0639\u0627 \u0686\u06cc\u0632\u06cc \u0628\u0647 \u0627\u0633\u0645 \u0646\u0648\u0646 \u0648 \u067e\u0646\u06cc\u0631 \u062a\u0648\u0634 \u0646\u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0645 \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f\u0647 . \u0627\u06cc\u0646 \u0686\u0646\u062f\u0645\u06cc\u0646 \u0628\u0627\u0631\u0647 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc  \u0633\u062d\u0631 \u0633\u0641\u0627\u0631\u0634 \u062a\u0627\u0632\u0647 \u0627\u0631\u0633\u0627\u0644 \u0646\u0645\u06cc\u06a9\u0646\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u067e\u0631 \u0633\u06cc\u0627\u0647", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u0645...\u0628\u0631\u0628\u0631\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u0631\u063a \u0648 \u0642\u0627\u0631\u0686", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0639\u0627\u0627\u0627\u0627\u0644\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0639\u0627\u0644\u06cc\u0647 \u0627\u0645\u0627 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062f\u0631 \u0645\u0642\u0627\u06cc\u0633\u0647 \u0628\u0627 \u0634\u0639\u0628\u0647 \u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u0628\u0647 \u0634\u06a9\u0644 \u0642\u0627\u0628\u0644 \u062a\u0648\u062c\u0647\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0633\u0627\u062f\u0647", 1]}
{"text": ["\u06af\u0631\u0645 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0627\u064a\u0646\u0642\u062f\u0631 \u062f\u0631\u0647\u0645 \u0628\u0631\u0647\u0645 \u0634\u062f\u0647 \u0643\u0647 \u062f\u064a\u06af\u0647 \u0646\u0645\u064a\u0634\u0647 \u062c\u0644\u0648\u064a \u0643\u0633\u064a \u06af\u0630\u0627\u0634\u062a\n\u0627\u064a\u0646 \u0686\u0647 \u0648\u0636\u0639\u0647 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 24 \u0639\u062f\u062f)", -1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u062d\u062f\u0627\u0642\u0644 \u062f\u0648 \u0631\u0648\u0632 \u0627\u0632 \u067e\u062e\u062a \u0622\u0646 \u0645\u06cc\u06af\u0630\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u062f \u0631\u0633\u06cc\u062f\u0647 \u0628\u0648\u062f \u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646 \u0647\u0627 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0631\u0648\u06cc \u0647\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u0631\u06cc\u0633 \u0628\u0631\u0633\u062a \u0628\u0627\u062f\u0627\u0645", -1]}
{"text": ["\u0633\u0631\u06cc\u0639 \u0627\u0648\u0645\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062d\u062c\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u0647\u0627 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u06a9\u0645 \u0628\u0648\u062f \u0648\u0644\u06cc \u06a9\u06cc\u0641\u062a\u0647 \u0634\u06cc\u0631\u06cc\u0646\u0647\u0627 \u0648 \u0645\u0632\u0634\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u067e\u0631\u0633\u0646\u0644 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0628\u0633\u062a\u0647 \u0631\u0648 \u0631\u0633\u0648\u0646\u062f\u0646 \u0627\u0632\u0634\u0648\u0646 \u0645\u0645\u0646\u0648\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0645\u0646\u0627\u0633\u0628 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0639\u06a9\u0633 \u0628\u0627\u06cc\u062f \u0648\u0627\u0642\u0639\u06cc\u062a \u0631\u0648 \u0646\u0634\u0648\u0646 \u0628\u062f\u0647 \u0627\u0632 \u0646\u0638\u0631 \u0633\u0627\u06cc\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0632 \u0632\u0627\u0648\u06cc\u0647 \u0627\u06cc \u06af\u0631\u0641\u062a\u0647 \u0628\u0634\u0647 \u06a9\u0647 \u0628\u06cc\u0646\u0646\u062f\u0647 \u0631\u0648 \u062f\u0686\u0627\u0631 \u062e\u0637\u0627 \u06a9\u0646\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0646\u0633\u0628\u062a \u0628\u0647 \u062d\u062c\u0645 \u06a9\u06cc\u06a9 \u0648\u0627\u0642\u0639\u0627\u064b \u0628\u0627\u0644\u0627 \u0628\u0648\u062f\u0634 . \u062f\u0631 \u0636\u0645\u0646 \u0628\u0631\u0627\u0646\u06cc \u0627\u0631\u0633\u0627\u0644\u06cc \u0627\u0635\u0644\u0627\u064b \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f\u0634.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0628\u0647 \u062e\u0635\u0648\u0635 \u0627\u06cc\u0646 \u06a9\u0647 \u067e\u0627\u06cc\u0647 \u06a9\u0627\u0631 \u06a9\u06cc\u06a9 \u0628\u0648\u062f \u0648 \u0646\u0647 \u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u0641\u0634\u0631\u062f\u0647. \u0686\u0648\u0646 \u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u0641\u0634\u0631\u062f\u0647 \u0632\u0645\u0627\u0646 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u0631\u0627\u06cc \u0627\u0633\u062a\u062d\u06a9\u0627\u0645 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0646 \u0645\u06cc \u062e\u0648\u0627\u062f \u0648 \u0627\u06cc\u0646 \u0628\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0647\u0645\u0627\u0647\u0646\u06af \u0646\u06cc\u0633\u062a. \u0633\u067e\u0627\u0633 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0643\u0648\u0686\u064a\u0643 \u0628\u0648\u062f \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u0634 \u0634\u0627\u064a\u062f \u0627\u0646\u062f\u0627\u0632\u0647 \u062f\u0648 \u0628\u0646\u062f\u0647 \u0627\u0646\u06af\u0634\u062a \u0648 \u0627\u0635\u0627 \u0646\u0645\u064a \u0627\u0631\u0632\u064a\u062f \u0628\u0647 \u0646\u0633\u0628\u062a \u0642\u064a\u0645\u062a ! \u062d\u062a\u064a \u0686\u064a\u0632 \u0643\u064a\u0643 \u0647\u0627\u064a \u064a\u062e\u0686\u0627\u0644\u064a\u0634! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0643\u0631\u0627\u0633\u0627\u0646 \u0648 \u0646\u0627\u0646 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0628\u064a\u0627\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0645\u0631\u0628\u0627 \u0642\u06cc\u0635\u06cc \u0632\u0631\u062f\u0627\u0644\u0648 \u06a9\u0648\u0686\u06a9", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u0628\u0632\u0631\u06af", "\u0645\u0627\u0644\u062a\u06cc \u0633\u06cc\u0631\u06cc\u0627\u0644 \u0644\u0648\u0641", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc\u060c \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u067e\u06cc\u06a9 \u0628\u0627\u0627\u062f\u0628\u0634\u0648\u0646... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0627\u0628\u0639\u0627\u062f \u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0633\u064a\u0627\u0631 \u0643\u0648\u0686\u0643 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06cc\u0647 \u06a9\u0645 \u0642\u06cc\u0645\u062a\u200c\u0647\u0627 \u0628\u0627\u0644\u0627 \u0628\u0648\u062f\n\u0627\u0645\u0627 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 1", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u06a9\u06cc\u06a9\u0634. \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u0648 \u062f\u0631 \u0628\u0639\u0636\u06cc \u0642\u0633\u0645\u062a\u0647\u0627  \u062e\u0627\u0645\u0647 \u0627\u0646 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062f\u0631 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u064a\u0646 \u0664\u0645\u062f\u0644 \u0645\u062e\u062a\u0644\u0641 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u0649 \u0648 \u0648\u0642\u062a\u0649 \u0627\u0631\u0633\u0627\u0644 \u0643\u0631\u062f\u064a\u0646 \u0664\u0639\u062f\u062f \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u0649 \u0633\u0627\u062f\u0647 \u0628\u0648\u062f \u0648\u0628\u0642\u064a\u0647 \u0643\u0647 \u062f\u0631 \u062d\u062f\u0648\u062f \u0668-\u0669 \u062a\u0627 \u0628\u0648\u062f \u062a\u0645\u0627\u0645 \u0634\u0643\u0644\u0627\u062a\u0649 \u0628\u0648\u062f!!! \u064a\u0639\u0646\u0649 \u0643\u0627\u0645\u0644\u0627\u064b \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0686\u064a\u0632\u0649 \u0643\u0647 \u0641\u0631\u0648\u0634 \u0646\u0631\u0641\u062a\u0647 \u0631\u0648 \u062e\u064a\u0644\u0649 \u0628\u064a\u0634\u062a\u0631 \u06af\u0630\u0627\u0634\u062a\u064a\u0646...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u064a\u0644\u0649 \u0639\u0627\u0644\u0649 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0630\u0647 \u062d\u062a\u0645\u0627 \u067e\u064a\u0634\u0646\u0647\u0627\u062f \u0645\u064a\u0634\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 ..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc 650 \u06af\u0631\u0645", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u062f\u0627 \u0628\u0647 \u06a9\u0627\u0631\u062a\u0627\u0646 \u0628\u0631\u06a9\u062a \u062f\u0647\u062f...\u0645\u0627 \u06a9\u0647 \u0686\u0647\u0627\u0631\u0645\u06cc\u0646 \u0628\u0627\u0631\u0627\u0633\u062a \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0647\u06cc\u0645 \u0648 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062f\u0648 \u062c\u0639\u0628\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0628\u062a\u062f\u0627 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f \u0648 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0641\u0631\u0627\u0645\u0648\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0627\u0644\u0628\u062a\u0647 \u0628\u0639\u062f \u0627\u0632 \u062a\u0645\u0627\u0633 \u0648 \u0627\u0637\u0644\u0627\u0639 \u0631\u0633\u0627\u0646\u06cc\u060c \u0628\u062f\u0648\u0646 \u0647\u06cc\u0686 \u0645\u0634\u06a9\u0644\u06cc \u062c\u0639\u0628\u0647 \u062f\u0648\u0645 \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 1.100 \u06af\u0631\u0645\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9\u200c\u062e\u0634\u06a9\u200c\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0648 \u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c \u0627\u0646\u06af\u0627\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u0646\u062f \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0648\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0628\u0627\u06a9\u06cc\u0641\u06cc\u062a \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 650 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628\u060c \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc \u067e\u0633\u062a\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 30 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0648 \u062a\u0648 \u06cc\u0647 \u062c\u0639\u0628\u0647 \u0642\u0631\u0627\u0631 \u0645\u06cc \u062f\u0627\u062f\u06cc\u0646 \u0686\u0631\u0627 \u06f4 \u062a\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0643\u0631 \u0645\u064a\u0643\u0631\u062f\u0645 \u0648\u0642\u062a\u064a \u062c\u0627\u064a\u064a \u0627\u0633\u0645 \u062e\u0648\u062f \u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0631\u0648\u0634\u064a \u0631\u0648 \u0631\u0648\u064a \u0643\u064a\u0643\u0634 \u0645\u064a\u0630\u0627\u0631\u0647 \u064a\u0639\u0646\u064a \u0628\u0647\u062a\u0631\u064a\u0646 \u0643\u064a\u0643\u0634 \u0628\u0627\u064a\u062f \u0628\u0627\u0634\u0647 \u060c \u0648\u0644\u064a \u064a\u0647 \u0643\u064a\u0643 \u0633\u0627\u062f\u0647 \u0643\u0647 \u0646\u0647 \u0645\u063a\u0632 \u062f\u0627\u0634\u062a \u062f\u0627\u062e\u0644\u0634 \u0646\u0647 \u0645\u0648\u0632 \u062f\u0627\u0634\u062a \u060c \u0633\u0627\u062f\u0647 \u0633\u0627\u062f\u0647 \u0628\u0627 \u062e\u0627\u0645\u0647 \u0634\u0643\u0644\u0627\u062a\u064a\u060c ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0627\u0627\u0627\u0645\n\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f \u060c \u0628\u0631 \u062e\u0644\u0627\u0641 \u062e\u06cc\u0644\u06cc \u0627\u0632 \u0631\u062f\u0648\u0644\u0648\u062a\u0627 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u0646 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0647\u0645\u0647 \u0686\u06cc\u0632\u0634 \u062e\u0648\u0628 \u0648 \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0648\u062f \n\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \n\u0648 \u0633\u0627\u0644\u0645 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \n\u0645\u0645\u0646\u0648\u0646 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u062e\u062a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0633\u0631\u0647\u0627 \u0628\u0634\u062f\u062a \u0645\u0632\u0647 \u0627\u0633\u0627\u0646\u0633 \u0648 \u0637\u0639\u0645 \u062f\u0647\u0646\u062f\u0647 \u062f\u0627\u0634\u062a \u0648 \u0628\u0627\u0641\u062a \u067e\u0641\u06a9\u06cc \u06a9\u0647 \u0646\u0634\u0648\u0646 \u0645\u06cc\u062f\u0627\u062f \u0645\u0648\u0646\u062f\u0647 \u0647\u0633\u062a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u0627\u0646\u0628\u0647 \u06cc\u06a9 \u0639\u062f\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0633\u0644\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u062a\u062e\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u0639\u062f\u062f", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632\u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u0631\u0627\u0628\u06cc\u0647 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u062d\u0644\u0648\u0627 \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f \u0648 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u06a9\u0647 \u06a9\u0647\u0646\u0647 \u0627\u0633\u062a.\n\u067e\u06cc\u0634 \u0627\u0632 \u0622\u0646\u06a9\u0647 \u0631\u0627\u0646\u0646\u062f\u0647 \u0632\u0646\u06af \u062f\u0631 \u0631\u0627 \u0628\u0632\u0646\u062f \u0627\u0632 \u0631\u0648\u06cc \u0646\u0642\u0634\u0647 \u062f\u06cc\u062f\u0645 \u06a9\u0647 \u062f\u0645 \u062f\u0631 \u0631\u0633\u06cc\u062f\u0647 \u0648\u0642\u062a\u06cc \u0628\u0631\u0627\u06cc \u062a\u062d\u0648\u06cc\u0644 \u0628\u0633\u062a\u0647 \u062e\u0648\u062f \u0631\u0641\u062a\u0645 \u062f\u06cc\u062f\u0645 \u0631\u0627\u0646\u0646\u062f\u0647 \u062f\u0631 \u062d\u0627\u0644 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0646 \u0628\u0633\u062a\u0647 \u0627\u0633\u062a. \u0648\u0642\u062a\u06cc \u0639\u0644\u062a \u0631\u0627 \u062c\u0648\u06cc\u0627 \u0634\u062f\u0645 \u06af\u0641\u062a \u0627\u0632 \u062f\u0633\u062a \u0628\u0647 \u0632\u0645\u06cc\u0646 \u0627\u0641\u062a\u0627\u062f\u0647 \u0648 \u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u0628\u06cc\u0646\u0645 \u062e\u0631\u0627\u0628 \u0646\u0634\u062f\u0647 \u0628\u0627\u0634\u062f.\u06a9\u0647 \u0627\u06cc\u0646 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u06f2\u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0641\u062a\u0647 \u0628\u0648\u062f\u0645 \u06cc\u0647 \u0646\u0648\u0639 \u0627\u0648\u0631\u062f\u0646 \n\u0627\u0645\u0627 \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u062f\u0633\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0631\u0648\u0644\u062a\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645 \u062a\u0639\u062f\u0627\u062f \u06f1\u06f2 \u0639\u062f\u062f \u0628\u0648\u062f \u0646\u0647 \u06f2\u06f0 \u0639\u062f\u062f \u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u0641\u0642\u0637 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0627\u0631\u0633\u0627\u0644 \u0646\u06a9\u0631\u062f\u0646 . \u0686\u0648\u0646 \u0645\u0627 \u062f\u0631 \u0645\u062d\u0644 \u06a9\u0627\u0631 \u0628\u0627\u06cc\u062f \u0641\u0627\u06a9\u062a\u0648\u0631 \u0627\u0631\u0627\u06cc\u0647 \u0628\u062f\u06cc\u0645 . \u0648\u0642\u062a\u06cc \u0627\u0632 \u0631\u0633\u062a\u0648\u0631\u0627\u0646\u0647\u0627 \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u06cc\u0645 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u0634\u0647 \u0648\u0644\u06cc \u0627\u06cc\u0646\u062c\u0627 \u0646\u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u0698\u0644\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u062f\u0648\u0633\u062a\u0645\u0648\u0646 \u0631\u0648 \u0633\u0648\u067e\u0631\u0627\u06cc\u0632 \u06a9\u0631\u062f\u06cc\u0645 \u060c \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0634\u0627\u062f\u06cc \u0645\u0627 \u0631\u0648 \u0634\u06cc\u0631\u06cc\u0646 \u06a9\u0631\u062f\u06cc\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0641\u06a9\u0646\u0645 \u067e\u06cc\u06a9 \u0628\u0627 \u06a9\u06cc\u06a9 \u06a9\u0634\u062a\u06cc \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f \u0647\u0645\u0647 \u062a\u0632\u06cc\u06cc\u0646 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644\u0627\u062a\u0647\u0627\u06cc \u062f\u0648\u0631\u0634 \u0634\u06a9\u0633\u062a\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0634\u06cc\u0631\u0646\u06cc \u06af\u0631\u0641\u062a\u0645 \u0647\u0645\u0634 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 ", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0646 \u0628\u06cc\u0634 \u0627\u0632 \u06f8\u0628\u0627\u0631\u0647 \u0627\u0632\u06cc\u0646 \u0634\u0639\u0628\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u06f6 \u0628\u0648\u062f\u0647 \u06cc\u0647\u0648 \u06a9\u0631\u062f\u06cc\u062f \u06f1\u06f2\u062a\u0648\u0645\u0627\u0646!!! ", "\u062a\u0631 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648 \u06a9\u06cc\u06a9 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645 \u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u0639\u06a9\u0633 \u062f\u0641\u0639\u0627\u062a \u0642\u0628\u0644\u06cc \u060c \u0627\u06cc\u0646\u0628\u0627\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0646\u0648\u0646 \u0632\u06cc\u0631\u0634 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0641\u062a \u0648 \u0645\u06cc\u0648\u0647\u200c\u0647\u0627\u06cc \u067e\u0644\u0627\u0633\u06cc\u062f\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647 .. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u062a\u0644 \u0641\u0646\u062c\u0648\u0646\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0635\u0644\u0627\u200c\u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u0648 \u0639\u06a9\u0633\u0647 \u0646\u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0645\u0632\u0647 \u06cc \u0647\u0644 \u0645\u06cc\u062f\u0627\u062f \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0645\u062a\u0644\u0627\u0634\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u062c\u0628\u0648\u0631 \u0628\u0647 \u062a\u0647\u06cc\u0647 \u06a9\u06cc\u06a9 \u062f\u06cc\u06af\u0631\u06cc \u0628\u0631\u0627\u06cc \u0645\u0631\u0627\u0633\u0645 \u0634\u062f\u0645\n\u0647\u0645\u0686\u0646\u06cc\u0646 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u0628\u0627 \u0639\u06a9\u0633 \u0627\u0646\u062a\u062e\u0627\u0628\u06cc \u0645\u063a\u0627\u06cc\u0631\u062a \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u062a\u0644 \u062e\u0644\u0627\u0644 \u062f\u0627\u0631", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u067e\u06cc\u06a9 \u0647\u0645 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0644\u0627\u0645. \u062e\u0648\u0628 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0628\u0627\u0642\u0644\u0648\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u06cc\u0627\u062f \u0627\u0632 \u062d\u062f \u0646\u062f\u0627\u0634\u062a \u0648 \u0645\u0627 \u0644\u0630\u062a \u0628\u0631\u062f\u06cc\u0645.\u0646\u0627\u067e\u0644\u06cc\u0648\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u06cc\u0647 \u06a9\u0648\u0686\u0648\u0644\u0648 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u062a\u0631 \u0628\u0627\u0634\u0647 \u0639\u0627\u0644\u06cc \u0645\u06cc\u0634\u062e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", 1]}
{"text": ["\u0639\u0627\u0644\u0644\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc . \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0645\u0644 \u0645\u06cc\u06a9\u0646\u0647 \u0648 \u067e\u06cc\u06a9 \u0627\u0646\u067e \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u062f\u0642\u06cc\u0642 \u06a9\u0627\u0631\u0634 \u0631\u0648 \u0627\u0646\u062c\u0627\u0645\u200c\u0645\u06cc\u062f\u0647 . \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0628\u0631\u0627\u06cc \u0647\u0645\u06a9\u0627\u0631\u0627\u0646\u0645 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627 \u062d\u0627\u0644\u0627 \u0646\u0634\u062f\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u06cc \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0628\u06af\u06cc\u0631\u06cc\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0647 \u0628\u0627\u0634\u0647 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0645\u0631\u062a\u0628 \u0648 \u0633\u0631\u06cc\u0639 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0645\u0647\u200c\u0634 \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0628\u0648\u062f \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u062f\u0627\u0634\u062a \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0637\u0628\u0642 \u0627\u0648\u0646\u0686\u0647 \u062a\u0648\u06cc \u0639\u06a9\u0633 \u062f\u06cc\u062f\u0645 \u0627\u0646\u062a\u0638\u0627\u0631 \u0686\u0647\u0627\u0631 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06cc\u0644\u062f\u0627\u06cc\u06cc \u062f\u0627\u0634\u062a\u0645, \u0648\u0644\u06cc \u0627\u0634\u06a9\u0627\u0644 \u0646\u062f\u0627\u0631\u0647, \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u06a9\u0627\u0631\u0634 \u0647\u0645\u06cc\u0634\u0647 \u062f\u0631\u0633\u062a\u0647.. \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062e\u0635\u0648\u0635 \u06cc\u0644\u062f\u0627", 1]}
{"text": ["\u0646\u0627\u0646 \u0633\u062d\u0631 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u064a\u0647 \u062f\u0648\u0646\u0627\u062a \u0631\u0648 \u06af\u0631\u0645 \u0648 \u062f\u0627\u063a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0645\u064a\u0631\u0633\u0648\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0628\u0631\u0627\u0645 \u0627\u0648\u0645\u062f \u0628\u0627 \u0639\u06a9\u0633\u0634 \u06a9\u0627\u0645\u0644\u0627 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u0627\u0632 \u0646\u0638\u0631 \u0637\u0639\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0632 \u0646\u0638\u0631 \u0638\u0627\u0647\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", -1]}
{"text": ["\u0642\u06cc\u0645\u062a \u067e\u06cc\u06a9 \u0646\u0633\u0628\u062a \u0628 \u0645\u0633\u06cc\u0631 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u0627\u06cc\u0646 \u06a9\u0647 \u06f6 \u062a\u0627\u0633 \u0646\u0647 \u062d\u062f\u0648\u062f\u0627 \u062f\u0647 \u062a\u0627 \u0645\u0647\u0645 \u0646\u06cc\u0633 \u0686\u0648\u0646 \u0628\u0632\u0631\u06af \u0628\u0648\u062f\u0646 \u0648\u0644\u06cc \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u06cc\u0633\u062a:(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u060c \u0646\u0627\u0646 \u0633\u062d\u0631 \u06cc\u062f\u0648\u0646\u0647 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (1 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 \u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0645\u0639\u0637\u0644\u064a \u0632\u064a\u0627\u062f \u0628\u0647 \u062f\u0644\u064a\u0644 \u0646\u0627\u0642\u0635 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0633\u0641\u0627\u0631\u0634.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 12 \u0639\u062f\u062f)", "\u062a\u0633\u062a \u0633\u0648\u06cc\u062a\u0627\u0644", "\u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", -1]}
{"text": ["\u062a\u0633\u062a \u062e\u06cc\u0644\u06cc \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u062a\u0627 \u062f\u0633\u062a \u0632\u062f\u06cc\u0645 \u06a9\u0644\u0634 \u062e\u0648\u0631\u062f \u0634\u062f \u0634\u0647\u062f \u0633\u06cc\u062a\u0631\u0648\u0644 \u0647\u0645 \u0627\u0635\u0644\u0646 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u062c\u0648 \u062f\u0648\u0633\u0631", "\u0633\u06cc\u062a\u0631\u0648\u0644", -1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u0627\u0633\u0644\u0627\u06cc\u0633 \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062a\u0642\u0631\u06cc\u0628\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0633\u062d\u0631 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0639\u0627\u0644\u06cc....\u0628\u0627 \u062e\u0627\u0646\u0647 \u06cc \u0633\u0628\u06a9 \u0648 \u062a\u0627\u0632\u0647.....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f.\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.\u06a9\u0631\u0627\u0633\u0627\u0646 \u0628\u0627 \u0633\u0644\u06cc\u0642\u0645 \u062c\u0648\u0631 \u0646\u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", 1]}
{"text": ["\u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f . \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u06a9\u0645 \u062d\u062c\u0645\u0647 \u0648\u0644\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0642\u0634\u0646\u06af\u06cc \u062f\u0627\u0631\u0647 \u0628\u0631\u0627 \u0647\u062f\u06cc\u0647 \u062f\u0627\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0647\u0645 \u0628\u0631\u0646\u0627\u0645\u0647 \u0648 \u0647\u0645 \u062e\u0631\u06cc\u062f \u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062e\u0648\u062f \u06a9\u06cc\u06a9  \u0627\u0633\u0641\u0646\u062c\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u060c \u0628\u06cc\u0627\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0634\u06a9\u0644\u0627\u062a \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0645\u0627 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c \u062e\u0627\u0645\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u06cc\u0646\u06af", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0628\u0628\u06cc\u0646\u06cc\u062f \u062f\u0648\u0633\u062a\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0644\u0627 \u0641\u0627\u0632\u0634 \u0628\u0627 \u063a\u0630\u0627 \u0641\u0631\u0642 \u0645\u06cc\u06a9\u0646\u0647 \u0648 \u0628\u0627\u06cc\u062f \u0639\u0627\u0634\u0642 \u0628\u0627\u0634\u06cc \u062a\u0627 \u062f\u0631\u06a9 \u06a9\u0646\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06cc\u0639\u0646\u06cc \u0686\u06cc \n\u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u062d\u062f\u0648\u062f \u06f1\u06f0 \u0633\u0627\u0644\u06cc \u0647\u0633\u062a \u0628\u0627\u0632 \u0634\u062f\u0647 \n\u0645\u0648\u0627\u062f \u0628\u0633\u06cc\u0627\u0631 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a\u0647 \n\u06a9\u0644\u0627 \u062a\u0648\u0635\u06cc\u0647 \u0645\u0646 \u0628\u0647 \u0634\u0645\u0627 \u0639\u0632\u06cc\u0632\u0627\u0646 \u0627\u06cc\u0646\u0647 \u06a9\u0647 \u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0631\u0648 \u06f1\u06f5 \u062b\u0627\u0646\u06cc\u0647 \u0631\u0627\u062e\u0644 \u0645\u0627\u06cc\u06a9\u0631\u0648 \u0642\u0631\u0627\u0631 \u0628\u062f\u06cc\u062f \u062a\u0627 \u0644\u0630\u062a \u0628\u0628\u0631\u06cc\u062f \u0627\u0632 \u0622\u0628 \u0634\u062f\u0646 \u0634\u06a9\u0644\u0627\u062a \n\u0627\u06cc\u0646\u062c\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0633\u062a \u062a\u0642\u0631\u06cc\u0628\u0627 \u0647\u0645\u0647 \u0686\u06cc\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": [" \u0648\u0627\u0627\u0627\u0627\u06cc \u0637\u0639\u0645\u0634 \u0628\u0627 \u0647\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u062a\u0627 \u062d\u0627\u0644\u0627 \u062e\u0648\u0631\u062f\u0645 \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc \u06cc \u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647\u200c\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06af\u0631\u062f\u0648\u062a\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0639\u062f \u0686\u0646\u062f \u0631\u0648\u0632 \u0647\u0645\u0648\u0646\u062c\u0648\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0641\u0642\u0637 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0648\u0642\u0627\u062a \u0645\u0648\u062c\u0648\u062f\u06cc \u0647\u0627 \u0628\u0631\u0648\u0632 \u0646\u06cc\u0633\u062a \u062e\u0648\u0627\u0647\u0634\u0627 \u062f\u0631 \u0635\u0648\u0631\u062a \u0627\u062a\u0645\u0627\u0645  \u0645\u0648\u062c\u0648\u062f\u06cc \u062d\u062a\u0645\u0627 \u0628\u0644\u0627\u0641\u0627\u0635\u0644\u0647 \u0628\u0631\u0648\u0632 \u0631\u0633\u0627\u0646\u06cc \u06a9\u0646\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0628\u0633\u062a\u0646\u064a \u0633\u0646\u062a\u064a \u0637\u0639\u0645 \u062f\u0631\u062c\u0647 \u064a\u0643\u064a \u0646\u062f\u0627\u0634\u062a\n\u0643\u064a\u0643 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u064a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u0644\u0647 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0642\u062a\u064a \u067e\u064a\u0643 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u0648\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0633\u062a\u0646\u06cc \u0633\u0646\u062a\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f\u0646 \u0648 \u067e\u06cc\u06a9 \u0627\u0633\u067e\u0631\u0633 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f.  \u0627\u0645\u0627 \u0628\u0647\u062a\u0631 \u0647\u0633\u062a \u062f\u0631 \u0686\u06cc\u062f\u0645\u0627\u0646 \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0646 \u0645\u0648\u0644\u0627 \u0627\u06af\u0631 \u062f\u0648 \u0646\u0648\u0639 \u0631\u0648\u0644\u062a \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u0634\u0647 \u06f1\u06f0\u062a\u0627 \u06cc\u0647 \u0645\u062f\u0644 \u0648 \u062a\u0646\u0647\u0627 \u0633\u0647 \u0639\u062f\u062f \u0627\u0632 \u0645\u062f\u0644 \u062f\u06cc\u06af\u0647 \u0646\u0628\u0627\u0634\u0647 \u0648 \u0646\u0635\u0641 \u0646\u0635\u0641 \u0627\u0632 \u0647\u0631\u062f\u0648 \u062a\u0631\u06a9\u06cc\u0628 \u0686\u06cc\u062f\u0647 \u0628\u0634\u0647. \u0628\u0627 \u062a\u0634\u06a9\u0631.\u0627\u0632  \u0646\u06cc\u0634\u06a9\u0631 \u0647\u0631\u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0647\u0645 \u0628\u0631\u0637\u0631\u0641 \u0628\u0634\u0647 \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631 \u0647\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u062a\u0627\u0631\u062a \u0647\u0627 \u0634\u0643\u0633\u062a\u0647 \u0648 \u0644\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u064a\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06a9\u0648\u0686\u06a9) \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645\u0647 \u064a \u0634\u064a\u0631\u064a\u0646\u064a\u0647\u0627 \u0633\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648\u0647\u064a\u0686 \u062a\u0632\u0626\u064a\u0646\u064a \u0646\u062f\u0627\u0634\u062a\u0646 \u064a\u0643 \u0645\u0642\u062f\u0627\u0631 \u062c\u0630\u0627\u0628\u064a\u062a \u0628\u062f \u0646\u064a\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9\u062a\u0648\u0646 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\u060c \u062f\u0631 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0647\u0631 \u062c\u0639\u0628\u0647 12 \u062a\u0627 14 \u0639\u062f\u062f \u062f\u0631\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0631 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 1 \u0639\u062f\u062f \u062f\u0631 \u0647\u0631 \u062c\u0639\u0628\u0647 \u0642\u0631\u0627\u0631 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. ", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 650 \u06af\u0631\u0645", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0645\u064a\u0643\u0633 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0643\u0647 \u0628\u0633\u062a\u0647 \u0627\u064a \u0643\u0647 \u0628\u0631\u0627\u0645 \u0627\u0648\u0645\u062f \u0646\u0635\u0641\u0634 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0628\u0648\u062f \u0646\u0635\u0641\u0634 \u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u0627\u064a\u0647 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u064a!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0633\u0631\u0648\u06cc\u0633 \u0627\u06a9\u0633\u067e\u0631\u0633 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0635\u0648\u0631\u062a\u06cc", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631 \u0645\u0646 \u0647\u0632\u064a\u0646\u0647 \u064a \u067e\u064a\u0643 \u0646\u0633\u0628\u062a \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u062e\u064a\u0644\u064a \u0632\u064a\u0627\u062f\u0647 \u0644\u0637\u0641\u0627 \u0628\u0631\u0631\u0633\u064a \u0634\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u062a\u0632\u0627 \u06af\u0631\u062f 650 \u06af\u0631\u0645 (5 \u062a\u0627 7 \u0639\u062f\u062f)", "\u0628\u0633\u062a\u0646\u06cc \u0645\u06cc\u0648\u0647 \u0627\u06cc", 1]}
{"text": ["\u0646\u06cc\u0634\u06a9\u0631 \u0639\u0627\u0644\u06cc\u0647\n\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0686\u0631\u0627 \u06f6\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0627\u0646 \u0628\u0631\u0627\u06cc \u067e\u06cc\u06a9 \u0627\u0632 \u0627\u0639\u062a\u0628\u0627\u0631 \u06a9\u0645 \u0634\u062f \u0627\u0645\u0627 \u062f\u0631 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0647\u0645\u0631\u0627\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u061b \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644( \u0635\u0641\u0631) \u0645\u0646\u0638\u0648\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f\u061f\u061f!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628. \u0641\u0642\u0637 \u0627\u06af\u0647 \u0628\u0633\u062a\u0646\u06cc \u0633\u0646\u062a\u06cc \u062e\u0627\u0645\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u0639\u0627\u0644\u06cc \u0645\u06cc\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", "\u0628\u0633\u062a\u0646\u06cc \u0633\u0646\u062a\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c\u0646\u0627\u0646 \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647 \u06a9\u0647 \u0633\u0628\u062f\u0634 \u0627\u0632 \u0646\u0648\u0639 \u062e\u0648\u0631\u0627\u06a9\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c\u0631\u0648\u0644\u062a \u062e\u0648\u0628 \u0628\u0648\u062f\u060c\u067e\u06cc\u06a9 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0633\u0628\u062f \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062a\u062e\u0645\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0647 \u06cc\u0647 \u0637\u0631\u0641 \u062c\u0639\u0628\u0647 \u0627\u0648\u0645\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u06a9\u0627\u0645\u0644\u0627 \u062f\u0642\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646.\u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0645\u0648\u062f\u0628 \u0648 \u062e\u0648\u0634\u0631\u0648 \u0628\u0648\u062f.\u06a9\u06cc\u06a9 \u0647\u0645 \u0633\u0627\u0644\u0645 \u0631\u0633\u0648\u0646\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0645\u0648\u0632\u06cc\u06a9\u0627\u0644", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u06cc\u06a9 \u062c\u0639\u0628\u0647 \u06cc\u06a9 \u062f\u0648\u0646\u0647 \u06a9\u0645 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0648 \u0643\u064a\u0643 \u0643\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0631\u0633\u064a\u062f\n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc", 1]}
{"text": ["\u0634\u0645\u0639\u06cc \u06a9\u0647 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0646\u0628\u0648\u062f\u060c\u0648\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0645\u062f\u062a \u0632\u0645\u0627\u0646\u0634 \u0647\u0645 \u06a9\u0645 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0642\u062a\u06cc \u06a9\u06cc\u06a9\u0645 \u0631\u0648 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u0648 \u06a9\u0647 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u0641\u062a\u0647 \u0628\u0648\u062f \u06cc\u06a9 \u0633\u0645\u062a \u062c\u0639\u0628\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0634\u06a9\u0644\u062f\u0627\u0631", "\u0628\u0627\u062f\u06a9\u0646\u06a9", -1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648 \u0645\u062b\u0644\u062b\u06cc \u0646\u0628\u0648\u062f \u0648 \u06af\u0631\u062f \u0628\u0648\u062f \u0648 \u0646\u0633\u0628\u062a \u0628\u0647 \u0639\u06a9\u0633 \u062e\u06cc\u0644\u06cc \u0641\u0631\u0642 \u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u0646\u0641\u0631\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0634\u0627\u062a\u0648\u062a\u06cc \u0641\u0631\u0633\u062a\u0627\u0646\u062f \u0628\u062c\u0627\u06cc \u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u06a9\u0647 \u062a\u0648\u06cc \u0639\u06a9\u0633 \u0628\u0648\u062f! \u0648\u0627\u0642\u0639\u06cc\u062a\u0634 \u0627\u0635\u0644\u0627 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f \u06a9\u0647 \u06f6\u06f9\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0627\u0646 \u067e\u0648\u0644 \u062a\u0627\u0631\u062a \u0648 \u062d\u0645\u0644\u0634 \u0631\u0648 \u06af\u0631\u0641\u062a\u0646\u062f \u0648 \u06cc\u06a9 \u062a\u0627\u0631\u062a \u062f\u06cc\u06af\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634\u0645 \u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u062f\u06cc\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c\u0648\u0642\u062a\u06cc \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u0647\u0645\u0647 \u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0634\u06a9\u0644\u0634\u0648\u0646 \u06a9\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0647 \u0646\u0638\u0631\u0645 \u0647\u0645 \u0642\u0646\u0627\u062f\u06cc \u0628\u0627\u06cc\u062f \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u06cc \u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631 \u0645\u06cc\u06af\u0630\u0627\u0634\u062a \u0647\u0645 \u0627\u0633\u0646\u067e \u0628\u0627 \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u062d\u0645\u0644\u0634\u0648\u0646 \u0645\u06cc\u06a9\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0645\u0639 \u0628\u0648\u062f\u0646\u062f \u0648 \u0647\u0645\u0631\u0627\u0647\u0634\u0648\u0646 \u0686\u0646\u062f \u0628\u0631\u0634 \u06a9\u06cc\u06a9 \u0647\u0645 \u0628\u0647 \u0628\u0631\u0627\u06cc \u062a\u0633\u062a \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f \u06a9\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062f\u0644\u067e\u0630\u06cc\u0631 \u0628\u0648\u062f\u0646\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0641\u0642\u0637 \u06cc\u06a9 \u0646\u0648\u0639 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0627\u0648\u0646\u0642\u062f\u0631\u0627 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0686\u064a\u0646\u0634 \u0646\u0627\u0645\u0631\u062a\u0628 \u060c\u062a\u0646\u0648\u0639 \u0646\u062f\u0627\u0634\u062a\u0646 \u0628\u0627\u0642\u0644\u0648\u0627 \u060c\u0645\u0646 \u0647\u0645\u064a\u0634\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645 \u0631\u0627\u0636\u064a\u0645         \u0648\u0644\u064a \u0627\u064a\u0646 \u0633\u0631\u064a \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u064a \u0646\u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u062f \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0648\u062a\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0627 \u0633\u0644\u06cc\u0642\u0647 \u0648 \u0628\u062f\u0648\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0646 \u06af\u0641\u062a\u0647 \u0628\u0627\u0634\u0645 \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062c\u0639\u0628\u0647 \u06a9\u0627\u0645\u0644 \u0628\u0648\u062f \u0637\u0639\u0645 \u0647\u0645 \u06a9\u0647 \u0646\u0627\u062a\u0644\u06cc \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628 \u0647\u0633\u062a\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0645\u0627\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0631\u0633\u06cc\u062f \n\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc \u0628\u0648\u062f \n\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0633\u06a9\u0627\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0643 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u0627\u0632 \u0648\u0633\u0637 \u062a\u0631\u0643 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f!!!\u0646\u0645\u064a\u062f\u0648\u0646\u0645 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u0627\u064a\u0646 \u0627\u062a\u0641\u0627\u0642 \u0627\u0641\u062a\u0627\u062f\u0647 \u064a\u0627 \u062f\u0631 \u0642\u0646\u0627\u062f\u064a \u0628\u0647 \u0647\u0645\u064a\u0646 \u0635\u0648\u0631\u062a \u0628\u0648\u062f\u0647!\u062f\u0631 \u0647\u0631\u0635\u0648\u0631\u062a \u0645\u0627 \u0627\u064a\u0646 \u0643\u064a\u0643 \u0631\u0648 \u0628\u0631\u0627\u0645\u0647\u0645\u0627\u0646\u064a \u0628\u0631\u062f\u064a\u0645 \u0648 \u062c\u0644\u0648\u0647 \u062e\u0648\u0628\u064a \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645\u0646 \u0628\u0631\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u0647 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u0645\u062b\u0644 \u0634\u0641\u0627\u0631\u0634 \u0627\u0645\u0634\u0628 \u06a9\u0647 \u0631\u06cc\u0632 \u0628\u0648\u062f\u0645\u0645\u0646\u0648\u0646\u0645 \u0645\u06af\u0631 \u0628\u0647 \u062f\u0644\u062e\u0648\u0627\u0647 \u0645\u0634\u062a\u0631\u06cc \u0627\u0632 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062f\u0631\u0634\u062a \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f\u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0633\u06a9\u0627\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u200c\u0648 \u062e\u0648\u0634\u0645\u0632\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0633\u0631\u06cc\u0639 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u06cc\u0698\u0647 \u0634\u0628 \u06cc\u0644\u062f\u0627 \u062f\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0648\u062f...\u062e\u0635\u0648\u0635\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u0639\u0644\u06cc\u0631\u063a\u0645 \u0646\u06af\u0631\u0627\u0646\u06cc \u0628\u0646\u062f\u0647\u060c \u06a9\u06cc\u06a9 \u0635\u062d\u06cc\u062d \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f \u06a9\u0647 \u062c\u0627\u06cc \u062a\u0642\u062f\u06cc\u0631 \u0641\u0631\u0627\u0648\u0627\u0646 \u062f\u0627\u0631\u0647...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \n\u062a\u0646\u0648\u0639 \u062f\u0631 \u062c\u0639\u0628\u0647 \u06a9\u0645 \u0628\u0648\u062f \u0648 \u0641\u0642\u0637 \u0627\u0632 \u06cc\u06a9 \u0646\u0648\u0639 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u0634\u0628 \u06cc\u0644\u062f\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0627 \u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 \u0638\u0627\u0647\u0631\u0634 \u062e\u06cc\u0644\u06cc \u062a\u0641\u0627\u0648\u062a \u062f\u0627\u0634\u062a \u06a9\u0644\u06cc \u062a\u0648 \u0630\u0648\u0642\u0645 \u062e\u0648\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u06cc\u0698\u0647 \u0634\u0628 \u06cc\u0644\u062f\u0627 \u0686\u0647\u0627\u0631", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u062f\u0642\u06cc\u0642\u0627 \u0633\u0631 \u0633\u0627\u0639\u062a \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0639\u0632\u06cc\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u06af\u064a \u0634\u064a\u0631\u064a\u0646\u0647\u0627 \u0643\u0647 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0648\u0644\u064a \u0634\u064a\u0631\u064a\u0646\u064a\u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0643\u0645\u064a  \u0646\u0627 \u0645\u0631\u062a\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f  \u0648 \u0645\u064a\u0648\u0647 \u0647\u0627\u064a \u0631\u0648\u064a \u0634\u064a\u0631\u064a\u0646\u0647\u0627 \u0633\u0631 \u062c\u0627\u064a \u0627\u0635\u0644\u064a\u0634 \u0646\u0628\u0648\u062f\u060c \u0643\u0647 \u064a\u0627 \u0628\u0647 \u062f\u0644\u064a\u0644 \u0639\u062f\u0645 \u062f\u0642\u062a \u062f\u0631 \u0686\u064a\u062f\u0645\u0627\u0646 \u0634\u064a\u0631\u064a\u0646\u064a \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0648 \u064a\u0627 \u0628\u0647 \u062f\u0644\u064a\u0644 \u0639\u062f\u0645 \u062f\u0642\u062a \u062f\u0631 \u062d\u0645\u0644 \u062c\u0639\u0628\u0647 \u062a\u0648\u0633\u0637 \u067e\u064a\u0643 \u0645\u064a\u0628\u0627\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", -1]}
{"text": ["\u0648\u0627\u0644\u0627 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062e\u0648\u0628 \u0628\u0648\u062f \u062c\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0686\u0631\u0627 \u0641\u0642\u0637 \u06cc\u06a9 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0628\u0648\u062f\u061f \u0641\u0642\u0637 \u0646\u0627\u0631\u0646\u062c\u06a9 \u0628\u0648\u062f.\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062e\u062a\u0644\u0641 \u0628\u0627\u0634\u0647 \u0641\u0642\u0637 \u06cc\u06a9 \u0646\u0648\u0639 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0631\u0648\u06cc\u0627\u0644 \u0633\u0628\u0648\u0633", "\u0628\u0627\u06af\u062a \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644 \u0628\u0627 \u0631\u0648\u063a\u0646 \u0632\u06cc\u062a\u0648\u0646", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u060c \u062a\u0639\u062f\u0627\u062f\u0634 \u0647\u0641\u062a \u0639\u062f\u062f \u0628\u0648\u062f \u06a9\u0647 \u0627\u0644\u0628\u062a\u0647 \u0645\u0627 \u0645\u0628\u0646\u0627\u06cc \u0648\u0632\u0646 \u0631\u0648 \u062f\u0631 \u0646\u0638\u0631 \u0645\u06cc\u06af\u06cc\u0631\u06cc\u0645 \u06a9\u0647 \u0645\u0645\u06a9\u0646\u0647 \u062a\u0648 \u062a\u0639\u062f\u0627\u062f \u062a\u0627\u062b\u06cc\u0631 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u060c \u0646\u0627\u0646 \u0647\u0627 \u06a9\u0645\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f\u0646 \u062f\u0631 \u06a9\u0644 \u0628\u0633\u06cc\u0627\u0631 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u06cc\u0645 . \u062a\u0634\u06a9\u0631 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0628\u0631\u06af\u0631 \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644 (1 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647\n\u062a\u0627\u0632\u0647 \u0648 \u0644\u0630\u062a \u0628\u062e\u0634 \u0628\u0648\u062f\n\u067e\u06cc\u06af\u06cc\u0631\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0647\u0645 \u0642\u0627\u0628\u0644 \u062a\u062d\u0633\u06cc\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06af\u0631 \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644 (1 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u067e\u0646\u06cc\u0631", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0631\u0627\u06cc \u06cc\u06a9 \u063a\u0630\u0627\u06cc \u0633\u0631\u062f \u06a9\u0647 \u0627\u062d\u062a\u06cc\u0627\u062c \u0628\u0647 \u0627\u0645\u0627\u062f\u0647 \u06a9\u0631\u062f\u0646 \u0646\u06cc\u0633\u062a \u06f1 \u0633\u0627\u0639\u062a \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 \u061f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u062a\u0632\u0627 (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06af\u0627\u0631\u062f\u0646 \u0686\u06cc\u06a9\u0646", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u062e\u064a\u0644\u0649 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f\u060c \u062f\u0648\u0646\u0627\u062a \u062f\u0627\u063a \u0648 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u0647\u0645 \u0643\u0627\u0645\u0644\u0627 \u0644\u062d\u0627\u0638 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u06af\u0627\u062a\u0627", "\u0642\u0646\u062f\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645..\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0645\u0631\u062a\u0628 \u0648 \u062a\u0645\u06cc\u0632 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f..\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u062f\u0644\u0646 \u06a9\u0631\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 23 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 6 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0631\u0648\u063a\u0646\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u06a9\u0648\u06a9\u06cc\u0632 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 30 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0627\u062f\u0644\u0646 \u0639\u0627\u0644\u06cc \u0648 \u062f\u0631 \u0632\u0645\u0627\u0646 \u0645\u0646\u0627\u0633\u0628 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u062f\u0644\u0646 \u06a9\u0631\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 23 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u0622\u0646 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062c\u0648 \u062e\u0634\u06a9 \u062a\u062e\u0645 \u06a9\u0646\u062c\u062f", "\u0633\u0628\u0648\u0633 80%", -1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u062e\u0627\u0637\u0631\u0647 \u0627\u0646\u06af\u06cc\u0632\u06cc \u062f\u0627\u0634\u062a. \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0627\u0645\u0627 \u06a9\u0631\u0645 \u062f\u0627\u062e\u0644\u0634 \u0628\u062f \u0628\u0648\u062f.\u06a9\u0645\u06cc \u062e\u0627\u0645\u0647 \u0648\u0627\u0642\u0639\u06cc \u0628\u062c\u0627\u06cc \u0627\u06cc\u0646 \u06a9\u0631\u0645\u0647\u0627\u06cc \u0635\u0646\u0639\u062a\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f \u0628\u062e\u062f\u0627 \u062b\u0648\u0627\u0628 \u062f\u0627\u0631\u0647 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 16 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u0627\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u0639\u0645\u0648\u0644\u06cc \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0632\u0647 \u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06f6 \u0639\u062f\u062f \u0628\u0648\u062f \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u06af\u0641\u062a\u0647 \u0634\u062f\u0647 \u062f\u0631 \u062d\u062f\u0648\u062f \u06f8 \u0639\u062f\u062f!  \u0627\u06af\u0631 \u06f7 \u0639\u062f\u062f \u0628\u0648\u062f \u0645\u0634\u06a9\u0644\u06cc \u0646\u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u0627\u062e\u062a\u0644\u0627\u0641 \u06f2 \u062a\u0627 \u062f\u06cc\u06af\u0647 \u0632\u06cc\u0627\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0627\u0634\u062a\u0628\u0627\u0647\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0633\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644\u06cc \u06a9\u0627\u0645\u0644\u0627  \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u0647\u0645 \u0641\u0631\u0648 \u0631\u0641\u062a\u0647 \u0648 \u06cc\u0647 \u06af\u0648\u0634\u0647 \u062c\u0639\u0628\u0647 \u062c\u0645\u0639 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f. \u0648 \u0634\u06a9\u0633\u062a\u0647 \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 12 \u0639\u062f\u062f)", -1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u0628\u0641\u0631\u0645\u0627\u06cc\u06cc\u062f \u06a9\u0647 \u0627\u06af\u0647 \u062c\u0639\u0628\u0647 \u062d\u0627\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u0627 \u0633\u0631\u0648 \u062a\u0647 \u06a9\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0627\u063a\u0648\u0646 \u0645\u06cc\u0634\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u062f\u0644\u0646 \u06a9\u0631\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 23 \u0639\u062f\u062f)", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 24 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u0649", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648 \u0628\u06cc\u0646\u0647\u0627\u06cc\u062a \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u0627\u0645\u0647 /\u067e\u0646\u064a\u0631 \u0631\u0648\u064a \u0643\u064a\u0643 \u0647\u0648\u064a\u062c \u0643\u0627\u0645\u0644\u0627 \u062e\u0634\u0643 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0648 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc. \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647. \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0633\u062a\u06cc\u06a9 \u0641\u0631\u0646\u0686", "\u0647\u0648\u0644 \u0645\u06cc\u0644 \u0644\u0648\u0641 \u067e\u0646\u06cc\u0631\u0648 \u0632\u06cc\u062a\u0648\u0646", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u0648\u0645\u0631\u0628\u0627", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0648\u062f\u0627\u0631\u0686\u06cc\u0646", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u0686\u06cc\u067e \u06a9\u0648\u06a9\u06cc", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0628\u0631\u06cc\u0648\u0634 \u0646\u0648\u062a\u0644\u0627", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0628\u0647 \u0646\u0638\u0631 \u06a9\u0647\u0646\u0647 \u0645\u06cc \u0622\u0645\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", "\u0628\u0631\u06cc\u0648\u0634 \u0646\u0648\u062a\u0644\u0627", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u0648\u0645\u0631\u0628\u0627", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u06a9\u0644\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u0634\u0648\u0646 \u062e\u06cc\u0644\u06cc \u0627\u0641\u062a \u06a9\u0631\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u0646\u0648\u062a\u0644\u0627", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 ....", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. \u0641\u0642\u0637 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0646\u0648\u0639 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u06a9\u06cc\u06a9 \u06a9\u0645\u06cc \u0628\u0632\u0631\u06af \u0628\u0648\u062f\u060c \u0628\u0627\u0639\u062b \u062d\u0631\u06a9\u062a \u06a9\u06cc\u06a9 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062e\u062f\u0627\u0631\u0648 \u0634\u06a9\u0631 \u0622\u0633\u06cc\u0628 \u062c\u062f\u06cc \u0628\u0647 \u062a\u0631\u06a9\u06cc\u0628 \u06a9\u06cc\u06a9 \u0646\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0645\u06af\u0647 \u0645\u06cc\u0634\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0645\u0632\u0647 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f.... \u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc\n\u0637\u0639\u0645 \u0639\u0627\u0644\u06cc\n\u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u06a9\u06cc\u0641 \u0645\u06cc\u06a9\u0646\u0645 \u0648\u0642\u062a\u06cc \u0627\u0632 \u0646\u06cc\u0634\u06a9\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u062e\u062f\u0627 \u06a9\u0646\u0647 \u0647\u0645\u0686\u0646\u0627\u0646 \u06a9\u06cc\u0641\u06cc\u062a\u0634\u0648\u0646 \u062e\u0648\u0628 \u0628\u0645\u0648\u0646\u0647.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c 650 \u06af\u0631\u0645", "\u067e\u0627\u06cc \u067e\u0646\u06cc\u0631 \u0622\u0644\u0628\u0627\u0644\u0648 650 \u06af\u0631\u0645\u06cc (7 \u062a\u0627 9 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u0644\u0645\u0628\u06cc\u0631 \u06a9\u0645\u06cc \u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0631\u0648\u06cc \u062a\u0627\u0631\u062a \u0647\u0645 \u0628\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0644\u0645\u0628\u06cc\u0631 \u0628\u0632\u0631\u06af", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06a9\u0648\u0686\u06a9) 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0643\u064a\u0643 \u0646\u0633\u0643\u0627\u0641\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0635\u0648\u0631\u062a\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0642\u0637 \u062e\u0644\u0627\u0644 \u0628\u0627\u062f\u0627\u0645 \u0628\u0648\u062f \u0648 \u067e\u0633\u062a\u0647 \u0646\u062f\u0627\u0634\u062a .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u0631\u0627\u0628\u06cc\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u0631\u0627\u0628\u06cc\u0647 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc. \u0645\u06cc\u200c\u0634\u062f \u0628\u0627\u0642\u0644\u0648\u0627 \u062a\u0631\u062f\u062a\u0631 \u0628\u0627\u0634\u0647 \u0648\u0644\u06cc.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", "\u067e\u0627\u06cc \u067e\u0646\u06cc\u0631 \u0622\u0644\u0628\u0627\u0644\u0648 650 \u06af\u0631\u0645\u06cc (7 \u062a\u0627 9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0631\u0627\u0646\u0686\u06cc \u06a9\u0648\u06a9\u06cc \u06cc\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u06cc\u0627 \u0627\u0648\u0646 \u06a9\u0648\u0631\u0646 \u0641\u0644\u0627\u06a9\u0633 \u0647\u0627\u0634 \u0627\u0632 \u062c\u0646\u0633 \u0628\u062f \u0628\u0648\u062f. \u062f\u0631 \u0647\u0631 \u062d\u0627\u0644 \u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0627\u0646\u0686\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0627\u0646\u0686\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 4 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0634\u06a9\u0631 \u0645\u0635\u0631\u0641\u06cc \u062f\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0634\u0645\u0627 \u0632\u06cc\u0627\u062f \u0627\u0633\u062a \u0648 \u0644\u0637\u0641\u0627 \u0628\u0647 \u0642\u0646\u0627\u062f\u0647\u0627\u06cc\u062a\u0627\u0646 \u062a\u0630\u06a9\u0631 \u0628\u062f\u0647\u06cc\u062f \u0627\u0644\u0627\u0646 \u062f\u06cc\u06af\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0648\u0628 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0634\u062f\u0647 \u0627\u0646\u062f ...\u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f \n\u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u06a9\u062c \u0634\u062f\u0647 \n\u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0628\u0648\u062f \n\u0641\u0627\u062c\u0639\u0647 \u0628\u0648\u062f \n", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u0646 \u0643\u064a\u0643 \u0646\u0633\u0643\u0627\u0641\u0647 \u0627\u064a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0639\u062f \u0632\u0646\u06af \u0632\u062f\u0646 \u06af\u0641\u062a\u0645 \u0646\u062f\u0627\u0631\u0646 \u0628\u0639\u062f \u06af\u0641\u062a\u0645 \u0643\u064a\u0643 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u064a \u0628\u0631\u0627\u0645 \u0628\u0641\u0631\u0633\u062a\u0646 \u064a\u0647 \u062a\u0627\u0631\u062a \u0643\u0648\u0686\u0648\u0644\u0648 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0646 \u06af\u0641\u062a\u0645 \u062a\u0627\u0631\u062a \u0646\u0645\u064a\u062e\u0648\u0627\u0645 \u062d\u0627\u0644\u0627 \u0628\u0627\u064a\u062f \u0628\u0631\u0645 \u064a\u0647 \u0643\u064a\u0643 \u0628\u062e\u0631\u0645 \u062f\u0648\u0628\u0627\u0631\u0647\u060c \u0646\u062f\u0627\u0631\u064a\u0646 \u0646\u0627\u0645\u0648\u062c\u0648\u062f \u0643\u0646\u064a\u0646 \u060c \u0643\u064a \u0648\u0627\u0633\u0647 \u062a\u0648\u0644\u062f \u062a\u0627\u0631\u062a \u0645\u064a\u0628\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0633\u0641\u06cc\u062f", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062e\u0627\u0644\u06cc \u0628\u0648\u062f \u062f\u0627\u062e\u0644\u0634 \u0645\u063a\u0632 \u0628\u0627\u062f\u0627\u0645 \u06cc\u0627 \u067e\u0633\u062a\u0647 \u0634\u0627\u0645 \u06cc\u0627 \u0645\u063a\u0632 \u062a\u062e\u0645\u0647 \u06cc\u0627 \u067e\u0633\u062a\u0647 \u0648 \u06cc\u0627 \u06af\u0631\u062f\u0648 \u0646\u0628\u0648\u062f. \u06a9\u06cc\u06a9 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f . \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645. \u0627\u0632 \u0646\u06cc\u0634\u06a9\u0631 \u062a\u0639\u0631\u06cc\u0641 \u0632\u06cc\u0627\u062f \u0634\u0646\u06cc\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0646\u0627\u0627\u0645\u06cc\u062f \u0634\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0642\u06cc\u0645\u062a \u067e\u06cc\u06a9 \u06f6\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0627\u0646 \u0632\u06cc\u0627\u062f\u0647....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0645\u0646 \u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0646\u0648\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646. \u06a9\u0645\u06cc \u0647\u0645 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u0627\u0646\u062a\u0638\u0627\u0631\u0645 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f. \u062f\u0631 \u0627\u06cc\u0646 \u0645\u0648\u0627\u0631\u062f \u0628\u0627\u06cc\u062f \u062a\u0645\u0627\u0633 \u0628\u06af\u06cc\u0631\u0646 \u0648 \u0628\u06af\u0648\u06cc\u0646\u062f \u0641\u0644\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0627 \u062a\u0645\u0627\u0645 \u06a9\u0631\u062f\u06cc\u0645 \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0633\u0631\u062e\u0648\u062f \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0631\u06cc \u0628\u0641\u0631\u0633\u062a\u0646\u062f.", "\u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u0648\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0635\u0648\u0631\u062a\u06cc", 1]}
{"text": ["\u0645\u062a\u0648\u0633\u0637 \u0631\u0648\u0628\u0647 \u067e\u0627\u06cc\u06cc\u0646 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f \u06cc \u06a9\u06cc\u06a9 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u062f\u0648\u0646 \u0647\u06cc\u062c\u0627\u0646!!\n \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0645 \u0642\u0631\u0628\u0648\u0646\u0634 \u0628\u0631\u0645 \u062a\u06a9\u0648\u0646 \u0647\u0627\u06cc \u0631\u06cc\u0632\u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0627\u0639\u0645\u0627\u0644 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u06a9 \u0642\u062f\u0631\u06cc \u0638\u0627\u0647\u0631\u0634 \u0631\u0648 \u062e\u0633\u062a\u0647 \u062a\u0631 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc (20 \u062a\u0627 25 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0637\u0639\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\n\u0641\u0642\u0637 \u062a\u0627\u0631\u062a \u0631\u064a\u0632 \u0647\u0627 \u064a\u0643\u0645 \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0633\u0631\u06cc \u0628\u0631\u0627\u0646\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u06a9\u0627\u06a9\u0627\u0626\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 .\u0645\u0645\u0646\u0648\u0646\u0645\n\u0628\u0646\u0638\u0631\u0645 \u0628\u0631\u0627\u064a \u062c\u0644\u0648\u0647 \u0628\u064a\u0634\u062a\u0631 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u064a \u0627\u0633\u0644\u0627\u064a\u0633\u064a \u064a\u0627 \u0628\u0647 \u0631\u0648\u0634\u064a \u062a\u0632\u0626\u064a\u0646 \u0628\u0634\u0647 \u0628\u0647\u062a\u0631\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0645\u0645\u0646\u0648\u0646 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645\n\u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\n\u0633\u0647 \u0639\u062f\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 2 \u0639\u062f\u062f)", 1]}
{"text": ["\u06cc\u0647 \u062f\u0648\u0646\u0647 \u0627\u0632 \u0628\u0627\u062f\u06a9\u0646\u06a9\u0627 \u0633\u0648\u0631\u0627\u062e \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u06a9\u0646\u06a9", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", "\u0634\u0645\u0639 \u0639\u062f\u062f", 1]}
{"text": ["\u0627\u06af\u0647 \u062a\u0648\u0634 \u0645\u0648\u0632 \u0648 \u06af\u0631\u062f\u0648 \u062f\u0627\u0634\u062a \u0639\u0627\u0644\u06cc \u0645\u06cc\u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u062c\u0639\u0628\u0647 \u0647\u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0631\u0627\u062f\u0631\u0648\u0646\n\u0646\u0627\u06cc\u0644\u06a9\u0633 \u0642\u0631\u0627\u0631\u062f\u0647\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u062a\u0634\u06a9\u0631 \u0628\u0627\u0628\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627.   \u0648\u0644\u06cc \u0645\u0646 \u0647\u0645 \u062a\u0644\u0641\u0646\u06cc \u0639\u0646\u0648\u0627\u0646 \u06a9\u0631\u062f\u0645 \u0647\u0645 \u062f\u0631 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0645 \u06a9\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u06a9\u0647 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0642\u0628\u0644\u06cc\u060c \u06a9\u0645 \u0632\u062f\u0647 \u0628\u0648\u062f\u06cc\u0646\u060c \u0628\u0631\u0627\u0645 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f.\n\u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u0627\u0645 \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u062f\u0634.  \u0644\u0637\u0641\u0627 \u067e\u0627\u0633\u062e \u0628\u0641\u0631\u0645\u0627\u06cc\u06cc\u0646.  \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0641\u06a9\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 17 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0648\u0642\u062a \u0628\u0648\u062f \u067e\u0627\u064a \u0633\u064a\u0628 \u0627\u064a\u0646\u0642\u062f\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u0646\u0641\u0631\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0633\u0631\u06cc\u0639 \u0648 \u0645\u0631\u062a\u0628 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0648\u062e\u0648\u0634\u0645\u0632\u0647 \u0648\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u067e\u06cc\u06a9 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u0648\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647", 1]}
{"text": ["\u0627\u0633\u0646\u067e \u0627\u0643\u0633\u067e\u0631\u0633 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 .. \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u06a9\u0627\u0634 \u0628\u0631\u0634\u0647\u0627\u06cc \u06a9\u0648\u0686\u06a9 \u062a\u0631\u06cc \u062f\u0627\u0634\u062a \u06a9\u0647 \u0647\u0645 \u0631\u0627\u062d\u062a \u062a\u0631 \u0628\u0631\u062f\u0627\u0634\u062a\u0647 \u0628\u0634\u0647 \u0648 \u0647\u0645 \u06cc\u06a9 \u0628\u0631\u0634 \u0627\u0648\u0646 \u0628\u0631\u0627\u06cc \u0631\u0698\u06cc\u0645 \u062f\u0627\u0631\u0647\u0627 \u0632\u06cc\u0627\u062f \u0646\u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0633\u06a9\u0627\u0641\u0647 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u06cc\u0646 \u062f\u0648\u0645\u06cc\u0646 \u0628\u0627\u0631\u06cc\u0647 \u06a9\u0647 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633 \u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u0648 \u067e\u0634\u06cc\u0645\u0648\u0646 \u0634\u062f\u0645 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0637\u0639\u0645 \u0645\u0648\u0646\u062f\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u062a\u0644\u06cc \u06a9\u0645 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u0627\u0633\u0646\u0643 \u0633\u0647 \u06af\u0648\u0634 \u0628\u0627 \u0647\u0645\u0627\u0647\u0646\u06af\u064a \u062a\u063a\u064a\u0631 \u067e\u064a\u062f\u0627 \u0643\u0631\u062f \u0627\u0645\u0627 \u0648\u0642\u062a\u064a \u0631\u0633\u064a\u062f \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0646\u064a\u0645 \u0643\u064a\u0644\u0648\u064a\u064a \u0664-\u0665 \u062c\u0648\u0631 \u0627\u0633\u0646\u0643 \u0645\u062a\u0641\u0627\u0648\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062a\u06cc\u062a\u0627\u0628\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0627\u0633\u0646\u06a9 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06cc\u06a9 \u0639\u062f\u062f \u0628\u0631\u0628\u0631\u06cc \u0645\u0635\u0646\u0648\u0639\u06cc (\u067e\u0644\u0627\u0633\u062a\u06cc\u06a9\u06cc) \u0628\u0648\u062f \u062d\u0627\u0648\u06cc \u0628\u0631\u062e\u06cc \u0645\u06cc\u0648\u0647 \u0647\u0627\u06cc \u0628\u06cc\u0645\u0632\u0647 \u06a9\u0647 \u0645\u0632\u0647 \u0627\u0633\u067e\u0631\u06cc \u0645\u06cc\u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0645\u0632\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u06cc\u06a9\u0645 \u0632\u06cc\u0627\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0643\u0647\u0646\u0647 \u0628\u0648\u062f!!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 lips \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u0647\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u067e\u06cc\u06a9 \u0647\u0645 \u06f1\u06f1 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0639\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0642\u0646\u0627\u062f\u06cc \u0646\u0627\u062a\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0646\u06cc\u0634 lips \u0645\u062b\u0644 \u0639\u06a9\u0633\u0634 \u062a\u0632\u06cc\u06cc\u0646 \u067e\u0633\u062a\u0647 \u0627\u06cc \u0646\u062f\u0627\u0634\u062a. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0631\u06cc \u062e\u06cc\u0644\u06cc \u0628\u0631\u0634\u0647\u0627\u06cc \u0628\u0632\u0631\u06af\u06cc \u062f\u0627\u0634\u062a \u0648 \u0628\u0631\u0627\u06cc \u0628\u0627 \u062f\u0633\u062a \u062e\u0648\u0631\u062f\u0646 \u0645\u062e\u0635\u0648\u0635\u0627 \u0628\u0631\u0627\u06cc \u06a9\u0648\u062f\u06a9\u0627\u0646 \u0633\u062e\u062a\u0647\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 lips \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u062a\u0627\u0628\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0646 \u062a\u0627\u0631\u062a \u0627\u0633\u067e\u0631\u0633\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0632\u0646\u06af \u0632\u062f\u0646 \u0645\u06cc\u06af\u0646 \u0646\u062f\u0627\u0631\u0646 \u0645\u0646 \u0631\u0648 \u062a\u0648 \u0639\u0645\u0644 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0642\u0631\u0627\u0631 \u062f\u0627\u062f\u0646 \u0628\u0647 \u062c\u0627\u0634 \u062a\u0627\u0631\u062a \u062a\u0645\u0634\u06a9\u06cc \u062f\u0627\u062f\u0646 \u06a9\u0647 \u0634\u0628\u06cc\u0647 \u0645\u0631\u0628\u0627 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0645\u0632\u0634 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u0628\u062f\u0645\u0634 \u0628\u0647 \u0633\u0631\u0627\u06cc\u062f\u0627\u0631 \u0633\u0627\u062e\u062a\u0645\u0627\u0646! \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u06a9\u0645\u06cc \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u06a9 \u0646\u0641\u0631\u0647", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u062a\u0627\u0631\u062a \u0627\u0633\u067e\u0631\u0633\u0648", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0628.\n\u0631\u062f \u0648\u0644\u0648\u062a \u062e\u0648\u0628.\n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0631\u06cc \u0642\u0628\u0644\u0627\u064b \u062a\u0627\u0632\u0647\u200c\u062a\u0631 \u0628\u0648\u062f\u200c.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a\u060c \u0627\u0631\u0633\u0627\u0644 \u062e\u0648\u0628 \u0648 \u0633\u0631\u06cc\u0639.\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648 \u0627\u0633\u0646\u067e.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u062f\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u0646\u062e\u0648\u062f\u0686\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc \u0627\u0632 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u0633\u0631\u06cc\u0639 \u0628\u0648\u062f\n\u062d\u062f\u0648\u062f \u06f1\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u062f\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0647\u067e\u06cc \u0628\u0631\u0633 \u062f\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0642\u0646\u0627\u062f\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c\u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0628 \u0648 \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f\u060c\u067e\u06cc\u06a9 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0633\u062a\u0647 \u0631\u0648 \u06a9\u0647 \u062e\u0627\u0645\u0647 \u0627\u06cc\u06cc \u0628\u0648\u062f \u0628\u062f\u0648\u0646 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0633\u0648\u0646\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644\u0627\u064b \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0633\u0631\u06cc\u0639 \u06a9\u0645\u062a\u0631 \u0627\u0632 \u06cc\u06a9 \u0631\u0628\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631 \u0627\u0632 \u062f\u0641\u0639\u0647 \u06cc \u0642\u0628\u0644 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u0628\u06cc\u200c\u0646\u0638\u06cc\u0631 \u0628\u0648\u062f\n\u0645\u0646 \u062e\u06cc\u0644\u06cc \u062f\u0648\u0633\u0634 \u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u0647\u0645 \u0631\u0627\u0646\u0646\u062f\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0627\u0648\u0646\u200c\u0647\u0627\u0631\u0648 \u0631\u0633\u0648\u0646\u062f. \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0648\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0648\u062e\u0627\u0631\u06cc \u0647\u0627 \u067e\u0648\u062f\u0631 \u0634\u062f\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u0646 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0633\u0641\u06cc\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc\u200c\u0647\u0627 \u0645\u062b\u0644 \u0642\u0628\u0644 \u0646\u06cc\u0633\u062a. \u0645\u062f\u0644 \u0642\u0628\u0644\u06cc \u0648\u0627\u0642\u0639\u0627 \u0628\u0647\u062a\u0631 \u0628\u0648\u062f\u060c \u06a9\u0627\u0634 \u0647\u0645\u0648\u0646 \u0631\u0648 \u062a\u0648\u0644\u06cc\u062f \u06a9\u0646\u06cc\u062f. \u0645\u0627 \u0646\u0635\u0641 \u062f\u0644\u06cc\u0644\u0645\u0648\u0646 \u0628\u0631\u0627\u06cc \u0633\u0641\u0627\u0631\u0634\u060c \u0646\u0648\u0646 \u06a9\u0634\u0645\u0634\u06cc\u200c\u0647\u0627\u062a\u0648\u0646 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 25 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 7 \u0639\u062f\u062f)", "\u062c\u0648 80% \u062f\u0648\u062a\u0627\u06cc\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", "\u0633\u06cc\u0645\u06cc\u062a", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u064a \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u064a\u062f \u0648\u0644\u064a \u0643\u0631\u0627\u0633\u0627\u0646 \u0647\u0627 \u0647\u0631\u062f\u0641\u0639\u0647 \u0627\u0646\u062f\u0627\u0632\u0634 \u0643\u0648\u0686\u0643\u062a\u0631 \u0645\u064a\u0634\u0647 !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (1 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u062f\u0631\u062d\u0645\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u06cc \u062f\u0642\u062a\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0647\u0645\u0647 \u0628\u0627\u0647\u0645 \u0645\u062e\u0644\u0648\u0637 \u0648\u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0645\u0646 \u062d\u0633\u0627\u0628\u06cc \u0634\u0631\u0645\u062a\u062f\u0647 \u0645\u0647\u0645\u0648\u0646\u0647\u0627\u0645 \u0634\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 12 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u062a\u062d\u0648\u06cc\u0644 \u062e\u06cc\u0644\u06cc \u0628\u062f!!! \u0647\u0645\u0647 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 20 \u0639\u062f\u062f)", -1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062f\u0627\u063a \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", "\u062a\u0633\u062a \u0631\u0648\u06cc\u0627\u0644", "\u0644\u0648\u0627\u0634 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0627\u0648\u0631\u062f \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u0633\u0631 \u062e\u06cc\u0627\u0628\u0648\u0646\u0645\u0648\u0646\u0647 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0628\u0627\u0628\u062a\u0634 \u062a\u0645\u0627\u0633 \u0647\u0645 \u06af\u0631\u0641\u062a\u0645 .\n\u0627\u0645\u0627 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0639\u0632\u06cc\u0632 \u0648\u0642\u062a\u06cc \u0634\u0645\u0627 \u06af\u0632\u06cc\u0646\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u062f\u0627\u0631\u06cc\u062f \u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0645\u0634\u062a\u0631\u06cc \u062f\u0648 \u062a\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0647 \u06cc\u0639\u0646\u06cc \u062f\u0648 \u0633\u0641\u0627\u0631\u0634 \u0645\u062a\u0641\u0627\u0648\u062a\u0646 \u0648\u0644\u06cc \u0634\u0645\u0627 \u062a\u0645\u0627\u0645 \u06a9\u06cc\u06a9\u0627\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u0631\u0648 \u062f\u0631 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u06cc\u062f. \u06a9\u0647 \u062d\u062a\u06cc \u062a\u0639\u062f\u0627\u062f \u0632\u0648\u062c \u0647\u0645 \u0646\u0628\u0648\u062f.\n\u0627\u0632 \u0637\u0631\u0641\u06cc \u062f\u0631 \u0645\u0646\u0648 \u062e\u0648\u0631\u062f\u0647 \u0628\u0631\u0627\u0648\u0646\u06cc \u06a9\u0647 \u0631\u0648\u0634 \u067e\u0633\u062a\u0647 \u062f\u0627\u0631\u0647 \u06cc\u0627 \u067e\u0648\u062f\u0631 \u067e\u0633\u062a\u0647 \u062f\u0627\u0631\u0647 \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u0627\u062b\u0631\u06cc \u0627\u0632 \u067e\u0633\u062a\u0647 \u0631\u0648\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u0647\u0627 \u0646\u0628\u0648\u062f.\n\u0644\u0637\u0641\u0627 \u0628\u06cc\u0634\u062a\u0631 \u0646\u0638\u0627\u0631\u062a \u0648 \u062f\u0642\u062a \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u062f.\n\u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u0628\u0631\u0627\u0648\u0646\u06cc", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", 1]}
{"text": ["\u0645\u0646 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0686\u06cc\u06a9\u0646 \u06a9\u0627\u0631\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0686\u06cc\u06a9\u0646 \u06af\u0627\u0631\u062f\u0646 \u0627\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0686\u06cc\u06a9\u0646 \u06a9\u0627\u0631\u06cc", -1]}
{"text": ["\u062e\u0648\u0634 \u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0641\u0642\u0637 \u0644\u0637\u0641 \u06a9\u0646\u06cc\u062f \u0628\u0647 \u062c\u0627\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0648\u0646 \u062f\u0631 \u0646\u0627\u06cc\u0644\u0648\u0646.\u0627\u0648\u0646\u0647\u0627\u0631\u0648 \u062f\u0631 \u067e\u0627\u06a9\u062a \u06a9\u0627\u063a\u0630\u06cc \u0628\u0632\u0627\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647! \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0628\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0648 \u0633\u0631\u06cc\u0639 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0631\u0646\u06af \u0634\u0645\u0639 \u0647\u0627 \u0634\u0628\u06cc\u0647 \u0647\u0645 \u0646\u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0644\u0646\u06af\u0647 \u0628\u0647 \u0644\u0646\u06af\u0647 \u0628\u0648\u062f \n\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u0646 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0631\u062f\u0645 \u0627\u0628\u0639\u0627\u062f\u0634 \u0628\u0632\u0631\u06af \u062a\u0631 \u0628\u0627\u0634\u0647 \n\u0648\u0644\u06cc \u0645\u0632\u0647 \u0627\u0634 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0686\u0647\u0627\u0631", "\u0634\u0645\u0639 \u0634\u0634", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u062f\u0645\u0632\u0633!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u06cc\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0627\u06af\u0647 \u0634\u0639\u0628\u0647 \u0641\u0631\u0645\u0627\u0646\u06cc\u0647 \u0647\u0645 \u0645\u062b\u0644 \u0634\u0639\u0628\u0647 \u062c\u0631\u062f\u0646 \u06a9\u0627\u0641\u06cc \u0648 \u0642\u0647\u0648\u0647 \u062f\u0627\u0634\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0622\u062e\u0647 \u0645\u06af\u0647 \u0645\u06cc\u0634\u0647 \u062c\u0627\u06cc\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u0634\u0647 \u0642\u0647\u0648\u0647 \u0627\u0634 \u0646\u0628\u0627\u0634\u0647\u061f\u061f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0627\u0632 \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0627\u0633\u0646\u067e \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 1", "\u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u0631 1", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0633\u0641\u0646\u062c\u06cc\u0634 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u06cc\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0632\u06cc\u0627\u062f \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f\n\u0628\u0647 \u0646\u0633\u0628\u062a \u062d\u062c\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a\u060c \u0642\u06cc\u0645\u062a \u062e\u06cc\u0644\u06cc \u0628\u0627\u0644\u0627 \u0628\u0648\u062f. \u0627\u0635\u0644\u0627 \u0627\u0631\u0632\u0634 \u0646\u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a \u0633\u0627\u064a\u0632 \u062e\u064a\u0644\u064a \u0643\u0648\u0686\u064a\u0643\u064a \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0641\u0642\u0637 \u06f1\u06f5 \u062f\u0642\u06cc\u0642\u0647 !", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0643\u064a\u0643 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0647\u0645 \u0627\u064a\u0646 \u0645\u0648\u0636\u0648\u0639 \u0647\u0645 \u0627\u0632 \u0638\u0627\u0647\u0631 \u0643\u064a\u0643 \u0648 \u0633\u0641\u062a \u0634\u062f\u0646 \u062e\u0627\u0645\u0647 \u0648 \u062e\u0648\u062f \u0643\u064a\u0643 \u0648 \u0647\u0645 \u0627\u0632 \u0637\u0639\u0645\u0634 \u0643\u0627\u0645\u0644\u0627 \u067e\u064a\u062f\u0627 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0646\u0633\u0628\u062a \u0642\u064a\u0645\u062a \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0643\u0648\u0643\u064a \u0647\u0627 \u0627\u0635\u0644\u0627 \u062a\u0646\u0627\u0633\u0628 \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0637\u0639\u0645\u0634 \u06a9\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc.\u0641\u0642\u0637 \u0634\u06cc\u0631\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u0631\u06cc\u0632 \u0628\u0648\u062f \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0627\u062f\u0648\u0645 \u0628\u0648\u062f \u0648 \u0622\u0628\u0631\u0648\u0645\u0648\u0646 \u062c\u0644\u0648 \u0645\u0647\u0645\u0648\u0646\u0627 \u0631\u0641\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0627\u06cc\u062c\u0627\u062f\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u0627\u0639\u062b \u0633\u0631\u0639\u062a \u062f\u0631 \u062a\u062d\u0648\u06cc\u0644 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0648 \u0627\u0645\u06a9\u0627\u0646 \u0645\u0634\u0627\u0647\u062f\u0647 \u0645\u0648\u0642\u0639\u06cc\u062a \u067e\u06cc\u06a9 \u0634\u062f\u0647 \u0627\u0633\u062a \u06a9\u0647 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0627\u0631 \u062e\u0648\u0628\u06cc \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0631\u06cc\u0639 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 7", "\u0634\u0645\u0639 \u0639\u062f\u062f 5", "\u06a9\u06cc\u06a9 \u0628\u0644\u0698\u06cc\u06a9\u06cc (\u0686\u0647\u0627\u0631\u06af\u0648\u0634)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u062e\u0627\u0645\u0647 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06a9\u0645 \u0628\u0648\u062f \u0627\u0645\u0627 \u062f\u0631 \u0645\u0648\u0631\u062f \u0647\u0632\u06cc\u0646\u0647 \u0627\u0633\u0646\u067e...\u0641\u0627\u0635\u0644\u0647 \u0645\u0627 \u062a\u0627 \u0646\u06cc\u0634\u06a9\u0631 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645\u0647 \u0648 \u062f\u0631\u06cc\u0627\u0641\u062a\u06f6\u0647\u0632\u0627\u0631\u062a\u0648\u0645\u0646 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0645\u0633\u0627\u0641\u062a \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0632\u0645\u0627\u0646\u06cc\u06a9\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u06a9\u06cc\u06a9 \u0631\u0627 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u062f\u06cc\u062f\u0645 \u06a9\u0647 \u0647\u0631 \u062f\u0648 \u0637\u0631\u0641 \u06a9\u06cc\u06a9 \u0628\u0647 \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0648 \u062a\u0645\u0627\u0645 \u062e\u0627\u0645\u0647 \u0647\u0627 \u0628\u0647 \u0631\u0648\u06cc \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0648 \u0633\u0633 \u0628\u0631\u06cc\u0644\u0648 \u06a9\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0628\u0648\u062f \u0628\u062e\u0627\u0637\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u0627\u0645\u0647 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0647\u0645\u0647 \u0628\u0647 \u0627\u0637\u0631\u0627\u0641 \u06a9\u06cc\u06a9 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0644\u0627 \u0634\u06a9\u0644 \u0648 \u0634\u0645\u0627\u06cc\u0644 \u06a9\u06cc\u06a9 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0635\u0648\u0631\u062a\u06cc", -1]}
{"text": ["\u062a\u0635\u0648\u064a\u0631 \u0634\u064a\u0631\u064a\u0646\u0649 \u0628\u0627 \u0622\u0646\u0686\u0647 \u0643\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0631\u062f\u0648\u0644\u0648\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0639\u062f \u0632\u0646\u06af \u0632\u062f\u0646 \u06af\u0641\u062a\u0646 \u0646\u062f\u0627\u0631\u0646 \u0648 \u0628\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0645\u0646 \u0631\u0648\u0644\u062a \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0634\u062f \u0631\u0648\u0644\u062a \u0647\u0645 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0627\u06cc\u062f \u0645\u0646\u0648 \u0647\u0627 \u0628\u0631\u0648\u0632 \u0628\u0627\u0634\u0647 \u06a9\u0647 \u0647\u0645\u0686\u06cc\u0646 \u0645\u0634\u06a9\u0644\u06cc \u067e\u06cc\u0634 \u0646\u06cc\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0622\u0644\u0628\u0627\u0644\u0648 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u0645\u062e\u0635\u0648\u0635 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc.\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0627\u0632\u062c\u0627\u06cc \u062f\u06cc\u06af\u0647 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u0648\u0628\u0627 \u0645\u0634\u06a9\u0644\u0627\u062a\u0634 \u0631\u0648\u0628\u0647 \u0631\u0648\u0645\u06cc\u0634\u0645 \u0645\u06cc\u06af\u0645 \u06a9\u0627\u0634 \u0628\u0627\u0632\u0647\u0645 \u0627\u0632\u0646\u06cc\u0634\u06a9\u0631 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0631\u062f\u0645\u060c\u0646\u06cc\u0634\u06a9\u0631 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0686\u06cc\u0632\u06cc \u0646\u062f\u0627\u062f\u0647 \u062f\u0633\u062a\u0645 \u06a9\u0647 \u0646\u0627\u0631\u0627\u0636\u06cc \u0628\u0627\u0634\u0645\u060c\u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u0628\u0631\u062e\u0644\u0627\u0641 \u0628\u0639\u0636\u06cc\u0627 \u0628\u0647 \u0645\u0634\u062a\u0631\u06cc\u062a\u0648\u0646 \u0648 \u0634\u0639\u0648\u0631\u0634 \u0627\u062d\u062a\u0631\u0627\u0645 \u0645\u06cc\u06af\u0630\u0627\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u06a9\u0648\u062a\u0627\u0647\u06cc \u0645\u0633\u06cc\u0631 \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0646\u0633\u0628\u062a\u0627 \u0632\u06cc\u0627\u062f \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u0648\u0646\u0647 \u0645\u0627 \u062a\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u06f1 \u062f\u0642\u06cc\u0642\u0647 \u0631\u0627\u0647 \u0647\u0633\u062a \u0648\u0644\u06cc \u06f6 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0646 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u06af\u0631\u0641\u062a\u0647 \u0634\u062f!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631\u0633\u062a \u0686\u06cc\u062f\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f. \u0645\u0632\u0647\u200c\u0634 \u0645\u062a\u0648\u0633\u0637 \u0628\u0648\u062f\n\u0645\u0648\u0633 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u0632\u0647 \u0627\u0646\u0628\u0647 \u0646\u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc", "\u0627\u0646\u0628\u0647", "\u067e\u0627\u06cc \u0645\u06cc\u0648\u0647 \u06a9\u0631\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 7", "\u0634\u0645\u0639 \u0639\u062f\u062f 4", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.\u067e\u06cc\u06a9 \u0647\u0645 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f \u0648 \u0628\u0627 \u062f\u0642\u062a \u06a9\u06cc\u06a9 \u0631\u0648 \u0622\u0648\u0631\u062f\u0646 \u0627\u0645\u0627 \u067e\u06cc\u06a9 \u0628\u0627\u06cc\u062f \u0627\u0648\u0644 \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f\u0647 \u0628\u0639\u062f\u0634 \u067e\u06cc\u0627\u0645\u06a9 \u062a\u062d\u0648\u06cc\u0644 \u0628\u06cc\u0627\u062f.\u06f1\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0642\u0628\u0644 \u0627\u0632 \u062a\u062d\u0648\u06cc\u0644\u060c\u067e\u06cc\u0627\u0645\u06a9 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0646 \u0627\u0648\u0645\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc . \u062a\u0627\u0632\u0647 \u0648 \u0633\u0631\u06cc\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062a\u0627\u062e\u06cc\u0631 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632\u0634 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \n\u0645\u0646 \u06a9\u0631\u0645 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u062f\u0633\u0631\u06cc \u0634\u0628\u06cc\u0647 \u0645\u0648\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 2", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 . \u0645\u0645\u0646\u0648\u0646 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632\u06cc \n\u06cc\u0627\u0634\u0627\u0633\u06cc\u0646 \u0622\u0630\u0631\u0628\u0627\u06cc\u062c\u0627\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f!!!  -___-", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u062e\u06cc\u0631 \u062f\u0627\u0634\u062a . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u062f\u0648\u0644\u0648\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0633\u0644\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u062a\u062e\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0644\u0628\u062a\u0647 \u062a\u0639\u062f\u0627\u062f \u062d\u062f\u0648\u062f 30 \u0639\u062f\u062f \u0646\u0628\u0648\u062f\u060c \u0628\u06cc\u0634 \u0627\u0632 100 \u0639\u062f\u062f \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0646\u062c\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 30 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0628\u0632\u0631\u06af)", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", 1]}
{"text": ["\u0627\u06af\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u06cc\u0645\u060c \u062b\u0627\u0628\u062a \u0628\u0645\u0648\u0646\u0647\u060c \u062e\u0628 \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0645\u06cc\u0634\u06cc\u0645. \u0627\u0648\u0646\u0627\u06cc\u06cc \u0647\u0645 \u06a9\u0647 \u067e\u0633\u0646\u062f \u0646\u0634\u062f\u0647 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0628\u0647\u062a\u0631 \u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633 \u06a9\u0631\u0645\u062f\u0627\u0631 \u067e\u0633\u062a\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u0627\u0646\u0628\u0647 \u06cc\u06a9 \u0639\u062f\u062f", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u0627\u062f\u0645 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06af\u0641\u062a\u0646 \u0646\u062f\u0627\u0631\u0646\n\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0648\u0631\u062f\u0646 \u0628\u062c\u0627\u0634 \u062a\u0648\u0634 \u06cc\u06a9 \u0686\u06cc\u0632\u0647\u0627\u06cc \u062a\u0644\u062e\u06cc \u0628\u0648\u062f \u0641\u06a9\u0631 \u06a9\u0646\u0645 \u067e\u0648\u0633\u062a \u067e\u0631\u062a\u0642\u0627\u0644 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062a\u0644\u062e \u0648 \u0628\u062f \u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0627 \u062e\u0627\u06a9 \u0642\u0646\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 (Happy Birthday)", -1]}
{"text": ["\u062f\u0631 \u0645\u0642\u0627\u06cc\u0633\u0647 \u0628\u0627 \u062a\u0635\u0648\u06cc\u0631 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u0648\u0627 \u0631\u0641\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0631\u0633\u062a\u0647 \u06a9\u0647 \u0622\u0648\u0631\u062f\u0646\u0634 \u0633\u062e\u062a\u0647 \u062f\u0631\u06a9 \u0645\u06cc\u06a9\u0646\u0645 \u0648\u0644\u06cc \u0628\u0627\u06cc\u062f \u06cc\u0647 \u0641\u06a9\u0631\u06cc \u0628\u0631\u0627\u0634 \u0628\u0634\u0647\u060c \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0628\u0631\u0627\u06cc \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u0628\u0648\u062f\u0647 \u0648 \u06a9\u0644\u06cc\u0634 \u0628\u0647 \u062f\u0631 \u0648 \u062f\u06cc\u0648\u0627\u0631 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", -1]}
{"text": ["\u062e\u0648\u0646\u0647 \u0645\u0627 \u062a\u0627 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632\u06cc \u06f3 \u062f\u0642\u06cc\u0642\u0647 \u067e\u06cc\u0627\u062f\u0647 \u0641\u0627\u0635\u0644\u0647 \u0647\u0633\u062a\u0634 \u0686\u0631\u0627 \u0647\u0632\u06cc\u0646\u0647 \u062d\u0645\u0644 \u0648 \u0646\u0642\u0644 \u062d\u0633\u0627\u0628 \u0645\u06cc\u0634\u0647\u061f!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0644\u0628\u062a\u0647 \u06a9\u06cc\u06a9 \u0632\u06cc\u0631\u0634 \u06cc\u0647 \u06a9\u0645 \u0633\u0641\u062a \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0633\u0648\u0647\u0627\u0646 \u0639\u0633\u0644\u06cc \u0648\u0627\u0642\u0639\u0627 \u0648\u0627\u0642\u0639\u0627 \u062e\u06cc\u06cc\u06cc\u06cc\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u0648 \u0628\u0648\u06cc \u0631\u0648\u063a\u0646 \u0633\u0648\u062e\u062a\u0647 \u0645\u06cc\u062f\u0627\u062f \u0627\u0635\u0644\u0627 \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0642\u0639\u0627 \u0628\u062f \u0631\u0627 \u0646\u062f\u0627\u0634\u062a\u0645 \u062e\u06cc\u0644\u06cc \u0639\u062c\u06cc\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0633\u0648\u0647\u0627\u0646 \u0639\u0633\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0646\u0648\u0632 \u0646\u062e\u0648\u0631\u062f\u06cc\u0645 \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0645\u0648\u0646 \u0634\u06a9\u0644\u06cc \u06a9\u0647 \u062a\u0648 \u0639\u06a9\u0633 \u0628\u0648\u062f \u0632\u06cc\u0628\u0627 \u0648 \u0635\u062d\u06cc\u062d \u0648 \u0633\u0627\u0644\u0645 \u0648 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f.\n\u0634\u0627\u062f \u0648 \u067e\u0631\u062a\u0648\u0627\u0646 \u0628\u0627\u0634\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f. \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0627\u06cc\u0646 \u062a\u0648\u0642\u0639 \u0646\u0645\u06cc\u0631\u0647 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647\u0646\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u0634\u062a\u0631\u06cc \u0628\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0639\u062f\u0627\u062f \u0622\u06cc\u062a\u0645 \u0647\u0627 \u062e\u06cc\u0644\u06cc\u06cc\u06cc \u06a9\u0645 \u0628\u0648\u062f \u0648 \u062d\u0642 \u0627\u0646\u062a\u062e\u0627\u0628 \u0632\u06cc\u0627\u062f\u06cc \u0646\u062f\u0627\u0634\u062a\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0645\u0646 \u0686\u0648\u06a9\u0648\u0628\u0627\u0644 \u0645\u0639\u0645\u0648\u0644\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0686\u0648\u06a9\u0648\u0628\u0627\u0644 \u0631\u062f\u0648\u0644\u0648\u0644\u062a \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0645\u062a\u0648\u0633\u0637 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u0645\u06cc \u0631\u0641\u062a \n\u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0647\u0645 \u0645\u0645\u0646\u0648\u0646\u0645 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0633\u0631\u0639\u062a \u0627\u0631\u0633\u0627\u0644 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0648\u06a9\u0648\u0628\u0627\u0644", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u064a\u064a\u064a\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0644\u0627\u062a \u067e\u0648\u062f\u0631\u06cc \u0645\u0631\u0628\u0639 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u0646\u0627\u0646\u0647 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062f\u0627\u062f\u0645(\u0633\u0627\u062f\u0647) \u0627\u0645\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0627\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646  \u0628\u0633\u062a\u0647 \u0627\u06cc (12 \u0639\u062f\u062f\u06cc)", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0631\u0633\u06cc\u062f. \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f  \u0627\u0645\u0627 \u0631\u0648\u0632\u0647\u0627\u06cc \u0628\u0627\u0631\u0627\u0646\u06cc \u0645\u062b\u0644 \u0627\u0645\u0631\u0648\u0632 \u062c\u0639\u0628\u0647 \u0647\u0627 \u0628\u0627\u06cc\u062f \u062f\u0631 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9 \u0647\u0645 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u0648\u0646\u062f. \n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0633\u062a\u0646\u062f\u060c \u0627\u0645\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0628\u0632\u0631\u06af! \u0648 \u06cc\u06a9\u062f\u0633\u062a  \u0648 \u06cc\u06a9 \u0627\u0646\u062f\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a\u0646\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0627\u0633\u0646\u067e \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0622\u0648\u0631\u062f \u06f4\u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0631\u0627\u06cc \u0645\u0633\u06cc\u0631\u06cc \u06a9\u0647 \u067e\u06cc\u0627\u062f\u0647 \u06f4 \u062f\u0642\u06cc\u0642\u0647 \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", -1]}
{"text": ["\u0637\u0644\u0627\u0645\n\u0628\u0627 \u0639\u06a9\u0633 \u062e\u06cc\u0644\u06cc \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u0648 \u0627\u06cc\u0646 \u062d\u0644\u0648\u0627 \u0648 \u062e\u0631\u0645\u0627 \u0631\u0648 \u0647\u0645\u0647 \u062c\u0627 \u062f\u0627\u0631\u0646\u062f\u061b \u0645\u0646 \u0628\u0627 \u062f\u06cc\u062f\u0646 \u0639\u06a9\u0633\u0634 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645. \u0645\u062b\u0644 \u0627\u06cc\u0646\u0647 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc \u0628\u0631\u0627\u062a \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0628\u06cc\u0627\u0631\u0646\u062f. \u062a\u062c\u0631\u0628\u0647\u200c\u06cc \u062e\u0648\u0628\u06cc \u0646\u0628\u0648\u062f \u0648 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0646\u0645\u06cc\u200c\u06a9\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u062d\u0644\u0648\u0627 \u062e\u0631\u0645\u0627 \u0645\u06cc\u06a9\u0633", -1]}
{"text": ["\u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0645\u0627\u0645 \u0645\u0648\u0627\u0631\u062f \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0631\u0639\u0627\u06cc\u062a \u0634\u062f\u0647 \u0628\u0648\u062f\u060c\u0627\u0632 \u062c\u0639\u0628\u0647 \u0647\u062f\u06cc\u0647 \u0647\u0645 \u0645\u0645\u0646\u0648\u0646 \u0648\u0627\u0642\u0639\u0627.\u0628\u0645\u0648\u0642\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f\u060c\u0645\u0632\u0647 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0642\u06cc\u0645\u062a \u0647\u0645 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u062f\u06cc\u062f.\n\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u062d\u0648\u06cc\u0644\u06cc \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f \n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u062d\u0648\u06cc\u0644\u06cc \u062f\u0631 \u062c\u0639\u0628\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0645\u0646\u0638\u0645 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc\u0631\u0633\u06cc\u062f \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0641\u062a\u0627\u062f\u0647 \u0627\u0633\u062a \u0648 \u0627\u0632 \u06cc\u06a9 \u0637\u0631\u0641 \u062c\u0639\u0628\u0647 \u0628\u0627\u0632 \u0628\u0648\u062f.\n\u0627\u0635\u0644\u0627 \u0686\u0646\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u0646\u0627\u062a\u0627\u0644\u06cc \u0642\u0627\u0628\u0644 \u067e\u0630\u06cc\u0631\u0634 \u0646\u06cc\u0633\u062a :(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062f\u0644\u0645 \u0645\u06cc \u062e\u0648\u0627\u0633\u062a \u0627\u0632 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u06a9\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u06cc\u062f \u06cc\u0647 \u0639\u06a9\u0633 \u0628\u0631\u0627\u062a\u0648\u0646 \u0628\u0641\u0631\u0633\u062a\u0645 \u06a9\u0647 \u062e\u0648\u062f\u062a\u0648\u0646 \u0628\u0627 \u0639\u06a9\u0633 \u0627\u0633\u0646\u067e \u0645\u0642\u0627\u06cc\u0633\u0647 \u06a9\u0646\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0631\u06cc\u0646\u06af\u06cc", -1]}
{"text": ["\u0646\u0627\u062a\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062e\u0648\u0634\u0645\u0632\u0647.\n\u0648 \u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06a9\u0647 \u0633\u0631\u06cc\u0639 \u0622\u0648\u0631\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0633\u06a9\u0627\u0641\u0647 1 \u06a9\u06cc\u0644\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u0644\u0627\u06cc\u0633\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0643\u064a\u0643 \u0628\u0633\u064a\u0627\u0631 \u0633\u0641\u062a \u0648 \u0628\u064a\u0627\u062a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0639\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0633\u0627\u0644\u0645 \u0648 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", 1]}
{"text": ["\u0647\u0645 \u062e\u0648\u0628 \u062d\u0645\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["Ham cake awli bod ham barkhorde peyk mamnon", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0645\u062c\u06cc\u06a9", 1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06a9\u0627\u06a9\u0627\u0626\u0648\u06cc\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0630\u06a9\u0631 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0627 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06a9\u0627\u06a9\u0627\u0626\u0648\u06cc\u06cc \u0646\u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u06cc\u0645\n\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0627\u0645\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u0648\u0646\u0634 \u0633\u0641\u062a \u0648 \u062d\u0627\u0644\u062a \u0633\u0648\u062e\u062a\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0622\u0648\u0631\u062f\u0646.\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u064a\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u0637\u0648\u0644\u0627\u0646\u06cc \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0622\u0642\u0627 \u06a9\u06cc\u06a9 \u0631\u0648 \u06a9\u0644\u0627 \u0645\u0648\u062a\u0648\u0631\u06cc \u062e\u0631\u0627\u0628\u0634 \u06a9\u0631\u062f\u0647 \u062a\u0648 \u0631\u0627\u0647 \u0627\u0634\u062a\u0628\u0627\u0647 \u06a9\u0631\u062f\u0645 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 9", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u06cc\u0639\u0646\u06cc \u062a\u0627\u0633\u0641 \u0628\u0627\u0631 \u0647\u0633\u062a.\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0645\u0627\u0646\u0646\u062f \u0633\u0646\u06af \u0633\u0641\u062a \u0628\u0648\u062f\u0647 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u06cc\u0633\u062a.\u0647\u0645\u0648\u0646\u062c\u0648\u0631\u06cc \u06af\u0630\u0627\u0634\u062a\u0645 \u0646\u0627\u0646 \u062e\u0634\u06a9.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u062f\u0648 \u062a\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0645\u0627\u0631\u0633\u067e\u0627\u0646 \u0628\u0648\u062f\u0647 \u06a9\u0647 \u062c\u0641\u062a\u0634 \u0631\u0648 \u0628\u06cc\u0634\u062a\u0631 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646.\u0627\u06af\u0631 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0634\u062a\u0646 \u0628\u0627\u06cc\u062f \u0647\u0645\u0627\u0647\u0646\u06af \u0645\u06cc\u06a9\u0631\u062f\u0646!\u062f\u0642\u06cc\u0642\u0627 \u0627\u06af\u0631 \u062e\u0648\u062f\u0634\u0648\u0646 \u0634\u06a9\u0631 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0646 \u0646\u0635\u0641 \u062d\u062c\u0645 \u0633\u0641\u0627\u0631\u0634\u0634\u0648\u0646 \u0622\u0631\u062f \u0628\u0627\u0634\u0647 \u0686\u0647 \u062d\u0633\u06cc \u062f\u0627\u0631\u0646\u062f\u061f\u062c\u0627\u0644\u0628\u0647 \u06a9\u0647 \u062a\u0648 \u0646\u0638\u0631\u0627\u062a \u062f\u0648\u0633\u062a\u0627\u0646 \u0647\u0645 \u0627\u06cc\u0646 \u0642\u0628\u06cc\u0644 \u0645\u0634\u06a9\u0644\u0627\u062a \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\u0647 \u0627\u0645\u0627 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0646\u0638\u0627\u0631\u062a\u06cc \u0646\u0645\u06cc\u06a9\u0646\u0647!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0631\u0633\u067e\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 13 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u06a9\u0647 \u0628\u0631\u0633\u0647 \u0648 \u0627\u0635\u0644\u0627 \u062a\u0627\u0631\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 8 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0644\u0627\u0645. \u0645\u0646 \u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0628\u0631\u0628\u0631\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0645\u062a\u0641\u0627\u0648\u062a \u0647\u0633\u062a\u0646. \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u06af\u0627\u062a\u0627", -1]}
{"text": ["\u0686\u0642\u062f\u0631 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f!\n\u06a9\u0644\u0627 \u062f\u0648 \u062a\u0627 \u062e\u06cc\u0627\u0628\u0648\u0646 \u0641\u0627\u0635\u0644\u0647 \u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645 (\u062d\u062f\u0648\u062f\u0627 15 \u0639\u062f\u062f)", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627\u06cc\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627\u064b \u0644\u0630\u064a\u0630 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0646\u06cc\u0631", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (1 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u062a", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0627\u0627\u0631 \u0645\u0648\u0646\u062f\u0647. \u0628\u0627 \u0648\u062c\u0648\u062f \u062a\u0627\u0643\u064a\u062f \u0645\u0646 \u062f\u0631 \u0642\u0633\u0645\u062a \u062a\u0648\u0636\u064a\u062d\u0627\u062a\u060c \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u062f. \u0644\u0637\u0641\u0627 \u0627\u06af\u0631 \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0627\u0632\u0647 \u0646\u062f\u0627\u0631\u064a\u062f \u062a\u0645\u0627\u0633 \u0628\u06af\u064a\u0631\u064a\u062f \u0648 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0643\u0646\u0633\u0644 \u0643\u0646\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u062a\u0627 14 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u060c \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f \u0645\u0646 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634\u0645 \u06f4 \u0639\u062f\u062f \u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u0646\u06a9\u0631\u062f\u0646\u062f \u0648 \u0686\u0647\u0627\u0631 \u0639\u062f\u062f \u0647\u0645 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 \u06a9\u0647 \u062f\u0648 \u0639\u062f\u062f \u0633\u0627\u062f\u0647 \u0648 \u062f\u0648 \u0639\u062f\u062f \u0631\u0648\u06a9\u0634 \u0634\u06a9\u0627\u0644\u0627\u062a \u06a9\u0647 \u062f\u0648 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a \u0631\u0648 \u0647\u0645 \u0646\u06cc\u0627\u0648\u0631\u062f\u0646\u062f \u062f\u0631 \u0648\u0627\u0642\u0639\u0627 \u06f6 \u0642\u0644\u0645 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u06a9\u0647 \u067e\u0631\u062f\u0627\u062e\u062a \u0647\u0645 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0646\u06cc\u0627\u0648\u0631\u062f\u0646 \u060c \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0628\u0627 \u06a9\u062c\u0627 \u0628\u0631\u0627\u06cc \u0627\u0637\u0644\u0627\u0639 \u0628\u0627\u06cc\u062f \u062a\u0645\u0627\u0633 \u0628\u06af\u06cc\u0631\u0645 \u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u0646 \u0644\u0637\u0641\u0627 \u0634\u0645\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0628\u0641\u0631\u0645\u0627\u06cc\u06cc\u062f \u060c\u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 12 \u0639\u062f\u062f)", "\u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 14 \u0639\u062f\u062f)", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", -1]}
{"text": ["\u062a\u0639\u062f\u0627\u062f \u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631 \u062f\u0631 \u0639\u06a9\u0633 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u062a\u0639\u062f\u0627\u062f \u062a\u062d\u0648\u06cc\u0644\u06cc \u0645\u06cc \u0628\u0627\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u062c\u0648 \u062f\u0648 \u0633\u0631", 1]}
{"text": ["\u0645\u06cc\u0632\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u062a\u0631\u062f\u06cc \u06a9\u06cc\u06a9 \u0648 \u067e\u0627\u06cc \u0628\u06cc\u0634 \u0627\u0632 \u0627\u0646\u062f\u0627\u0632\u0647 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 6 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0645\u062e\u0644\u0648\u0637 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u062f\u0631 \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0627\u0632 \u0645\u0631\u0628\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u0648 \u062f\u0644 \u0631\u0627 \u0645\u06cc\u0632\u062f !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06cc\u06a9\u06cc \u062f\u0648 \u062a\u0627 \u0628\u0647 \u062c\u0627\u06cc \u067e\u0646\u06cc\u0631 \u06a9\u0644\u0627 \u062e\u0627\u0645\u0647 \u0632\u062f\u0647 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \n\u06cc\u0639\u0646\u06cc \u0628\u0627\u0648\u0631\u0645 \u0646\u0645\u06cc\u0634\u062f \n\u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u0628\u0631\u0645 \u0628\u0631\u0627\u06cc \u06a9\u0633\u06cc \u062f\u06cc\u062f\u0646 \u0627\u0645\u0627 \u0646\u0634\u062f \u0627\u0648\u0646 \u0631\u0648\u0632 \u0648 \u062f\u0642\u06cc\u0642\u0627 \u06cc\u06a9 \u0647\u0641\u062a\u0647 \u0628\u0639\u062f \u0628\u0627 \u0647\u0645\u0648\u0646 \u062c\u0639\u0628\u0647 \u0631\u0641\u062a\u0645 \u062f\u06cc\u062f\u0646 \u0648\u0642\u062a\u06cc \u0628\u0647\u0645 \u062a\u0639\u0627\u0631\u0641 \u06a9\u0631\u062f\u0646 \u0627\u0646\u062a\u0638\u0627\u0631 \u0633\u0641\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646 \u062f\u0627\u0634\u062a\u0645 \u0627\u0645\u0627 \u0628\u0627\u0648\u0631\u0645 \u0646\u0645\u06cc\u0634\u062f \u0646\u0631\u0645 \u062a\u0627\u0632\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0646\u0647 \u062a\u0648 \u06cc\u062e\u0686\u0627\u0644 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u0627\u06cc\u0646 \u06cc\u0647 \u0647\u0641\u062a\u0647 \u0646\u0647 \u0686\u06cc\u0632\u06cc \n\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \n\u0645\u0631\u0633\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 3 (700 \u06af\u0631\u0645\u06cc)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0633\u0641\u062a \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u062f \u0637\u0639\u0645 \n\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u0648\u0642\u062a\u06cc \u0645\u062d\u0635\u0648\u0644\u0634\u0648\u0646 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u0645\u06cc\u0641\u0631\u0633\u062a\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633 \u0633\u0641\u062a \u0648 \u0645\u0648\u0646\u062f\u0647\n\n\u0641\u0642\u0637 \u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06af\u0631\u062f\u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0641\u0642\u0637 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0686\u0646\u062f\u06cc\u0646 \u0633\u0627\u0644 \u0647\u0633\u062a \u06a9\u0647 \u0645\u0634\u062a\u0631\u06cc \u0627\u06cc\u0646 \u062c\u0627 \u0647\u0633\u062a\u0645.\n\u0628\u062f\u0648\u0646 \u0627\u063a\u0631\u0627\u0642 \u06a9\u0627\u0631\u0634\u0648\u0646 \u062e\u0648\u0628\u0647. \u0648 \u062c\u0627\u0644\u0628 \u0627\u06cc\u0646\u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u0627\u0631\u0634\u0648\u0646 \u0647\u0645\u0648\u0627\u0631\u0647 \u0628\u0627\u0644\u0627 \u0628\u0648\u062f\u0647.\n\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0642\u06cc\u0645\u062a \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0647\u0632\u06cc\u0646\u0647 \u0627\u062c\u0627\u0631\u0647 \u0648 \u0627\u0645\u0644\u0627\u06a9 \u0628\u0627\u0644\u0627 \u0645\u06cc\u0631\u0647 .\n\u0627\u0644\u0628\u062a\u0647 \u0628\u0627\u0628\u062a \u0627\u06cc\u0646 \u0645\u0648\u0636\u0648\u0639 \u0646\u0642\u062f\u06cc \u0628\u0647 \u062a\u0648\u0644\u06cc\u062f \u06a9\u0646\u0646\u062f\u0647 \u062a\u0648 \u0647\u0645\u0686\u06cc\u0646 \u0645\u062d\u0644\u0647 \u0647\u0627 \u06cc\u06cc \u062f\u06cc\u06af\u0647 \u0648\u0627\u0631\u062f \u0646\u06cc\u0633\u062a.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0642\u0628\u0644\u0627 \u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0641\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0645\u0642\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648\u0642\u062a\u06cc \u0627\u0648\u0645\u062f \u0628\u0648\u062f \u0647\u0645\u0647 \u0628\u0627\u0647\u0645 \u0642\u0627\u0637\u06cc \u0634\u062f \u0628\u0648\u062f \u062f\u06cc\u06af\u0647 \u062e\u0631\u06cc\u062f \u0646\u0645\u06cc\u06a9\u0646\u0645", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a\u0632 \u062e\u0648\u0628 \u0628\u0648\u062f \u0628\u0647 \u062c\u0632 \u0643\u064a\u0643 \u0647\u0648\u064a\u0686 \u0643\u0647 \u062e\u0627\u0645\u0647 \u064a \u0631\u0648\u0634 \u0628\u0633\u062a\u0647 \u064a\u0648\u062f \u0648 \u0628\u0647 \u0646\u0638\u0631 \u062a\u0627\u0632\u0647 \u0646\u0645\u064a\u0648\u0645\u062f\n\u062d\u0645\u0644:\n\u0648\u0642\u062a\u064a \u062c\u0639\u0628\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0643\u064a\u0643 \u0647\u0648\u064a\u0686 \u0628\u0631 \u0639\u0643\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u0643\u0647 \u0646\u062d\u0648\u0647 \u064a \u062d\u0645\u0644 \u0645\u0646\u0627\u0633\u0628 \u0646\u0628\u0648\u062f\u0647", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u0643\u0648\u0686\u06a9", "\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0637\u0639\u0645 \u0648 \u0645\u0632\u0647 \u062e\u064a\u0644\u0649 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u0649 \u0648\u0627\u0642\u0639\u0627 \u0627\u0646\u062f\u0627\u0632\u0647 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a \u062e\u064a\u0644\u0649 \u0643\u0645 \u0628\u0648\u062f \u0648 \u0643\u0627\u0645\u0644\u0627 \u0628\u0627 \u0639\u0643\u0633 \u0647\u0627 \u062a\u0641\u0627\u0648\u062a \u062f\u0627\u0634\u062a.\u062f\u0631 \u0643\u0644 \u0631\u0627\u0636\u0649 \u0646\u0628\u0648\u062f\u0645 \u0648 \u062f\u064a\u06af\u0647 \u0633\u0641\u0627\u0631\u0634 \u0646\u0645\u064a\u062f\u0645", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": [" \u0628\u0639\u062f 1\u0633\u0627\u0639\u062a \u0648 10 \u062f\u0642\u06cc\u0642\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u06a9\u0647 \u0627\u06cc\u0646 \u0632\u0645\u0627\u0646 \u0628\u0631\u0627\u06cc \u0622\u0645\u0627\u062f\u0647 \u0633\u0627\u0632\u06cc \u0648 \u062a\u062d\u0648\u06cc\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0627\u0633\u062a!!! \u062d\u062a\u06cc \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a \u0627\u0632 \u0632\u0645\u0627\u0646 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0628\u06cc\u0634\u062a\u0631 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0627\u0634\u062a\u0628\u0627\u0647\u0627 \u0628\u062c\u0627\u06cc \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0627\u0633\u062a\u06cc\u0644\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u06cc\u0634\u06a9\u0631 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062a\u0627\u0631\u0647 \u0646\u0628\u0648\u062f\u060c \u0628\u0627\u0641\u062a \u06a9\u06cc\u06a9 \u0646\u0631\u0645 \u0646\u0628\u0648\u062f \u060c \u067e\u0648\u062f\u0631 \u0634\u06a9\u0631 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u062e\u06cc\u0633 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0646\u0634\u0648\u0646 \u0645\u06cc\u062f\u0627\u062f \u0632\u06cc\u0627\u062f \u062a\u0648 \u06cc\u062e\u0686\u0627\u0644 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 1.100 \u06af\u0631\u0645\u06cc", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u06cc\u06a9\u0645 \u0634\u06a9\u0631 \u0631\u0648\u0634 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\u060c ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u06f2\u06f0 \u0633\u0627\u0644 \u067e\u06cc\u0634 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9\u0634 \u0641\u0642\u0637 \u06a9\u06cc\u06a9 \u0648 \u062e\u0627\u0645\u0647 \u0628\u0648\u062f \u0646\u0647 \u06a9\u06cc\u06a9 \u062a\u0648\u0644\u062f.\n\u0645\u0632\u0634 \u0647\u0645 \u0628\u062f \u0646\u0628\u0648\u062f \u0628\u0647 \u0646\u0638\u0631\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f.\n\u0634\u0645\u0639 \u0647\u0645 \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a\n\u0627\u0635\u0646 \u0631\u0648\u0634\u0646 \u0646\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u0648\u0642\u062a\u06cc \u06a9\u06cc\u06a9 \u0631\u0648 \u0622\u0648\u0631\u062f\u0646 \u06a9\u06cc\u06a9 \u062c\u0627\u0628\u0647 \u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0627\u0632 \u0646\u0638\u0631 \u0637\u0639\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0647\u0631\u0686\u0646\u062f \u06a9\u0647 \u0645\u0646 \u0641\u0631\u0642 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u0648 \u0633\u0648\u0626\u06cc\u0633\u06cc \u0631\u0648 \u0646\u0641\u0647\u0645\u06cc\u062f\u0645\u060c \u0647\u0631\u062f\u0648\u062a\u0627 \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06cc\u06a9\u062c\u0648\u0631 \u0628\u0648\u062f\n\u0648\u0627\u0644\u0628\u062a\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u06af\u0631\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc \u067e\u0633\u062a\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a\n\u0627\u0635\u0644\u0627 \u0641\u06a9\u0631\u0634\u0645 \u0646\u0645\u06cc\u06a9\u0631\u062f\u0645 \u0627\u0646\u0642\u062f\u0631 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0634\u0647\n\u06a9\u0647\u0646\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\n \u0641\u0642\u0637 \u0646\u0648\u0646 \u0648 \u062e\u0627\u0645\u0647 \u062f\u0627\u0634\u062a \u0648 \u0647\u06cc\u0686 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u062f\u0644 \u0631\u0648\u06cc \u062e\u0627\u0645\u0647 \u06a9\u0627\u0645\u0644\u0627\u0646 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0639\u06a9\u0633 \u0633\u0641\u0627\u0631\u0634 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u062f \u0628\u0648\u062f \u060c\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0628\u0648\u062f\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 4 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f \n\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u062a\u062e\u0641\u06cc\u0641 \u06cc\u0644\u062f\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0627\u0634\u062a\u0628\u0627\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u06a9\u0627 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0628\u0633\u064a\u0627\u0631 \u0644\u0637\u064a\u0641 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u0637\u0639\u0645 \u062e\u0627\u0645\u0647 \u0646\u062f\u0627\u0634\u062a\u0646 \u0641\u0642\u0637 \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0627\u0627\u0627\u0644\u06cc \n\u06cc\u0627\u0627\u0627\u0627\u0627\u0634\u0627\u0627\u0627\u0627\u0627\u0633\u06cc\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u062f\u0648 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u062e\u0627\u0645\u0647 \u06cc \u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062a\u0632\u06cc\u06cc\u0646 \u0642\u0634\u0646\u06af \u0648 \u0633\u0627\u062f\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a\u060c \u0641\u0642\u0637 \u062e\u0648\u062f \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u06cc\u06a9\u0645 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0646\u0647 \u0638\u0627\u0647\u0631 \u060c\u0646\u0647 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647\n\n\u0648 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0633\u0631\u0639\u062a \u0648 \u0628\u0631\u062e\u0648\u0631\u062f \u062e\u0648\u0628 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c \u067e\u06cc\u06a9 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a \u0639\u0627\u0644\u064a \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u064a\u062f \u0648 \u0647\u0645 \u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0633\u062a \u0637\u0639\u0645 \u062e\u0627\u0645\u0647 \u0646\u0627\u062a\u0644\u064a \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f \u0628\u0648\u062f \u067e\u0648\u0644\u0645 \u0631\u0627 \u062d\u0631\u0627\u0645 \u06a9\u0631\u062f\u0645 \u06a9\u0647\u0646\u0647 \u0648 \u0633\u0641\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0641\u0631\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f ..\u060c\u060c \u0628\u0627 \u062a\u0686\u0643\u0631 \u0627\u0632 \u0646\u0627\u062a\u0644\u064a \u0647\u0631\u0648\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0698\u0627\u067e\u0646\u06cc \u0628\u0627 \u0637\u0639\u0645 \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f .\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0627 \u0627\u0648\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u0648 \u0639\u06a9\u0633 \u0628\u0648\u062f \u0641\u0631\u0642 \u0645\u06cc\u06a9\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0643\u064a\u0643 \u064a\u0647 \u0645\u0642\u062f\u0627\u0631 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0648 \u06cc\u06a9 \u062a\u06a9\u0647 \u0627\u0632 \u0622\u0646 \u062c\u062f\u0627 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \n\u0643\u064a\u0641\u064a\u062a \u0648 \u0633\u0631\u0639\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u0628\u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0647\u0645 \u06a9\u06cc\u06a9 \u0633\u0627\u0644\u0645 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0646\u0647 \u0645\u062b\u0644 \u0628\u0639\u0636\u06cc \u062c\u0627\u0647\u0627 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0627\u062f\u0645 \u0631\u0648 \u0628\u0627 \u062f\u06cc\u0632\u0627\u06cc\u0646 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0645\u06cc\u0641\u0631\u0633\u062a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0632 \u0648\u0627\u0646\u06cc\u0644\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0645\u062a\u0646\u0648\u0639 \u0628\u0648\u062f.\n\n\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0641\u0631\u0627\u0648\u0627\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0627\u06cc\u0646 \u062f\u0648\u0645\u06cc\u0646 \u0628\u0627\u0631 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0648 \u0628\u0647 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u062f\u0646\u060c\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062a\u0648\u0633\u0637 \u0628\u0648\u062f \u0627\u0645\u0627 \u062f\u0631 \u0627\u0635\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u06a9\u0648\u0686\u06a9 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0645\u062a\u0648\u0633\u0637 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u060c\u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0647\u0645 \u0645\u062a\u0648\u0633\u0637 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645  \u0627\u0645\u0627 \u06a9\u0648\u0686\u06a9 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f \u06a9\u0647 \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc  \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0645 \u0648 \u06af\u0641\u062a\u0646 \u0627\u0634\u062a\u0628\u0627\u0647 \u0634\u062f\u0647\u060c\u0627\u0645\u0627 \u0628\u0646\u0638\u0631 \u0645\u06cc\u0631\u0633\u0647 \u0627\u06cc\u0646 \u0645\u0634\u06a9\u0644 \u0628\u0627 \u0622\u06af\u0627\u0647\u06cc \u0648 \u0627\u0632 \u0639\u0645\u062f \u0647\u0633\u062a\u0634\u060c\u06cc\u06a9 \u0631\u062f\u06cc\u0641 \u062e\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0632\u0646 \u0647\u0645 \u0645\u063a\u0627\u06cc\u0631\u062a \u062f\u0627\u0634\u062a \u060c\u0647\u0645\u06cc\u0646 \u062e\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u062c\u0639\u0628\u0647 \u0628\u0627\u0639\u062b \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u0647\u0645 \u0641\u0634\u0631\u062f\u0647 \u0628\u0634\u0647 \u0648 \u0628\u0686\u0633\u0628\u0646 \u0648 \u0638\u0627\u0647\u0631\u0634\u0648\u0646 \u062e\u0631\u0627\u0628 \u0628\u0634\u0647\u060c\u062e\u0648\u0628 \u0648\u0642\u062a\u06cc \u0642\u0631\u0627\u0631 \u06cc\u0647 \u0645\u062d\u0635\u0648\u0644 \u0628\u0627 \u0638\u0627\u0647\u0631\u06cc \u0646\u0627\u0645\u062a\u0646\u0627\u0633\u0628 \u062f\u0631\u06cc\u0627\u0641\u062a \u06a9\u0646\u0645 \u0686\u0631\u0627 \u0628\u0627\u06cc\u062f \u0627\u0635\u0644\u0627\u064b \u062e\u0631\u06cc\u062f \u06a9\u0646\u0645!!!!\n\u0628\u0646\u062f\u0647 \u0627\u0632 \u0645\u0634\u062a\u0631\u06cc \u0647\u0627\u06cc \u062d\u0636\u0648\u0631\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0628\u0648\u062f\u0645\u060c\u06a9\u0647 \u0628\u0647 \u0639\u0644\u062a \u062c\u0627\u06cc \u067e\u0627\u0631\u06a9 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0648 \u0634\u0644\u0648\u063a\u06cc \u062e\u06cc\u0644\u06cc \u0648\u0642\u062a\u0647\u0627 \u0646\u0645\u06cc\u0634\u0647 \u0627\u0632\u0634\u0648\u0646 \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u060c\u06a9\u0647 \u0628\u0627 \u0627\u06cc\u0646 \u0633\u0631\u0648\u06cc\u0633 \u062e\u0631\u06cc\u062f \u0627\u0632\u0634\u0648\u0646 \u0631\u0627\u062d\u062a \u0634\u062f\u0647 \u0627\u0645\u0627 \u0648\u0642\u062a\u06cc \u062e\u0631\u06cc\u062f \u06a9\u0647 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0645\u06cc\u0634\u0647\u060c\u0627\u06cc\u0646 \u062d\u0633 \u0648 \u0645\u0646\u062a\u0642\u0644 \u0645\u06cc\u06a9\u0646\u0647 \u06a9\u0647 \u0628\u0639\u062f \u0627\u0632 \u062e\u0631\u06cc\u062f \u0645\u0634\u062a\u0631\u06cc \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0627\u0631\u0632\u0634\u06cc \u0646\u062f\u0627\u0631\u0647 \u0686\u0648\u0646 \u06cc\u06a9 \u067e\u0631\u0648\u0633\u0647 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0627\u0633\u062a \u060c\u0648\u0627\u0642\u0639\u0627\u064b \u0645\u062a\u0627\u0633\u0641\u0645\n\u0636\u0645\u0646\u0627\u064b \u0627\u06af\u0631 \u0627\u0632 \u0646\u0638\u0631 \u0642\u06cc\u0645\u062a \u0647\u0645 \u0628\u0631\u0627\u0634\u0648\u0646 \u0628\u0647 \u0635\u0631\u0641\u0647 \u0646\u06cc\u0633\u062a \u0642\u06cc\u0645\u062a \u0648 \u0627\u0635\u0644\u0627\u062d \u06a9\u0646\u0646\u062f \u0646\u0647 \u0648\u0632\u0646 \u0633\u0641\u0627\u0631\u0634 \u0648 \u062a\u063a\u06cc\u06cc\u0631 \u0628\u062f\u0646 \u0627\u0645\u0627 \u062f\u0627\u062e\u0644 \u0645\u0646\u0648 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0631\u06cc \u0646\u0648\u0634\u062a\u0647 \u0628\u0627\u0634\u0647\n\u0636\u0645\u0646\u0627\u064b \u0645\u0627\u0641\u06cc\u0646 \u0648 \u0645\u0627\u0641\u06cc\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0631\u0648 \u0647\u0645 \u0628\u0647 \u0645\u0646\u0648 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0627\u06cc\u0646\u0645 \u062a\u0642\u0635\u06cc\u0631 \u0642\u0646\u0627\u062f\u06cc \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0632\u0645\u0627\u0646 \u0628\u0631\u062f \u0628\u0631\u0633\u0647 \u0627\u0645\u0627 \u0642\u0633\u0645\u062a \u0645\u0647\u0645 \u0645\u0627\u062c\u0631\u0627 \u0627\u0648\u0646\u062c\u0627 \u0628\u0648\u062f \u06a9\u0647 \u062e\u0648\u062f \u0631\u062f\u0648\u0644\u0648\u062a \u06cc\u0639\u0646\u06cc \u06a9\u06cc\u06a9 \u0633\u0641\u062a \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0633\u0641\u062a!! \u0627\u0644\u0628\u062a\u0647 \u062e\u0627\u0645\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0628\u0631\u0627\u06cc \u0647\u0645\u06cc\u0646 \u0628\u0639\u06cc\u062f \u0645\u06cc\u062f\u0648\u0646\u0645 \u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0647 \u0628\u0627\u0634\u0647 \u0627\u0645\u0627 \u0647\u062f\u0686\u06cc \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u06a9\u06cc\u06a9 \u0644\u0637\u06cc\u0641\u06cc \u0646\u0628\u0648\u062f \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0646\u0645\u06cc\u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f!\u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647!\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u064a\u0643 \u0639\u0627\u0644\u064a!\u0645\u062a\u0634\u0643\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u0646\u0648\u0639 \u0627\u0631\u0633\u0627\u0644 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u067e\u06cc\u06a9 \u0647\u0645 \u0627\u0632 \u0645\u0646 \u062e\u0648\u0627\u0633\u062a \u0686\u06a9 \u06a9\u0646\u0645 \u0628\u0628\u06cc\u0646\u0645 \u06a9\u06cc\u06a9 \u062f\u0631\u0633\u062a\u0647\u061f \u062e\u0631\u0627\u0628 \u0646\u0634\u062f\u0647\u061f \u06a9\u0644\u0627 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u062a\u062d\u0648\u06cc\u0644 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0645\u0646 \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0647\u0645 \u062a\u0627\u0632\u06af\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645 \u062d\u062c\u0645 \u0627\u0648\u0646 \u0648 \u0647\u0645 \u0633\u0631\u0639\u062a \u0648 \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u062e\u0648\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0645\u0634\u06a9\u0644\u0634 \u0627\u0632 \u06a9\u062c\u0627 \u0628\u0648\u062f \u06a9\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u0634\u0644 \u0648 \u0648\u0644 \u0628\u0648\u062f!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0633\u0627\u0646\u0633\u0648\u0631 \u062e\u0631\u0627\u0628 \u0628\u0648\u062f .\u0628\u0627 \u067e\u0644\u0647 \u0627\u0648\u0645\u062f \u0628\u0627\u0644\u0627 .\u0648 \u0627\u0639\u062a\u0631\u0627\u0636 \u0646\u06a9\u0631\u062f.\u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 17 \u0639\u062f\u062f)", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u0645\u0646 \u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0632\u0646\u06af \u0632\u062f \u06a9\u0647 \u0646\u0627\u0646 \u0633\u062d\u0631 \u06af\u0641\u062a\u0647 \u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0644\u0642\u0645\u0647 \u0645\u06a9 ! \u0645\u0648\u0646\u062f\u0647 \u06a9\u0647 \u0645\u06cc\u06af\u0641\u062a \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u06cc\u0647...\u0645\u0646\u0645 \u06af\u0641\u062a\u0645 \u0628\u06cc\u0627\u0631\u0646.\u0627\u06af\u0647 \u06cc\u0647 \u0646\u0648\u0639 \u062f\u06cc\u06af\u0647 \u0627\u0632\u0648\u0646 \u062f\u0633\u062a\u0647 \u0646\u0627\u0646 \u0647\u06cc\u062a ...\u062f\u0648\u062a\u0627 \u0646\u0627\u0646 \u0628\u0631\u06af\u0631 \u0633\u0641\u06cc\u062f\u06a9\u0648\u0686\u06cc\u06a9 \u06a9\u0647 \u06a9\u0646\u0627\u0631 \u0633\u0648\u062e\u0627\u0631\u06cc \u0645\u06cc\u0632\u0627\u0631\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0628\u0627 \u0642\u06cc\u0645\u062a \u0647\u0645\u0648\u0646 \u0646\u0627\u0646 !  7000 \u062a\u0648\u0645\u0646 !!!!! \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u06cc \u062f\u0642\u062a\u06cc \u06a9\u0627\u0631\u06a9\u0646\u0627\u0646 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0647\u0645\u06cc\u0634\u06af\u06cc \u0647\u0633\u062a \u0645\u0648\u0633 \u0641\u0646\u062f\u0642 \u0647\u0645 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0641\u0631\u0633\u062a\u0627\u062f \u0627\u0627\u0628\u062a\u0647 \u06cc\u062f\u0648\u0646\u0647 \u0641\u0646\u062f\u0642 \u0647\u0645 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u0631\u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 !!! \u06a9\u0647 \u0627\u062b\u0631\u06cc \u0627\u0632 \u0646\u0648\u062a\u0644\u0627 \u062a\u0648\u0634 \u0646\u0628\u0648\u062f . \u0627\u0648\u0646\u0645 \u0634\u06a9\u0644\u0627\u062a \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u06a9\u0631\u0645", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (1 \u0639\u062f\u062f)", "\u0645\u0648\u0633 \u0641\u0646\u062f\u0648\u0642 (1 \u0639\u062f\u062f)", "\u0628\u0631\u0628\u0631\u06cc \u0647\u0641\u062a \u06af\u06cc\u0627\u0647", "\u0644\u0642\u0645\u0647 \u0645\u06a9", -1]}
{"text": ["\u0645\u0646 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc 1 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0622\u0648\u0631\u062f\u0647 \u0634\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc 10 \u0639\u062f\u062f\u06cc \u0628\u0648\u062f  .  \u0645\u0646 \u0647\u0632\u06cc\u0646\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0631\u0648 \u067e\u0631\u062f\u0627\u062e\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u062c\u0648 \u062f\u0648\u0633\u0631", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 10 \u0639\u062f\u062f)", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0627\u0631\u0633\u0627\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0631\u0648\u0632 \u0642\u0628\u0644 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f\u0627 6 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0631 \u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0627\u062f\u0645 \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f!\n", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a", "\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u0643 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", -1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0628\u062c\u0627\u06cc \u0622\u0698\u0627\u0646\u0633 \u0627\u0632 \u062e\u0648\u062f \u067e\u06cc\u06a9 \u0647\u0627\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u06a9\u0648\u0686\u06a9", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc 2", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0627\u0631\u0633\u0627\u0644 \u0627\u0632 \u06a9\u0648\u0647 \u0646\u0648\u0631 \u062a\u0627 \u062e\u06cc\u0627\u0628\u0627\u0646 \u0639\u0645\u0627\u0631 \u06f1\u06f2\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0627\u0646 \u0628\u0648\u062f. ", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u0628\u0644\u063a \u062d\u0645\u0644 \u0628\u0633\u064a\u0627\u0631 \u0632\u064a\u0627\u062f \u0628\u0648\u062f ", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0632\u06cc\u0628\u0627. \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u06cc\u0646\u0638\u06cc\u0631. \u062d\u062a\u0645\u0627 \u0628\u0627\u0632\u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u0627\u0647\u0645 \u062f\u0627\u062f. \u0641\u0642\u0637 \u062d\u06cc\u0641 \u06a9\u0647 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644\u0634 \u0627\u0646\u0642\u062f\u0631 \u0632\u06cc\u0627\u062f\u0647", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u0648\u0627\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u062f\u0631 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u0628\u0627 \u0627\u0698\u0627\u0646\u0633 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f \u0648 \u0647\u0632\u064a\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0646\u0633\u0628\u062a \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u0632\u064a\u0627\u062f \u0628\u0648\u062f", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u0643\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628. \u0627\u0645\u0627 \u0647\u0632\u06cc\u0646\u0647 \u06cc \u0622\u0698\u0627\u0646\u0633 \u0628\u0633\u06cc\u0627\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f. \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u06a9\u0647 \u0641\u0627\u0635\u0644\u0647 \u06cc \u0645\u0646\u0632\u0644 \u062a\u0627 \u0627\u06cc\u0646 \u0634\u0639\u0628\u0647 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 5 \u062f\u0642\u06cc\u0642\u0647 \u0646\u06cc\u0633\u062a. \u0627\u06af\u0631 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u0641\u0639\u0627\u0644\u06cc\u062a \u06a9\u0646\u062f \u0628\u0633\u06cc\u0627\u0631 \u0645\u0637\u0644\u0648\u0628 \u062a\u0631 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f \u0648 \u0642\u0637\u0639\u0627 \u0633\u0641\u0627\u0631\u0634 \u0628\u0627\u0644\u0627\u062a\u0631\u06cc \u0627\u0646\u062c\u0627\u0645 \u062e\u0648\u0627\u0647\u062f \u0634\u062f", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u067e\u0648\u062f\u064a\u0646\u06af \u0643\u0648\u0686\u06a9", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0634\u0645\u0639 \u0628\u0633\u064a\u0627\u0631 \u0643\u0648\u0686\u0643 \u0628\u0648\u062f \u0643\u0647 \u062d\u062f\u0648\u062f \u0661 \u062f\u0642\u064a\u0642\u0647 \u0628\u064a\u0634\u062a\u0631 \u0631\u0648\u0634\u0646 \u0646\u0645\u0648\u0646\u062f !!\n\u0642\u0637\u0631 \u067e\u0627\u064a \u0662\u0660 \u0633\u0627\u0646\u062a \u0628\u0648\u062f \u0643\u0647 \u0628\u064a\u0634\u062a\u0631 \u0628\u0647 \u0633\u0627\u064a\u0632 \u0645\u062a\u0648\u0633\u0637 \u0645\u064a\u0627\u062f \u0648 \u0627\u0628\u0631\u0648. \u0631\u064a\u0632\u064a \u0645\u064a\u0634\u0647 \u0648\u0642\u062a\u064a \u062c\u0627\u064a\u064a \u0628\u0628\u0631\u064a !\n\u0645\u0631\u0628\u0627\u064a \u0627\u0644\u0628\u0627\u0644\u0648\u064a\u064a \u0632\u064a\u0627\u062f\u064a \u0634\u064a\u0631\u064a\u0646 \u062f\u0627\u0634\u062a \u0648 \u0646\u0627\u0646 \u0645\u0639\u0645\u0648\u0644\u064a .\n\u0628\u0631\u0627\u064a \u0641\u0627\u0635\u0644\u0647 \u0643\u0645\u062a\u0631 \u0627\u0632 \u0661 \u0643\u064a\u0644\u0648\u0645\u062a\u0631 \u0661\u0662 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0646 \u0647\u0632\u064a\u0646\u0647 \u0622\u0698\u0627\u0646\u0633 \u06af\u0631\u0641\u062a\u0647 \u0634\u062f \u060c \u0643\u0647 \u0628\u0631\u0627\u064a \u0622\u0698\u0627\u0646\u0633 \u0647\u0645 \u0632\u064a\u0627\u062f \u0647\u0633\u062a \u060c \u0627\u0645\u0627 \u0628\u0627 \u067e\u064a\u0643 \u0645\u0648\u062a\u0648\u0631\u064a \u0627\u0631\u0633\u0627\u0644 \u0634\u062f .\n\u0646\u0648\u0634\u062a\u0647 \u062a\u0628\u0631\u064a\u0643 \u0631\u0648 \u0642\u0631\u0627\u0631 \u0634\u062f  \u0631\u0648\u064a \u0645\u0642\u0648\u0627 \u0628\u0646\u0648\u064a\u0633\u0646 \u0643\u0647  \u0641\u0631\u0627\u0645\u0648\u0634 \u0643\u0631\u062f\u0646 ...\n\u062f\u0631 \u0643\u0644 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u064a \u0646\u064a\u0633\u062a\u0645 .", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 \u0633\u0647", "\u0634\u0645\u0639 \u0646\u0647", -1]}
{"text": ["\u0634\u0631\u064a\u0646\u064a \u0647\u0627 \u0647\u0645\u0647 \u062e\u0634\u0643 \u0648 \u0633\u0641\u062a \u0628\u0648\u062f \u0627\u0635\u0644\u0627\u064b \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0645\u0648\u0646\u062f\u06af\u064a \u0645\u064a\u062f\u0627\u062f \u0647\u0631\u06af\u0632 \u062f\u064a\u06af\u0647 \u0633\u0641\u0627\u0631\u0634 \u0646\u0645\u064a\u062f\u0645\u060c \u0642\u0628\u0644\u0627\u064b \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u0627\u0644\u0627\u0646 \u0648\u0627\u0642\u0639\u0627\u064b \u0628\u062f \u0648 \u063a\u064a\u0631 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0634\u062f\u0647 \u0643\u064a\u0641\u064a\u062a\u0634\u060c \u0645\u0627 \u0643\u0647 \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u0628\u064a\u0634\u062a\u0631\u0634 \u0631\u0648 \u0631\u064a\u062e\u062a\u064a\u0645 \u062f\u0648\u0631 \n", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u062f\u0631\u0633\u062a \u0628\u0647 \u0645\u0648\u0642\u0639 \u0622\u0645\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u0627\u0645\u0627 \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u0641\u0627\u0635\u0644\u0647 \u0628\u0646\u062f\u0647 \u062a\u0627 \u0642\u0646\u0627\u062f\u06cc \u06a9\u0645\u062a\u0631 \u0627\u0632 \u062f\u0647 \u062f\u0642\u06cc\u0642\u0647 \u0647\u0633\u062a \u062d\u062f\u0648\u062f\u0627 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0648 \u0646\u06cc\u0645 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u067e\u0627\u0633 \u0627\u0632 \u0632\u062d\u0645\u0627\u062a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u060c \u0638\u0627\u0647\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0686\u06cc\u062f\u0645\u0627\u0646 \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0645\u0637\u0644\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0646\u0638\u0631 \u06a9\u0645\u062a\u0631 \u0627\u0632 \u0645\u06cc\u0632\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u060c \u0648\u067e\u0633 \u0627\u0632 \u0633\u0647 \u0628\u0627\u0631 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0648 \u062a\u0627\u062e\u06cc\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u0627\u0631\u0645\u0646\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u062a\u0627\u062e\u06cc\u0631 \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f \u0648 \u0686\u0648\u0646 \u0645\u0627 \u062a\u0648\u0644\u062f \u062f\u0627\u0634\u062a\u06cc\u0645 \u0648 \u0642\u0631\u0627\u0631 \u0628\u0631 \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u06a9\u0644\u0627 \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u06a9\u0646\u0633\u0644 \u0634\u062f \u0648 \u0647\u0645\u0686\u0646\u06cc\u0646 \u0645\u0627 \u062f\u0627\u0646\u0634\u062c\u0648\u06cc\u06cc\u0645 \u0648 \u0628\u0627\u06cc\u062f \u0628\u0647 \u06a9\u0644\u0627\u0633 \u0645\u06cc\u0631\u0641\u062a\u06cc\u0645 \u0648 \u0627\u06cc\u0646 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f \u0645\u0634\u06a9\u0644 \u0633\u0627\u0632 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 2", "\u0634\u0645\u0639 \u0639\u062f\u062f 0", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0628\u0627\u062f\u0627\u0645 \u062f\u0648\u0631\u0634 \u0628\u0647 \u0646\u0633\u0628\u062a \u062c\u0627\u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0628\u062f \u0646\u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0644\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a.\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0632\u064a\u0646\u0647 \u067e\u064a\u0643\u0634\u0648\u0646 \u0631\u0648 \u062e\u064a\u0644\u064a \u0628\u0627\u0644\u0627 \u06af\u0630\u0627\u0634\u062a\u0646 \u0628\u0627\u064a\u062f \u0627\u0635\u0644\u0627\u062d \u0643\u0646\u0646\u062f \u0648\u06af\u0631\u0646\u0647 \u0628\u0647 \u0635\u0631\u0641\u0647 \u0646\u064a\u0633\u062a \u0648 \u0645\u0648\u0642\u0639\u064a \u0643\u0647 \u0634\u064a\u0631\u064a\u0646\u0634\u0648\u0646 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0647 \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0633\u062a \u0628\u0647 \u0627\u064a\u0646 \u0645\u0648\u0631\u062f \u0647\u0645 \u062a\u0648\u062c\u0647 \u0643\u0646\u0646 \u0643\u0647 \u0627\u06af\u0647 \u062a\u0627\u0632\u0647 \u0646\u064a\u0633\u062a \u0646\u0641\u0631\u0633\u062a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u06a9\u06cc\u06a9\u0634 \u06cc\u06a9\u0645 \u0645\u0632\u0647 \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0633\u0644\u0627\u0645   \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u064a\u062f \u0645\u0646 \u0627\u0645\u0631\u0648\u0632 \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u064a\u0634\u0643\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u0634\u062a\u0645 \u0648 \u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u06af\u0645 \u0627\u0635\u0644\u0627\u064b \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u062d\u062f\u0627\u0642\u0644 \u0628\u0631\u0627\u064a \u062f\u064a\u0631\u0648\u0632 \u0628\u0648\u062f\u0647 \n\u0648 \u0645\u064a\u062f\u0648\u0646\u0645 \u0641\u0627\u064a\u062f\u0647 \u0646\u062f\u0627\u0631\u0647 \u0646\u0638\u0631 \u0648 \u0627\u0646\u062a\u0642\u0627\u062f \u0645\u0634\u062a\u0631\u064a !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 1.100 \u06af\u0631\u0645\u06cc", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0644\u0630\u062a \u0645\u06cc\u200c\u0628\u0631\u062f\u0645 \u0627\u0645\u0631\u0648\u0632 \u0622\u0646\u0642\u062f\u0631 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0632 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0622\u0628 \u0686\u06a9\u0647 \u0645\u06cc\u06a9\u0631\u062f \u0648\u062e\u06cc\u0633 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0633\u0628\u062f \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647.. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0634\u06a9\u0644 \u0627\u0635\u0644\u06cc \u062e\u0648\u062f \u0627\u0633\u0646\u067e \u0627\u0633\u062a \u06a9\u0647 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0627\u0631\u0633\u0627\u0644 \u0646\u06a9\u0631\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0645 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0627\u0631\u0633\u0627\u0644 \u0646\u06a9\u0631\u062f !!!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u062f\u0633\u0631 \u0631\u0648\u0644\u062a\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", -1]}
{"text": ["\u0644\u0648\u062a\u06a9\u0627 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0648\u062a\u06a9\u0627 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0631\u0648\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u0628\u0648\u062f \u0628\u0647 \u062c\u0627\u0634 \u0645\u06cc\u0648\u0647 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u0698\u0644\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0627\u0642\u0627 \u062f\u0633\u062a \u06af\u0644\u062a\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647 .\u0639\u0627\u0644\u06cc \u0628\u0648\u062f.\u0645\u0631\u0633\u06cc \u0628\u0631\u0627\u06cc \u0646\u0648\u0634\u062a\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9.\u06a9\u06cc\u06a9 \u0635\u062d\u06cc\u062d \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f .\u0645\u0645\u0646\u0648\u0646 \u0628\u0627\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u0698\u0644\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0627\u0647\u0631\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062a\u062e\u0645\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0627\u062a\u0627 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0631\u0627\u06cc \u0622\u062f\u0631\u0633 \u0647\u0627\u06cc \u0646\u0632\u062f\u06cc\u06a9 \u0628\u0647 \u0645\u062d\u0644 \u0633\u0641\u0627\u0631\u0634 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0632\u06cc\u0627\u062f \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u06cc\u062a\u0627\u0644\u06cc\u0627\u06cc\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0633\u0646\u067e \u0643\u064a\u0643 \u0631\u0648 \u0633\u0627\u0644\u0645 \u0646\u0631\u0633\u0648\u0646\u062f\u060c \u0643\u062c \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0645\u0648\u0642\u0639 \u0647\u0627\u06cc \u0636\u0631\u0648\u0631\u06cc \u0628\u0647 \u062f\u0627\u062f\u0645 \u0645\u06cc\u0631\u0633\u06cc\u062f\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0628\u0631\u0646\u0627\u0645\u0647 \u062e\u0648\u0628\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u06cc\u0686 \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0627 \u0645\u0634\u062e\u0635\u0627\u062a \u0627\u0631\u0627\u0626\u0647 \u0634\u062f\u0647 \u0646\u062f\u0627\u0634\u062a. \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u062e\u06cc\u0644\u06cc \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f. :(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc ... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0648\u0686\u06a9", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633 \u06a9\u0631\u0645\u062f\u0627\u0631 \u067e\u0633\u062a\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0632 \u0646\u0638\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u062a\u0644\u06cc \u0647\u06cc\u0686 \u062a\u0631\u062f\u06cc\u062f\u06cc \u0646\u062f\u0627\u0631\u0645 \u06a9\u0647 \u0639\u0627\u0644\u06cc\u0647\u060c\u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u06cc\u062f\u0647 \u0648\u0627\u0631\u0648\u0646\u0647 \u0634\u062f\u0647 \u0648 \u0644\u0647 \u0634\u062f\u0647.\u06af\u0648\u06cc\u0627 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u06a9\u062c \u06af\u0631\u0641\u062a\u0646 \u0648 \u0622\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u062a\u0644 \u062e\u0644\u0627\u0644 \u062f\u0627\u0631", -1]}
{"text": ["\u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u062f \u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u0627\u0641\u06cc\u0646 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0627\u0631\u0633\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0647\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u067e\u06cc \u0628\u0627 \u0645\u063a\u0632\u06cc \u062a\u0645\u0634\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0627\u06cc\u0646 \u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0648\u0645\u06cc\u0647 \u0639\u0627\u0644\u06cc\u0647 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u064a\u0686 \u0634\u0628\u0627\u0647\u062a\u064a \u0628\u0647 \u0639\u0643\u0633 \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0642\u0637\u0639\u0647 \u0642\u0637\u0639\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0631\u0628\u0639\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0631\u0628\u0639\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062c\u0646\u0633\u0647\u0627 \u0648\u0627\u0642\u0639\u0627 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0633\u062a\u0646 \u0641\u0642\u0637 \u0648\u0642\u062a\u06cc \u062a\u0645\u0648\u0645 \u0645\u06cc\u0634\u0647 \u0628\u0632\u0646\u06cc\u0646 \u062a\u0648 \u0633\u06cc\u0633\u062a\u0645 \u062a\u0645\u0648\u0645 \u0645\u06cc\u0634\u0647 \u06cc\u0627 \u0627\u0635\u0644\u0627 \u06a9\u0627\u0634\u06a9\u06cc \u0627\u0633\u0646\u06a9 \u0627\u0627\u062a\u0648\u0646 \u0647\u06cc\u0686 \u0648\u0642\u062a \u062a\u0645\u0648\u0645 \u0646\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0633\u0646\u06a9 \u0698\u0627\u0645\u0628\u0648\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0631\u0628\u0639\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u064a\u0634\u062a\u0631 \u0648\u0632\u0646 \u0628\u0627\u0628\u062a \u062c\u0639\u0628\u0647 \u0648 \u0638\u0631\u0641 \u0628\u0648\u062f\n\u0646\u0647 \u062e\u0648\u062f \u0628\u0627\u0642\u0644\u0648\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u0644\u0627 \u06a9\u06cc\u06a9 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0645\u062c\u06cc\u06a9", -1]}
{"text": ["\u0628\u0647\u062a\u0631\u0647 \u0633\u0641\u0627\u0631\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0647\u0645 \u0628\u0630\u0627\u0631\u06cc\u0646 \u0648\u06af\u0631\u0646\u0647 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0631\u0627\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u060c\u0627\u0648\u0646 \u0647\u0645 \u062f\u0631 \u0645\u062d\u062f\u0648\u062f\u0647 \u060c\u0622\u0645\u0627\u062f\u0647 \u0633\u0627\u0632\u06cc 50 \u062f\u0642\u06cc\u0642\u0647 \u0627\u06cc \u0645\u0639\u0642\u0648\u0644 \u0646\u06cc\u0633\u062a .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0646\u0631\u0645 \u0648 \u062e\u0645\u064a\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc\u060c \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0627\u0648\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0627\u062a\u0631\u06cc\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0647\u0627 \u0645\u062f\u062a \u0632\u0645\u0627\u0646 \u0632\u06cc\u0627\u062f\u06cc \u062f\u0627\u062e\u0644 \u0634\u0647\u062f\u0634\u0648\u0646 \u0628\u0648\u062f\u0646 \u0648 \u0646\u0631\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u062a\u064f\u0631\u062f\u06cc\u0634\u0648\u0646 \u0631\u0648 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u0647 \u0628\u0648\u062f\u0646\n\u0645\u0632\u0647 \u0648 \u0639\u0637\u0631 \u0648 \u0637\u0639\u0645\u0634\u0648\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": [" \u062f\u0648\u0646\u0627\u062a \u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u200c\u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a . \u0628\u0633\u062a\u0647 \u0628\u062f\u0648\u0646 \u062a\u0627\u062e\u06cc\u0631 \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648 \u062f\u0648\u0646\u0627\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u062f\u0645 \u062a\u0637\u0627\u0628\u0642 \u0645\u0646\u0648 \u0648 \u0645\u0648\u062c\u0648\u062f\u06cc \u0641\u0631\u0648\u0634\u06af\u0627\u0647\u060c \u062a\u063a\u06cc\u06cc\u0631 \u0642\u06cc\u0645\u062a \u0622\u0698\u0627\u0646\u0633 \u067e\u0633 \u0627\u0632 \u067e\u0631\u062f\u0627\u062e\u062a \u0642\u0637\u0639\u06cc", "\u06a9\u0648\u06a9\u06cc \u0645\u06cc\u06a9\u0633 \u0641\u0627\u062c", "\u06a9\u0648\u06a9\u06cc \u0641\u0627\u062c", "\u06a9\u0648\u06a9\u06cc \u0645\u06cc\u06a9\u0633 \u0648\u0627\u06cc\u062a", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f....\n\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0641\u0631\u0645\u0627\u0646\u06cc\u0647 \u0628\u062e\u0627\u0637\u0631 \u0647\u0645\u06a9\u0627\u0631\u06cc \u0648 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0647\u0627\u0634\u0648\u0646", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0639\u0627\u0644\u064a \u0641\u0642\u0637 \u0647\u0632\u064a\u0646\u0647 \u067e\u064a\u0643 \u0631\u0648 \u0643\u0645 \u0643\u0646\u064a\u0646\n\u062e\u064a\u0644\u064a \u0628\u0627\u0644\u0627\u0633\u062a", "\u0645\u06cc\u0646\u06cc \u0646\u0647 \u062a\u0627\u06cc\u06cc", "\u0628\u06cc\u0633\u06a9\u0627\u062a\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc (\u0634\u06a9\u0644\u0627\u062a \u0641\u0646\u062f\u0642)", 1]}
{"text": ["\u0647\u0632\u064a\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0633\u064a\u0627\u0631 \u0632\u064a\u0627\u062f \u0628\u0648\u062f\n\u062a\u0631\u062c\u064a\u062d \u0645\u064a\u062f\u0647\u0645 \u062f\u064a\u06af\u0647 \u0646\u06af\u064a\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0634\u0645\u0627\u0631\u0647 \u06cc\u06a9", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u062f\u0631 \u0645\u0648\u0631\u062f \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u06a9\u06cc\u06a9 \u0644\u0637\u0641\u0627 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0634\u0648\u062f \u062a\u0627 \u0633\u0627\u0644\u0645 \u062f\u0631\u06cc\u0627\u0641\u062a \u06a9\u0646\u06cc\u0645\n\u0645\u0631\u0633\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0645\u0645\u0646\u0648\u0646", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", "\u0645\u06cc\u0646\u06cc \u0646\u0647 \u062a\u0627\u06cc\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u06cc\u0628 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0642\u064a\u0645\u062a \u0647\u0627 \u0628\u0647 \u0637\u0648\u0631 \u063a\u064a\u0631 \u0645\u0639\u0645\u0648\u0644 \u0628\u0627\u0644\u0627\u0633\u062a", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f...", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u06cc\u06a9\u0633 \u06cc\u062e\u0686\u0627\u0644\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0644\u0637\u0641\u0627 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0648 \u06a9\u0627\u0647\u0634 \u0628\u062f\u06cc\u0646 \u0628\u0627 \u0633\u067e\u0627\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062c\u062f\u0627\u064a \u0627\u0632 \u0637\u0639\u0645 \u0643\u0647 \u0633\u0644\u064a\u0642\u0647 \u0627\u064a \u0645\u062d\u0633\u0648\u0628 \u0645\u064a\u0634\u0647 \u060c \u0633\u0631\u0639\u062a \u0627\u0631\u0633\u0627\u0644 \u0632\u064a\u0631 \u0661\u0665 \u062f\u0642\u064a\u0642\u0647 \u0628\u0648\u062f \u0643\u0647 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u060c \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u0647\u0645 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f . \u0641\u0642\u0637 \u0647\u0632\u064a\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u064a\u0643\u0645 \u0632\u064a\u0627\u062f \u0628\u0648\u062f \u0643\u0647 \u0627\u0645\u064a\u062f\u0648\u0627\u0631\u0645 \u0628\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u062e\u0648\u062f \u067e\u064a\u0643 \u0627\u0633\u0646\u067e \u0628\u062c\u0627\u064a \u0622\u0698\u0627\u0646\u0633 \u0627\u064a\u0646 \u0645\u0633\u0627\u0644\u0647 \u0647\u0645 \u062d\u0644 \u0628\u0634\u0647 . ", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u067e\u0627\u067e \u06a9\u06cc\u06a9", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0628\u0648\u062f\n\u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0627\u06cc\u062f \u0628\u0631\u0627\u06cc \u0627\u0631\u0633\u0627\u0644 \u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0648 \u06cc\u0627 \u0631\u0627\u0647\u06a9\u0627\u0631 \u062f\u06cc\u06af\u0631\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0646\u062f. \u0645\u0645\u0646\u0648\u0646", "\u06a9\u0648\u06a9\u06cc \u0633\u06cc\u0628 \u0648 \u0647\u0648\u06cc\u062c", "\u06a9\u0648\u06a9\u06cc \u0686\u0627\u06a9\u0644\u062a \u0686\u06cc\u067e", "\u06a9\u0648\u06a9\u06cc \u0645\u0627\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0648\u0627\u06cc\u062a \u0686\u0627\u06a9\u0644\u062a", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631 \u0631\u0627\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u062e\u0631\u062a\u0628 \u0648 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0643\u064a\u0643 \u0648\u0642\u062a\u064a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062d\u0633\u0627\u0628\u064a \u0643\u062c \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u0627\u0632 \u0631\u0648\u064a \u0645\u0648\u062a\u0648\u0631 \u0632\u0645\u064a\u0646 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0638\u0627\u0647\u0631\u0634 \u0627\u0635\u0644\u0627 \u0634\u0628\u064a\u0647 \u0643\u064a\u0643 \u0627\u0646\u062a\u062e\u0627\u0628\u064a \u0645\u0646 \u0646\u0628\u0648\u062f ", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 3 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u062f\u0627\u062e\u0644 \u0639\u06a9\u0633 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0631\u0627 \u0646\u06cc\u0627\u0648\u0631\u062f\u0646\u062f\u060c \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0646\u0627\u0631\u0627\u062d\u062a \u0634\u062f\u0645\u060c \u0644\u0637\u0641\u0627 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0637\u0628\u0642 \u0639\u06a9\u0633 \u062f\u0642\u062a \u0641\u0631\u0645\u0627\u06cc\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\u0645\u0646 \u062f\u0648 \u0639\u062f\u062f \u0634\u0645\u0639 \u0639\u062f\u062f \u06f3 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u06f1 \u0639\u062f\u062f \u062a\u062d\u0648\u06cc\u0644 \u0628\u0646\u062f\u0647 \u0634\u062f", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", 1]}
{"text": ["besiaaaaar aaaaaliii", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0632\u064a\u0646\u0647 \u0647\u0627\u0649 \u0627\u0631\u0633\u0627\u0644 \u0628\u0631\u0627\u0649 \u0645\u0633\u064a\u0631\u0647\u0627\u0649 \u0646\u0632\u062f\u064a\u0643 \u062e\u064a\u0644\u0649 \u0632\u064a\u0627\u062f\u0647 !!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0627\u0633\u062a\u06cc\u0644\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0645\u06cc\u06a9\u0633 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u0634\u0627\u0645\u0644 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc\u060c \u0631\u0648\u0644\u062a\u060c \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0648 \u0644\u0637\u06cc\u0641\u0647 \u0647\u0633\u062a\u060c \u062a\u0648\u06cc \u0633\u0641\u0627\u0631\u0634 \u0646\u0648\u0634\u062a\u0645 \u0628\u0647 \u062c\u0627\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0630\u0627\u0631\u0646\u060c \u06a9\u0644\u0627 \u0631\u0648\u0644\u062a \u0648 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06af\u0630\u0627\u0634\u062a\u0646 \u0641\u0642\u0637 ! \n\u0627\u06cc\u0646\u06a9\u0647 \u0628\u0647 \u0645\u0634\u062a\u0631\u06cc \u0627\u062d\u062a\u0631\u0627\u0645 \u0646\u0645\u06cc \u0630\u0627\u0631\u06cc\u0646 \u0648 \u0628\u062f\u0648\u0646 \u0627\u062c\u0627\u0632\u0647 \u0648 \u0627\u0637\u0644\u0627\u0639 \u06a9\u0627\u0631\u06cc \u06a9\u0647 \u062f\u0648\u0633\u062a \u062f\u0627\u0631\u06cc\u0646 \u0631\u0648 \u0627\u0646\u062c\u0627\u0645 \u0645\u06cc\u062f\u06cc\u0646 \u0628\u0627\u0639\u062b \u0645\u06cc\u0634\u0647 \u0646\u0647 \u062a\u0646\u0647\u0627 \u062f\u06cc\u06af\u0647 \u062e\u0631\u06cc\u062f \u0645\u062c\u0627\u0632\u06cc \u060c \u0628\u0644\u06a9\u0647 \u062f\u06cc\u06af\u0647 \u062d\u0636\u0648\u0631\u06cc \u0647\u0645 \u062e\u0631\u06cc\u062f \u0646\u06a9\u0646\u0645 \u0627\u0632\u062a\u0648\u0646 ! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1.400 \u06af\u0631\u0645\u06cc (20 \u062a\u0627 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0627\u062d\u0627\u0644\u06cc\u062f. \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f. \u0645\u0646 \u06cc\u0647 \u0646\u0638\u0631 \u062f\u0627\u0631\u0645. \u0645\u062b\u0644\u0627 \u0628\u0631\u0627\u06cc \u062a\u0628\u0644\u06cc\u063a \u062e\u0648\u062f\u062a\u0648\u0646\u060c \u063a\u0630\u0627 \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u060c \u062d\u062a\u06cc \u0628\u0647 \u0645\u0642\u062f\u0627\u0631 \u062e\u06cc\u0644\u06cc \u06a9\u0645\u060c \u0628\u0647 \u0635\u0648\u0631\u062a \u0631\u0646\u062f\u0645 \u0628\u06cc\u0627\u0631\u06cc\u062f \u062f\u0645 \u062e\u0648\u0646\u0647 \u0647\u0627 \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u06a9\u0646\u06cc\u062f!!! \u062e\u06cc\u0644\u06cc \u0628\u0627\u062d\u0627\u0644 \u0645\u06cc \u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f !!!!!", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0646\u06cc\u0648\u0645 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0631\u062a \u0647\u0627 \u0631\u0648 \u06a9\u0646\u0627\u0631 \u0647\u0645 \u0628\u0632\u0648\u0631 \u062a\u0648\u06cc \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u06a9\u0648\u0686\u06a9 \u0686\u067e\u0627\u0646\u062f\u0647 \u0627\u0646\u062f \u0648 \u062e\u0631\u062f \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f.  \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0648 \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc! ", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06a9\u0648\u0686\u06a9) 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0644\u0637\u0641\u0646 \u067e\u06cc\u06a9 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u06a9\u0646\u0647\u060c \u0686\u0648\u0646 \u0628\u0639\u0636\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0648 \u062e\u0627\u0645\u0647 \u0647\u0627 \u0628\u0647 \u0628\u0642\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0647\u0633\u062a\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062c\u062f\u062f\u0627 \u067e\u06cc\u06a9 \u0645\u0631\u0628\u0648\u0637\u0647 \u062c\u0639\u0628\u0647 \u0631\u0627 \u0628\u0627 \u0634\u0631\u0627\u06cc\u0637 \u0628\u062f\u06cc \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646\u062f \u0648 \u0645\u062d\u062a\u0648\u06cc\u0627\u062a \u0622\u0646 \u0631\u0648\u06cc \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f . \u0627\u0646\u06af\u0627\u0631 \u06a9\u0647 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0644\u0648\u0627\u0632\u0645 \u06cc\u062f\u06a9\u06cc \u062d\u0645\u0644 \u06a9\u0631\u062f\u0647 \u0628\u0627\u0634\u062f \u200c \u0644\u0637\u0641\u0627 \u062a\u0630\u06a9\u0631 \u062f\u0647\u06cc\u062f \u06cc\u0627 \u067e\u06cc\u06a9\u0647\u0627\u0631\u0627 \u0628\u0627 \u0648\u0633\u06cc\u0644\u0647 \u0628\u0647\u062a\u0631\u06cc \u0631\u0648\u0627\u0646\u0647 \u06a9\u0646\u06cc\u062f . \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0645\u0631\u0627\u0633\u0645 \u062e\u0627\u0635 \u0648 \u06cc\u0627 \u0628\u0627\u0628\u062a \u062a\u0628\u0631\u06cc\u06a9 \u06af\u0641\u062a\u0646 \u0627\u0633\u062a \u0648 \u0646\u0628\u0627\u06cc\u062f \u062f\u0631\u0647\u0645 \u0648 \u0628\u0627 \u0622\u0628\u0631\u0648\u0631\u06cc\u0632\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06a9\u0648\u0686\u06a9) \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0632\u0647 \u06a9\u0644\u0648\u0686\u0647 \u0646\u0648\u0634\u06cc\u0646 \u0634\u0645\u0627\u0644 \u0645\u06cc\u062f\u0627\u062f\n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0644\u0637\u06cc\u0641\u0647 \u0631\u0627 \u062d\u0630\u0641 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u06cc\u0645 \u06a9\u0647 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f\n\u062f\u0631 \u06a9\u0644 \u0637\u0639\u0645 \u0645\u0639\u0645\u0648\u0644\u06cc \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u062a\u0627\u0632 \u0648 \u062e\u0648\u0634 \u0645\u0632\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc (6 \u062a\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0639\u0627\u0644\u06cc \u0648 \u0633\u0631\u06cc\u0639 \u0641\u0642\u0637 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0647\u0627\u06cc \u0644\u0647 \u0648 \u0634\u06a9\u0633\u062a\u0647 \u0648 \u0646\u0647 \u0686\u0646\u062f\u0627\u0646 \u062a\u0627\u0632\u0647 \u0648 \u0645\u0631\u063a\u0648\u0628 \u0628\u0648\u062f\u0646\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u062c\u0632\u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062a\u0631\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u0633\u062a \u0645\u0627 \u0645\u0634\u062a\u0631\u06cc \u067e\u0631 \u0648 \u067e\u0627\u0642\u0631\u0635\u0634 \u0647\u0633\u062a\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u0633\u0627\u0642\u0647 \u0639\u0631\u0648\u0633 \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ... \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0627\u0644\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 17 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646\u062f \u0648 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644\u0634 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0634\u06a9\u0644\u062f\u0627\u0631", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f\u0646\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0634\u0648\u0646\u0645 \u062e\u06cc\u0644\u06cc \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062f\u0644\u0648 \u0646\u0645\u06cc\u0632\u062f \u0627\u0635\u0644\u0627. \n\u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0627\u067e\u06cc\u0648\u0646\u06cc \u062e\u0627\u06a9 \u0642\u0646\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u0626\u06cc\u0633\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u062f\u0631 \u062d\u0645\u0644 \u0643\u064a\u0643 \u062f\u0642\u062a \u0634\u0648\u062f \u060c \u0643\u0646\u0627\u0631 \u0643\u064a\u0643 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0643\u064a\u0641\u064a\u062a \u062e\u0648\u062f \u0643\u064a\u0643 \u0647\u0645 \u062e\u064a\u0644\u064a \u0645\u0639\u0645\u0648\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", -1]}
{"text": ["\u0645\u0646\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u062a\u0648\u062c\u0647 \u0646\u062f\u0627\u0631\u0647 \u06a9\u0647 \u062f\u0627\u0631\u0647 \u06a9\u06cc\u06a9 \u062d\u0645\u0644 \u0645\u06cc\u06a9\u0646\u0647. \u0642\u0634\u0646\u06af \u0627\u0632 \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u0645\u0634\u062e\u0635\u0647 \u06a9\u0647 \u0631\u0648\u06cc \u0645\u0648\u062a\u0648\u0631 \u0686\u0647 \u0628\u0644\u0627\u06cc \u0633\u0631\u0634 \u0627\u0648\u0645\u062f\u0647. \u062e\u0648\u0627\u0647\u0634\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u0647\u0627\u062a\u0648\u0646 \u062a\u0630\u06a9\u0631 \u0628\u062f\u06cc\u062f \u06a9\u0647 \u06a9\u06cc\u06a9 \u0631\u0648 \u0633\u0627\u0644\u0645 \u0628\u0647 \u0645\u0642\u0635\u062f \u0628\u0631\u0633\u0648\u0646\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u06a9\u06cc \u0628\u062c\u0627\u0634 \u062f\u0627\u062f\u0646 \u0648 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 35 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0647\u0631 \u0627\u062f\u0645 \u0639\u0627\u0642\u0644\u06cc \u0645\u06cc \u062f\u0648\u0646\u0647 \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u0648 \u0646\u0628\u0627\u06cc\u062f \u0628\u0627 \u0645\u0648\u062a\u0648\u0631 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f \u060c \u0645\u0627 \u0641\u0642\u0637 \u06f6\u06f0\u200e\u066a \u06a9\u06cc\u06a9 \u0628\u0647 \u0645\u0627 \u0631\u0633\u06cc\u062f \u0648 \u0627\u0644\u0628\u0627\u0642\u06cc\u0634\u0648 \u0627\u0632 \u062f\u06cc\u0648\u0627\u0631\u0647 \u0647\u0627\u06cc \u062c\u0639\u0628\u0647 \u06a9\u06cc\u06a9 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0631\u062f\u06cc\u0645 .\n\u0648\u0627\u0642\u0639\u0627 \u062f\u06cc\u06af\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0633\u0631\u0648\u06cc\u0633\u062a\u0648\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0645\u06cc \u06af\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062a\u0646 \u062f\u0631\u062e\u0648\u0627\u0633\u062a\u06cc \u0645\u0646 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0646\u0648\u0634\u062a\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u062f\u0631 \u0645\u0642\u0627\u06cc\u0633\u0647 \u0628\u0647 \u0639\u06a9\u0633\u0634 \u062f\u0631 \u0633\u0627\u06cc\u062a \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0633\u0644\u0627\u0645\u060c\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c\u0645\u0645\u0646\u0648\u0646 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f\u060c\n\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u062f\u062f\u062f\u062f\u062f\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u06f5\u06f0\u06f0\u06f0 \u062a\u0648\u0645\u0627\u0646 \u0645\u0646\u0637\u0642\u06cc \u0648 \u0645\u0642\u0631\u0648\u0646 \u0628\u0647 \u0635\u0631\u0641\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0646\u0645\u06cc\u0631\u0633\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0633\u0631\u0639\u062a \u0639\u0645\u0644 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0627\u0632 \u067e\u0634\u062a\u064a\u0628\u0627\u0646\u064a \u0647\u0645 \u062a\u0634\u0643\u0631 \u0645\u064a\u0643\u0646\u0645 \n\u062c\u0647\u062a \u0647\u0645\u0627\u0647\u0646\u06af\u064a \n\u0627\u0632 \u0642\u0646\u0627\u062f\u064a \u0646\u0627\u062a\u0644\u064a \u0647\u0631\u0648\u064a \u0628\u0647\u062a\u0631 \u0646\u064a\u0633\u062a \u0645\u0631\u0633\u064a \u0627\u0632 \u0647\u0645\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0634\u0639\u0628\u0647 \u0647\u0631\u0648\u06cc\n\u0648\u0627\u0642\u0639\u0627\u0627\u0627\u0627 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0646\u0627\u062a\u0644\u06cc \u0628\u0648\u062f\u0646 \u062e\u0648\u062f\u0634 \u0631\u0648 \u0627\u062b\u0628\u0627\u062a \u06a9\u0631\u062f\n\u0645\u06af\u0647 \u062f\u0627\u0631\u06cc\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0627\u062e\u0647\u0647\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u062a\u0627 \u0631\u0633\u06cc\u062f\u0646 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0628\u06cc\u0631\u0648\u0646 \u0627\u0632 \u06cc\u062e\u0686\u0627\u0644 \u0628\u0648\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0631\u0628\u0639\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0633\u0627\u0641\u062a \u06a9\u0648\u062a\u0627\u0647 \u062d\u062f\u0648\u062f \u06f1 \u0633\u0627\u0639\u062a \u0627\u0632 \u062d\u0631\u06a9\u062a \u067e\u06cc\u06a9 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0631\u0648\u0644\u062a \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0638\u0627\u0647\u0631 \u0632\u06cc\u0628\u0627\u06cc\u06cc \u062f\u0627\u0634\u062a . \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644\u0634 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u062e\u06cc\u0644\u06cc \u0628\u0627\u0644\u0627\u0633\u062a \u0627\u06cc\u0646 \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc\u0647 \u06a9\u0647  \u0645\u0627 \u062e\u06cc\u0627\u0628\u0648\u0646 \u0631\u0648\u0628\u0631\u0648\u06cc \u0642\u0646\u0627\u062f\u06cc \u0647\u0633\u062a\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0641\u0627\u062c\u0639\u0647 \u0628\u0648\u062f.\u0627\u0635\u0644\u0627 \u0634\u0628\u06cc\u0647 \u0627\u0648\u0646\u200c\u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0646\u0628\u0648\u062f.\u0645\u0632\u0634 \u0628\u062f.\u062d\u062c\u0645 \u0648 \u062a\u0631\u06a9\u06cc\u0628 \u0646\u0627\u0645\u0646\u0627\u0633\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0634\u0627\u062a", -1]}
{"text": ["\u0638\u0627\u0647\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0647 \u0639\u06a9\u0633 \u0646\u062f\u0627\u0631\u0647\u060c \u0648\u0642\u062a\u06cc \u062e\u0631\u06cc\u062f \u0627\u06cc\u0646\u062a\u0631\u0646\u062a\u06cc \u0647\u0633\u062a \u0639\u06a9\u0633 \u0645\u062d\u0635\u0648\u0644 \u062e\u06cc\u0644\u06cc \u0645\u0647\u0645\u0647 \u0644\u0637\u0641\u0627 \u0628\u06cc\u0634\u062a\u0631 \u062a\u0648\u062c\u0647 \u06a9\u0646\u06cc\u062f \u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0631\u0648\u0644\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0632\u06cc\u0627\u062f\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0631\u0648\u0646 \u062c\u0639\u0628\u0647 \u0628\u0647 \u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f.\n\u0642\u06cc\u0645\u062a \u0647\u0645 \u0628\u0627\u0644\u0627\u0633\u062a...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0631\u0628\u0639\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06cc\u06a9\u0627\u062f\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645, \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0627 \u06a9\u0647 \u0622\u0648\u0631\u062f\u0646\u062f \u0628\u0647 \u0639\u0645\u0631\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06cc\u06a9\u0627\u062f\u0648\u06cc\u06cc \u0628\u062f\u062a\u0631 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u062a\u0631 \u0648 \u0628\u062f \u062a\u0631 \u0627\u0632 \u0627\u06cc\u0646 \u0646\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645. \u06a9\u0627\u0645\u0644\u0627 \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0628\u0648\u062f. \u0647\u0645 \u0648\u0642\u062a \u0645\u0627\u0646 \u062a\u0644\u0641 \u0634\u062f \u0647\u0645 \u067e\u0648\u0644\u0645\u0627\u0646 \u0648 \u0647\u0645 \u0645\u0647\u0645\u0627\u0646\u06cc \u0645\u0627\u0646. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0632\u0648\u062f\u062a\u0631 \u0627\u0632 \u062a\u0627\u06cc\u0645\u06cc \u06a9\u0647 \u06af\u0641\u062a\u0647 \u0634\u062f \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0633\u0631\u06cc\u0639 \u0627\u0648\u0645\u062f \u0648 \u06a9\u06cc\u06a9\u0647\u0627 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0641\u0642\u0637 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0646 \u062f\u0633\u0631 \u0631\u062f \u0648\u0644\u0648\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u0631\u062f \u0648\u0644\u0648\u062a \u0628\u0631\u0627\u06cc \u0645\u0646 \u0622\u0648\u0631\u062f\u0646!\n\u062f\u0631 \u0636\u0645\u0646 \u062f\u0646\u06cc\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646\u062f \u06af\u0641\u062a\u0646\u062f \u062a\u0645\u0648\u0645 \u0634\u062f\u0647 \u0648 \u0628\u062c\u0627\u0634 \u062f\u0646\u06cc\u0634 \u062f\u0627\u0631\u0686\u06cc\u0646\u06cc \u0622\u0648\u0631\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u06cc\u06a9\u0627\u062f\u0648", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u067e\u06cc \u0628\u0627 \u0645\u063a\u0632\u06cc \u062f\u0627\u0631\u0686\u06cc\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0645\u0646 \u0628\u0627\u0631\u0647\u0627 \u0627\u0632 \u0647\u0645\u06cc\u0646 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0646\u0627\u062a\u0644\u06cc \u062e\u0631\u06cc\u062f\u0645\n\u0627\u0645\u0627 \u0627\u06cc\u0646 \u0628\u0633\u062a\u0647 \u0627\u06cc \u06a9\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u062f\u0627\u063a\u0648\u0646 \u0628\u0648\u062f\n\u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062d\u0631\u06a9\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\n\u0648\u0642\u062a\u06cc \u0646\u0627\u062a\u0644\u06cc \u062f\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u0627\u06cc\u0646 \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0645\u06cc\u062f\u0647 \u062f\u0633\u062a \u067e\u06cc\u06a9 \u0645\u0648\u062a\u0648\u0631\u06cc \u0628\u0627\u06cc\u062f \u0637\u0648\u0631\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc\u0634 \u06a9\u0646\u0647 \u06a9\u0647 \u062a\u0648\u06cc \u062d\u0631\u06a9\u062a \u0646\u0631\u06cc\u0632\u0647\n\u0627\u0632 \u0637\u0631\u0641\u06cc \u0647\u0645 \u067e\u06cc\u06a9 \u0634\u0645\u0627 \u0628\u0627\u06cc\u062f \u062d\u0648\u0627\u0633\u0634\u0648 \u062c\u0645\u0639 \u0645\u06cc\u06a9\u0631\u062f \u06a9\u0647 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u062f\u0633\u062a\u0634\u0647 \u0646\u0647 \u062c\u0639\u0628\u0647 \u0627\u0647\u0646 \u0622\u0644\u0627\u062a!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u062a\u0644 \u062e\u0644\u0627\u0644 \u062f\u0627\u0631 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u0628\u0627\u0642\u0644\u0648\u0627.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\u0633\u067e\u0644\u0633 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0646\u0633\u0628\u062a \u0628 \u062d\u062c\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0644\u0627 \u0628\u0648\u062f \u0648 \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0647\u0645 \u0632\u06cc\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", -1]}
{"text": ["\u0643\u064a\u0643 \u0643\u0627\u0645\u0644\u0627 \u062f\u0627\u063a\u0648\u0646 \u0648 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u0646\u0635\u0641 \u0643\u064a\u0643 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u064a\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0637\u0648\u0631\u064a \u0643\u0647 \u0643\u0627\u0645\u0644\u0627 \u063a\u064a\u0631 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0628\u0631\u06af\u0634\u062a \u067e\u0648\u0644 \u0648 \u067e\u0633 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0643\u064a\u0643 \u0634\u062f \u062a\u0627\u0632\u0647 \u0628\u0627 \u0686\u0647\u0644 \u062f\u0642\u064a\u0642\u0647 \u062a\u0627\u062e\u064a\u0631 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u0648\u067e\u0634\u062a \u062e\u0637 \u067e\u0634\u062a\u064a\u0628\u0627\u0646\u064a \u064a\u0647 \u0628\u064a\u0633\u062a \u062f\u0642\u064a\u0642\u0647 \u0627\u064a \u0645\u0648\u0646\u062f\u0645 \u062a\u0627 \u062c\u0648\u0627\u0628\u0645\u0648 \u0628\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u062f\u0631\u0628 \u06cc\u06a9\u06cc \u0627\u0632 \u0628\u0633\u062a\u0647 \u062e\u0631\u06cc\u062f\u0645 \u0686\u0633\u0628 \u0646\u062f\u0627\u0634\u062a \u0648\u0628\u0627\u0632 \u0628\u0648\u062f \n\u06a9\u0647 \u0627\u06cc\u0646 \u0646\u06a9\u062a\u0647 \u0645\u06cc\u062a\u0648\u0646\u0647 \u0627\u0639\u062a\u0628\u0627\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u06a9\u0645\u06cc\u062a \u0631\u0627 \u0632\u06cc\u0631 \u0633\u0648\u0627\u0644 \u0628\u0628\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u062a\u0639\u062f\u0627\u062f\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0628\u0639\u0636\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0633\u0631\u0639\u062a \u0639\u0645\u0644 \u0639\u0627\u0644\u06cc \u0632\u06cc\u0631 \u06f1\u06f5 \u062f\u0642\u06cc\u0642\u0647\n\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \n\u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0628\u06cc\u0634\u062a\u0631 \u0627\u0648\u0642\u0627\u062a \u0633\u0641\u0627\u0631\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646 \u0627\u0633\u062a. \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u060c \u0642\u0633\u0645\u062a\u06cc \u0627\u0632 \u062c\u0639\u0628\u0647\u060c \u062e\u0627\u0644\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0648\u062f. \u0627\u0646\u062a\u0638\u0627\u0631 \u0645\u0634\u062a\u0631\u06cc \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u06a9\u0627\u0645\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0633\u062a \u0645\u062e\u0635\u0648\u0635\u0627 \u0627\u06af\u0631 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646 \u0628\u0627\u0634\u062f. \u0628\u06af\u0630\u0631\u06cc\u0645\u060c \u0622\u0628\u0631\u0648\u06cc \u0645\u0627 \u06a9\u0647 \u0631\u0641\u062a. \n\u062e\u0648\u0627\u0647\u0634\u0627 \u0628\u0631\u0627\u06cc \u062a\u0646\u0638\u06cc\u0645 \u062f\u0642\u06cc\u0642 \u0648\u0632\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u060c \u062c\u0639\u0628\u0647 \u0631\u0627 \u062e\u0627\u0644\u06cc \u0646\u06af\u0630\u0627\u0631\u06cc\u062f\u060c \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0627 \u0637\u0648\u0631\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0647\u0645 \u0648\u0632\u0646 \u0648 \u0647\u0645 \u067e\u0648\u0634\u0634 \u062c\u0639\u0628\u0647 \u062a\u0646\u0638\u06cc\u0645 \u0628\u0627\u0634\u062f. \n\u0628\u0627 \u062a\u0634\u06a9\u0631  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0645\u062a\u0623\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u06a9\u06cc\u06a9\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0639\u062f\u062f 1", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0627\u0648\u0646 \u06af\u0648\u0644\u0647 \u0634\u06a9\u0644\u0627\u062a \u0647\u0627 \u06a9\u0647 \u062f\u0648\u0631 \u06a9\u06cc\u06a9 \u0628\u0648\u062f \u0646\u0628\u0627\u0634\u0647 \u0628\u0647\u062a\u0631\u0647. \u0648 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0627\u0648\u0646 \u0634\u0627\u0647 \u062a\u0648\u062a \u0628\u0648\u062f \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u06cc \u0628\u0648\u062f \u0648\u0633\u0637 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc\u0627 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0627\u0648\u0646\u0645 \u0646\u0628\u0627\u0634\u0647 \u0628\u0647\u062a\u0631\u0647 \u0648\u0644\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc\u0627 \u0639\u0627\u0644\u06cc  \u0648 \u062e\u0627\u0645\u0647 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062f\u0631 \u0646\u0647\u0627\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0632\u064a\u0646\u0647 \u067e\u064a\u0643 \u0628\u0631\u0627\u064a \u0648\u0644\u0646\u062c\u0643 \u0628\u0627\u0644\u0627\u0633\u062a \u0644\u0637\u0641\u0627 \u062a\u062c\u062f\u064a\u062f \u0646\u0638\u0631 \u0643\u0646\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 4 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0644\u0637\u064a\u0641\u0647 \u0647\u0627 \u062e\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0646 \u062d\u062a\u064a \u0639\u0643\u0633 \u0647\u0645 \u06af\u0631\u0641\u062a\u0645 \u0648 \u062f\u0648\u062a\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u062e\u0627\u0645\u0647 \u0627\u064a \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f \u0631\u0648\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0643\u0647 \u0647\u0645\u0647 \u0631\u0648 \u0644\u0647 \u0643\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0627\u0643 \u0642\u0646\u062f \u0646\u0627\u067e\u0644\u0648\u0646\u064a \u0647\u0627 \u0631\u0648\u064a \u0647\u0645\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0633\u0641\u06cc\u062f", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u060c \u0647\u0631 \u062f\u0648 \u0643\u064a\u0643 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0627\u0646\u06af\u0627\u0631 \u0627\u0632 \u062f\u0633\u062a\u0634\u0627\u0646 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u0647\u0631 \u062f\u0648 \u0631\u0627 \u062f\u0648\u0631 \u0628\u064a\u0646\u062f\u0627\u0632\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0631\u0648\u0644\u062a\u0647\u0627\u06cc \u0633\u0627\u062f\u0647 \u06cc\u06a9\u0645\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f\u0646\u062f\u060c\u0627\u062d\u0633\u0627\u0633 \u06a9\u0631\u062f\u0645 \u0648\u0627\u0633\u0647 \u0631\u0648\u0632\u0647 \u0642\u0628\u0644\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u0646 3\u0628\u0627\u0631 \u062a\u0627 \u062d\u0627\u0644\u0627 \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u060c \u0628\u0627 \u0648\u062c\u0648\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0647\u0627\u0634  \u0647\u0631 3\u0628\u0627\u0631 \u0647\u0645 \u0627\u0632 \u062e\u0631\u06cc\u062f\u0645 \u0646\u0627\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 . \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc \u06a9\u0646\u0645 \u062d\u062a\u0645\u0627 \u062d\u062a\u0645\u0627 \u0647\u0646\u06af\u0627\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0633\u0641\u0627\u0631\u0634 \u060c  \u062e\u0631\u06cc\u062f\u062a\u0648\u0646 \u0631\u0648 \u0686\u06a9 \u06a9\u0646\u06cc\u062f \u060c \u0686\u0648\u0646 1 \u0628\u0627\u0631 \u0628\u0631\u0627\u06cc \u0645\u0646 1\u0642\u0644\u0645 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u0645 \u0631\u0648 \u0627\u0634\u062a\u0628\u0627\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0648 \u0628\u0639\u062f \u0627\u0632 \u06a9\u0644\u06cc \u062a\u0645\u0627\u0633 \u0648 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0648 \u0633\u0631 \u06a9\u0627\u0631 \u06af\u0630\u0627\u0634\u062a\u0646 \u0645\u0646 \u060c \u0622\u062e\u0631 \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0639\u0648\u0636 \u0646\u06a9\u0631\u062f\u0646 \u060c 2 \u0628\u0627\u0631 \u062f\u06cc\u06af\u0647 \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0644\u0647 \u0648 \u062f\u0631\u0628 \u0648 \u062f\u0627\u063a\u0648\u0646 \u0628\u0631\u0627\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u060c \u062c\u0648\u0631\u06cc \u06a9\u0647 \u0627\u0646\u06af\u0627\u0631 \u0628\u0627 \u0647\u0645\u0632\u0646 \u0647\u0645\u0634 \u0632\u062f\u0647 \u0628\u0648\u062f\u0646 \u060c \u0645\u0634\u06a9\u0644 \u0647\u0645 \u0627\u0632 \u067e\u06cc\u06a9 \u0645\u0648\u062a\u0648\u0631\u06cc \u0647\u0627\u0633\u062a \u0647\u0645 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u06a9\u0647 \u0633\u062e\u062a\u0634\u0647 \u06a9\u0647 \u06cc\u0647 \u062c\u0639\u0628\u0647 \u0628\u0632\u0631\u06af \u0628\u0632\u0627\u0631\u0647 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0631\u0648 \u0645\u0631\u062a\u0628 \u0648 \u0628\u062f\u0648\u0646 \u062a\u062d\u062a \u0641\u0634\u0627\u0631 \u0628\u0648\u062f\u0646 \u0628\u0632\u0627\u0631\u0647 \u062a\u0648 \u062c\u0639\u0628\u0647 \u060c \u0628\u0647 \u0647\u0631 \u062d\u0627\u0644 \u062d\u062a\u0645\u0627 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 \u060c \u0633\u0641\u0627\u0631\u0634\u062a\u0648\u0646 \u0631\u0648 \u0686\u06a9 \u06a9\u0646\u06cc\u062f \u0648 \u0627\u06af\u0631 \u0645\u0634\u06a9\u0644 \u0645\u0646 \u0631\u0648 \u062f\u0627\u0634\u062a\u06cc\u062f \u062a\u062d\u0648\u06cc\u0644 \u0646\u06af\u06cc\u0631\u06cc\u062f \u0627\u0632\u0634\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u0649 \u060c \u0647\u0645 \u0627\u0632 \u0646\u0638\u0631 \u0643\u064a\u0641\u064a\u062a \u0639\u0627\u0644\u0649 \u0628\u0648\u062f \u0647\u0645 \u062e\u062f\u0645\u0627\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0634\u06a9\u0644\u062f\u0627\u0631", "\u0628\u0627\u062f\u06a9\u0646\u06a9", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0645\u0632\u0647 \u0628\u0648\u062f\u060c\u0641\u0642\u0637 \u06cc\u06a9\u0645 \u0628\u0627 \u0648\u062c\u0648\u062f \u0646\u0632\u062f\u06cc\u06a9\u06cc \u0631\u0627\u0647 \u0647\u0632\u06cc\u0646\u0647 \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u0627\u0644\u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u06a9\u0627\u06a9\u0627\u0626\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u062f\u0646\u064a\u0634 \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0634\u0643\u0631\u064a \u062e\u064a\u0644\u064a \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0648\u0644\u064a \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u064a\u0643 \u0627\u0633\u0646\u067e \u0628\u0627 \u0628\u064a \u0645\u0628\u0627\u0644\u0627\u062a\u064a \u062c\u0639\u0628\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648 \u0627\u0646\u062f\u0627\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u064a \u0634\u0643\u0631\u064a \u062a\u0642\u0631\u064a\u0628\u0627 \u0646\u0635\u0641\u0634 \u062e\u0648\u0631\u062f \u0648 \u062e\u0627\u0643\u0634\u064a\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f.\u0628\u0627 \u062a\u0634\u0643\u0631 \u0627\u0632 \u0634\u0631\u0643\u062a \u0627\u0633\u0646\u067e \u0643\u0647 \u0628\u0647 \u0633\u0631\u0639\u062a \u067e\u064a\u06af\u064a\u0631\u064a \u0643\u0631\u062f \u0648 \u0628\u0639\u0646\u0648\u0627\u0646 \u0639\u0630\u0631 \u062e\u0648\u0627\u0647\u064a \u0643\u062f \u062a\u062e\u0641\u064a\u0641 \u0627\u0631\u0633\u0627\u0644 \u0643\u0631\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06a9\u0631\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628.\n\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 35 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0627\u067e \u06a9\u06cc\u06a9 \u0647\u0627\u0645 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0627\u06cc\u0646 \u0627\u0632 \u0646\u062d\u0648\u0647 \u0627\u0648\u0631\u062f\u0646\u0634\u0648\u0646 \u0628\u0648\u062f\u0647 \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0628\u062f \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0647 \u062f\u0627\u062e\u0644 \u0628\u0627\u06a9\u0633 \u0648\u0644\u06cc \u0644\u0637\u0641\u0627 \u062f\u0641\u0639\u0647 \u06cc \u0628\u0639\u062f \u0628\u0647\u062a\u0631\u0647 \u0645\u062d\u06a9\u0645 \u062a\u0631 \u062f\u0627\u062e\u0644 \u0638\u0631\u0641 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u0646 . \u0645\u0645\u0646\u0648\u0646 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u06a9\u0627\u067e \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 5 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0627\u0633\u062a \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u062f\u06cc\u06af\u0631\u06cc \u0646\u062f\u0627\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0648\u0627\u0635\u0644 \u06a9\u0648\u062a\u0627\u0647 \u0645\u06cc\u0628\u0627\u06cc\u0633\u062a \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0631\u0627\u06cc\u06af\u0627\u0646 \u0628\u0627\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9\u06cc \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \"\u0647\u06cc\u0686\" \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0647 \u06a9\u06cc\u06a9 \u062a\u0648\u06cc\u0650 \u0633\u0627\u06cc\u062a \u0646\u062f\u0627\u0634\u062a. \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u0647\u0645 \u06a9\u062c \u0648 \u0645\u0639\u0648\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0632\u0626\u06cc\u0646\u0627\u062a \u0648 \u062e\u0627\u0645\u0647\u200c\u06cc \u0631\u0648\u0634 \u0647\u0645 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u200c.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0639\u062f\u062f", -1]}
{"text": ["\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0647 \u062a\u0627\u0632\u06af\u06cc \u0628\u0642\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u0644\u0637\u0641\u0627 \u0639\u06a9\u0633 \u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0648 \u062f\u0633\u0631\u0647\u0627 \u0631\u0648 \u0628\u0632\u0627\u0631\u06cc\u062f \u062a\u0627 \u0645\u0634\u062a\u0631\u06cc \u0631\u0627\u062d\u062a \u062a\u0631 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u0647\n\u0645\u0646 \u06a9\u0627\u0645\u0644\u0627 \u0634\u0627\u0646\u0633\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0645 \u0648 \u0627\u0635\u0644\u0627 \u0646\u0645\u06cc\u062f\u0648\u0646\u0633\u062a\u0645 \u0686\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062c\u0644\u0633\u06cc", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u0645\u0646 \u062f\u0627\u062f\u0645 \u06a9\u06cc\u06a9 \u0631\u0632 \u0648\u0627\u0646\u06cc\u0644\u06cc \u06f1.\u06f4\u06a9\u06cc\u0644\u0648\u06af\u0631\u0645\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0642\u06cc\u0645\u062a\u0634 \u0647\u0645 \u06f7\u06f0 \u062a\u0648\u0645\u0646\u0647! \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0622\u0648\u0631\u062f\u0646 \u0627\u0648\u0644\u0627 \u06a9\u0647 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u062b\u0627\u0646\u06cc\u0627 \u0631\u0648\u0634 \u0646\u0648\u0634\u062a\u0647 \u0631\u0632 \u0648\u0627\u0646\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0648 \u0648\u0642\u062a\u06cc \u0648\u0632\u0646 \u0645\u06cc \u06a9\u0646\u06cc\u0645 \u0647\u0645 \u06a9\u0645\u062a\u0631 \u0627\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u06af\u0631\u0645\u0647! \u06cc\u0639\u0646\u06cc \u067e\u0648\u0644 \u0631\u0632 \u0648\u0627\u0646\u06cc\u0644\u06cc \u06f1.\u06f4 \u06a9\u06cc\u0644\u0648\u06af\u0631\u0645\u06cc \u06af\u0631\u0641\u062a\u0647 \u0634\u062f\u0647 \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u06a9\u0648\u0686\u06a9 \u062e\u0631\u0627\u0628 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0632 \u0648\u0627\u0646\u06cc\u0644\u06cc", -1]}
{"text": ["\u0627\u0632 \u0634\u0634 \u062a\u0627 \u0633\u0647 \u062a\u0627\u0634 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u067e\u0646\u062c \u0639\u062f\u062f \u062f\u0633\u0631 \u06a9\u06cc\u0648\u06cc \u0648 \u06cc\u06a9 \u0639\u062f\u062f \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0628\u0648\u062f. \u062f\u0631 \u062d\u0627\u0644\u06cc\u06a9\u0647 \u062f\u0631 \u062a\u0635\u0648\u06cc\u0631 \u062a\u0645\u0627\u0645 \u0645\u062f\u0644\u0647\u0627 \u0645\u062a\u0646\u0648\u0639 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0634\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0644\u0637\u0641\u0627 \u062f\u0631 \u0627\u0648\u0631\u062f\u0646 \u062c\u0639\u0628\u0647 \u062f\u0642\u062a \u06a9\u0646\u06cc\u062f \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0646 \u0648 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646\u06cc \u0646\u06cc\u0633\u062a \u0627\u0635\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u062a\u0644 \u0641\u0646\u062c\u0627\u0646\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627\u06cc \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0647\u0645\u06cc\u0634\u0647 \u0628\u0635\u0648\u0631\u062a \u0633\u06cc\u0646\u06cc \u0641\u0631\u0648\u062e\u062a\u0647 \u0645\u06cc\u0634\u0647 \u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627\u06cc \u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u0645\u0627 \u062f\u0631\u06cc\u0627\u0641\u062a \u06a9\u0631\u062f\u06cc\u0645 \u062a\u0648\u06cc \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0628\u062f\u0648\u0646 \u0633\u06cc\u0646\u06cc \u0648 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0642\u0646\u0627\u062f\u06cc \u0646\u0627\u062a\u0627\u0644\u06cc \u0627\u0632 \u0646\u0638\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u0647 \u0648\u0644\u06cc \u0645\u0646 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0631\u062f\u0645 \u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u062f\u0627\u062f\u0645 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0627\u0634\u0647 \u0648\u0644\u06cc \u0627\u06cc\u0646\u0637\u0648\u0631 \u0646\u0628\u0648\u062f\u0633\u0627\u06cc\u0632 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af \u0628\u0648\u062f\u0648 \u0645\u0646 \u0646\u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06a9\u0644 \u0631\u062f\u0648\u0644\u0648\u062a \u0628\u0627 \u0639\u06a9\u0633 \u062b\u0628\u062a \u0634\u062f\u0647 \u062a\u0637\u0627\u0628\u0642 \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0648\u062f\u060c\u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0647 \u0646\u0633\u0628\u062a \u0645\u0633\u0627\u0641\u062a \u0632\u06cc\u0627\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0633\u0631\u06cc\u0639 \u062a\u062e\u0648\u06cc\u0644 \u06af\u0631\u062f\u06cc\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u06a9\u0647 \u0648\u0632\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u200c\u0647\u0627\u06cc \u0627\u0631\u0633\u0627\u0644\u06cc \u06f4\u06f0\u06f0 \u06af\u0631\u0645 \u0648 \u0628\u0627\u0642\u0644\u0648\u0627 \u06f4\u06f3\u06f0 \u06af\u0631\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0648\u06cc\u0648\u0631\u06a9\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0634\u0644 \u0648 \u0648\u0627\u0631\u0641\u062a\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0645\u0632\u0647 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0646\u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0633\u06a9\u0627\u0641\u0647 \u0628\u0627 \u0634\u06a9\u0644\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0628\u0631\u0627\u06cc \u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u062a\u0644\u06cc \u0647\u0631\u0648\u06cc \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u0645 \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u0627\u0632 \u062e\u0631\u06cc\u062f\u0645 \u0628\u0647\u062a\u0631\u06cc \u0633\u0631\u06cc \u0631\u0642\u06cc\u0628 \u0647\u0627\u06cc \u0645\u0646\u0637\u0642\u0647 \u0628\u0632\u0646\u06cc\u062f \u062a\u0627 \u062a\u0641\u0627\u0648\u062a \u0631\u0648 \u0627\u062d\u0633\u0627\u0633 \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0646\u062f\u0647 \u0648 \u0642\u062f\u06cc\u0645\u06cc \u0628\u0648\u062f\n\u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u06a9\u0647 \u0645\u0634\u062a\u0631\u06cc \u062f\u0627\u0626\u0645\u06cc \u06a9\u0644\u06cc\u0647 \u0634\u0639\u0628\u0647 \u0647\u0627\u0634 \u0647\u0633\u062a\u06cc\u0645 \u0647\u0645\u0686\u06cc\u0646 \u0627\u0646\u062a\u0638\u0627\u0631\u06cc \u0646\u062f\u0627\u0634\u062a\u06cc\u0645\n\u0622\u0628\u0631\u0648\u0645\u0648\u0646 \u0647\u0645 \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0648\u0646\u0647\u0627\u0645\u0648\u0646 \u0631\u0641\u062a\n\u0627\u06cc\u0634\u0627\u0644\u0644\u0647 \u0628\u062a\u0648\u0646\u0646 \u062c\u0628\u0631\u0627\u0646 \u06a9\u0646\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc 1 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0627\u0632 \u0633\u0631\u0639\u062a \u0639\u0645\u0644\u062a\u0648\u0646 \u0648 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u06a9\u0647 \u0628\u0627 \u062f\u0642\u062a \u0648 \u0633\u0627\u0644\u0645 \u0633\u0641\u0627\u0631\u0634 \u0648 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0648\u06cc\u0648\u0631\u06a9\u06cc", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0645\u0648\u0642\u0639 \u0633\u0641\u0627\u0631\u0634 \u062a\u0639\u062f\u0627\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0627 \u0646\u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f \u0641\u0642\u0637 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f \u062a\u0627\u0631\u062a \u06a9\u0648\u0686\u06a9 \u06f1 \u06a9\u06cc\u0644\u0648 \u0647\u0645\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u0647\u0627\u06cc \u062f\u06cc\u06af\u0631 \u0645\u06cc \u06af\u0631\u0641\u062a\u0645 \u062a\u0627\u0631\u062a \u06a9\u0648\u0686\u06a9 \u062d\u062f\u0648\u062f \u06f2\u06f5 \u0639\u062f\u062f \u0628\u0648\u062f \u0645\u0646 \u0647\u0645 \u0628\u0631 \u0645\u0628\u0646\u0627\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u06f3 \u0639\u062f\u062f \u062a\u0627\u0631\u062a \u0628\u0632\u0631\u06af \u0628\u0631\u0627\u06cc\u0645 \u0622\u0648\u0631\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u0646\u0633\u06a9\u0627\u0641\u0647 \u0628\u0627 \u0634\u06a9\u0644\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u0649 \u0632\u0628\u0627\u0646 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f _\u067e\u0627\u0649 \u0633\u064a\u0628 \u0643\u0647\u0646\u0647 \u0628\u0648\u062f-\u062f\u0633\u0631 \u0634\u0643\u0644\u0627\u062a\u064a \u0648 \u0628\u0627\u0642\u0644\u0648\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0633\u0646\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0628\u062f \u0646\u0628\u0648\u062f \u0648\u0644\u064a \u062d\u0636\u0648\u0631\u064a \u062d\u0642 \u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u0647\u062a\u0631\u064a \u0645\u064a\u0634\u0647 \u062f\u0627\u0634\u062a \u0648\u0627\u0633\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u062c\u0639\u0628\u0647 \u0627\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062a\u0639\u062f\u0627\u062f\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0633\u0628\u06a9 \u062d\u062a\u0645\u0627 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0648 \u0628\u062e\u0648\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f (\u06f1\u06f5 \u062f\u0642\u06cc\u0642\u0647 ) \u06f3 \u0645\u062f\u0644 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0633\u0627\u062f\u0647 \u0628\u0648\u062f . \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0632\u0648\u062f \u0647\u0645 \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a", 1]}
{"text": ["\u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644\u060c \u06a9\u06cc\u06a9 \u0635\u062f\u0645\u0647 \u062f\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", "\u0634\u0645\u0639 \u0639\u062f\u062f 1", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u06a9\u0647 \u0647\u0633\u062a\u06cc \u0628\u0647\u062a\u0631\u06cc\u0646 \u062e\u0627\u0637\u0631\u0627\u062a \u0628\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u062a \u06af\u0630\u0634\u062a\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0648\u0642\u062a\u064a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", -1]}
{"text": ["\u0643\u0648\u0686\u064a\u0643 \u062a\u0631 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u06a9\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u0645\u0627\u06cc\u0647 \u0622\u0628\u0631\u0648 \u0631\u06cc\u0632\u06cc \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u06cc\u0647 \u06a9\u0648\u0686\u0648\u0644\u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0645\u062a\u0631 \u0628\u0627\u0634\u0647 \u0628\u0647\u062a\u0631\u0647\n\u067e\u0633\u0631 \u0645\u0646 \u06f3 \u062a\u0627 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062e\u0648\u0631\u062f \u0639\u0627\u0634\u0642\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0634\u0645\u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", "\u0641\u0634\u0641\u0634\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9", "\u0634\u0645\u0639 12 \u0639\u062f\u062f\u06cc \u0635\u0648\u0631\u062a\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 650 \u06af\u0631\u0645", "\u067e\u0627\u06cc \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc", 1]}
{"text": ["\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u0648 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u0649 \u0645\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0649 \u0643\u064a\u0641\u064a\u062a \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0628\u062f\u0649 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0642\u0646\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0627 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0645\u0631\u062a\u0628 \u0646\u0686\u06cc\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 650 \u06af\u0631\u0645", "\u067e\u0627\u06cc \u0645\u06cc\u0648\u0647 \u06a9\u0631\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f - \u0645\u062a\u0634\u06a9\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u06af\u0644\u0627\u0628\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 500 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0644\u0627\u0644 \u0646\u062f\u0627\u0634\u062a\u0646\u062f \u060c \u0637\u06cc \u0646\u0642\u0644 \u0648 \u0627\u0646\u062a\u0642\u0627\u0644 \u0647\u0645\u0647 \u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0648 \u062f\u0631 \u0647\u0645 \u0645\u062e\u0644\u0648\u0637 \u0634\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0646\u06cc\u0648\u0645 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u200d", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 4 650 \u06af\u0631\u0645", "\u062a\u0627\u0631\u062a \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc (4 \u062a\u0627 5 \u0639\u062f\u062f)", 1]}
{"text": ["Merci", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062e\u0634\u06a9 4 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0631\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0686\u0647\u0627\u0631\u06af\u0648\u0634)", 1]}
{"text": ["\u0642\u064a\u0645\u062a \u0643\u0648\u0643\u064a \u0647\u0627 \u062e\u064a\u0644\u064a \u0628\u0627\u0644\u0627\u0633\u062a \u0648\u0627\u0642\u0639\u0627 \u0645\u0646\u0637\u0642\u064a \u0646\u064a\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06a9\u0648\u0686\u06a9", "\u06a9\u0648\u06a9\u06cc \u0645\u06cc\u06a9\u0633 700 \u06af\u0631\u0645", "\u0642\u0647\u0648\u0647", "\u06a9\u0631\u0646\u0628\u0631\u06cc", "\u062a\u0648\u062a", -1]}
{"text": ["\u0646\u06cc\u0634\u06a9\u0631 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u06cc\u0631\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062a\u0647\u0631\u0627\u0646\u0647 \u0648\u0644\u06cc \u0628\u0627\u0642\u0644\u0648\u0627 \u0648 \u062a\u0648 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u0646\u06cc \u0628\u0631\u0627\u06cc \u0645\u0627 \u0627\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0628\u0631\u0627\u06cc \u0645\u0646\u0627\u0633\u0628\u062a \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0627\u0633\u062a \u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u0638\u0631\u0641 \u0645\u0646\u0627\u0633\u0628 \u0628\u0627\u0642\u0644\u0648\u0627 \u0628\u0631\u0627\u06cc \u0633\u0631\u0648 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062a\u0647\u06cc\u06cc\u0647 \u06a9\u0646\u0646\u062f \u0648 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u0646\u06cc\u0647\u0627\u06cc \u0628\u0632\u0631\u06af \u0628\u0627\u0642\u0644\u0648\u0627\u0647\u0627\u06cc \u0631\u06cc\u0632 \u0631\u0627 \u0646\u06af\u0630\u0627\u0631\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u06cc\u0634\u06a9\u0631 \u062e\u06cc\u0644\u06cc \u0628\u0647 \u0645\u0627 \u0646\u0632\u062f\u06cc\u06a9\u0647 \u0648 \u0647\u0632\u06cc\u0646\u0647 \u06cc \u0634\u0634 \u0647\u0632\u0627\u0631\u062a\u0648\u0645\u0646 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u062a\u0631 \u0645\u06cc\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1.400 \u06af\u0631\u0645\u06cc (20 \u062a\u0627 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0631\u0627\u0636\u0649 \u0628\u0648\u062f\u0645 -\u0639\u0627\u0644\u0649 \u0628\u0648\u062f \u0648\u0644\u064a \u062d\u064a\u0641 \u0643\u0647 \u062a\u0648\u0631\u0627\u0647 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f\n\u064a\u0647 \u0645\u0645 \u0628\u0627 \u0627\u062d\u062a\u064a\u0627\u0637 \u062a\u0631 \u062d\u0645\u0644 \u0634\u0648\u062f", "\u0634\u0645\u0639 \u0639\u0644\u0627\u0645\u062a \u0633\u0648\u0627\u0644", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0627\u0642\u0644\u0648\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u064a \u0643\u064a\u0641\u064a\u062a \u0648 \u0631\u0648\u063a\u0646 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0637\u0639\u0645 \u0648 \u0628\u0648\u064a \u0628\u062f\u060c \u0648\u0627\u0642\u0639\u0627 \u0628\u0631\u0627\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u064a\u0634\u0643\u0631 \u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc 650 \u06af\u0631\u0645", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0648\u0642\u0627\u0644\u0639\u0627\u062f\u0647 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u064a \u0646\u0628\u0648\u062f\u0645 \u0644\u0637\u0641\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648\u0632 \u0628\u0641\u0631\u0633\u062a\u064a\u062f  \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 650 \u06af\u0631\u0645\u06cc", "\u0634\u0645\u0639 \u0639\u062f\u062f 2", "\u0634\u0645\u0639 \u0639\u062f\u062f 9", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", "\u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0626\u0648\u0646 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0647 \u062c\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc (\u06a9\u06cc\u0644\u0648\u06cc\u06cc 30 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0627\u0646) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc (\u06a9\u06cc\u0644\u0648\u06cc\u06cc 20 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0627\u0646) \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0646\u06a9\u062a\u0647 \u0645\u0647\u0645\u062a\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0648\u06a9\u06cc\u0648\u0645 \u0628\u0648\u062f\u0646 \u0628\u0633\u062a\u0647 \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0647\u062f\u06cc\u0647 \u0628\u0647 \u0645\u062d\u0644 \u062f\u06cc\u06af\u0631\u06cc \u0631\u0641\u062a\u060c \u0627\u06cc\u0646 \u0645\u063a\u0627\u06cc\u0631\u062a \u0633\u0628\u0628 \u0622\u0628\u0631\u0648\u0631\u06cc\u0632\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f\u06cc \u0634\u062f!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 35 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u0628\u0627\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0647\u0645\u0686\u0646\u06cc\u0646 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f\u060c \u0627\u0632 \u0647\u0645\u06af\u06cc \u0639\u0648\u0627\u0645\u0644 \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u06a9\u0627\u0634 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0631 \u0627\u062b\u0631 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628\u060c \u06a9\u0644\u06cc\u0647 \u062a\u0632\u0626\u06cc\u0646\u0627\u062a \u06a9\u06cc\u06a9 \u0648 \u0645\u062d\u062a\u0648\u06cc\u0627\u062a \u0631\u0648\u06cc \u0622\u0646 \u0628\u0647 \u0627\u0637\u0631\u0627\u0641 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f!!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f... \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u0627\u0635\u0644\u0627 \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0647 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0646\u062f\u0627\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0642\u0628\u0644\u0646 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0648 \u0627\u0632 \u0647\u0645\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u062a\u0647\u06cc\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0627\u0645\u0631\u0648\u0632 \u0647\u06cc\u0686 \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0647 \u0627\u0648\u0646 \u0642\u0628\u0644\u06cc \u062a\u062f\u0627\u0634\u062a \u0646\u0647 \u0638\u0627\u0647\u0631\u0634 \u0646\u0647 \u0645\u0632\u0647 \u0634 \u060c\u0642\u06cc\u0645\u062a \u0628\u0627\u0644\u0627\u062a\u0631 \u0631\u0641\u062a\u0647 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0627\u0641\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0646\u0638\u0631 \u0645\u06cc\u0627\u062f \u06a9\u0647\u0646\u0647 \u0633\u062a \u0647\u0645\u06cc\u0634\u0647 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0645 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0627\u06cc\u0646\u0628\u0627\u0631 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0686\u0627\u06a9\u0644\u062a \u0628\u0631\u0627\u0648\u0646\u06cc \u0627\u0635\u0644\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u062f\u0627\u0634\u062a \u0631\u062f\u0648\u0644\u0648\u0644\u062a \u0647\u0645 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0642\u06cc\u0647 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0639\u0627\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0646\u0627\u062a\u0644\u06cc \u0648 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u0647 \u062e\u0627\u0637\u0631 \u062f\u0642\u062a \u0631\u0627\u0646\u0646\u062f\u0647 \u0648 \u0633\u0631\u0639\u062a \u0639\u0645\u0644 \u0627\u0632\u0633\u0627\u0644 \u06a9\u0627\u0644\u0627 \u0648 \u0647\u0645 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f\u0646 \u0648 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f\u0646 \u0627\u06cc\u0634\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u06a9\u0644\u062a \u0628\u0631\u0627\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0634\u0627\u062a 1 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0627\u0646\u062c\u06cc\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u062a\u0631\u06cc\u0646\u06af 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u062a\u0632\u0627 \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0631\u0628\u0639\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0633\u0631 \u0634\u0627\u062a \u0647\u0627 \u0631\u0648 \u06f2\u062a\u0627\u0634\u0648 \u0628\u0631\u0639\u06a9\u0633 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u06cc\u062f \u0648 \u0631\u0633\u0645\u0627 \u0627\u0632 \u06f6 \u062a\u0627 \u062f\u0633\u0631 \u06f2\u062a\u0627\u0634 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0628\u0642\u06cc\u0647 \u0644\u06cc\u0648\u0627\u0646\u200c\u0647\u0627 \u06a9\u062b\u06cc\u0641 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0633\u0646\u06a9 \u0698\u0627\u0645\u0628\u0648\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0633\u0648\u0633\u06cc\u0633 \u0627\u0646\u06af\u0634\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0627\u0633\u0646\u06a9 \u0627\u0644\u0648\u06cc\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0634\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0631\u0627\u06cc \u0645\u0646 \u06a9\u0647 \u0628\u0686\u0647 \u06a9\u0648\u0686\u06a9 \u062f\u0627\u0631\u0645  \u0639\u0627\u0644\u06cc\u0647 \u0639\u0627\u0644\u06cc  \u0633\u0631\u06cc\u0639 \u0648 \u067e\u06cc\u06a9 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u062a\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0632 \u0648\u0627\u0646\u06cc\u0644\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u062a\u0648\u0633\u0637 \u067e\u06cc\u06a9 \u0645\u062d\u062a\u0631\u0645 \u0648 \u0645\u0648\u062f\u0628\u06cc \u0648 \u0628\u0627 \u06f2\u06f0% \u062a\u062e\u0641\u06cc\u0641 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f.\n\u0627\u06cc \u06a9\u0627\u0634 \u062a\u062e\u0641\u06cc\u0641 \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0647\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644\u062a \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0627\u0645\u0631\u0648\u0632 \u062a\u0631 \u062a\u0645\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0647 \u062f\u0633\u062a\u0645 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0634\u0627\u062a 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0627 \u0628\u0627\u0641\u062a \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0628 \u0627\u0632 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u062e\u0648\u062f \u0646\u0627\u062a\u0644\u06cc \u0647\u0645 \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u06af\u0641\u062a\u0646 \u0646\u0635\u0641 \u0646\u06cc\u0648 \u06cc\u0648\u0631\u06a9\u06cc \u0648 \u0646\u0635\u0641 \u0645\u062e\u0635\u0648\u0635 \u0628\u06af\u06cc\u0631\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f \n\u0627\u0632 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0647\u0645 \u0645\u0645\u0646\u0648\u0646 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0645\u0648\u062f\u0628 \u0648 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0648\u06cc\u0648\u0631\u06a9\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f. \u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0627\u0647\u0631\u0627\u0646\u0647 \u0648 \u0633\u0627\u0644\u0645 \u0622\u0648\u0631\u062f\u0647 \u0628\u0648\u062f. \u062f\u0633\u062a \u0647\u0645\u06af\u06cc \u062f\u0631\u062f \u0646\u06a9\u0646\u0647. \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645\u200c. \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9\u0633\u0628 \u0648 \u06a9\u0627\u0631\u062a\u0648\u0646 \u067e\u0631 \u0631\u0648\u0646\u0642 \u0648 \u067e\u0631 \u062e\u06cc\u0631 \u0648 \u0628\u0631\u06a9\u062a \u0628\u0627\u0634\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u067e\u0627\u06cc\u0647 \u0633\u06cc\u0628 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f \u060c \u067e\u0627\u06cc\u0647 \u0622\u0646\u0627\u0646\u0627\u0633 \u0642\u062f\u0631\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u060c \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0628\u0647 \u0634\u062f\u062a \u0628\u0648\u06cc \u0631\u0648\u063a\u0646 \u0645\u0627\u0647\u06cc \u0648 \u0632\u062e\u0645 \u0645\u06cc \u062f\u0627\u062f \u062c\u0648\u0631\u06cc \u06a9\u0647 \u062f\u0648\u0631\u0627\u0646\u062f\u0627\u062e\u062a\u0645\u0634\u060c \u062f\u0633\u0631 \u0647\u0645 \u0632\u06cc\u0627\u062f \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u062f\u0648\u0631\u0646\u06af", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0633\u0646\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u0634\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0647 \u062e\u0635\u0648\u0635 \u0645\u06cc\u06a9\u0627\u062f\u0648 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 .\n\u0645\u062a\u0634\u06a9\u0631\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062d\u0644\u0648\u0627 \u0645\u06cc\u06a9\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u0628\u06cc\u200c\u0646\u0638\u06cc\u0631.\n\n\u0641\u0642\u0637 \u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0645\u062d\u062a\u0631\u0645 \u0642\u0646\u0627\u062f\u06cc \u062e\u0648\u0627\u0647\u0634 \u0646\u06cc\u200c\u06a9\u0646\u0645 \u0645\u0646\u0648\u06cc \u062e\u0648\u062f \u062f\u0631 \u0633\u0627\u06cc\u062a \u0627\u0633\u0646\u067e \u0631\u0627 \u0628\u0647 \u0631\u0648\u0632 \u0646\u06af\u0647 \u062f\u0627\u0631\u0646\u062f \u06a9\u0647 \u0645\u0648\u062c\u0628 \u0633\u0631\u062f\u0631\u06af\u0645\u06cc \u0645\u0634\u062a\u0631\u06cc \u0646\u0634\u0648\u062f.\n\n\u0628\u0627 \u0633\u067e\u0627\u0633 \u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u062e\u0648\u0628 \u0641\u0631\u0648\u0634\u06af\u0627\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0645\u06cc\u06a9\u0627\u062f\u0648", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u06af\u0630\u0634\u062a\u0647 \u06f1\u06f0\u06f0\u200e\u066a \u0627\u0641\u062a \u06a9\u06cc\u0641\u06cc\u062a\u200c\u062f\u0627\u0634\u062a\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": ["\u0627\u06af\u0631\u0627\u0645\u0643\u0627\u0646\u0634 \u0628\u0627\u0634\u0647 \u0627\u0632 \u0647\u0631 \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0645\u062a\u0631 \u0627\u0632 \u0661 \u0643\u064a\u0644\u0648 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u064a\u0645 \u062e\u064a\u0644\u064a \u0628\u0647\u062a\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0647\u0631 \u062f\u0648 \u0645\u0648\u0631\u062f \u0633\u0631 \u0645\u0648\u0642\u0639 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0627\u0632 \u0647\u0645\u0647 \u0645\u0647\u0645\u200c\u062a\u0631 \u062a\u0627\u0632\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f.\n\n\u062a\u0628\u0631\u06cc\u06a9 \u0628\u0647 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0645\u062d\u062a\u0631\u0645 \u0648 \u0622\u0631\u0632\u0648\u06cc \u0627\u06cc\u0646\u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u062f\u0627\u0631 \u0628\u0645\u0627\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0645\u062b\u0644\u062b\u06cc", "\u062f\u0646\u06cc\u0634 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u062a\u0631 \u0627\u0632 \u062d\u062f \u0627\u0646\u062a\u0638\u0627\u0631\u0645 \u0631\u0633\u06cc\u062f. \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u062f\u0645 \u06a9\u0645\u06cc \u0637\u0639\u0645 \u06a9\u0631\u0647 \u0631\u0648 \u0628\u0647 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f \u0628\u0647 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u062f \u062e\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f.\u0645\u0631\u0633\u06cc \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0648 \u0645\u0631\u0633\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0642\u0644\u0648\u0627 \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631 \u0627\u0632 \u0627\u06cc\u0646 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u06cc\u0646\u0647\u0627\u06cc\u062a \u06a9\u0647\u0646\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647. \u0647\u0645\u06cc\u0646 \u0627\u0644\u0627\u0646 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0645\u0633\u062a\u0642\u06cc\u0645 \u062f\u0648\u0631 \u0645\u06cc\u0631\u06cc\u0632\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0631\u0648", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0628\u0631 \u0634\u0645\u0627\u060c \u0641\u0631\u062f\u06cc \u06a9\u0647 \u062f\u0631 \u0642\u0646\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0627 \u062f\u0631 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0686\u06cc\u062f\u0647 \u061b \u062e\u06cc\u0644\u06cc \u0628\u0627\u0633\u0644\u06cc\u0642\u0647 \u0639\u0645\u0644 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u06a9\u0634 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u06af\u0647 \u0628\u06cc\u0646\u0634 \u06af\u0631\u062f\u0648 \u0648 \u0645\u0648\u0632 \u0645\u06cc\u200c\u062f\u0627\u0634\u062a \u062e\u0648\u0634\u0645\u0632\u0647\u200c\u062a\u0631 \u0647\u0645 \u0645\u06cc\u200c\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0628\u0647 \u0634\u062f\u062a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0645\u062f\u0644\u0634 \u0627\u0632 \u0627\u06cc\u0646 \u0645\u0627\u0631\u0645\u0627\u0644\u0627\u062f\u06cc\u0647\u0627 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u0646 \u0634\u062e\u0635\u0627 \u0627\u0632 \u0627\u06cc\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628\u0627 \u06a9\u0647 \u062a\u0648\u0634 \u0633\u06cc\u0628 \u062f\u0627\u0631\u0647 \u0628\u06cc\u0634\u062a\u0631 \u062f\u0648\u0633 \u062f\u0627\u0631\u0645 \u066c \u067e\u06cc\u06a9\u0634\u0648\u0646 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628 \u0642\u06cc\u0645\u062a \u062d\u062c\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0627\u06af\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0647\u0645 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u0628\u0647\u062a\u0631\u0647 \u0648 \u06cc\u06a9\u0645 \u0645\u0633\u0627\u0641\u062a \u0642\u0646\u0627\u062f\u06cc \u0648 \u0645\u0642\u0635\u062f \u0631\u0648 \u0628\u06cc\u0634\u062a\u0631 \u06a9\u0646\u06cc\u062f \u06f3\u06f0\u06f0\u06f0 \u0645\u062a\u0631 \u06a9\u0647 \u0686\u06cc\u0632\u06cc \u0646\u06cc\u0633\u062a \u0627\u06af\u0631 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0634\u0647 \u0645\u0645\u0646\u0648\u0646 \u0645\u06cc\u0634\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0645\u062a\u0648\u0633\u0637", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u0645\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0646\u062a\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0646 \u06cc\u0647 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062e\u0644\u0648\u0637 \u06af\u0631\u0641\u062a\u0645 \u06a9\u0647 \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u062d\u062c\u0645\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 250 \u06af\u0631\u0645 \u0627\u0633\u062a \u0648\u0644\u06cc \u0648\u0642\u062a\u06cc \u0622\u0648\u0631\u062f\u0646 \u0628\u0627 \u062a\u0631\u0627\u0632\u0648 \u062f\u0642\u06cc\u0642 \u06a9\u0634\u06cc\u062f\u0645 \u062d\u062c\u0645\u0634 \u0628\u0627 \u062c\u0639\u0628\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 70 \u06af\u0631\u0645 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0639\u0627\u0644\u064a \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0627\u0645\u0627 \u0642\u064a\u0645\u062a \u067e\u064a\u0643 \u0663\u0660\u0660\u0660 \u0628\u0631\u0627\u064a \u0645\u0633\u064a\u0631 \u064a\u0643 \u0643\u0648\u0686\u0647 \u0632\u064a\u0627\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u062f\u0633\u062a\u062a\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0645\u062f \u0646\u0638\u0631 \u0642\u0631\u0627\u0631 \u0645\u06cc\u062f\u0647\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0644\u0627\u0645.\u0645\u0646 \u06f4 \u062c\u0639\u0628\u0647 \u062e\u0648\u0627\u0633\u062a\u0647 \u0628\u0648\u062f\u0645.\u0627\u0645\u0627 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06af\u0641\u062a\u0646 \u06f3 \u062c\u0639\u0628\u0647 \u0645\u0648\u062c\u0648\u062f\u0647.\u0644\u0637\u0641 \u06a9\u0646\u06cc\u0646 \u0648\u0642\u062a\u06cc \u0627\u0632 \u0645\u062d\u0635\u0648\u0644\u06cc \u062a\u0639\u062f\u0627\u062f \u0645\u062d\u062f\u0648\u062f \u062f\u0627\u0631\u06cc\u0646 \u0634\u0631\u0627\u0626\u0637\u06cc \u0631\u0648 \u0641\u0631\u0627\u0647\u0645 \u06a9\u0646\u06cc\u0646 \u06a9\u0647 \u0645\u0634\u062a\u0631\u06cc \u0627\u0632 \u062a\u0639\u062f\u0627\u062f \u0645\u0637\u0644\u0639 \u0628\u0627\u0634\u0647.\u0627\u0648\u0646\u0648\u0642\u062a \u062a\u0635\u0645\u06cc\u0645 \u0645\u06cc\u06af\u06cc\u0631\u0647 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0647 \u06cc\u0627 \u0646\u0647.\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0648\u0644 \u067e\u0648\u0644 \u0631\u0648 \u06a9\u0633\u0631 \u0645\u06cc\u06a9\u0646\u06cc\u0646 \u0628\u0639\u062f \u062f\u0631 \u0645\u0648\u0631\u062f \u0648\u062c\u0648\u062f \u06cc\u0627 \u0639\u062f\u0645 \u0648\u062c\u0648\u062f \u0645\u062d\u0635\u0648\u0644\u060c\u0627\u0637\u0644\u0627\u0639 \u0631\u0633\u0627\u0646\u06cc \u0645\u06cc\u06a9\u0646\u06cc\u0646 \u06a9\u0647 \u0627\u06cc\u0646 \u062c\u0632\u0621 \u0627\u0635\u0648\u0644 \u062d\u0631\u0641\u0647 \u0627\u06cc \u06a9\u0627\u0631 \u0646\u06cc\u0633\u062a.\u0645\u0645\u0646\u0648\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0635\u0648\u0635 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06cc\u06a9 \u062a\u0648\u0644\u062f \u0628\u062f\u0648\u0646 \u067e\u06cc\u0634 \u0628\u06cc\u0646\u06cc \u0642\u0628\u0644\u06cc \u0628\u0627 \u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0634\u0645\u0627 \u0631\u0648\u0646\u0642 \u06af\u0631\u0641\u062a\n\u0645\u062a\u0634\u06a9\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u0698\u06cc\u06a9\u06cc (\u0686\u0647\u0627\u0631\u06af\u0648\u0634)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc 650 \u06af\u0631\u0645", "\u0627\u0633\u0646\u06a9 \u0633\u0648\u0633\u06cc\u0633 \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645 (6 \u062a\u0627 8 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0632 \u0646\u06cc\u0634\u06a9\u0631 \u060c \u067e\u0644\u0645\u0628\u06cc\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u0628\u0648\u062f \u06cc\u0627 \u06a9\u0644\u0627 \u0645\u062f\u0644\u0634 \u0627\u06cc\u0646\u0637\u0648\u0631\u06cc \u0647\u0633\u062a\u060c \u0627\u0645\u0627 \u0648\u0627\u0642\u0639\u0627 \u0647\u06cc\u0686 \u0637\u0639\u0645 \u062e\u0627\u0635\u06cc \u0646\u062f\u0627\u0634\u062a\u060c \u0627\u0646\u06af\u0627\u0631 \u06cc\u0647 \u06a9\u0645 \u062e\u0627\u0645\u0647 \u0648 \u0645\u06cc\u0648\u0647 \u06cc\u062e \u0632\u062f\u0647 \u0645\u06cc\u062e\u0648\u0631\u062f\u06cc!!!! \u0645\u06cc\u0648\u0647 \u0647\u0627\u06cc \u0631\u0648\u0634 \u0647\u0645 \u0628\u0647 \u0646\u0638\u0631 \u062a\u0627\u0632\u0647 \u0646\u0645\u06cc\u0631\u0633\u06cc\u062f\u060c \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0646 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634\u0645 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u062d\u062a\u0645\u0627 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0647!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0644\u0645\u0628\u06cc\u0631 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc 650 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1.400 \u06af\u0631\u0645\u06cc (20 \u062a\u0627 25 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u0645\u062e\u0635\u0648\u0635 650 \u06af\u0631\u0645", 1]}
{"text": ["\u062f\u0631 \u06a9\u0644 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f. \u0645\u062a\u0648\u0633\u0637 \u0631\u0648 \u0628\u0647 \u062e\u0648\u0628.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0631\u0641\u062a\u0627\u0631 \u0631\u0627\u0646\u0646\u062f\u0647 \u0627\u0633\u0646\u067e ... \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u0639\u062f\u062f 3", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u067e\u0627\u06cc \u067e\u0646\u06cc\u0631 \u0622\u0644\u0628\u0627\u0644\u0648 1300 \u06af\u0631\u0645\u06cc (12 \u062a\u0627 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0646 \u0639\u0627\u0634\u0642 \u0637\u0639\u0645 \u0627\u064a\u0646 \u062a\u0627\u0631\u062a \u0647\u0627\u064a \u0646\u064a\u0634\u0643\u0631 \u0647\u0633\u062a\u0645. \u0627\u0644\u0628\u062a\u0647 \u0628\u0647 \u0646\u0638\u0631\u0645 \u062a\u0627\u0631\u062a \u0647\u0627\u064a \u0637\u0627\u0644\u0628\u064a\u0634 \u0632\u064a\u0627\u062f \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u064a\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0646\u06cc\u0648\u0645 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u0649 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a \u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u0643\u0648\u0686\u0643 \u0628\u0648\u062f \u0648 \u062f\u0631 \u0643\u0644 \u062f\u064a\u06af\u0647 \u0628\u0647\u062a\u0648\u0646 \u0633\u0641\u0627\u0631\u0634 \u0646\u0645\u064a\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0642\u0647\u0648\u0647 \u06af\u0631\u062f\u0648 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 8", "\u0634\u0645\u0639 \u0639\u062f\u062f 2", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u06af\u0641\u062a\u0645 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u062a\u0647\u0631\u0627\u0646 \u062f\u0631 \u0646\u06cc\u0634\u06a9\u0631 \u067e\u062e\u062a \u0645\u06cc\u0634\u0647\u060c \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0628\u0627 \u0647\u0645\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u0647\u062a\u0631 \u0627\u062f\u0627\u0645\u0647 \u0645\u0633\u06cc\u0631 \u062f\u0647\u06cc\u062f ! \u062e\u062f\u0627 \u0642\u0648\u0651\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0642\u0631\u0627\u0628\u06cc\u0647 650 \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0647 \u0639\u06a9\u0633 \u0646\u062f\u0627\u0634\u062a\u060c \u0648\u0627\u0642\u0639\u0627 \u0627\u0646\u062a\u0638\u0627\u0631\u0634 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u0645 \u0647\u0645\u0686\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u062a\u062d\u0648\u06cc\u0644 \u0628\u06af\u06cc\u0631\u0645. \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0639\u0644\u0627\u0631\u063a\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0648\u0636\u06cc\u062d \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0647 \u0628\u062f\u062a\u0631\u06cc\u0646 \u0634\u06a9\u0644 \u0648 \u0628\u06cc \u0633\u0644\u06cc\u0642\u0647 \u062a\u0631\u06cc\u0646 \u062d\u0627\u0644\u062a \u0645\u0645\u06a9\u0646 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0627\u06af\u0631 \u0646\u0645\u06cc\u062a\u0648\u0646\u0633\u062a\u0646 \u0631\u0648\u0634 \u0628\u0646\u0648\u06cc\u0633\u0646 \u0628\u0627\u06cc\u062f \u0647\u0645\u0627\u0647\u0646\u06af \u0645\u06cc\u06a9\u0631\u062f\u0646 . \u0646\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u0634\u06a9\u0644 \u0628\u06cc \u0633\u0644\u06cc\u0642\u0647 !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0633\u0631\u064a\u0639 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0634\u06a9\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0646 \u0686\u0646\u062f\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u06a9\u06cc\u06a9 \u06af\u0631\u0641\u062a\u0645. \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0645\u06cc\u0627\u0631\u0646 \u0648 \u0647\u0645 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u06cc \u062f\u0627\u0631\u0646...\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u062a\u0631 \u0627\u0632 \u0633\u0627\u06cc\u0632 \u0648 \u0648\u0632\u0646\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0642\u06cc\u062f \u0634\u062f\u0647 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0686\u0627\u0631\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0646\u06af\u0627\u0631 \u062a\u0648\u06cc \u0641\u0631\u06cc\u0632\u0631 \u0628\u0648\u062f\u0647 \u0628\u0627\u0634\u0647 \u0645\u0632\u0647 \u0645\u0648\u0646\u062f\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f \u0648 \u062e\u0627\u0645\u0647 \u0648\u0633\u0637 \u062d\u0627\u0644\u062a \u06cc\u062e \u0632\u062f\u06af\u06cc \u062f\u0627\u0634\u062a \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u0647\u06cc\u0686 \u0634\u0628\u0627\u0647\u062a\u06cc \u0628\u0627 \u06a9\u06cc\u06a9 \u062f\u0631 \u0639\u06a9\u0633 \u0646\u062f\u0627\u0634\u062a \u0648 \u0627\u0635\u0644\u0627 \u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0647\u0645 \u0627\u06af\u0647 \u062e\u0627\u0645\u0647 \u06a9\u0645\u062a\u0631 \u0628\u0632\u0627\u0631\u0646 \u062e\u0648\u0628 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u0627\u0646\u0628\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 6 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u0627\u0633\u0647 \u0627\u0648\u0644\u06cc\u0646 \u062a\u062c\u0631\u0628\u0647 \u06cc \u062e\u0631\u06cc\u062f \u06a9\u06cc\u06a9 \u0622\u0646\u0644\u0627\u06cc\u0646 \u062a\u0635\u0648\u0631\u0634 \u0631\u0648 \u0646\u0645\u06cc\u06a9\u0631\u062f\u0645 \u0627\u06cc\u0646\u0642\u062f \u062e\u0648\u0628 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u062f\u0648 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0627\u0632 \u0647\u0645 \u067e\u0627\u0634\u06cc\u062f\u0647 \u0628\u0648\u062f \u060c \u0627\u06cc\u0646 \u0648\u0636\u0639 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644 \u0646\u06cc\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0633\u0644\u0627\u0645\u200c \u06a9\u0644\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f  \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc\u06cc \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u062a\u0631\u062f \u0648\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0627 \u062e\u0627\u0645\u0647 \u0645\u0646\u0627\u0633\u0628 \u0648 \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647  \u062f\u0633\u062a\u062a\u0648\u0646 \u062f\u0631\u062f\u0646\u06a9\u0646\u0647\n\u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0645 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648\u0631\u0641\u062a\u0627\u0631 \u0645\u0648\u062f\u0628\u0627\u0646\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a\n\u0641\u0642\u0637 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u063a\u06cc\u0631 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0647\u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0633\u0641\u0627\u0631\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0647\u0645 \u0628 \u0645\u0646\u0648\u06cc \u062e\u0648\u062f \u0627\u0636\u0627\u0641\u0647 \u0646\u0645\u0627\u06cc\u062f \n\u062a\u0648 \u0628\u06cc\u0646\u0638\u0631\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u06cc\u06a9\u0645 \u0632\u06cc\u0627\u062f \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u062c\u0632 \u0627\u0648\u0646 \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a \u06a9\u0647\u0646\u0647 \u0648 \u0628\u062f \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634 \u0645\u0632\u0647 \u0648\u0644\u06cc \u067e\u06cc\u06a9 \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f ...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["48 \u062f\u0642\u06cc\u0642\u0647 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u0633\u0631\u06cc\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648\u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0643\u064a\u0643 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u060c \u0641\u0642\u0637 \u062a\u062d\u0648\u064a\u0644 \u0633\u0641\u0627\u0631\u0634 \u0627\u0632 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0628\u0631\u0627\u064a \u0645\u0646 \u0647\u0645\u064a\u0634\u0647 \u0628\u0627 \u062a\u0627\u062e\u064a\u0631 \u0632\u064a\u0627\u062f \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u060c \u0646\u0645\u064a \u062f\u0648\u0646\u0645 \u0643\u0647 \u0627\u0634\u0643\u0627\u0644 \u0627\u0632 \u0627\u0633\u0646\u067e \u0647\u0633\u062a \u064a\u0627 \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u060c \u0645\u0648\u0641\u0642 \u0628\u0627\u0634\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0633\u064a\u0627\u0631 \u0633\u0631\u064a\u0639 \u062a\u0627 \u064a\u0643 \u0631\u0628\u0639 \u0628\u0639\u062f \u0627\u0632 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0628\u0647 \u062f\u0633\u062a\u0645\u0627\u0646 \u0631\u0633\u064a\u062f \u0645\u062a\u0634\u0643\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\n\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0631\u0627 \u0632\u06cc\u0627\u062f \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c 650 \u06af\u0631\u0645", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0646\u0627\u067e\u0644\u0648\u0646\u06cc \u0646\u062e\u0648\u0627\u0633\u062a\u0647 \u0628\u0648\u062f\u0645 \u060c \u0628\u0631\u0627\u0645 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", -1]}
{"text": ["\u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ... \u062d\u0627\u0644 \u0646\u06a9\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc 650 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 650 \u06af\u0631\u0645", "\u0645\u06cc\u06a9\u0633 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 700 \u06af\u0631\u0645\u06cc", -1]}
{"text": ["\u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0645\u0646 \u062f\u0631 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0622\u06cc\u062a\u0645 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0631\u0627 \u0646\u0648\u0634\u062a\u0645 \u0648\u0644\u06cc \u062a\u0648\u062c\u0647\u06cc \u0646\u0634\u062f \n\u0628\u0633\u06cc\u0627\u0631 \u0647\u0645 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", "\u0631\u0648\u0644\u062a", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \n\u062f\u0627\u063a \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631\n\u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u06cc\u06a9\u0633 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u062c\u0627\u06cc \u0646\u0648\u0646 \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u0641\u0642\u0637 \u0631\u0648\u0644\u062a \u0633\u0627\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u060c \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0647\u0645\u0647 \u0686\u06cc\u0632\u0634 \u0645\u062a\u0646\u0627\u0633\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u0648\u0647 \u0627\u06cc 650 \u06af\u0631\u0645", "\u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a 1 \u06a9\u06cc\u0644\u0648", "\u0644\u0648\u062a\u06a9\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0645\u062e\u0635\u0648\u0635 1 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0627\u0632 \u0646\u06cc\u0634\u06a9\u0631 \u0628\u0627\u0628\u062a \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0645\u06cc\u06a9\u0633 700 \u06af\u0631\u0645", "\u0634\u06a9\u0644\u0627\u062a", "\u0641\u0646\u062f\u0642", "\u06a9\u0631\u0646\u0628\u0631\u06cc", "\u062a\u0648\u062a", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u062f\u0631\u0647\u0645 \u0648 \u0641\u0634\u0631\u062f\u0647 \u0631\u0648\u064a \u0647\u0645 \u0686\u064a\u062f\u0646 \u060c \u0647\u0645\u0634\u0648\u0646 \u0644\u0647 \u0634\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0633 \u062a\u0631 1 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644\u062a", "\u0644\u0637\u06cc\u0641\u0647", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", -1]}
{"text": ["\u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0633\u06cc\u0627\u0631 \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u06af\u0644\u0627\u0628\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644", "\u062f\u0633\u0631 \u06af\u0627\u0646\u0627\u0634", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u0628\u0644\u0627 \u062e\u064a\u0644\u064a \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0627\u0631\u062a \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0642\u0646\u0627\u062f\u06cc\u060c \u0641\u0642\u0637 \u0627\u0632 \u0633\u0647 \u0645\u062f\u0644 \u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u062f\u0627\u062f\u0645 \u062a\u0641\u0627\u0648\u062a\u06cc \u062d\u0633 \u0646\u06a9\u0631\u062f\u0645 \u0648 \u0647\u0631 \u0633\u0647 \u06cc\u06a9 \u0645\u062f\u0644 \u0628\u0648\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u064f\u0646\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0645\u06cc \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a\u060c\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0645\u0646\u062a\u0647\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0641\u0627\u06a9\u062a\u0648\u0631 \u062e\u0631\u06cc\u062f \u062a\u0648\u0633\u0637 \u067e\u06cc\u06a9 \u0627\u0631\u0627\u0626\u0647 \u0646\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u062a\u0648\u0646 \u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 (Happy Birthday)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0628\u0647 \u0642\u062f\u0631\u06cc\u200c\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u06a9\u0631\u0645 \u0628\u06cc\u0646\u0634 \u0639\u06cc\u0646 \u0644\u0627\u0633\u062a\u06cc\u06a9 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 7 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u067e\u0646\u062c \u0646\u06cc\u0633\u062a. \u0642\u0631\u0627\u0628\u06cc\u0647 \u0647\u0645 \u062f\u0631 \u062d\u062f \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0633\u062a \u0686\u0648\u0646 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u062e\u0635\u0635\u06cc \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0642\u0631\u0627\u0628\u06cc\u0647 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0644\u0637\u06cc\u0641\u0647 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u062e\u0634\u06a9 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u06a9\u0627\u06a9\u0627\u0626\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 10 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\u0646\u0648\u0634\u062a\u0647 \u0645\u0648\u0631\u062f \u0646\u0638\u0631 \u0631\u0648\u06cc \u06cc\u0647 \u0631\u0648\u0628\u0627\u0646 \u0648\u0635\u0644 \u0628\u0647 \u06a9\u06cc\u06a9 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0646\u0648\u0634\u062a\u0647 \u0645\u06cc\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u0628\u0648\u062f\n\u06cc\u06a9 \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u0628\u06cc\u0647 \u0631\u062f\u0648\u0644\u0648\u0644\u062a \u0628\u0648\u062f\n\u062d\u062c\u0645 \u0648 \u0642\u06cc\u0645\u062a\u0634 \u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f.\u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06cc\u0647 \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c \u0648\u0644\u06cc \u06a9\u0645\u06cc \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0632\u0648\u062f \u0631\u0633\u06cc\u062f \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u06a9\u06cc\u06a9\u0634 \u062a\u06cc\u06a9\u0647 \u0647\u0627\u06cc \u06cc\u062e \u062f\u0627\u0634\u062a \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f 5", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0645\u06cc\u0646\u06cc", "\u0634\u0645\u0639 \u0639\u062f\u062f 2", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0631 \u062c\u0639\u0628\u0647 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f. \u062a\u0642\u0635\u06cc\u0631 \u0627\u0632 \u0646\u062d\u0648\u0647 \u0627\u0631\u0633\u0627\u0644 \u0646\u06cc\u0633\u062a \u062c\u0639\u0628\u0647 \u0645\u0646\u0627\u0633\u0628\u06cc \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646\u06a9\u0627\u0631 \u0627\u0646\u062a\u062e\u0627\u0628 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06cc\u06a9 \u0633\u0645\u062a \u06a9\u06cc\u06a9 \u0648\u0642\u062a\u06cc \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f . \u0648 \u0648 \u0633\u0631 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u06cc\u06a9 \u0633\u0645\u062a \u0633\u06cc\u0646\u06cc. \u0648\u0644\u06cc \u0627\u0632 \u0646\u0638\u0631 \u0632\u0645\u0627\u0646\u06cc \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u0648\u06cc \u0633\u06cc\u0646\u06cc \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0639\u062f\u062f 4", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc\u0634 \u062e\u0648\u0628\u0647 !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062f\u0644\u0686\u0633\u0628 \u0648 \u0644\u0630\u06cc\u0630 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0647\u0631 \u062f\u0648 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f\u062f\u062f\u062f\n\u0645\u0646 \u0648\u0627\u0642\u0639\u0627 \u0631\u0627\u0636\u06cc \u0646\u06cc\u0633\u062a\u0645 \u060c\u0648 \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0631\u0627\u062d\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0645\u0631\u0628\u0627 \u0642\u06cc\u0635\u06cc \u0632\u0631\u062f\u0627\u0644\u0648 \u06a9\u0648\u0686\u06a9", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0647 \u0645\u0639\u0646\u0627\u06cc \u062f\u0642\u06cc\u0642 \u06a9\u0644\u0645\u0647 \u0645\u06cc\u0646\u06cc!!! \u062f\u0648\u0633\u062a\u0627\u0646 \u0645\u0631\u0627\u0642\u0628 \u0628\u0627\u0634\u06cc\u062f \u0627\u06cc\u0646 \u0669 \u0639\u062f\u062f \u062f\u0631 \u06a9\u0646\u0627\u0631 \u0647\u0645 \u0631\u0648 \u0628\u0647 \u06a9\u0641 \u062f\u0633\u062a \u062c\u0627 \u0645\u06cc\u0634\u0647! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0627\u0648\u0644\u0627 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0628\u06cc\u0633\u062a\u0647 \u0648 \u0645\u0631\u0633\u06cc \u062f\u0648 \u0627\u06cc\u0646\u06a9\u0647 \u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0645\u0633\u0626\u0648\u0644\u06cc\u062a \u067e\u0630\u06cc\u0631 \u0628\u0648\u062f \u0648 \u06af\u0641\u062a \u0686\u06a9 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u06a9\u06cc\u06a9\u0647\u0627 \u062e\u0631\u0627\u0628 \u0646\u0634\u062f\u0647 \u0628\u0627\u0634\u0647 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644. \u0648 \u0686\u06a9 \u06a9\u0631\u062f\u0645 \u0647\u0645\u0634 \u0633\u0627\u0644\u0645 \u0628\u0648\u062f. \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0647\u0633\u062a\u06cc\u0646\u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0627\u0634\u062e\u0635\u06cc\u062a \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f\u060c \u0645\u062e\u0635\u0648\u0635\u0627 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc \u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u0634 \u0647\u0645\u0627\u0646\u0646\u062f \u0647\u0645\u06cc\u0646 \u0686\u0646\u062f \u0633\u0627\u0644 \u067e\u06cc\u0634 \u0628\u0648\u062f \u0628\u0631\u0627\u06cc \u0627\u0648\u0644\u06cc\u0646 \u0645\u0631\u062a\u0628\u0647 \u0637\u0639\u0645 \u062e\u0648\u0634\u0645\u0632\u0634 \u062a\u062c\u0631\u0628\u0647 \u06a9\u0631\u062f\u06cc\u0645. \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0648\u0628\u062a\u0648\u0646 \u0648 \u0647\u0645\u0686\u0646\u06cc\u0646 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0627 \u0633\u0644\u06cc\u0642\u0647 \u0645\u062d\u062a\u0631\u0645\u0627\u0646\u0647 \u0627\u06cc \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0644\u062d\u0627\u0638 \u0645\u06cc\u06a9\u0646\u06cc\u062f\u060c \u0645\u0645\u0646\u0648\u0646\u0645 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u062c\u0631\u0628\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f\u06cc \u0628\u0648\u062f. \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f\u060c \u0648 \u0627\u0632 \u0622\u0646 \u0645\u0647\u0645\u062a\u0631\u060c \u0627\u0632 \u0644\u062d\u0627\u0638 \u062a\u0627\u0632\u06af\u06cc\u060c \u0632\u0645\u0627\u0646 \u0637\u0628\u062e \u06a9\u06cc\u06a9\u0647\u0627 \u0628\u0647 \u062f\u0648\u0631\u0647 \u06cc \u0627\u0646\u0642\u0644\u0627\u0628 \u0631\u0648\u0633\u06cc\u0647 \u0628\u0631\u0645\u06cc\u06af\u0634\u062a. \u062a\u0646\u0647\u0627 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0645\u06cc \u062a\u0627\u0632\u0647 \u062a\u0631 \u0648 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0628\u0648\u062f\u060c \u06a9\u0647 \u0628\u0647 \u0644\u0637\u0641 \u067e\u06cc\u06a9 \u0627\u06cc\u0646 \u0622\u06cc\u062a\u0645 \u0647\u0645 \u0627\u0632 \u0647\u0645 \u067e\u0627\u0634\u06cc\u062f\u0647 \u0628\u0648\u062f. \u0628\u0647 \u0647\u0631 \u062d\u0627\u0644 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u062f\u0641\u0639\u0647 \u0628\u0639\u062f\u06cc\u060c \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u062f\u0648\u0631 \u0631\u06cc\u0632 \u0631\u0627 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0646\u0641\u0631\u0633\u062a\u0646\u062f\u060c \u06a9\u0647 \u0645\u0627 \u0647\u0645 \u0645\u0631\u062f\u0645\u0627\u0646\u06cc\u0645. \u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u062a\u0627\u067e\u06cc\u0646\u06af \u0631\u0648\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u06f4 \u0628\u0627\u0631 \u062a\u0627\u062e\u06cc\u0631 \u062e\u0648\u0631\u062f \u0628\u0647\u0634 \u0648 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc (\u062f\u0627\u0646\u0647 \u0627\u06cc)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062a\u0627\u062e\u06cc\u0631....\n\u062a\u0627\u062e\u06cc\u0631....\n\u062a\u0627\u062e\u06cc\u0631....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a (9 \u062a\u0627\u06cc\u06cc)", -1]}
{"text": ["\u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u062f\u0648\u0645 \u0627\u0633\u062a \u06a9\u0647 \u0627\u06cc\u0646 \u0645\u0634\u06a9\u0644 \u067e\u06cc\u0634 \u0627\u0645\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", -1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0645\u062a\u0644\u0627\u0634\u06cc \u0648 \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u0645\u0635\u0631\u0641 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", -1]}
{"text": ["\u0641\u0642\u0637 \u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0647 \u0635\u0648\u0631\u062a \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u0648\u0644\u064a \u0627\u0632 \u0627\u064a\u0646\u0643\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u067e\u0630\u064a\u0631\u0641\u062a \u0627\u064a\u0646 \u0645\u0648\u0631\u062f \u0643\u0647 \u0627\u0632 \u0637\u0631\u0641 \u062e\u0648\u062f \u067e\u064a\u0643 \u0627\u062a\u0641\u0627\u0642 \u0627\u0641\u062a\u0627\u062f\u0647 \u0631\u0636\u0627\u064a\u062a \u0628\u062e\u0634 \u0647\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0686\u0631\u0627 \u0628\u0627\u06cc\u062f \u067e\u0648\u062f\u0631 \u0646\u0627\u0631\u06af\u06cc\u0644 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u062a\u0648\u0634\u061f\n\u0648\u0627\u0642\u0639\u0627 \u0628\u0627 \u0630\u0627\u0626\u0642\u0647 \u06cc \u0645\u0646 \u062c\u0648\u0631 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0627\u0634\u062a\u0628\u0627\u0647 \u0622\u0648\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u0634\u06a9\u0644\u0627\u062a\u06cc 600 \u06af\u0631\u0645", -1]}
{"text": ["\u0627\u0628\u062a\u062f\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627\u064b \u0627\u0634\u062a\u0628\u0627\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. \u067e\u0633 \u0627\u0632 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0648 \u0633\u0647 \u0628\u0627\u0631 \u0622\u0645\u062f\u0646 \u067e\u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0631\u0633\u062a \u0628\u0627\u0644\u0627\u062e\u0631\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062a\u0631 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u062f \u0648 \u0632\u0634\u062a \u0628\u0648\u062f. 90% \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062f\u0631\u0628 \u062c\u0639\u0628\u0647. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627\u064b \u062f\u0627\u063a \u0648 \u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u0634\u06a9\u0644\u0627\u062a\u06cc 600 \u06af\u0631\u0645", -1]}
{"text": ["\u062e\u0633\u062a\u06af\u06cc \u0639\u0635\u0631 \u062c\u0645\u0639\u0647 \u0631\u0648 \u0628\u0631\u0637\u0631\u0641 \u06a9\u0631\u062f\u06cc\u0646 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f \u0641\u06a9\u0631 \u06a9\u0646\u0645 \u0647\u0631 \u0631\u0648\u0632 \u062f\u0644\u0645 \u0628\u062e\u0648\u0627\u062f \u0627\u0632 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0647\u0627 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633 \u06a9\u0631\u0645\u062f\u0627\u0631 \u067e\u0633\u062a\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 12 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628\u06cc \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 18 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u06cc\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 (Happy Birthday)", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0622\u0628\u0631\u0648\u0645\u0648\u0646 \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0648\u0646 \u0631\u0641\u062a  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (\u062d\u062f\u0648\u062f 25 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \n\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. \u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f \u0648 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u062d\u062f\u0648\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633\u06cc \u06a9\u0647 \u062f\u0631 \u0633\u0627\u06cc\u062a \u06af\u0630\u0627\u0634\u062a\u0646\u062f \u0646\u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062f\u0648 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u06af\u0631 \u0628\u06cc\u0646 \u06a9\u06cc\u06a9 \u060c \u0642\u0637\u0639\u0627\u062a \u0645\u0648\u0632 \u0647\u0645 \u06af\u0630\u0627\u0634\u062a\u0647 \u0645\u06cc\u0634\u062f \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0634\u06a9 \u0647\u0627\u0634 \u0639\u0627\u0644\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0631\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (12 \u0639\u062f\u062f)", "\u0632\u0646\u062c\u0628\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0641\u0642\u0637 \u06a9\u0645\u06cc \u0634\u06cc\u0631\u06cc\u0646\u0634 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f .\u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc", 1]}
{"text": ["\u0628\u0631\u0627 \u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u06a9\u06cc\u06a9 \u0622\u0646\u0644\u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645. \u0647\u0645 \u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u06a9\u0646\u06a9 \u0647\u0644\u06cc\u0648\u0645\u06cc", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0647 \u0637\u0628\u0642 \u0645\u0639\u0645\u0648\u0644 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (12 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0662 \u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0647\u0631\u0662 \u0628\u0627\u0631 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0627\u0648\u0631\u062f\u0646\u060c \u0643\u064a\u0641\u064a\u062a \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0645 \u062e\u064a\u0644\u064a \u062e\u0648\u0628 \u0628\u0648\u062f\n\u0641\u0642\u0637 \u0643\u0627\u0634 \u0639\u0643\u0633 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0631\u0648 \u0647\u0645 \u062a\u0648 \u0633\u0627\u064a\u062a \u0645\u064a\u0630\u0627\u0634\u062a\u064a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0648\u0646\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0647\u067e\u06cc", "\u06a9\u06cc\u06a9 \u0633\u0628\u062f \u06af\u0644", 1]}
{"text": ["\u0633\u0627\u0642 \u0639\u0631\u0648\u0633 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0642\u0631\u06cc\u0628\u0627 \u0627\u0635\u0644\u0627 \u0633\u06cc\u0628 \u0646\u062f\u0627\u0634\u062a \u062a\u0648\u0634! \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0647\u0645 \u0631\u0633\u06cc\u062f \u0641\u06a9\u0631 \u06a9\u0646\u0645 \u062d\u062a\u06cc \u06a9\u0645\u062a\u0631 \u0627\u0632 \u06cc\u0647 \u0631\u0628\u0639 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c\u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u0627\u0648\u0646 \u0686\u06cc\u0632\u06cc \u0647\u0645 \u06a9\u0647 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u06af\u0630\u0627\u0634\u062a\u0646 \u062a\u0648 \u062c\u0639\u0628\u0647.\n\u06cc\u0647 \u062c\u0639\u0628\u0647 \u067e\u0631\u0647 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u0631\u0628\u0627\u06cc\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc", -1]}
{"text": ["\u062f\u0633\u062a\u062a\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f.\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u064a\u062f \u0627\u064a\u062f\u0647 \u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u064a \u062f\u0627\u0631\u064a\u062f \n\u0644\u0637\u0641\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0631\u0648\u0634\u064a\u0647\u0627\u064a\u0628\u064a\u0634\u062a\u0631\u064a \u0631\u0627 \u067e\u0648\u0634\u0634 \u0628\u062f\u064a\u0646 \n\u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u0633\u0628\u06a9 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0633\u062a. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0645\u062c\u06cc\u06a9", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0627\u0648\u0644\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u06a9\u06cc\u06a9 \u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \n\u0633\u0641\u0627\u0631\u0634 \u0627\u0648\u0644 \u0628\u0646\u062f\u0647 \u0647\u0645\u06cc\u0646 \u06a9\u06cc\u06a9 \u0628\u0627 \u0648\u0632\u0646 \u06a9\u0645\u062a\u0631 \u0628\u0648\u062f \u06a9\u0647 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06af\u0641\u062a\u0646 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0648 \u0633\u0641\u0627\u0631\u0634 \u0648 \u0627\u06af\u0631 \u0645\u0627\u06cc\u0644 \u0628\u0627\u0634\u06cc\u062f \u0639\u0648\u0636 \u06a9\u0646\u06cc\u0645 \u060c\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c\u0634\u0627\u06cc\u062f \u0628\u0627 \u0627\u0631\u0641\u0627\u063a \u0628\u0634\u0647 \u0628\u0647\u0634 \u0627\u0645\u062a\u06cc\u0627\u0632 \u0645\u062a\u0648\u0633\u0637 \u062f\u0627\u062f\u060c\u062e\u0627\u0645\u0647 \u0648\u0633\u0637 \u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u0628\u0633\u062a\u0646\u06cc \u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0642\u0648\u0627\u0645 \u0644\u0627\u0632\u0645 \u0648 \u0646\u062f\u0627\u0634\u062a\u060c\u0634\u06a9\u0644\u0627\u062a\u0647\u0627\u06cc \u0631\u0646\u062f\u0647 \u0634\u062f\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0628\u06cc\u0634\u062a\u0631\u0634 \u062f\u0631\u0648\u0646 \u062c\u0639\u0628\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u0648 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u060c\u06a9\u0647 \u0627\u06af\u0631 \u0628\u0631\u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u0634\u062e\u0635\u06cc \u0646\u0628\u0648\u062f \u0648 \u0628\u0631\u0627\u06cc \u062c\u0634\u0646 \u06cc\u0627 \u0645\u0647\u0645\u0627\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0642\u0637\u0639\u0627\u064b \u0628\u0647 \u0634\u062f\u062a \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0645\u06cc\u06a9\u0631\u062f\u0645\u060c\u06a9\u0644 \u0627\u062c\u0632\u0627\u06cc \u06a9\u06cc\u06a9 \u0627\u0632 \u0646\u0627\u0646 \u0627\u0633\u0641\u0646\u062c\u06cc \u06af\u0631\u0641\u062a\u0647 \u062a\u0627 \u062e\u0627\u0645\u0647 \u0648 \u062f\u06cc\u0632\u0627\u06cc\u0646 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0647\u0633\u062a \u0648 \u0641\u0642\u0637 \u0637\u0639\u0645 \u06a9\u0627\u06a9\u0627\u0626\u0648 \u063a\u0627\u0644\u0628 \u0647\u0633\u062a \u060c\u0647\u06cc\u0686 \u0645\u06cc\u0648\u0647 \u06cc\u0627 \u0622\u062c\u06cc\u0644\u06cc \u062f\u0631\u0648\u0646 \u06a9\u06cc\u06a9 \u0628\u06a9\u0627\u0631 \u0646\u0631\u0641\u062a\u0647 \u0641\u0642\u0637 \u0628\u0631\u0627\u06cc \u062a\u0632\u06cc\u06cc\u0646 \u0627\u0632 \u06a9\u0645\u067e\u0648\u062a \u06af\u06cc\u0644\u0627\u0633 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0631\u0648\u06cc \u0627\u0648\u0646 \u0648 \u0628\u0627 \u06cc\u06a9 \u06a9\u0631\u0645 \u06cc\u0627 \u0686\u06cc\u0632\u06cc \u0634\u0628\u06cc\u0647 \u0698\u0644\u0647 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u062c\u0627\u0644\u0628\u06cc \u0646\u062f\u0627\u0634\u062a \u0648 \u0628\u062f \u0645\u0632\u0647 \u0628\u0648\u062f \u067e\u0648\u0634\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646\u060c\u0639\u06a9\u0633 \u0647\u0645 \u06af\u0631\u0641\u062a\u0645 \u0648 \u0641\u0631\u0633\u062a\u0627\u062f\u0645 \u0627\u0645\u0627 \u062b\u0628\u062a \u0646\u06a9\u0631\u062f\u0646!!!!! \u0636\u0645\u0646\u0627\u064b \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u0628\u0627 \u0639\u06a9\u0633 \u062a\u0648\u06cc\u0647 \u0645\u0646\u0648 \u0641\u0631\u0642 \u0645\u06cc\u06a9\u0646\u0647!!!!!\n\u062f\u0631 \u06a9\u0644 \u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0627\u0646\u062a\u0638\u0627\u0631 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0645\u06cc\u0631\u0647 \u060c\u0627\u0645\u0627 \u0642\u0637\u0639\u0627\u064b \u0648\u0642\u062a\u06cc \u06a9\u06cc\u06a9 \u0628\u0627 \u0627\u06cc\u0646 \u0648\u0632\u0646 \u0648 \u0633\u0627\u06cc\u0632 \u062f\u0631\u0633\u062a \u0645\u06cc\u06a9\u0646\u06cc\u062f \u0641\u0631\u0648\u0634\u0634 \u0647\u0645 \u0633\u062e\u062a \u062a\u0631 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f .\u0641\u0642\u0637 \u06a9\u0627\u0634 \u0628\u0631\u0627\u06cc \u0645\u0633\u0627\u0641\u062a\u0647\u0627\u06cc \u0628\u0647 \u0627\u06cc\u0646 \u06a9\u0648\u062a\u0627\u0647\u06cc \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0631\u0627\u06cc\u06af\u0627\u0646 \u0628\u0627\u0634\u0647.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0637\u0628\u0642 \u0645\u0639\u0645\u0648\u0644 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631 \u0645\u0646 \u0627\u06af\u0631 \u062a\u0639\u062f\u0627\u062f \u0628\u06cc\u0634\u062a\u0631\u06cc \u0627\u0632 \u0627\u06cc\u0646 \u062f\u0633\u062a \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u0647\u0627 \u0630\u0631 \u0627\u0633\u0646\u067e \u0645\u06cc\u0628\u0648\u062f \u0631\u0642\u0627\u0628\u062a \u067e\u06cc\u062f\u0627 \u0645\u06cc\u0634\u062f \u0648\u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0644\u0627\u062a\u0631 \u0645\u06cc\u0631\u0641\u062a \u0628\u0647 \u0647\u0631\u062d\u0627\u0644 \u062e\u0648\u0628\u0647 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u0647\u061b \u0641\u0642\u0637 \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0631\u0648\u063a\u0646 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0632\u06cc\u0627\u062f\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u0644\u0648\u0686\u0647 \u062e\u0631\u0645\u0627\u06cc\u06cc\u0634\u0648 \u0628\u0642\u06cc\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f \n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc\u0634 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0644\u0648\u0686\u0647 \u062e\u0631\u0645\u0627\u06cc\u06cc", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0633\u062a\u0646 \u0645\u0631\u0631\u0631\u0631\u0631\u0633\u06cc \u0627\u0632 \u062e\u0644\u0627\u0642\u06cc\u062a\u062a\u0648\u0646 \u0628\u0627\u0628\u062a \u0646\u0627\u0646 \u0644\u06cc\u062f\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0631\u062f\u0648 \u062f\u0627\u063a \u062f\u0627\u063a\u060c\u060c\u062a\u0627\u0632\u0647...\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc.\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0645\u0634\u062a\u0631\u06cc \u0645\u062f\u0627\u0631\u06cc\u062a\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (20 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647\u060c \u0645\u0648\u0642\u0639\u06cc \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f \u06a9\u0627\u0645\u0644\u0627 \u062f\u0627\u063a \u0628\u0648\u062f\u060c \u0627\u0632\u062a\u0648\u0646 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0627\u06cc\u0646\u0628\u0627\u0631 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u06cc\u0627\u062a\u0630\u0628\u0648\u062f \u0648 \u0632\u0648\u062f \u06a9\u067e\u06a9 \u0632\u062f\u060c\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0641\u062a \u06af\u06cc\u0627\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f \u0646\u0633\u0628\u062a \u0628\u0647 \u0632\u0645\u0627\u0646 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0641\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u06cc \u0645\u0632\u0647 !", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0643\u064a\u0643 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0634\u0643\u0644\u0627\u062a \u0631\u0648\u0634 \u062a\u064a\u0631\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u064a\u0639\u0646\u0649 \u062e\u0631\u064a\u062f \u063a\u064a\u0631\u062d\u0636\u0648\u0631\u0649 \u0628\u0627\u064a\u062f \u0627\u064a\u0646\u062c\u0648\u0631\u0649 \u0628\u0627\u0634\u0647\u061f \u0686\u0648\u0646 \u0646\u0645\u064a\u0628\u064a\u0646\u064a\u0645 \u0648 \u0645\u064a\u062e\u0631\u064a\u0645 \u0628\u0627\u064a\u062f \u0643\u064a\u0643 \u0645\u0648\u0646\u062f\u0647 \u0628\u0641\u0631\u0633\u062a\u0646\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0633\u0627\u0644 \u0647\u0627\u0633\u062a \u0627\u0632 \u0634\u0639\u0628 \u0645\u062e\u062a\u0644\u0641 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0627\u0645\u0627 \u0627\u06cc\u0646\u062f\u0641\u0639\u0647 \u0628\u0627 \u06a9\u0645\u0627\u0644 \u062a\u0639\u062c\u0628 \u0645\u062a\u0648\u062c\u0647 \u0634\u062f\u0645 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f! \u0646\u0647 \u062a\u0646\u0647\u0627 \u0631\u0646\u06af \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u062a\u06cc\u0631\u0647 \u0628\u0648\u062f \u0628\u0644\u06a9\u0647 \u0644\u0628\u0647 \u0647\u0627\u06cc \u0628\u06cc\u0631\u0648\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0645\u0632\u0647 \u0633\u0648\u062e\u062a\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u06f2 \u0633\u0627\u0639\u062a \u0628\u0647 \u062c\u0627\u06cc \u06a9\u06cc\u06a9 \u06f1 \u0645\u0639\u062c\u0648\u0646 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9\u200c\u0647\u0627 \u06cc\u06a9\u0645 \u0628\u0647\u0645\u200c\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc... \u0627\u06cc\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0627 \u0627\u062e\u062a\u0644\u0627\u0641 \u06cc\u06a9\u06cc \u0627\u0632 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0647\u0627\u06cc\u06cc \u0647 \u06a9\u0647 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0631\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0648\u062f\u0631 \u0634\u062f\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0648\u0642\u062a\u06cc \u0631\u0633\u06cc\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u06a9\u0627\u0645\u0644\u0627  \u0642\u0627\u0637\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f ... \u0648\u0642\u062a\u06cc \u0628\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06af\u0641\u062a\u06cc\u0645 \u0628\u0639\u062f \u0627\u0632 \u06a9\u0644\u06cc \u0645\u0637\u0644\u06cc \u06af\u0641\u062a\u0646\u062f \u062f\u0648\u0628\u0627\u0631\u0647 \u0645\u06cc\u0641\u0631\u0633\u062a\u0646\u062f \u0627\u0645\u0627 \u0686\u0646\u062f\u06cc\u0646 \u0642\u0644\u0645 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0627 \u06a9\u0644\u06cc \u062a\u0627\u062e\u06cc\u0631 \u0628\u062f\u0633\u062a\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f ... \u062f\u0631 \u0646\u0647\u0627\u06cc\u062a \u0628\u0639\u062f \u0627\u0632 \u06f2 \u0633\u0627\u0639\u062a \u0648 \u06f4\u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0646\u0627\u0642\u0635 \u0628\u0647 \u062f\u0633\u062a\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f .\n\u0648 \u0627\u06cc\u0646 \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0645\u0646 \u062f\u0631 \u0627\u0628\u062a\u062f\u0627 \u062e\u0648\u0627\u0647\u0634 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0627\u0648\u0644\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0645\u0646\u0627\u0633\u0628 \u0642\u0631\u0627\u0631 \u062f\u0647\u0646\u062f \u062b\u0627\u0646\u06cc\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u06af\u0648\u0634\u0632\u062f \u06a9\u0646\u0646\u062f \u06a9\u0647 \u0628\u0627 \u062f\u0642\u062a \u062d\u0645\u0644 \u0634\u0648\u062f \u0686\u0648\u0646 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0633\u0648\u0645\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0639\u0627\u0634\u0642 \u0627\u064a\u0646 \u0643\u064a\u0643\u0645 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u064a\u0643 \u0647\u0645 \u0639\u0627\u0644\u064a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u06af\u0641\u062a\u0647 \u0628\u0648\u062f\u0645 \u0628\u0627 \u062f\u0642\u062a \u062d\u0645\u0644 \u0628\u0634\u0647 \u067e\u0648\u062f\u06cc\u0646\u06af \u06a9\u0627\u0645\u0644\u0627 \u067e\u062e\u0634 \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u062f\u0633\u0631 \u0647\u0627 \u0628\u0647 \u062e\u0627\u0637\u0631 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062a\u0639\u0648\u064a\u0636 \u0647\u0645 \u0646\u0634\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u0645\u062a\u0648\u0633\u0637\u0634\u0648\u0646 \u0622\u0628 \u0631\u0641\u062a\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0627\u0644\u0627 \u0628\u0648\u062f\u0646 \u0642\u06cc\u0645\u062a \u0646\u0633\u0628\u062a \u0628\u0647 \u06a9\u06cc\u0641\u06cc\u062a! \u062c\u0627\u0628\u0647 \u062c\u0627\u06cc\u06cc \u06a9\u06cc\u06a9 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628\u060c \u0698\u0644\u0647 \u0647\u0627\u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0641 \u0638\u0631\u0641.\n\u062f\u0631 \u06a9\u0644 \u0645\u062a\u0648\u0633\u0637 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", 1]}
{"text": ["\u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0628\u062c\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u06a9\u0647 \u0686\u0646\u062f\u0645\u06cc\u0646 \u0628\u0627\u0631\u0647 \u0628\u0647 \u062a\u0627\u0632\u06af\u06cc \u0628\u0642\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0646\u06cc\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u060c \u0645\u062a\u0634\u06a9\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f.\n\u0641\u0642\u0637 \u0644\u0637\u0641\u0627 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0647\u0645 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u06cc\u062f.\n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u0634\u06a9\u0644\u0627\u062a\u06cc 600 \u06af\u0631\u0645", 1]}
{"text": ["\u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u062c\u062f\u06cc\u062f\u0627 \u067e\u06cc\u06a9 \u0647\u0627 \u067e\u06cc\u0634 \u0627\u0632 \u0631\u0633\u0648\u0646\u062f\u0646 \u0645\u06cc\u0632\u0646\u0646 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0634\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0631\u062f\u0648\u0644\u0648\u062a \u0627\u0632 \u0647\u0645\u0647 \u0627\u0634 \u0628\u0647\u062a\u0631\u060c \u062c\u0632 \u0645\u0639\u062f\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u06cc\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062f\u06cc\u062f\u0645 \u062a\u0648 \u0631\u062f\u0648\u0644\u0648\u062a \u067e\u0646\u06cc\u0631 \u0647\u0645 \u06af\u0630\u0627\u0634\u062a\u0647. \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc\u0634\u0648\u0646\u0645 \u0632\u06cc\u0628\u0627 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0628\u0631\u0627\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc\u062a\u0648\u0646 \u0628\u0647\u062a\u0631\u0647 \u062a\u0648 \u0628\u0633\u062a\u0647 \u0647\u0627\u06cc \u0642\u0634\u0646\u06af \u0633\u0631\u0648\u0634 \u06a9\u0646\u06cc\u062f \u0686\u0648\u0646 \u0648\u0627\u0642\u0639\u0627 \u0628\u0631\u0627\u06cc \u0637\u0639\u0645 \u0628\u0647 \u0627\u06cc\u0646 \u062e\u0648\u0634\u0645\u0632\u06af\u06cc \u0627\u06cc\u0646 \u0628\u0633\u062a\u0647 \u0647\u0627 \u062d\u06cc\u0641 \u0647\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0646\u0628\u0648\u0644\u06cc \u0648\u06cc\u0698\u0647 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 600 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u06af\u0631\u0645 \u0628\u0648\u062f \u062f\u0631 \u062d\u062f\u06cc \u06a9\u0647 \u062a\u0631\u0633\u06cc\u062f\u0645 \u0645\u0648\u0633 \u0631\u0648\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0627\u0634\u0647 \u060c \u0648 \u0627\u06af\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0628\u0648\u062f \u062d\u062a\u0645\u0627 \u0648\u0627 \u0631\u0641\u062a\u0647 \u0628\u0648", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0631 \u06a9\u0645\u062a\u0631\u06cc\u0646 \u0632\u0645\u0627\u0646 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f \u0645\u062a\u0634\u06a9\u0631\u0645 \n\u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0627\u0632 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0627\u06cc \u0628\u0647\u062a\u0631\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc (\u06cc\u06a9 \u0627\u0633\u0644\u0627\u06cc\u0633)", 1]}
{"text": ["\u0627\u0632 \u0646\u0638\u0631 \u0637\u0639\u0645 \u0645\u0646 \u0642\u0628\u0644\u0627 \u0627\u0632 \u0645\u0627\u0631\u06cc \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0633\u062a \u0647\u0645 \u062a\u0627\u0632\u0647 \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0627\u0645\u0627 \u0627\u0645\u0631\u0648\u0632 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0627 \u067e\u06cc\u06a9 \u0622\u0645\u062f \u062e\u06cc\u0644\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \n\u062e\u0627\u0645\u0647 \u0647\u0627 \u0647\u0645\u0647 \u0628\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0644\u0637\u0641\u0627 \u0639\u06a9\u0633 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0631\u0627 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u06a9\u0647 \u0628\u0627 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0647\u06cc\u0645\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u0686\u0627\u06cc\u06cc", 1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u062a\u0645\u0634\u06a9 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0646\u06cc\u0634 \u0634\u06a9\u0644\u0627\u062a\u06cc 600 \u06af\u0631\u0645", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062f\u062a \u0632\u0645\u0627\u0646 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0646\u0632\u062f\u06cc\u06a9\u06cc \u0628\u0647 \u0645\u062d\u0644 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u06a9\u0645\u06cc \u0637\u0648\u0644\u0627\u0646\u06cc \u0634\u062f.\u0637\u0639\u0645 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc 1 \u06a9\u06cc\u0644\u0648 \u0648 100 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f .\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0633\u0631\u0639\u062a \u0648 \u062f\u0642\u062a \u0634\u0645\u0627 .\u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0639\u0627\u0644\u0649\n\u0642\u064a\u0645\u062a \u0645\u0646\u0627\u0633\u0628\n\u0645\u0631\u0633\u0649 \u0643\u0647 \u0647\u0633\u062a\u064a\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc", "\u062a\u0627\u0631\u062a \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0632\u0628\u0627\u0646 \u062e\u064a\u0644\u064a \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0641\u0642\u0637 \u0643\u0645\u064a \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0628\u0644\u0646\u062f \u0634\u0634\u0635\u062f \u06af\u0631\u0645", "\u0646\u0627\u0646 \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc\u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c \u0632\u06cc\u0631 \u06f1 \u0631\u0628\u0639 \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0642\u06cc\u0641\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (6 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (7 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0647\u0627\u0634 \u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u06cc\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", "\u062f\u064f\u0646\u0627\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0628\u0627 \u0639\u06a9\u0633\u06cc \u06a9\u0647  \u062a\u0648 \u0645\u0646\u0648 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u0648 \u0628\u06cc\u0646 \u0633\u0627\u06cc\u0632 \u0628\u0632\u0631\u06af \u0648 \u06a9\u0648\u0686\u06cc\u06a9\u0634  \u0627\u0632 \u0644\u062d\u0627\u0638 \u0648\u0632\u0646\u06cc \u062a\u0641\u0627\u0648\u062a \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645\u06cc \u0628\u0648\u062f \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0633\u0627\u06cc\u0632 \u0628\u0632\u0631\u06af \u0648 \u0628\u0627 \u062e\u0627\u0645\u0647 \u0632\u06cc\u0627\u062f \u062a\u0632\u0626\u0626\u0646 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u0628\u0647 \u062d\u062f\u0627\u0642\u0644 \u0648\u0632\u0646 \u06a9\u0647 \u0645\u06cc\u0628\u0627\u06cc\u0633\u062a \u0628\u0627\u0634\u0647 \u0628\u0631\u0633\u0648\u0646\u0646. \u062f\u0631 \u0648\u0627\u0642\u0639 \u0645\u06cc\u0634\u0647 \u06af\u0641\u062a \u0628\u0627 \u062a\u0632\u0626\u06cc\u0646 \u062e\u0627\u0645\u0647 \u0632\u06cc\u0627\u062f \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u0648 \u0639\u06a9\u0633 \u0645\u0646\u0648 \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0633\u0627\u06cc\u0632 \u0628\u0632\u0631\u06af \u0648 \u0628\u0647 \u062d\u062f\u0627\u0642\u0644 \u0648\u0632\u0646 \u062a\u0627\u0632\u0647 \u0634\u0627\u06cc\u062f\u060c \u0631\u0633\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0645\u0646 \u0627\u06cc\u0646\u06a9\u0627\u0631 \u0648\u0627\u0642\u0639\u0627 \u0632\u0634\u062a\u0647. \u0648 \u0645\u0646 \u0627\u0632 \u0627\u06cc\u0646 \u0628\u0647 \u0628\u0639\u062f \u0627\u06af\u0647 \u0628\u062e\u0648\u0627\u0645 \u0628\u062e\u0631\u0645 \u0642\u0637\u0639\u0627 \u06a9\u0648\u0686\u06cc\u06a9\u0634 \u0648 \u0645\u06cc\u06af\u06cc\u0631\u0645 \u0686\u0648\u0646 \u0628\u0627 \u0628\u0632\u0631\u06af \u062a\u0641\u0627\u0648\u062a \u062e\u06cc\u0644\u06cc \u06a9\u0645\u06cc \u062f\u0627\u0634\u062a \u0648 \u0627\u0635\u0644\u0627 \u062a\u0641\u0627\u0648\u062a \u0642\u06cc\u0645\u062a\u0634\u0648\u0646 \u0642\u0627\u0628\u0644 \u062a\u0648\u062c\u06cc\u0647 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9", "\u0634\u0645\u0639 \u0642\u0644\u0628\u06cc", -1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647\n\u062e\u0627\u0645\u0647 \u0633\u0628\u06a9 \u0648 \u0627\u0635\u0644\u0627 \u062f\u0644\u0648 \u0646\u0645\u06cc\u0632\u062f\n\u0648 \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \n\u06cc\u06a9 \u062f\u0646\u06cc\u0627 \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f \u0648 \u0628\u0633\u06cc\u0627\u0631 \u062f\u0627\u063a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a.\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u062a\u0648\u0646. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0634\u06a9\u0631\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06a9\u0646\u062c\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0633\u0648\u062e\u062a\u0647 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u062e\u0645\u06cc\u0631 \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", -1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.\u0634\u06cc\u0631\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0645\u06cc\u062a\u0648\u0646\u0633\u062a \u0628\u0647\u062a\u0631 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (12 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0648 \u0647\u0645 \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (25 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u06cc\u0634\u0646\u0647\u0627\u062f\u0645 \u0627\u06cc\u0646\u0647 \u062e\u0627\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0628\u06cc\u0634\u062a\u0631 \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0646\u0628\u0648\u062f \u06a9\u0627\u0645\u0644\u0627 \u0645\u062a\u0648\u0633\u0637 \u0648 \u062f\u0631 \u062d\u062f \u0642\u06cc\u0645\u062a\u0634 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0645\u0646 \u06f2 \u0633\u0631\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0647\u0631 \u062f\u0641\u0639\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a\u0645 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u062a\u0648\u062c\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f...\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0645\u062e\u0635\u0648\u0635\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc \u062a\u0631\n\u0627\u0631\u0633\u0627\u0644 \u0647\u0645 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", 1]}
{"text": ["\u0627\u06af\u0631 \u0645\u06cc\u0632\u0627\u0646 \u0634\u06a9\u0631 (\u0634\u062f\u062a \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f\u0646) \u062a\u0648\u0644\u06cc\u062f\u0627\u062a \u0622\u0646 \u0642\u0646\u0627\u062f\u06cc \u06a9\u0645\u062a\u0631 \u0634\u0648\u062f \u0628\u0633\u06cc\u0627\u0631 \u0628\u0647\u062a\u0631 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u062a\u0631 \u0648 \u0633\u0627\u0644\u0645 \u062a\u0631 \u062e\u0648\u0627\u0647\u0646\u062f \u0634\u062f. \u0645\u062a\u0634\u06a9\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0633\u0631\u06cc\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0632\u06cc\u0627\u062f\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u0632\u0647 \u0634 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9\u0634 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u060c \u062a\u0642\u0631\u0628\u0627 \u0628\u0647\u0634 \u0645\u06cc \u062e\u0648\u0631\u062f \u0645\u0627\u0644 \u06f3 \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0627\u0634\u0647 \u060c \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0646\u06cc\u0633\u062a \u06cc\u0647 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0648 \u0627\u06cc\u0646 \u0642\u06cc\u0645\u062a \u0628\u0631\u0627\u06cc \u06a9\u06cc\u06a9\u06cc\u0647 \u06a9\u0647 \u062f\u0627\u062e\u0644\u0634 \u062d\u062f\u0627\u0642\u0644 \u06a9\u0645\u06cc \u0646\u0648\u062a\u0644\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0627\u0634\u062f \u0648\u0644\u06cc \u0627\u06cc\u0646 \u0647\u06cc\u0686\u06cc \u0646\u062f\u0627\u0634\u062a \u0641\u0642\u0637 \u06cc\u0647 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0643\u0644\u0627 \u0634\u064a\u0631\u064a\u0646\u064a\u200c\u0647\u0627\u064a \u062e\u0648\u0628\u064a \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u06a9\u0644\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", 1]}
{"text": ["\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0633\u0641\u062a \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc\n\u06a9\u06cc\u06a9 \u0686\u0646\u062f \u063a\u0644\u0647 \u0648 \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0648\u0646\u0647 \u06af\u0631\u0645 \u0628\u0648\u062f\u0646 \u0648 \u0634\u06af\u0641\u062a\u200c\u0627\u0646\u06af\u06cc\u0632\n\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0647\u0645 \u062a\u0627\u0632\u0647 \u0648 \u06a9\u0645 \u0686\u0631\u0628 \u0648 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0648 \u0645\u062a\u0646\u0627\u0633\u0628\n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648 \u0647\u0645 \u0646\u0631\u0645 \u0648 \u0644\u0637\u06cc\u0641 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0646\u0648\u0646 \u062a\u0633\u062a \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0628\u0648 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc \u0648 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062e\u06cc\u0644\u06cc \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 \u062a\u0642\u0631\u06cc\u0628\u0627\u064b \u0686\u0647\u0644 \u062f\u0642\u06cc\u0642\u0647 \u0634\u062f. \u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["Kheyliiii khub o taze o ba keyfiyat bud. Avalesh ba tardid sefaresh dadam vali vaghti resid b dastam vaghean lezzat bordam. \nMerciiiii", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0633\u067e\u0627\u0633\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0634\u06a9", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u062f\u06cc\u0627\u0628\u062a \u0648 \u0686\u0631\u0628\u06cc \u0633\u0648\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0647\u0631 \u062f\u0641\u0639\u0647 \u062d\u062c\u0645\u0634 \u06a9\u0645\u062a\u0631 \u0645\u06cc\u0634\u0648\u062f \u0648 \u06af\u0631\u0627\u0646\u062a\u0631 \u0648 \u0634\u0627\u06cc\u062f \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0647\u0645 \u067e\u0627\u06cc\u06cc\u0646\u062a\u0631 \u0622\u0645\u062f\u0647 \u0686\u0648\u0646 \u0642\u0628\u0644\u0627 \u0628\u0648\u06cc \u0631\u0648\u063a\u0646 \u0686\u0646\u062f\u0628\u0627\u0631 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0646\u0645\u06cc\u062f\u0627\u062f. \u0627\u0644\u0628\u062a\u0647 \u06a9\u0644\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646\u0647\u0627\u06cc \u0627\u06cc\u0646\u062c\u0627 \u062e\u0648\u0628 \u0627\u0633\u062a \u0648 \u0645\u06cc\u0631\u0627\u0634\u06a9\u06cc\u0634 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u06cc\u0646 \u0686\u0646\u062f\u0628\u0627\u0631 \u0622\u062e\u0631 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062d\u062c\u0645 \u0645\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0628\u0647 \u0648\u0634\u0635\u0648\u062d \u067e\u0627\u06cc\u06cc\u0646 \u0622\u0645\u062f\u0647 \u0647\u0631\u0686\u0646\u062f \u0634\u0627\u0647\u062f \u0631\u0634\u062f \u0632\u06cc\u0627\u062f \u0642\u06cc\u0645\u062a \u0628\u0648\u062f\u06cc\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u0642\u062a\u06cc \u0645\u0646 \u062f\u0648 \u062a\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u0645\u0634\u062e\u0635\u0647 \u062f\u0648\u062a\u0627 \u0628\u0633\u062a\u0647 \u0645\u062c\u0632\u0627  \u06a9\u06cc\u06a9 \u0645\u06cc\u062e\u0648\u0627\u0645 \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u06cc\u06a9 \u0628\u0633\u062a\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u0626\u06cc \u0628\u0631\u0627\u06cc \u0645\u0646 \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", -1]}
{"text": ["\u0647\u0645\u0647 \u062e\u0648\u0628 \u0648\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u062a\u0633\u062a \u06a9\u0648\u0686\u06a9 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u0639\u06a9\u0633 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0648\u0646\u0634 \u06a9\u0644\u0641\u062a \u0648 \u0633\u0641\u062a \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u062a\u062e\u0645 \u0622\u0641\u062a\u0627\u0628 \u06af\u0631\u062f\u0627\u0646 \u0628\u0627 \u06a9\u0646\u062c\u062f", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0632\u06cc\u0631\u0647", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0634\u0648\u06cc\u062f", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u062e\u0635\u0648\u0635\u0627 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0627\u0635\u0644\u0627 \u0686\u0631\u0628 \u0646\u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc\u060c \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0639\u0627\u0644\u06cc \u062a\u0631. \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0646 \u0628\u0627 \u0627\u06cc\u0646  \u06a9\u0647 \u0632\u06cc\u0627\u062f \u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0648\u062f \u063a\u0630\u0627 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u06a9\u0645 \u067e\u06cc\u0634 \u0645\u06cc\u0627\u062f \u0646\u0638\u0631 \u0628\u062f\u0645.\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062f\u0627\u063a \u0628\u0648\u062f.\u0648 \u0645\u0632\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0646\u0647", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062f\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u0649\u060c \u062a\u0627\u0632\u0647\u060c \u0628\u0633\u064a\u0627\u0631 \u0644\u0637\u064a\u0641\u060c \u0645\u064a\u062a\u0648\u0646\u0645 \u0628\u06af\u0645 \u0628\u0647\u062a\u0631\u064a\u0646 \u0634\u064a\u0631\u064a\u0646\u0649 \u0641\u0631\u0648\u0634\u0649 \u062a\u0647\u0631\u0627\u0646 \u0647\u0633\u062a\u064a\u0646. \u0647\u0645\u064a\u0634\u0647 \u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627 \u0633\u0631\u0648\u062a\u0647 \u0645\u064a\u0634\u062f\u060c \u0648\u0644\u0649 \u0627\u064a\u0646 \u0633\u0631\u0649 \u0622\u0642\u0627\u0649 \u067e\u064a\u0643 \u0643\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0631\u0633\u0648\u0646\u062f\u0646\u0634\u0648\u0646\u060c \u0627\u0632 \u0627\u064a\u0634\u0648\u0646\u0645 \u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u0648 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646.\u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0647\u0627 \u0639\u0627\u0644\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0645\u0646 \u062a\u0627 \u0628\u0647 \u062d\u0627\u0644 \u0686\u0646\u062f\u064a\u0646 \u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u062f\u0645 \u0627\u0632 \u0634\u0639\u0628 \u0645\u062e\u062a\u0644\u0641 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0628\u0635\u0648\u0631\u062a \u062e\u064a\u0644\u064a \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0648 \u0631\u064a\u062e\u062a\u0647 \u0634\u062f\u0647 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u0628\u0627 \u064a\u0643 \u0634\u0643\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u062a\u062d\u0648\u064a\u0644 \u06af\u0631\u0641\u062a\u0645 \u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u062a\u062f\u0643\u0631 \u062a\u0644\u0641\u0646\u064a \u0647\u0645 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0645\u062c\u062f\u062f \u0627\u0645\u0631\u0648\u0632 \u0628\u0627 \u064a\u0643 \u0634\u0643\u0644 \u0628\u0633\u064a\u0627\u0631 \u0628\u062f \u062a\u062d\u0648\u064a\u0644 \u06af\u0631\u0641\u062a\u0645 \u0643\u0647 \u062f\u064a\u06af\u0647 \u0648\u0627\u0642\u0639\u0627 \u0646\u0645\u064a\u062f\u0648\u0646\u0645 \u0645\u0634\u0643\u0644 \u0627\u0632 \u0627\u0633\u0646\u067e \u0647\u0633\u062a\u0634 \u064a\u0627 \u062e\u0648\u062f\u0650 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u0628\u0627\u0641\u062a \u06a9\u06cc\u06a9 \u0641\u0634\u0631\u062f\u0647 \u0648 \u0633\u0646\u06af\u06cc\u0646 \u0628\u0648\u062f\u060c \u06a9\u0645\u06cc \u0637\u0639\u0645\u0634 \u0628\u0647 \u062a\u0631\u0634\u06cc \u0645\u06cc\u0632\u062f \u0634\u0627\u06cc\u062f \u0642\u0647\u0648\u0647 \u062f\u0627\u062e\u0644 \u062e\u0648\u062f \u06a9\u06cc\u06a9 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\u0647 \u0648 \u0628\u0627\u0639\u062b\u0634 \u0634\u062f\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0641\u0642\u0637 \u0647\u0645\u06cc\u0646 \u0631\u0648 \u0645\u06cc \u062a\u0648\u0646\u0645 \u0628\u06af\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0627\u06cc\u0646 \u0686\u0647 \u0633\u0641\u0627\u0631\u0634 \u0627\u0648\u0631\u062f\u0646\u06cc\u0647!\u0627\u0648\u0644\u0627 \u06a9\u0647 \u062d\u062c\u0645 \u0627\u0635\u0644\u0627 \u0627\u0648\u0646 \u0686\u06cc\u0632\u06cc \u0646\u06cc\u0633\u062a \u06a9\u0647 \u0646\u0634\u0648\u0646 \u062f\u0627\u062f\u06cc\u0646.\u062f\u0648\u0645\u0627 \u062a\u0645\u0627\u0645 \u0645\u06cc\u0646\u06cc \u06a9\u06cc\u06a9\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0631\u0648\u06cc \u0647\u0645 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f.\u0627\u06cc\u0646 \u067e\u0648\u0644\u06cc \u06a9\u0647 \u0645\u06cc\u062f\u06cc\u0645 \u0628\u0631\u0627\u06cc \u062f\u06cc\u0632\u0627\u06cc\u0646\u0647 \u062f\u0631\u0648\u0627\u0642\u0639 \u06a9\u0647 \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc \u0628\u062f \u0628\u0648\u062f \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0648\u0627\u0642\u0639\u0627 \u06a9\u0648\u0686\u06a9\u0647 \u0627\u0632\u0639\u06a9\u0633 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0627\u0635\u0644\u0627 \u0627\u0631\u0632\u0634 \u0646\u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0628\u0631\u06cc\u0648\u0634 \u06af\u0648\u062c\u0647 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0639\u0627\u0644\u06cc! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0643\u0644\u0627\u062a \u062a\u0631\u0627\u0641\u0644", 1]}
{"text": ["\u0627\u0648\u0644\u0627 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0631\u06cc\u0632\u0648 \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f\u060c \u062f\u0631 \u062d\u062f\u06cc \u06a9\u0647 \u0622\u062f\u0645 \u0628\u0627\u0648\u0631\u0634 \u0646\u0645\u06cc\u0634\u0647\n\u062f\u0648\u0645\u0627 \u06a9\u0647 \u0628\u0627\u0631 5 \u0627\u0645 \u0647\u0633\u062a \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0627\u0632 \u0634\u0645\u0627 \u0645\u06cc\u06af\u06cc\u0631\u06cc\u0645 \u0648 \u0686\u067e \u0634\u062f\u0647 \u062a\u0648 \u062c\u0639\u0628\u0647\u060c \u0628\u0647\u062a\u0631 \u0646\u06cc\u0633\u062a \u06cc\u0647 \u0641\u06a9\u0631\u06cc \u0628\u06a9\u0646\u06cc\u062f \u0628\u0631\u0627\u06cc \u0627\u0628\u0646 \u0645\u0648\u0636\u0648\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0637\u0639\u0645 \u0645\u0627\u0646\u062f\u06af\u06cc \u062f\u0627\u0634\u062a \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648 \u0645\u0648\u0627\u062f \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645\u06cc \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u06af\u0648\u062c\u0647 \u0648 \u067e\u0646\u06cc\u0631", -1]}
{"text": ["\u0631\u0648\u0644 \u0686\u0627\u06cc \u0645\u0639\u0631\u06a9\u0647\u060c \u0631\u0648\u0632 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0644\u0647 \u0632\u0631\u062f", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u0646\u0627\u0646 \u0633\u06cc\u0646\u06cc\u062a \u0648 \u0633\u0628\u0648\u0633 \u062e\u0634\u06a9 \u062e\u0634\u06a9 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", -1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u0645\u062e\u0635\u0648\u0635\u0627 \u0634\u06cc\u0631\u0645\u0627\u0644 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a", -1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0632\u0648\u062f\u062a\u0631 \u0627\u0648\u0645\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0631\u0648\u0644\u062a \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0645\u062e\u0644\u0648\u0637 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \n\u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062f\u0631\u062c\u0647 \u064a\u0643 \n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u064a\u0646\u0647\u0645\u0647 \u0645\u0634\u062a\u0631\u064a \u0645\u062f\u0627\u0631\u064a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u0646\u0627\u0646 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627", 1]}
{"text": ["\u0639\u0627\u0644\u06cc. \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0628\u0627 \u0633\u0644\u06cc\u0642\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f. \u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0645\u0627\u0634\u06cc\u0646\u06cc", "\u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u0622\u0633\u062a\u0627\u0646\u0647 250 \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0632\u062d\u0645\u062a\u062a\u0627\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u06a9\u0646\u062c\u062f\u06cc", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", 1]}
{"text": ["\u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0645\u062e\u0644\u0648\u0637 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0633\u062a \u0641\u0642\u0637 \u0627\u06cc \u06a9\u0627\u0634 \u0634\u0647\u062f \u0631\u0648\u06cc \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0645\u062a\u0631 \u0628\u0648\u062f \u06a9\u0647 \u062f\u0644\u0648 \u0646\u0632\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0646\u0631\u0645 \u0628\u0648\u062f. \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f. \u06a9\u0631\u0648\u0633\u0627\u0646 \u06a9\u0645\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0633\u0628\u0648\u0633\u062f\u0627\u0631", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a", "\u0644\u0627\u062a\u0647", -1]}
{"text": ["\u0627\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u06cc\u062f \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u0628\u0648\u062f. \u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a \u0628\u0648\u062f. \u067e\u0646\u06cc\u0631\u06cc \u062a\u0648\u0634 \u0646\u062f\u06cc\u062f\u06cc\u0645.\n\u062d\u062c\u0645 \u06a9\u06cc\u06a9\u0647\u0627 \u0647\u0645 \u0648\u0627\u0642\u0639\u0627 \u06a9\u0645 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u062f \u0622\u0644\u0648", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645\n\u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0628\u0645\u0648\u0642\u0639 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0631\u062c\u06cc\u062d \u0645\u06cc\u062f\u0627\u062f\u0645 \u062a\u0646\u0648\u0639 \u0647\u0645 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u06a9\u0648\u0686\u06a9 \u0645\u06cc\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", -1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0627\u0646 \u06a9\u0634\u0645\u0634\u06cc \u06a9\u0647 \u062d\u0636\u0648\u0631\u0627 \u0645\u06cc\u06af\u06cc\u0631\u0645 \u062e\u06cc\u0644\u06cc \u0631\u06cc\u0632 \u0648 \u06cc\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0648 \u0628\u0631\u0634\u062a\u0647 \u0627\u0646 \u0648 \u062a\u0648 \u062c\u0639\u0628\u0647  \u062e\u06cc\u0644\u06cc \u0645\u0646\u0638\u0645 \u0686\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0647\u0633\u062a\u0646\u062f \u0627\u0645\u0627 \u0627\u06cc\u0646\u0627\u06cc\u06cc \u06a9\u0647 \u0627\u0645\u0631\u0648\u0632 \u0628\u0631\u0627\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u0646 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0646\u062f\u0627\u0632\u0647 \u0647\u0627\u0634\u0648\u0646 \u062f\u0631\u0634\u062a \u062a\u0631 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0634\u06a9\u0633\u062a\u0647 \u062f\u0627\u0634\u062a \u0648 \u062e\u06cc\u0644\u06cc \u0646\u0627\u0645\u0631\u062a\u0628 \u062a\u0648 \u062c\u0639\u0628\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f  :-(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645\u0645 \u0645\u0632\u0634 \u062f\u0644 \u0646\u0645\u06cc\u0632\u062f \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc", "\u0646\u0627\u0646 \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0644\u0637\u0641\u0627\u064b \u062c\u0648\u0631\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0646\u0631\u06cc\u0632\u062f \u0648 \u0627\u06cc\u0646 \u06a9\u0647 \u0634\u06a9\u0644\u0627\u062a \u06cc\u0627 \u0634\u06a9\u0631 \u06a9\u0646\u0627\u0631 \u0644\u0627\u062a\u0647 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0627\u062a\u0647", -1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062c\u0627\u06cc \u062f\u0648 \u062a\u0627 \u06cc\u06a9\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0628\u0632\u0631\u06af \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc", -1]}
{"text": [" \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645\u06af\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u060c \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0634\u0634\u0635\u062f \u06af\u0631\u0645", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645\u062f\u0627\u0631 \u0634\u0634\u0635\u062f \u06af\u0631\u0645", "\u0628\u06cc\u0633\u06a9\u0648\u0626\u06cc\u062a \u0634\u0647\u062f \u0627\u0646\u06af\u0648\u0631", 1]}
{"text": ["\u0628\u06cc \u0646\u0638\u06cc\u0631\u0647 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0627\u06cc\u0646\u062c\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0628\u062f \u0628\u0648\u062f. \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u06a9\u06a9 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648", "\u062a\u0627\u0631\u062a \u06a9\u0648\u0686\u06a9 \u0645\u06cc\u0648\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", -1]}
{"text": ["\u0639\u0627\u0644\u06cc . \u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062e\u0648\u0631\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0627\u0645\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0628\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u0645\u062a\u0646\u0648\u0639 \u0648 \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f \u0641\u0642\u0637 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u0631\u0648\u0644\u062a \u067e\u0647\u0646 \u0648 \u0644\u0637\u0641\u06cc\u0647 \u0628\u0648\u062f \u0628\u0647 \u0645\u0642\u062f\u0627\u0631 \u0632\u06cc\u0627\u062f. \u06cc\u0639\u0646\u06cc \u0641\u0642\u0637 \u062e\u0627\u0645\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0644\u0627 \u0633\u0647 \u0645\u062f\u0644 \u0633\u0627\u062f\u0647 \u0648 \u0628\u06cc\u062e\u0648\u062f. \u062a\u0627\u0632\u0647 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0645\u0646 \u0647\u0645 \u062a\u0648\u062c\u0647 \u0627\u06cc \u0646\u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0648 \u0635\u062f \u06af\u0631\u0645", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0648\u06cc\u0698\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", 1]}
{"text": ["\u0642\u0647\u0648\u0647 \u062a\u0631\u06a9 \u0646\u0635\u0641\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u06cc\u062f. \u06a9\u0647 \u062d\u062a\u0645\u0627 \u0646\u0635\u0641\u0634 \u062f\u0631 \u0631\u0627\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0648 \u0635\u062f \u06af\u0631\u0645", "\u0644\u0627\u062a\u0647", "\u0642\u0647\u0648\u0647 \u062a\u0631\u06a9", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0646\u0648\u0646 \u0627\u0641\u0637\u0627\u0631\u06cc \u0645\u063a\u0632\u062f\u0627\u0631 \u0647\u0631 \u0639\u062f\u062f", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062d\u0627\u0644\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0642\u0627\u0644\u0628\u06cc \u062f\u0627\u0634\u062a \u0648 \u0628\u0631\u062e\u0644\u0627\u0641 \u062a\u0635\u0648\u06cc\u0631 \u0628\u0647 \u0635\u0648\u0631\u062a \u0644\u06cc\u0648\u0627\u0646\u06cc \u0646\u0628\u0648\u062f.\n\u0645\u0648\u0633 \u0627\u0646\u0628\u0647 \u0647\u0645 \u0645\u0632\u0647 \u062c\u0627\u0644\u0628\u06cc \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (6 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u0627\u0646\u0628\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (6 \u0639\u062f\u062f)", "\u0645\u0648\u0633 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (8 \u0639\u062f\u062f)", -1]}
{"text": ["\u064a\u0643 \u0646\u0648\u0639 \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627 \u064a\u062e \u0632\u062f\u0647 \u0628\u0648\u062f.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (8 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u067e\u0627\u067e\u06cc\u0648\u0646\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (15 \u0639\u062f\u062f)", -1]}
{"text": ["\u0627\u0632 \u0631\u0627\u0647\u0646\u0645\u0627\u06cc\u06cc \u06a9\u0627\u0631\u0634\u0646\u0627\u0633\u0627\u0646 \u06a9\u0645\u0627\u0644 \u0631\u0636\u0627\u06cc\u062a \u062f\u0627\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0646\u06cc\u0644\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (12 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc\u060c\u0628\u0631\u062e\u0648\u0631\u062f \u0627\u0633\u0646\u067e \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0648 \u0645\u062d\u062a\u0631\u0645\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0639\u062f\u062f", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u06cc\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u0648\u0648\u0648\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f. \u06a9\u06cc\u06a9 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u06a9\u0646\u06a9 \u0647\u0644\u06cc\u0648\u0645\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0639\u062f\u062f", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u06a9 \u0646\u0641\u0631\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0646 \u062e\u0648\u0627\u0633\u062a\u0647 \u0628\u0648\u062f\u0645  \u062f\u0631 \u0635\u0648\u0631\u062a \u0627\u0645\u06a9\u0627\u0646 \u0628\u0647 \u062c\u0627\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0631\u0648\u0644\u062a \u06f3\u0631\u0627\u0631 \u062f\u0627\u062f\u0647 \u0628\u0634\u0647. \u0627\u0645\u0627 \u0644\u0637\u06cc\u0641\u0647 \u0628\u0648\u062f \u0648 \u06cc\u06a9 \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06cc\u0648\u0647 \u0642\u0631\u0645\u0632 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062c\u0644\u0648\u0647 \u062f\u0627\u0634\u062a \u062d\u0630\u0641 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0628\u0627 \u062a\u0634\u06a9\u0631.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": [" \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0646\u0642\u062f\u0631 \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0643\u0647 \u0628\u0627 \u0645\u0648\u0646\u062f\u0646 \u0664\u0631\u0648\u0632 \u062a\u0648\u064a \u064a\u062e\u0686\u0627\u0644 \u0628\u0627\u0632\u0645 \u062a\u0627\u0632\u0647 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062e\u0634\u0643 \u0648 \u062e\u0631\u0627\u0628 \u0646\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0627\u06cc\u0646 \u0645\u06cc\u06a9\u060c \u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a \u0646\u0628\u0648\u062f! \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0627 \u0686\u0646\u062f\u062a\u0627 \u06af\u06cc\u0644\u0627\u0633 \u0631\u0648\u0634 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u062a\u0632\u0626\u0626\u06cc\u0646 \u0628\u0648\u062f!!!! \u06a9\u06cc\u0641\u06cc\u062a \u0628\u062f \u0646\u0628\u0648\u062f \u0627\u0645\u0627 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u0647 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a!!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0644\u0637\u06cc\u0641\u0647 \u0647\u0627 \u06a9\u0645\u06cc \u0633\u0641\u062a \u0628\u0648\u062f\u0646\u062f. \u0628\u0631\u062e\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u0648\u0644\u06cc \u0628\u0631\u062e\u06cc \u062f\u06cc\u06af\u0631 \u06a9\u0645\u062a\u0631. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0627\u0632 \u0646\u0638\u0631 \u0638\u0627\u0647\u0631 \u0633\u0627\u0644\u0645 \u0628\u0648\u062f. \u062a\u062d\u0648\u06cc\u0644 \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f. \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633", 1]}
{"text": ["\u0627\u0646\u06af\u0627\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0631 \u0686\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0646\u062f\u0647 \u062a\u0647 \u06cc\u062e\u0686\u0627\u0644 \u0631\u0627 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", "\u0645\u0648\u0633 \u0645\u0648\u0631\u0644 \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0645\u0627\u0641\u06cc\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u0627\u0641\u06cc\u0646", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", -1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0633\u0641\u062a \u0648 \u0646\u0627\u0645\u0637\u0644\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc\u0634 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0628\u062f\u0648\u0646 \u0627\u0633\u062a\u062b\u0646\u0627 \u0647\u0645\u0647 \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0628\u0648\u062f\u0646 \u062d\u062f\u0627\u0642\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u0627 \u0645\u062a\u0641\u0627\u0648\u062a \u0645\u06cc\u0632\u0627\u0634\u062a\u0646 \u0627\u0632 \u06cc\u0647 \u0646\u0648\u0639\u06cc\u0634 \u06a9\u0647 \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u062d\u062f\u0627\u0642\u0644 \u0633\u0647 \u0639\u062f\u062f \u0641\u0642\u0637 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646. \u062d\u062f\u0627\u0642\u0644 \u062a\u0646\u0648\u0639 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u06cc\u0647 \u0633\u0631\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u0647 \u0633\u0631\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0646\u0647 \u0647\u0645\u0647 \u06a9\u0631\u0645 \u062f\u0627\u0631!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0645\u062b\u0644\u0647 \u06cc\u0647 \u06a9\u06cc\u06a9 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u067e\u0646\u06cc\u0631 \u0646\u062f\u0627\u0634\u062a\u060c \u062a\u0648 \u0635\u0641\u062d\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u0648\u0634\u062a\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0637\u0639\u0645 \u062f\u0627\u0631 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0648 \u0634\u06a9\u0644\u0627\u062a \u0647\u0633\u062a\u060c \u062d\u062a\u06cc \u0628\u06cc\u0633 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 \u0647\u0645 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0648\u062f\u060c \u0645\u0646 \u0627\u06af\u0631 \u0637\u0639\u0645\u062f\u0627\u0631 \u0645\u06cc \u062e\u0648\u0627\u0633\u062a\u0645 \u06a9\u0647 \u0633\u0627\u062f\u0647 \u0633\u0641\u0627\u0631\u0634 \u0646\u0645\u06cc \u062f\u0627\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9", -1]}
{"text": ["\u0641\u0642\u0637 \u06a9\u0627\u0634 \u0645\u0648\u0632 \u0646\u0630\u0627\u0631 \u0644\u0627\u06cc\u0647 \u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0645\u06cc\u0634\u0647 \u0644\u06cc\u0632 \u0648 \u0628\u062f \u0645\u0632\u0647 \u0645\u06cc\u0634\u0647 \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f \u0647\u0645\u0647 \u0686\u06cc\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0646\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0628\u06cc\u0633\u06a9\u0648\u0686\u0627\u06a9\u0644\u062a (2)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0639\u0645\u0648\u0644\u06cc \u0648 \u0633\u0627\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0645\u062e\u0635\u0648\u0635\u0627 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u062f\u0627\u0634\u062a\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u0645\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u060c \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u062d\u062a\u0645\u0627 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0646\u06cc\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0627 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0647\u0631 \u0631\u0648\u0632 \u0627 \u0647\u0645\u06a9\u0627\u0631\u0627\u0646 \u0627\u0632 \u0646\u0627\u0646 \u062c\u0645 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u06cc\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u0647\u060c \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0648\u0646 \u0628\u0631\u0628\u0631\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628 \u06f1\u0646\u0648\u0646 \u0628\u0627\u06af\u062a \u0628\u06cc\u0634\u062a\u0631 \u0634\u0628\u06cc\u0647 \u0628\u0648\u062f \u062a\u0627 \u0628\u0631\u0628\u0631\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647\n\u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u064a\n\u0635\u0628\u062d\u0627\u0646\u0647 \u064a \u0631\u0648\u0632 \u062c\u0645\u0639\u0647 \u0645\u0648\u0646 \u0628\u0627 \u0627\u064a\u0646 \u0646\u0648\u0646\u0647\u0627 \u0639\u0627\u0644\u064a \u0634\u062f\n\u062f\u0633\u062a\u062a\u0648\u0646 \u062f\u0631\u062f \u0646\u0643\u0646\u0647\n\u0643\u0633\u0628 \u0648 \u0643\u0627\u0631\u062a\u0648\u0646 \u067e\u0631 \u0628\u0631\u0643\u062a \u0648 \u067e\u0631 \u0631\u0648\u0632\u064a \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u06af\u0647 \u06cc\u06a9\u0645 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u062a\u0631 \u0628\u0648\u062f \u0628\u0647\u062a\u0631 \u0628\u0648\u062f. \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0645\u0646 \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc\u0645.\n\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0647\u0645 \u0639\u0627\u0644\u06cc.\u0647\u0645 \u0631\u0641\u062a\u0627\u0631 \u0647\u0645 \u0633\u0631\u0639\u062a\u0634\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["Khyli taze o khoshmze bood mrci", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0631\u0628\u0627\u06cc\u06cc \u06af\u0631\u0641\u062a\u0645 (\u0622\u0644\u0645\u0627\u0646\u06cc) \u0648\u0627\u0642\u0639\u0627 \u0628\u062f \u0628\u0648\u062f\u060c \u062e\u06cc\u0644\u06cc \u0642\u062f\u06cc\u0645\u06cc \u0628\u0648\u062f\u0646 \u0648 \u062a\u0644\u062e \u0634\u062f\u0646\u060c \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f. \u062f\u06cc\u06af\u0647 \u0627\u0632 \u0627\u06cc\u0646\u062c\u0627 \u062e\u0631\u06cc\u062f \u0646\u0645\u06cc\u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0627\u0635\u0644\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0628\u0648\u062f \u0646\u0647 \u0637\u0639\u0645 \u0646\u0647 \u0639\u0637\u0631 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a.\u0646\u0627\u0646\u0647\u0627 \u062a\u0642\u0631\u06cc\u0628\u0627\u0647 \u0647\u0645\u0647 \u06cc\u0647 \u0645\u0632\u0647 \u062f\u0627\u0631\u0646 \u0641\u0642\u0637\u0634\u06a9\u0644\u0634\u0648\u0646 \u0641\u0631\u0642 \u062f\u0627\u0631\u0647 \u0648 \u067e\u0648\u0631\u067e\u0648\u0631 \u0628\u0647 \u0646\u0637\u0631 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0648 \u0641\u06a9\u0631 \u0645\u06a9\u0631\u062f\u0645 \u0637\u0639\u0645 \u062a\u0631\u0634 \u0646\u0648\u0646\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0628\u0627\u062e\u0645\u06cc\u0631 \u062a\u0631\u0634 \u062a\u0647\u06cc\u0647 \u0645\u06cc\u0634\u0647\u0631\u0648 \u0647\u0645 \u062f\u0627\u0631\u0647 \u06a9\u0647 \u0646\u062f\u0627\u0634\u062a \u0648\u0639\u06cc\u0646 \u0646\u0627\u0646 \u0647\u0627\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f.\u0646\u0627\u0646 \u062c\u0648 \u0631\u0648\u06af\u0646 \u0641\u0642\u0637 \u0637\u0639\u0645\u0634 \u0641\u0631\u0642 \u062f\u0627\u0631\u0647 \u06a9\u0647 \u0628\u0647 \u062f\u0631\u062f \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0647\u0627\u06cc \u06cc\u0647 \u0646\u0641\u0631\u0647 \u0646\u0645\u06cc\u062e\u0648\u0631\u0647 \u062f\u0631\u0632\u0645\u0627\u0646 \u0628\u0631\u0634  \u0634\u06a9\u0644\u0634 \u0631\u0648 \u0627\u0632\u062f\u0633\u062a \u0645\u06cc\u062f\u0647 \u0648\u0644\u06cc \u0637\u0639\u0645\u0634\u0648 \u062f\u0648\u0633\u062a \u062f\u0627\u0631\u0645.\u06a9\u0644\u0627 \u0627\u0632\u0646\u0637\u0631 \u0637\u0627\u0647\u0631\u06cc \u0646\u0648\u0646\u0647\u0627 \u0647\u0645\u0647 \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644 \u0647\u0633\u062a\u0646 \u0648\u0644\u06cc \u0637\u0639\u0645 \u0642\u0627\u0628\u0644 \u0628\u0647\u062a\u0631 \u0634\u062f\u0646 \u0647\u0633\u062a.\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0634\u0648\u0646 \u06a9\u0644\u0627 \u062a\u0648\u062a\u0645\u0627\u0645 \u0633\u0641\u0627\u0631\u0634\u0647\u0627 \u062e\u06cc\u0644\u06cc \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u062e\u0635\u0648\u0635 \u067e\u0648\u0631\u067e\u0648\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u0628\u0627 \u0634\u0647\u062f \u0627\u0646\u06af\u0648\u0631 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0648\u200c\u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648\u200c\u0628\u0648\u06cc \u0646\u0627 \u0645\u06cc\u062f\u0627\u062f\n\u0628\u0647 \u0647\u06cc\u0686\u200c\u0639\u0646\u0648\u0627\u0646 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u0628\u0627 \u0634\u0647\u062f \u0627\u0646\u06af\u0648\u0631", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f \n\u0646\u0627\u0646 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0633\u0628\u062a \u0628\u0647 \u06af\u0630\u0634\u062a\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0646\u0627\u0646 \u062c\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u0628\u0627\u06a9\u06cc\u0641\u06cc\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u0646\u062a\u06cc \u0627\u0633\u06a9\u0648 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0645\u0646 \u0633\u0631 \u0648 \u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062f\u0641\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0641\u0631\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0631\u0627\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0627\n\u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 \u0647\u0631 \u0628\u0627\u0631 \u06a9\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f\n\u0644\u0637\u0641\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062a\u0648\u0646\u0648 \u0639\u0648\u0636 \u06a9\u0646\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u0642\u062f\u0627\u0631 \u0633\u06cc\u0628 \u062f\u0627\u062e\u0644 \u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0637\u0639\u0645 \u0645\u0627\u0646\u062f\u06af\u06cc \u062f\u0627\u0634\u062a\n\u0627\u0645\u0627 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u060c \u0641\u0642\u0637 \u0628\u0639\u0644\u062a \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 1", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u06a9\u0627\u0634 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0628\u0634\u0647 \u062a\u0648\u0644\u062f\u062a \u0645\u0628\u0627\u0631\u06a9 \u0647\u0645 \u0646\u0648\u0634\u062a.\u0645\u0646 \u0648\u0627\u0633\u0647 \u062a\u0648\u0644\u062f \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0648\u0644\u06cc \u06af\u0641\u062a\u0646 \u0686\u0648\u0646 \u0622\u0645\u0627\u062f\u0633\u062a \u0646\u0645\u06cc\u0634\u0647 \u0631\u0648\u0634 \u0646\u0648\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0646\u0647", "\u0634\u0645\u0639 \u062f\u0648", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u0628\u0647\u062a\u0631\u06cc\u0646 \u067e\u0648\u062f\u06cc\u0646\u06af\u0627\u06cc\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062e\u0648\u0631\u062f\u0645 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627\u062a\u0648\u0646 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0633\u0633\u0633\u0633 \n\u0645\u0632\u0647 \u0628\u0647\u0634\u062a \u0645\u06cc\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0643\u064a\u0643 \u062e\u064a\u0644\u064a \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u0636\u0645\u0646 \u062d\u0645\u0644 \u0643\u0645\u064a \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0641\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["4-5 ta shirinihash chap sbode bod to jabe ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u062a\u06a9\u0648\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0628\u0648\u062f\u060c \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u06af\u0630\u0627\u0634\u062a\u0646 \u062c\u0639\u0628\u0647 \u062a\u0648\u06cc \u0628\u06af \u0647\u0645 \u062f\u0627\u0634\u062a\u0645 \u06a9\u0647 \u062a\u0648\u062c\u0647\u06cc \u0646\u06a9\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u0627\u06cc\u0646 \u0645\u0646\u0637\u0642\u0647 \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0645\u062e\u0644\u0648\u0637 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0632 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u062a\u0639\u062f\u0627\u062f \u0642\u0627\u0628\u0644 \u062a\u0648\u062c\u0647\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u062f\u0648\u0645\u06cc\u0646 \u0628\u0627\u0631\u06cc \u0647\u0633\u062a \u06a9\u0647 \u0627\u0632 \u0646\u0627\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u060c \u0647\u0645\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u060c \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f.\n\u0627\u0632 \u062e\u062f\u0645\u0627\u062a \u062e\u0648\u0628 \u0627\u0633\u0646\u067e \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a\u0632\u0647\u0627 \u0639\u0627\u0644\u064a\u060c \u0645\u062e\u0635\u0648\u0635\u0627 \u0633\u064a\u0645\u064a\u062a \u0637\u0639\u0645 \u062e\u0648\u0646\u06af\u064a \u0645\u064a\u062f\u0627\u062f\u060c \u0634\u064a\u0631\u064a\u0646\u064a \u0644\u0646\u062f\u0648 \u0628\u0627 \u0648\u062c\u0648\u062f\u064a\u0643\u0647 \u0645\u0646 \u0627\u0647\u0644 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u064a\u0633\u062a\u0645\u060c \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u06cc\u06a9\u0646", 1]}
{"text": ["\u0627\u0632 \u0648\u0642\u062a\u06cc \u062c\u0639\u0628\u0647 \u0634\u0631\u06cc\u0646\u06cc \u0631\u0648 \u062a\u0648 \u0646\u0627\u06cc\u0644\u06a9\u0633 \u0646\u0645\u06cc\u0632\u0627\u0631\u0646\u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u0634\u0646.\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0633\u0631 \u0645\u0648\u0642\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0646\u0627\u0646 \u062c\u0648 80%", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u067e\u0646\u062c \u0633\u062a\u0627\u0631\u0647 \u06a9\u0645\u0647.. \u0633\u062a\u0627\u0631\u0647 \u0647\u0627\u06cc \u0628\u06cc\u0634\u062a\u0631\u06cc\u200c\u0646\u062f\u0627\u0631\u06cc\u062f  \u0628\u0647\u0634 \u0628\u062f\u0645\u061f \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u062f\u0627\u0631\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0628\u0631\u0627\u06cc \u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0632 \u0634\u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0627\u0648\u0646\u0645 \u0627\u0632 \u0646\u0648\u0639 \u0627\u0633\u0646\u067e\u06cc \u06af\u0631\u0641\u062a\u0645 \u0648. \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \n\n\u0645\u062a\u0634\u06a9\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0645\u062e\u0644\u0648\u0637 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0647 \u0645\u062f\u06cc\u0631\u06cc\u062a \u062a\u0648\u0646 \u062a\u0628\u0631\u06cc\u06a9 \u0645\u06cc\u06af\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", 1]}
{"text": ["\u0645\u0646 \u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0646\u062e\u0648\u0627\u0633\u062a\u0647 \u0628\u0648\u062f\u0645\u060c \u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u062e\u0648\u0627\u0633\u062a\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f \u0633\u0641\u062a \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u062e\u06cc\u0644\u06cc \u0648\u0642\u062a\u0647 \u0645\u0648\u0646\u062f\u0647 \u0648\u0644\u06cc \u0628\u0631\u0627\u0646\u0686\u06cc \u0642\u0627\u0631\u0686 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0634\u0648\u06cc\u062f", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0633\u06cc\u0631 \u0648 \u06a9\u0631\u0647", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0642\u0627\u0631\u0686", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0631\u0628\u062a \u0628\u0647 \u0644\u06cc\u0645\u0648 \u0648 \u062e\u0627\u06a9\u0634\u06cc\u0631", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0648\u06a9\u0648 \u0633\u0628\u0632\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u0648\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0686\u0627\u0648\u062f\u0627\u0631 \u06a9\u0648\u0686\u06a9", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062c\u0648", "\u0633\u0645\u0628\u0648\u0633\u0647 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0641\u0648\u0642\u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 ... \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0628\u0645\u0648\u0646\u06cc\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u0627\u0631 \u0631\u0648 \u062e\u0631\u0627\u0628 \u0646\u06a9\u0646\u06cc\u062f \u0645\u062b\u0644 \u0628\u0642\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0642\u0647\u0648\u0647 \u062a\u0631\u06a9 \u0646\u0635\u0641\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u06cc\u062f. \u06a9\u0647 \u062d\u062a\u0645\u0627 \u0646\u0635\u0641\u0634 \u062f\u0631 \u0631\u0627\u0647 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0648 \u0635\u062f \u06af\u0631\u0645", "\u0644\u0627\u062a\u0647", "\u0642\u0647\u0648\u0647 \u062a\u0631\u06a9", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\n\u0648\u0644\u06cc \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u0639\u0645\u0648\u0644\u0627 \u06cc\u0647 \u0644\u0627\u06cc\u0647 \u0622\u0644\u0628\u0627\u0644\u0648 \u0632\u06cc\u0631 \u062f\u0627\u0631\u0647 \u0646\u0647 \u0622\u0644\u0628\u0627\u0644\u0648 \u0647\u0627\u06cc \u062a\u06a9 \u062a\u06a9. \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0622\u0644\u0628\u0627\u0644\u0648 \u062f\u0631 \u0627\u0634\u06a9\u0627\u0644 \u0645\u062e\u062a\u0644\u0641 \u0634\u0645\u0631\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u067e\u0627\u06cc \u0628\u0647 \u062d\u0633\u0627\u0628 \u0646\u0645\u06cc\u0627\u062f. \u0644\u0637\u0641\u0627 \u0639\u06a9\u0633 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062e\u0648\u062f \u0631\u0627 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u062a\u0627 \u0645\u0627 \u0628\u0627 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", 1]}
{"text": ["\u0628\u06cc \u0646\u0638\u06cc\u0631\u060c \u0628\u0631\u0627\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0634\u0645\u0627 \u0628\u0627\u0632 \u0647\u0645 \u06a9\u0645\u0647\n\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0644\u0630\u06cc\u0630.\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0627\u06cc\u062a\u0627\u0644\u06cc\u0627\u06cc\u06cc", "\u0646\u0627\u0646 \u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", "\u062f\u0646\u06cc\u0634 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0634\u0634\u0635\u062f \u06af\u0631\u0645", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0633\u0631\u06cc \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0644\u06a9 \u0634\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0648 \u0635\u062f \u06af\u0631\u0645", 1]}
{"text": ["\u0645\u062d\u0634\u0631 \u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0633 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0637\u0639\u0645  \u0645\u0627\u0631\u06cc\n\u0645\u0634\u062a\u0631\u06cc \u062f\u0627\u0626\u0645\u06cc \u0645 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u0631\u0627\u0636\u06cc\n\u0645\u0631\u0633\u06cc \u0641\u0642\u0637 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062a\u0648\u0646 \u0645\u06cc\u062a\u0648\u0646\u0647 \u0628\u0647\u062a\u0631 \u0647\u0645 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062a\u0646\u0648\u0631\u06cc", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0628\u0632\u0631\u06af \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u062f \u0622\u0644\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u0647\u0627\u06cc \u0627\u0633\u0646\u067e \u0628\u06af\u06cc\u062f \u0642\u0628\u0644 \u0627\u0632 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646 \u0646\u0632\u0646\u0646 \u0633\u0641\u0627\u0631\u0634 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f. \u0686\u0646\u062f \u062f\u0642\u06cc\u0642\u0647 \u0642\u0628\u0644 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u067e\u06cc\u06a9 \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u067e\u06cc\u0627\u0645\u06a9 \u062a\u062d\u0648\u06cc\u0644 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0648 \u0635\u062f \u06af\u0631\u0645", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062c\u062f\u06cc\u062f \u0627\u0633\u0646\u067e \u0628\u0648\u062f. \u0648\u0627\u0633\u0647 \u0622\u0634\u0646\u0627\u06cc\u06cc \u0648 \u062a\u0633\u062a, \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645. \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0627\u0644\u0628\u062a\u0647 \u0645\u0646 \u0628\u0647 \u0634\u062e\u0635\u0647 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0631\u0645. \u0628\u0627\u0628 \u0634\u062f\u0647 \u062a\u0648 \u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0645\u06cc\u0631\u06cc\u0632\u0646. \u0645\u06cc\u062f\u0648\u0646\u0645 \u0633\u0644\u06cc\u0642\u0647 \u0627\u06cc\u0647. \u0648\u0644\u06cc \u062e\u0648\u0627\u0647\u0634\u0627 \u0627\u0642\u0644\u0627 \u0646\u0635\u0641 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0631\u0648 \u0628\u062f\u0648\u0646 \u067e\u0648\u062f\u0631 \u0642\u0647\u0648\u0647 \u06cc\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648 \u062f\u0631\u0633\u062a \u06a9\u0646\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u06a9\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc \u0628\u0648\u062f \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645\n\u0647\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647\u0647\u0647\u0647\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0634\u0634\u0635\u062f \u06af\u0631\u0645", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645\u062f\u0627\u0631 \u0634\u0634\u0635\u062f \u06af\u0631\u0645", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646 \u0633\u0647 \u06af\u0648\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (25 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u0627\u0646\u0628\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (12 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u0631\u0627\u062d\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (7 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (8 \u0639\u062f\u062f)", "\u0644\u0637\u06cc\u0641\u0647 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0641\u0631\u0627\u0648\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062f\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (15 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0648 \u062a\u0632\u0626\u06cc\u0646\u0627\u062a \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0634\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 \u0639\u062f\u062f", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0641\u0642\u0637 \u06cc\u06a9 \u0627\u06cc\u0631\u0627\u062f\u06cc \u06a9\u0647 \u062f\u0627\u0634\u062a \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647\u200c\u0645\u0646 \u06f2 \u06a9\u06cc\u0644\u0648 \u062f\u0631 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645\u200c\u06a9\u0647 \u0641\u0631\u0648\u0634\u0646\u062f \u062f\u0631 \u062f\u0648 \u062c\u0639\u0628\u0647 \u06f1 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0627\u0648\u0631\u062f\u0646......\u062f\u0631 \u0645\u0646\u0648 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646\u200c\u0645\u0646\u0638\u0648\u0631 \u067e\u06cc\u0634 \u0628\u06cc\u0646\u06cc \u0646\u0634\u062f\u0647 ...\u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0633\u0628\u0627\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (18 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633\u0634 \u0628\u0627\u0634\u0647\u060c \u0648\u0644\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0645\u0639 \u0639\u062f\u062f", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 \u0648\u0627\u0646\u06cc\u0644\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u0628\u062f \u06af\u0644", 1]}
{"text": ["\u0633\u067e\u0627\u0633 \u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u0645\u06cc\u06a9\u0646\u0646\n\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u0628\u0627\u0641\u062a\u06cc \u0646\u0631\u0645\n\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0647\u0645 \u062a\u0627\u0632\u0647 \u0648 \u0646\u0631\u0645 \u0648 \u0644\u0637\u06cc\u0641\n\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0648 \u0645\u062b\u0644 \u06af\u0630\u0634\u062a\u0647 \u062d\u0641\u0638 \u06a9\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0648 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0648\u06cc \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f \u0648 \u0628\u0642\u06cc\u0647 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 \u0627\u0646\u0634\u0627\u0644\u0644\u0647 \u062f\u0641\u0639\u0627\u062a \u0628\u0639\u062f\u06cc \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0644\u0627\u06cc\u06cc \u0628\u0631\u062e\u0648\u0631\u062f\u0627\u0631 \u0628\u0627\u0634\u0647 . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u062e\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u0644\u06cc \u06a9\u06cc\u06a9 \u062e\u0648\u0634\u06af\u0644 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u06cc \u0628\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u062f \u0645\u0646\u0645 \u062a\u062e\u0641\u06cc\u0641 \u062f\u0627\u0634\u062a\u0645 \u0628\u0631\u0627\u0645 \u0642\u06cc\u0645\u062a\u0634 \u0634\u062f 34 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0646 \u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0634\u062f.\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0646\u062f\u06cc", 1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0648 \u0644\u0637\u06cc\u0641\u0634 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u06cc\u06a9\u0645 \u0631\u062f\u0648\u0644\u0648\u062a\u0634 \u0645\u06cc\u062a\u0648\u0646\u0633\u062a \u0628\u0647\u062a\u0631 \u0628\u0627\u0634\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0646\u0628\u0648\u062f\u060c \u0627\u0644\u0628\u062a\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0627\u0633\u0641\u0646\u062c \u06a9\u06cc\u06a9 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648\u0645\u06cc\u0632\u0627\u0646 \u0628\u0633\u062a\u0646\u06cc \u062f\u0627\u062e\u0644 \u0627\u0646 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0633\u062a\u0646\u06cc (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u062f\u062a \u0632\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f\u0646 \u06a9\u0645\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0634\u064a\u0631\u064a\u0646\u064a\u0634\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u0645\u0646\u0627\u0633\u0628 \u0646\u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u0645\u0627\u062c (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u06cc\u0646 \u0627\u0645\u0631\u0648\u0632 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0635\u0628\u062d \u0632\u0648\u062f \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645 \u0646\u0627\u0646 \u0647\u0627 \u0628\u0634\u062f\u062a \u0628\u06cc\u0627\u062a \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u06cc\u0647\u0648 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0634\u062f\u0647 \u0648 \u062d\u06cc\u0641 \u06a9\u0647 \u062f\u06cc\u06af\u0647 \u0635\u0631\u0641 \u0646\u0645\u06cc\u06a9\u0646\u0647 \u0627\u0632\u062a\u0648\u0646 \u062e\u0631\u06cc\u062f \u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc\u0647 \u0647\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0647\u0645\u0686\u0646\u06cc\u0646 \u067e\u0631 \u0627\u0632 \u06a9\u0634\u0645\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc \u0648 \u06a9\u0631\u0627\u0633\u0627\u0646\u0634 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f\u0646\u060c \u0628\u0647 \u062e\u0627\u0637\u0631 \u0631\u0648\u063a\u0646 \u0645\u0648\u0646\u062f\u0647 \u0627\u06cc \u06a9\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\n\u0646\u0648\u0646 \u0634\u06cc\u0631\u0645\u0627\u0644 \u0647\u0645 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0627\u0635\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u06cc\u06a9\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0627\u0635\u0641\u0647\u0627\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0644\u0627\u0645\u060c \u0643\u064a\u0641\u064a\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0639\u0627\u0644\u0649 \u0647\u0633\u062a\u060c \u0641\u0642\u0637 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0643\u064a\u0643 \u0647\u0627 \u0646\u0647 \u0633\u0644\u0641\u0648\u0646 \u062f\u0627\u0634\u062a \u0646\u0647 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u0649 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0648\u0627\u0633\u0647 \u0647\u0645\u064a\u0646 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0643\u064a\u0641\u064a\u062a \u0639\u0627\u0644\u0649.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u062e\u0645\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627 \u0646\u06cc\u0645\u0647 \u0622\u0645\u0627\u062f\u0647 \u0628\u0632\u0631\u06af (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", 1]}
{"text": ["\u0628\u0631 \u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0632\u06cc\u0631 \u0646\u0648\u0646 \u0647\u0627 \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0632\u0647 \u0648 \u0628\u0648\u06cc \u0633\u0648\u062e\u062a\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f \u0648 \u0628\u0647 \u062a\u0644\u062e\u06cc \u0645\u06cc\u0632\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u0627\u06cc\u0646\u062c\u0627 \u0632\u06cc\u0627\u062f \u0645\u06cc\u062f\u0645 \u0648 \u0645\u0639\u0645\u0648\u0644\u0627 \u0647\u0645 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0628\u0627\u0631 \u0622\u062e\u0631 \u06a9\u0631\u0648\u0627\u0633\u0627\u0646\u0647\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0648\u06cc \u0628\u06cc\u0627\u062a\u06cc \u0645\u06cc\u062f\u0627\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0633\u0641\u06cc\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0627\u06cc\u0646 \u0628\u0627\u0631 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u0627\u0641\u0641\u062a\u0636\u0627\u0627\u0627\u0627\u062d \u0628\u0648\u062f... \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0633\u0641\u062a \u060c \u0648 \u0647\u0645 \u0686\u0646\u06cc\u0646 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0627 \u0639\u06a9\u0633 \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f. \u0648 \u0627\u0635\u0644\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0648 \u0646\u0627\u0646 \u062e\u0631\u0645\u0627\u06cc\u06cc \u0647\u0631\u062f\u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0646\u0627\u0631 \u0646\u0627\u0646 \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc - \u0648\u0644\u06cc \u0645\u062a\u0623\u0633\u0641\u0627\u0646\u0647 \u0641\u0627\u06a9\u062a\u0648\u0631 \u0627\u0631\u0627\u0626\u0647 \u0646\u06a9\u0631\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 \u0628\u0627 \u0632\u0631\u062f \u0622\u0644\u0648", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", 1]}
{"text": ["\u0627\u0635\u0644\u0627\u062f\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646.. \u0627\u0632 \u0627\u0648\u0646 \u0628\u062f\u062a\u0631 \u06cc\u0647 \u0633\u0627\u0639\u062a \u0641\u0642\u0637 \u0645\u0646\u062a\u0638\u0631 \u0634\u062f\u0645 \u062a\u0627 \u0627\u0633\u0646\u067e \u0628\u06cc\u0627\u0631\u0647 \u0627\u062e\u0631\u0645 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0645 \u062a\u0627 \u0627\u0648\u0631\u062f\u0646 ....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633\u0647\u0627\u064a \u0645\u064a\u0646\u064a \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0686\u0646\u062f \u062a\u0627\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u0631\u0639\u0643\u0633 \u0645\u0639\u0645\u0648\u0644 \u0686\u064a\u0632\u0643\u064a\u0643 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f\u060c \u0645\u0632\u0647 \u062e\u0648\u0628\u0649 \u0646\u062f\u0627\u0634\u062a\u060c \u062e\u064a\u0644\u0649 \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f \u0648 \u0643\u0627\u0631\u0627\u0645\u0644 \u0632\u064a\u0627\u062f\u0649 \u0647\u0645 \u0631\u0648\u0649 \u0627\u0648\u0646 \u0642\u0631\u0627\u0631\u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0643\u0647 \u0627\u0648\u0636\u0627\u0639 \u0631\u0648 \u0628\u062f\u062a\u0631 \u0643\u0631\u062f\u0647 \u0628\u0648\u062f. \u0648\u0627\u0642\u0639\u0627 \u0646\u0627 \u0627\u0645\u064a\u062f \u0643\u0646\u0646\u062f\u0647 \u0628\u0648\u062f. \u0641\u0642\u0637 \u0643\u0648\u0643\u0649 \u0647\u0646\u0648\u0632 \u0643\u064a\u0641\u064a\u062a \u0645\u0639\u0645\u0648\u0644 \u0631\u0648 \u062f\u0627\u0634\u062a. \u0641\u0642\u0637 \u0643\u0648\u0643\u0649 \u0631\u0648 \u0643\u0646\u0627\u0631 \u0686\u064a\u0632 \u0643\u064a\u0643 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f \u0643\u0647 \u0628\u0631\u0627\u062b\u0631 \u062d\u0631\u0643\u062a \u0686\u0646\u062f\u062a\u0627\u064a\u0649 \u0643\u0627\u0631\u0627\u0645\u0644\u0649 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0639\u0627\u0627\u0644\u064a \u0628\u0648\u062f. \u0643\u0627\u0645\u0644\u0646 \u0633\u0627\u0644\u0645 \u0631\u0633\u064a\u062f \u062f\u0633\u062a\u0645 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \n\u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0635\u0641\u0631", 1]}
{"text": ["\u062f\u0631 \u0628\u0631\u06cc\u0648\u0634 \u06af\u0648\u062c\u0647 \u067e\u0646\u06cc\u0631 \u0627\u062b\u0631\u06cc \u0627\u0632 \u06af\u0648\u062c\u0647 \u0648 \u067e\u0646\u06cc\u0631 \u0646\u06cc\u0633\u062a \u0634\u0627\u06cc\u062f \u06cc\u0647 \u0686\u06cc\u0632\u06cc \u0634\u0628\u06cc\u0647 \u0627\u0633\u0627\u0646\u0633 \u062a\u0648\u0634 \u0647\u0633\u062a \u06a9\u0647 \u0627\u0648\u0646\u0645 \u0637\u0639\u0645 \u062e\u0627\u0635\u06cc \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u06af\u0648\u062c\u0647 \u0648 \u067e\u0646\u06cc\u0631", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0628\u0631\u064a\u0648\u0634 \u0647\u0627\u064a \u0627\u0631\u0633\u0627\u0644\u064a \u062e\u0634\u0643 \u0648 \u0643\u0647\u0646\u0647 \u0628\u0648\u062f\u0646\u062f\u060c \u0627\u0632 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0628\u0639\u064a\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", "\u0628\u0631\u06cc\u0648\u0634 \u06af\u0648\u062c\u0647 \u0648 \u067e\u0646\u06cc\u0631", "\u0628\u0631\u06cc\u0648\u0634 \u067e\u0633\u062a\u0648", 1]}
{"text": [" \u0628\u0627 \u0633\u0644\u0627\u0645\n\u0647\u0646\u06af\u0627\u0645\u06cc \u06a9\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u0627 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u062a\u0645\u0627\u0645\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc  \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u062c\u0639\u0628\u0647 \u062f\u0631 \u0637\u0648\u0644 \u0645\u0633\u06cc\u0631 \u06a9\u062c \u0634\u062f\u0647 \n\u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \n\u0627\u0645\u0627 \u0627\u0633\u0646\u067e \u062f\u0648 \u0633\u0627\u0639\u062a \u062a\u0645\u0627\u0645 \u06a9\u06cc\u06a9 \u0645\u0646\u0648 \u062f\u06cc\u0631 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0645\u0632\u0647 \u062e\u0648\u0628\u064a \u062f\u0627\u0634\u062a\u0646 \u0648\u0644\u064a \u0645\u062a\u0623\u0633\u0641\u0627\u0646\u0647 \u062a\u064e\u0648 \u062d\u0645\u0644 \u0664 \u062a\u0627\u0634 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0638\u0627\u0647\u0631 \u062e\u0648\u0628\u064a \u0646\u062f\u0627\u0634\u062a. \u0627\u064a\u0646 \u0647\u0645\u0647 \u067e\u0648\u0644 \u0645\u064a\u062f\u064a\u0645 \u062d\u062f\u0627\u0642\u0644 \u062f\u0631\u0633\u062a \u0628\u0631\u0633\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0643\u064a\u0643\u064a \u0643\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u064a\u062f \u0643\u0627\u0645\u0644\u0627 \u0628\u0631 \u0639\u0643\u0633 \u0634\u062f\u0647  \u0628\u0648\u062f \u062f\u0631 \u0628\u0633\u062a\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0647\u0645\u0647 \u06a9\u0648\u06a9\u06cc\u0647\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0648 \u0642\u0627\u0628\u0644 \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc \u0627\u0632 \u0645\u06cc\u0647\u0645\u0627\u0646 \u0646\u06cc\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0641\u0631\u0627\u062a\u0631 \u0627\u0632 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0645\u0627 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u0628\u062f \u0628\u0648\u062f. \u0628\u0627 \u0627\u06cc\u0646 \u06a9\u0647 \u062a\u0648\u06cc \u067e\u0631\u0641\u0631\u0648\u0634\u200c\u0647\u0627 \u0628\u0648\u062f\u060c \u0645\u0627 \u0627\u0632 \u062e\u0631\u06cc\u062f\u0634 \u06a9\u0627\u0645\u0644\u0627 \u067e\u0634\u06cc\u0645\u0627\u0646 \u0634\u062f\u06cc\u0645. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0646 \u0628\u0627\u0631 \u0627\u0648\u0644 \u0628\u0648\u062f \u06a9\u0647 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0631\u062f\u0645 \u0647\u0645\u0634\u0648\u0646 \u0639\u0627\u0644\u06cc \u0645\u0634\u062a\u0631\u06cc \u062f\u0627\u0626\u0645 \u0634\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u06af\u0631\u062f\u0648", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062d\u062c\u0645 , \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0647 \u0634\u0631\u06a9\u062a \u0627\u0641\u062a \u06a9\u0631\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0631\u0628\u062a \u062a\u062e\u0645 \u0634\u0631\u0628\u062a\u06cc \u0648 \u0646\u0639\u0646\u0627", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a. \u0648\u0627\u0642\u0639\u0627 \u062c\u0631\u0641 \u0646\u062f\u0627\u0634\u062a. \u0645\u0631\u0633\u06cc \u06a9\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ... \u0645\u0634\u062a\u0631\u06cc \u062f\u0627\u0626\u0645\u06cc \u0634\u062f\u06cc\u0645 \u0647\u0631 \u0631\u0648\u0632 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc\u0645. \u06af\u0627\u062a\u0627 \u0645\u062d\u0634\u0631 \u0628\u0648\u062f. \u0646\u0648\u0646 \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u0639\u0627\u0644\u06cc. \u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647\u200c\u0627\u06cc \u0639\u0627\u0644\u06cc ... \u0645\u0631\u0633\u06cc \u0648\u0627\u0642\u0639\u0627 ... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0646\u0648\u0646 \u0647\u0627\u06cc \u062e\u0648\u0628 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a\u06cc \u062f\u0627\u0631\u0646\u062f. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0645\u062c\u0645\u0648\u0639\u0647 \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (5 \u0639\u062f\u062f)", "\u0632\u0645\u0644", 1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0634\u0645\u0627\u060c \u0645\u062a\u0639\u062c\u0628 \u0627\u0632 \u0628\u0627\u0644\u0627 \u0631\u0641\u062a\u0646 \u0645\u0628\u0644\u063a \u0627\u0631\u0633\u0627\u0644 \u0647\u0633\u062a\u0645!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u06a9\u062a\u0627\u0646", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u0649", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc...\u0645\u062b\u0644\u200c\u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0628\u0631\u0648\u062a\u0686\u0646", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0645\u0627\u0634\u06cc\u0646\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u0649 \u060c \u0648\u0627\u0642\u0639\u0627 \u0643\u064a\u0641\u064a\u062a \u0646\u0648\u0646\u0647\u0627 \u062e\u064a\u0644\u0649 \u062e\u0648\u0628.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0645\u0627\u0634\u06cc\u0646\u06cc", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u06a9\u0646\u062c\u062f\u06cc", "\u0646\u0627\u0646 \u062c\u0648 80%", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0631\u06cc\u0632 \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06af\u0627\u0631\u062f\u0646 \u0686\u06cc\u06a9\u0646", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u0649 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062e\u064a\u0644\u0649 \u062e\u0648\u0628 \u0628\u0648\u062f \u060c \u0641\u0642\u0637 \u0627\u064a\u0646 \u0627\u0648\u0631\u0646\u062c \u0628\u0627\u0631 \u064a\u0643\u0645 \u0643\u0648\u0686\u064a\u0643 \u0628\u0648\u062f \u0628\u0647 \u0646\u0638\u0631\u0645 \u0648 \u0646\u0645\u0649 \u0627\u0631\u0632\u064a\u062f \u064a\u0643 \u062c\u0648\u0631\u0627\u0649 \u0627\u0632 \u0646\u0638\u0631 \u062d\u062c\u0645 \u060c \u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u0639\u0627\u0644\u0649 \u0647\u0645\u0647 \u0686\u0649 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0627\u0648\u0631\u0646\u062c \u0628\u0627\u0631", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", 1]}
{"text": ["\u0639\u0627\u0644\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a \u0628\u0648\u062f  \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u064a\u062f \u0648 \u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc \u062a\u06a9 \u067e\u0633\u062a\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u06a9\u0627 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0644\u06cc\u0648\u0627\u0646\u06cc \u0627\u0646\u0628\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (6 \u0639\u062f\u062f)", 1]}
{"text": ["\u0631\u0648\u0644\u062a \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (7 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0628\u0631\u0633\u0647 \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0646\u0633\u0628\u062a \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u0632\u06cc\u0627\u062f \u0628\u0648\u062f.", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["Keyfiat mesle hamishe ali bood vali too jabe zaheresh aslan jaleb nabodo hame shirnia leh shodeo too ham boodan, age too deliverish deghat beshe ali mishe dg.", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u06cc\u062a\u0627\u0644\u06cc\u0627\u06cc\u06cc \u06af\u0631\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0643\u064a\u0643 \u0648\u0627\u0646\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647 \u062e\u064a\u0644\u064a \u0633\u0628\u0643\u060c \u0632\u064a\u0627\u062f \u0648 \u062e\u0648\u0628\u064a \u062f\u0627\u0634\u062a. \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0622\u0644\u0645\u0627\u0646\u064a \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0627\u0645\u064a\u062f\u0648\u0627\u0631\u0645 \u0643\u064a\u0641\u064a\u062a \u062a\u062f\u0627\u0648\u0645 \u067e\u064a\u062f\u0627 \u0643\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u062e\u062a \u06af\u0631\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u06af\u0631\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0628\u0647\u200c\u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u0627\u0646\u062f \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u0635\u0644 \u062a\u0628\u0631\u06cc\u0632", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u06a9\u0631\u0634\u0645 \u0646\u0645\u06cc\u06a9\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0633\u062a\u0637\u06cc\u0644 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (15 \u0639\u062f\u062f)", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (15 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0633\u0631\u06cc \u0628\u0631\u0627\u0646\u06cc \u0628\u0627 \u067e\u0648\u062f\u0631 \u06a9\u0627\u06a9\u0627\u0626\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 8\u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0644\u06a9 \u0648\u0627\u0631\u0633 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0628\u06cc\u0634\u062a\u0631 \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u062a\u0631 \u0627\u0632 \u0686\u06cc\u0632\u06cc \u06a9 \u0628\u0646\u0638\u0631 \u0645\u06cc\u0631\u0633\u06cc\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\n\u0638\u0627\u0647\u0631 \u0632\u06cc\u0628\u0627 \u0648 \u0627\u0646\u062f\u0627\u0632\u0647 \u0645\u0646\u0627\u0633\u0628 \u0628\u0631\u0627\u06cc \u06cc\u0647 \u062c\u0634\u0646 \u062f\u0648 \u0646\u0641\u0631\u0647(\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648) \u0628\u0627 \u0642\u06cc\u0645\u062a \u062e\u0648\u0628\n\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0637\u0639\u0645\u0634 \u0647\u0645 \u0628 \u0647\u0645\u06cc\u0646 \u062e\u0648\u0628\u06cc \u0628\u0627\u0634\u0647 \u0648\u0644\u06cc \u0646\u0628\u0627\u0634\u0647 \u0647\u0645 \u0634\u0628 \u0645\u0627 \u06a9\u0627\u0645\u0644 \u0634\u062f\u0647!\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0627\u062f\u06a9\u0646\u06a9 \u0647\u0644\u06cc\u0648\u0645\u06cc 1\u0639\u062f\u062f", 1]}
{"text": ["\u0643\u0627\u0634 \u0645\u064a\u0634\u062f \u0645\u062b\u0644\u0627 \u0628\u06af\u064a\u0645 \u062f\u0647 \u062a\u0627 \u0627\u0632 \u0627\u064a\u0646 \u0646\u0648\u0639 \u0634\u064a\u0631\u064a\u0646\u064a \u062f\u0647 \u062a\u0627 \u0627\u0632 \u0646\u0648\u0639 \u062f\u064a\u06af\u0631 \u0648 ... \u062d\u0642 \u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u064a\u0634\u062a\u0631 \u0645\u064a\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u06a9\u0627 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 (20 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0631 \u062e\u0644\u0627\u0641 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u06cc \u0642\u0628\u0644\u06cc \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u06af\u06cc \u0628\u0627\u0631 \u0642\u0628\u0644 \u0631\u0627 \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc.\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0633\u067e\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0633\u2066\u2069\n\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0627\u0631\u06af\u06cc\u0644", 1]}
{"text": ["\u0639\u0627\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u0644\u06cc \u0648 \u062a\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u062f\u0631 \u0627\u0646\u062a\u062e\u0627\u0628 \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0633\u0644\u06cc\u0642\u0647 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0627\u0646\u062c\u0627\u0645 \u0634\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f... \u0648 \u062f\u0631 \u0639\u0631\u0636 \u06f1\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f! \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0627\u062a\u0631\u06cc\u0634\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646.\u062a\u0627\u0632\u0647.\u0633\u0631\u06cc\u0639.\u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc\u0647 ! \u062e\u0648\u0631\u062f\u0646 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0644\u0630\u062a \u0628\u062e\u0634\u0647 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648\u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0647\u0645\u06cc\u0634\u0647 \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u060c \u0645\u0631\u0633\u06cc \u0648\u0644\u06cc\u0648\u0631\u06cc \u062f\u0627\u0631\u0634 \u06a9\u0631\u062f\u06cc\u0646 . \u0686\u0646\u062f\u06cc\u0646 \u0633\u0627\u0644\u0647 \u0645\u0634\u0627\u0631\u06cc\u062a\u0648\u0646\u0645 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645\n\u0627\u0648\u0646 \u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u062e\u06cc\u0644\u06cc \u0634\u06a9\u06cc\u0644\u0647 .\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u06cc\u06a9\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0628\u0627 \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645 \u0648 \u0628\u062f\u062a\u0631\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062a\u0627\u062d\u0627\u0644\u0627 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0646\u0631\u0645 \u0646\u0628\u0648\u062f\u060c\u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u064a \u0646\u0628\u0648\u062f\u064a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0628\u062f \u0628\u0647 \u062a\u0645\u0627\u0645 \u0645\u0639\u0646\u0627 \u0627\u0646\u06af\u0627\u0631 \u0628\u0631\u0627\u06cc \u06cc\u0647 \u0647\u0641\u062a\u0647 \u067e\u06cc\u0634 \u0628\u0648\u062f\u0647 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0627\u0646\u062c\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646\u0647\u0627 \u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0628 \u0628\u0648\u062f \u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0634\u06a9", 1]}
{"text": ["\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a. \u0638\u0627\u0647\u0631\u0627 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a\u0646\u062f \u0648 \u0628\u06cc\u0627\u062a \u0634\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", -1]}
{"text": ["\u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u0630\u06a9\u0631 \u06a9\u0631\u062f\u0645 \u0646\u0627\u0646 \u067e\u062e\u062a \u0631\u0648\u0632 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0628\u0647 \u062a\u0646\u0647\u0627 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0645\u0632\u0634 \u0646\u0645\u06cc\u062e\u0648\u0631\u062f \u0647\u0645\u06cc\u0646 \u0646\u0648\u062a\u0644\u0627 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u06a9\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a\u062a\u0648\u0646 \u0639\u0627\u0644\u064a\u0647 ! \u0647\u0645\u064a\u0634\u0647 \u062a\u0627\u0632\u0647  . \u0645\u0631\u0633\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u060c \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u062e\u0635\u0648\u0635 \u067e\u0648\u0631\u067e\u0648\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a\u0647\u0627 \u0634\u0648\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u0686\u06cc\u0632\u06a9\u06cc\u06a9\u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0622\u0628 \u0634\u062f\u0647 \u0648 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 \u0633\u0647 \u0639\u062f\u062f\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u062f\u0631 \u062d\u0631\u06a9\u062a \u0648 \u0646\u062a\u0648\u0646\u0633\u062a\u0645 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u0645!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u06cc \u062a\u0648\u0644\u062f \u062e\u0631\u06cc\u062f\u0627\u0631\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06cc\u06a9 \u0637\u0631\u0641 \u06a9\u0627\u0645\u0644 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0634\u06a9\u0644 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u062d\u0648\u06cc\u0644 \u0627\u0633\u0646\u067e \u062e\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f . \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f \u0628\u0627\u0648\u062c\u0648\u062f \u0641\u0627\u0635\u0644\u0647 \u0627\u06cc \u06a9\u0647 \u062f\u0627\u0634\u062a\u06cc\u0645 . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u060c\u0633\u0627\u064a\u0632\u0634\u0645 \u0639\u0627\u0644\u064a\u060c\u064a\u0643\u0645 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a\u0634 \u0643\u0648\u0686\u0643 \u0647\u0633\u062a \u0648\u0644\u064a!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0645\u0646 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0647\u062f\u06cc\u0647 \u0628\u0631\u062f\u0645 \u06a9 \u0633\u0627\u0644\u0645 \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0628\u0631\u062e\u0648\u0631\u062f \u062f\u0631 \u062c\u0639\u0628\u0647 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646 \u062f\u0631 \u062d\u062f \u0648 \u0627\u0646\u062f\u0627\u0632\u0647 \u0647\u0627\u06cc \u0646\u0627\u0645 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0646\u0628\u0648\u062f\n\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627 \u0647\u0645 \u0628\u0647 \u0642\u06cc\u0645\u062a \u0646\u0645\u06cc \u0627\u0631\u0632\u06cc\u062f\n\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0645 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u062a\u0627\u0632\u0647\u060c \u062c\u0630\u0627\u0628\u060c \u062e\u0648\u0634\u0645\u0632\u0647\n\u0645\u062f\u062a\u0647\u0627 \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0647 \u0627\u06cc\u0646 \u062e\u0648\u0634\u0645\u0632\u06af\u06cc \u0646\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062a\u0648\u062c\u0647 \u0646\u0645\u06cc\u0634\u0645 \u0686\u0631\u0627 \u0645\u0648\u062c\u0648\u062f\u06cc \u0647\u06cc\u0686\u0648\u0642\u062a \u0622\u067e\u062f\u06cc\u062a \u0646\u06cc\u0633\u062a \u0648 \u0628\u0627\u0628\u062a \u062a\u0639\u0648\u06cc\u0636 \u062a\u0645\u0627\u0633 \u0645\u06cc\u06af\u06cc\u0631\u0646!\n\u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u0646\u06a9\u0631\u062f\u0646 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u06cc\u06a9\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u062f\u06cc\u0647 \u0627\u0633\u062a \u0648 \u062c\u062f\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u0648\u062f \u0648 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0628\u06cc \u062a\u0648\u062c\u0647\u06cc \u0634\u0645\u0627 \u0647\u0645\u0647 \u06cc \u0632\u0631\u0634\u06a9\u0647\u0627\u06cc \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0628\u0647 \u0638\u0631\u0641 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u062f\u0647 \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0647 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0646\u062a\u0648\u0627\u0646\u0633\u062a\u0645 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0647\u062f\u06cc\u0647 \u0628\u0647 \u06a9\u0633\u06cc \u0628\u062f\u0647\u0645!! \u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627 \u062e\u0634\u06a9 \u062e\u0634\u06a9 \u0628\u0648\u062f!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", -1]}
{"text": ["\u062e\u0627\u0645\u0647 \u0647\u0627\u06cc \u0631\u0648 \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u06cc\u0644\u0627\u0633 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u062d\u0633 \u062a\u0627\u0632\u06af\u06cc \u0646\u062f\u0627\u0634\u062a \u0627\u0645\u0627 \u062e\u0648\u062f\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0628\u0642\u06cc\u0647 \u0633\u0641\u0627\u0631\u0634 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0632\u06cc\u0627\u062f \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0645\u062b\u0644 \u062f\u0641\u0639\u0627\u062a \u0642\u0628\u0644.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u0628\u0631\u0627\u064a \u0643\u0633\u064a \u0628\u0631\u062f\u0645 \u0648 \u0646\u062e\u0648\u0631\u062f\u0645 \u0648\u0644\u064a \u062d\u062a\u0645\u0627 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u067e\u06cc\u06a9\u0647\u0627 \u0645\u0639\u0645\u0648\u0644\u0627 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u06a9\u0627\u0631 \u0631\u0648 \u0627\u0646\u062c\u0627\u0645 \u0645\u06cc\u062f\u0646 \u0648 \u062f\u0642\u062a \u0644\u0627\u0632\u0645 \u0631\u0648 \u0646\u062f\u0627\u0631\u0646.\n\u0642\u0646\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u062f\u0633\u0631 \u0631\u0648 \u0635\u0627\u0641 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0642\u0631\u0627\u0631 \u0645\u06cc\u062f\u0647 \u0648\u0644\u06cc \u067e\u06cc\u06a9\u0647\u0627 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644 \u0628\u0639\u0636\u0627 \u062d\u062a\u06cc \u062c\u0639\u0628\u0647 \u0647\u0627 \u0633\u0631 \u0648 \u062a\u0647 \u0634\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0648\u06a9\u0648 \u06af\u0648\u0634\u062a", 1]}
{"text": ["\u06a9\u0634\u0645\u0634 \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u062e\u0645\u06cc\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u064a \u0645\u0643\u0632\u064a\u0643\u064a \u0631\u0648 \u0645\u0646 \u0646\u064a\u0645 \u0643\u064a\u0644\u0648 \u0628\u0631\u0627\u064a \u0645\u0647\u0645\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0643\u0647 \u0661\u0661 \u0639\u062f\u062f \u0645\u064a\u0634\u062f \u0648 \u0664 \u062a\u0627\u0634 \u0643\u0647 \u0642\u0631\u0645\u0632 \u0628\u0648\u062f \u0643\u0647\u0646\u0647 \u0648 \u062e\u0634\u0643 \u0628\u0648\u062f\u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u062f\u0631 \u064a\u0627\u062f\u062f\u0627\u0634\u062a \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648\u0632 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0646  \u0643\u064a\u0643 \u0647\u0627\u064a \u062f\u0648\u0646\u0627\u062a \u0647\u0645 \u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u064a\u0634\u0647 \u062e\u0634\u0643 \u0628\u0648\u062f\u0646 \u062d\u064a\u0641 \u0643\u0647 \u0645\u0646 \u0647\u0645\u064a\u0634\u0647 \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648\u0632 \u062e\u0631\u064a\u062f \u0645\u064a\u0643\u0631\u062f\u0645 \u0648 \u0643\u064a\u0641\u064a\u062a \u0647\u0627\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f \u062a\u0627 \u0645\u0634\u062a\u0631\u064a \u0647\u0627\u0634\u0648\u0646\u0648 \u0628\u062f\u0633\u062a \u0645\u064a\u0627\u0631\u0646 \u0643\u064a\u0641\u064a\u062a \u062e\u0648\u062f\u0634\u0648\u0646 \u0631\u0648 \u062e\u0631\u0627\u0628 \u0645\u064a\u0643\u0646\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", -1]}
{"text": ["\u0645\u0634\u062a\u0631\u06cc\u0634 \u0634\u062f\u0645. \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0645\u0627\u0634\u06cc\u0646\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062e\u0627\u0645\u0647 \u0627\u0634 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0622\u0686\u0627\u0631\u06cc \u06af\u0644 \u0648\u0627\u0646\u06cc\u0644\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634 \u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f. \u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0627\u06a9\u0627\u062a\u06cc", "\u0628\u0627\u062f\u06a9\u0646\u06a9 \u0647\u0644\u06cc\u0648\u0645\u06cc 1\u0639\u062f\u062f", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0633\u0631\u064a\u0639 \u0647\u0645 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0648\u0627\u0646\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0632\u0626\u06cc\u0646 \u0645\u06cc\u0648\u0647", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (6 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0641\u0642\u0637 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc \u0628\u0627 \u0698\u0644\u0647 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646. \u0627\u06cc\u0646 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f \u0628\u0627 \u0627\u0648\u0646\u06cc \u06a9\u0647 \u062a\u0648 \u0639\u06a9\u0633 \u0628\u0648\u062f \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u062f \u0646\u0628\u0648\u062f. \u0633\u0627\u0642 \u0639\u0631\u0648\u0633 \u0647\u0645 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 :(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0642\u0647 \u0639\u0631\u0648\u0633 \u0645\u0631\u0628\u0627\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (10 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (12 \u0639\u062f\u062f)", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 (17 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u06cc\u062e \u0632\u062f\u0647 \u0628\u0648\u062f :/ ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0631\u0634\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u06a9\u0627 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u06a9\u0627 \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0639\u0627\u0644\u06cc...\n\u0631\u0648\u0644\u062a \u0639\u0627\u0644\u06cc...\n\u0648\u0644\u06cc \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0645\u0633\u0627\u0641\u062a \u06a9\u0645 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u0627\u0634 \u0628\u0631\u0627\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u0645\u0648\u0627\u0631\u062f \u0632\u06cc\u0627\u062f\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u0628\u06cc \u0646\u0638\u06cc\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0645\u0627\u0646\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0631\u062f\u0648\u06cc\u06cc", -1]}
{"text": ["\u062f\u0633\u062a\u0634\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647 \u06a9\u0647 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\n\u0636\u0645\u0646\u0627 \u0648\u0632\u0646 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627 \u0647\u0645 \u062f\u0631\u0633\u062a \u0628\u0648\u062f\n\u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0627\u0632 \u0628\u0686\u0647 \u0647\u0627\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0647\u0645 \u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u0645\u0648\u0642\u0639 \u0627\u0641\u0637\u0627\u0631 \u067e\u06cc\u06af\u06cc\u0631 \u0633\u0641\u0627\u0631\u0634 \u0648 \u062a\u062d\u0648\u06cc\u0644 \u0633\u0641\u0627\u0631\u0634 \u0628\u0648\u062f\u0646 \u0648 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0647 \u0642\u0633\u0645\u062a \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0633\u0641\u0627\u0631\u0634\u0645 \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f \u062f\u0633\u062a\u062a\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0638\u0631\u0641 \u0634\u0634 \u0636\u0644\u0639\u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0643\u0647\u0646\u06af\u064a \u0645\u064a\u062f\u0627\u062f \u0627\u0632 \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u062a\u0639\u062c\u0628 \u0643\u0631\u062f\u0645 \u0686\u0648\u0646 \u0647\u0645\u064a\u0634\u0647 \u0643\u064a\u0641\u064a\u062a\u0634 \u0639\u0627\u0644\u064a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc", -1]}
{"text": ["\u062e\u0627\u0645\u0647 \u0643\u064a\u0643 \u062f\u0628\u0644 \u0686\u0627\u0643\u0644\u062a \u062e\u064a\u0644\u064a \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f . \u0643\u064a\u0643 \u0627\u0633\u0641\u0646\u062c\u064a \u062f\u0627\u062e\u0644\u0634 \u0647\u0645 \u062e\u0634\u0643 \u0628\u0648\u062f. \u0638\u0627\u0647\u0631\u0634 \u0647\u0645 \u0634\u0628\u064a\u0647 \u0639\u0643\u0633 \u0646\u064a\u0633\u062a \u0627\u0635\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0647\u0627\u06cc \u062a\u0647\u0631\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0647\u0631 \u062c\u0641\u062a\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u0638\u0631\u0641 \u0645\u0631\u0628\u0639 \u06a9\u0648\u0686\u06a9 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u060c \u062a\u0627\u0632\u0647 \u0648 \u0642\u06cc\u0645\u062a \u0645\u0646\u0627\u0633\u0628.\n\u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0627\u0633\u062a\u0639\u062f\u0627\u062f \u062e\u0627\u0635\u064a \u0645\u064a\u062e\u0648\u0627\u0633\u062a \u0632\u0648\u0644\u0628\u064a\u0627 \u0628\u0627\u0645\u064a\u0647 \u0631\u0648 \u0628\u062f\u0645\u0632\u0647 \u062f\u0631\u0633\u062a \u0643\u0646\u0646\u062f \u0648 \u064a\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u062f\u0627\u0646\u0645\u0627\u0631\u0643\u064a \u0647\u064a\u0686 \u0631\u0628\u0637\u064a \u0628\u0647\u0634 \u0646\u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647. \u062e\u064a\u0644\u064a\u064a\u064a\u064a\u064a\u064a\u064a \u0628\u062f \u0628\u0648\u062f \u0647\u0631 \u062f\u0648\u0634! \u0645\u062a\u0627\u0633\u0641\u0645 \u0648\u0627\u0642\u0639\u0627!!! \u067e\u0648\u0644 \u062f\u0648\u0631 \u0631\u064a\u062e\u062a\u0645 \u0686\u0648\u0646 \u0628\u062f\u0648\u0646 \u0627\u064a\u0646\u0643\u0647 \u0628\u062a\u0648\u0646\u064a\u0645 \u0628\u062e\u0648\u0631\u064a\u0645\u060c \u0634\u0628 \u06af\u0630\u0627\u0634\u062a\u064a\u0645\u0634\u0648\u0646 \u062c\u0644\u0648\u064a \u062f\u0631!  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", -1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0648\u200c \u0646\u0627\u0645\u0637\u0628\u0648\u0639 \u0628\u0648\u062f. \u0646\u0638\u0631 \u062a\u0645\u0627\u0645 \u0645\u0647\u0645\u0627\u0646\u0647\u0627 \u0647\u0645 \u0647\u0645\u06cc\u0646 \u0628\u0648\u062f. \u0628\u0647 \u0647\u06cc\u0686 \u0648\u062c\u0647 \u062f\u06cc\u06af\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0642\u0646\u0627\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u0646\u062e\u0648\u0627\u0647\u0645 \u062f\u0627\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0638\u0631\u0641 \u0634\u0634 \u0636\u0644\u0639\u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u06cc\u06a9\u0645 \u0632\u06cc\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u0632\u0648\u0644\u0628\u06cc\u0627 \u0647\u0627\u0627\u0627\u0627\n\u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0639\u0627\u0644\u06cc \u0648 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0638\u0631\u0641 \u0645\u0631\u0628\u0639 \u0628\u0632\u0631\u06af \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0627\u0643\u0644\u0631 \u0648\u0627\u0642\u0639\u0627\u064b \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f\u060c \u0648\u0644\u064a \u062e\u0645\u064a\u0631 \u067e\u064a\u062a\u0632\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0646\u0627\u0646 \u062c\u0648 \u0647\u0645 \u0628\u062f \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u062e\u0635\u0648\u0635 \u067e\u0648\u0631\u067e\u0648\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062e\u0645\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627 \u0646\u06cc\u0645\u0647 \u0622\u0645\u0627\u062f\u0647 \u0628\u0632\u0631\u06af (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06cc\u06a9\u0645 \u062e\u0634\u06a9 \u0628\u0648\u062f\u0646 \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u0634\u0647\u062f \u0628\u06cc\u0634\u062a\u0631\u06cc \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0646\u0627\u0646 \u0646\u062e\u0648\u062f \u0686\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u06cc \u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u062e\u0648\u062f\u0686\u06cc", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0646 \u062a\u0642\u0631\u064a\u0628\u0627 \u0647\u0631 \u0631\u0648\u0632 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645 \u0648 \u062e\u064a\u0644\u0649 \u0631\u0627\u0636\u0649 \u0628\u0648\u062f\u0645 \u060c \u0627\u0645\u0627 \u0662 \u0633\u0631\u0649 \u0622\u062e\u0631 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0633\u0641\u0627\u0631\u0634\u0627\u062a\u0645\u060c \u0627\u0645\u064a\u062f\u0648\u0627\u0631\u0645 \u0643\u064a\u0641\u064a\u062a \u0647\u0645\u064a\u0634\u06af\u0649 \u067e\u0627\u064a\u064a\u0646 \u0646\u064a\u0627\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u0627\u0635\u0644\u0627 \u06a9\u06cc\u0641\u062a \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u0628\u0631\u0627\u06cc \u0686\u0646\u062f \u0631\u0648\u0632 \u067e\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", -1]}
{"text": ["\u0632\u064a\u0631  \u0662\u0660 \u062f\u0642\u064a\u0642\u0647 \u0631\u0633\u064a\u062f.\n\u0646\u0627\u0646 \u0628\u0648\u0644\u0643\u064a \u0627\u0632 \u0646\u0627\u0646 \u0628\u0648\u0644\u0643\u064a\u0647\u0627\u064a \u0633\u0646\u062a\u064a \u064a\u0643\u0645 \u0628\u0632\u0631\u06af\u062a\u0631\u0647 (\u0643\u0647 \u0627\u064a\u0631\u0627\u062f\u064a \u0646\u062f\u0627\u0631\u0647). \u0636\u0645\u0646\u0627 \u0646\u0627\u0646 \u064a\u0648\u0644\u0643\u064a \u062a\u0647 \u0645\u0632\u0647 \u062a\u0631\u0634 \u0633\u0646\u062a\u064a \u0631\u0627 \u062f\u0627\u0631\u062f.\n\u062f\u0648\u0646\u0627\u062a \u0628\u064a\u0634 \u0627\u0632 \u062d\u062f \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f \u0648 \u067e\u0641 \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062c\u0634\u0646 \u062a\u0648\u0644\u062f\u0645 \u0628\u0627 \u0646\u0648\u0646\u0647\u0627\u06cc \u062e\u0648\u0634\u0645\u0632\u062a\u0648\u0646 \u0639\u0627\u0644\u06cc \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632\u0632\u0632 \u0639\u0627\u0644\u06cc. \u0648\u0627\u0642\u0639\u0627 \u0645\u0631\u0633\u06cc. \u062f\u0631\u062c\u0647 \u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u060c \u0633\u0631\u06cc\u0639 \u0648 \u0646\u0627\u0646 \u062c\u0645 \u0647\u0645 \u06a9\u0647 \u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0628\u06af\u0630\u0631\u06cc\u0645 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u06af\u06cc \u0647\u0645\u0647 \u0627\u0646\u0648\u0627\u0639 \u0646\u0627\u0646\u0647\u0627 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 \u0648 \u0628\u06cc \u0646\u0642\u0635 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633\u060c \u0627\u0648\u062c \u062a\u0639\u0647\u062f \u0648 \u063a\u06cc\u0631\u062a \u0631\u0648 \u0645\u06cc\u0634\u0647 \u062f\u0631 \u0645\u062c\u0645\u0648\u0639\u0647 \u0627\u06cc \u062f\u06cc\u062f \u06a9\u0647 \u0633\u0627\u0639\u062a 10:30 \u0634\u0628 \u06a9\u0647 \u0647\u0645\u0647 \u0641\u0627\u0646\u062a\u0632\u06cc \u067e\u0632\u0647\u0627 \u062a\u0639\u0637\u06cc\u0644 \u0647\u0633\u062a\u0646 \u0648 \u0627\u06af\u0631 \u0686\u06cc\u0632\u06cc\u0645 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0646 \u0628\u06cc\u0627\u062a\u0647\u060c \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u062a\u0627\u0632\u0647 \u0648 \u062a\u0631\u062f\u06cc \u0645\u06cc\u0641\u0631\u0633\u062a\u0647 \u06a9\u0647 \u0686\u0646\u0627\u0646 \u0645\u0646\u0627\u0641\u0639 \u0645\u0627\u062f\u06cc \u0647\u0645 \u0628\u0631\u0627\u0634\u0648\u0646 \u0646\u062f\u0627\u0631\u0647!\n\u0648\u0627\u0642\u0639\u0627 \u062c\u0627\u06cc \u062a\u0634\u06a9\u0631 \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631\u0631 \u062f\u06cc\u0631 \u0627\u0645\u0627\u062f\u0647 \u0634\u062f\n\u06a9\u0644\u0627 \u062f\u0631\u0633\u0627\u0644 \u062c\u062f\u06cc\u062f \u0647\u0631 \u0633\u0641\u0627\u0631\u0634\u06cc \u0627\u0632 \u0642\u0646\u0627\u062f\u06cc\u0647\u0627 \u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u062f\u0627\u0634\u062a\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0639\u0637\u0644 \u0634\u062f\u0645\u060c \u0642\u0628\u0644\u0627 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639\u062a\u0631 \u0628\u0648\u062f\n\u0627\u0632\u06cc\u0646 \u0644\u062d\u0627\u0638 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u06cc\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u062a\u0645\u0627\u0645 \u0627\u0641\u0631\u0627\u062f\u06cc \u06a9\u0647 \u0627\u0632 \u06a9\u06cc\u06a9 \u062e\u0648\u0631\u062f\u0646\u062f\u060c \u0647\u0645\u06af\u06cc \u0627\u0632 \u0637\u0647\u0645 \u0648 \u0645\u0632\u0647 \u062e\u0648\u0628 \u06a9\u06cc\u06a9 \u062a\u0639\u0631\u06cc\u0641 \u06a9\u0631\u062f\u0646\u062f.\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0628\u0627\u0628\u062a \u0627\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0647\u0645\u0686\u0646\u06cc\u0646 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06a9\u0647 \u062f\u0631 \u062d\u0645\u0644 \u06a9\u06cc\u06a9 \u0646\u0647\u0627\u06cc\u062a \u062f\u0642\u062a \u0631\u0648 \u062f\u0631 \u062a\u062d\u0648\u06cc\u0644 \u06a9\u06cc\u06a9 \u062f\u0627\u0634\u062a\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 (12 \u062a\u0627\u06cc\u06cc)", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u06cc\u0646\u0642\u062f\u0631 \u062a\u06a9\u0648\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0647 \u062a\u0648\u06cc \u062d\u0645\u0644 \u0648 \u0646\u0642\u0644 \u06a9\u0647 \u0647\u0645 \u06a9\u0646\u0627\u0631 \u06a9\u06cc\u06a9 \u0647\u0645 \u0631\u0648\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0638\u0627\u0647\u0631\u0627 \u0647\u06cc\u0686\u06a9\u0633 \u06a9\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0647 \u0628\u0647\u062a\u0648\u0646 \u060c \u062f\u0631\u0633\u062a \u062a\u062d\u0648\u06cc\u0644 \u0646\u0645\u06cc \u06af\u06cc\u0631\u0647. \u0628\u0647 \u0647\u0645\u06cc\u0646 \u0648\u0636\u0639\u06cc\u062a \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u06cc\u0646 \u0628\u0639\u06cc\u062f \u0645\u06cc\u062f\u0648\u0646\u0645 \u06a9\u0633\u06cc \u062f\u0644\u0634 \u0628\u062e\u0648\u0627\u062f \u0627\u0646\u0644\u0627\u06cc\u0646 \u0627\u0632\u062a\u0648\u0646 \u062e\u0631\u06cc\u062f \u06a9\u0646\u0647 \u062f\u06cc\u06af\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0633\u0631\u062f \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648 \u0628\u06cc \u0645\u062d\u062a\u0648\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0642\u0627\u0631\u0686", "\u0633\u0645\u0628\u0648\u0633\u0647 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u0645\u0631\u063a", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631\u06cc\u0646 \u0646\u0627\u0646 \u0647\u0627 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0648 \u0627\u0632 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0645\u06cc\u0634\u0647 \u062e\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0627\u0631\u062a \u0646\u0645\u06a9\u06cc \u0628\u0632\u0631\u06af (30 \u0639\u062f\u062f)", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0645\u0646 \u0643\u0647 \u0639\u0627\u0634\u0642 \u0646\u0648\u0646 \u0628\u0631\u0628\u0631\u064a \u0627\u064a\u0646\u062c\u0627\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0645\u0627\u0634\u06cc\u0646\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0631 \u0648 \u0632\u06cc\u062a\u0648\u0646", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0642\u0627\u0631\u0686", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631\u060c \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0645\u062e\u0644\u0648\u0637 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0648 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645.\n\u0627\u0635\u0644\u0627 \u0627\u0635\u0644\u0627 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a\u0634\u0648\u0646 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645.\n\u0628\u0631\u0627\u06cc \u0627\u0648\u0644\u06cc\u0646 \u0648 \u0622\u062e\u0631\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0648\u062f \u06a9\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062e\u0631\u06cc\u062f \u0645\u06cc \u06a9\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0631\u0648\u0644 \u0686\u0627\u06cc \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0633\u0628\u06a9 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0647\u0645 \u0631\u0633\u06cc\u062f\n\u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u0633\u06cc\u0631 \u0648 \u06a9\u0631\u0647", 1]}
{"text": ["\u0634\u06cc\u0631\u0647 \u0632\u0648\u0644\u0628\u06cc\u0627\u0648\u0628\u0627\u0645\u06cc\u0647 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\n\u067e\u0644\u0645\u0628\u06cc\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0644\u0645\u0628\u06cc\u0631 \u0644\u06cc\u0648\u0627\u0646\u06cc", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 (\u0628\u0633\u062a\u0647 \u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 . \u0633\u067e\u0627\u0633 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u06a9\u06cc\u0641\u06cc\u062a\u0634\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0627\u0633\u062a\u0627\u0645\u0628\u0648\u0644\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0638\u0631\u0641 \u0645\u0631\u0628\u0639 \u0628\u0632\u0631\u06af \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 (\u0628\u0633\u062a\u0647 \u06a9\u0648\u0686\u06a9)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", 1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u0631\u0636\u0627\u06cc\u062a \u0628\u062e\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u0647 \u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f\n\u062f\u0631 \u0648\u0627\u0642\u0639 \u0648\u0627\u0642\u0639\u0627 \u062e\u0634\u06a9 \u0628\u0648\u062f!!!!!\n\u0648\u0633\u0637 \u0628\u0627\u0645\u06cc\u0647 \u0647\u0627 \u0647\u0645 \u062e\u0627\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u062f\u0631 \u0642\u0633\u0645\u062a \u062a\u0648\u0635\u06cc\u062d\u0627\u062a \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0646\u0648\u0634\u062a\u0646 happy birthday \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0646\u062c\u0627\u0645 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u0628\u0627 \u0639\u06a9\u0633 \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u0633\u0627\u06cc\u062a \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f \u0648 \u0647\u06cc\u0686 \u06af\u0648\u0646\u0647 \u062a\u0632\u06cc\u06cc\u0646\u0627\u062a\u06cc \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u064a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0627\u0632 \u0633\u0631\u0648\u064a\u0633 \u0627\u0631\u0627\u0626\u0647 \u0634\u062f\u0647 \u062e\u064a\u0627\u064a \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645\n\u0627\u0644\u0628\u062a\u0647 \u0647\u0645\u064a\u0634\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u064a \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\u0647\n\u0645\u0645\u0646\u0648\u0646 \u0628\u0631\u0627\u064a \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u064a\u0639 \u0648 \u062e\u0648\u0628 \u0648 \u0643\u064a\u0641\u064a\u062a \u0639\u0627\u0644\u064a \u0634\u064a\u0631\u064a\u0646\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646\u0645 \n\u0648\u0627\u0642\u0639\u0627 \u062f\u0631 \u0647\u0631 \u0628\u0627\u0631 \u062e\u0631\u06cc\u062f \u062a\u0648\u0646\u0633\u062a\u0645 \u0631\u0648\u06cc \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 \u062e\u0633\u0627\u0628 \u06a9\u0646\u0645\n\u06cc\u06a9 \u0627\u0645\u062a\u06cc\u0627\u0632 \u062e\u0648\u0628 \u0634\u0645\u0627 \u062a\u062d\u0648\u06cc\u0644 \u0633\u0631\u06cc\u0639 .\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0628\u0632\u0631\u06af)", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u063a\u06cc\u0631 \u062d\u0636\u0648\u0631\u06cc \u0641\u0631\u0635\u062a \u062e\u0648\u0628\u06cc\u0647 \u06a9 \u062c\u0646\u0633\u0627\u06cc \u06a9\u0647\u0646\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0631\u0648 \u0631\u062f \u06a9\u0646\u06cc \u0638\u0627\u0647\u0631\u0627 \u0645\u0647\u0645 \u0647\u0645 \u0646\u06cc\u0633 \u06a9 \u062f\u06cc\u06af\u0647 \u0627\u0632\u0634\u0648\u0646 \u062e\u0631\u06cc\u062f \u0646\u06a9\u0646\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0631\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u0631\u0633\u06cc \u06a9\u0647 \u0647\u0633\u062a\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0627\u0633\u062a \u0648 \u0628\u0648 \u0645\u06cc\u062f\u0647\n\u0644\u0637\u0641\u0627 \u0631\u0633\u06cc\u062f\u06af\u06cc \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0641\u0642\u0637 \u0643\u0644\u0645\u0647 \u0628\u062f \u0645\u0646\u0627\u0633\u0628 \u0627\u064a\u0646 \u0632\u0648\u0644\u0628\u064a\u0627 \u0628\u0627\u0645\u064a\u0647 \u0628\u0648\u062f  \n \u0645\u064a\u0634\u0647 \u0627\u064a\u0646\u0637\u0648\u0631 \u0637\u0639\u0645\u0634 \u0631\u0648 \u062a\u0639\u0631\u064a\u0641 \u0643\u0631\u062f \u0643\u0647 \u0646\u0648\u0646 \u062e\u0634\u0643\u064a \u0643\u0647 \u0628\u0648\u064a \u0632\u0647\u0645 \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u064a\u062f\u0627\u062f  \n \u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645  \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", -1]}
{"text": ["\u0632\u064a\u0631 \u0661\u0660 \u062f\u0642\u064a\u0642\u0647 \u0631\u0633\u064a\u062f. \u0627\u0632 \u0646\u0627\u0646 \u0628\u0648\u0644\u0643\u064a \u0647\u0645 \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0686\u0646\u062f \u0628\u0627\u0631\u0647 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a\u0647! \u0686\u0631\u0627 \u0631\u0633\u06cc\u062f\u06af\u06cc \u0646\u0645\u06cc\u06a9\u0646\u06cc\u062f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", -1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0686\u0631\u0628 \u0628\u0648\u062f\u0646...\u0632\u06cc\u0627\u062f\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645\u0647\u200c \u0645\u06cc\u0646\u06cc\u200c\u06a9\u06cc\u06a9\u200c\u0647\u0627 \u0631\u0648\u06cc \u0647\u0645 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646... \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0686\u0646\u062f\u0645 \u0628\u0648\u062f \u06a9\u0647 \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0627\u0641\u062a\u0627\u062f\u0647... \u0644\u0637\u0641\u0627 \u06cc\u0647 \u0641\u06a9\u0631\u06cc \u0628\u0631\u0627\u06cc \u0628\u0633\u062a\u0647\u200c\u0628\u0646\u062f\u06cc \u06a9\u0646\u06cc\u062f \u0686\u0648\u0646 \u0628\u0627 \u0627\u06cc\u0646 \u0628\u0627\u06a9\u0633 \u062f\u0631 \u0647\u0631 \u0635\u0648\u0631\u062a \u0633\u0627\u0644\u0645 \u0628\u0647 \u0645\u0642\u0635\u062f \u0646\u0645\u06cc\u200c\u0631\u0633\u0647!\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0631 \u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0642\u062a\u06cc \u0646\u0645\u06cc\u062a\u0648\u0646\u06cc\u062f \u062f\u0631\u0633\u062a \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f\u06cc\u062f \u0633\u0641\u0627\u0631\u0634 \u0646\u06af\u06cc\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0645\u06cc\u0632\u0627\u0646 \u0642\u0646\u062f \u0645\u0635\u0631\u0641\u06cc \u062f\u0631 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062e\u0648\u062f \u0631\u0627 \u06a9\u0645\u06cc \u06a9\u0627\u0647\u0634 \u062f\u0647\u06cc\u062f\u060c \u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u0631\u0648\u06cc \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0628\u0637\u0631\u0632 \u0646\u0627\u062e\u0648\u0634\u0627\u06cc\u0646\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u0645\u0646 \u062f\u0648 \u062f\u0641\u0639\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c \u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0623\u0645\u0627 \u0686\u0646\u062f\u062a\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u0648\u0627\u0698\u06af\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f \u0643\u0647 \u0632\u064a\u0627\u062f \u062c\u0627\u0644\u0628 \u0646\u0628\u0648\u062f \u0627\u0645\u064a\u062f\u0648\u0627\u0631\u0645 \u062f\u0631 \u062d\u0645\u0644 \u0643\u0631\u062f\u0646 \u062a\u0648\u062c\u0647 \u0628\u064a\u0634\u062a\u0631\u064a \u0628\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645\u060c \u062a\u0627\u0631\u062a \u0633\u06cc\u0627\u0647 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c \u067e\u0648\u062f\u06cc\u0646\u06af \u0647\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0634\u06a9\u0644\u0627\u062a \u0647\u0627\u06cc \u0631\u0648\u0634 \u06a9\u0627\u0645\u0644\u0627 \u062a\u06cc\u0631\u0647 \u0648 \u062e\u0634\u06a9 \u062a\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0628\u0642\u06cc\u0647 \u0633\u0641\u0627\u0631\u0634 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062f\u0631 \u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647 ....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645\u06af\u06cc \u0639\u0627\u0644\u06cc\u060c \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u062f. \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0628\u0627 \u062d\u0648\u0635\u0644\u0647 \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f.  \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u06cc\u0641\u06cc\u062a\u060c\u06a9\u0645\u06cc\u062a \u0648 \u0627\u0633\u062a\u0627\u0646\u062f\u0627\u0631\u062f \u062e\u0648\u0628 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0634\u0645\u0632\u0647. \u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u0647\u0633\u062a\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u06af\u0631\u0648\u0646 \u0634\u062f\u0647 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0645\u0647\u0647\u0647\u0647\u0647 \u06cc \u0628\u0633\u062a\u0647 \u0647\u0627 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f. \u0622\u0628\u0631\u0648\u0645 \u0631\u0641\u062a. \u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645. \u0647\u0645\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0648\u0642\u062a\u064a \u0646\u0645\u064a\u062a\u0648\u0646\u064a\u062f \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u0633\u0631 \u0648\u0642\u062a \u0648 \u062f\u0631\u0633\u062a \u062a\u062d\u0648\u064a\u0644 \u0628\u062f\u064a\u062f \u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u0633\u0631\u0648\u064a\u0633 \u0631\u0648 \u062d\u0630\u0641 \u0643\u0646\u064a\u062f .\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645. \u0633\u0641\u0627\u0631\u0634 \u0628\u0639\u062f \u0627\u0632 \u0662 \u0633\u0627\u0639\u062a \u0646\u0631\u0633\u064a\u062f!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0635\u0641\u0631", -1]}
{"text": ["\u062d\u0645\u0644 \u0628\u0633\u064a\u0627\u0631 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u062a\u0632\u064a\u064a\u0646 \u0643\u064a\u0643 \u0631\u0648 \u062e\u0631\u0627\u0628 \u0643\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06f1.\u0648\u0642\u062a\u06cc \u0647\u0632\u06cc\u0646\u0647 \u062d\u0645\u0644 \u062f\u0631\u06cc\u0627\u0641\u062a \u0645\u06cc\u0634\u0647\u060c \u0686\u0647 \u0627\u0635\u0631\u0627\u0631\u06cc \u0628\u0647 \u0633\u0641\u0627\u0631\u0634 \u0628\u0627\u0644\u0627\u06cc \u06f2\u06f0 \u0647\u0632\u0627\u0631\u062a\u0648\u0645\u0646 \u0647\u0633\u062a\u061f\n\u06f2.\u062f\u0631\u062e\u0648\u0627\u0633\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062f\u0631 \u062c\u0639\u0628\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0647 \u0648\u0644\u06cc \u062f\u0631 \u0637\u0631\u0641 \u06cc\u06a9\u0628\u0627\u0631 \u0645\u0635\u0631\u0641 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f.\n\u06f3.\u0642\u0628\u0644 \u0627\u0632 \u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634\u060c \u0633\u0641\u0627\u0631\u0634 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0628\u0627 \u06a9\u0644\u06cc \u0645\u0639\u0637\u0644\u06cc \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646\u062f \u06a9\u0647 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a\u060c \u0628\u0647\u062a\u0631\u0647 \u0645\u0648\u062c\u0648\u062f\u06cc \u0628\u0647 \u0631\u0648\u0632 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0645\u0627\u0641\u06cc\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u0648\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645. \u0646\u0627\u0646 \u062e\u0627\u0645\u0647\u200c\u0627\u06cc \u0633\u0627\u062f\u0647 \u062f\u0631\u06cc\u0627\u0641\u062a \u06a9\u0631\u062f\u0645 \u06a9\u0647 \u06f2 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0646 \u0627\u062e\u062a\u0644\u0627\u0641 \u0642\u06cc\u0645\u062a \u062f\u0627\u0631\u062f \u0648 \u0627\u0631\u0632\u0627\u0646\u200c\u062a\u0631 \u0627\u0633\u062a. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0633\u0627\u062f\u0647", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u062a\u0647\u0627 \u0627\u06cc\u0631\u0627\u062f \u062f\u0631 \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0647\u0627 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u0647\u0627 \u0628\u06cc \u0646\u0638\u06cc\u0631\u0646...\u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u0634\u06a9\u0644\u0627\u062a \u06a9\u0627\u0641\u06cc...\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062e\u064a\u0644\u0649 \u0631\u0627\u0636\u0649 \u0647\u0633\u062a\u0645 \u0648 \u0645\u0631\u062a\u0628 \u062e\u0631\u064a\u062f \u0645\u0649 \u0643\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a", "\u0633\u0648\u062e\u0627\u0631\u06cc \u062f\u0648 \u0631\u0646\u06af \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0639\u0627\u0644\u06cc\u06cc\u06cc \u0628\u0648\u062f .\u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0645\u0631\u0633\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u0631\u0627\u0648\u06cc\u062a\u0627 \u0627\u0645\u06af\u06273", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u06af\u0631\u062f\u0648 \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0631\u0628\u062a \u0633\u06a9\u0646\u062c\u0628\u06cc\u0646 \u0648 \u062e\u06cc\u0627\u0631", "\u0646\u0627\u0646 \u06af\u0631\u062f\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u0627\u0634 \u0627\u0645\u06a9\u0627\u0646\u0634 \u0628\u0627\u0634\u0647 \u062d\u062c\u0645 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0642\u0637\u0627\u0628 \u0631\u0648 \u06a9\u0645\u062a\u0631 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc\u0645 \u0645\u062b\u0644\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u0637\u0627\u0628 \u0648 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc", "\u06a9\u06cc\u06a9 \u0645\u0627\u0641\u06cc\u0646", 1]}
{"text": ["\u0645\u062e\u0635\u0648\u0635\u0627 \u06af\u0641\u062a\u0645 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u0647 \n\u06a9\u0627\u0645\u0644\u0627 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \n\u0645\u06cc\u0648\u0647 \u0631\u0648\u0634 \u067e\u0644\u0627\u0633\u06cc\u062f\u0647 \u0628\u0648\u062f \n\u062f\u0631 \u06a9\u0644 \u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0631\u062f\u0627\u0634\u062a\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0645\u0627\u0641\u06cc\u0646 \u0645\u06cc\u0648\u0647 \u0627\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u062a\u0648\u0646 \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc\u06cc \u062e\u0648\u0628\u0647 \u0648\u0633\u0631\u06cc\u0639 \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u06cc\u06cc \u0647\u0645 \u0628\u0630\u0627\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f . \u0645\u0627\u06a9\u0627\u0631\u0648\u0646 \u0647\u0627 \u0647\u0645 \u0647\u0645\u06cc\u0646 \u0637\u0648\u0631 .\u0648 \u062e\u06cc\u0644\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", -1]}
{"text": ["\u0628\u0627 \u0639\u06a9\u0633 \u062a\u0641\u0627\u0648\u062a \u062f\u0627\u0634\u062a \u0645\u062e\u0635\u0648\u0635\u0627 \u06a9\u0647 \u0631\u0648\u0644\u062a \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0628\u0627 \u0627\u062f\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627\u0627\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u060c\u0645\u0646 \u067e\u062f\u0631\u0645 \u062a\u0648 \u0632\u0645\u064a\u0646\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0633\u062e\u062a\u06af\u064a\u0631 \u0647\u060c\u0645\u0646 \u0628\u0631\u0627\u064a \u0627\u0648\u0644\u064a\u0646 \u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u0645\u0645\u0645\u0645 \u060c\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f.\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 .\u0648 \u062e\u064a\u0644\u064a \u0633\u0631\u064a\u0639 \u0628\u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u064a\u062f..\u0645\u0631\u0633\u064a \u0627\u0632 \u0627\u064a\u0646 \u0647\u0645\u0627\u0647\u0646\u06af\u064a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u062a\u0627\u06a9\u06cc\u062f \u0628\u0646\u062f\u0647 \u0628\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u06cc\u06a9 \u067e\u062e\u062a\u0647 \u0634\u062f\u0647 \u06cc \u0647\u0645\u0627\u0646 \u0631\u0648\u0632 \u060c \u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0628\u0631\u0627\u06cc\u0645 \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u062f . \u06a9\u06cc\u06a9 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u06a9\u0647 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a . \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u062a\u0639\u062f\u0627\u062f\u06cc", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u062e\u0627\u0645\u0647 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\n\u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633 \u0647\u0645 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0647\u067e\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u062e\u0686\u0627\u0644\u06cc (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u0627\u0634 \u0627\u0645\u06a9\u0627\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062a\u0631 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0647\u0645 \u0648\u062c\u0648\u062f \u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u062f\u0648 \u0633\u0647 \u0637\u0628\u0642\u0647 \u0631\u0648 \u0628\u0627\u0644\u0627 \u0627\u0648\u0645\u062f\u0646 \u0628\u062f\u0648\u0646 \u0622\u0633\u0627\u0646\u0633\u0648\u0631 \u0634\u0631\u0645\u0646\u062f\u0647 \u0634\u062f\u06cc\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u0633\u06cc\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u0631\u0633\u06cc\n\u062f\u0642\u06cc\u0642\u0627 \u0647\u0645\u0648\u0646 \u0644\u06cc\u0633\u062a \u0648 \u062a\u0627\u0632\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0628\u062f \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0686\u0631\u0627 \u0633\u0641\u0627\u0631\u0634\u0648 \u0627\u0634\u062a\u0628\u0627\u0647 \u0645\u06cc\u0641\u0631\u0633\u062a\u06cc\u0646 \u0645\u0646 \u0646\u0648\u0646 \u0627\u0646\u062c\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u06cc\u0647 \u0646\u0648\u0646 \u06cc\u06a9\u0645 \u0634\u06a9\u0644\u0627\u062a \u0645\u0627\u0644\u06cc\u062f\u06cc\u0646 \u0628\u0647\u0634 \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u0646 \n\u0646\u0648\u0646\u0627 \u0631\u0648 \u0647\u0645 \u062a\u0648 \u06cc\u0647 \u0646\u0627\u06cc\u0644\u0648\u0646 \u0646\u0630\u0627\u0634\u062a\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0627\u0646\u062c\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0646 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0633\u0627\u062f\u0647 \u0622 \u0648\u0631\u062f\u0646\u062f\u060c \u0627\u0645\u0627 \u0634\u06cc\u0631\u0645\u0627\u0644 \u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0648\u0646 \u0648\u0627\u0642\u0639\u0627 \u0628\u0627\u0644\u0627 \u0628\u0648\u062f\u060c \u0645\u0631\u0633\u06cc \u0627\u0632 \u0632\u062d\u0645\u0627\u062a\u062a\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0622\u0642\u0627 \u0627\u06cc\u0646 \u062f\u0648\u0646\u0627\u062a \u062f\u0648 \u062a\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0686\u0631\u0627 \u06cc\u062f\u0648\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u062e\u0648\u062f\u0686\u06cc", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0646\u0627\u0646 \u0633\u064a\u0645\u064a\u062a \u0639\u0627\u0627\u0627\u0644\u064a \u0628\u0648\u062f. \u067e\u0631 \u0627\u0632 \u0643\u0646\u062c\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647. \u0646\u0627\u0646 \u0641\u0631\u0627\u0646\u0633\u0648\u064a \u0647\u0645 \u0628\u0633\u064a\u0627\u0631 \u0628\u0627 \u0643\u064a\u0641\u064a\u062a \u0628\u0648\u062f. \u0641\u0642\u0637 \u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u064a \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u062f\u0631 \u062d\u0645\u0644 \u0643\u0627\u0645\u0644\u0627 \u062e\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0647\u0645\u0634 \u06af\u0648\u0634 \u0641\u06cc\u0644 \u0628\u0648\u062f!!!!!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", "\u0642\u0637\u0627\u0628", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f. \u06af\u0627\u062a\u0627 \u0648 \u06a9\u0648\u06a9\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0646\u062f\u0627\u0634\u062a \u0648 \u062a\u0645\u0627\u0645\u0627 \u0631\u06cc\u062e\u062a\u0645 \u062f\u0648\u0631. \u0645\u062e\u0635\u0648\u0635\u0627 \u06a9\u0648\u06a9\u06cc\u200c \u0628\u0627 \u0622\u0646 \u0642\u06cc\u0645\u062a \u0628\u0627\u0644\u0627 \u0628\u0647\u06cc\u0686 \u0648\u062c\u0647 \u0642\u0627\u0628\u0644 \u062a\u0648\u062c\u06cc\u0647 \u0646\u06cc\u0633\u062a. \u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0645 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f. \u0644\u0637\u0645\u0647 \u0627\u06cc\u200c \u06a9\u0647 \u0641\u0631\u0648\u0634 \u0627\u06cc\u0646 \u0627\u062c\u0646\u0627\u0633 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0647 \u0627\u0639\u062a\u0628\u0627\u0631 \u0627\u06cc\u0646 \u0645\u063a\u0627\u0632\u0647 \u0645\u06cc\u0632\u0646\u0647 \u0642\u0637\u0639\u0627 \u0627\u0631\u0632\u0634 \u0633\u0648\u062f \u062c\u0632\u06cc\u06cc \u0627\u0648\u0646 \u0631\u0648 \u0646\u062f\u0627\u0631\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648 \u0633\u0631 \u0631\u0698\u06cc\u0645\u06cc 90%", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u06a9\u0648\u06a9\u06cc \u06af\u0631\u062f\u0648 \u0648 \u0634\u06a9\u0644\u0627\u062a", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc. \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u06af\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u06a9\u0634\u0645\u0634\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u06af\u0627\u062a\u0627\u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u062a\u0627\u0632\u0647 \u067e\u0631 \u0645\u063a\u0632 \u06af\u0631\u062f\u0648 \u0647\u0627\u06cc \u0645\u0631\u063a\u0648\u0628 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645\n\u0645\u06cc\u06a9\u0627\u062f\u0648 \u06cc\u0647 \u0627\u0633\u0627\u0646\u0633\u06cc \u062f\u0627\u0634\u062a \u06a9\u0647 \u062f\u0648\u0633\u0634 \u0646\u062f\u0627\u0634\u062a\u0645 \u0648\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u0648 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645 \u0647\u062f\u06cc\u0647 \u0628\u062f\u0645 \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0642\u0627\u0628\u0644 \u0627\u0631\u0627\u0626\u0647 \u0628\u0639\u0646\u0648\u0627\u0646 \u0647\u062f\u06cc\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", -1]}
{"text": ["\u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f \u0648\u0644\u06cc \u0637\u0639\u0645\u0634 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["I love you please stay perfect ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u0647 \u0648\u0644\u06cc \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u062e\u06cc\u0644\u06cc \u0641\u0627\u062c\u0639\u0647 \u0628\u0648\u062f \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u06f1 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631 \u062f\u0627\u0634\u062a . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u062f\u0631 \u062c\u0639\u0628\u0647 \u062c\u0627 \u0628\u0647 \u062c\u0627 \u0634\u062f\u0647 \u0648 \u06cc\u06a9\u0637\u0631\u0641 \u0622\u0646 \u062a\u063a\u06cc\u06cc\u0631 \u0634\u06a9\u0644 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u062a\u0627\u062e\u064a\u0631 \u064a\u0643 \u0633\u0627\u0639\u062a \u0648 \u0646\u064a\u0645 \u0643\u064a\u0643 \u0628\u0627 \u0638\u0627\u0647\u0631 \u0643\u0627\u0645\u0644\u0627 \u0646\u0627 \u0645\u0646\u0627\u0633\u0628\u0649 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647\u060c \u0628\u0631\u0627\u0649 \u062a\u0648\u0644\u062f \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u0649 \u0639\u0645\u0644\u0627 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0628\u0648\u062f !!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u062f\u0648\u0633\u0627\u0639\u062a \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f . \u0632\u0645\u0627\u0646 \u0627\u0639\u0644\u0627\u0645\u06cc \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a \u0628\u0648\u062f. \u0686\u0647 \u062e\u0628\u0631\u0647 \u0648\u0627\u0642\u0639\u0627 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 1", -1]}
{"text": ["\u062c\u0639\u0628\u0647 \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0646\u0633\u0628\u062a \u0628\u0647 \u062a\u0639\u062f\u0627\u062f \u0648 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0648\u062f \u0628\u0647 \u0647\u0645\u06cc\u0646 \u062f\u0644\u06cc\u0644 \u062a\u0639\u062f\u0627\u062f\u06cc \u0627\u0632 \u0622\u0646\u0647\u0627 \u0648\u0627\u0698\u06af\u0648\u0646 \u0634\u062f\u0647 \u06a9\u0647 \u0645\u0648\u062c\u0628 \u062e\u0631\u0627\u0628\u06cc \u0634\u06a9\u0644 \u0638\u0627\u0647\u0631\u06cc \u0622\u0646\u0647\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f. \n\u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062f\u0631\u0633\u062a \u0648 \u0645\u0646\u0627\u0633\u0628 \u0645\u0648\u062c\u0628 \u0633\u0627\u0644\u0645 \u0646\u06af\u0647 \u062f\u0627\u0634\u062a\u0646 \u0634\u06a9\u0644 \u0648 \u0641\u0631\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0642\u0637\u0639\u0627 \u0628\u0627\u0639\u062b \u062d\u0641\u0638 \u0622\u0628\u0631\u0648 \u0645\u06cc\u0632\u0628\u0627\u0646 \u062d\u06cc\u0646 \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc \u0627\u0632 \u0645\u06cc\u0647\u0645\u0627\u0646 \u062e\u0648\u0627\u0647\u062f \u0634\u062f.\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a \u0639\u0627\u0644\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0630\u06cc\u0631 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u0648 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0628\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u0649 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0628\u0631\u0627\u06cc \u0627\u0646\u062a\u0642\u0627\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u06a9\u06cc\u06a9 \u0628\u0627 \u0645\u0648\u062a\u0648\u0631 \u062a\u0645\u0647\u06cc\u062f\u0627\u062a\u06cc \u0628\u0633\u0646\u062c\u06cc\u062f \u06a9\u0647 \u06a9\u06cc\u06a9 \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0647 \u0634\u062f\u0647 \u0628\u062f\u0633\u062a \u0645\u0634\u062a\u0631\u06cc \u0646\u0631\u0633\u0647 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.\u062f\u0642\u06cc\u0642\u0627 \u0647\u0645\u0648\u0646 \u0627\u0646\u062a\u0638\u0627\u0631\u06cc \u06a9\u0647 \u0645\u06cc\u0631\u0641\u062a \u062d\u062a\u06cc \u0628\u0647\u062a\u0631 \u0647\u0645 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u062e\u0645\u0647 \u0645\u062d\u0628\u0648\u0628\u06cc \u062f\u0648 \u0622\u062a\u06cc\u0634\u0647 250 \u06af\u0631\u0645", "\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0633\u06cc\u0631 \u0648 \u06a9\u0631\u0647", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\u0647\u0645\u0647 \u0686\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0641\u0642\u0637 \u062f\u0633\u0631 \u0647\u0648\u06cc\u062c \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u06cc\u0645.\u0646\u0627\u067e\u0644\u06cc\u0648\u0646\u06cc \u06a9\u0645 \u062e\u0627\u0645\u0647 \u0648 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628. \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0647\u0645 \u0639\u0627\u0644\u06cc.\u067e\u06cc\u06a9 \u0645\u0648\u062f\u0628 \u0648 \u0633\u0631\u06cc\u0639.\u0633\u067e\u0627\u0633 \u0641\u0631\u0627\u0648\u0627\u0646 \u0628\u0627\u0628\u062a \u0645\u0634\u062a\u0631\u06cc \u0645\u062f\u0627\u0631\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0633\u0631 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u0646\u0627\u0646 \u062e\u064a\u0633 \u0628\u0648\u062f \u0648 \u0628\u062f\u0648\u0646 \u0646\u0627\u064a\u0644\u0648\u0646 \u0627\u0635\u0644\u064a \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", -1]}
{"text": ["\u0627\u0632 \u0647\u0645\u0647 \u0646\u0638\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0632 \u0646\u0627\u0646\u0647\u0627 \u0648 \u0634\u064a\u0631\u064a\u0646\u064a\u0647\u0627\u0649 \u0627\u064a\u0646 \u0645\u063a\u0627\u0632\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0645\u06af\u0647 \u062f\u0627\u0631\u064a\u0645 \u061f!\u061f!\n\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062e\u064a\u0644\u0649 \u062e\u064a\u0644\u0649 \u062e\u0648\u0628 \u0628\u0648\u062f .\n \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u0649 \u0628\u0647 \u06af\u0631\u0648\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u067e\u064a\u0643 \u0645\u062d\u062a\u0631\u0645 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u06a9\u0648\u06a9\u06cc \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0645\u0646 \u0648\u0627\u0642\u0639\u0627\u064b \u0646\u0645\u064a\u062f\u0648\u0646\u0645 \u0643\u0633\u064a \u0643\u0647 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627 \u0631\u0627 \u0645\u064a\u062e\u0648\u0646\u0647 \u0648 \u0622\u0645\u0627\u062f\u0647 \u0645\u064a\u0643\u0646\u0647 \u0686\u0637\u0648\u0631\u064a \u0645\u062a\u0648\u062c\u0647 \u0646\u0645\u064a\u0634\u0647 \u0643\u0647 \u0633\u0641\u0627\u0631\u0634 \u0627\u0634\u062a\u0628\u0627\u0647 \u0645\u064a\u0641\u0631\u0633\u062a\u0647 \u0627\u064a\u0646 \u0628\u0627\u0631 \u062f\u0648\u0645\u0647 \u0643\u0647 \u0627\u064a\u0646 \u0643\u0627\u0631 \u0631\u0648 \u0645\u064a\u0643\u0646\u064a\u062f \u064a\u0639\u0646\u064a \u0627\u0646\u0642\u062f\u0631 \u0633\u062e\u062a\u0647 \u0641\u0647\u0645\u064a\u062f\u0646\u0634 \u0643\u0647 \u0628\u0647 \u062c\u0627\u064a \u06af\u0631\u0627\u0646\u0648\u0644\u0627\u064a \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u0627\u0646\u0648\u0644\u0627\u064a \u0645\u064a\u0643\u0633 \u0641\u0631\u0633\u062a\u0627\u062f\u064a\u062f \u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u0627\u064a\u0646 \u0643\u0647 \u0628\u0647 \u062e\u0648\u062f\u062a\u0648\u0646 \u0636\u0631\u0631 \u0645\u0627\u0644\u064a \u0645\u064a\u0632\u0646\u064a\u062f \u0627\u0639\u062a\u0645\u0627\u062f \u0645\u0634\u062a\u0631\u064a \u0628\u0647 \u062e\u0648\u062f\u062a\u0648\u0646 \u0647\u0645 \u0643\u0645 \u0645\u064a\u0643\u0646\u064a\u062f \u0644\u0637\u0641\u0627\u064b\u064a\u0643 \u0643\u0645 \u062f\u0642\u062a \u0643\u0646\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0635\u0628\u062d\u0627\u0646\u0647", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", -1]}
{"text": ["\u062f\u0633\u0631 \u0647\u0648\u06cc\u062c \u0648 \u0631\u062f\u0648\u0644\u0648\u062a \u062e\u06cc\u0644\u06cc \u0628\u062f \u0645\u0632\u0647 \u0648 \u062a\u0631\u0634 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", "\u062f\u0633\u0631 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a  \u0627\u0645\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u0645\u062a\u06cc\u0627\u0632 \u0628\u0627\u0644\u0627\u06cc\u06cc \u06a9\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u062a\u0638\u0627\u0631 \u0628\u0647\u062a\u0631\u06cc\u0646 \u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0646\u0639\u0644 \u0627\u0633\u0628\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0628\u0647 \u062c\u0627\u0649 \u067e\u0627\u064a \u0633\u064a\u0628 \u0643\u064a\u0643 \u06af\u0631\u062f\u0648\u064a\u064a \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0643\u0647 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645 \u0627\u0632 \u0646\u0627\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0635\u0628\u062d\u0627\u0646\u0647", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u062a\u062e\u0645\u0647 \u0648 \u06a9\u0646\u062c\u062f", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062f\u0631\u062c\u0647 \u06cc\u06a9 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0627 \u0628\u0627\u0631", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0645\u0631\u0633\u06cc \u0645\u0631\u0631\u0631\u0631\u0631\u0633\u06cc *-:\n\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u2026 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0639\u0627\u0627\u0627\u0627\u0644\u06cc ( \u06a9\u0644\u0644\u0644\u0644\u06cc \u0645\u0631\u0633\u06cc \u06a9\u0647 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a\u0645 \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u06cc\u0646 ) \u062d\u0645\u0644 \u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u2026 \u0634\u0645\u0627 \u0628\u0647\u0647\u0647\u0647\u0647\u062a\u0631\u06cc\u0646\u0646\u0646\u0646\u0646\u0646\u06cc\u06cc\u06cc\u06cc\u06cc\u062f\u062f\u062f\u062f\u062f\u062f ^_^", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0634\u0645\u0639 \u062e\u0627\u0644 \u062e\u0627\u0644\u06cc", 1]}
{"text": ["\u0647\u0645 \u062a\u0627\u0632\u0647 \u0647\u0645 \u0633\u0631\u06cc\u0639.. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0627\u0632 \u0634\u0645\u0627. \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647\u200c\u0627\u06cc\u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0628\u06a9 \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u06cc \u0628\u0648\u062f.\n\u0627\u0648\u0644\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634\u0645 \u0628\u0648\u062f \u0648 \u0645\u0634\u062a\u0631\u06cc\u062a\u0648\u0646 \u0634\u062f\u0645.\n\u0627\u0631\u0633\u0627\u0644\u0634 \u0647\u0645 \u0641\u0648\u0631\u06cc \u0628\u0648\u062f. \u0628\u0627\u0632 \u0647\u0645 \u0633\u067e\u0627\u0633.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627 \u0627\u0635\u0644\u0627\u064b \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u062a\u0627 \u0627\u0644\u0627\u0646 \u0647\u0631 \u0686\u06cc \u06a9\u06cc\u06a9 \u06af\u0631\u0641\u062a\u0645 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639 \n\u0645\u0631\u062a\u0628 \u0648 \u0645\u0646\u0638\u0645 \n\u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u062e\u0686\u0627\u0644\u06cc (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0645\u062c\u06cc\u06a9", 1]}
{"text": ["\u0632\u06cc\u0631 \u062f\u0647 \u062f\u0642\u06cc\u0642\u0647 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645\u0648\u0646 \u0648 \u062e\u06cc\u0644\u06cc \u0647\u0645 \u062a\u0631\u0648\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u060c\u0633\u067e\u0627\u0633 \u0641\u0631\u0627\u0648\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633\u0634 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0645\u0648\u0631\u0644 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u062e\u0686\u0627\u0644\u06cc (\u0645\u06cc\u0646\u06cc)", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0647\u067e\u06cc", "\u06a9\u06cc\u06a9 \u062a\u0645\u0634\u06a9 \u06cc\u062e\u0686\u0627\u0644\u06cc (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0628\u0647 \u063a\u06cc\u0631 \u0627\u0632 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc\u0634 \u0628\u0642\u06cc\u0647 \u0634 \u06cc\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f.. \u0628\u0647 \u0647\u0631 \u062d\u0627\u0644 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0645\u0632\u0647 \u06a9\u06cc\u06a9\u0634 \u0639\u0627\u0644\u06cc\u0647 \u0648 \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0631\u062f\u0648\u0644\u0648\u062a\u0634 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u06a9\u06cc\u06a9 \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0633\u0631\u06cc\u0639 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0627\u0646\u0642\u062f\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u062f\u0627\u063a \u0628\u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f.\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f..\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u062a\u0648\u0646 \u0645\u062e\u0635\u0648\u0635\u0627 \u0628\u0627\u0628\u062a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u062f\u0648\u0646\u0627\u062a \u0647\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0637\u0639\u0645 \u0646\u0648\u0646 \u0642\u0646\u062f\u06cc \u0647\u0627\u06cc \u0632\u0645\u0627\u0646 \u0628\u0686\u06af\u06cc\u0645\u0648 \u0645\u06cc\u062f\u0627\u062f \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0646\u0627\u0646 \u062c\u0645 \u0648 \u0627\u0633\u0646\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0634\u06a9", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u06a9\u0645\u06cc \u0686\u0631\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u0631\u0648\u0633\u0627\u0646 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0631\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0632\u0644\u062d\u0627\u0638 \u06a9\u06cc\u0641\u06cc\u062a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u06a9\u0645 \u0634\u0647\u062f \u0648\u06a9\u0645\u06cc \u062e\u0634\u06a9 \u0648\u0627\u06cc\u0646\u06a9\u0647 \u06f1\u06f0\u06f0\u06af\u0631\u0645 \u062e\u0631\u062f\u0647 \u0630\u0648\u0644\u0628\u06cc\u0627 \u0648\u0645\u0627\u0628\u0642\u06cc \u0628\u0627\u0645\u06cc\u0647 \u062f\u0631\u06cc\u06a9 \u0628\u0633\u062a\u0647 \u0628\u0648\u062f \u0648\u062a\u0646\u0627\u0633\u0628 \u0631\u0639\u0627\u06cc\u062a \u0646\u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u062f\u0627\u063a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u062f\u06cc\u062f\u0627 \u062a\u0648\u0635\u06cc\u0647 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0646 \u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645. \u0634\u0645\u0627 \u06af\u0631\u062f \u0622\u0648\u0631\u062f\u06cc\u062f. \u0644\u0637\u0641\u0627 \u0628\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0642\u062a \u0634\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0647\u0645\u0647 \u0686\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0686\u0631\u0628 \u0648 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645... \u0648\u0627\u0642\u0639\u0627 \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0647\u0633\u062a\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u06a9\u0627\u0645\u0644 \u0686\u067e \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0646\u062d\u0648\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f \u06a9\u0645\u06cc \u0645\u0632\u0647 \u0645\u0642\u0648\u0627 \u0645\u06cc\u062f\u0627\u062f \u0648\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0645\u063a\u0632 \u0622\u062c\u06cc\u0644 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u062f\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 1", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u067e\u06cc\u06a9 \u0627\u0646\u0642\u062f\u0631 \u0627\u0644\u062a\u0645\u0627\u0633 \u06a9\u0631\u062f \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627 \u0628\u0647 \u0646\u0633\u0628\u062a \u0642\u06cc\u0645\u062a \u062e\u0648\u0628 \u0647\u0633\u062a\u0646\u062f \u0627\u0645\u0627 \u06a9\u0645\u06cc \u06a9\u0645\u062a\u0631 \u0628\u0631\u0634\u062a\u0647 \u0628\u0634\u0646 \u0628\u0647\u062a\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0628\u0647 \u0646\u0633\u0628\u062a \u0642\u06cc\u0645\u062a \u0633\u0627\u06cc\u0632 \u0645\u062d\u0635\u0648\u0644 \u06a9\u0648\u0686\u06cc\u06a9\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0645\u062a\u0623\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u0642\u0633\u0645\u062a\u06cc \u0627\u0632 \u0622\u0646 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0662 \u0633\u0627\u0639\u062a \u0648 \u0631\u0628\u0639 \u062a\u0627\u062e\u064a\u0631\u061f\u061f\u061f\u061f\u061f\u061f\u061f!!!!!!!!\u0686\u0631\u0627\u0627\u0627\u0627\u0627 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062c\u0627\u0646\u061f\u061f\u061f\u061f!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", -1]}
{"text": ["\u067e\u06cc\u06a9 \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0633\u0631 \u0648 \u062a\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645\u0634 \u0644\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062e\u064a\u0644\u064a \u0637\u0639\u0645 \u0645\u0639\u0645\u0648\u0644\u064a \u062f\u0627\u0634\u062a\u0646 \u0628\u0647\u0632\u062e\u0627\u0637\u0631 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\n\u0627\u06af\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u062d\u062a\u0645\u0627\u064b \u062e\u064a\u0644\u0649 \u062e\u0648\u0634 \u0645\u0632\u0647 \u062a\u0631 \u0645\u064a\u0634\u062f\u0646..\n\u0648\u0644\u064a \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u062e\u064a\u0644\u064a \u0642\u0634\u0646\u06af\u064a \u062f\u0627\u0634\u062a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u062c\u0648 \u0648 \u0628\u0627\u062f\u0627\u0645", 1]}
{"text": ["\u062a\u0648\u0644\u062f \u0647\u0645\u0633\u0631\u0645 \u0628\u0648\u062f \u0648 \u062f\u0627\u062e\u0644 \u0622\u0633\u0627\u0646\u0633\u0648\u0631 \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u0634\u0645\u0639 \u0628\u06af\u0630\u0627\u0631\u0645 \u062a\u0627 \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u0634\u0646\u060c \u06a9\u06cc\u06a9 \u0634\u0628\u06cc\u0647 \u0647\u0631 \u0686\u06cc \u0628\u0648\u062f\u060c \u06a9\u06cc\u06a9 \u0646\u0628\u0648\u062f \u0627\u0632 \u0628\u0633 \u06a9\u0647 \u062a\u0648 \u062f\u0631 \u0648 \u062f\u06cc\u0648\u0627\u0631 \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u062f\u0641\u0648\u0631\u0645\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0645\u0648\u0645 \u062e\u0627\u0645\u0647 \u0647\u0627\u0634 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \n\u0648\u0627\u0642\u0639\u0627 \u0634\u0648\u06a9\u0647 \u0648 \u0646\u0627\u0631\u0627\u062d\u062a \u0634\u062f\u0645 \u0648 \u06a9\u0627\u0631\u06cc \u0627\u0632 \u062f\u0633\u062a\u0645 \u0628\u0631 \u0646\u0645\u06cc\u0648\u0645\u062f \u0627\u0648\u0646 \u0645\u0648\u0642\u0639 \n\u0644\u0637\u0641\u0627 \u0628\u0631\u0627\u06cc \u062d\u0645\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u06a9\u06cc\u06a9 \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u06a9\u0646\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0643\u0644\u0627 \u062e\u0648\u0628\u064a\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u06cc\u0646 \u0633\u0631\u06cc \u062e\u0648\u0628 \u0648 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u062f\u0648\u0646 \u0647\u0645\u0627\u0647\u0646\u06af\u06cc \u06a9\u06cc\u06a9 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u06a9\u0647 \u062f\u0631 \u0646\u0647\u0627\u06cc\u062a \u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u067e\u0633 \u062f\u0627\u062f\u0647 \u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0647\u0627\u06cc\u062a \u062f\u0642\u062a \u0631\u0648 \u062f\u0627\u0634\u062a\u06cc\u062f \u06a9\u0647 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f\n\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646\u06cc \u0627\u06cc\u0646 \u0646\u0648\u0639 \u062f\u0633\u0631 \u0648\u0627\u0642\u0639\u0627 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0643\u064a\u0643 \u0628\u0647 \u0637\u0631\u0632 \u0648\u062d\u0634\u062a\u0646\u0627\u0643\u0649 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0627\u0633\u0646\u067e \u0628\u0633\u06cc\u0627\u0631 \u062f\u06cc\u0631 \u0627\u0645\u062f \u0645\u062b\u0644\u0627 \u0627\u0633\u0645\u0634 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u0648\u062f !", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0628\u062f \u06cc\u0648\u062f \u0637\u0639\u0645 \u063a\u0630\u0627 \u0648 \u0633\u0631\u062f .... \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647\u062f\u062d\u062a\u06cc \u0632\u062d\u0645\u062a \u06af\u0631\u0645 \u06a9\u0631\u062f\u0646 \u0631\u0627 \u0647\u0645 \u0628\u0647 \u062e\u0648\u062f\u0634\u0627\u0646 \u0646\u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u062f . \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u06f5\u06f4 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0627\u0646 \u0631\u0648 \u0647\u062f\u0631 \u062f\u0627\u062f\u0645 \u0645\u062a\u0627\u0633\u0641\u0645 . \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0645\u0631\u063a", "\u0647\u0627\u062a \u062f\u0627\u06af \u067e\u0646\u06cc\u0631\u06cc", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0633\u06cc\u0646\u0647 \u0645\u0631\u063a", "\u0631\u0648\u0644 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", -1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648\u0644\u06cc \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u0622\u0633\u062a\u0627\u0646\u0647 250 \u06af\u0631\u0645", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", -1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0639\u0627\u0644\u06cc. \u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0639\u0627\u0644\u06cc. \u0634\u06cc\u0631\u0645\u0627\u0644 \u0638\u0627\u0647\u0631\u0634 \u0642\u0634\u0646\u06af \u0628\u0648\u062f \u0648\u0644\u06cc \u0647\u0645 \u0628\u06cc \u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645 \u062e\u0634\u06a9 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u06a9\u0644\u0627\u0633\u06cc\u06a9", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0646\u0639\u0644 \u0627\u0633\u0628\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0631\u0633\u0628\u0627\u0646\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0645\u062e\u0644\u0648\u0637 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u060c \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u06af\u06cc\u0647\u0627 \u062e\u06cc\u0644\u06cc \u0627\u0634\u062a\u0628\u0627\u0647 \u062a\u0648 \u0627\u0631\u0633\u0627\u0644 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0631\u062e \u0645\u06cc\u062f\u0647 \u0645\u0627 \u06cc\u06a9 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u06cc\u0645 \u0634\u0645\u0627 \u06cc\u06a9 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0645\u06cc\u0641\u0631\u0633\u062a\u06cc\u0646\n\u0628\u0647 \u0644\u0637\u0641 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0627\u0642\u0644\u0627 \u0639\u0648\u0636 \u0645\u06cc\u06a9\u0646\u06cc\u0645 \u06cc\u0627 \u067e\u0648\u0644\u0634\u0648 \u067e\u0633 \u0645\u06cc\u06af\u06cc\u0631\u06cc\u0645 \u0648\u0644\u06cc \u0644\u0637\u0641\u0627 \u062f\u0642\u062a \u06a9\u0646\u06cc\u062f \u062f\u0631\u0633\u062a \u0628\u0641\u0631\u0633\u062a\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc...\n\u062a\u0627\u0632\u0647 \u0648 \u062e\u06cc\u0644\u06cc\u06cc \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e\u200c\u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0643\u0627\u0644\u0627\u0647\u0627 \u062e\u064a\u0644\u0649 \u062e\u0648\u0628 \u0645\u062a\u0634\u0643\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u0645\u063a\u0632 \u06af\u0631\u062f\u0648 \u0627\u06cc\u0631\u0627\u0646\u06cc 250 \u06af\u0631\u0645", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0627\u0646\u06af\u0627\u0631 \u06af\u0644\u0627\u0628 \u062e\u0627\u0644\u06cc \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0631 \u062f\u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0647\u0631 \u0628\u0627\u0631 \u06a9\u0647 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u0632\u0646\u06af \u0645\u06cc\u0632\u0646\u0646 \u06a9\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u0627\u0642\u0644\u0627\u0645 \u062a\u0645\u0648\u0645 \u0634\u062f\u0647 \u0648 \u0627\u06cc\u0646 \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", -1]}
{"text": ["\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0686\u0631\u0627 \u0628\u0631\u0628\u0631\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u062f\u061f\u061f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u06a9\u0646\u062c\u062f\u06cc", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u06a9\u0644\u0627 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0628\u06cc \u0646\u0642\u0635 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0628\u0631\u0648\u062a\u0686\u0646", "\u062b\u0645\u06cc\u0646", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0646\u062f\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \n\u0648\u0642\u062a \u0628\u062e\u064a\u0631 \n\u0645\u0646 \u0646\u064a\u0645 \u0643\u064a\u0644\u0648  \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u064a \u0633\u0627\u062f\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u064a \u0646\u064a\u0645 \u0643\u064a\u0644\u0648 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u064a \u0645\u062e\u0644\u0648\u0637 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0643\u0645\u064a \u062f\u0642\u062a \u0643\u0646\u064a\u062f \u0644\u0637\u0641\u0627\u064b\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0644\u0630\u06cc\u0630 \u0648 \u0644\u0630\u062a \u0628\u062e\u0634 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0631\u0628\u062a \u06af\u0644\u0627\u0628 \u0648 \u062a\u062e\u0645 \u0634\u0631\u0628\u062a\u06cc", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0648\u06a9\u0648 \u0633\u0628\u0632\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0648 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u064a\u062f\n\u0643\u064a\u0641\u064a\u062a \u0646\u0648\u0646 \u0647\u0627 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u064a\u0647 \u0645\u0646 \u0686\u0646\u062f\u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c \u0646\u0648\u0646 \u067e\u0646\u064a\u0631 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0647 \u06af\u0648\u062c\u0647 \u062e\u064a\u0627\u0631 \u062f\u0627\u0631\u0647 \u0639\u0627\u0644\u064a\u0647\n\u0641\u0642\u0637 \u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u0647\u0627 \u062e\u064a\u0644\u064a \u062f\u0627\u062e\u0644\u0634 \u062e\u0645\u064a\u0631\u064a \u0628\u0648\u062f \u062e\u064a\u0644\u064a \u0628\u0647\u062a\u0632 \u0627\u0632\u064a\u0646\u0627 \u0645\u064a\u062a\u0648\u0646\u0647 \u062f\u0631\u0633\u062a \u0634\u0647\n\u062f\u0631 \u0643\u0644 \u0633\u067e\u0627\u0633 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a \u062e\u0648\u0628 \u0648 \u0643\u064a\u0641\u064a\u062a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0646\u0648\u0646 \u0647\u0627\n\u0645\u0648\u0641\u0642 \u0628\u0627\u0634\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631\u060c \u06af\u0631\u062f\u0648", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u06af\u0648\u0634\u062a", 1]}
{"text": ["\u0643\u064a\u0643 \u0627\u0632 \u064a\u0643 \u0637\u0631\u0641 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0648\u0642\u062a\u064a \u0628\u0647 \u067e\u064a\u0643 \u062a\u0630\u0643\u0631 \u062f\u0627\u062f\u0647 \u0634\u062f - \u06af\u0641\u062a\u0646 \u0633\u0627\u0644\u0645\u0647 !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0686\u0642\u062f\u0631 \u0633\u0631\u0631\u0631\u0631\u0631\u0631\u0631\u0631\u06cc\u0639 !!! \n\u0645\u06af\u0647 \u062f\u0627\u0631\u06cc\u0645\u061f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u062f\u0631 \u0646\u06cc\u0645\u0647 \u0632\u0645\u0627\u0646 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0631\u06cc\u0627\u0641\u062a \u0634\u062f. \u0628\u0647 \u062c\u0627\u06cc \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc, \u06a9\u06cc\u06a9 \u06a9\u0634\u0645\u0634\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u062f\u0631 \u0647\u0645\u0627\u0646 \u062a\u0645\u0627\u0633 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0628\u0627\u0628\u062a \u062a\u0639\u0648\u06cc\u0636 \u062f\u06cc\u06af\u0631 \u0622\u06cc\u062a\u0645 \u0633\u0641\u0627\u0631\u0634, \u0628\u0647 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0647\u0645 \u0627\u0634\u0627\u0631\u0647 \u0645\u06cc \u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", 1]}
{"text": ["\u0639\u0627\u0634\u0642\u062a\u0648\u0646\u0645 \u06a9\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u062e\u0648\u0628\u06cc\u0646 ^_^\n\u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0627\u0627\u0632\u0647 \u0648 \u0628\u062f\u0648\u0646 \u06a9\u0648\u0686\u06a9\u062a\u0631\u06cc\u0646 \u062c\u0627\u0628\u062c\u0627\u06cc\u06cc \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f ( \u0647\u0645\u06cc\u0646 \u0637\u0648\u0631 \u062e\u06cc\u06cc\u06cc\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 )\n\u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u060c \u062e\u0635\u0648\u0635\u0627\u064b \u06a9\u0648\u06a9\u06cc \u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a . \u0645\u0627\u0628\u0642\u06cc \u0633\u0641\u0627\u0631\u0634\u0645 \u06a9\u0647 \u0627\u0635\u0644\u0627\u064b \u0646\u06cc\u0627\u0632\u06cc \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d \u0646\u062f\u0627\u0631\u0646 \u0686\u0648\u0646 \u0628\u0647\u062a\u0631\u06cc\u0646\u0646 \u0648 \u0647\u0645\u0647 \u0627\u06cc\u0646\u0648 \u0645\u06cc\u062f\u0648\u0646\u0646 .\n\u0645\u0631\u0631\u0631\u0631\u0631\u0631\u0633\u06cc *-:", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u06a9\u062c \u0634\u062f\u0647 \u0648 \u06a9\u0645\u06cc \u0627\u0632\u0634 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0645\u0646\u0638\u0645, \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a + \u0631\u0641\u062a\u0627\u0631 \u062e\u0648\u0628 \u067e\u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0627 \u0644\u0647 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u06af\u0644 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f...\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u0648\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u06a9\u0647 \u0645\u0634\u062a\u0631\u06cc \u062f\u0627\u06cc\u0645\u06cc \u0647\u0633\u062a\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0634\u0648\u0646 \u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648 \u062f\u0648\u0646\u0627\u062a", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0645\u0632\u0647 \u06a9\u06cc\u06a9\u0634 \u0639\u0627\u0644\u06cc\u0647 \u0648 \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0631\u062f\u0648\u0644\u0648\u062a\u0634 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0639\u062f\u062f 6", "\u0634\u0645\u0639 \u0639\u062f\u062f 2", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u0631\u0627\u0636\u06cc \u06a9\u0646\u0646\u062f\u0647 \u0628\u0648\u062f.\u0648\u0627\u0642\u0639\u0627 \u0644\u0630\u062a \u0628\u0631\u062f\u0645 \u0627\u0632 \u0633\u0631\u0639\u062a \u062a\u062d\u0648\u06cc\u0644.\u06a9\u0645\u062a\u0631 \u0627\u0632 8 \u062f\u0642\u06cc\u0642\u0647.\u0627\u0646\u0634\u0627\u0644\u0644\u0647 \u06a9\u0647 \u0645\u0648\u0641\u0642 \u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u062a\u0648\u06cc \u0639\u06a9\u0633 \u0645\u062f\u0644 \u0647\u0627\u06cc \u0645\u062e\u062a\u0644\u0641\u06cc \u0627\u0632 \u0633\u0627\u0642 \u0639\u0631\u0648\u0633 \u0631\u0648 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0641\u0642\u0637 \u06cc\u06a9 \u0645\u062f\u0644 \u0631\u0648 \u0641\u0631\u0633\u062a\u0627\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0627\u0642 \u0639\u0631\u0648\u0633", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u0645\u062a\u0648\u0633\u0637)", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a\u0647\u0627 \u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0647\u0633\u062a \u0645\u0646 \u0647\u0631 \u062c\u0627\u06cc \u0627\u0632 \u062a\u0647\u0631\u0627\u0646 \u0628\u0627\u0634\u0645 \u0645\u06cc\u0627\u0645 \u0627\u0632 \u0627\u06cc\u0646\u062c\u0627 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9\u0647 \u0647\u0645\u06cc\u0646 \u062c\u0648\u0631 \u062e\u0648\u0628 \u0628\u0645\u0648\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646 \u062a\u0631 \u0631\u06cc\u0632 \u0645\u062e\u0644\u0648\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u062c\u0634\u0646\u0648\u0627\u0631\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u06cc\u0646\u06cc)", "\u0634\u0645\u0639 \u0647\u067e\u06cc", 1]}
{"text": ["\u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u0646\u0648\u0639 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 (\u062a\u0646\u0648\u0631\u06cc/\u06cc\u062e\u0686\u0627\u0644\u06cc) \u0630\u06a9\u0631 \u0634\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9", -1]}
{"text": [" \u0627\u0648\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u0648\u06cc \u062a\u0635\u0648\u06cc\u0631 \u0628\u0627\u06cc\u062f \u0628\u0627\u0634\u0647 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06cc\u062e\u0686\u0627\u0644\u06cc (\u0645\u06cc\u0646\u06cc)", -1]}
{"text": ["\u0645\u06cc\u0634\u0647 \u0644\u0637\u0641\u0646 \u0628\u0633\u062a\u0647 \u0647\u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0631\u0648 \u0647\u0645 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u0646! \u06a9\u0647 \u06a9\u0627\u0631\u0628\u0631 \u0628\u062a\u0648\u0646\u0647 \u062d\u062c\u0645 \u0645\u0648\u0631\u062f \u0646\u0638\u0631\u0634 \u0631\u0648 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u062f\u0644\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0627\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u062f\u0631 \u06a9\u0644 \u062a\u0627\u0632\u06af\u06cc \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0646\u0628\u0648\u062f \u06cc\u0647 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0633\u0627\u062f\u0647 \u0628\u0648\u062f\n\u0628\u0627\u0632\u0645 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u062e\u0644\u0648\u0637 \u062c\u0639\u0628\u0647 \u0627\u06cc (\u06a9\u0648\u0686\u06a9)", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u062d\u0635\u0648\u0644 \u062a\u0627\u0632\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u062a\u062e\u0645 \u06a9\u062a\u0627\u0646", "\u06a9\u0627\u06a9", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644", 1]}
{"text": ["\u06af\u0648\u0634\u0641\u06cc\u0644 \u0646\u062f\u0627\u0634\u062a \u062a\u0648 \u0633\u0641\u0627\u0631\u0634\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0646\u0627\u0646 \u0648 \u0622\u0631\u062f \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0628\u0647 \u062c\u0627\u06cc 800 \u06af\u0631\u0645 600 \u06af\u0631\u0645 \u0628\u0648\u062f \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644 \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0627\u0645\u06cc\u0647 \u0648 \u0632\u0648\u0644\u0628\u06cc\u0627 \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0622\u0631\u062f \u0633\u0641\u06cc\u062f 21 \u062f\u0631\u0635\u062f (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644", -1]}
{"text": ["\u0647\u0645 \u0633\u0631\u06cc\u0639 \u0622\u0648\u0631\u062f\u0646 \u0647\u0645 \u0648\u0642\u062a\u06cc \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0645\u062b\u0647 \u0646\u0648\u0646\u06cc \u06a9\u0647 \u0627\u0632 \u062a\u0646\u0648\u0631 \u0628\u06cc\u0631\u0648\u0646 \u0627\u0648\u0645\u0631\u0647\u060c \u0646\u0631\u0645 \u0648 \u062f\u0627\u063a! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u0649 \u0645\u062b\u0644 \u0633\u0646\u06af \u062e\u0634\u0643 \u0628\u0648\u062f \u0648 \u062f\u0648\u0631 \u0631\u064a\u062e\u062a\u0647 \u0634\u062f \u0686\u0646\u062f\u0645\u064a\u0646 \u0628\u0627\u0631 \u0647\u0633\u062a\u0634 \u0643\u0647 \u0627\u0632 \u0646\u0627\u0646 \u062c\u0645 \u0634\u064a\u0631\u064a\u0646\u0649 \u0643\u0634\u0645\u0634\u0649 \u0648 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645 \u0648 \u0627\u064a\u0646 \u0627\u062a\u0641\u0627\u0642 \u0645\u064a\u0641\u062a\u0647 \u0644\u0637\u0641\u0627 \u0631\u0633\u064a\u062f\u06af\u0649 \u0643\u0646\u064a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u062d\u062f\u0627\u0642\u0644 \u06cc\u06a9\u0645 \u0628\u0647 \u0645\u0634\u062a\u0631\u06cc \u0627\u062d\u062a\u0631\u0627\u0645 \u0645\u06cc\u0632\u0627\u0634\u062a\u06cc\u062f \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0628 \u0645\u06cc\u06a9\u0631\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u06a9\u0648\u0686\u06a9 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0648 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647\u200c\u0627\u06cc \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f... \u06f8\u06f0\u06f0 \u06af\u0631\u0645 \u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0631\u0627 \u0628\u0627\u06cc\u062f \u0628\u0631\u06cc\u0632\u0645 \u062f\u0648\u0631 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644", -1]}
{"text": ["\u0632\u0648\u0644\u0628\u064a\u0627 \u0628\u0627\u0645\u064a\u0647 \u062e\u064a\u0644\u064a\u064a\u064a\u064a\u064a \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f \u0627\u0645\u0627 \u06af\u0648\u0634 \u0641\u064a\u0644 \u0647\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0645\u0631\u062a\u0628 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0648 \u0628\u0627\u0645\u06cc\u0647 \u0648 \u06af\u0648\u0634 \u0641\u06cc\u0644", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0648 \u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\u0646\u062f\u060c \u0648\u0644\u06cc \u0646\u0627\u0646 \u062c\u0648 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u06cc\u0627\u062a \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f .\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0628\u0647\u062a\u0631 \u0627\u0632 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0648\u062f .\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f .\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc.\n\u0642\u06cc\u0645\u062a  \u06af\u0631\u0648\u0646 \u0647\u0633\u062a \u0648\u0644\u06cc \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u062a\u0648\u062c\u06cc\u0647 \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u062e\u0627\u0644 \u062e\u0627\u0644\u06cc", 1]}
{"text": ["\u0628\u0627 \u062a\u0627\u062e\u064a\u0631 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0627\u063a\u0648\u0646 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645. \u0627\u0632 \u0627\u0633\u0646\u067e \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u06cc\u0633\u062a\u0645. \u06a9\u06cc\u06a9 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u06a9\u0627\u0645\u0644\u0627 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645\u060c \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0633\u062a\u0645 \u0627\u0634\u062a\u0628\u0627\u0647\u06cc \u062e\u0648\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0645\u0632\u0647 \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u06a9\u0647 \u0646\u0648\u0646\u0634 \u0628\u06cc\u0627\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0631\u0627\u06cc \u062a\u0648\u0644\u062f \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0627\u0635\u0644\u0627  \u0686\u0646\u06cc\u0646 \u0627\u0646\u062a\u0638\u0627\u0631\u06cc \u0646\u062f\u0627\u0634\u062a\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062f\u0648", "\u0634\u0645\u0639 \u0647\u0634\u062a", -1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u0628\u0648\u06cc \u0634\u062f\u06cc\u062f \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u0628\u0627\u064a\u062f \u062a\u0648\u062c\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u064a\u0646 \u0643\u0647 \u062d\u062c\u0645 \u0643\u0644 \u0633\u0641\u0627\u0631\u0634\u062a\u0648\u0646 \u0631\u0648\u0649 \u0647\u0645 \u064a\u0643 \u0645\u0631\u0628\u0639 \u0661\u0665*\u0661\u0665 \u0647\u0645 \u0646\u0645\u064a\u0634\u0647! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062f\u0648 \u062a\u0627 \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627 \u0648\u0627\u0631\u0648\u0646\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0643\u0627\u0645\u0644\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0643\u064a\u0641\u064a\u062a \u0628\u0627\u0643\u0633 \u062f\u064a\u06af\u0631 \u0628\u0631\u0627\u0649 \u0645\u0647\u0645\u0627\u0646\u0649 \u0645\u0646\u0627\u0633\u0628 \u0646\u064a\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u0634\u0644\u0647 \u0632\u0631\u062f \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u06a9\u0645 \u0628\u0648\u062f \u0646\u0648\u0646 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0646\u0628\u0648\u062f \u0641\u0627\u0646\u062a\u0632\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0644\u0647 \u0632\u0631\u062f", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (5 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0627\u0646 \u0647\u0627 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0633\u0628\u0648\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u0628\u0686 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f .\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627\u06af\u062a \u062e\u0645\u06cc\u0631 \u062a\u0631\u0634 \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062c\u0627\u0634 \u0646\u0627\u0646 \u062c\u0648 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0628\u062c\u0632 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0627\u0632 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u060c \u0634\u0648\u0631\u06cc\u0646\u06cc \u060c \u0646\u0627\u0646 \u0647\u0627 \u0648 \u0627\u0644\u0628\u062a\u0647 \u0633\u0631\u0639\u062a \u0627\u0633\u0646\u067e \u0628\u0633\u06cc\u0627\u0631 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645. \u062d\u062a\u0645\u0627 \u0645\u062c\u062f\u062f \u0645\u0647\u0645\u0627\u0646 \u0634\u0645\u0627 \u062e\u0648\u0627\u0647\u06cc\u0645 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0628\u0627\u06af\u062a \u062e\u0645\u06cc\u0631 \u062a\u0631\u0634", "\u0646\u0627\u0646 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627", "\u0634\u0648\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u0631\u0628\u062a \u0628\u0647 \u0644\u06cc\u0645\u0648 \u0648 \u062e\u0627\u06a9\u0634\u06cc\u0631", "\u0634\u0631\u0628\u062a \u0633\u06a9\u0646\u062c\u0628\u06cc\u0646 \u0648 \u062e\u06cc\u0627\u0631", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0634\u0631\u0628\u062a \u0628\u06cc\u062f\u0645\u0634\u06a9 \u0632\u0639\u0641\u0631\u0627\u0646", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u06a9\u0627\u0634 \u0628\u0634\u0647 \u0627\u0646\u0648\u0627\u0639 \u0645\u062e\u062a\u0644\u0641 \u0631\u0648 \u062c\u062f\u0627 \u062a\u0647\u06cc\u0647 \u06a9\u0631\u062f(\u0633\u0627\u062f\u0647\u060c \u0634\u06a9\u0644\u0627\u062a\u06cc\u060c \u0646\u0633\u06a9\u0627\u0641\u0647 \u0627\u06cc) \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0633\u067e\u0627\u0633 \u0627\u0632 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 100%", "\u0632\u0645\u0644", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a\n\u0648\u0644\u064a \u0643\u064a\u0643 \u0648\u0627\u0642\u0639\u0627 \u0628\u062f \u0628\u0648\u062f \u0647\u064a\u0686 \u0645\u0632\u0647\u200c\u0627\u06cc \u0646\u062f\u0627\u0634\u062a\n\u0627\u0646\u06af\u0627\u0631 \u062f\u0627\u0631\u06cc \u062e\u0645\u06cc\u0631 \u0645\u06cc\u062e\u0648\u0631\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u0649 \u062e\u0648\u0628 \u0628\u0648\u062f \u060c \u0628\u0627 \u062a\u0634\u0643\u0631 \u0627\u0632 \u0645\u062f\u064a\u0631\u064a\u062a \u0645\u062c\u0645\u0648\u0639\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u0632\u0645\u0644", "\u06a9\u06cc\u06a9 \u062e\u0631\u0645\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0632\u062d\u0645\u0627\u062a \u0634\u0645\u0627\n\u0645\u0646 \u0646\u0627\u0646 \u0633\u0646\u062a\u06cc \u062e\u0648\u0627\u0633\u062a\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0646\u0627\u0646 \u0641\u0627\u0646\u062a\u0632\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0648\u0644\u06cc \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0627 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0645\u0646 \u0631\u0633\u06cc\u062f \u0634\u06a9\u0644 \u0638\u0627\u0647\u0631\u06cc\u0634\u0648\u0646 \u062f\u0627\u063a\u0648\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", 1]}
{"text": ["\u0627\u06cc\u0646 \u062c\u062f\u06cc\u062f\u0647 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634\u0648 \u0648\u0644 \u06a9\u0646\u0646 \u062a\u0648 \u0644\u0627\u0628\u06cc \u0628\u0631\u0646 \u0628\u0639\u062f \u0632\u0646\u06af \u0628\u0632\u0646\u0646 \u0628\u0631\u0648 \u0628\u0631\u062f\u0627\u0631\u061f\u061f\u061f\u061f\u061f\u061f\u061f\u061f\u061f \u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u0628\u0631\u0627\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0627\u062a \u062f\u0627\u06af \u067e\u0646\u06cc\u0631\u06cc", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0648\u0646 \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648\u062a\u0627\u0632\u0647  \u0641\u0642\u0637 \u06a9\u0627\u0634 \u0645\u0642\u062f\u0627\u0631 \u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0632\u062f\u0647 \u0628\u0634\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u0648\u0644\u0648 \u0628\u0648\u062f \u0627\u0648\u0646\u06cc \u06a9\u0647 \u0645\u0646 \u06af\u0631\u0641\u062a\u0646 :)) \u06cc\u0627 \u0645\u062b\u0644\u0627 \u0628\u0634\u0647 \u0645\u0642\u062f\u0627\u0631 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f \u0628\u0627 \u0633\u067e\u0627\u0633 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u0631\u0627\u0648\u06cc\u062a\u0627 \u0644\u06cc\u062f\u06cc", "\u067e\u0648\u0631\u0627\u0648\u06cc\u062a\u0627 \u0627\u0645\u06af\u06273", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u06a9\u0644\u0627\u0633\u06cc\u06a9", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u0632\u06cc\u06cc\u0646\u0634\u060c\u0634\u06a9\u0644\u0634 \u062a\u0645\u0627\u0645 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u0628\u0627\u0628 \u0627\u0633\u0641\u0646\u062c\u06cc", -1]}
{"text": ["2\u062a\u0627 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", -1]}
{"text": ["\u0636\u0639\u0641 \u0622\u0645\u0648\u0632\u0634 \u0647\u0645\u0647 \u062c\u0627 \u062f\u06cc\u062f\u0647 \u0645\u06cc\u0634\u0647 . \u0641\u0627\u0635\u0644\u0647 \u0645\u0627 \u062a\u0627 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06f2\u06f0\u06f0 \u0645\u062a\u0631 \u0646\u06cc\u0633\u062a \u0648\u0644\u06cc \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0646\u0645\u06cc \u062a\u0648\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u062a\u0648 \u0647\u0645\u06cc\u0646 \u0641\u0627\u0635\u0644\u0647 \u0633\u0627\u0644\u0645 \u0628\u0631\u0633\u0648\u0646\u0647. \u0628\u0647 \u067e\u06cc\u06a9 \u0622\u0645\u0648\u0632\u0634\u06cc \u062f\u0627\u062f\u0647 \u0646\u0634\u062f\u0647 \u06a9\u0647 \u0622\u0648\u0631\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627 \u067e\u0631\u06cc\u0646\u062a\u0631 \u0641\u0631\u0642 \u0645\u06cc \u06a9\u0646\u0647 \u0641\u0642\u0637 \u0645\u06cc \u062e\u0648\u0627\u0646 \u0633\u0631\u06cc\u0639 \u0628\u0631\u0633\u0648\u0646\u0646. \u0622\u0634 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f. \u0646\u0645\u0631\u0647 \u0635\u0641\u0631 \u0647\u0645 \u0632\u06cc\u0627\u062f\u062a\u0648\u0646\u0647 \u0628\u0627\u06cc\u062f \u06af\u0632\u06cc\u0646\u0647 \u0645\u0646\u0641\u06cc \u0647\u0645 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0631\u0627\u0646\u0646\u062f\u06af\u06cc \u0646\u0627 \u0645\u0646\u0627\u0633\u0628 \u067e\u06cc\u06a9 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647\u0627\u06cc \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u062a\u0648 \u0628\u0627\u06a9\u0633\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u06a9\u06cc\u06a9\u200c\u0647\u0627 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062f\u0631\u0633\u062a\u200c\u06a9\u0646\u0627\u0631 \u0647\u0645 \u0642\u0631\u0627\u0631 \u062f\u0627\u0634\u062a\u0646\u062f \u0627\u0645\u0627 \u0647\u0645\u0634\u0648\u0646 \u06a9\u062c \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f ! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u067e\u0648\u062f\u064a\u0646\u06af", -1]}
{"text": ["\u062a\u062d\u0648\u06cc\u0644 \u0628\u0647 \u0645\u0648\u0642\u0639\u060c\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645  \u0633\u0641\u0627\u0631\u0634\u0645\u0648 \u0628\u0639\u062f \u0627\u0632 \u062f\u0648 \u0628\u0627\u0631 \u062a\u0645\u062f\u06cc\u062f \u0632\u0645\u0627\u0646 \u0627\u0632 \u0637\u0631\u0641 \u0627\u0633\u0646\u067e \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 \u0648\u0642\u062a\u06cc \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9  \u0628\u0631\u0639\u06a9\u0633 \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0642\u06cc\u0647 \u06a9\u06cc\u06a9\u0647\u0627 \u0631\u0648 \u0647\u0645 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f. \u0648\u0627\u0642\u0639\u0627 \u062c\u0627\u06cc \u062a\u0627\u0633\u0641 \u062f\u0627\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0631\u0648 \u0646\u0627\u0628\u0648\u062f \u062a\u062d\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0647\u0645\u0647\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0648 \u062c\u0639\u0628\u0647 \u0628\u0627 \u0647\u0645 \u0642\u0627\u0637\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u0647\u0645 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", -1]}
{"text": ["\u062d\u0645\u0644 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0627\u063a\u0644\u0628 \u0645\u0648\u0627\u0642\u0639 \u0631\u0636\u0627\u06cc\u062a \u0628\u062e\u0634 \u0646\u06cc\u0633\u062a. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u0647\u0632\u0627\u0631\u0645 \u06a9\u06cc\u06a9 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0648 \u0634\u06a9\u0644 \u0628\u062f\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0647.\n\u062c\u0648\u0627\u0628 \u0627\u0633\u0646\u067e \u0647\u0645 \u06a9\u0647 \u0645\u0634\u062e\u0635 \u0627\u0633\u062a.\n\u062a\u062d\u0648\u06cc\u0644 \u06a9\u06cc\u06a9 \u0634\u0645\u0627 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0628\u0648\u062f\u0647 \u062d\u062a\u0645\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0645\u06cc\u06a9\u0646\u06cc\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u06a9\u062b\u0631\u0627 \u0628\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0646 \u06a9\u06cc\u06a9 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0627 \u062a\u0648 \u0645\u0633\u06cc\u0631 \u0645\u0634\u06a9\u0644 \u062f\u0627\u0631\u0646 \u0644\u0637\u0641\u0627 \u062a\u0630\u06a9\u0631 \u062c\u062f\u06cc \u0628\u062f\u06cc\u062f..\u0645\u0646 \u0646\u0632\u062f\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062c\u0631\u062f\u0646\u0645 \u0686\u0646\u062f \u062a\u0627 \u06a9\u0648\u0686\u0647 \u0641\u0627\u0635\u0644\u0647 \u062f\u0627\u0631\u0645 \u0647\u0645 \u06cc\u06a9\u0645 \u062a\u0627\u062e\u06cc\u0631 \u062f\u0627\u0634\u062a \u0647\u0645 \u062f\u0633\u0631\u0647\u0627 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f..\u0645\u0648\u0642\u0639 \u067e\u06cc\u0686\u06cc\u062f\u0646 \u06cc\u0627 \u0644\u0627\u0628\u0647 \u0644\u0627\u06cc \u0645\u0627\u0634\u06cc\u0646\u0627 \u067e\u06cc\u0686 \u0645\u06cc\u062e\u0648\u0631\u0646 \u062f\u0633\u0631\u0627 \u0647\u0645 \u0628\u0647\u0645 \u0645\u06cc\u062e\u0648\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627\u064b \u0644\u0647 \u0634\u062f\u0647 \u0648 \u0627\u0632 \u0638\u0627\u0647\u0631 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0634\u06a9\u0644 \u0627\u0632 \u0646\u062d\u0648\u0647 \u06cc \u062a\u062d\u0648\u06cc\u0644 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0641\u0644 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0631\u0627\u0646\u06cc \u0647\u0627\u200c \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u067e\u0627\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \u0627\u0633\u0646\u067e \u0647\u0645 \u0639\u0627\u0644\u06cc \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0643\u064a\u0643 \u0628\u0647 \u0628\u062f\u0646\u0647 \u062c\u0639\u0628\u0647 \u0628\u0631\u062e\u0648\u0631\u062f \u0643\u0631\u062f\u0647 \u0628\u0648\u062f \n\u0627\u064a\u0646 \u0643\u064a\u0643 \u0628\u0631\u0627\u064a \u062a\u0648\u0644\u062f \u062e\u0631\u064a\u062f\u0627\u0631\u064a \u0634\u062f\u0647 \n\u0648 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0645\u064a\u0628\u0627\u0634\u062f \u060c\u062f\u0631 \u0627\u0643\u062b\u0631 \u0645\u0648\u0627\u0641\u0639 \u0631\u0627\u0646\u0646\u062f\u0647 \u0647\u0627\u064a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0643\u064a\u0643 \u0647\u0627 \u0631\u0627 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u062a\u062d\u0648\u064a\u0644 \u0645\u064a\u062f\u0647\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u0633 \u0645\u0648\u0631\u0644 \u0646\u0648\u062a\u0644\u0627 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f \u0628\u0647 \u062d\u062f\u06cc \u06a9\u0647 \u062f\u0644 \u0631\u0648 \u0645\u06cc\u0632\u062f... \u067e\u0644\u0645\u0628\u06cc\u0631 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0634\u0628\u06cc\u0647 \u0639\u06a9\u0633\u0634 \u0646\u0628\u0648\u062f :/ \n\u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0647\u0631 \u062f\u0648 \u0637\u0639\u0645 \u062e\u0648\u0628 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0645\u0648\u0631\u0644 \u0646\u0648\u062a\u0644\u0627", "\u067e\u0644\u0645\u0628\u06cc\u0631 \u0644\u06cc\u0648\u0627\u0646\u06cc", 1]}
{"text": ["\u0686\u064a\u0632 \u0643\u064a\u0643 \u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", 1]}
{"text": ["\u0645\u0648\u0633 \u0645\u0648\u0631\u0644 \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f. \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0647\u0645 \u0637\u0639\u0645 \u062a\u0631\u0634\u06cc \u062d\u0633 \u06a9\u0631\u062f\u0645 \u062e\u0648\u0634\u0645 \u0646\u06cc\u0648\u0645\u062f.\u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0634\u06a9\u0644\u0627\u062a\u06cc \u0647\u0645 \u0627\u0648\u06a9\u06cc \u0628\u0648\u062f. \u067e\u0633\u062a\u0647 \u0647\u0645 \u0627\u0648\u06a9\u06cc \u0628\u0648\u062f. \u062f\u0631 \u06a9\u0644 \u06f6\u06f0 \u0627\u0632 \u06f1\u06f0\u06f0. \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0648 \u067e\u06cc\u06a9 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f. \u062f\u0631 \u0634\u06a9\u0644\u06a9\u0647\u0627 \u0641\u0642\u0637 \u0631\u0627\u0636\u06cc \u0648\u200c\u0646\u0627\u0631\u0627\u0636\u06cc \u062f\u0627\u0631\u06cc. \u0628\u062f \u0646\u06cc\u0633\u062a \u0645\u062a\u0648\u0633\u0637 \u0647\u0645 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0648\u0646\u062f\u0631 \u067e\u0633\u062a\u0647", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u0645\u0648\u0633 \u0645\u0648\u0631\u0644 \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc", "\u0645\u0648\u0633 \u0645\u0648\u0631\u0644 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", "\u0645\u0648\u0633 \u0645\u0648\u0631\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u062f\u06cc\u0632\u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u062f \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u0628\u0647 \u0646\u0638\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0647 \u0634\u062f \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0631\u062e\u0648\u0627\u0633\u062a\u06cc \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a\n\u06cc\u06a9\u06cc \u062f\u06cc\u06af\u0647 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u06a9\u0631\u062f\u0645 \u0627\u0648\u0646\u0647\u0645 \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f\n\u0645\u062c\u0628\u0648\u0631 \u0628\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0633\u0648\u0645 \u0634\u062f\u0645 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u06cc \u062a\u0627\u0628\u06cc", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u0627\u0634\u06a9\u06cc \u0645\u06cc\u0634\u062f \u0648\u0632\u0646 \u0648 \u06cc\u0627 \u0645\u0642\u062f\u0627\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f \u0686\u0648\u0646 \u0645\u062b\u0644\u0627 \u0628\u0631\u0627\u06cc \u0645\u0627 \u06a9\u0647 \u062f\u0648 \u0646\u0641\u0631\u06cc\u0645 \u0648 \u062f\u0648 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u06cc\u0645 \u0627\u06cc\u0646 \u0645\u0642\u062f\u0627\u0631 \u0648\u0627\u0642\u0639\u0627 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06af\u0631\u062f", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u06cc\u0632", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062e\u0648\u0634\u0645\u0632\u062a\u0648\u0646. \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f .\u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0627 \u0631\u0648\u06a9\u0634 \u0639\u0633\u0644\u06cc \u0631\u0646\u06af \u0637\u0639\u0645\u0634 \u06cc\u06a9\u0645 \u0628\u0647 \u062a\u0644\u062e\u06cc \u0645\u06cc\u0632\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u0627\u0641\u06cc\u0646", 1]}
{"text": ["\u0628\u0627\u0633\u0644\u0627\u0645\u060c \u0627\u06af\u0631 \u0646\u0648\u0634\u062a\u0647 \u0627\u0639\u0644\u0627\u0645\u06cc \u0631\u0648\u06cc \u062e\u0648\u062f\u06a9\u06cc\u06a9 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u062a\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0627 \u06cc\u06a9 \u0631\u0648\u0628\u0627\u0646 \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u06a9\u0647 \u0622\u0646 \u0647\u0645 \u0628\u0647 \u062c\u0627\u06cc\u06cc \u0645\u062a\u0635\u0644 \u0646\u0628\u0648\u062f \u0645\u0648\u0627\u062c\u0647 \u0634\u0648\u06cc\u0645!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u06cc\u0646\u06cc)", 1]}
{"text": ["\u06a9\u0627\u0634 \u0628\u062a\u0648\u0646\u06cc\u0645 \u0645\u062f\u0644\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u062e\u0648\u062f\u0645\u0648\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u0645\u0645 \u062a\u0648 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", -1]}
{"text": ["\u0628\u0627\u0645\u06cc\u0647 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\n\u0646\u0627\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0645\u06cc\u0647", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0647\u0645\u0647 \u0646\u0648\u0646\u0647\u0627 \u0627\u0632\u0646\u0637\u0631 \u0637\u0627\u0647\u0631\u06cc \u0648 \u0637\u0639\u0645\u200c\u062e\u0648\u0628 \u0628\u0648\u062f\u0646 \u0648\u0644\u06cc \u062a\u0641\u0627\u0648\u062a \u0645\u0639\u0646\u0627\u062f\u0627\u0631\u06cc \u0628\u06cc\u0646 \u0637\u0639\u0645 \u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0634\u062a \u0686\u0648\u0646 \u0645\u0639\u0645\u0648\u0644\u0627 \u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u062d\u062c\u0645 \u0633\u0628\u0648\u0633 \u0628\u06cc\u0634\u062a\u0631\u06cc \u062f\u0627\u0631\u0647 \u06a9\u0647 \u0637\u0639\u0645\u0634\u0648 \u062a\u063a\u06cc\u06cc\u0631 \u0645\u06cc\u062f\u0647 .\u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u0628\u0647 \u0646\u0637\u0631\u0645 \u0631\u0648\u06cc \u0646\u0627\u0646\u0647\u0627 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u067e\u062e\u062a\u0647 \u0648 \u062a\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u06af\u0631\u0686\u0647 \u0637\u0639\u0645\u200c\u0628\u0647\u062a\u0631\u06cc \u0628\u0647\u0634 \u0645\u06cc\u062f\u0647 \u0648\u0644\u06cc \u0686\u0648\u0646 \u062f\u0627\u062e\u0644\u0634 \u0646\u0631\u0645\u0647 \u0628\u0631\u0634 \u0632\u062f\u0646 \u0648 \u062a\u0647\u06cc\u0647 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0631\u0648 \u0633\u062e\u062a \u0645\u06cc \u06a9\u0646\u0647 \u0648\u062e\u0631\u062f \u0645\u06cc\u0634\u0647.\u06a9\u0627\u0634 \u06af\u0632\u06cc\u0646\u0647 \u0628\u0631\u0634 \u062f\u0631 \u062e\u0648\u062f \u06a9\u0627\u0631\u06af\u0627\u0647 \u067e\u062e\u062a \u0647\u0645 \u0627\u0636\u0627\u0641\u0647 \u0628\u0634\u0647.\u062f\u0631\u06a9\u0644  \u062e\u0648\u0634\u062d\u0627\u0644\u0645 \u0627\u0632\u06cc\u0646\u06a9\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u0633\u0631\u0639\u062a \u0627\u0645\u06a9\u0627\u0646 \u062f\u0633\u062a\u0631\u0633\u06cc \u0628\u0647 \u0686\u0646\u062f\u0646\u0648\u0639 \u0646\u0627\u0646\u200c\u062e\u0648\u0634\u0637\u0639\u0645\u200c\u0648 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u062f\u0633\u062a \u0627\u0648\u0631\u062f\u0645.\u0645\u0642\u062f\u0627\u0631\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0628\u0647 \u0646\u0637\u0631\u0645 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0631\u0627\u06cc \u0635\u0628\u062d\u0627\u0646\u0647 \u0686\u0647\u0627\u0631\u062a\u0627 \u0634\u0634 \u0646\u0641\u0631 \u06a9\u0627\u0641\u06cc \u0647\u0633\u062a \u0648\u0642\u06cc\u0645\u062a\u0647\u0627 \u0647\u0645\u200c\u0645\u0646\u0635\u0641\u0627\u0646\u0647 \u0647\u0633\u062a. \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u062a\u0646\u0648\u0639 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0627\u0632 \u0646\u0627\u0646\u0647\u0627\u06cc \u06a9\u0634\u0648\u0631\u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u0631\u0648 \u0647\u0645 \u062f\u0627\u0634\u062a\u0647\u200c\u0628\u0627\u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06af\u0631\u062f \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u06cc\u0646\u062c\u0627 \u062f\u0648\u0646\u0627\u062a\u0634 \u0639\u0627\u0644\u06cc\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u062e\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u062f\u0627\u063a \u0648 \u062a\u0627\u0632\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062d\u0627\u062c\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0637\u0639\u0645\u0634\u0648 \u062f\u0648\u0633 \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0645\u06cc\u0647", -1]}
{"text": ["\u0646\u0627\u0646 \u0631\u0698\u06cc\u0645\u06cc \u0648 \u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0631\u062f\u0648\u200c \u062f\u0633\u062a\u200c\u06a9\u0645 \u0645\u0627\u0644 \u0633\u0647 \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0648\u062f\u0646\u062f\u060c \u0628\u0633\u06cc\u0627\u0631 \u062e\u0634\u06a9 \u0648 \u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc\u0627\u062a.\n\u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e\u200c\u0641\u0648\u062f \u0647\u0645 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0645 \u06a9\u0647 \u0646\u062a\u06cc\u062c\u0647\u200c\u0627\u06cc \u0646\u062f\u06cc\u062f\u0645.\n\u0628\u0627\u0628\u062a \u062c\u0646\u0633 \u06a9\u0647\u0646\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0646\u0628\u0627\u06cc\u062f \u0627\u0632 \u0645\u0634\u062a\u0631\u06cc \u0647\u0632\u06cc\u0646\u0647\u200c\u0627\u06cc \u062f\u0631\u06cc\u0627\u0641\u062a \u0628\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0641\u062a \u06af\u06cc\u0627\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u062e\u0648\u0628 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0622\u0631\u062f \u0633\u0641\u06cc\u062f 21 \u062f\u0631\u0635\u062f (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645)", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0633\u0646\u062a\u06cc \u0686\u0627\u0628\u0627\u062a\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627\u0645\u06cc\u0647 \u0633\u0641\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u067e\u06cc\u06a9 \u0646\u0627 \u0622\u0634\u0646\u0627 \u0628\u0647 \u0645\u0633\u06cc\u0631 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0645\u06cc\u0647", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc...\u0628\u0647\u062a\u0631\u06cc\u0646 \u0646\u0627\u0646 \u062f\u0631 \u0633\u0637\u062d \u0634\u0647\u0631 \u0631\u0648 \u062f\u0627\u0631\u0647 \u0627\u06cc\u0646\u062c\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u0646 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0645\u06cc\u0647", -1]}
{"text": ["\u0639\u0627\u0644\u06cc\u2026 \u0639\u0627\u0644\u06cc\u2026\n\u062f\u0645\u062a\u0648\u0646 \u06af\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u06a9\u062b\u0631 \u0633\u0641\u0627\u0631\u0634\u0645 \u06a9\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u0633\u06cc\u0645\u06cc\u062a \u06a9\u0647 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u06cc\u0633\u062a.\n\u062c\u0627\u06cc \u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0644 \u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 \u06af\u0630\u0627\u0634\u062a\u0646\n\u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc \u0631\u0648 \u0633\u0627\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0628\u0627 \u06f2 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0627\u0646 \u067e\u0648\u0644 . \u0648\u0627\u0642\u0639\u0627 \u0632\u0634\u062a \u0628\u0648\u062f \u0627\u06cc\u0646 \u062d\u0631\u06a9\u062a\n\u06cc\u06a9 \u062a\u0645\u0627\u0633 \u0645\u06cc\u06af\u0631\u0641\u062a\u0646 \u06a9\u0646\u0633\u0644 \u0645\u06cc\u06a9\u0631\u062f\u0646 \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u06a9\u0633\u06cc \u0647\u0645 \u0646\u0627\u0631\u0627\u062d\u062a \u0646\u0645\u06cc\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0644 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u06a9\u0646\u0646\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u0634\u0648\u0646 \u0647\u0645 \u062e\u0648\u0628\u0647\u200c \u062f\u0633\u062a\u0634\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0645\u200c\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u0631\u0698\u06cc\u0645\u06cc.\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631 \u0645\u0632\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0627\u0635\u06cc \u0646\u0645\u06cc\u062f\u0627\u062f \u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u0646\u0645\u06a9 \u0646\u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648 \u0633\u0631 \u0631\u0698\u06cc\u0645\u06cc 90%", 1]}
{"text": ["\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u06cc\u0627\u062a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a \u0627\u0646\u06af\u0627\u0631 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u062f\u0631 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9 \u0642\u0631\u0627\u0631 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f \u0648 \u062e\u0645\u06cc\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0648\u06cc\u0698\u0647", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0631\u0648\u064a \u0643\u064a\u0643 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f \u062a\u0648\u064a \u0628\u0627\u0643\u0633\u0634 \u064a\u0639\u0646\u064a \u0643\u0644\u0627 \u0647\u064a\u0686 \u0645\u0627\u0631\u0645\u0627\u0644\u0627\u062f \u0648 \u0632\u0631\u0634\u0643\u064a \u0631\u0648\u064a \u0686\u064a\u0632 \u0643\u064a\u0643 \u0646\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0632 \u062c\u0639\u0628\u0647 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0632\u062f\u0647 \u0628\u0648\u062f \u0628\u064a\u0631\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", 1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u06f2 \u0633\u0627\u0639\u062a \u0648 \u06f4\u06f9 \u062f\u0642\u06cc\u0642\u0647 \u06a9\u06cc\u06a9 \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u060c \u062a\u0627\u0632\u0647 \u06af\u0641\u062a\u0646 \u06af\u0631\u0648\u0646 \u062a\u0631 \u0647\u0645 \u0647\u0633\u062a \u0628\u0642\u06cc\u0647 \u067e\u0648\u0644\u0634\u0645 \u0628\u062f\u0647. \u0648\u0642\u062a\u06cc \u0631\u0633\u06cc\u062f \u062f\u06cc\u062f\u0645 \u0627\u0634\u062a\u0628\u0627\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af \u0648\u06cc\u0698\u0647 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u062c\u062f\u06cc\u062f\u0627 \u0627\u0633\u0646\u067e \u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc\u062f\u0647 \u06cc\u0647 \u062a\u062c\u062f\u06cc\u062f \u0646\u0638\u0631 \u0628\u06a9\u0646\u0647 \u0631\u0648\u06cc \u067e\u06cc\u06a9 \u0647\u0627\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u0628\u0627\u0631 \u0642\u0628\u0644\u06cc \u06a9\u0647 \u0645\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u06af\u0631\u0641\u062a\u0645 \u060c \u06af\u0631\u0645 \u0628\u0648\u062f \n\u0627\u06cc\u0646 \u0628\u0627\u0631 \u06a9\u0647 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645 \u0633\u0631\u062f \u0628\u0648\u062f \n\n\u0645\u0646 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0631\u062f\u0645 \u06af\u0631\u0645 \u0628\u0627\u0634\u0647 . \u062d\u0633 \u0645\u06cc\u06a9\u0646\u0645 \u0628\u0627\u0631 \u0642\u0628\u0644\u06cc \u062a\u0627\u0632\u0647 \u067e\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0647 \n\u0648\u0644\u06cc \u0627\u06cc\u0646 \u0628\u0627\u0631 \u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u067e\u0648\u062f\u064a\u0646\u06af \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631\u064a\u0646 \u0643\u064a\u0643 \u0634\u0643\u0644\u0627\u062a\u064a \u0643\u0647 \u062a\u0627 \u0627\u0644\u0627\u0646 \u062e\u0648\u0631\u062f\u0645\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0645\u0631\u0628\u0627 \u0642\u06cc\u0635\u06cc \u0632\u0631\u062f\u0627\u0644\u0648 \u06a9\u0648\u0686\u06a9", "\u067e\u0627\u067e \u06a9\u06cc\u06a9", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631 \u0627\u0632 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u060c \u0633\u0627\u06cc\u0632 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647\u200c\u0627\u0634 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u0643\u0647\u0646\u0647 \u0648\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u062c\u0648\u0631\u064a \u0643\u0647 \u062e\u0627\u0645\u0647 \u0631\u0648\u064a \u0645\u064a\u0646\u064a \u0643\u064a\u0643\u0647\u0627 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0628\u0647 \u0639\u0644\u062a \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0631 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u062f\u0631\u0647\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u06a9\u0644\u0627 \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0627\u0646\u06af\u0627\u0631 \u067e\u06cc\u06a9 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0647 \u0632\u0645\u06cc\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 \u067e\u0627\u06cc\u200c\u0647\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0645\u0646 \u0645\u0634\u062a\u0631\u064a \u0647\u0645\u064a\u0634\u06af\u064a \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0647\u0633\u062a\u0645 \u0648\u0644\u064a \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u064a\u0646 \u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634\u0645 \u0648\u062d\u0634\u062a\u0646\u0627\u0643 \u0628\u062f \u0628\u0648\u062f\u060c \u0627\u0648\u0644\u0627 \u0643\u0647 \u064a\u0643 \u0633\u0627\u0639\u062a \u0648 \u0646\u064a\u0645 \u0637\u0648\u0644 \u0643\u0634\u064a\u062f \u062a\u0627 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0648 \u0627\u0632 \u0647\u0645\u0647 \u0628\u062f\u062a\u0631 \u0627\u064a\u0646\u0643\u0647 \u062a\u0645\u0627\u0645 \u0634\u064a\u0631\u064a\u0646\u064a\u0647\u0627 \u062f\u0631\u0647\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062d\u0633\u0627\u0628\u064a \u0622\u0628\u0631\u0648\u0645 \u062c\u0644\u0648\u064a \u0645\u0647\u0645\u0648\u0646\u0645 \u0631\u0641\u062a!!! \u0627\u0635\u0644\u0627 \u0627\u0646\u062a\u0638\u0627\u0631 \u0647\u0645\u064a\u0686\u064a\u0646 \u0686\u064a\u0632\u064a \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u0645!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", -1]}
{"text": ["\u0647\u0631 \u062f\u0641\u0639\u0647 \u06cc\u0647 \u0633\u0641\u0627\u0631\u0634 \u062c\u062f\u06cc\u062f \u062b\u0628\u062a \u0645\u06cc\u06a9\u0646\u0645 \u0648 \u0647\u0631\u0628\u0627\u0631 \u0639\u0627\u0644\u06cc\u062a\u0631 \u0627\u0632 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644. \u0634\u0645\u0627\u0631\u0648 \u0628\u062e\u062f\u0627\u0627\u0627\u0627 \u0645\u062b\u0644 \u0628\u0642\u06cc\u0647 \u0647\u0645\u06a9\u0627\u0631\u0627\u062a\u0648\u0646 \u06cc\u0647\u0648 \u0627\u064f\u0641\u062a \u06a9\u06cc\u0641\u06cc\u062a \u0646\u06a9\u0646\u06cc\u062f \u0648 \u0647\u0645\u06cc\u0646\u062c\u0648\u0631 \u0639\u0627\u0644\u06cc \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u06cc\u062f \u0645\u0627 \u0647\u0645 \u0644\u0630\u062a \u0628\u0628\u0631\u06cc\u0645 \u0627\u0632 \u062a\u0627\u0632\u06af\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u06af\u06cc \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u06af\u0648\u0634\u062a", 1]}
{"text": ["\u0631\u0648\u0644\u062a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0627\u0645\u06cc\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0644\u062a \u0645\u062e\u0644\u0648\u0637 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648\u0642\u062a\u06cc \u06a9\u0647 \u0622\u0648\u0648\u0631\u062f\u0646 \u0647\u0646\u0648\u0632 \u062f\u0627\u063a \u0628\u0648\u062f \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0645\u0631\u0633\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062a\u0648 \u0645\u062f\u062a \u0632\u0645\u0627\u0646 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u062a\u0627\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u0649 \u0645\u0645\u0646\u0648\u0646 \u060c \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u0644\u0647 \u0632\u0631\u062f", "\u0645\u06cc\u0646\u06cc \u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (5 \u0639\u062f\u062f)", "\u0634\u0648\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646\u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0633\u0641\u0627\u0631\u0634\u06f1\u06f5\u062f\u0642\u06cc\u0642\u0647 \u0628\u0639\u062f \u0627\u0632 \u062b\u0628\u062a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c\u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0642\u0637\u0639\u0627 \u0645\u0631\u0628\u0648\u0637 \u0628\u0647 \u0631\u0648\u0632 \u0642\u0628\u0644 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u0645\u0632\u0647 \u06af\u0627\u062a\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u062d\u06cc\u0641 \u0628\u062e\u0627\u0637\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u062f\u0627\u063a \u062a\u0648 \u06a9\u06cc\u0633\u0647 \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0628 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0648\u06a9\u0648 \u0633\u0628\u0632\u06cc", "\u0634\u0631\u0628\u062a \u062a\u062e\u0645 \u0634\u0631\u0628\u062a\u06cc \u0648 \u0646\u0639\u0646\u0627", "\u0631\u0648\u0644 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0641\u0631\u0633\u062a\u0627\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633\u062f\u0627\u0631", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06a9\u0631\u0645\u062f\u0627\u0631", 1]}
{"text": ["\u062e\u0648\u0627\u0647\u0634\u0627 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0631\u0648 \u0646\u0627\u0642\u0635 \u0627\u0631\u0633\u0627\u0644 \u0646\u06a9\u0646\u06cc\u062f \u06a9\u0644\u06cc \u0632\u0645\u0627\u0646 \u0628\u0631\u062f \u062a\u0627 \u0627\u062f\u0627\u0645\u0647 \u06cc \u0633\u0641\u0627\u0631\u0634 \u0628\u0647\u0645\u0648\u0646 \u0628\u0631\u0633\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u06cc\u0646\u06af\u0631 \u0628\u0648\u0642\u0644\u0645\u0648\u0646", -1]}
{"text": ["\u0627\u06cc\u0646 \u062f\u0648\u0645\u06cc\u0646 \u0645\u0631\u062a\u0628\u0647 \u0627\u0633\u062a \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0646\u0627\u0642\u0635 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc \u0634\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u06cc\u0646\u06af\u0631 \u0628\u0648\u0642\u0644\u0645\u0648\u0646", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062d\u062f\u0648\u062f\u0627 \u06f2 \u0633\u0627\u0639\u062a \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0628\u0631\u0633\u0647 \u0648\u0644\u06cc \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u062f\u0631 \u0627\u0633\u0631\u0639 \u0648\u0642\u062a \u0633\u0641\u0627\u0631\u0634\u0645 \u0631\u0627 \u062f\u0631\u06cc\u0627\u0641\u062a \u06a9\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0627\u0646\u062c\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627\u0633\u0644\u0627\u0645 \u0648 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f\n\u0647\u0645\u0647 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0648\u06a9\u06cc\u0632 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645 .\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062f\u06cc\u0631 \u0627\u0648\u0645\u062f \u0633\u0641\u0627\u0631\u0634\u0645 \u0627\u0644\u0628\u062a\u0647 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0646\u0648\u0646 \u0622\u0645\u0627\u062f\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062f\u0627\u063a \u0648 \u062a\u0627\u0632\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062c\u0648 80% \u062f\u0648\u062a\u0627\u06cc\u06cc", "\u062c\u0648 100% \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0633\u0645\u0628\u0648\u0633\u0647 \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646\u062f \n\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u0648\u0642\u0644\u0645\u0648\u0646 \u0648\u0627 \u0631\u0641\u062a\u0647 \u0648 \u0628\u0647 \u0646\u0638\u0631 \u06af\u0648\u062c\u0647 \u0648 \u062e\u06cc\u0627\u0631\u0634\u0648\u0631 \u062a\u0627\u0632\u0647 \u0646\u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u0698\u0627\u0645\u0628\u0648\u0646 \u0628\u0648\u0642\u0644\u0645\u0648\u0646 \u062a\u0631\u062f \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a \u06a9\u0647 \u062c\u062f\u0627\u06af\u0627\u0646\u0647 \u062e\u0648\u0631\u062f\u0645 \u0627\u0644\u0628\u062a\u0647 \u0646\u0627\u0646 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0686\u0648\u0646 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0647 \u062e\u0627\u0637\u0631 \u06af\u0648\u062c\u0647 \u0648 \u062e\u06cc\u0627\u0631\u0634\u0648\u0631 \u062e\u06cc\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f !\n\u0633\u067e\u0627\u0633 \u0627\u0632 \u0627\u0631\u0633\u0627\u0644 \u0628\u0647 \u0645\u0648\u0642\u0639 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u0648\u0642\u0644\u0645\u0648\u0646", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c \u0633\u0631\u0639\u062a \u0627\u0631\u0633\u0627\u0644 \u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0641\u0642\u0637 \u0628\u0646\u0638\u0631\u0645\u0646 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0647\u0646\u0647 \u0648 \u0645\u0648\u0646\u062f\u0647..... \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062e\u06cc\u0644\u06cc \u0686\u0631\u0628 \u0648 \u0631\u0648\u063a\u0646\u06cc.... \u0647\u06cc\u0686 \u06a9\u062f\u0648\u0645 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f \u0641\u0642\u0637 \u0637\u0639\u0645 \u0648\u0628\u0648\u06cc \u0631\u0648\u063a\u0646 \u06a9\u0647\u0646\u0647 \u0645\u06cc\u062f\u0627\u062f.. \u0647\u0645\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", -1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062c\u0648 80% \u0644\u0642\u0645\u0647", -1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639, \u062e\u0648\u0634\u0645\u0632\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a \u0648\u0644\u064a \u062e\u064a\u0644\u064a \u0637\u0648\u0644 \u0643\u0634\u064a\u062f \u062a\u0627 \u0628\u064a\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644\u0634 \u06f4\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u062f\u0631\u062c \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u067e\u0633 \u0627\u0632 \u06f2 \u0628\u0627\u0631 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0648 \u0628\u0639\u062f \u0627\u0632 \u06f2 \u0633\u0627\u0639\u062a \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f. \u0627\u0644\u0628\u062a\u0647 \u0627\u0631\u062a\u0628\u0627\u0637\u06cc \u0628\u0647 \u06a9\u0648\u06a9\u06cc\u200c\u0628\u0627\u06a9\u0633 \u0646\u062f\u0627\u0631\u062f \u0648 \u0628\u0647 \u0627\u0633\u0646\u067e\u200c\u0628\u0627\u06a9\u0633 \u0645\u0631\u0628\u0648\u0637 \u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0686\u0627\u067e\u0627\u062a\u0627 \u0643\u0645\u064a \u0627\u0641\u062a \u0643\u0631\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645\u061b\n\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0633\u0627\u06cc\u0632 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0648\u0686\u06a9 \u0634\u062f\u0647\u060c \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0642\u06cc\u0645\u062a \u0647\u0627 \u0647\u0645 \u0627\u0641\u0632\u0627\u06cc\u0634 \u062f\u0627\u0634\u062a\u0647 \u0627\u0633\u062a. \u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0648 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a\u0646\u062f. \u062a\u062d\u0648\u06cc\u0644 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0643\u0627\u0645\u0644\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u062e\u0627\u0637\u0631 \u0631\u0639\u0627\u064a\u062a \u0646\u0643\u0631\u062f\u0646 \u067e\u064a\u0643", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0631\u0633\u06cc ...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a (9 \u062a\u0627\u06cc\u06cc)", 1]}
{"text": ["\u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0644\u0630\u062a \u0628\u0631\u062f\u06cc\u0645 \u0648 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \n\u0645\u0634\u06a9\u0644 \u0627\u0635\u0644\u06cc\u0634 \u067e\u06cc\u06a9\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0627\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0686\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062a\u06a9\u0648\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648 \u062a\u0645\u0627\u0645 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0631\u0648\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0648 \u0645\u0627\u0631\u0645\u0627\u0644\u0627\u062f\u0634\u0648\u0646 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u062a\u0648 \u062c\u0639\u0628\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0647\u0631 \u06f9 \u0637\u0639\u0645\u0634 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u0647 \u0646\u0633\u0628\u062a \u062d\u062c\u0645 \u0645\u062a\u0631\u0628\u0627\u0644\u061b \u0642\u06cc\u0645\u062a\u0634 \u0628\u0627\u0644\u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u0648\u062f\u06cc\u0646\u06af \u0628\u0627 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0638\u0627\u0647\u0631\u0634 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0644\u0627\u0645\u060c\n\u0628\u0646\u0638\u0631\u0645 \u062a\u0627\u0631\u062a \u0633\u06cc\u0627\u0647 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u062e\u0634\u06a9 \u0628\u0648\u062f\u060c \u0648\u0644\u06cc \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u062f\u0642\u062a, \u0633\u0631\u0639\u062a \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u0645\u0632\u0647 \u0628\u064a \u0646\u0638\u064a\u0631 \u0627\u0645\u0627 \u062f\u0627\u062e\u0644 \u067e\u0627\u0643\u062a \u0686\u0631\u0628\u064a \u0632\u064a\u0627\u062f\u064a \u067e\u0633 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u064a\u0643\u064a \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0633\u062a \u0648\u0644\u06cc \u062d\u062c\u0645\u0634 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f :(", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06cc\u06a9 \u0628\u0627\u06a9\u0633 \u06a9\u0648\u0686\u06a9 \u0634\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0645\u0648\u0642\u0639 \u0628\u0627\u0632 \u0645\u0631\u062f\u0646 \u062a\u0645\u0627\u0645 \u0634\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0648\u06cc \u0647\u0645 \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0628\u0647 \u062c\u0627\u06cc 3 \u06a9\u0648\u06a9\u06cc 4 \u06a9\u0648\u06a9\u06cc \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646\u062f \u0628\u0647 \u0627\u0634\u062a\u0628\u0627\u0647 \u0645\u0646 \u062d\u0633\u0627\u0628\u0645\u0648 \u0634\u0627\u0631\u0698 \u0645\u06cc\u06a9\u0646\u0645 \u0645\u0628\u0644\u063a \u0631\u0648 \u0627\u0632\u0634 \u06a9\u0645 \u0628\u0641\u0631\u0645\u0627\u0626\u06cc\u0646 \u06a9\u0647 \u0645\u0634\u06a9\u0644\u06cc \u0627\u06cc\u062c\u0627\u062f \u0646\u0634\u0647 \u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", 1]}
{"text": ["\u0633\u0644\u0627\u0645\u060c\u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u064a\u060c\u0641\u0642\u0637 \u062f\u0631 \u0642\u0633\u0645\u062a \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0627\u0634\u0643\u064a \u0645\u064a\u0634\u062f \u0645\u064a\u0632\u0627\u0646 \u0648\u0632\u0646\u064a \u0648 \u0646\u0648\u0639 \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u0643\u0646\u064a\u0645\u060c\u0645\u062b\u0644\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u064a\u0645 \u0643\u064a\u0644\u0648\u064a\u064a \u0628\u0634\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0643\u0631\u062f \u0648 \u0627\u064a\u0646\u0643\u0647 \u0645\u062b\u0644\u0627 \u062f\u0631 \u0642\u0633\u0645\u062a \u062f\u0627\u0646\u0645\u0627\u0631\u0643\u064a\u060c\u0646\u0648\u0639 \u062f\u0627\u0646\u0645\u0627\u0631\u0643\u064a \u0647\u0645 \u0628\u0634\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0643\u0631\u062f..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0635\u0628\u062d\u200c\u0647\u0627 \u0647\u0645\u06cc\u0634\u0647 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u062a\u0627\u0632\u0647 \u0627\u0633\u062a \u0648 \u0639\u0627\u0644\u06cc. \u062f\u0645\u0634\u0648\u0646 \u06af\u0631\u0645\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u067e\u0627\u06cc\u06cc\u0646 \u0627\u0648\u0645\u062f\u0647\u060c\u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9\u0647 \u0648 \u0627\u0648\u0646 \u0633\u0633 \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc \u06a9\u0647 \u0642\u0628\u0644\u0627 \u062f\u0627\u0634\u062a \u06cc\u0627 \u06a9\u0645 \u0634\u062f\u0647 \u06cc\u0627 \u0627\u0635\u0644\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0645\u06cc\u0634\u0647 \u0686\u0648\u0646 \u0647\u0645\u0648\u0646 \u0628\u0627\u0639\u062b \u062a\u0631\u062f\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u06af\u06cc \u0645\u06cc\u0634\u062f\u060c\u0648 \u0628\u0647 \u062c\u0627\u0634 \u0634\u06a9\u0644\u0627\u062a \u0632\u06cc\u0627\u062f \u0634\u062f\u0647 \u06a9\u0647 \u0645\u0646 \u0646\u0645\u06cc \u067e\u0633\u0646\u062f\u0645.\u0645\u0627 \u062f\u0631 \u06a9\u0644 \u0627\u0632 \u0646\u0627\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0645 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u06cc\u0645 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0631\u06cc\u062f\u0627\u0645\u0648\u0646\u0648 \u0627\u0632 \u0627\u06cc\u0646\u062c\u0627 \u0627\u0646\u062c\u0627\u0645 \u0645\u06cc\u062f\u06cc\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u062f\u06cc\u0627\u0628\u062a \u0648 \u0686\u0631\u0628\u06cc \u0633\u0648\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0631\u0627\u0636\u06cc\u0645 ... \u0628\u0647 \u0646\u0638\u0631\u0645 \u06cc\u06a9\u06cc \u0627\u0632 \u062f\u0631\u062c\u0647 \u06cc\u06a9 \u062a\u0631\u06cc\u0646 \u0646\u0627\u0646 \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u06cc \u0627\u06cc\u0646 \u0645\u0646\u0637\u0642\u0647 \u0647\u0633\u062a\u06cc\u0646\u060c\u060c\u060c \u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0648 \u0645\u06cc\u0646\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0628\u0627\u0641\u062a \u0628\u0648\u062f\u0646 \u060c \u062e\u0645\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627 \u0647\u0645 \u06a9\u0647 \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a... \u0647\u0645\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u062a\u0648\u0646 ... \u0647\u0645\u06cc\u0634\u0647 \u0628\u062f\u0631\u062e\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u062e\u0645\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627 \u0646\u06cc\u0645\u0647 \u0622\u0645\u0627\u062f\u0647 \u0628\u0632\u0631\u06af (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0627\u0645\u0627 \u0648\u0627\u0642\u0639\u0627 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u0648 \u0628\u0627 \u0639\u0646\u0648\u0627\u0646 \u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0647\u0645\u062e\u0648\u0627\u0646\u06cc \u0646\u062f\u0627\u0634\u062a\u060c \u0648\u0627\u0642\u0639\u0627 \u0644\u0627\u0632\u0645 \u0646\u06cc\u0633\u062a \u0647\u0645\u0686\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u0627\u06cc\u0646\u0642\u062f\u0631 \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0627\u0634\u0647. \u0628\u0627 \u0645\u0642\u062f\u0627\u0631 \u062e\u06cc\u0644\u06cc \u06a9\u0645\u062a\u0631\u06cc \u0634\u06a9\u0631 \u0647\u0645 \u0627\u06cc\u0646 \u06a9\u0648\u06a9\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0647\u0627 \u0628\u062f\u0648\u0646 \u062d\u0641\u0627\u0638 \u062f\u0631 \u0646\u0627\u06cc\u0644\u0648\u0646 \u0642\u0631\u0627\u0631 \u062f\u0627\u0631\u062f \u0648 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644 \u06a9\u0627\u0645\u0644\u0627\u064b \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0627\u06af\u0631 \u062f\u0631 \u06cc\u06a9 \u0646\u0627\u06cc\u0644\u0648\u0646 \u062c\u062f\u0627\u06af\u0627\u0646\u0647 \u062f\u0631\u0628\u0633\u062a\u0647 \u0642\u0631\u0627\u0631 \u0628\u06af\u06cc\u0631\u062f \u062e\u0634\u06a9 \u0646\u0645\u06cc\u0634\u0648\u062f \u0648 \u062a\u0627\u0632\u0647 \u062a\u0631 \u0645\u06cc\u0631\u0633\u062f.\n\u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0628\u0646\u0638\u0631\u0645 \u0686\u0631\u0628 \u0628\u0648\u062f \u0648 \u0634\u0631\u064a\u0646\u064a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f:)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0633\u062a \u0648 \u062a\u0627\u0632\u0647\u060c \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0645\u06cc\u0627\u062f \u0641\u0642\u0637 \u0648\u0632\u0646\u0634 \u0646\u0632\u062f\u06cc\u06a9 \u06f3\u06f0\u06f0 \u06af\u0631\u0645 \u0647\u0633\u062a \u0648 \u0627\u0648\u0646  \u06f6\u06f5\u06f0 \u06af\u0631\u0645 \u0628\u0627\u06cc\u062f \u062a\u0635\u062d\u06cc\u062d \u0628\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u0648\u062f\u064a\u0646\u06af \u0643\u0644\u0627 \u0628\u0631\u0639\u0643\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645\u0647 \u0686\u064a\u0632\u0634 \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", -1]}
{"text": ["\u0661- \u062c\u0646\u0633 \u0628\u0627 \u062a\u0627\u062e\u064a\u0631 \u062a\u062d\u0648\u064a\u0644 \u0634\u062f\n\u0662-\u0627\u0632 \u062f\u0648 \u0642\u0644\u0645 \u062c\u0646\u0633 \u062e\u0631\u064a\u062f\u0627\u0631\u064a \u0634\u062f\u0647 \u062a\u0646\u0647\u0627 \u064a\u0643 \u0642\u0644\u0645 \u062a\u062d\u0648\u064a\u0644 \u06af\u0631\u062f\u064a\u062f !!!\n\u0663- \u0645\u0646\u062a\u0638\u0631 \u062a\u062d\u0648\u064a\u0644 \u0634\u0643\u0644\u0627\u062a \u062a\u0631\u0627\u0641\u0644 \u0645\u064a \u0628\u0627\u0634\u0645 !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", "\u0634\u0643\u0644\u0627\u062a \u062a\u0631\u0627\u0641\u0644", -1]}
{"text": ["\u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0628\u0631\u062e\u0648\u0631\u062f \u0639\u0627\u0644\u06cc \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0628\u062f \u0648 \u062d\u062a\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u062f\u0631 \u062c\u0639\u0628\u0647 \u0648 \u0628\u0647 \u0634\u062f\u062a \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0639\u0627\u0644\u064a \n\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\n\u0628\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u0634\u064a\u0643", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0647\u0645\u06cc\u0634\u0647 \u0644\u0630\u062a \u0645\u06cc\u0628\u0631\u0645 \u062a\u0627\u0632\u0647 \u0648 \u062a\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0645\u0631\u0628\u0627 \u0642\u06cc\u0635\u06cc \u0632\u0631\u062f\u0627\u0644\u0648 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0647\u0645 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0645\u0645\u0646\u0648\u0646 \u0643\u0647 \u0643\u064a\u0641\u064a\u062a \u0631\u0648 \u067e\u0627\u064a\u064a\u064a\u0646 \u0646\u0645\u064a\u0627\u0631\u064a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0642\u062f\u06cc\u0645\u06cc \u0647\u0633\u062a\u0645 \u0648 \u06a9\u0644\u0627 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc\u0627\u06cc \u062e\u0648\u0628 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0631\u0627\u0636\u06cc \u0627\u0645\u0627 \u0642\u06cc\u0645\u062a\u0627 \u0628\u0627\u0644\u0627 \u0631\u0641\u062a\u0647 \u0648 \u0628\u0639\u0636\u06cc\u0627\u0634 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634\u0645 \u0646\u0633\u0628\u062a \u0628\u0647 \u062d\u062c\u0645\u0634\u0648\u0646 \u0645\u0646\u0637\u0642\u06cc \u0646\u06cc\u0633\u062a \u06af\u0631\u0686\u0647 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u0627\u06cc\u0646 \u0635\u062d\u0628\u062a \u062a\u0627\u062b\u06cc\u0631\u06cc \u0631\u0648\u06cc \u0642\u06cc\u0645\u062a\u0627\u062a\u0648\u0646 \u0646\u0645\u06cc\u0632\u0627\u0631\u0647 \u0627\u0645\u0627 \u0628\u0627\u0632\u0645 \u0644\u0627\u0632\u0645 \u062f\u0648\u0646\u0633\u062a\u0645 \u0646\u0638\u0631\u0645\u0648 \u0628\u06af\u0645 \u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0628\u0631\u0627\u0646\u06cc \u0647\u0627 \u0645\u062e\u0635\u0648\u0635\u0627 \u067e\u06cc\u0646\u0627\u062a \u0628\u0627\u062a\u0631 \u06a9\u0627\u0645\u0644\u0627 \u0627\u0641\u062a \u06a9\u0631\u062f\u0647 \u0648 \u062f\u0631 \u062d\u062f \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0633\u0648\u067e\u0631 \u0645\u0627\u0631\u06a9\u062a \u0634\u062f\u0647 \u0648 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u0645\u0642\u0627\u06cc\u0633\u0647 \u0628\u0627 \u0642\u0628\u0644 \u0646\u06cc\u0633\u062a\n\u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0648\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a \u0639\u0627\u0644\u064a \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u062e\u0648\u0628.\n\u0645\u0631\u0633\u064a \u0627\u0632 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0639\u0632\u064a\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u062e\u064a\u0644\u0649 \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0648 \u062c\u0627 \u062f\u0627\u0631\u0647 \u0627\u0632 \u0627\u0633\u0646\u067e \u062a\u0634\u0643\u0631 \u0643\u0646\u0645 ...\n\u0643\u0631\u0627\u0633\u0627\u0646 \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u062d\u062a\u0649 \u0637\u0639\u0645 \u0633\u0648\u062e\u062a\u06af\u0649 \u0628\u0647 \u0634\u062f\u062a \u0645\u064a\u0632\u062f \u062f\u0631 \u0645\u0632\u0647 \u0648 \u062d\u062a\u0649 \u062f\u0648 \u0637\u0631\u0641 \u0643\u0631\u0627\u0633\u0627\u0646 \u0628\u0647 \u0633\u064a\u0627\u0647\u0649 \u0645\u064a\u0632\u062f.. \u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u064a\u0646 \u0647\u0645 \u0628\u0631 \u062e\u0644\u0627\u0641 \u0639\u0643\u0633 \u062e\u064a\u0644\u0649 \u0643\u0648\u0686\u064a\u0643 \u0648 \u062c\u0645\u0639 \u0648 \u062c\u0648\u0631 \u0628\u0648\u062f.. \u0686\u0627\u0628\u0627\u062a\u0627 \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a \u0645\u062e\u0635\u0648\u0635\u0627\u064b \u0633\u0628\u0648\u0633 \u062f\u0627\u0631\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0646\u0633\u0628\u062a \u0628\u0647 \u06af\u0630\u0634\u062a\u0647 \u0627\u0641\u062a \u062f\u0627\u0634\u062a\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", 1]}
{"text": ["\u0645\u06af\u0647 \u0634\u0645\u0627 \u0628\u0647 \u067e\u064a\u0643 \u0645\u0648\u062a\u0648\u0631\u064a \u0647\u0627\u062a\u0648\u0646 \u0646\u0645\u064a\u06af\u064a\u062f \u0686\u0637\u0648\u0631\u064a \u0628\u0627\u064a\u062f \u064a\u0647 \u0643\u064a\u0643 \u0648 \u0628\u064a\u0627\u0631\u0646\u062f \u0647\u0645\u0634 \u0643\u064a\u0643\u0627 \u0628\u0647\u0645 \u0645\u064a \u062e\u0648\u0631\u0647 \u062e\u0631\u0627\u0628 \u0645\u064a\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0628\u0632\u0631\u06af", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", -1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062a\u0647\u0631\u0627\u0646 \u0631\u0648 \u0634\u0645\u0627 \u062f\u0627\u0631\u06cc\u062f .\n\u067e\u0648\u062f\u06cc\u0646\u06af \u062e\u0627\u0635\u062a\u0631\u06cc\u0646 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0627\u06cc\u0647 \u06a9\u0647 \u062a\u0627 \u062d\u0627\u0644\u0627 \u062e\u0648\u0631\u062f\u0645 .\n\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0647\u0645\u06cc\u0634\u0647 \u0645\u06cc\u0686\u0633\u0628\u0647 . \u06cc\u0647 \u062a\u0631\u06a9\u06cc\u0628 \u0639\u0627\u0644\u06cc \u0627\u0632 \u0627\u0633\u0641\u0646\u062c \u0644\u0627\u06cc \u062e\u0627\u0645\u0647 \u067e\u0646\u06cc\u0631\u06cc\u0647  . \n\u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633 \u0647\u0645 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0644\u0637\u06cc\u0641 \u0648 \u0639\u0627\u0644\u06cc \u062a\u0631\u06cc\u0646 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u06cc\u062e\u0686\u0627\u0644\u06cc \u062a\u0647\u0631\u0627\u0646\u0647\n \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0635\u0628\u062d\u0648\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc\u062a\u0648\u0646 \u0631\u0648 \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0645\u0631\u0637\u0648\u0628 \u062a\u0631 \u062f\u0631\u0633\u062a \u06a9\u0646\u06cc\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f.\u0628\u0631\u0627\u06cc \u0627\u0641\u0637\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06a9 \u0641\u06cc\u0646\u06af\u0631 \u0641\u0648\u062f \u0645\u062e\u0644\u0648\u0637", "\u0635\u0628\u062d\u0627\u0646\u0647 \u0641\u06cc\u0646\u06af\u0631 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc...\u0646\u0627\u0646 \u0647\u0627 \u06cc\u06a9\u062f\u0633\u062a \u0628\u062f\u0648\u0646 \u0647\u06cc\u0686 \u0627\u06cc\u0631\u0627\u062f\u06cc....\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0645\u0644", "\u0628\u0627\u06af\u062a \u062e\u0645\u06cc\u0631 \u062a\u0631\u0634", 1]}
{"text": ["\u0645\u0646 \u062f\u0631 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f\u0645 \u062a\u0627\u0632\u0647 \u0648\u0628\u0631\u0627\u06cc \u0627\u0645\u0631\u0648\u0632 \u0628\u0627\u0634\u062f \n \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062f\u0627\u063a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f .\u0645\u0631\u0633\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u067e\u06cc\u062a\u0632\u0627 \u0648 \u0631\u0648\u0644 \u06af\u0648\u0634\u062a \u062e\u06cc\u0644\u06cc \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u0645\u0631\u063a", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0642\u0627\u0631\u0686", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u06af\u0648\u0634\u062a", "\u0645\u06cc\u0646\u06cc \u067e\u06cc\u062a\u0632\u0627\u06cc \u0633\u06cc\u0646\u0647 \u0645\u0631\u063a (\u0633\u0631\u062f)", -1]}
{"text": ["\u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0628\u0627 \u0627\u0631\u0633\u0627\u0644 \u0645\u063a\u0627\u06cc\u0631\u062a \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u0644\u0642\u0645\u0647 \u0628\u0631\u0648\u062a\u0686\u0646", -1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0628 \u0628\u0648\u062f \u0647\u0645 \u0643\u064a\u0641\u064a\u062a \u0647\u0645 \u0633\u0631\u0639\u062a \u0631\u0633\u064a\u062f\u0646 \u0627\u0633\u0646\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a", 1]}
{"text": ["\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0633\u0631\u062f \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f . \u0634\u0631\u0628\u062a \u0628\u06cc\u062f\u0645\u0634\u06a9 \u0648 \u0632\u0639\u0641\u0631\u0627\u0646 \u0647\u0645 \u0632\u0639\u0641\u0631\u0627\u0646\u06cc \u0645\u0646 \u0646\u062f\u06cc\u062f\u0645 \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0632\u06cc\u0627\u062f \u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0633\u0641\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u0631\u0628\u062a \u0628\u06cc\u062f\u0645\u0634\u06a9 \u0632\u0639\u0641\u0631\u0627\u0646", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0648\u06a9\u0648 \u0633\u0628\u0632\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0633\u0631 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc\u06af\u0627\u062a\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0628\u0631\u0627\u0646\u0686\u06cc \u0642\u0627\u0631\u0686 \u0648 \u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0645\u0686\u06a9\u0631\u0645 :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0642\u0627\u0631\u0686", "\u0634\u0631\u0628\u062a \u0628\u0647\u0627\u0631 \u0646\u0627\u0631\u0646\u062c \u0648 \u062a\u062e\u0645 \u0634\u0631\u0628\u062a\u06cc", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u06af\u0648\u0634\u062a", 1]}
{"text": ["\u06af\u0627\u062a\u0627\u0647\u0627 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u0641\u0642\u0637 \u0627\u0631\u062f \u06af\u0627\u062a\u0627 \u062f\u0631 \u0628\u0639\u0636\u06cc \u0642\u0633\u0645\u062a\u0647\u0627 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a \u062e\u0648\u0628 \u0645\u0631\u0633\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f . \u0641\u0642\u0637 \u0627\u06cc\u0646\u06a9\u0647 \u06f3 \u062a\u0627 \u0646\u0627\u0646 \u0686\u0627\u0648\u062f\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0639\u062f\u0634 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06a9\u0647 \u062f\u0648 \u062a\u0627 \u062f\u0627\u0631\u06cc\u0645 \u062c\u0627 \u0628\u0647 \u062c\u0627 \u0634\u062f . \u06a9\u0627\u0634 \u062a\u0639\u062f\u0627\u062f \u0645\u0648\u062c\u0648\u062f\u06cc \u0631\u0648 \u0647\u0645 \u062f\u0631 \u0627\u067e\u0644\u06cc\u06a9\u06cc\u0634\u0646 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0646\u06cc\u0646. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", "\u0628\u0627\u06af\u062a \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u0646\u0627\u0646 \u0633\u0648\u067e\u0631 \u0633\u064a\u0627\u0647 \u0627\u064a\u0646\u0633\u0631\u064a \u0628\u0648\u064a \u0639\u0637\u0631 \u0634\u062f\u064a\u062f\u064a \u0645\u064a\u062f\u0627\u062f \u0627\u0646\u06af\u0627\u0631 \u062f\u0633\u062a \u0639\u0637\u0631\u064a \u0628\u0647\u0634 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u060c \u0627\u0635\u0644\u0627\u064b \u0646\u0645\u064a\u0634\u062f \u062e\u0648\u0631\u062f!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0648\u067e\u0631 \u0633\u06cc\u0627\u0647", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u062a\u0633\u062a \u0686\u0627\u0648\u062f\u0627\u0631 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 :)\n\u0641\u0642\u0637 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u06cc \u0645\u0632\u0647 \u0628\u0648\u062f \u0646\u0648\u0646 \u062f\u0648\u0631\u0634 \u0645\u0632\u0647 \u0646\u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0631\u0648 \u0628\u0631\u0627\u06cc \u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u06af\u0631\u0641\u062a\u0645 \u0648\u0627\u0642\u0639\u0627 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0648\u0642\u062a\u06cc \u0628 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0647\u0646\u0648\u0632 \u062f\u0627\u063a \u0628\u0648\u062f\u060c \u0648 \u0628\u0642\u06cc\u0647 \u06cc \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0647\u0645 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062c\u0648", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0627\u0642\u0644\u0627\u0645 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u0627\u06cc\u0646 \u0645\u0648\u0636\u0648\u0639 \u0631\u0639\u0627\u06cc\u062a \u0634\u062f\u0647 \u0628\u0648\u062f\u060c\n\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644 \u0633\u0647 \u0639\u062f\u062f \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u06a9\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0648 \u0639\u062f\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u060c\u0627\u0644\u0628\u062a\u0647 \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0645 \u0648 \u0645\u0634\u06a9\u0644 \u062d\u0644 \u0634\u062f\u060c\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0647\u0645 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u062c\u0627\u0634 \u0634\u06cc\u0631\u0645\u0627\u0644 \u06a9\u0631\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u060c\u0641\u0642\u0637 \u0627\u06cc \u06a9\u0627\u0634 \u0627\u0642\u0644\u0627\u0645\u06cc \u0631\u0648 \u06a9\u0647 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u0646 \u060c\u0627\u0632 \u062f\u0633\u062a\u0631\u0633 \u062e\u0627\u0631\u062c \u06a9\u0646\u0646\u062f \u062a\u0627 \u0633\u0641\u0627\u0631\u0634 \u0645\u0634\u062a\u0631\u06cc \u0628\u0631\u0627\u06cc \u062a\u0627\u06cc\u06cc\u062f \u0634\u062f\u0646 \u062e\u06cc\u0644\u06cc \u0637\u0648\u0644 \u0646\u06a9\u0634\u0647\u060c\u067e\u0646\u062c \u0628\u0627\u0631 \u0627\u0632 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u0648 \u0686\u06cc\u0632\u06cc \u062d\u062f\u0648\u062f \u0628\u06cc\u0633\u062a \u062f\u0642\u06cc\u0642\u0647 \u0632\u0645\u0627\u0646 \u0628\u0631\u062f \u062a\u0627 \u062a\u0627\u06cc\u06cc\u062f \u0628\u0634\u0647 \u0648 \u0646\u0647\u0627\u06cc\u06cc \u0628\u0634\u0647\u060c\u0686\u0648\u0646 \u0627\u0642\u0644\u0627\u0645 \u0645\u0646\u0648 \u062a\u0648\u0646 \u0647\u0645 \u0632\u06cc\u0627\u062f\u0647 \u0648\u0642\u062a\u06cc \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u062a\u0645\u0627\u0633 \u0645\u06cc\u06af\u06cc\u0631\u0647 \u0648 \u0645\u06cc\u06af\u0647 \u062c\u0627\u06cc\u06af\u0631\u06cc\u0646 \u06a9\u0646\u0645 \u0627\u0646\u062a\u062e\u0627\u0628 \u0627\u0632 \u067e\u0634\u062a \u062a\u0644\u0641\u0646 \u062e\u06cc\u0644\u06cc \u0633\u062e\u062a \u0645\u06cc\u0634\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0628\u06cc \u0627\u062f\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u0631\u0628\u062a \u0628\u0647\u0627\u0631 \u0646\u0627\u0631\u0646\u062c \u0648 \u062a\u062e\u0645 \u0634\u0631\u0628\u062a\u06cc", "\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644", "\u0634\u0631\u0628\u062a \u0628\u06cc\u062f\u0645\u0634\u06a9 \u0632\u0639\u0641\u0631\u0627\u0646", 1]}
{"text": ["\u0646\u0627\u0646 \u062c\u062f\u064a\u062f \u0633\u0648\u067e\u0631 \u0633\u064a\u0627\u0647 \u0647\u0645 \u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0627\u0644\u064a \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", "\u0646\u0627\u0646 \u0633\u0648\u067e\u0631 \u0633\u06cc\u0627\u0647", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627", "\u0641\u06cc\u0646\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0648 \u0633\u0631 \u0648\u0642\u062a \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0647\u0627 \u062f\u0627\u0627\u0627\u0627\u063a \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u0646 \u06a9\u0647 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\n\u0648 \u0646\u06a9\u062a\u0647 \u062e\u0648\u0628 \u062f\u0631\u0628\u0627\u0631\u0647 \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648\u0647\u0627\u06cc \u0646\u0627\u0646 \u0633\u062d\u0631 \u0627\u06cc\u0646\u0647 \u06a9 \u0645\u0631\u0628\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648\u06cc\u06cc \u06a9\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u06a9\u0646\u0646 \u062a\u0631\u0634\u0647\u060c \u0648 \u0628\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0650 \u06a9\u06cc\u06a9\u060c \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0645\u06cc\u0634\u0647\n\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0648\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0631 \u062e\u0644\u0627\u0641 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0642\u0628\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627", -1]}
{"text": ["\u0627\u0632 \u0645\u062c\u0645\u0648\u0639\u0647 \u0646\u0627\u0646 \u0633\u062d\u0631 \u062a\u0648\u0642\u0639 \u062e\u06cc\u0644\u06cc \u0628\u06cc\u0634\u062a\u0631\u06cc \u062f\u0627\u0631\u06cc\u0645 . \u0627\u06af\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0645\u0634\u062a\u0631\u06cc \u0632\u06cc\u0627\u062f \u06f3 \u0628\u0627\u0631 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0628\u0627 \u0645\u0646 \u062a\u0645\u0627\u0633 \u0645\u06cc \u06af\u06cc\u0631\u0647 \u06a9\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0627\u062a\u0645\u0627\u0645 \u0645\u0648\u062c\u0648\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u0646\u0648 \u062a\u063a\u06cc\u06cc\u0631 \u0628\u062f\u0647 \u060c \u062f\u06cc\u06af\u0647  \u0646\u0628\u0627\u06cc\u062f \u0646\u0648\u0646 \u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc\u0627\u062a \u062a\u062d\u0648\u06cc\u0644 \u0628\u06af\u06cc\u0631\u0645 !!! \u0636\u0645\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0631\u0627\u06cc \u06a9\u0646\u062a\u0631\u0644 \u062f\u0627\u0626\u0645\u06cc \u0645\u0648\u062c\u0648\u062f\u06cc \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0646\u0628\u0627\u06cc\u062f \u062a\u0630\u06a9\u0631 \u0628\u062f\u0645 \u0648 \u0628\u0647 \u0632\u062d\u0645\u062a \u0628\u06cc\u0641\u062a\u0645 \u0648 \u0633\u0641\u0627\u0631\u0634\u0645\u0648 \u06a9\u0646\u0633\u0644 \u06a9\u0646\u0645 . \u06cc\u06a9\u06cc \u0627\u0632 \u0647\u0645\u0648\u0646 \u0645\u0634\u062a\u0631\u06cc \u0647\u0627\u06cc \u0632\u06cc\u0627\u062f \u0645\u0646 \u0647\u0633\u062a\u0645 \u0648 \u0633\u0648\u062f \u0628\u0627\u0644\u0627\u06cc \u0646\u0627\u0646 \u0633\u062d\u0631 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0645\u0646\u0641\u0639\u062a\u06cc \u0646\u062f\u0627\u0631\u0647 \u0648 \u0645\u0646 \u0641\u0642\u0637 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062d\u0635\u0648\u0644 \u0648 \u0645\u062f\u06cc\u0631\u06cc\u062a \u062f\u0631\u0633\u062a \u0627\u0631\u0633\u0627\u0644 \u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u062f\u0631\u062f\u0645 \u0645\u06cc \u062e\u0648\u0631\u0647 \u200c . \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0633\u062d\u0631 \u0627\u063a\u0644\u0628 \u062e\u0648\u0628 \u0628\u0648\u062f\u0647 \u0627\u0645\u0627 \u062f\u0631 \u0686\u06a9 \u06a9\u0631\u062f\u0646 \u0645\u0648\u062c\u0648\u062f\u06cc \u0648 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u06af\u0648\u06cc\u0627 \u062f\u0627\u0631\u0646 \u0645\u0631\u062a\u0628 \u0628\u06cc \u0646\u0638\u0645 \u062a\u0631 \u0645\u06cc \u0634\u0646 \u0648 \u0627\u0645\u0631\u0648\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0634\u062a . \u0634\u0627\u06cc\u062f \u0628\u0627\u06cc\u062f \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646\u0647\u0627\u06cc \u0628\u0647\u062a\u0631\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0646\u06cc\u0645 . \u0627\u0645\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0634\u0645\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0628\u0648\u0633 80%", -1]}
{"text": ["\u0631\u0627\u0646\u0646\u062f\u0647 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0627 \u06a9\u062c \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062c\u0627 \u0628\u0647 \u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648\u06cc\u06a9\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \u060c\u062f\u0631 \u062d\u0645\u0644 \u0648 \u0646\u0642\u0644 \u062f\u0642\u062a \u0646\u06a9\u0631\u062f\u0646 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062d\u0645\u0644 \u0645\u06cc\u06a9\u0646\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0642\u0646\u062f\u06cc \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0635\u0644\u0646 \u0645\u062b \u0634\u0639\u0628\u0647 \u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u06cc \u0646\u0627\u0646 \u0633\u062d\u0631 \u0646\u0628\u0648\u062f \u0648 \u06cc\u06a9\u06cc \u0627\u0632 \u06cc\u06a9\u06cc \u0628\u062f\u062a\u0631 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0646\u0648\u0634\u0627\u0628\u0647 \u06a9\u0648\u06a9\u0627", "\u0633\u0645\u0628\u0648\u0633\u0647", "\u0641\u06cc\u0646\u06af\u0631 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u0627\u0644\u0632\u0648\u0646 \u0645\u0631\u063a", -1]}
{"text": ["\u0627\u0648\u0644 \u06a9\u0647 \u0638\u0627\u0647\u0631\u0627 \u0686\u06cc\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0627\u0632 \u06cc\u062e\u0686\u0627\u0644 \u0628\u0647 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0627\u06cc\u062f \u06f4\u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0632\u0645\u0627\u0646 \u0628\u0628\u0631\u0647 \u0648 \u062f\u0631\u0633\u062a\u0634 \u0647\u0645 \u0647\u0645\u06cc\u0646\u0647!\n\u062f\u0648\u0645 \u0686\u0631\u0627 \u0627\u0646\u0642\u062f\u0631 \u0627\u0632 \u062e\u0627\u0645\u0647 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0628\u0645\u0627\u0633\u0647 \u062a\u0648 \u062f\u0647\u0646\u061f\n\u0633\u0648\u0645 \u0627\u06af\u0647 \u0646\u0645\u06cc\u062a\u0648\u0646\u06cc\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627\u062a\u0648\u0646 \u0631\u0648 \u0628\u0641\u0631\u0648\u0634\u06cc\u062f\u060c \u06a9\u0645\u062a\u0631 \u062f\u0631\u0633\u062a \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0645\u0634\u062a\u0631\u06cc \u0628\u06cc\u0686\u0627\u0631\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0647 \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0631\u0648 \u0627\u0632\u062a\u0648\u0646 \u062a\u0647\u06cc\u0647 \u0646\u06a9\u0646\u0647.\n\u0642\u0637\u0639\u0627 \u06a9\u0647 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0627\u0632 \u0634\u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u062e\u0648\u0627\u0647\u0645 \u062e\u0631\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644\u062a \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0631\u0627\u06cc \u062f\u0641\u0639\u0647 \u06cc \u0633\u0648\u0645 \u0628\u0648\u062f \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u0648\u0631\u062f \u0646\u0638\u0631\u0645 \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631 \u0645\u0646\u0648 \u0627\u062a\u0645\u0627\u0645 \u0646\u0632\u062f\u0647 \u0628\u0648\u062f\u0646\u062f .\u0648\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0637\u0644\u0627\u0639 \u0631\u0633\u0627\u0646\u06cc \u0648 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0648 \u0627\u062d\u062a\u0631\u0627\u0645 \u067e\u0631\u0633\u0646\u0644 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647", "\u06a9\u0627\u0644\u0632\u0648\u0646 \u0645\u0631\u063a", 1]}
{"text": ["\u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645 \u0648\u0644\u064a \u0633\u0641\u0627\u0631\u0634\u0645 \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0643\u0647\u0646\u0647 \u0648 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0645\u062a\u0627\u0633\u0641\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc \u0628\u0647 \u0646\u0633\u0628\u062a \u06a9\u0631\u0648\u0633\u0627\u0646 \u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u06a9\u0645 \u0645\u062e\u0644\u0641\u0627\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0641\u06cc\u0646\u06af\u0631 \u0628\u0648\u0642\u0644\u0645\u0648\u0646", "\u0641\u06cc\u0646\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647", 1]}
{"text": [" \u0628\u0633\u062a\u0647\u200c\u0628\u0646\u062f\u06cc \u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f \u0628\u0648\u062f. \u062f\u0648 \u0633\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0627\u0632 \u0628\u0648\u062f \u0648 \u062a\u0645\u0627\u0645 \u0634\u06a9\u0644\u0627\u062a\u200c\u0647\u0627 \u0628\u06cc\u0631\u0648\u0646 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062a\u062e\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0627\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0628\u0627\u0632\u0645 \u0645\u062b \u0647\u0645\u06cc\u0634\u0647 \u0633\u062d\u0631 \u0628\u0631\u0646\u062f\u0647 \u0645\u06cc\u0634\u0647 :D", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u0631\u063a", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u06cc\u0646\u06af\u0631 \u067e\u0646\u06cc\u0631\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0646\u0648\u062a\u0644\u0627 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0647 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u062f\u0631\u062d\u06cc\u0644 \u062d\u0645\u0644\n\u0627\u062d\u0633\u0627\u0633 \u0633\u0646\u06af\u06cc\u0646\u06cc \u0645\u06cc\u06a9\u0646\u06cc\u062f \u0648\u0642\u062a\u06cc \u06cc\u06a9 \u062a\u06a9\u0647 \u0645\u06cc\u0644 \u0645\u06cc\u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0628\u0632\u0631\u06af", 1]}
{"text": [" \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u062c\u0632 \u06f2 \u0645\u062f\u0644 \u0642\u0631\u0645\u0632 \u0631\u0646\u06af \u0645\u0632\u0647 \u062e\u0627\u0635\u06cc \u0646\u062f\u0627\u0634\u062a\u0646.\u06cc\u0639\u0646\u06cc \u062a\u0641\u0627\u0648\u062a \u0637\u0639\u0645 \u062d\u0633 \u0646\u0645\u06cc\u0634\u062f...\u06cc\u0639\u0646\u06cc \u0645\u0646 \u0627\u0635\u0644\u0627 \u0646\u0641\u0647\u0645\u06cc\u062f\u0645 \u0686\u0647 \u0637\u0639\u0645\u06cc \u0647\u0633\u062a\u0646 \u062d\u062a\u0627...\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628 \u0647\u0645 \u0627\u0635\u0644\u0627 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u0645 \u0645\u0632\u0647 \u0647\u0631 \u0686\u06cc\u0632\u06cc \u0645\u06cc\u062f\u0627\u062f \u063a\u06cc\u0631 \u0627\u0632 \u0633\u06cc\u0628 \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0647\u0645 \u0628\u06cc\u0627\u062a \u0634\u062f\u0647 \u0628\u0648\u062f....\u0648\u0644\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u06cc\u0646\u0647\u0627\u06cc\u062a \u0632\u06cc\u0628\u0627 \u062e\u0627\u0635 \u0628\u0648\u062f...\u0627\u06cc \u06a9\u0627\u0634 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645 \u0628\u0647 \u067e\u0627\u06cc \u0627\u06cc\u0646 \u062d\u0633\u0646 \u0633\u0644\u06cc\u0642\u0647 \u0645\u06cc\u0631\u0633\u06cc\u062f.\u062f\u0631 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u0628\u0627 \u062e\u06cc\u0627\u0644 \u0631\u0627\u062d\u062a \u0645\u06cc\u0634\u062f \u0628\u0639\u0646\u0648\u0627\u0646 \u06a9\u0627\u062f\u0648 \u06af\u0631\u0641\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u06a9\u06cc\u06a9\u200c\u0628\u0642\u062f\u0631\u06cc \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062a\u0645\u0627\u0645\u0634 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062c\u0639\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc \u0646\u0642\u0631\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u062e\u0627\u0644 \u062e\u0627\u0644\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u067e\u0646\u06cc\u0631 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0627\u0644\u0628\u062a\u0647 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0627\u0632 \u0627\u0646\u062f\u0627\u0632\u0647 \u0627\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0641\u06a9\u0631 \u0645\u06cc \u06a9\u0631\u062f\u0645 \u0628\u0627\u06cc\u062f \u0628\u0627\u0634\u0647\u060c \u0634\u0645\u0639 \u0647\u0627 \u06a9\u0648\u0686\u06a9 \u0648 \u0632\u06cc\u0628\u0627 \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0630\u0648\u0628 \u0634\u062f\u0646 \u0648 \u0631\u06cc\u062e\u062a\u0646 \u0631\u0648\u06cc \u06a9\u06cc\u06a9\u060c \u0637\u0648\u0631\u06cc \u06a9\u0647 \u0646\u0634\u062f \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u062f\u0648 \u0633\u0647 \u062a\u0627 \u0639\u06a9\u0633 \u0628\u06af\u06cc\u0631\u06cc\u0645. \u0627\u0645\u0627 \u0627\u0632 \u0647\u0645\u0647 \u0645\u0647\u0645 \u062a\u0631 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0633\u06cc\u0627\u0631 \u0645\u062d\u062a\u0631\u0645\u0627\u0646\u0647 \u0648 \u062e\u0648\u0628 \u067e\u06cc\u06a9 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0627 \u0648\u062c\u0648\u062f \u062a\u0627\u062e\u06cc\u0631 \u062f\u0631 \u062a\u062d\u0648\u06cc\u0644 \u06a9\u06cc\u06a9 \u062a\u0648\u0633\u0637 \u0642\u0646\u0627\u062f\u06cc \u0628\u0647 \u0627\u06cc\u0634\u0648\u0646\u060c \u062e\u0648\u062f\u0634\u0648\u0646 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f\u0646\u062f \u0648 \u062a\u0645\u0627\u0633 \u0647\u0645 \u06af\u0631\u0641\u062a\u0646\u062f \u062a\u0627 \u062e\u0628\u0631 \u0628\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u062f\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0647\u0641\u062a", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u0631\u0633\u0627\u0644 \u0639\u0627\u0644\u06cc \u067e\u06cc\u06a9\u062a\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0648 \u062e\u0648\u062f \u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc\u062a\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647 \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0628\u0627\u0632\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f!! \u064a\u0643\u064a \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f!!!\n\u0648\u0627\u0642\u0639\u0627 \u0627\u06af\u0647 \u0646\u0645\u064a \u062a\u0648\u0646\u064a\u062f \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648 \u062f\u0631\u0633\u062a \u062a\u062d\u0648\u064a\u0644 \u0628\u062f\u064a\u0646\u060c \u0643\u0644\u0627 \u0627\u064a\u0646 \u0643\u0627\u0631 \u0631\u0648 \u0627\u0646\u062c\u0627\u0645 \u0646\u062f\u064a\u0646 \u062e\u0628!!!!!! \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", -1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627\u060c \u0645\u062e\u0635\u0648\u0635\u0627 \u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u0628\u06cc\u0627\u062a \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u06cc\u06a9\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u0643\u064a\u0641\u064a\u062a \u062e\u0648\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646  \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0627\u0632 \u0647\u0631 \u0646\u0638\u0631 \u0639\u0627\u0644\u06cc\u060c \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0647\u0645 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627\u0633\u0644\u0627\u0645 \n\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \n\u0641\u0642\u0637 \u06cc\u0647 \u06a9\u0645 \u0642\u06cc\u0645\u062a\u0634 \u06af\u0631\u0648\u0646\u0647 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0631\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc\u0627 \u0628\u0647 \u0634\u062f\u062a \u0645\u0632\u0647 \u0645\u0648\u0646\u062f\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f \u062c\u0648\u06cc\u062f\u0647 \u0646\u0645\u06cc\u0634\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u06cc\u0634\u06cc\u0645 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0631 \u06af\u0627\u062a\u0627 \u067e\u0648\u0633\u062a \u06af\u0631\u062f\u0648 \u0648\u062c\u0648\u062f \u062f\u0627\u0634\u062a.\n\u06a9\u0644 \u0645\u062d\u062a\u0648\u06cc\u0627\u062a \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0628\u0647 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9\u06cc \u06a9\u0647 \u0632\u06cc\u0631 \u0647\u0631 \u06a9\u062f\u0627\u0645 \u0628\u0648\u062f \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648 \u0642\u0627\u0628\u0644 \u062c\u062f\u0627 \u0634\u062f\u0646 \u0647\u0645 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628", -1]}
{"text": ["\u0645\u0646 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0647\u0631 \u0647\u0641\u062a\u0647 \u06cc\u0627 \u0647\u0631 \u062f\u0648 \u0647\u0641\u062a\u0647 \u0627\u0632 \u0634\u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0645\u06cc\u06af\u06cc\u0631\u0645 \u0628\u0631\u0627\u06cc \u062e\u0648\u062f\u0645 \u0648 \u0647\u0645\u06a9\u0627\u0631\u0627\u0645 \u0648 \u0647\u0645\u0645\u0648\u0646 \u06a9\u06cc\u0641 \u0645\u06cc\u06a9\u0646\u06cc\u0645 \u0627\u0632 \u062a\u0627\u0632\u06af\u06cc \u0648 \u0645\u0632\u0647\u200c\u0634\u060c \u06a9\u06cc\u0641\u06cc\u062a\u062a\u0648\u0646 \u0645\u0633\u062a\u062f\u0627\u0645:)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0627\u06cc\u0646 \u0646\u0627\u0646 \u062c\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647. \u0647\u0645\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u0634 \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0633\u062a \u0647\u0645 \u0642\u06cc\u0645\u062a\u0634 \u0645\u0646\u0627\u0633\u0628. \u0645\u0646 \u062f\u0631 \u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0628\u0647 \u0627\u0648\u0646\u062c\u0627 \u062f\u0627\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0644 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0627\u0646\u062c\u06cc\u0631", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u062c\u06cc\u0628\u0647 \u0645\u0646 \u0686\u0646\u062f \u0631\u0648\u0632\u06cc\u0647 \u06a9 \u0628 \u062e\u0627\u0637\u0631 \u062a\u0627\u0632\u06af\u06cc \u0648 \u06a9\u06cc\u0641\u06cc\u062a\u0648 \u062d\u062c\u0645 \u06a9\u0631\u0633\u0627\u0646 \u0647\u0627 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0627\u062f\u0645 \u062d\u062a\u06cc \u0639\u06a9\u0633\u0627\u0634\u0645 \u06af\u0631\u0641\u062a\u0645 \u06a9\u0644\u06cc \u0628 \u062f\u06cc\u06af\u0631\u0627\u0646 \u062a\u0648\u0635\u06cc\u0634 \u06a9\u0631\u062f\u0645 \u0627\u0645\u0627 \u0627\u06cc\u0646\u06cc \u06a9\u0647 \u062f\u0631 \u0627\u06cc\u0646\u0628\u0627\u0631 \u0628 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0627\u0646\u06af\u0627\u0631 \u0627\u0635\u0644\u0627 \u0645\u0627\u0644 \u0627\u0648\u0646\u062c\u0627 \u0646\u06cc\u0633 \u062e\u06cc\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0641\u0631\u0642 \u0645\u06cc\u06a9\u0646\u0647 \u0636\u0639\u06cc\u06cc\u0641 \u0648 \u0627\u0635\u0644\u0627 \u0646\u0645\u06cc\u0627\u0631\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u060c \u0628\u0646\u0638\u0631\u0645 \u0634\u0645\u0627 \u0633\u0646\u06af \u0647\u0645 \u0628\u0630\u0627\u0631\u06cc\u0646 \u062a\u0648 \u062a\u0646\u0648\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u06cc\u0634\u0647 :))) \u0647\u0645\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0633\u06cc\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u0627\u0631\u06a9\u0646\u0647\u0627\u06cc \u062e\u0648\u0628\u06cc \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0639\u0636\u06cc \u0627\u0648\u0642\u0627\u062a \u06cc\u06a9\u0645\u06cc \u0645\u0648\u0646\u062f\u0633\u062a \u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u067e\u062e\u062a \u0631\u0648\u0632 \u0642\u0628\u0644 \u0647\u0633\u062a! \u0628\u0647\u062a\u0631\u0647 \u06a9\u0647 \u0631\u0648\u0632\u0627\u0646\u0647 \u067e\u062e\u062a \u0628\u0634\u0647 \u0686\u0648\u0646 \u062a\u0627\u0632\u0634 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0627\u06a9\u0644\u0631 \u06a9\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f\u060c \u0628\u0642\u06cc\u0647 \u0647\u0645 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062a\u0648 \u062d\u0645\u0644 \u062f\u0642\u062a \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0643\u064a\u0643 \u0647\u0627 \u0627\u0632 \u0641\u0631\u0645 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648\u0642\u062a\u0649 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0631\u0648\u0644 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u0648\u0642\u062a\u0649 \u062f\u0627\u062e\u0644\u0634 \u0631\u0627 \u0628\u0627 \u0645\u0648\u0627\u062f \u0633\u0627\u0646\u062f\u0648\u064a\u0686 \u067e\u0631 \u0645\u064a\u0643\u0646\u0645\u060c\u0628\u0639\u0636\u0649 \u0642\u0633\u0645\u062a\u0647\u0627\u064a\u0634 \u062a\u0631\u0643 \u0645\u064a\u062e\u0648\u0631\u062f \u0648 \u0646\u0627\u0646 \u0628\u0627\u0632 \u0645\u064a\u0634\u0648\u062f \u0643\u0647 \u0645\u062c\u0628\u0648\u0631 \u0645\u064a\u0634\u0645 \u062f\u0648\u0631 \u0646\u0627\u0646 \u0641\u0648\u064a\u0644 \u0628\u067e\u064a\u0686\u0645 \u0643\u0647 \u0645\u0648\u0627\u062f \u0627\u0632 \u067e\u0627\u0631\u06af\u064a\u0647\u0627\u0649 \u0646\u0627\u0646 \u0628\u064a\u0631\u0648\u0646 \u0646\u0631\u064a\u0632\u062f \u0648\u0627\u0644\u0628\u062a\u0647 \u0628\u0639\u0636\u0649 \u0627\u0632 \u0646\u0627\u0646 \u0647\u0627 \u0627\u064a\u0646\u062c\u0648\u0631\u0649 \u0645\u064a\u0634\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u064a\u062f.\u062e\u064a\u0644\u064a \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f\n\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u06cc\u0644\u0627\u0633 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0631\u0648\u06cc \u06a9\u06cc\u06a9\u0647\u0627\u06cc \u06a9\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648!!!!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", "\u0645\u0631\u0628\u0627 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc  \u06a9\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0628\u0631\u0627\u0646\u06cc \u0647\u0627 \u0628\u0647 \u0634\u062f\u062a \u0627\u0641\u062a \u06a9\u0631\u062f\u0647 \u060c \u0645\u062e\u0635\u0648\u0635\u0627 \u067e\u06cc\u0646\u0627\u062a \u06a9\u0647 \u0642\u0628\u0644\u0627 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0628\u0631\u0627\u0646\u06cc\u062a\u0648\u0646 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0644\u0627\u0646 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", -1]}
{"text": ["\u06cc\u06a9\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0642\u0628\u0644 \u0627\u0632\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0686\u0646\u062f \u0628\u0627\u0631 \u0686\u06a9 \u06a9\u0631\u062f\u06cc\u0645 \u0628\u0627\u0632 \u0647\u0645 \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0631\u062e\u0648\u0627\u0633\u062a\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0634\u062f\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u0646 \u0634\u062f\u0647!!!!\n\u06cc\u0639\u0646\u06cc \u067e\u06cc\u06a9 \u0646\u0628\u0627\u06cc\u062f \u062a\u0648\u062c\u06cc\u062d \u0628\u0627\u0634\u0647 \u06a9\u0647 \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0627\u06cc\u062f \u062f\u0631\u0633\u062a \u0628\u06cc\u0627\u0631\u0647 \u0648 \u0627\u06cc\u0646\u0642\u062f\u0631 \u0686\u067e \u0648 \u0631\u0627\u0633\u062a \u0646\u0631\u0647 \u06a9\u0647 \u06a9\u0647 \u06a9\u06cc\u06a9\u06cc \u0644\u0647 \u0634\u062f\u0647 \u0628\u06cc\u0627\u062f\u061f!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", -1]}
{"text": ["\u0628\u0631\u0627\u06cc \u062c\u0627\u0628\u0647 \u062c\u0627\u06cc\u06cc \u06a9\u06cc\u06a9 \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u062f \u0628\u0647 \u062c\u0627\u064a \u0686\u064a\u0632 \u0643\u064a\u0643 \u0646\u0648\u062a\u0644\u0627 \u0628\u0631\u0627\u064a \u0645\u0646 \u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u062e\u064a\u0644\u064a\u064a\u064a \u062e\u064a\u0644\u064a\u064a\u064a\u064a \u0628\u062f \u0628\u0648\u062f \u0627\u0646\u0642\u062f\u0631 \u0633\u0641\u062a \u0628\u0648\u062f \u0643\u0647 \u0646\u0645\u064a\u0634\u062f \u062e\u0648\u0631\u062f \u0645\u0632\u0647 \u0627\u0634 \u0647\u0645 \u0639\u0648\u0636 \u0634\u062f\u0647 \u0628\u0648 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0643\u0647 \u062e\u064a\u0644\u064a \u0645\u0648\u0646\u062f\u0647 \u0627\u0633\u062a  \u0645\u062a\u0627\u0633\u0641\u0646\u0647 \u0645\u0646 \u062e\u0648\u0631\u062f\u0645 \u0648 \u062d\u0627\u0644\u0645 \u0628\u062f \u0634\u062f\u0648 \u0647\u0645\u064a\u0646 \u0637\u0648\u0631 \u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647 \u0647\u0645 \u062e\u064a\u0644\u064a \u062e\u0634\u0643 \u0628\u0648\u062f \u062e\u064a\u0644\u064a \u0643\u064a\u0641\u064a\u062a \u067e\u0627\u064a\u064a\u0646 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u064a \u0646\u0628\u0648\u062f\u0645  \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0639\u06a9\u0633\u06cc \u06a9\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u067e\u06a9\u06cc\u062c \u0627\u0631\u0627\u0626\u0647 \u0634\u062f\u0647\u060c \u0646\u0645\u0627\u06cc\u0627\u0646\u06af\u0631 \u0633\u0627\u06cc\u0632 \u0648\u0627\u0642\u0639\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u0646\u06cc\u0633\u062a. \u0627\u062a\u0641\u0627\u0642\u0627\u064b \u0686\u0646\u06cc\u0646 \u0646\u0642\u0637\u0647\u200c\u0646\u0638\u0631\u06cc \u062a\u0648\u0633\u0637 \u0645\u0634\u062a\u0631\u06cc\u0627\u0646 \u062f\u06cc\u06af\u0631 \u0647\u0645 \u062a\u0627\u0628\u062d\u0627\u0644 \u062b\u0628\u062a \u06af\u0631\u062f\u06cc\u062f\u0647 \u0627\u0633\u062a \u0648 \u0628\u0646\u0638\u0631\u0645 \u0642\u06cc\u0645\u062a \u062f\u0631 \u0646\u0638\u0631 \u06af\u0631\u0641\u062a\u0647 \u0634\u062f\u0647 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u067e\u06a9\u06cc\u062c \u0646\u06cc\u0632 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u0628\u0627\u0644\u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u062e\u064a\u0644\u0649 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 3", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0635\u0628\u062d\u0627\u0646\u0647 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f. \u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u06cc\u06a9 \u062a\u06a9\u0647 \u062e\u0645\u06cc\u0631 \u0628\u0648\u062f. \u06cc\u06a9 \u062a\u06a9\u0647 \u06a9\u06cc\u06a9 \u06a9\u0648\u0686\u06cc\u06a9 \u0627\u0646\u06af\u0627\u0631 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u200c \u0648\u0632\u0646 \u062f\u0627\u0634\u062a. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0632\u06cc\u0628\u0627 \u0648 \u0628\u0627 \u0645\u0642\u0648\u0627\u06cc \u0628\u0647\u062f\u0627\u0634\u062a\u06cc \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0633\u062a\u0642\u06cc\u0645\u0627\u064b \u0631\u0648\u06cc \u0645\u0642\u0648\u0627 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u062f\u0647 \u0648 \u0632\u06cc\u0631\u0634 \u06a9\u0627\u063a\u062f \u0631\u0648\u063a\u0646\u06cc \u06cc\u0627 \u0647\u0631\u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0627\u0632 \u062a\u0645\u0627\u0633 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627 \u0645\u0642\u0648\u0627 \u062c\u0644\u0648\u06af\u06cc\u0631\u06cc \u06a9\u0646\u0647 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0634\u062a. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0633\u0627\u0644\u0645 \u0648 \u0645\u0631\u062a\u0628 \u0631\u0633\u06cc\u062f\u0646 \u0645\u0631\u0633\u06cc \u0627\u0632 \u0627\u0642\u0627\u06cc \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648\u0644\u06cc \u0637\u0639\u0645 \u06a9\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0647 \u067e\u0627\u06cc \u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628 \u0646\u0645\u06cc\u0631\u0633\u06cc\u067e", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0632\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0646\u0638\u0631 \u0645\u0646 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0645\u0633\u0627\u0641\u062a \u06a9\u0648\u062a\u0627\u0647 \u06f3 \u0647\u0632\u0627\u0631\u062a\u0648\u0645\u0646 \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f.\n\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0639\u0631\u0636 \u0633\u0644\u0627\u0645\n\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0637\u0639\u0645 \u0646\u062f\u0627\u0634\u062a\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u062f\u0631 \u0645\u0646\u0648 \u062a\u0648\u0646 \u062f\u0648\u0646\u0627\u062a \u0633\u0627\u062f\u0647 \u063a\u06cc\u0631 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0647\u0645 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u0646.\n \u0686\u0646\u062f\u06cc\u0646 \u0645\u0631\u062a\u0628\u0647 \u062d\u0636\u0648\u0631\u0627 \u0628\u0627 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0647\u0645 \u0635\u062d\u0628\u062a \u06a9\u0631\u062f\u0645 \u0648\u0644\u06cc \u062a\u0631\u062a\u06cc\u0628 \u0627\u062b\u0631 \u062f\u0627\u062f\u0647 \u0646\u0634\u062f\u0647.\n\u0645\u0645\u0646\u0648\u0646.\n\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0627\u0631\u062a \u0646\u0645\u06a9\u06cc \u0628\u0632\u0631\u06af (30 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u06cc\u062a\u0632\u0627 \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f.\n\u0641\u0642\u0637 \u062f\u0648\u0646\u0627\u062a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0645\u06cc\u0646\u06cc \u067e\u06cc\u062a\u0632\u0627\u06cc \u0645\u062e\u0644\u0648\u0637", "\u0647\u0627\u062a \u062f\u0627\u06af \u067e\u0646\u06cc\u0631\u06cc", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u0645\u0631\u063a", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u0649 \u0647\u0645\u0647 \u0634 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f \u062a\u0648 \u062c\u0639\u0628\u0647 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f \u062e\u064a\u0644\u064a \u0628\u062f \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u067e\u0648\u0631\u0627\u0648\u06cc\u062a\u0627 \u0627\u0645\u06af\u06273", 1]}
{"text": ["\u0646\u0627\u0646 \u06af\u0627\u062a\u0627\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u062a\u0627\u0642\u0628\u0644 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0633\u0648 \u062a\u0641\u0627\u0647\u0645\u06cc \u0628\u06cc\u0634 \u0646\u0628\u0648\u062f.... \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0627\u0633\u062a. \u0622\u062f\u0645 \u0645\u06cc\u062e\u0648\u0627\u062f \u0627\u0646\u0642\u062f\u0631 \u0628\u062e\u0648\u0631\u0647 \u062a\u0627 \u0628\u0645\u06cc\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0631\u0648\u06cc\u0627\u0644 \u0633\u0628\u0648\u0633", "\u062a\u0633\u062a \u0633\u0648\u06cc\u062a\u0627\u0644", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u0647\u0627\u062f\u0627\u06af\u0634 \u0633\u0631\u062e \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0632\u0647 \u062e\u0627\u0645\u06cc \u0645\u06cc\u062f\u0627\u062f.\n\u0627\u06af\u0647 \u0647\u0627\u062f\u0627\u06af \u0634\u0648\u0646 \u0631\u0648 \u0633\u0631\u062e \u06a9\u0646\u0646 \u0628\u0639\u062f \u0628\u0632\u0627\u0631\u0646 \u0644\u0627\u06cc \u0646\u0648\u0646 \u0648 \u0628\u0632\u0627\u0631\u0646 \u062a\u0648\u06cc \u0641\u0631 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0645\u06cc\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0647\u0627\u062a \u062f\u0627\u06af \u067e\u0646\u06cc\u0631\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0645\u062b\u0644 \u0627\u063a\u0644\u0628 \u0645\u0648\u0627\u0631\u062f \u0639\u0627\u0644\u06cc \u0628\u0648\u062f . \u0641\u0642\u0637 \u0686\u06a9 \u06a9\u0631\u062f\u0646 \u0645\u0648\u062c\u0648\u062f\u06cc \u0628\u0647 \u0635\u0648\u0631\u062a \u062f\u0627\u0626\u0645 \u062c\u0648\u0631\u06cc \u06a9\u0647 \u0645\u062c\u0628\u0648\u0631\u0645\u0648\u0646 \u0646\u06a9\u0646\u0646\u062f \u0633\u0641\u0627\u0631\u0634\u0645\u0648\u0646\u0648 \u062a\u063a\u06cc\u06cc\u0631 \u0628\u062f\u06cc\u0645 \u0642\u0637\u0639\u0627 \u0648\u0638\u06cc\u0641\u0647 \u0645\u062c\u0645\u0648\u0639\u0647 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0647\u0633\u062a . \u0644\u0637\u0641\u0627 \u062f\u0642\u062a \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0628\u0631\u0628\u0631\u06cc", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u062a\u0627\u0632\u0647 \u0648\u06af\u0631\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u0627\u06cc \u0686\u0646\u062f\u0645\u06cc\u0646 \u0628\u0627\u0631 \u0647\u0633\u062a \u06a9\u0647 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0634\u0639\u0628\u0647 \u0645\u0631\u0632\u062f\u0627\u0631\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0641\u0631\u0627\u0648\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u0647\u060c \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0647\u0633\u062a \u0648\u0644\u06cc \u062e\u0648\u0628 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f\u06cc \u062f\u0627\u0631\u0647 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0628\u06cc\u0641 \u0627\u0633\u0645\u0648\u06a9\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645\u062f\u0627\u0631", "\u0633\u0627\u062f\u0647", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u06cc\u0646\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0643\u064a\u0643 \u0634\u0643\u0644\u0627\u062a \u062a\u0644\u062e \u0645\u0634\u062e\u0635\u0647 \u062a\u0627\u0632\u0647 \u0646\u064a\u0633\u062a. \u06af\u0648\u064a\u0627 \u0635\u0631\u0641\u0627 \u0643\u064a\u0643 \u067e\u0646\u064a\u0631 \u0631\u0648\u0632 \u067e\u062e\u062a\u0647\u061f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e \u0646\u06cc\u0645 \u06a9\u0644\u0648", "\u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", -1]}
{"text": ["\u0645\u062b \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0645\u0631\u0633\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u06cc\u0646\u06cc \u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u062a\u0627\u062e\u064a\u0631 \u062f\u0631 \u062a\u062d\u0648\u064a\u0644 \u0633\u0641\u0627\u0631\u0634 \u0648\u0627\u0642\u0639\u0627\u064b \u0645\u0627\u064a\u0647 \u062a\u0627\u0633\u0641 \u0627\u0633\u062a. \u0628\u062e\u062f\u0627 \u0642\u0633\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0647 \u0628\u0631\u0627\u064a \u0645\u0627 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f \u0661 \u0643\u064a\u0644\u0648 \u0646\u0628\u0648\u062f! \u0631\u0648\u064a \u062c\u0639\u0628\u0647 \u067e\u0631 \u0628\u0648\u062f \u0627\u0632 \u0686\u0633\u0628 \u0646\u0648\u0627\u0631\u064a! \u062f\u0631\u0628 \u0643\u0627\u0631\u062a \u062c\u0639\u0628\u0647 \u062e\u0648\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0643\u0627\u0645\u0644\u0627\u064b \u0645\u0634\u062e\u0635 \u0628\u0648\u062f\u0634\u064a\u0631\u0633\u062a\u064a \u0647\u0627\u064a \u062f\u0627\u062e\u0644\u0634 \u0631\u064a\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f. \u0627\u0632 \u062e\u0631\u064a\u062f\u0645 \u067e\u0634\u064a\u0645\u0627\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u0628\u0627 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0645\u0631\u0632\u062f\u0627\u0631\u0627\u0646 \u0645\u0634\u06a9\u0644 \u0639\u062f\u0645 \u0645\u0648\u062c\u0648\u062f\u06cc \u0628\u0639\u062f \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u06cc\u0627  \u0645\u0634\u06a9\u0644\u0627\u062a \u062f\u06cc\u06af\u0647 \u0627\u06cc \u0628\u0639\u062f \u0627\u0632 \u067e\u0631\u062f\u0627\u062e\u062a \u0648 \u0639\u062f\u0645 \u0647\u0645\u06a9\u0627\u0631\u06cc \u0631\u0648 \u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0641\u06cc\u0646\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647", "\u0641\u06cc\u0646\u06af\u0631 \u0628\u0648\u0642\u0644\u0645\u0648\u0646", "\u0646\u0648\u0634\u0627\u0628\u0647 \u0641\u0627\u0646\u062a\u0627", "\u067e\u0627\u06cc \u06a9\u0631\u0645", -1]}
{"text": ["\u0645\u0646 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0648 \u062f\u0648\u0633 \u062f\u0627\u0631\u0645 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u062f\u0644\u0646 \u06a9\u0631\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u0648\u0633 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0642\u06cc\u0645\u062a \u0627\u0633\u0646\u067e \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0645\u0633\u06cc\u0631 \u0627\u0641\u0632\u0627\u06cc\u0634 \u0632\u06cc\u0627\u062f\u06cc \u062f\u0627\u0634\u062a\u0647. \u0648\u0627\u0642\u0639\u0627\u064b \u062f\u0627\u0631\u0647 \u063a\u06cc\u0631\u0645\u0646\u0637\u0642\u06cc \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644", "\u06a9\u0627\u0644\u0632\u0648\u0646 \u0645\u0631\u063a", 1]}
{"text": ["\u0645\u0646 \u0642\u0628\u0644\u0627 \u0647\u0645 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0647\u064a\u0647 \u0643\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648 \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u0634\u0648\u0646 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u0648\u0644\u064a \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0645\u0631\u0648\u0632 \u0647\u064a\u0686\u0643\u062f\u0648\u0645 \u0627\u0632 \u0627\u0642\u0644\u0627\u0645\u064a \u0643\u0647 \u0628\u0631\u0627\u064a \u0645\u0646 \u0627\u0631\u0633\u0627\u0644 \u0643\u0631\u062f\u0646\u062f \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e \u0646\u06cc\u0645 \u06a9\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062a\u062e\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u062f\u0642\u062a \u0641\u0642\u0637 \u0686\u0648\u0646 \u0633\u0641\u0627\u0631\u0634 \u0627\u06cc\u0646\u062a\u0631\u0646\u062a\u06cc \u0647\u0633\u062a \u0648 \u062f\u06cc\u062f\u0647 \u0646\u0645\u06cc\u0633\u0647 \u06a9\u0647 \u0646\u0638\u0631\u06cc \u0631\u0627\u062c\u0639\u0628\u0634 \u062f\u0627\u062f\u0647 \u0628\u0634\u0647 \u0644\u0637\u0641\u0627 \u062e\u0648\u062f\u062a\u0648\u0646 \u0632\u062d\u0645\u062a \u062a\u0632\u06cc\u06cc\u0646 \u0628\u0627 \u067e\u0648\u062f\u0631\u0627\u06cc \u0631\u0646\u06af\u06cc\u062a\u0648\u0646\u0648 \u0628\u06a9\u0634\u06cc\u062f \u0648 \u0641\u0642\u0637 \u0628\u0627 \u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a \u062e\u0627\u0644\u06cc \u0627\u0631\u0633\u0627\u0644 \u0646\u0641\u0631\u0645\u0627\u06cc\u06cc\u062f   ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 500 \u06af\u0631\u0645", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0628\u06cc\u0636\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0633\u06cc\u0628 \u0648 \u0647\u0648\u06cc\u062c \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0633\u0641\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f.\n\u0648\u0644\u06cc \u06a9\u0631\u0645 \u0631\u0648\u0634 \u0648\u0627\u0642\u0639\u0627 \u0637\u0639\u0645 \u0632\u0631\u0634\u06a9 \u0631\u0648 \u0628\u0647\u0634 \u0646\u0645\u06cc\u062f\u0627\u062f \u0648 \u0645\u0632\u0647 \u06a9\u0645\u06cc \u062f\u0627\u0634\u062a.\n\u0648 \u0627\u06cc\u0646\u06a9\u0647 \u06a9\u06cc\u06a9 \u0645\u0646 \u06cc\u06a9\u0645 \u0622\u0633\u06cc\u0628 \u062f\u06cc\u062f\u0647 \u0628\u0648\u062f \u0648\u0642\u062a\u06cc \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u06cc\u0647 \u0646\u0641\u0631 \u0628\u0627\u0647\u0627\u0634 \u0633\u06cc\u0631 \u0645\u06cc\u0634\u0647 \u0648\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0647 \u0634\u062f\u062a \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0637\u0639\u0645 \u0648 \u0645\u0632\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0648\u0647\u0645\u0686\u0646\u06cc\u0646  \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u06cc\u06a9\u062a\u0648\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u0631\u0648 \u062f\u0645\u0631 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0631 \u0645\u0631\u062d\u0644\u0647 \u062d\u0645\u0644 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0639\u062f\u0645 \u062a\u0648\u062c\u0647 \u067e\u06cc\u06a9\u060c \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644 \u0686\u067e \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0627\u0632 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u0647\u0627\u06cc \u0638\u0631\u0641 \u0627\u0646\u062a\u0642\u0627\u0644 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f\u060c  \u062e\u0645\u06cc\u0631 \u0633\u0641\u062a \u0648 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0631\u062f \u0645\u06cc\u0634\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u060c \u0648\u0644\u06cc \u0645\u06cc\u0634\u062f \u06a9\u0647 \u062a\u0627\u0632\u0647\u200c\u200c\u062a\u0631 \u0628\u0627\u0634\u0647\n\u0648\u0644\u06cc \u0628\u0647 \u0634\u062f\u062a \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645 \u060c \u0628\u0627 \u06cc\u06a9 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0661\u0660 \u062a\u0627\u0632\u0643\u0648\u0643\u064a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u064a\u0643\u064a \u0627\u0632 \u064a\u0643\u064a \u0645\u0648\u0646\u062f\u0647 \u062a\u0631 \u0648 \u062e\u0634\u0643 \u062a\u0631 !\u0627\u06af\u0647 \u0627\u062f\u0639\u0627 \u062f\u0627\u0631\u064a\u062f \u0645\u0648\u0627\u0631\u062f\u064a \u0643\u0647 \u0641\u0631\u0648\u062e\u062a\u0647 \u0646\u0645\u064a \u0634\u0647 \u0631\u0648 \u0627\u0646\u062a\u0647\u0627\u064a \u0631\u0648\u0632 \u064a\u0627 \u0646\u0647\u0627\u064a\u062a\u0627 \u0631\u0648\u0632 \u0628\u0639\u062f \u0628\u0631\u064a\u0632\u064a\u062f \u062f\u0648\u0631 \u062a\u0648\u0639\u064a\u0646 \u0628\u0647 \u0645\u0634\u062a\u0631\u064a\u0647 \u0627\u064a\u0646 \u0643\u0627\u0631 \u060c ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u0627\u0646\u06af\u0627\u0631 \u062e\u0645\u06cc\u0631 \u06a9\u06cc\u06a9 \u06cc\u0647 \u0647\u0641\u062a\u0647 \u062a\u0648 \u06cc\u062e\u0686\u0627\u0644 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0639\u0627\u0627\u0644\u064a\u064a\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0645\u0627 \u0634\u0628 \u062a\u0648\u0644\u062f \u067e\u062f\u0631\u0645\u0647 \n\u06a9\u06cc\u06a9 \u06cc\u06a9 \u0637\u0631\u0641\u0634 \u06a9\u0627\u0645\u0644 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u062c\u0639\u0628\u0647 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u06a9\u0647 \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u062e\u0631\u0645\u0627", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", -1]}
{"text": ["\u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u0627\u0631\u0647 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc \u0646\u0642\u0631\u0647 \u0627\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0646\u062f\u0627\u0632\u0647 \u0622\u0646\u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f\n\u0628\u0627 \u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u06cc\u062a\u0648\u0646\u0633\u062a \u062a\u0627\u0632\u0647 \u062a\u0631\u0645 \u0628\u0627\u0634\u0647 \u0627\u0646\u06af\u0627\u0631 \u0645\u062b\u0644\u0627 \u0628\u0631\u0627\u06cc \u062f\u06cc\u0631\u0648\u0632 \u0628\u0648\u062f \u0627\u0645\u0627 \u0628\u0627\u0632\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u062f\u0631 \u06a9\u0644 \u0645\u0645\u0646\u0648\u0646 :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u060c \u0646\u0627\u0646 \u0647\u0627 \u062a\u0627\u0632\u0647\u060c \u0627\u0631\u0633\u0627\u0644 \u062f\u0642\u06cc\u0642", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u06cc\u06a9\u0627\u0634 \u0632\u0645\u0627\u0646 \u0628\u0646\u062f\u06cc \u062f\u0642\u06cc\u0642 \u0628\u0627\u0634\u062f \u062a\u0627 \u0628\u0634\u0648\u062f \u0628\u0631\u0646\u0627\u0645\u0647 \u0631\u06cc\u0632\u06cc \u06a9\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0634\u0627\u062a\u0648\u062a", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u060c \u0627\u0644\u0628\u062a\u0647 \u0627\u0635\u0644\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0627\u06af\u0631 \u06a9\u06cc\u06a9\u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062f\u0627\u063a \u0628\u0627\u0634\u062f \u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u060c \u06a9\u06cc\u06a9 \u062d\u0627\u0644\u062a \u062e\u0645\u06cc\u0631\u06cc \u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0645\u0632\u0647 \u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc \u0646\u0645\u06cc\u062f\u0627\u062f\n\u0648 \u0627\u0635\u0648\u0644\u0627 \u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc \u062a\u0647 \u0645\u0632\u0647 \u062a\u0631\u0634\u06cc \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \n\u062f\u06cc\u06af\u0647 \u0646\u0627\u0646\u0648\u0627\u06cc\u06cc \u0647\u0645 \u0646\u0645\u06cc\u0631\u06cc\u0645 :))", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0627\u0635\u0641\u0647\u0627\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0648\u200c\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0647\u0645 \u067e\u06cc\u06a9 \u0633\u0631\u06cc\u0639 \u0627\u0648\u0645\u062f \u0648 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u060c \u062a\u0645\u0627\u0645 \u0646\u0627\u0646 \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647...\n\u062f\u0631 \u0636\u0645\u0646 \u0628\u0627 \u0648\u062c\u0648\u062f \u0628\u0627\u0644\u0627 \u0628\u0648\u062f\u0646 \u062d\u062c\u0645 \u0633\u0641\u0627\u0631\u0634\u0645\u060c \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062f\u0631\u0633\u062a \u0648 \u062f\u0642\u06cc\u0642 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u0627\u06cc \u0642\u0632\u0648\u06cc\u0646", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u06cc\u0646 \u0648 \u0632\u06cc\u0628\u0627 \u0648 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u0648\u0646\u062f\u06cc\u0646. \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0644\u0637\u0641\u0627\u064b \u0627\u0632 \u067e\u06cc\u06a9\u062a\u0648\u0646 \u0628\u062e\u0648\u0627\u06cc\u0646 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0631\u0648 \u0622\u0631\u0648\u0645 \u0628\u06cc\u0627\u0631\u0647\u060c \u0627\u0644\u0627\u0646 \u0627\u06cc\u0646 \u0645\u06cc\u0646\u06cc \u0628\u0627\u06a9\u0633 \u0647\u06cc\u0686\u06cc\u0634 \u0633\u0631 \u062c\u0627\u0634 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", 1]}
{"text": ["\u0628\u0627\u0628\u0627 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647\u200c\u0633\u062a. \u06a9\u0627\u0634 \u0642\u06cc\u0645\u062a\u0634 \u062c\u0648\u0631\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0628\u0634\u0647 \u0628\u06cc\u0634\u062a\u0631 \u062e\u0631\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0647\u0633\u062a \u0648\u0644\u06cc \u067e\u0627\u06cc \u0633\u06cc\u0628 \u062e\u0645\u06cc\u0631\u0634 \u0645\u062b\u0644 \u0642\u0628\u0644 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u062a\u0648\u0633\u0637 \u062f\u0631  \u062c\u0639\u0628\u0647 \u0628\u0632\u0631\u06af \u0622\u0648\u0631\u062f\u0647 \u0634\u062f \u06a9\u0647 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0648 \u0627\u0646\u0627\u0631 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0645\u0646 \u06f1\u06f0 \u062a\u0627 \u06a9\u0648\u06a9\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u06f5 \u062a\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u0644\u0637\u0641\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0627\u0646\u0627\u0631 \u0645\u062a\u0648\u0633\u0637", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\n\u0637\u0639\u0645 \u0648 \u062d\u062c\u0645 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0646\u0627\u0633\u0628 \u0627\u0633\u062a \u0648 \u0628\u0647 \u0644\u062d\u0627\u0638 \u063a\u0630\u0627\u06cc\u06cc\u060c \u0628\u0633\u06cc\u0627\u0631 \u0633\u0646\u06af\u06cc\u0646 \u0648 \u067e\u0631\u06a9\u0627\u0644\u0631\u06cc \u0627\u0633\u062a.\n\u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0647\u0645 \u0628\u0627\u0628\u062a \u0627\u0646\u062a\u0642\u0627\u0644 \u0633\u0627\u0644\u0645 \u06a9\u06cc\u06a9 \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u06a9\u06cc\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0628\u0631\u0627\u06cc \u062a\u0648\u0644\u062f \u0627\u0633\u062a \u062f\u0631 \u0647\u0646\u06af\u0627\u0645 \u062d\u0645\u0644 \u0647\u06cc\u0686\u06af\u0648\u0646\u0647 \u0627\u062d\u062a\u06cc\u0627\u0637\u06cc \u0635\u0648\u0631\u062a \u0646\u06af\u0631\u0641\u062a\u0647 \u0648 \u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u062c\u0639\u0628\u0647 \u06a9\u06cc\u06a9 \u067e\u0627\u0631\u0647 \u0634\u062f\u0647 \u062e\u0648\u062f \u06a9\u06cc\u06a9 \u0647\u0645 \u062f\u0686\u0627\u0631 \u0632\u062f\u06af\u06cc \u0634\u062f\u0647 . \u0645\u062a\u0627\u0633\u0641\u0645 \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0633\u0647", "\u0634\u0645\u0639 \u0647\u0641\u062a", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0634\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f\n\u062f\u0631 \u0631\u0627\u0647 \u0628\u0627 \u062f\u0642\u062a \u062d\u0645\u0644 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0645\u0627\u0644\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0648 \u0639\u0645\u0644\u0627 \u062f\u0648\u0631 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647\n\u06a9\u0627\u0634 \u0627\u0639\u062a\u0645\u0627\u062f \u0645\u0634\u062a\u0631\u06cc \u0631\u0648 \u062e\u0631\u0627\u0628 \u0646\u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0635\u0628\u062d \u0645\u0642\u062f\u0627\u0631 \u0632\u06cc\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0648\u0686\u06a9 \u067e\u06cc\u0634 \u0633\u0641\u0627\u0631\u0634 \u0627\u0646\u062c\u0627\u0645 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u0647\u0645\u0647 \u0645\u0648\u062c\u0648\u062f \u0628\u0648\u062f \u0648 \u062b\u0628\u062a \u0634\u062f \u0648 \u067e\u0648\u0644 \u0631\u0627 \u0647\u0645 \u0627\u0646\u0644\u0627\u06cc\u0646 \u067e\u0631\u062f\u0627\u062e\u062a \u06a9\u0631\u062f\u0645 . \n\u0634\u0628 \u0645\u06cc\u0647\u0645\u0627\u0646 \u062f\u0627\u0634\u062a\u0645 \u0648 \u062f\u0631\u0633\u062a \u0645\u0648\u0642\u0639\u06cc \u06a9\u0647 \u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0628\u0631\u0633\u062f \u060c \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0632\u0646\u06af \u0632\u062f\u0646 \u0648 \u06af\u0641\u062a\u0646 \u0628\u0628\u062e\u0634\u06cc\u062f \u0627\u0632 \u06f4 \u0642\u0644\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0634\u0645\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u062f \u060c \u0633\u0647 \u0642\u0644\u0645 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u060c \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0645\u06cc\u062e\u0648\u0627\u06cc\u062f \u06cc\u0627 \u067e\u0648\u0644 \u0631\u0648 \u067e\u0633 \u0628\u062f\u0645 \u061f \u0645\u0646 \u0628\u0631\u0627\u06cc \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc \u0627\u0648\u0646\u0634\u0628 \u0628\u0647 \u0645\u0634\u06a9\u0644 \u0632\u06cc\u0627\u062f\u06cc \u0628\u0631\u062e\u0648\u0631\u062f\u0645 . \u0627\u06af\u0631 \u0646\u0645\u06cc\u062a\u0648\u0627\u0646\u06cc\u062f \u0628\u0631\u0627\u06cc \u067e\u06cc\u0634 \u0641\u0631\u0648\u0634 \u0628\u0631\u0646\u0627\u0645\u0647 \u0631\u06cc\u0632\u06cc \u06a9\u0646\u06cc\u062f \u0644\u0637\u0641\u0627\u064b \u06af\u0632\u06cc\u0646\u0647 \u0627\u0634 \u0631\u0627 \u0628\u0631\u062f\u0627\u0631\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0643\u0647 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f . \u0641\u0642\u0637 \u0643\u064a\u0643 \u0647\u0627 \u0648\u0642\u062a\u064a \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0628\u0631\u0639\u0643\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062a\u0645\u0627\u0645 \u062e\u0627\u0645\u0647 \u0648 \u0645\u062d\u062a\u0648\u064a\u0627\u062a \u0631\u0648\u064a \u0643\u064a\u0643 \u0627\u0632 \u0643\u064a\u0643 \u062c\u062f\u0627 \u0634\u062f\u0647 \u0648 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u064a\u062f\u0647 \u0628\u0648\u062f . \u0648\u0642\u062a\u064a \u0646\u0638\u0631\u0633\u0646\u062c\u064a \u0647\u0627 \u0631\u0627 \u0645\u064a \u062e\u0648\u0627\u0646\u062f\u0645 \u0628\u0647 \u0646\u0638\u0631 \u0645\u064a \u0631\u0633\u064a\u062f \u0643\u0647 \u0627\u0643\u062b\u0631 \u0627\u0641\u0631\u0627\u062f \u0627\u064a\u0646 \u0645\u0634\u0643\u0644 \u0631\u0627 \u062f\u0627\u0634\u062a\u0647 \u0627\u0646\u062f \u0648 \u0627\u0643\u0633\u067e\u0631\u0633 \u0647\u064a\u0686 \u062a\u063a\u064a\u064a\u0631\u064a \u0635\u0648\u0631\u062a \u0646\u062f\u0627\u062f\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0686\u0642\u062f \u067e\u06cc\u06a9 \u0628\u0627 \u0634\u062e\u0635\u06cc\u062a \u0648 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f . \u0648 \u0686\u0642\u062f\u0631 \u0628\u0627 \u0627\u062d\u062a\u06cc\u0627\u0637 \u0627\u0648\u0645\u062f\u0647 \u0628\u0648\u062f . \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a\u060c \u0647\u0645 \u0632\u0645\u0627\u0646 \u0631\u0633\u06cc\u062f\u0646\u060c \u0647\u0645 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0648 \u0647\u0645 \u0646\u062d\u0648\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0633\u0641\u0627\u0631\u0634 \u0628\u06cc \u0646\u0642\u0635 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647 \u0627\u0635\u0644\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f \u0647\u06cc\u0686 \u0645\u0632\u0647 \u0627\u06cc \u0646\u062f\u0627\u0634\u062a\n\u0648\u0644\u06cc \u0628\u0631\u0639\u06a9\u0633 \u06af\u0627\u062a\u0627 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0647\u0645\u0647 \u0646\u0648\u0646 \u0647\u0627 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0628\u062c\u0632 \u062a\u0633\u062a \u0633\u0648\u064a\u062a\u0627\u0644 \u0643\u0647 \u0643\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u0647\u062f \u0647\u0645 \u0646\u062f\u0627\u0634\u062a!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0646\u0639\u0644 \u0627\u0633\u0628\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u062b\u0645\u06cc\u0646", "\u062a\u0633\u062a \u0633\u0648\u06cc\u062a\u0627\u0644", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0648\u06a9\u0648 \u0633\u06cc\u0628 \u0632\u0645\u06cc\u0646\u06cc", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0634\u06cc\u0631\u0645\u0627\u0644\u0647 \u0633\u0641\u062a\u0647 \u0634\u0628\u06cc\u0647 \u0628\u0647 \u0628\u0631\u0628\u0631\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062c\u0648\u06cc\u062f\u0646\u0634 \u0627\u0648\u0646 \u0631\u0648 \u0627\u0632 \u062e\u0648\u0631\u062f\u0646 \u0645\u0646\u0635\u0631\u0641 \u0645\u06cc\u06a9\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", -1]}
{"text": ["\u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c -\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647- \u062a\u0627\u0632\u0647 \u062a\u0631 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0632\u062f\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0641\u0627\u0646\u062a\u0632\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645\u060c\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c\u200c\u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u0628\u0644 \u0634\u064a\u0631\u0647\u200c\u0634 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\n\u0628\u0639\u062f \u062e\u064a\u0644\u064a \u0645\u0646\u062a\u0638\u0631 \u0627\u0648\u0646 \u06af\u0648\u0634\u0641\u064a\u0644\u0627 \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0627\u0648\u0646\u0645 \u0628\u0631\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0628\u0647 \u0646\u0627\u0645 \u067e\u0627\u0633\u062f\u0627\u0631\u0627\u0646....\n\u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644 \u0645\u0627\u0646\u062f \u0647 \u0648 \u0628\u062f \u0637\u0639\u0645 \u0648 \u062f\u0627\u063a\u0648\u0646\u060c \u0646\u0627\u0646 \u0628\u0631\u06af\u0631 \u0628\u06cc\u0627\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0633\u0628\u0648\u0633", "\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644", -1]}
{"text": ["\u0645\u0646 \u0627\u0644\u0627\u0646 \u0686\u0646\u062f \u0628\u0627\u0631\u06cc \u0645\u06cc\u0634\u0647 \u0627\u0632 \u0646\u0627\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u0645\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u0634\u0648\u0646 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc\u0647\u060c \u0645\u062e\u0635\u0648\u0635\u0627 \u0644\u0642\u0645\u0647 \u0647\u0627\u06cc \u0633\u0628\u0648\u0633\u060c \u0627\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u0627\u0648\u0644 \u0631\u0648\u0644 \u0686\u0627\u06cc\u06cc \u0647\u0645 \u06af\u0631\u0641\u062a\u0645 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u0647\u0645\u0647\u200c\u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f .\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0641\u0631\u0646\u06cc \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0631\u0646\u06cc", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u0634\u0644\u0647 \u0632\u0631\u062f", 1]}
{"text": ["\u0628\u0631\u0627\u0646\u0686\u06cc \u0645\u0631\u063a \u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06af\u0631\u062f\u0648", "\u0628\u0631\u0627\u0646\u0686\u06cc \u0645\u0631\u063a", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u060c \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u060c \u0641\u0642\u0637 \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u06cc\u0647 \u06a9\u0645 \u0627\u0646\u06af\u0627\u0631 \u0686\u0631\u0628 \u0628\u0648\u062f\u060c \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0639\u062f\u0627\u062f\u0634 \u06af\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0637\u0639\u0645 \u0648 \u0643\u064a\u0641\u064a\u0627 \u0634\u064a\u0631\u064a\u0646\u064a \u0648 \u0632\u0648\u0644\u0628\u064a\u0627\u0648 \u0647\u0645 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632 \u0627\u0632 \u0646\u0638\u0631 \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0636\u0639\u06cc\u0641 \u0627\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0634\u062f\u062a \u062e\u0634\u06a9 \u0628\u0648\u062f.\u0634\u0644\u0647 \u0632\u0631\u062f \u0631\u06cc\u062e\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f .\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0644\u0647 \u0632\u0631\u062f", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631\u060c \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u0627\u06cc\u0646 \u0633\u0631\u06cc \u0628\u06cc\u200c\u0646\u0647\u0627\u06cc\u062a \u0633\u0641\u062a \u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f. \u0647\u0645\u0686\u0646\u06cc\u0646 \u06a9\u06cc\u06a9 \u062e\u0631\u0645\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u062e\u0631\u0645\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", -1]}
{"text": ["\u062f\u0648\u0628\u0627\u0631 \u0632\u0646\u06af \u0632\u062f\u0646 \u0628\u0639\u062f \u06f2\u06f5 \u062f\u0642\u06cc\u0642\u0647 \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0631\u0648 \u0647\u0645\u0647 \u0631\u0648 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u0646..\u0628\u0627 \u06a9\u0644\u06cc \u062a\u0627\u062e\u06cc\u0631 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0647\u0645\u0628\u0631\u06af\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0647 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0628\u0633\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0646\u0633\u06a9\u0627\u0641\u0647 \u0634\u06cc\u0631\u06cc", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0637\u0639\u0645 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u067e\u0627\u06cc \u06a9\u0631\u0645", "\u0641\u06cc\u0646\u06af\u0631 \u0627\u0644\u0648\u06cc\u0647", "\u0641\u06cc\u0646\u06af\u0631 \u067e\u0646\u06cc\u0631\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0628\u06cc\u0636\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", -1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0634\u0645\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0628\u06cc\u0636\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", 1]}
{"text": ["\u0628\u0627\u0642\u0644\u0648\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0627\u0648\u0631\u062c\u06cc\u0646\u0627\u0644", "\u0628\u0627\u0642\u0644\u0648\u0627 \u0634\u06cc\u0631 \u0648 \u0639\u0633\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", 1]}
{"text": ["\u0645\u0646 \u0686\u0646\u062f \u0628\u0627\u0631 \u0627\u0632 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0634\u0639\u0628\u0647 \u0645\u0631\u0632\u062f\u0627\u0631\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c \u0648\u0644\u06cc \u062f\u0631 \u062f\u0641\u0639\u0647 \u0627\u062e\u06cc\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0642\u062f\u06cc\u0645\u06cc \u0628\u0648\u062f \u0637\u0648\u0631\u06cc\u06a9\u0647 \u0647\u0645 \u0645\u0646 \u0648 \u0647\u0645 \u062e\u0627\u0646\u0648\u0627\u062f\u0647 \u0627\u0645 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u062d\u0627\u0644\u0645\u0648\u0646 \u0628\u062f \u0634\u062f. \u0628\u0647 \u0647\u0631 \u062d\u0627\u0644 \u0627\u0635\u0644\u0627\u064b \u0628\u0627\u0628\u062a \u0647\u0632\u06cc\u0646\u0647 \u0627\u06cc \u06a9\u0647 \u06a9\u0631\u062f\u06cc\u0645 \u060c \u0644\u0630\u062a \u0646\u0628\u0631\u062f\u0646 .\n\u0641\u0642\u0637 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0631\u0627 \u0645\u06cc \u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u06af\u0645 \u06a9\u0647 \u0627\u06cc\u0646 \u0631\u0648\u0634 \u062e\u0631\u06cc\u062f \u062c\u0647\u062a \u0633\u0647\u0648\u0644\u062a \u062d\u0627\u0644 \u0645\u0634\u062a\u0631\u06cc \u0627\u0633\u062a \u0648 \u06a9\u0627\u0631\u06a9\u0646\u0627\u0646 \u0646\u0627\u0646 \u0633\u062d\u0631 \u0646\u0628\u0627\u06cc\u062f \u0686\u0646\u06cc\u0646 \u0628\u0631\u062f\u0627\u0634\u062a\u06cc \u06a9\u0646\u0646\u062f \u06a9\u0647 \u0686\u0648\u0646 \u0645\u0634\u062a\u0631\u06cc \u062d\u0636\u0648\u0631 \u0646\u062f\u0627\u0631\u062f \u060c \u06a9\u0647\u0646\u0647 \u062a\u0631\u06cc\u0646 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0631\u0627 \u0627\u0631\u0633\u0627\u0644 \u0646\u0645\u0627\u06cc\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062a\u062e\u062a \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0631\u0627\u06cc \u0686\u0646\u062f\u0645\u06cc\u0646 \u0628\u0627\u0632 \u060c\u06a9\u0631\u0648\u0633\u0627\u0646 \u0641\u0642\u0637 \u0627\u0633\u0645\u0634 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0648\u062f \u0628\u062f\u0648\u0646 \u06a9\u0627\u06a9\u0627\u0626\u0648 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0646\u0648\u0646 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062e\u06cc\u0644\u06cc \u0633\u0641\u062a \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0648\u0627\u0634 \u0633\u0628\u0648\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0648\u0686\u06a9 250 \u06af\u0631\u0645", "\u0631\u0648\u06a9\u0634 \u0634\u06a9\u0644\u0627\u062a", -1]}
{"text": ["\u062e\u0648\u0628\u0647 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u0645\u06cc\u0627\u0631\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f\u06cc)", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0645\u062e\u0635\u0648\u0635", "\u0645\u0627\u0641\u06cc\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u06a9\u0631\u0645", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc\u0647 \u06a9\u0647 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0631\u0633\u0627\u0644 \u200c\u0634\u0648\u0646 \u0631\u0648 \u062d\u0630\u0641 \u06a9\u0631\u062f\u0646. \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u062d\u0627\u0644\u0645 :))\n\u0686\u0648\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0639\u0627\u0644\u06cc\u0647 \u0627\u0645\u0627 \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0632\u06cc\u0627\u062f \u0647\u0645\u06cc\u0634\u0647 \u0622\u062f\u0645 \u0631\u0648 \u0645\u0646\u0635\u0631\u0641 \u0645\u06cc\u200c\u06a9\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u0633\u0631\u06cc\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u062e\u0631\u0645\u0627", "\u0628\u0631\u06cc\u0648\u0634 \u06af\u0648\u062c\u0647 \u0648 \u067e\u0646\u06cc\u0631", "\u06af\u0627\u062a\u0627", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0686\u0627\u067e\u0627\u062a\u0627 \u0633\u0627\u062f\u0647 \u0648 \u0643\u0631\u0627\u0645\u0628\u0644 \u0639\u0627\u0644\u064a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u06af\u0627\u062a\u0627", "\u0686\u0627\u067e\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", 1]}
{"text": ["\u0631\u0648\u0632 \u0628\u062e\u06cc\u0631\n\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0631\u0627\u0646\u06cc \u0641\u0627\u062c \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u060c \u0648\u0644\u06cc \u0628\u0631\u0627\u0646\u06cc \u0645\u0627\u0631\u0628\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0686\u0646\u062f\u06cc\u0646 \u0628\u0627\u0631 \u062a\u0627 \u0627\u0644\u0627\u0646 \u0646\u0638\u0631\u0627\u062a \u0645\u0628\u0646\u06cc \u0628\u0631 \u062d\u0645\u0644 \u0646\u0627 \u0645\u0646\u0627\u0633\u0628 \u0648 \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u06cc\u06a9 \u0628\u0627 \u062c\u0639\u0628\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u0627\u0631\u06cc \u0635\u0648\u0631\u062a \u0646\u0645\u06cc\u06af\u06cc\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647 \u0646\u0633\u0628\u062a \u0628\u0647 \u0639\u06a9\u0633 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u062a\u0631 \u0647\u0633\u062a \u0637\u0648\u0631\u06cc \u06a9\u0647 \u067e\u06a9 16 \u0639\u062f\u062f\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc 7 \u0646\u0641\u0631  \u06af\u0631\u0641\u062a\u0645 \u0628\u0647 \u0642\u062f\u0631\u06cc \u0631\u06cc\u0632 \u0628\u0648\u062f \u06a9\u0647 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u062f\u0648\u0628\u0627\u0631\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0645 ! \u0628\u0627 55 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0627\u0646 \u0645\u06cc \u062a\u0648\u0646\u0633\u062a\u0645 \u06a9\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0645.. \u0622\u0628\u0631\u0648\u0631\u06cc\u0632\u06cc \u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\n\n\u067e\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af \u0631\u0648 \u0627\u0646\u062f\u0627\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0686\u067e \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u06cc\u0646\u06af", "\u0628\u0631\u06cc\u0648\u0634 \u06af\u0648\u062c\u0647 \u0648 \u067e\u0646\u06cc\u0631", "\u0628\u0631\u06cc\u0648\u0634 \u067e\u0633\u062a\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u0686\u06cc\u0632\u06a9\u06cc\u06a9\u200c\u0647\u0627 \u062a\u0648 \u062c\u0639\u0628\u0647 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0631\u0648\u0634. \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0686\u0642\u062f\u0631 \u062e\u0648\u0628\u06cc\u062f \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 1", "\u0628\u0631\u06cc\u0648\u0634 \u062e\u0631\u0645\u0627", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0631\u0647 \u0648\u0644\u06cc \u0648\u0642\u062a\u06cc \u0627\u0648\u0631\u062f\u0646 \u06cc\u06a9\u06cc \u067e\u062e\u0634 \u0634\u062f \u062a\u0648 \u0628\u0627\u06a9\u0633 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0645 \u0633\u0627\u0644\u0645 \u0628\u0631\u0633\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0646\u0634\u062f \u062a\u0648 \u0632\u0645\u0627\u0646\u0627\u06cc \u0645\u062e\u062a\u0644\u0641 \u0645\u0627 \u06cc\u0647 \u0686\u06cc\u0632\u06cc \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc\u0645..\u062f\u0648 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0639\u062f \u0632\u0646\u06af\u200c\u0646\u0632\u0646\u06cc\u0646\u200c\u0628\u06af\u06cc\u0646 \u0646\u0645\u06cc\u0634\u0647 \u062c\u0627\u06cc \u0641\u0644\u0627\u0646 \u06a9\u0648\u06a9\u06cc \u0627\u06cc\u0646\u0648 \u0628\u0630\u0627\u0631\u06cc\u0645... \u0646\u062f\u0627\u0631\u06cc\u0645 \u0622\u062e\u0647\u0647\u0647\u0647\u0647\u0647...\u062d\u06cc\u0641 \u06a9\u0647 \u0639\u0627\u0634\u0642 \u06a9\u0648\u06a9\u06cc \u0647\u0627\u062a\u0648\u0646 \u0647\u0633\u062a\u0645\u0645\u0645\u0645\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u062e\u0631\u0645\u0627", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", -1]}
{"text": ["\u0686\u0631\u0627 \u0648\u0642\u062a\u06cc \u0647\u0646\u0648\u0632 \u06a9\u06cc\u06a9 \u0631\u0648 \u062a\u062d\u0648\u06cc\u0644 \u0646\u062f\u0627\u062f\u0646\u060c \u067e\u06cc\u0627\u0645 \u0645\u06cc\u0627\u062f \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647\u061f\u061f\u061f\u061f\u061f\u061f\u061f\u061f\u061f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0648\u0644\u06cc \u062f\u0648\u0646\u0627\u062a \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f\n\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0641\u0642\u0637 \u0628 \u0646\u0638\u0631\u0645 \u0627\u06af\u0647 \u0645\u0642\u062f\u0627\u0631 \u0642\u0633\u0645\u062a \u0646\u0648\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0628\u06cc\u0634\u062a\u0631 \u0628\u0627\u0634\u0647 \u0627\u0632 \u06a9\u0631\u0645 \u0628\u06cc\u0646\u0634 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u062a\u0631 \u0628\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0633\u0631\u06cc\u0639 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u06a9\u0627\u0645\u0644\u0627 \u067e\u0648\u062f\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u067e\u06cc\u06a9 \u0647\u0645 \u062a\u0642\u0631\u06cc\u0628\u0627 5 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0639\u062f \u0627\u0632 \u0627\u062a\u0645\u0627\u0645 \u0632\u0645\u0627\u0646 \u06af\u0641\u062a\u0647 \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u0648\u06a9\u06cc \u06af\u0631\u062f\u0648 \u0648 \u0634\u06a9\u0644\u0627\u062a", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u0633\u06cc\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 \u0628\u0627 \u0632\u0631\u062f \u0622\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0634\u062f\u06cc\u0645 \u062f\u06cc\u06af\u0647\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc\u0647 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0647\u0633\u062a\u0646\u062f\u060c \u0646\u0627\u0646 \u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0627\u0633\u062a\u060c \u062a\u0642\u0631\u06cc\u0628\u0627 \u0647\u0641\u062a\u0647 \u0627\u06cc \u062f\u0648\u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u0627\u0647\u0645 \u062f\u0627\u062f\u060c \u067e\u06cc\u06a9 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062f\u0642\u06cc\u0642 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u060c \u0645\u0631\u0633\u06cc \u06a9\u0644\u06cc \u06a9\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0648 \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u0628\u0631\u0627\u0645 \u062c\u0627\u0644\u0628 \u0628\u0648\u062f \u06a9\u0647 \u0622\u0631\u062f \u0641\u0642\u0637 \u06af\u0632\u06cc\u0646\u0647 \u06f1 \u06a9\u06cc\u0644\u0648 \u0631\u0648 \u0628\u0631\u0627\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u062f\u0627\u0631\u0647 \u0648\u0644\u06cc \u0646\u06cc\u0645 \u0645\u06cc\u0644\u0648 \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u0646!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0622\u0631\u062f \u0633\u0641\u06cc\u062f 21 \u062f\u0631\u0635\u062f (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u062a\u0631 \u0648 \u062a\u0627\u0632\u0647 \u0647\u0645\u0647 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0646:)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u06a9\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u062e\u0648\u0628\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0627\u06a9", 1]}
{"text": ["\u0627\u0632 \u062f\u0641\u0639\u0647 \u0647\u0627\u06cc \u0642\u0628\u0644 \u0634\u06cc\u0631\u06cc\u0646\u062a\u0631 \u0628\u0648\u062f. \u0645\u0646 \u0634\u062e\u0635\u0627 \u062f\u0648\u0633\u062a \u062f\u0627\u0631\u0645 \u06a9\u0647 \u0632\u06cc\u0627\u062f \u0634\u06cc\u0631\u06cc\u0646 \u0646\u0628\u0627\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 \u0628\u0627 \u0632\u0631\u062f \u0622\u0644\u0648", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0634\u0627\u062a\u0648\u062a", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc\u062a\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u0627\u0646\u062f\u0627\u0632\u0634 \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0686\u0627\u067e\u0627\u062a\u0627 \u0627\u0646\u06af\u0627\u0631 \u067e\u062e\u062a\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u062e\u0645\u06cc\u0631 \u0628\u0648\u062f \u0646\u0648\u0646 \u0644\u0642\u0645\u0647\u200c\u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u062e\u06cc\u0644\u06cc \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u06cc\u0627 \u0645\u0627\u0644 \u062f\u06cc\u0631\u0648\u0632 \u0628\u0648\u062f\u0647 \u06cc\u0627 \u0635\u0628\u062d \u0627\u0645\u0631\u0648\u0632 \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0647\u0645 \u0633\u0641\u06cc\u062f \u0628\u0648\u062f \u0648 \u0628\u0631\u0634\u062a\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0646\u0627\u0646 \u0633\u0646\u062a\u06cc \u0686\u0627\u0628\u0627\u062a\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u062c\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0627\u0633\u062a\u060c \u0645\u0646 \u0646\u0645\u06cc\u062f\u0648\u0646\u0633\u062a\u0645 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0627\u0648\u0645\u062f\u0647 \u0648 \u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646\u0645\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0647\u0627 \u0639\u0627\u0644\u06cc\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0648 \u0645\u0627 \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0628\u0648\u062f\u06cc\u0645\u060c \u0646\u0627\u0646 \u0628\u0646\u062f \u0627\u0646\u06af\u0634\u062a\u06cc \u0628\u0631\u0627\u06cc \u0641\u06cc\u0646\u06af\u0631\u0641\u0648\u062f \u0648 \u0635\u0628\u062d\u0627\u0646\u0647 \u0628\u0686\u0647 \u0647\u0627 \u062e\u06cc\u0644\u06cc \u0645\u0641\u06cc\u062f\u0647\u060c \u0627\u0631_\u0627\u0644 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062f\u0647 \u062f\u0642\u06cc\u0642\u0647 \u0646\u0634\u062f \u0622\u0645\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0632 \u0647\u0631 \u0646\u0638\u0631 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645\n\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0642\u0637\u0627\u0628", 1]}
{"text": ["\u0645\u0646 \u0645\u0634\u062a\u0631\u06cc\u0647 \u0647\u0645\u06cc\u0634\u06af\u06cc \u0627\u06cc\u0646\u062c\u0627 \u0647\u0633\u062a\u0645 \u0648 \u0648\u0627\u0642\u0639\u0627 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645\u0648\u0646\u06cc \u0647\u0633\u062a \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0631\u0645 ... \u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0632\u062d\u0645\u0627\u062a \u062a\u06cc\u0645\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u06cc\u0633\u06a9\u0627\u062a\u06cc \u0648\u0627\u0646\u06cc\u0644 \u0628\u0627\u062a\u06a9\u0647 \u0647\u0627\u06cc \u0634\u06a9\u0644\u0627\u062a", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u0628\u0647 \u0627\u0634\u062a\u0628\u0627\u0647 \u0628\u0647 \u062c\u0627\u064a \u067e\u0627\u064a \u0633\u064a\u0628 \u067e\u0627\u064a \u0622\u0644\u0628\u0627\u0644\u0648 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0643\u0634\u0645\u0634 \u062f\u0627\u062e\u0644 \u0643\u064a\u0643 \u0635\u0628\u062d\u0627\u0646\u0647 \u0637\u0639\u0645 \u0645\u0627\u0646\u062f\u06af\u064a \u0645\u064a \u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", -1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647 \u0627\u0632 \u0639\u06a9\u0633 \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0627\u0633\u062a \u0648 \u0627\u0635\u0644\u0627 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u0646\u0645\u06cc \u0627\u0631\u0632\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0643\u064a\u0643 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0633\u0627\u0644\u0645 \u062a\u062d\u0648\u064a\u0644 \u0634\u062f \u0627\u06af\u0631 \u0686\u0647 \u0633\u0641\u0627\u0631\u0634 \u062a\u063a\u064a\u064a\u0631 \u0643\u0631\u062f \u0643\u0647 \u0627\u064a\u0646 \u0645\u0648\u0631\u062f \u0645\u062a\u0648\u062c\u0647 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0628\u0648\u062f \u0646\u0647 \u0627\u0633\u0646\u067e! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u0648 \u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f\u0646 . \n\u0641\u0642\u0637 \u06a9\u06cc\u06a9 \u0648 \u067e\u0648\u062f\u06cc\u0646\u06af \u06a9\u062c \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0627\u0633\u0646\u067e \u062e\u0648\u0628 \u062a\u062d\u0648\u06cc\u0644 \u0646\u062f\u0627\u062f \u0627\u06af\u0631 \u062f\u0642\u062a \u0645\u06cc\u06a9\u0631\u062f \u06cc\u0627 \u0628\u0627 \u0639\u062c\u0644\u0647 \u062d\u0645\u0644 \u0646\u0645\u06cc\u06a9\u0631\u062f \u06a9\u062c \u0646\u0645\u06cc\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627 \u0645\u06cc\u06af\u0631\u0641\u062a\u0645 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633. \u0648\u0644\u06cc \u0648\u0642\u062a\u06cc \u0642\u06cc\u0645\u062a\u0634 \u0628\u0627\u0644\u0627\u062a\u0631 \u0645\u06cc\u0631\u0647 \u0627\u0646\u062a\u0638\u0627\u0631 \u0645\u06cc\u0631\u0647 \u0627\u0632 \u062d\u062c\u0645\u0634 \u06a9\u0645 \u0646\u0634\u0647. \u0648\u0642\u062a\u06cc \u062c\u0639\u0628\u0647 \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 \u0648\u0627\u0642\u0639\u0627 \u062a\u0639\u062c\u0640\u0640\u0640\u0628 \u06a9\u0631\u062f\u0645 \u0627\u0632 \u0633\u0627\u06cc\u0632 \u0628\u0631\u0627\u0646\u06cc! \u062e\u06cc\u0640\u0640\u0640\u0640\u0640\u0640\u0640\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0648\u0627\u0642\u0639\u0627 \u0645\u0646\u0635\u0641\u0627\u0646\u0647 \u0646\u06cc\u0633\u062a! \u0648 \u0642\u0637\u0639\u0627 \u0647\u0645\u0686\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u0631\u0648 \u062f\u06cc\u06af\u0647 \u062e\u0631\u06cc\u062f \u0646\u0645\u06cc\u06a9\u0646\u0645!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u067e\u06cc\u06a9 \u062a\u0648\u0646 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u062f\u0628 \u0648 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f.\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a\u0647\u0627 \u0628\u0631\u06af\u0634\u062a\u0647 \u0648 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u062f\u0631 \u0627\u062b\u0631 \u062a\u0643\u0627\u0646 \u0634\u062f\u064a\u062f \u0648 \u0646\u064a\u0645\u064a \u0627\u0632 \u062c\u0639\u0628\u0647 \u0642\u0627\u0628\u0644 \u0645\u0635\u0631\u0641 \u0646\u064a\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0641\u06cc\u0646\u06af\u0631 \u0646\u0648\u0646 \u067e\u0646\u06cc\u0631 \u0647\u0645 \u0628\u0648\u062f \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0646\u062f\u0627\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0639\u0627\u0644\u064a \u0647\u0645 \u0643\u064a\u0641\u064a\u062a \u0647\u0645 \u0633\u0631\u0639\u062a \u067e\u064a\u0643", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0646\u0628\u0648\u062f\u060c\u0628\u06cc\u0634\u062a\u0631 \u0648\u0632\u0646\u0634 \u0647\u0645 \u0628\u0627\u0645\u06cc\u0647 \u0628\u0648\u062f \u0632\u0648\u0644\u0628\u06cc\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", -1]}
{"text": ["\u062f\u06cc\u0631 \u0627\u0648\u0645\u062f \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c\u062a\u0648\u0646 \u0628\u06cc\u0646\u0638\u06cc\u0631\u0647!!\n\u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0633\u0631 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u0641\u0631\u0646\u06cc", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645\u200c \u0627\u0632 \u0633\u0631\u06cc \u0647\u0627\u06cc \u0642\u0628\u0644\u061b \u062e\u06cc\u0644\u06cc \u062d\u062c\u0645\u0634 \u06a9\u0645\u062a\u0631 \u0648 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0634\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0627 \u0628\u0627\u0631", "\u0627\u0646\u0631\u0698\u06cc \u0628\u0627\u0631", -1]}
{"text": ["Kohne va bad maze bod", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u060c \u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a\u0634\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647 \u2066\u2069", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062a\u0631\u062f \u0648 \u0639\u0627\u0644\u06cc.. \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u0628\u0647 \u0646\u0638\u0631\u0645 \u0643\u0631\u0627\u064a\u0647 \u0627\u0631\u0633\u0627\u0644 \u0648\u0627\u0633\u0647 \u0645\u0627 \u0643\u0647 \u062e\u064a\u0644\u064a \u0646\u0632\u062f\u064a\u0643 \u0628\u0648\u062f\u064a\u0645 \u0632\u064a\u0627\u062f \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0628\u06cc\u0627\u062a \u0628\u0648\u062f .\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0686\u0631\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", -1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0647\u0627\u060c \u0641\u0642\u0637 \u0627\u06cc\u0646 \u0628\u0627\u0631 \u0646\u0627\u0628\u0627\u0648\u0631\u0627\u0646\u0647 \u0646\u0627\u0646 \u0647\u0627\u06cc \u0633\u0628\u0648\u0633 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f\u0646\u062f!!! \u0644\u0637\u0641\u0627 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0631\u0631\u0633\u06cc \u0648 \u062a\u0648\u062c\u0647 \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", "\u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u064a\u0631\u064a \u0643\u0647 \u064a\u0643 \u0643\u064a\u0644\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0641\u0642\u0637 \u0667 \u0639\u062f\u062f \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0648\u062f!! \u0648 \u0643\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u064a\u0631\u064a \u0627\u0635\u0644\u0627 \u067e\u0646\u064a\u0631 \u0646\u062f\u0627\u0634\u062a!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0633\u0641\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc \u0628\u0648\u062f. \u0647\u0645 \u062f\u0646\u06cc\u0634 \u0648 \u0647\u0645 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0628\u0648\u06cc \u062a\u0627\u0632\u06af\u06cc \u0645\u06cc\u062f\u0627\u062f\u0646. \u062e\u06cc\u0644\u06cc \u0631\u0627\u0636\u06cc \u0627\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u06af\u0631 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u064a \u060c \u0646\u0648\u0646\u0634 \u0628\u0631\u0634\u062a\u0647 \u062a\u0631 \u0628\u0627\u0634\u0647 \u0639\u0627\u0644\u064a\u0647 \u0645\u064a\u0634\u0647\n\u0648\u0644\u064a \u062f\u0631 \u0643\u0644 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062f\u0645\u062a\u0648\u0646 \u06af\u0631\u0645 \u0628\u0627\u0628\u062a \u0627\u06cc\u0646 \u0628\u0631\u0646\u0627\u0645\u0647 \u0648\u0644\u06cc \u0628\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u06cc \u0628\u0631\u0646\u062f \u0647\u0645 \u06a9\u0627\u0631 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0639\u0627\u0644\u06cc \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0631\u0648\u0632 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0633\u062a \u062a\u0648 \u0645\u0646\u0637\u0642\u0647 \u067e\u0627\u0633\u062f\u0627\u0631\u0627\u0646 \u062c\u0632\u0621 \u0628\u0647\u062a\u0631\u06cc\u0646\u0647\u0627\u0633\u062a \u0627\u0633\u0646\u067e \u0641\u0648\u062f\u0645 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0633\u0641\u0627\u0631\u0634\u0645\u0648 \u0631\u0633\u0648\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0631\u06cc\u0632 \u0633\u0627\u062f\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0634\u06a9 \u0641\u0644\u0648\u0631\u0646\u062a\u06cc\u0646\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647\u060c\u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u060c\u0639\u0627\u0644\u06cc \u0645\u0631\u0633\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062f\u0644\u0686\u0633\u0628 \u0628\u0648\u062f \u062e\u062f\u0645\u0627\u062a \u062f\u0647\u06cc \u0633\u0631\u06cc\u0639 \u0647\u0645 \u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0648\u0627\u0642\u0639\u0627 \u0632\u0634\u062a \u0648 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0628\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u062f\u0648 \u0628\u0633\u062a\u0647 \u0646\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u06cc\u06a9 \u0628\u0633\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0627\u0628\u0648\u062f \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f \u0634\u0645\u0639 \u0639\u062f\u062f \u06f2 \u0647\u0645 \u0646\u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0634\u0634", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647. \u0648\u0644\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u06f3\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u062a\u0627\u062e\u06cc\u0631. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u064a\u064a\u064a\u064a\u064a\u064a \u062d\u062a\u0645\u0627\u064b \u067e\u064a\u0634\u0646\u0647\u0627\u062f \u0645\u064a\u0634\u0647\u0647\u0647\u0647\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u060c \u0645\u0631\u0633\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", "\u0634\u0645\u0639 \u062f\u0648", "\u0634\u0645\u0639 \u0646\u0647", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u0634\u06a9\u0644\u0627\u062a \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0628\u0642\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0627 \u0647\u0645 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u0686\u0646\u062f\u064a\u0646 \u0645\u0631\u062a\u0628\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0645\u0648\u0631\u062f \u0646\u0638\u0631\u0645 \u0631\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645(\u062f\u0631 \u0633\u0627\u064a\u062a \u0645\u0648\u062c\u0648\u062f \u0628\u0648\u062f)\u0648 \u0647\u0631\u0628\u0627\u0631 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u0643\u0647 \u0627\u0648\u0646 \u0646\u0648\u0639 \u0645\u0648\u062c\u0648\u062f \u0646\u064a\u0633\u062a\u060c\u0633\u0648\u0627\u0644\u0645 \u0627\u064a\u0646\u0647 \u0643\u0647 \u0686\u0631\u0627 \u0627\u062a\u0645\u0627\u0645 \u0645\u0648\u062c\u0648\u062f\u064a \u0646\u0645\u064a\u0632\u0646\u064a\u0646 \u0643\u0647 \u0628\u062a\u0648\u0646\u064a\u0645 \u0628\u0647\u062a\u0631 \u062e\u0631\u064a\u062f \u0643\u0646\u064a\u0645\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u062a\u062d\u0648\u064a\u0644 \u0628\u0647 \u0645\u0648\u0642\u0639\u060c \u0637\u0639\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0648\u06a9\u06cc\u0644\u06cc \u0647\u0633\u062a\u0645 . \u06f1\u06f0 \u0639\u062f\u062f \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c \u06f9 \u062a\u0627 \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u062e\u0648\u0628\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062e\u0648\u0628 .\u0628\u0631\u0627\u0646\u06cc \u0628\u062f\u0645\u0632\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062a\u0623\u0633\u0641\u0627\u0646\u0647 \u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0647\u0627 \u062f\u0631 \u062c\u0639\u0628\u0647 \u062a\u0643\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0648 \u0628\u0631\u0639\u0643\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f! \u0641\u0642\u0637 \u0633\u0647 \u062a\u0627 \u0633\u0627\u0644\u0645 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0633\u0646\u06af\u06cc\u0646 \u0628\u0648\u062f \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0639\u0627\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647 \u062d\u062c\u0645 \u0633\u06cc\u0628 \u0628\u0647 \u0646\u0633\u0628\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u06cc\u0627\u062f \u0628\u0627\u0634\u0647.\u067e\u06cc\u06a9 \u0628\u0627 \u0627\u0633\u062a\u0631\u0633 \u062e\u0648\u0627\u0633\u062a \u0628\u0633\u062a\u0647 \u0628\u0628\u06cc\u0646\u0645 \u0622\u0633\u06cc\u0628 \u0646\u062f\u06cc\u062f\u0647 \u0628\u0627\u0634\u0647 \u0627\u0646\u0642\u062f\u0631 \u0647\u0645 \u0627\u0632 \u067e\u06cc\u06a9 \u0645\u0648\u062a\u0648\u0631\u0633\u0648\u0627\u0631 \u0627\u06cc\u0631\u0627\u062f \u0646\u06af\u06cc\u0631\u06cc\u062f \u0698\u06cc\u0645\u0646\u0627\u0633\u062a\u06cc\u06a9 \u06a9\u0627\u0631 \u0646\u0645\u06cc\u06a9\u0646\u0646 \u06a9\u0647 !\u0627\u06cc\u0631\u0627\u062f \u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u06cc\u0627 \u06a9\u0644\u0627 \u0628\u0639\u0636\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0627\u06cc\u062f \u0628\u0627 \u0645\u0627\u0634\u06cc\u0646 \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0646 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0631 \u0647\u0646\u06af\u0627\u0645 \u062d\u0645\u0644\u060c \u062a\u0639\u062f\u0627\u062f\u06cc \u0627\u0632 \u062f\u0633\u0631\u0647\u0627 \u06a9\u062c \u0634\u062f\u0647 \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", -1]}
{"text": ["- \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0698\u06af\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f!!\n+\u0628\u0633\u06cc\u0627\u0631 \u0632\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u0646\u0648\u0646 \u0628\u0631\u0646\u062c\u064a \u0639\u0627\u0644\u064a \u0648 \u062a\u0627\u0632\u0647 \u0648\u0644\u064a \u0643\u0627\u0643 \u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u064a \u062f\u0631 \u0643\u0644 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0646\u062c\u06cc", "\u06a9\u0627\u06a9", "\u0642\u0637\u0627\u0628", 1]}
{"text": ["\u0633\u0644\u0627\u0645\u060c\u0645\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646\u0647\u0627\u062a\u0648\u0646 \u0628\u0637\u0648\u0631 \u0645\u06cc\u0627\u0646\u06af\u06cc\u0646 \u0631\u0627\u0636\u06cc\u0645 \u0627\u0645\u0627 \u0627\u0644\u0627\u0646 \u0686\u0646\u062f\u06cc\u0646 \u062f\u0641\u0639\u0633\u062a \u06a9\u0647 \u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0627\u0632 \u062f\u0627\u062e\u0644 \u0646\u0627\u0646\u0647\u0627 \u0633\u0648\u0631\u0627\u062e \u0647\u0633\u062a\u0646\u062f \u062e\u0648\u0628 \u0628\u0627\u0639\u062b \u0645\u06cc\u0634\u0647 \u0645\u0648\u0627\u062f \u0627\u0632 \u062f\u0627\u062e\u0644\u0634 \u0628\u0631\u06cc\u0632\u0647 \u0627\u06af\u0631 \u0627\u0645\u06a9\u0627\u0646 \u062f\u0627\u0631\u0647 \u0639\u0644\u062a\u0634\u0648 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f \u060c\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u06cc\u0633\u06a9\u0648\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0645\u06cc \u0628\u0647 \u062a\u0644\u062e\u06cc \u0645\u06cc\u0632\u0646\u0647 \u0648\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0628\u0627\u0627\u06cc\u0646\u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0648\u06cc \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u0628\u0627 \u0634\u0647\u062f \u0627\u0646\u06af\u0648\u0631", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", -1]}
{"text": ["\u06a9\u0627\u0645\u0644\u0627 \u06a9\u0647\u0646\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u06cc\u06a9!!!! \u0633\u0641\u062a \u0633\u0641\u062a\u060c \u062e\u06cc\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0645 \u0686\u0648\u0646 \u0628\u0627 \u0622\u0628\u0631\u0648\u06cc \u0645\u0646 \u0628\u0627\u0632\u06cc \u0634\u062f\u060c \u0645\u0646 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0631\u0648 \u0628\u0631\u0627\u06cc \u062c\u0644\u0633\u0647\u200c\u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648 \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0648\u0646\u0627\u0645 \u06af\u0630\u0627\u0634\u062a\u0645 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u06a9\u0647\u0646\u0647 \u0631\u0648!!!! \u0647\u0646\u0648\u0632 \u0647\u0645 \u0646\u06af\u0647\u062f\u0627\u0634\u062a\u0645 \u06a9\u06cc\u06a9 \u0647\u0627\u0631\u0648 \u0627\u06af\u0631 \u0628\u062e\u0648\u0627\u06cc\u0646 \u0628\u0641\u0631\u0633\u062a\u0645 \u062e\u062f\u0645\u0645\u062a\u0648\u0646! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u06af\u0631\u0641\u062a\u06cc\u0645 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0628\u0647 \u0634\u062f\u062a \u0628\u06cc\u0627\u062a \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\n\u0627\u0645\u0627 \u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u06a9\u0644\u0627\u062a \u0647\u0627\u06cc \u062f\u0627\u062e\u0644\u0634 \u0627\u0635\u0644\u0627 \u0646\u0648\u062a\u0644\u0627 \u0646\u0628\u0648\u062f\n\u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0645\u0631\u0633\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0647\u0633\u062a\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0641\u0627\u0646\u062a\u0632\u06cc \u0648 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0639\u0627\u0644\u06cc \u0645\u06cc\u0628\u0627\u0634\u062f \u0648\u0644\u06cc \u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0631\u0639\u06a9\u0633 \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u06a9\u0646\u0646\u062f\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0645\u0627\u0645\u06cc \u0646\u0627\u0646 \u0647\u0627 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0631\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0634\u0627\u062a\u0648\u062a", 1]}
{"text": ["\u0645\u06cc\u0646\u06cc \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u06cc\u0627\u062a \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0642\u06cc\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u062c\u0646\u0627\u0628 \u0622\u0642\u0627\u06cc \u067e\u06cc\u06a9 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0627 \u0627\u0632 \u0641\u0631\u0634\u062a\u0647 \u0648\u0627\u0633\u0647 \u0633\u0626\u0648\u0644 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645 \u0634\u0627\u06a9\u06cc \u0628\u0648\u062f\u0646. \u0627\u0646\u06af\u0627\u0631 \u0646\u0647 \u0627\u0646\u06af\u0627\u0631 \u06a9\u0647 \u0645\u0646 \u0628\u0631 \u0627\u0633\u0627\u0633 \u0645\u0633\u0627\u0641\u062a \u067e\u0648\u0644 \u067e\u06cc\u06a9 \u0631\u0648 \u067e\u0631\u062f\u0627\u062e\u062a \u06a9\u0631\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u062c\u0627\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u06cc\u0647 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0631\u0648\u0634 \u0632\u0631\u0634\u06a9 \u0628\u0648\u062f!! \n\u0627\u0632 \u0627\u0648\u0646 \u0645\u0647\u0645 \u062a\u0631 \u06a9\u0647 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648\u0645\u0632\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f \u0628\u0627 \u062f\u0641\u0639\u0647 \u0647\u0627\u06cc \u0642\u0628\u0644 ..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0647 \u0628\u062f \u062a\u0631\u06cc\u0646 \u0634\u06a9\u0644 \u0645\u0645\u06a9\u0646 \u0631\u0633\u06cc\u062f \u0647\u0645\u0647 \u06a9\u0627\u067e \u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u0647 \u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0633\u0627\u06cc\u0632 \u0645\u062a\u0648\u0633\u0637 \u0648 \u0645\u0646\u0627\u0633\u0628 \u0628\u0631\u0627\u06cc \u06f4 \u0646\u0641\u0631 \u06a9\u0647 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u062f\u0631 \u0648\u0627\u0642\u0639 \u0628\u0631\u0627\u06cc \u06f2 \u0646\u0641\u0631 \u0647\u0633\u062a \u0648 \u06a9\u06cc\u06a9 \u0627\u0645\u0627\u062f\u0647 \u0631\u0648 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u06cc\u06a9\u0633\u0627\u0639\u062a \u0648 \u0646\u06cc\u0645 \u0632\u0645\u0627\u0646 \u0628\u0631\u062f\u0647 \u06a9\u0647 \u06cc\u06a9 \u0645\u0633\u06cc\u0631 \u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0627\u06cc \u067e\u0627\u06cc \u0627\u0644\u0628\u0627\u0644\u0648 \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f\n\u062d\u062c\u0645 \u0648 \u0627\u0646\u062f\u0627\u0632\u0647 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0628\u0632\u0631\u06af \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u0628\u0644 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0634\u062f\u0647 \u0627\u0635\u0644\u0627 \u0627\u0631\u0632\u0634 \u062e\u0631\u06cc\u062f \u0646\u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0628\u0632\u0631\u06af", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", -1]}
{"text": ["\u062a\u062d\u0648\u064a\u0644 \u0648 \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u064a\u0643 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u0641\u0642\u0637 \u062c\u0639\u0628\u0647 \u064a\u0643 \u0645\u0642\u062f\u0627\u0631 \u062a\u0643\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u064a\u0643 \u0645\u0642\u062f\u0627\u0631 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u062e\u0648\u0628 \u062e\u0648\u0634\u06a9\u0644 \u0648 \u062a\u0631\u062a\u0645\u06cc\u0632 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["l\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648 \u06a9\u06cc\u06a9 \u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0633\u0641\u0627\u0631\u0634\u0647\u0627 \u0647\u0645 \u0645\u0646\u0638\u0645 \u0648 \u0628\u0627 \u062f\u0642\u062a \u0628\u0648\u062f\u0646\u062f.\u0627\u06cc\u0646 \u0631\u0648\u0646\u062f \u067e\u0627\u06cc\u062f\u0627\u0631\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0647\u0633\u062a \u0633\u0641\u0627\u0631\u0634 \u0627\u0645\u0631\u0648\u0632\u0645 \u0627\u0632 \u0644\u062d\u0627\u0638 \u06a9\u06cc\u0641\u06cc\u062a \u060c\u062d\u062c\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u062a\u0627\u0632\u06af\u06cc \u0647\u0645\u0627\u0646\u0646\u062f \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0642\u0628\u0644\u06cc \u0648 \u062d\u062a\u06cc \u062e\u0631\u06cc\u062f\u0647\u0627\u06cc \u0633\u0627\u0644\u0647\u0627\u06cc \u067e\u06cc\u0634 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062e\u0627\u0637\u0631\u0647 \u062e\u0648\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u062a\u0648\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0631\u0627\u0645\u0648\u0646 \u0632\u0646\u062f\u0647 \u0646\u06af\u0647 \u0645\u06cc\u062f\u0627\u0631\u06cc\u062f.\n\u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0631\u0627\u06cc \u067e\u06cc\u06af\u06cc\u0631\u06cc\u060c \u0647\u0645\u0631\u0627\u0647\u06cc \u0648 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0648\u0686\u06a9\u06cc \u06a9\u0647 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0627\u06cc\u062c\u0627\u062f \u0634\u062f \u0645\u0645\u0646\u0648\u0646\u0645 \u060c \u0645\u0634\u062a\u0631\u06cc \u0645\u062f\u0627\u0631\u06cc \u0648 \u062e\u062f\u0645\u0627\u062a \u0628\u0639\u062f \u0633\u0641\u0627\u0631\u0634 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \n\u067e\u06cc\u06a9 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0647\u0646\u062f\u0647 \u0633\u0641\u0627\u0631\u0634 \u0646\u06cc\u0632 \u0628\u0633\u06cc\u0627\u0631 \u0645\u062d\u062a\u0631\u0645 \u0648 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f\u0646\u062f \u0648 \u0647\u0645\u0647 \u0633\u0641\u0627\u0631\u0634\u0647\u0627 \u062f\u0631 \u0633\u0644\u0627\u0645\u062a \u06a9\u0627\u0645\u0644 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", 1]}
{"text": ["\u06cc\u0647 \u0645\u0642\u062f\u0627\u0631\u06cc \u0628\u0631 \u0627\u0633\u0627\u0633 \u0627\u0633\u0645\u062a\u0648\u0646 \u0645\u06cc\u0641\u0631\u0648\u0634\u06cc\u062f.\u0631\u0648 \u06a9\u0645\u06cc\u062a \u062a\u0645\u0631\u06a9\u0632 \u06a9\u0646\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06cc\u06a9 \u0639\u062f\u062f \u0634\u0645\u0639 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0646\u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "Don't Even Ask", 1]}
{"text": ["\u067e\u06cc\u06a9 \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f. \u0647\u0632\u06cc\u0646\u0647\u200c\u06cc \u067e\u06cc\u06a9 \u0631\u0648 \u06af\u0641\u062a\u0647 \u0628\u0648\u062f\u06cc\u0646 \u06f5 \u0648\u0644\u06cc \u06f6.\u06f5 \u062d\u0633\u0627\u0628 \u06a9\u0631\u062f\u06cc\u0646. \u0627\u0632 \u0627\u06cc\u0646\u0627 \u06a9\u0647 \u0628\u06af\u0630\u0631\u06cc\u0645 \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u062f\u0631 \u062d\u0627\u0644\u062a \u0639\u0627\u062f\u06cc \u0642\u06cc\u0645\u062a\u0634 \u0648\u0627\u0642\u0639\u0646 \u06af\u0631\u0648\u0646\u0647\u060c \u0648 \u0641\u0642\u0637 \u062f\u0631 \u062d\u0627\u0644\u062a \u0641\u0648\u062f\u067e\u0627\u0631\u062a\u06cc \u0645\u06cc\u200c\u0634\u0647 \u0686\u0646\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634\u06cc \u062f\u0627\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0648\u062c\u0648\u062f\u06cc \u0634\u06cc\u0631\u0646\u06cc  \u0628\u0647 \u0631\u0648\u0632 \u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u0645\u0627\u0645 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062a\u0645\u0627\u0645 \u0641\u0631\u0645\u0634 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062f\u064a\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u064a\u0633\u062a \u0627\u064a\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", -1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0648 \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f .\u0648\u0644\u06cc \u0645\u0631\u0628\u0627\u06cc \u0627\u0644\u0628\u0627\u0644\u0648 \u062f\u0627\u062e\u0644\u0634 \u0628\u0648\u062f \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0634 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f \u0648 \u0646\u0648\u0646\u0634 \u062e\u0634\u06a9 . \u062f\u0631 \u0645\u0642\u0627\u06cc\u0633\u0647 \u0628\u0627 \u0628\u0627\u0642\u06cc \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u062a\u0648\u0646 \u0636\u0639\u06cc\u0641\u062a\u0631 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0632\u0631\u06af", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0633\u0631\u064a\u0639 \u0631\u0633\u064a\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0633\u0641\u06cc\u062f \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u0628\u0632\u0631\u06af", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u0627\u06af\u0631 \u0627\u0645\u06a9\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u06a9\u0633 \u0627\u0632 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0628\u0627\u0634\u0647 \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u0648\u0648\u0648\u062f \u0645\u0645\u0646\u0648\u0648\u0648\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0627\u0645\u064a\u062f\u0648\u0627\u0631\u0645 \u0647\u0645\u064a\u0634\u0647 \u0647\u0645\u064a\u0646\u0637\u0648\u0631 \u0628\u0645\u0648\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062e\u0645\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627 \u0633\u0628\u0648\u0633 (4 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645 \u0648\u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0648\u0645\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06a9\u0645\u06cc \u062c\u0627\u06cc \u0628\u0647\u062a\u0631 \u0634\u062f\u0646 \u062f\u0627\u0631\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u062f\u0631\u0633\u062a \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u062e\u064a\u0644\u064a \u0628\u062f \u0628\u0648\u062f \u0646\u0648\u0646\u0634 \u064a\u0647 \u062c\u0648\u0631\u064a \u0645\u0648\u0646\u062f\u0647 \u0628\u0646\u0638\u0631 \u0645\u064a\u0645\u0648\u062f \u0647\u0645\u064a\u0646\u0637\u0648\u0631 \u06af\u0627\u062a\u0627 \u0643\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u06cc\u0646\u06af \u0646\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0648\u0646 \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0628\u0627\u0632 \u0647\u0645 \u0627\u0632\u062a\u0648\u0646 \u062e\u0631\u06cc\u062f \u0645\u06cc \u06a9\u0646\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0627\u0631\u062f\u0648 \u0686\u0627\u0648\u062f\u0627\u0631", "\u0646\u0627\u0646 \u062c\u0648 80%", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u06cc\u062f :) ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u06a9\u06cc\u06a9 \u062e\u0631\u0645\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u067e\u0627\u064a \u0622\u0644\u0628\u0627\u0644\u0648 \u0648 \u0646\u0627\u0646 \u0633\u064a\u0631 \u0648 \u0632\u064a\u062a\u0648\u0646 \u0628\u0647 \u0634\u062f\u062a \u0643\u0647\u0646\u0647 \u0648 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f .\n\u0646\u0627\u0646 \u0633\u064a\u0631 \u0648 \u0632\u064a\u062a\u0648\u0646 \u0647\u0645 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f .\n\n\u062a\u0646\u0647\u0627 \u067e\u064a\u0631\u0627\u0634\u0643\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627", "\u0646\u0627\u0646 \u0633\u06cc\u0631 \u0648 \u0632\u06cc\u062a\u0648\u0646", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", -1]}
{"text": ["\u0634\u0648\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0647 \u062c\u0627\u06cc \u062f\u0647 \u062a\u0627 \u06f9 \u062a\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0648\u062f\u060c\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u0647\u0645 \u0628\u0647 \u062c\u0627\u06cc \u062f\u0647 \u062a\u0627 \u06f7 \u062a\u0627 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0648\u0631\u06cc\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u0649 \u0628\u064a\u0627\u062a \u0648 \u0645\u0627\u0646\u062f\u0647 \n\u0636\u0645\u0646 \u0627\u064a\u0646 \u0643\u0647 \u0643\u064a\u0641\u064a\u062a \u0627\u0634 \u062f\u0631 \u0643\u0644 \u067e\u0627\u064a\u064a\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648\u0639\u0627\u0644\u0649", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u0631\u06cc\u0639 \u0627\u0648\u0645\u062f \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0686\u0648\u0646 \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u062d\u0636\u0648\u0631\u06cc \u0647\u0645 \u0647\u0633\u062a\u0645 \u0647\u0645\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u062f\u0631 \u0645\u0646\u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u06a9\u0634 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0631\u0648 \u0627\u0635\u0644\u0627 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u0645 \u0628\u0647 \u0646\u0638\u0631\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0645\u06cc\u0631 \u0628\u0648\u062f. \u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u062f\u0628 \u0648 \u0645\u062d\u062a\u0631\u0645 \u0648 \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0628\u0647 \u0645\u0648\u0642\u0639\u0645 \u0631\u0633\u06cc\u062f \u0627\u0645\u0627 \u062f\u0647 \u062f\u0642\u06cc\u0642\u0647 \u0642\u0628\u0644 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0631\u0633\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0627\u0633 \u0627\u0645 \u0627\u0633 \u0627\u0648\u0645\u062f \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0633\u0631\u06cc\u0639 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0628\u062f\u0647 \u0643\u0647 \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u064a\u0646\u0643\u0647 \u0647\u0645\u0647 \u0643\u0627\u0645\u0646\u062a \u06af\u0630\u0627\u0634\u062a\u0646 \u0631\u0648\u064a \u0643\u064a\u0643 \u0648 \u062f\u064a\u0648\u0627\u0631\u0647 \u0647\u0627\u0634 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647\u060c \u0627\u064a\u0646 \u0645\u0634\u0643\u0644 \u0631\u0648 \u062d\u0644 \u0646\u0645\u064a \u0643\u0646\u064a\u062f. \u0668\u0668 \u062a\u0648\u0645\u0646 \u067e\u0648\u0644 \u062f\u0627\u062f\u0645 \u0648\u0644\u064a \u0631\u0648 \u0648 \u0628\u063a\u0644 \u0643\u064a\u0643 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0628\u0631\u0627\u06cc \u0645\u06cc\u0647\u0645\u0627\u0646 \u062e\u0627\u0631\u062c\u06cc \u0627\u0645 \u0628\u0627 \u0634\u0646\u0627\u062e\u062a \u062e\u0648\u0628 \u0627\u0632 \u0634\u0645\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648\u0644\u06cc \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u062f \u0648 \u062d\u062a\u0645\u0627\u0627 \u0646\u062d\u0648\u0647 \u0627\u0631\u0633\u0627\u0644 \u0628\u062f ( \u067e\u06cc\u06a9 ) \u062f\u0648 \u0639\u062f\u062f \u0627\u0632 \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0686\u067e\u0647 \u0648 \u0631\u0648\u06cc \u0633\u0627\u06cc\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0628\u0627\u0639\u062b \u062e\u062c\u0627\u0644\u062a \u0648 \u0634\u0631\u0645\u0646\u062f\u06af\u06cc \u0645\u0646 \u0634\u062f.\n\u0636\u0645\u0646\u0627 \u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u0628\u0631 \u0631\u0648\u06cc \u062c\u0644\u062f \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u06cc\u0627 \u062f\u0631 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u06cc\u0627 \u0647\u0631\u062c\u0627\u06cc \u06a9\u0647 \u0635\u0644\u0627\u062d \u0645\u06cc\u062f\u0627\u0646\u06cc\u062f \u0627\u0633\u0645 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0632\u0646\u06cc\u062f \u062a\u0627 \u0628\u062a\u0648\u0627\u0646 \u0628\u0647\u062a\u0631 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u067e\u0627\u064a \u0627\u0644\u0628\u0627\u0644\u0648 \u0643\u0627\u0645\u0644\u0627 \u062e\u0634\u0643 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u060c \u0637\u0648\u0631\u064a \u0643\u0647 \u0646\u0645\u064a\u0634\u062f \u062e\u0648\u0631\u062f \u0648 \u062f\u0627\u062e\u0644\u0634 \u0647\u0645 \u0628\u0633\u064a\u0627\u0631 \u0643\u0645 \u0645\u0631\u0628\u0627 \u0648 \u0628\u064a \u0643\u064a\u0641\u064a\u062a . \u0645\u0646 \u0627\u0632 \u0645\u0634\u062a\u0631\u064a \u0647\u0627\u064a \u0647\u0645\u064a\u0634\u06af\u064a\u0634\u0648\u0646 \u0628\u0648\u062f\u0645 \u0648\u0644\u064a \u062f\u064a\u06af\u0647 \u0647\u064a\u0686 \u0633\u0641\u0627\u0631\u0634\u064a \u0646\u0645\u064a\u062f\u0645. \u0648\u0627\u0642\u0639\u0627 \u062c\u0627\u064a \u062a\u0627\u0633\u0641 \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u06f4 \u062a\u0627 \u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u062f\u0648 \u062a\u0627\u0634 \u0633\u0627\u062f\u0647 \u0628\u0648\u062f ....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u0628\u0631\u062f\u0646\u06cc \u0645\u062a\u0644 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0627\u0646\u0642\u062f\u0631 \u06a9\u06cc\u0641\u06cc\u06cc\u062a\u0634\u0648 \u067e\u0627\u06cc\u06cc\u0646 \u0627\u0648\u0631\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u0627\u06af\u0631 \u0627\u0645\u06a9\u0627\u0646\u0634 \u0647\u0633\u062a \u0628\u06af\u06cc\u0646 \u0645\u0646 \u06a9\u062c\u0627 \u0645\u06cc\u062a\u0648\u0646\u0645 \u0639\u06a9\u0633 \u0628\u0641\u0631\u0633\u062a\u0645 !!! \u0634\u0645\u0627 \u0628\u0628\u06cc\u0646\u06cc\u062f \u06a9\u0647 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9\u0647 \u06cc\u0627 \u06af\u0648\u0634\u062a \u06a9\u0648\u0628\u06cc\u062f\u0647 !!!!!!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u067e\u0648\u062f\u0631 \u0642\u0646\u062f\u06cc \u0631\u0648\u0634 \u0646\u062f\u06cc\u062f\u06cc\u0645.\n\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u0628\u0627 \u0645\u0631\u0628\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u062f\u0642\u06cc\u0642\u0627 \u0647\u0645\u06cc\u0646 \u0637\u0639\u0645 \u0631\u0627 \u062f\u0627\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0627\u0632 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u062f\u0631 \u0639\u06a9\u0633 \u0645\u06cc \u0628\u06cc\u0646\u06cc\u062f \u0628\u0628\u0633\u06cc\u0627\u0631 \u0633\u06cc\u0627\u0631 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0627\u0633\u062a \n\u0648\u0644\u06cc \u0627\u0646\u0635\u0627\u0641\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f ...\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0645\u0627\u0647\u064a\u062a \u0633\u0641\u0627\u0631\u0634 \u0648\u0646\u064a\u0627\u0632 \u0628\u0647 \u062f\u0642\u062a \u062f\u0631 \u062d\u0645\u0644 \u0622\u0646\u060c \u0641\u0631\u0648\u0634\u0646\u062f\u0647 \u0645\u064a\u0628\u0627\u064a\u0633\u062a \u0628\u0647 \u067e\u064a\u0643 \u0645\u062a\u0630\u0643\u0631 \u0634\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627 \u0647\u0645\u0647 \u0628\u0633\u064a\u0627\u0631 \u0628\u064a\u0627\u062a \u0648 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f - \u0627\u0635\u0644\u0627 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u0643\u0631\u0648\u0633\u0627\u0646 \u0643\u0645\u064a \u062e\u0634\u0643 \u0628\u0648\u062f \u0648  \u0646\u0627\u0646 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0634\u0645\u0634\u06cc \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0633\u0648\u062e\u062a\u06af\u06cc \u0645\u06cc\u200c\u062f\u0627\u062f. \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f\u0637\u0639\u0645 \u0648 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f. \u0627\u0635\u0644\u0627 \u0645\u0632\u0647 \u067e\u0627\u06cc \u0646\u0645\u06cc \u062f\u0627\u062f. \u062a\u0639\u062c\u0628 \u0645\u06cc \u06a9\u0646\u0645 \u0627\u0632 \u0646\u0638\u0631\u0627\u062a\u06cc \u06a9\u0647 \u06af\u0641\u062a\u0647 \u0628\u0648\u062f\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u060c \u0648\u0644\u06cc \u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0648\u0646 \u062c\u0648\u0631\u0698\u06cc\u0645\u06cc \u0627\u0634 \u062e\u06cc\u0644\u06cc \u062a\u0644\u062e \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648 \u0633\u0631 \u0631\u0698\u06cc\u0645\u06cc 90%", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0645\u0645\u0646\u0648\u0646\u0645 \u0641\u0642\u0637 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0645\u0627\u0628\u0642\u06cc \u0647\u0648\u0628 \u0628\u0648\u062f \u0647\u0645\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0631\u062f \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f \u0627\u0645\u0627\u200c\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0645\u06cc \u0628\u0648\u06cc \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f \u0628\u0627\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0648 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0631\u0641\u062a\u0627\u0631 \u067e\u06cc\u06a9 \u0627\u0641\u062a\u0636\u0627\u0627\u0627\u062d \u0627\u0646\u06af\u0627\u0631 \u0637\u0644\u0628 \u06a9\u0627\u0631\u0647! \u0645\u06cc\u06af\u0647 \u0628\u06cc\u0627 \u067e\u0627\u06cc\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u0631\u0648\u0627\u0633\u0627\u0646 \u0639\u0627\u0644\u06cc \u0627\u0633\u062a \u0641\u0642\u0637 \u06a9\u0646\u06cc \u062e\u0634\u06a9 \u0627\u0633\u062a \u0648 \u0645\u0648 \u0642\u0639 \u062e\u0648\u0631\u062f\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0631\u062f \u0645\u06cc \u0634\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u064a\u0646 \u062f\u0648 \u06af\u0632\u064a\u0646\u0647 \u067e\u064a\u0634\u0646\u0647\u0627\u062f \u0645\u064a\u0634\u0647 \u0634\u062f\u064a\u062f \u0645\u0646 \u0643\u0647 \u0645\u0634\u062a\u0631\u064a \u0634\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u062e\u0648\u0628 \u0646\u0628\u0648\u062f!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u0647\u0645\u064a\u0634\u0647 \u0643\u064a\u0641\u064a\u062a \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0627\u064a \u062f\u0627\u0634\u062a\u064a\u0646 \u0645\u0646\u062a\u0647\u0627 \u0627\u0645\u0631\u0648\u0632 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f \u0647\u0631 \u062f\u0648 \u0646\u0648\u0639 \u0646\u0627\u0646 \u0628\u0633\u064a\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u064a\u0627\u062a \u0628\u0648\u062f. \u062d\u064a\u0641\u0647 \u0643\u0647 \u0633\u0627\u0628\u0642\u0647 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0628\u062a\u0648\u0646 \u0631\u0648 \u062e\u0631\u0627\u0628 \u0643\u0646\u064a\u062f\u060c \u0645\u0646 \u0647\u0645\u064a\u0634\u0647 \u0646\u0627\u0646 \u0645\u0648\u0631\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u0646\u0632\u0644 \u0631\u0648 \u0627\u0632 \u0627\u064a\u0646\u062c\u0627 \u062a\u0647\u064a\u0647 \u0645\u064a\u0643\u0646\u0645 \u0646\u0627\u0627\u0645\u064a\u062f\u0645 \u0646\u0643\u0646\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (20 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0647\u062f\u0627\u0634\u062a\u06cc \u0648 \u06a9\u0627\u0645\u0644 \u0648\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0647\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u06a9\u0627\u0634 \u062a\u0627\u0631\u06cc\u062e \u067e\u062e\u062a \u0646\u0627\u0646 \u0631\u0648\u06cc \u0627\u0646 \u062f\u0631\u062c \u0645\u06cc \u0634\u062f. \u062e\u062f\u0627 \u0642\u0648\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u06a9\u0645\u0627\u062c (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0627\u06af\u0647 \u062f\u0648\u0646\u0627\u062a\u0647\u0627\u06cc \u0634\u06a9\u0631\u06cc \u0628\u0631\u0634\u062a\u0647 \u062a\u0631 \u0628\u0627\u0634\u0646 \u0642\u0637\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u062e\u0648\u0627\u0647\u0646\u062f \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648 \u0633\u0631 \u0631\u0698\u06cc\u0645\u06cc 90%", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u0633\u06cc\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f.\u062d\u062a\u06cc \u0628\u0639\u062f \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u0648\u062f\u0645 \u062d\u0645\u0644 \u062e\u06cc\u0644\u06cc \u0645\u0646\u0627\u0633\u0628\u06cc \u0646\u062a\u0648\u0646\u0633\u062a\u0645 \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u0645\u060c\u0627\u0632 \u0633\u0637\u062d \u0632\u06cc\u0631 \u06a9\u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u06a9\u0645\u06cc \u062c\u0627 \u0628\u0647 \u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0631\u0627\u062d\u062a\u06cc \u062a\u0648\u0646\u0633\u062a\u0645 \u0631\u0648\u06cc \u0635\u0641\u062d\u0647 \u0627\u0646\u062a\u0642\u0627\u0644\u0634 \u0628\u062f\u0645. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0637\u0639\u0645\u0634 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062d\u06cc\u0641 \u06a9\u0647 \u06a9\u0648\u0686\u06a9 \u0648 \u06a9\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0627\u064a\u0646 \u0628\u0633\u062a\u0647 \u0645\u064a\u0646\u064a \u0628\u0647\u062a\u0631\u064a\u0646 \u06af\u0632\u064a\u0646\u0647 \u0633\u062a \u0648\u0627\u0633\u0647 \u0648\u0642\u062a\u064a \u0643\u0647 \u0628\u0639\u062f\u0627\u0632 \u0638\u0647\u0631 \u0628\u0627 \u064a\u0647 \u0644\u064a\u0648\u0627\u0646 \u0642\u0647\u0648\u0647 \u0628\u062e\u0648\u0631\u064a\u062f. \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u062e\u0648\u0634\u06af\u0644 \u060c \u062e\u0648\u062f\u0634 \u062e\u064a\u0644\u064a \u062e\u0648\u0634 \u0645\u0632\u0647 \u0648 \u062a\u0631 \u0648 \u062a\u0645\u064a\u0632. \u062f\u0645 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u06af\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u067e\u0648\u062f\u064a\u0646\u06af \u0643\u0627\u0645\u0644\u0627 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", 1]}
{"text": ["\u0634\u0631\u064a\u0646\u0649 \u0627\u0631\u0633\u0627\u0644\u0649 \u062a\u0648\u0633\u0637 \u067e\u064a\u0643 \u0628\u0647\u0645 \u0631\u064a\u062e\u062a\u0647 \u0648 \u062f\u0627\u063a\u0648\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647 \u0628\u062f\u062a\u0631\u06cc\u0646 \u0648\u0636\u0639 \u0645\u0645\u06a9\u0646 \u062f\u0631\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u060c \u0645\u0647\u0645\u0627\u0646 \u062f\u0627\u0634\u062a\u0645 \u0648 \u0648\u0627\u0642\u0639\u0627 \u0627\u0628\u0631\u0648\u0645 \u0631\u0641\u062a .\n\u067e\u06cc\u06a9 \u0628\u0627\u06cc\u062f \u062f\u0642\u062a \u06a9\u0646\u0647 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc \u0628\u0627 \u0633\u06cc\u0628 \u0632\u0645\u06cc\u0646\u06cc \u0641\u0631\u0642 \u062f\u0627\u0631\u0647 \n\u0648 \u062f\u0631 \u062d\u0645\u0644 \u0648 \u0646\u0642\u0644\u0634 \u062f\u0642\u062a \u06a9\u0646\u0647\n\u0648\u0627\u0642\u0639\u0627 \u0646\u062a\u0648\u0646\u0633\u062a\u0645 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0631\u0633\u0627\u0644\u06cc \u0628\u0631\u0627\u06cc \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc \u0627\u0632 \u0645\u0647\u0645\u0627\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0628\u0647 \u0646\u0648\u0639\u06cc \u0645\u0634\u062e\u0635 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", 1]}
{"text": ["\u062e\u064a\u0644\u064a\u064a\u064a \u062f\u064a\u0631 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u0630", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0637\u0639\u0645\u0634 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f :)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0641\u0631\u0634\u062a\u0647 \u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0631\u0627 \u06a9\u0627\u0645\u0644 \u0627\u0646\u062c\u0627\u0645 \u062f\u0627\u062f\u0646 \n\u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0628\u062f\u0648\u0646 \u0646\u0642\u0635 \u0648 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0637\u0639\u0645\u0634 \u062a\u0627 \u0627\u0648\u0627\u0633\u0637 \u062e\u0648\u0628\u0647. \u0648\u0644\u06cc \u0627\u0646\u062a\u0647\u0627\u0634 \u062e\u06cc\u0644\u06cc \u0637\u0639\u0645 \u0628\u062f \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0647 \u0648 \u0645\u0646 \u0628\u0627\u06cc\u062f \u062c\u062f\u0627\u0634 \u06a9\u0646\u0645 \u0686\u0648\u0646 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u06cc\u0633\u062a. \u0644\u0637\u0641\u0627 \u0631\u0633\u06cc\u062f\u06af\u06cc \u06a9\u0646\u06cc\u062f \u0686\u0648\u0646 \u062d\u06cc\u0641\u0647 \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", -1]}
{"text": ["\u0627\u064a\u0646 \u0627\u0635\u0644\u0627 \u062f\u0631\u0633\u062a \u0646\u064a\u0633\u062a \u0643\u064a\u0643 \u0648 \u0634\u064a\u0631\u064a\u0646\u0649 \u0648 \u0628\u0647 \u0627\u064a\u0646 \u0635\u0648\u0631\u062a \u062a\u062d\u0648\u064a\u0644 \u0645\u064a\u062f\u064a\u062f !!! \n\u0645\u0646 \u0686\u0646\u062f \u0628\u0627\u0631 \u062a\u0627\u0643\u064a\u062f \u0643\u0631\u062f\u0645 \u062f\u0631 \u062d\u0645\u0644\u0634 \u062f\u0642\u062a \u0634\u0648\u062f \u0648\u0644\u0649 \u0628\u0627\u0632 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0643\u064a\u0643 \u0628\u0631\u06af\u0634\u062a\u0647 !!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u06a9\u0645\u06cc\u200c \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648\u0646\u0633\u0628\u062a \u0628\u0647 \u0628\u0642\u06cc\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u06a9\u06cc\u0641\u06cc\u062a \u067e\u0627\u06cc\u06cc\u0646 \u062a\u0631\u06cc \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u06a9\u0627\u067e \u06a9\u06cc\u06a9 \u0628\u0648\u062f \u06a9 \u0648\u0642\u062a\u06cc \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0647\u0645\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.\u062e\u0627\u0645\u0647 \u06cc \u0631\u0648\u0634\u0648\u0646 \u0628\u0627\u0647\u0645 \u0642\u0627\u0637\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0641\u0631\u0645 \u06a9\u06cc\u06a9 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0645\u0646 \u06a9\u0647 \u0645\u0634\u062a\u0631\u06cc\u062a\u0648\u0646 \u0634\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", 1]}
{"text": ["\u0645\u0646 \u0646\u06cc\u0645 \u0628\u0627\u06af\u062f \u06a9\u0646\u062c\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0628\u062f\u0648\u0646 \u0647\u0645\u0627\u0647\u0646\u06af\u06cc \u0633\u0627\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646. \n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0634\u0645\u0634\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", -1]}
{"text": ["\u0646\u0648\u0646 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062e\u06cc\u0644\u06cc \u0633\u0641\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062f\u0645\u062a\u0648\u0646 \u06af\u0631\u0645 \u0628\u0627 \u0627\u06cc\u0646 \u0646\u0631\u0645 \u0627\u0641\u0632\u0627\u0631 \u0648 \u062f\u0645\u062a\u0648\u0646 \u06af\u0631\u0645 \u0628\u0627\u0628\u062a \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc \u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0648 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u0645\u0627\u0644 \u0645\u0631\u0628\u0648\u0637 \u0628\u0647 \u0631\u0648\u0632\u0647\u0627\u06cc \u0642\u0628\u0644 \u0628\u0648\u062f \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0627\u0641\u062a\u0636\u0627\u0639 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0628\u0627\u06cc\u062f \u0646\u0645\u0631\u0647 \u0645\u0646\u0641\u06cc \u0628\u06af\u06cc\u0631\u0647 \u0648 \u0627\u0632 \u0627\u0645\u062a\u06cc\u0627\u0632\u0634 \u06a9\u0645 \u0628\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", -1]}
{"text": ["\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u067e\u0627\u06cc \u0633\u06cc\u0628 \u06cc\u0647 \u06a9\u0648\u0686\u0648\u0644\u0648 \u062f\u0648\u0631\u0634 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0633\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f \n\u0628\u0627 \u0633\u067e\u0627\u0633 \u0627\u0632 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u06cc\u0646\u06cc \u067e\u06cc\u062a\u0632\u0627 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u0645\u06cc\u0646\u06cc \u067e\u06cc\u062a\u0632\u0627\u06cc \u0645\u062e\u0644\u0648\u0637", -1]}
{"text": ["\u0645\u0627\u0641\u06cc\u0646 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0641\u06cc\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0648 \u0648\u06cc\u0698\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0627\u0635\u0644\u0627 \u0646\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648  \u200c\u200c\u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u06cc\u0627\u062a \u0648\u0633\u0641\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0633\u0627\u0644\u0627\u062f \u0646\u06cc\u0633\u0648\u0627", -1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0648 \u0628\u0627\u0648\u062c\u0648\u062f\u06cc\u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645\u060c\u0628\u0647 \u0627\u0634\u062a\u0628\u0627\u0647 \u062c\u0639\u0628\u0647 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u06a9\u0647 \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u0639\u0644\u0627\u0645 \u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc\u060c \u0644\u0637\u0641 \u06a9\u0631\u062f\u0646\u062f \u0648 \u06af\u0641\u062a\u0646\u062f \u0627\u0632 \u0646\u0638\u0631\u0634\u0648\u0646 \u0645\u0634\u06a9\u0644\u06cc \u0646\u062f\u0627\u0631\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0647\u0645 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0648 \u0646\u0648\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0648 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0633\u06cc\u0628\u0634 \u06a9\u0645 \u0628\u0648\u062f . \u0628\u06cc\u0634\u062a\u0631 \u06a9\u06cc\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0627\u0646\u0631\u0698\u06cc \u0628\u0627\u0631 \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f. \u0627\u0645\u0627 \u0631\u0648\u0644 \u0686\u0627\u06cc \u062a\u0631\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0646\u0633\u0628\u062a\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0631\u0698\u06cc \u0628\u0627\u0631", "\u0631\u0648\u0644 \u0686\u0627\u06cc", -1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", 1]}
{"text": ["\u062e\u0648\u0634 \u0645\u0632\u0647 \u0628\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0631 :) ;)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0628\u0644\u063a \u062e\u0631\u06cc\u062f \u0645\u0646 \u06a9\u0645 \u0628\u0648\u062f \u0648\u0644\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u0646 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0634\u0634", "\u0634\u0645\u0639 \u0646\u0647", 1]}
{"text": ["\u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0632\u06cc\u0628\u0627 \u062f\u0627\u0634\u062a. \u0642\u06cc\u0645\u062a \u0647\u0645 \u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f\u060c \u0627\u0631\u0633\u0627\u0644 \u062a\u0627\u062e\u06cc\u0631\u06cc \u0646\u062f\u0627\u0634\u062a.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0634\u0645\u0639 \u062f\u0648", "\u0634\u0645\u0639 \u0647\u0634\u062a", 1]}
{"text": ["\u0631\u062f \u0648\u0644\u0648\u062a \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u060c\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0628\u0639\u0636\u06cc \u0647\u0627 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f\u060c \u0648\u0644\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u06cc\u06a9 \u0628\u0648\u062f. \n\u062e\u062f\u0645\u0627\u062a \u0627\u0633\u0646\u067e \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u062f \u0627\u0648\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", 1]}
{"text": ["\u0627\u06cc\u0646 \u062f\u0648 \u062a\u0627 \u06a9\u06cc\u06a9 \u0628\u06cc \u0646\u0638\u06cc\u0631\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u0627\u0633\u0645 \u06a9\u06cc\u06a9\u060c \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c\u0647 \u0648\u0644\u06cc \u062f\u0631 \u0627\u0635\u0644 \"\u0686\u06cc\u0632\" \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0628\u0648\u062f!\n\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0627\u0632 \u0686\u06cc\u0632\u06cc \u06a9 \u0641\u06a9 \u0645\u06cc\u06a9\u0631\u062f\u0645 \u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0634\u0645\u0639 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 (12 \u062a\u0627\u06cc\u06cc)", 1]}
{"text": [" \u062f\u0648 \u0645\u0631\u062a\u0628\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0628\u0631\u0639\u06a9\u0633 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0627\u0632 \u062c\u0639\u0628\u0647\u200c\u0647\u0627\u06cc \u0645\u062d\u06a9\u0645 \u0628\u0631\u0627\u06cc \u0628\u0633\u062a\u0647\u200c\u0628\u0646\u062f\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u0648\u062f \u0648 \u0628\u0647 \u0637\u0648\u0631 \u06a9\u0627\u0645\u0644 \u0628\u0627 \u0646\u0627\u06cc\u0644\u0648\u0646 \u06cc\u0627 \u0686\u0633\u0628 \u0628\u0633\u062a\u0647 \u0634\u0648\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u060c \u0641\u0642\u0637 \u0627\u06cc \u06a9\u0627\u0634 \u0633\u0627\u06cc\u0632 \u0631\u0648 \u0645\u06cc\u0632\u062f\u06cc\u062f \u060c \u0645\u0646 \u062c\u0644\u0648 \u0645\u0647\u0645\u0648\u0646\u0627\u0645 \u0636\u0627\u06cc\u0639 \u0634\u062f\u0645\n\n\u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u062f\u0648\u0628\u0627\u0631\u0647 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0647 \u0648\u0642\u062a \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 \u0635\u0641\u0631", "\u0634\u0645\u0639 \u0633\u0647", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 HBD (\u0631\u0646\u06af\u06cc)", 1]}
{"text": ["\u06a9\u0627\u0645\u0644\u0627 \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0632 \u0634\u06a9\u0644 \u0627\u0648\u0644\u06cc\u0647 \u0627\u0634 \u062e\u0627\u0631\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u0637\u0639\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f \u06a9\u0627\u0634 \u0639\u06a9\u0633\u06cc \u06a9\u0647 \u0642\u0631\u0627\u0631 \u062f\u0627\u062f\u06cc\u0646 \u0648\u0627\u0642\u0639\u06cc \u0628\u0627\u0634\u0647 \u062a\u0627 \u0622\u062f\u0645 \u062a\u0648\u0642\u0639 \u062f\u0631\u0633\u062a\u06cc \u0627\u0632 \u062c\u0646\u0633\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", 1]}
{"text": ["\u0641\u0627\u06a9\u062a\u0648\u0631 \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0633\u0647 \u062a\u0627 \u062c\u0639\u0628\u0647 \u0631\u0648 \u0635\u0631\u0641\u0627 \u0628\u0627 \u0631\u0648\u0628\u0627\u0646 \u0628\u0647 \u0647\u0645 \u0628\u0633\u062a\u0647 \u0628\u0648\u062f\u0646\u060c \u0644\u0637\u0641\u0627 \u062f\u0627\u062e\u0644 \u06a9\u06cc\u0633\u0647 \u0647\u0645 \u0642\u0631\u0627\u0631 \u0628\u062f\u06cc\u062f \u062a\u0627 \u062d\u0645\u0644\u0634 \u0628\u0631\u0627\u06cc \u0645\u0627 \u0631\u0627\u062d\u062a \u062a\u0631 \u0628\u0627\u0634\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 2", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0627\u0628\u062a\u062f\u0627 \u0633\u0641\u0627\u0631\u0634 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u06cc\u0645 \u06a9\u0647 \u0628\u0627 \u0648\u062c\u0648\u062f \u0645\u0648\u062c\u0648\u062f \u0628\u0648\u062f\u0646 \u062f\u0631 \u0633\u0627\u06cc\u062a\u060c \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0647 \u0634\u062f \u0648 \u0639\u0648\u0636 \u0634\u062f \u0628\u0647 \u0639\u0644\u062a \u062a\u0645\u0627\u0645 \u0634\u062f\u0646 \u0648 \u0622\u067e\u062f\u06cc\u062a \u0646\u06a9\u0631\u062f\u0646 \u0645\u0648\u062c\u0648\u062f\u06cc.\n\u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u067e\u0633 \u0627\u0632 \u0631\u0633\u06cc\u062f\u0646 \u062a\u0645\u0627\u0633 \u0646\u0645\u06cc \u06af\u06cc\u0631\u062f \u0648 \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u062f\u0631 \u0644\u0627\u0628\u06cc \u0631\u0647\u0627 \u0645\u06cc \u0646\u0645\u0627\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f.\u0647\u0645\u0647 \u062a\u0627\u0632\u0647 \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0642\u0637 \u0646\u06a9\u062a\u0647 \u0645\u062b\u0628\u062a \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631 \u0631\u0627 \u062f\u0627\u063a \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646. \n\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u062e\u06cc\u0644\u06cc \u0631\u06cc\u0632 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648 \u0633\u0631 \u0631\u0698\u06cc\u0645\u06cc 90%", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0632\u06cc\u0631\u0647", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0634\u0627\u062a\u0648\u062a", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0637\u0639\u0645\u0634 \u0645\u0631\u0633\u064a \u0648\u0627\u0642\u0639\u0627 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u062e\u06cc\u0644\u06cc \u0645\u0631\u062a\u0628 \u0648 \u0645\u0646\u0638\u0645 \u0686\u06cc\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0638\u0627\u0647\u0631 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u0648 \u0627\u0644\u0628\u062a\u0647 \u062a\u0627\u0632\u0647 \u0647\u0645 \u0628\u0648\u062f\u060c \u0648\u0644\u06cc \u06cc\u06a9\u0645 \u0632\u06cc\u0627\u062f \u062e\u0634\u06a9 \u062f\u0631\u0633\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0633\u0644\u06cc\u0642\u0647 \u0645\u0646 \u0646\u06cc\u0633\u062a.\n\u062f\u0631 \u06a9\u0644 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u062f\u06cc\u0627\u0628\u062a \u0648 \u0686\u0631\u0628\u06cc \u0633\u0648\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u060c \u0641\u0642\u0637 \u062e\u06cc\u0644\u06cc \u0686\u0631\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0631\u0627\u0646\u06cc \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0633\u0631\u06cc\u0639 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u062a\u0627\u062d\u0627\u0644\u0627 \u0686\u0646\u062f \u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0647\u0634\u0648\u0646 \u0648\u0644\u06cc \u06cc\u0647 \u0645\u0634\u06a9\u0644\u06cc \u06a9\u0647 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0647\u0627\u0634\u0648\u0646 \u062f\u0627\u0631\u0647 \u0627\u06cc\u0646\u0647 \u06a9\u0647 \u0627\u06a9\u062b\u0631\u0627 \u0645\u0648\u0642\u0639 \u062c\u062f\u0627 \u06a9\u0631\u062f\u0646 \u0627\u0632 \u06a9\u0627\u063a\u0630 \u0627\u0648\u0646 \u0645\u0631\u0628\u0627\u06cc \u062f\u0627\u062e\u0644\u0634 \u062c\u0627 \u0645\u06cc\u0645\u0648\u0646\u0647 !", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u062e\u0648\u062f\u0686\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0628\u0647 \u0645\u0639\u0646\u06cc \u0648\u0627\u0642\u0639\u06cc \u0646\u0627\u0646 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0632\u06cc\u0628\u0627 !!!!!\u0646\u0627\u0646 \u0647\u0627\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f \u062f\u0627\u0631 \u0639\u0627\u0644\u06cc \u0647\u0633\u062a\u0646 \u060c\u0647\u0645 \u0627\u0632 \u0646\u0638\u0631 \u0637\u0639\u0645 \u0648 \u0647\u0645 \u0638\u0627\u0647\u0631 \u0632\u06cc\u0628\u0627  \u0648 \u0642\u06cc\u0645\u062a \u0645\u0646\u0627\u0633\u0628 \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646\u06cc \u0648 \u062f\u0648\u0631\u0647\u0645\u06cc \u0647\u0627 ...\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u06a9\u0627\u0631\u062a\u0648\u0646 \u0631\u0648 \u0639\u0627\u0644\u06cc \u0627\u0646\u062c\u0627\u0645 \u0645\u06cc\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (5 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0627\u0645\u0644\u0627 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u067e\u0646\u06cc\u0631 \u06cc\u0648\u0627\u0641 \u0628\u0648\u062f \u062a\u0648 \u0646\u0648\u0646 \u0645\u0648\u0646\u062f\u0647. \u0645\u0646 \u0642\u0628\u0644\u0627 \u062c\u0627\u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0627\u06cc\u0646 \u0646\u0648\u0646 \u0647\u0645 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646\n\u062a\u0648 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u0646 \u0622\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0686\u0648\u0646 \u0646\u0648\u0646\u0634 \u062e\u0634\u06a9 \u0628\u0648\u062f \u06cc\u06a9\u0645 \u062a\u06cc\u06a9\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0633\u0641\u06cc\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0646\u0642\u0631\u06cc\u0628\u0627 \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0628\u06cc \u0646\u0638\u06cc\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0646 \u062f\u0648\u0646\u0627\u062a \u0628\u0627 \u062a\u06a9\u0647 \u0647\u0627\u06cc \u0634\u06a9\u0644\u0627\u062a \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0631\u0627\u0645 \u062f\u0648\u0646\u0627\u062a \u0628\u0627 \u062a\u06a9\u0647 \u0647\u0627\u06cc \u0631\u0646\u06af\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. \u062a\u0642\u0631\u06cc\u0628\u0627 \u06f2\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0632\u0645\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0631\u0648\u0633\u0627\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0628\u0646\u0638\u0631\u0645 \u062a\u0627\u0632\u0647 \u0646\u0645\u06cc\u0648\u0645\u062f.\n\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u0647\u0645 \u0628\u0627\u06cc\u062f \u0642\u06cc\u062f \u0645\u06cc\u0634\u062f \u06a9\u0647 \u0627\u0632 \u062c\u0627\u06cc \u062f\u06cc\u06af\u0647 \u0633 \u0648 \u0641\u0642\u0637 \u0641\u0631\u0648\u0634\u0634 \u0628\u0647 \u0639\u0647\u062f\u0647 \u0627\u06cc\u0646 \u0645\u062c\u0645\u0648\u0639\u0647 \u0627\u0633\u062a. \u0645\u0646 \u0628\u0647 \u062d\u0633\u0627\u0628 \u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062a\u0627\u0632\u0647 \u06a9\u0647 \u062a\u0648\u06cc \u0646\u0648\u0646\u0648\u0627\u06cc\u06cc \u0648 \u0642\u0646\u0627\u062f\u06cc \u067e\u062e\u062a\u0647 \u0645\u06cc\u0634\u0647 \u062e\u0631\u06cc\u062f\u0645 \u0648\u0644\u06cc \u0627\u06cc\u0646 \u0645\u0627\u0644 \u062a\u0627\u0631\u06cc\u062e \u06f2\u06f6 \u0627\u0633\u0641\u0646\u062f \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u0628\u0627 \u0634\u0647\u062f \u0627\u0646\u06af\u0648\u0631", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647\n\u0641\u0642\u0637 \u06a9\u0627\u0634 \u0645\u0648\u062c\u0648\u062f\u06cc \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u0622\u0646\u0644\u0627\u06cc\u0646 \u0628\u0627\u0634\u0647 \u062a\u0627 \u067e\u0633 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0648 \u067e\u0631\u062f\u0627\u062e\u062a \u0647\u0632\u06cc\u0646\u0647\u060c \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0647 \u0646\u0634\u0647 \u06a9\u0647 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u0646 \u0648 \u06cc\u0627 \u0645\u062c\u0628\u0648\u0631 \u0628\u0647 \u06a9\u0646\u0633\u0644\u06cc \u0628\u0627\u0634\u06cc\u0645 \u0648 \u06cc\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u0633\u0641\u0627\u0631\u0634!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0632\u0647 \u06a9\u06cc\u06a9 \u0632\u06cc\u0627\u062f \u062e\u0648\u0628 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0627\u0632 \u067e\u0648\u062f\u06cc\u0646\u06af \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648\u0644\u06cc \u0627\u0632 \u062a\u062d\u0648\u06cc\u0644 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc\u0634 \u0646\u0647 . \u062f\u0648 \u0628\u0631\u0627\u0628\u0631 \u0632\u0645\u0627\u0646 \u0627\u0639\u0644\u0627\u0645\u06cc \u0631\u0633\u06cc\u062f . \u062c\u0639\u0628\u0647 \u0627\u0632 \u06af\u0648\u0634\u0647 \u0647\u0627 \u0628\u0627\u0632 \u0648 \u067e\u0648\u062f\u06cc\u0646\u06af \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631 \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f . \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0639\u0630\u0631\u062e\u0648\u0627\u0647\u06cc \u06a9\u0631\u062f \u062e\u0648\u0627\u0633\u062a \u0628\u0631\u06af\u0631\u062f\u0648\u0646\u0647 \u06af\u0641\u062a\u0645 \u062d\u062a\u0645\u0627 \u0628\u0627\u06cc\u062f \u06cc\u0647 \u0633\u0627\u0639\u062a \u062f\u06cc\u06af\u0647 \u0635\u0628\u0631\u06a9\u0646\u0645 \u062a\u0627 \u0628\u06cc\u0627\u062f \u0646\u0645\u06cc\u062e\u0648\u0627\u062f \u062f\u06cc\u06af\u0647 . \u0645\u0647\u0645\u062a\u0631\u06cc\u0646 \u0645\u0633\u0626\u0644\u0647 \u062a\u0648\u06cc \u0641\u0631\u0648\u0634 \u0627\u06cc\u0646\u062a\u0631\u0646\u062a\u06cc \u06a9\u06cc\u06a9 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645\u06cc\u0646 \u0646\u062d\u0648\u0647 \u062a\u062d\u0648\u06cc\u0644\u0634\u0647 \u06a9\u0647 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a \u0645\u0634\u062a\u0631\u06cc \u0628\u0631\u0633\u0647 \u06a9\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u062c\u0631\u0628\u0647 \u062e\u0648\u0628\u06cc \u0646\u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u0633\u0646\u067e \u062e\u06cc\u0644\u06cc \u0648\u0642\u062a\u0627 \u062e\u06cc\u0644\u06cc \u0637\u0648\u0644 \u0645\u06cc\u062f\u0647 \u062a\u0627 \u0628\u06cc\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", "Don't Even Ask", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0632\u06cc\u0627\u062f \u067e\u0641 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0644\u0627\u06cc\u0647\u200c\u0647\u0627\u0634 \u0627\u0632 \u0647\u0645 \u062c\u062f\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0645\u062e\u062a\u0644\u0641\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0627(\u0641\u0631\u0634\u062a\u0647 \u0648 \u062c\u0631\u062f\u0646) \u0631\u0648 \u062a\u0633\u062a \u06a9\u0631\u062f\u0645 \u0648 \u06a9\u0644\u0627 \u0627\u06cc\u0646 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0631\u0648 \u062f\u0648\u0633 \u062f\u0627\u0631\u0645.\n\u0648\u0644\u06cc \u0628\u0627\u06cc\u062f \u0628\u06af\u0645 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646\u0634\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062a\u0648\u062c\u0647 \u0645\u0646\u0648 \u062c\u0644\u0628 \u0646\u06a9\u0631\u062f \u0648  \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0639\u0627\u0644\u06cc \u0646\u0628\u0648\u062f.\n\u0645\u0646 \u0647\u0645\u0686\u0646\u0627\u0646 \u0645\u0634\u062a\u0631\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062e\u0648\u0627\u0647\u0645 \u0645\u0648\u0646\u062f \u0648\u0644\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646\u0634 \u0631\u0648 \u062f\u06cc\u06af\u0647 \u0646\u062e\u0648\u0627\u0647\u0645 \u062e\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0686\u064a\u0632\u064a \u0643\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0628\u0627 \u0686\u064a\u0632\u064a \u0643\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u067e\u0633\u062a\u064a\u0628\u0627\u0646\u064a \u0647\u0645 \u0627\u0641\u062a\u0636\u0627\u062d \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u06a9\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u0631\u0648\u06cc \u0647\u0645 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a \u0639\u0627\u0644\u064a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u0647\u0645\u0647 \u0646\u0627\u0646 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0686\u0627\u0648\u062f\u0627\u0631 \u06a9\u0648\u0686\u06a9", "\u062b\u0645\u06cc\u0646", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0643\u0631\u0648\u0633\u0627\u0646 \u0645\u062b\u0644\u0647 \u0647\u0645\u064a\u0634\u0647 \u0646\u0628\u0648\u062f :(  \u062e\u0648\u0628 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062e\u06cc\u0644\u06cc \u0628\u0648\u06cc \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u0646\u0627\u0646 \u062c\u0648 100%", "\u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0627\u0644\u0628\u062a\u0647 \u0645\u0646 \u062a\u0631\u062c\u06cc\u062d \u0645\u06cc\u062f\u0627\u062f\u0645 \u062f\u0627\u0631\u0686\u06cc\u0646 \u0647\u0645 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0647\u0631\u0686\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u0645\u0648\u0646\u062f\u0647 \u0634\u0628 \u0639\u064a\u062f \u0628\u0648\u062f \u0641\u0631\u0633\u062a\u0627\u062f\u0646\n\u0645\u062a\u0627\u0633\u0641\u0645 \u0643\u0647 \u0627\u0633\u0646\u067e\u0641\u0648\u062f \u0647\u064a\u0686 \u067e\u064a\u06af\u064a\u0631\u064a \u0631\u0648\u064a \u0631\u0633\u062a\u0648\u0631\u0627\u0646\u0647\u0627 \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0641\u0631\u0648\u0634\u064a\u0647\u0627 \u0646\u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0628\u0627\u0632 \u0647\u0645 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0632\u06cc\u0627\u0627\u0627\u0627\u0627\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.\n\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0647\u0646\u0647 \u0648 \u0628\u06cc\u0627\u062a. \u062e\u06cc\u0644\u06cc \u0628\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645. \u0628\u06cc\u0633\u06a9\u0648\u06cc\u062a \u062c\u0648\u200c\u06a9\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0631\u0627\u062d\u062a \u0645\u0627\u0644 \u06f1\u06f0 \u0631\u0648\u0632 \u067e\u06cc\u0634\u0647 \u0627\u0635\u0644\u0627 \u0646\u0645\u06cc\u0634\u0647 \u062e\u0648\u0631\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062c\u0648", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u06a9\u0648\u0686\u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0644\u0647 \u0632\u0631\u062f", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648\u062a\u0627\u0632\u0647 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0631\u06cc\u0632 \u0628\u0634\u0642\u0627\u0628\u06cc", "\u067e\u0627\u0646\u0627\u06a9\u0648\u062a\u0627", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0631\u0633\u0628\u0627\u0646\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u062c\u0627\u06cc \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631\u060c \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0648\u0631\u0646\u062f \u062f\u0631 \u062d\u0627\u0644\u06cc \u06a9\u0647 \u0627\u0635\u0644\u0627 \u0634\u06a9\u0644\u0627\u062a \u0648 \u06a9\u0627\u06a9\u0627\u0626\u0648 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0631\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u0634\u0644\u0647 \u0632\u0631\u062f", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0647 \u062a\u0627\u0632\u06af\u06cc \u0647\u0645\u06cc\u0634\u0647 \u0648 \u062f\u0641\u0639\u0627\u062a \u0642\u0628\u0644 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0646\u0631\u0698\u06cc \u0628\u0627\u0631", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0645\u0648\u0646\u062f\u0647.\u062e\u0634\u06a9 \u0648 \u0633\u0641\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u062e\u0648\u0628 \u0628\u0648\u062f. \u0647\u0631\u062f\u0648 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc. \u0627\u0644\u0628\u062a\u0647 \u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc\u06cc \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u06a9\u0631\u0645\u0641\u06cc\u0644 \u0645\u0627\u0641\u06cc\u0646 \u0647\u0627 \u0628\u0633\u06cc\u0627\u0627\u0631 \u06a9\u0645 \u0628\u0648\u062f!\n \u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0645\u0627\u0641\u06cc\u0646 \u062d\u062f\u0648\u062f \u06f1\u06f1 \u0639\u062f\u062f \u0628\u0648\u062f \u0646\u0647 \u06f1\u06f5 \u0639\u062f\u062f!\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0641\u06cc\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0631\u0648\u0632 \u0628\u062e\u06cc\u0631\n\u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062e\u0648\u0627\u0647\u0634 \u062f\u0627\u0631\u0645 \u0648\u0642\u062a\u06cc \u067e\u06cc\u06a9 \u0642\u0631\u0627\u0631\u0647 \u0645\u0648\u0627\u062f \u063a\u0630\u0627\u06cc\u06cc \u062d\u0645\u0644 \u06a9\u0646\u0647 \u0628\u06cc\u0634\u062a\u0631 \u062f\u0642\u062a \u06a9\u0646\u0647 \u06a9\u0647 \u0646\u0635\u0641 \u06a9\u06cc\u06a9 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0646\u0686\u0633\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u06a9\u06cc\u06a9 \u062c\u0627\u0628\u062c\u0627 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062f\u06cc\u0648\u0627\u0631\u0647\u200c\u06cc \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0644\u0637\u0641\u0627 \u0628\u0647 \u067e\u06cc\u06a9 \u0628\u06af\u06cc\u062f \u06a9\u0647 \u0645\u0648\u0642\u0639 \u062d\u0645\u0644 \u06a9\u06cc\u06a9 \u0627\u062d\u062a\u06cc\u0627\u0637 \u0628\u06a9\u0646\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 (12 \u062a\u0627\u06cc\u06cc)", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0627\u0646\u062f\u0627\u0632\u0647\u200c\u06a9\u0648\u0686\u06a9\u200c\u0646\u0633\u0628\u062a \u0642\u06cc\u0645\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0637\u0639\u0645. \u0648 \u0632\u06cc\u0628\u0627 \u0628\u0648\u062f.\n\u0634\u0645\u0639 \u0647\u0627 \u0632\u06cc\u0628\u0627 \u0628\u0648\u062f\u0646 \u0648\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a\u0646 \u0648 \u06cc\u06af\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0627\u0628 \u0634\u062f\u0646 \u0631\u0648 \u06a9\u06cc\u06a9 \u0648 \u06a9\u06cc\u06a9 \u0631\u0648 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u0646 \u062a\u0627 \u062d\u062f\u06cc\n\n\u0633\u0631\u0648\u06cc\u0633 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.\n\u0645\u062a\u0634\u06a9\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 HBD (\u0631\u0646\u06af\u06cc)", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0633\u0641\u0627\u0631\u0634 \u06a9\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648 \u0645\u06cc\u062f\u0645 \u0628\u0639\u062f \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u062c\u0627\u0634 \u06a9\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u0648\u0642\u062a \u0628\u0631\u06af\u0631\u062f\u0648\u0646\u062f\u0646 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u0645 \u062d\u06cc\u0641 \n\u0648\u06af\u0631\u0646\u0647 \u0627\u0632 \u0644\u062d\u0627\u0638 \u0637\u0639\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u0647\u0631\u062f\u0648 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0647\u0645\u0634\u0648\u0646 \u062e\u0648\u0634\u0645\u0632\u0647  \u0628\u0648\u062f\u0646\u062f    :))", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0634\u0645\u0639 \u062f\u0648", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0634\u0645\u0639 \u0646\u0647", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0642\u0627\u0628\u0644 \u067e\u0630\u06cc\u0631\u0627\u06cc\u06cc \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0686\u0646\u06af\u0627\u0644 \u0648 \u062f\u0633\u062a\u0645\u0627\u0644 \u06a9\u0627\u063a\u0630\u06cc \u0646\u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0647\u0633\u062a\u06cc\u062f.\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06af\u06cc\u0641\u062a \u062a\u0648\u0644\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0641\u0627\u0635\u0644\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062a\u0627 \u0645\u0646\u0632\u0644 \u0645\u0627 \u06a9\u0645 \u0628\u0648\u062f \u0645\u0628\u0644\u063a \u06f5\u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0627\u0646 \u0628\u0631\u0627\u06cc \u067e\u06cc\u06a9 \u0627\u06cc\u0646 \u0645\u0633\u0627\u0641\u062a \u0645\u0646\u0637\u0642\u06cc \u0646\u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u062a\u0631 \u0627\u0632 \u0639\u06a9\u0633 \u0647\u0633\u062a !!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0637\u0639\u0645\u0634 \u0643\u0647 \u0628\u064a \u0646\u0638\u064a\u0631 \u0628\u0648\u062f \n\u062e\u064a\u0644\u064a\u0645 \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0643\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u062f\u0631\u0633\u062a\u0647 \u0643\u0647 \u062e\u064a\u0644\u064a \u0628\u0627 \u062a\u0623\u062e\u064a\u0631 \u0631\u0633\u064a\u062f\u060c \n\u0648\u0644\u064a \u0627\u0646\u0642\u062f\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f \u0631\u0641\u062a\u0627\u0631\u0634\u0648\u0646 (\u0627\u0633\u0646\u067e \u0641\u0648\u062f) \u0643\u0647 \u062c\u0627\u064a \u0634\u0643\u0627\u064a\u062a\u064a \u0646\u0645\u0648\u0646\u062f \n\u0643\u064a\u0643 \u062a\u0631\u0627\u0641\u0644 \u0647\u0645 \u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u064a \u062a\u0648\u0642\u0639\u0645 \u0627\u0632 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0628\u0627\u0632 \u062e\u064a\u0644\u064a \u0628\u064a\u0634\u062a\u0631 \u0627\u0632 \u0627\u064a\u0646 \u0628\u0648\u062f\u060c \u0646\u0645\u064a\u062f\u0648\u0646\u0645 \u0686\u0631\u0627 \u062a\u0648\u0642\u0639 \u064a\u0647 \u0643\u064a\u0643 \u0627\u062c\u0627\u0628 \u0627\u0646\u06af\u064a\u0632 \u062f\u0627\u0634\u062a\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0641\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062f\u0642\u064a\u0642\u0627 \u0634\u0628\u064a\u0647 \u0639\u0643\u0633. \u0645\u0632\u0647 \u0627\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f. \u0643\u0645 \u0634\u064a\u0631\u064a\u0646. \u0648 \u0643\u0627\u0645\u0644\u0627 \u0633\u0627\u0644\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f \u0639\u0644\u064a\u0631\u063a\u0645 \u0628\u0627\u0631\u0648\u0646\u064a \u0628\u0648\u062f\u0646 \u0647\u0648\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0645\u0627 \u0647\u0645\u06cc\u0634\u0647 \u0627\u0632 \u0633\u0631\u06a9\u0627\u0631 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u06cc\u0645 \u0627\u0632 \u062a\u0648\u0646 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u062e\u0648\u0631\u0627\u06a9\u06cc \u0647\u0627\u06cc \u062a\u0627\u0632\u0647 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u06a9\u0646\u06cc\u0646\u060c \u0645\u0646 \u0634\u0639\u0628\u0647 \u06cc \u062f\u06cc\u06af\u062a\u0648\u0646 \u0647\u0645 \u0645\u0634\u062a\u0631\u06cc \u0647\u0633\u062a\u0645 \u060c \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u0627\u0644\u0627 \u0645\u0627 \u06a9\u0647 \u062a\u0648\u0634 \u0647\u0627\u062a \u062f\u0627\u06af\u06cc \u0646\u062f\u06cc\u062f\u06cc\u0645 \u0641\u0642\u0637 \u067e\u0646\u06cc\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u0639\u0627\u0644\u06cc \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0648\u06a9\u06cc \u06af\u0631\u062f\u0648 \u0648 \u0634\u06a9\u0644\u0627\u062a", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0627\u0632 \u0634\u0628 \u0639\u06cc\u062f \u062a\u0627 \u06a9\u0646\u0648\u0646 \u06a9\u06cc\u0644\u06cc\u0648\u06cc\u06cc 5000 \u062a\u0648\u0645\u0627\u0646 \u06af\u0631\u0627\u0646 \u06a9\u0631\u062f\u06cc\u062f \u0686\u0631\u0627 \u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0627\u0635\u0641\u0647\u0627\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0628\u0648\u062f \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0627\u062f\u0645 \u0648 \u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0647 \u0628\u0627 \u0647\u0645\u06a9\u0627\u0631\u0647\u0627 \u062f\u0648\u0631 \u0647\u0645 \u062f\u0627\u0631\u06cc\u0645 \u0645\u06cc\u062e\u0648\u0631\u06cc\u0645 \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0627\u0645\u0627\u062f\u0647 \u0648 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u060c \u0642\u0637\u0639\u0627 \u062f\u0648\u0628\u0627\u0631\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u06cc\u0645 \u0648\u0644\u06cc \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0642\u0628\u0644 \u062a\u062d\u0648\u06cc\u0644 \u06af\u0632\u06cc\u0646\u0647 \u06cc \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u0631\u0648 \u0632\u062f \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062d\u0631\u0641\u0647 \u0627\u06cc \u0646\u06cc\u0633\u062a\u060c\u062f\u0631 \u06a9\u0644 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0646\u062c\u06cc", 1]}
{"text": ["\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0646\u062c\u06cc", 1]}
{"text": ["\u0628\u062f\u06a9\u0644\u06cc \u062a\u0627\u062e\u06cc\u0631\u0633\u0641\u0627\u0631\u0634 \u0646\u0627\u0642\u0635 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646 \u0646\u0648\u0628\u0631\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u062e\u0648\u062f\u0686\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u067e\u0646\u062c \u0645\u063a\u0632", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648  \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u064a\u0646\u0643\u0647 \u062a\u0627\u0643\u064a\u062f \u0634\u062f\u0647 \u0628\u0648\u062f \u062c\u0639\u0628\u0647 \u0647\u0627 \u062a\u0643\u0648\u0646 \u0646\u062e\u0648\u0631\u0646\u062f \u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627 \u0633\u0631 \u0648 \u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f !!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u062e\u0648\u0628\u0647 \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06af\u0631\u0648\u0646\u0647 \u0628\u0647 \u0646\u0633\u0628\u062a \u062d\u062c\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u0645\u0642\u062f\u0627\u0631\u0634 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a \u062e\u064a\u0644\u0649 \u0643\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0631\u0648\u0649 \u0633\u0627\u064a\u062a \u0645\u0648\u062c\u0648\u062f\u0649 \u062f\u0627\u0634\u062a\u0646 \u0648\u0642\u062a\u0649 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0627\u062f\u064a\u0645 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062a\u0645\u0627\u0633 \u0645\u064a\u06af\u0631\u0641\u062a\u0646 \u0648 \u0645\u064a\u06af\u0641\u062a\u0646 \u0646\u062f\u0627\u0631\u064a\u0645!!!! \n\u0628\u0639\u062f \u0627\u0632 \u0643\u0644\u0649 \u062a\u0644\u0627\u0634 \u0643\u0647 \u0628\u0627\u0644\u0627\u062e\u0631\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u064a\u062f \u060c \u0633\u0627\u064a\u0632 \u0645\u064a\u0646\u0649 \u0627\u0632 \u0645\u064a\u0646\u0649 \u0647\u0645 \u062e\u064a\u0644\u064a\u064a\u064a\u064a \u0643\u0648\u0686\u0643\u062a\u0631 \u0628\u0648\u062f! \u0642\u0637\u0631 \u0622\u0646 \u0627\u0632 \u062f\u0648 \u0628\u0646\u062f \u0627\u0646\u06af\u0634\u062a \u062a\u062c\u0627\u0648\u0632 \u0646\u0645\u064a\u0643\u0631\u062f!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u064a\u0645\u062a \u0627\u0646 \u0643\u064a\u0641\u064a\u062a \u0644\u0627\u0632\u0645 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a \u0648 \u0627\u0635\u0644\u0627\u064b \u062d\u062a\u0649 \u0630\u0631\u0647 \u0627\u0649 \u0647\u0645 \u0645\u0632\u0647 \u0646\u0648\u062a\u0644\u0627 \u062d\u0633 \u0646\u0645\u064a\u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0646\u0645\u06cc\u0634\u0647! \u067e\u0633 \u0627\u0632 \u067e\u0631\u062f\u0627\u062e\u062a \u0648 \u062b\u0628\u062a \u0633\u0641\u0627\u0631\u0634 \u0627\u0632 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u0648 \u06af\u0641\u062a\u0646 \u0645\u0648\u0631\u062f \u0633\u0641\u0627\u0631\u0634 \u0634\u062f\u0647 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0648 \u0628\u0627\u06cc\u062f \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0631\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u0645. \u0648\u0642\u062a\u06cc \u0631\u0633\u06cc\u062f \u0645\u062a\u0648\u062c\u0647 \u0634\u062f\u0645 \u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0647 \u062d\u062f\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0633\u0641\u062a \u0628\u0648\u062f \u0648 \u0628\u0627 \u062f\u0633\u062a \u0632\u062f\u0646 \u0628\u0647\u0634 \u067e\u0648\u062f\u0631 \u0645\u06cc\u0634\u062f! \u0645\u0637\u0645\u0626\u0646\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0627\u0631\u0632\u0627\u0646\u062a\u0631\u06cc \u0647\u0645 \u0647\u0633\u062a\u0646\u062f \u067e\u0633 \u0648\u0642\u062a\u06cc \u0645\u0634\u062a\u0631\u06cc \u0628\u0647 \u0633\u0631\u0627\u063a \u0634\u0645\u0627 \u0645\u06cc\u0627\u062f \u062a\u0648\u0642\u0639 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0644\u0627 \u062f\u0627\u0631\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0643\u064a\u0643 \u0633\u064a\u0628 \u0648 \u0643\u0627\u0631\u0627\u0645\u0644 \u0628\u064a\u0627\u062a \u0628\u0648\u062f \u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u062f\u0631 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u062a\u0627\u0643\u064a\u062f \u0643\u0631\u062f\u0645 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u062f! \u0628\u0631\u0627\u064a \u0645\u0647\u0645\u0627\u0646 \u062e\u064a\u0644\u064a \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0644\u0630\u062a \u0628\u0631\u062f\u0645 \u0627\u0632 \u0637\u0639\u0645 \u0639\u0627\u0644\u06cc \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0648 \u062a\u0627\u0632\u06af\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u062e\u064a\u0644\u0649 \u0633\u0631\u064a\u0639 \u0631\u0633\u064a\u062f\n\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0648\u0644\u0649 \u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0648 \u0639\u0627\u0644\u06cc. \u0647\u0645\u0647 \u0645\u0648\u0627\u0631\u062f \u062f\u0627\u0631\u0627\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u062b\u0627\u0628\u062a \u0648 \u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0648\u062f\u0646\u062f. \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c \u062a\u0648\u0635\u06cc\u0647 \u0645\u06cc\u06a9\u0646\u0645 \u0645\u062e\u0635\u0648\u0635\u0627 \u0627\u0641\u0631\u0627\u062f\u06cc \u06a9\u0647 \u0639\u0644\u0627\u0642\u0647 \u0645\u0646\u062f \u0628\u0647 \u0646\u0648\u0634\u06cc\u062f\u0646 \u0642\u0647\u0648\u0647 \u0628\u0644\u06a9 \u0647\u0633\u062a\u0646\u062f \u0648 \u0645\u06cc\u062e\u0648\u0627\u0647\u0646\u062f \u06a9\u0645\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641 \u0648 \u0645\u0644\u0627\u06cc\u0645 \u0647\u0645\u0631\u0627\u0647 \u0642\u0647\u0648\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0646\u062f. \n\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0628\u0627 \u062f\u0642\u062a \u0648 \u0632\u06cc\u0628\u0627\u060c \u0647\u0645\u0627\u0646\u0646\u062f \u06cc\u06a9 \u0647\u062f\u06cc\u0647 \u0648 \u06a9\u0627\u062f\u0648 \u0627\u0632 \u0637\u0631\u0641 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0628\u0631\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc. \n\u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0645\u062d\u062a\u0631\u0645 \u0648 \u0628\u0631\u062e\u0648\u0631\u062f \u062e\u06cc\u0644\u06cc \u0645\u062d\u062a\u0631\u0645\u0627\u0646\u0647 \u062f\u0627\u0634\u062a.\n\u0627\u0632 \u0645\u062c\u0645\u0648\u0639\u0647 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0628\u0631\u0627\u06cc \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062e\u0648\u0628 \u0648 \u0633\u0631\u0648\u06cc\u0633  \u062e\u0648\u0628\u0634\u0648\u0646 \u0645\u0645\u0646\u0648\u0646\u0645\u060c \u06cc\u06a9 \u062a\u062c\u0631\u0628\u0647 \u0648 \u062e\u0627\u0637\u0631\u0647 \u062e\u0648\u0628 \u062f\u06cc\u06af\u0631 \u0628\u0631\u0627\u0645\u0648\u0646 \u062b\u0628\u062a \u06a9\u0631\u062f\u06cc\u062f.\n\u0634\u0627\u062f \u0648 \u067e\u0627\u06cc\u062f\u0627\u0631 \u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627 \u0628\u06cc \u0646\u0638\u06cc\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u062b\u0628\u062a \u06a9\u0627\u0645\u0644 \u0633\u0641\u0627\u0631\u0634\u060c \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646\u062f \u0648 \u06af\u0641\u062a\u0646\u062f \u0633\u0641\u0627\u0631\u0634 \u0634\u0645\u0627 \u0645\u0648\u062c\u0648\u062f \u0646\u0645\u064a\u0628\u0627\u0634\u062f. \u0627\u064a\u0646 \u0628\u0627\u0639\u062b \u0627\u0632 \u0628\u064a\u0646 \u0631\u0641\u062a\u0646 \u0628\u0631\u0646\u0627\u0645\u0647 \u0631\u064a\u0632\u0649 \u0648 \u0627\u0637\u0644\u0627\u0641 \u0648\u0642\u062a \u0645\u0634\u062a\u0631\u0649 \u062e\u0648\u0627\u0647\u062f \u0634\u062f. \u0628\u0627 \u062a\u0634\u06a9\u0631.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u062f\u0648", "\u0634\u0645\u0639 \u0634\u0634", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["Mese hamishe awli", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u062d\u062c\u0645 \u0643\u0645 \u0648 \u0642\u064a\u0645\u062a \u0632\u064a\u0627\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0637\u0639\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0642\u062f\u06cc\u0645 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0645\u062a\u0648\u0633\u0637", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", "\u0631\u0648\u0644 \u0698\u0627\u0645\u0628\u0648\u0646 \u0645\u0631\u063a", 1]}
{"text": ["\u062f\u0627\u063a \u0648 \u062a\u0627\u0632\u0647 \u0645\u062d\u0634\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0631\u06af\u06cc\u0644\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u062e\u0627\u0645\u0647 \u062f\u0627\u0634\u062a\u060c \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u0631\u0648\u0644 \u0686\u0627\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647\u060c \u0627\u0645\u0627 \u06a9\u0644 \u062c\u0639\u0628\u0647 \u06cc\u0647 \u0645\u062f\u0644 \u0628\u0648\u062f \u062a\u0648 \u0630\u0648\u0642 \u0645\u06cc\u0632\u062f\u060c \u0627\u06cc\u0646 \u0645\u062f\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u06cc\u06af\u0647 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u0648\u0647 \u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0627\u0645\u0627 \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0648 \u062e\u0627\u06a9\u0634\u06cc\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u06cc\u0646 \u0627\u0634\u06a9\u0627\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0627\u0633\u062a \u0646\u0647 \u067e\u06cc\u06a9 \u0644\u0637\u0641\u0627 \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062a\u0631 \u0631\u0627\u0647\u06cc \u0628\u0631\u0627\u06cc \u062d\u0645\u0644\u0634 \u062f\u0631 \u0646\u0638\u0631 \u0628\u06af\u06cc\u0631\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\n\u062a\u06cc\u0627\u0645\u06cc\u0633\u0648 \u0645\u0632\u0647 \u0628\u0627\u062f\u0648\u0645 \u062f\u0627\u0634\u062a \u06a9\u0647 \u0645\u0646 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", "\u067e\u0648\u062f\u06cc\u0646\u06af \u0646\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0641\u0627\u062c\u0639\u0647 \u0628\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f\n\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u062d\u062c\u0645 \u0627\u0632 \u0628\u06cc \u0645\u0633\u0626\u0648\u0644\u06cc\u062a\u06cc \u062f\u0631 \u0627\u0631\u0627\u0626\u0647 \u062e\u062f\u0645\u0627\u062a \u0645\u0646\u0627\u0633\u0628\n\u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0631\u062e\u0648\u0631\u062f\u0634 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u0645\u0648\u0646 \u0628\u0647 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646.\u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u0644\u0630\u06cc\u0630 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0631\u0633\u0628\u0627\u0646\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u067e\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0622\u0645\u062f.\n\u0627\u06af\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u062a\u0627 \u062c\u0639\u0628\u0647 \u0634\u0644 \u0648 \u0648\u0644 \u0641\u0627\u0646\u062a\u0632\u06cc \u0648 \u0632\u06cc\u0628\u0627 \u06a9\u0647 \u06a9\u0641 \u0627\u0648\u0646 \u0646\u06cc\u0645\u0647 \u0633\u062e\u062a \u0628\u0648\u062f\u060c \u0686\u0648\u0646 \u0647\u0645\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648\u0642\u062a\u06cc \u062e\u0648\u0627\u0633\u062a\u06cc\u0645 \u062a\u0648 \u06cc\u062e\u0686\u0627\u0644 \u0628\u06af\u0630\u0627\u0631\u06cc\u0645 \u06cc\u0647\u0648 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0628\u0627\u0632 \u0634\u062f \u0648 \u0631\u06cc\u062e\u062a\u0646 \u0632\u0645\u06cc\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0627\u0632 \u062a\u0648\u062c\u0647\u062a\u0648\u0646\u060c \u0646\u0627\u0646 \u0647\u0627 \u067e\u062e\u062a \u0631\u0648\u0632 \u0648 \u0628\u062e\u0648\u0628\u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0628\u062e\u0648\u0628\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u062a\u0646\u0647\u0627 \u062f\u0648 \u0645\u0648\u0631\u062f \u0648\u062c\u0648\u062f \u062f\u0627\u0634\u062a: \u06f1- \u0627\u06cc\u0646\u06a9\u0647 \u0686\u0631\u0627 \u0628\u0639\u0636\u06cc \u0627\u0648\u0642\u0627\u062a \u0645\u06cc\u0632\u0627\u0646 \u0633\u0628\u0648\u0633 \u0646\u0627\u0646 \u0647\u0627 \u06a9\u0627\u0647\u0634 \u0634\u062f\u06cc\u062f \u067e\u06cc\u062f\u0627 \u0645\u06cc \u06a9\u0646\u062f\u061f \u06f2- \u0628\u0639\u0636\u06cc \u0627\u0648\u0642\u0627\u062a \u0627\u0631\u0633\u0627\u0644 \u0631\u0627\u06cc\u06af\u0627\u0646 \u0628\u0648\u062f\u0647 \u0648 \u062f\u0631 \u0628\u0642\u06cc\u0647 \u0645\u0648\u0627\u0631\u062f \u0645\u0628\u0644\u063a \u0645\u0634\u062e\u0635\u06cc \u0628\u0631\u0627\u06cc \u0627\u0631\u0633\u0627\u0644 \u062f\u0631 \u0646\u0638\u0631 \u06af\u0631\u0641\u062a\u0647 \u0645\u06cc \u0634\u0648\u062f ( \u0627\u0644\u0628\u062a\u0647 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u06cc\u06a9 \u0646\u0631\u062e \u0645\u0634\u062e\u0635 \u0648 \u0639\u0627\u062f\u0644\u0627\u0646\u0647 \u0637\u0628\u06cc\u0639\u06cc \u0627\u0633\u062a)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0627\u0646\u062f\u0641\u0639\u0647 \u062a\u0648 \u06a9\u06cc\u0633\u0647 \u0646\u0630\u0627\u0634\u062a\u06cc\u0646 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u0645\u0627\u0646\u062f\u0647 \u0648 \u062e\u0634\u0643 \u0628\u0648\u062f\u060c \u0627\u0646\u06af\u0627\u0631 \u0633\u0627\u0639\u062a\u0647\u0627 \u062a\u0648 \u0641\u0636\u0627\u064a \u0628\u0627\u0632 \u0628\u0648\u062f\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", -1]}
{"text": ["\u0631\u0648\u0644 \u0686\u0627\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u0647\u0645\u06af\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u06a9\u0646\u062c\u062f\u06cc", 1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u060c \u06af\u0627\u0647\u06cc \u0627\u0648\u0642\u0627\u062a \u0628\u0639\u0636\u06cc \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0628\u0647 \u0646\u0638\u0631 \u067e\u062e\u062a \u0631\u0648\u0632 \u0646\u0645\u06cc \u0631\u0633\u062f \u0627\u0645\u0627 \u0628\u062f\u0644\u06cc\u0644 \u062a\u0648\u062c\u0647 \u0647\u0645\u06cc\u0634\u06af\u06cc \u06a9\u0627\u062f\u0631 \u0634\u0645\u0627 \u0642\u0627\u0628\u0644 \u0686\u0634\u0645 \u067e\u0648\u0634\u06cc \u0627\u0633\u062a \u0648 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0628\u06cc\u0634\u062a\u0631 \u0645\u0648\u0642\u0639 \u0627\u0631\u0633\u0627\u0644 \u062a\u0648\u062c\u0647 \u0634\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0686\u0627\u0648\u062f\u0627\u0631", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u0686\u0627\u0648\u062f\u0627\u0631", "\u0646\u0627\u0646 \u062c\u0648 80%", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u0627\u0646\u062f\u0641\u0639\u0647 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0646\u0627\u0646 \u0628\u0633\u064a\u0627\u0631 \u0645\u0646\u0627\u0633\u0628 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u064a \u0627\u062e\u064a\u0631\u0627\u064b \u067e\u064a\u0643 \u0647\u0627\u064a\u064a \u0643\u0647 \u063a\u0630\u0627 \u064a\u0627 \u0646\u0627\u0646 \u0631\u0648 \u0645\u064a\u0627\u0631\u0646 \u062e\u064a\u0644\u064a \u0628\u064a \u0627\u062f\u0628 \u0647\u0633\u062a\u0646\u062f \u060c \u0627\u0646\u06af\u0627\u0631 \u0637\u0644\u0628\u0643\u0627\u0631\u0646 !!! \u0628\u0633\u062a\u0631\u0648 \u067e\u0631\u062a \u0645\u064a\u0643\u0646\u0646.. \u0648\u0627\u0642\u0639\u0627\u064b \u0645\u062a\u0627\u0633\u0641\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0686\u0627\u0648\u062f\u0627\u0631", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0645\u06cc \u06a9\u0646\u0645 \u0627\u0632 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0646\u06a9\u0627\u062a \u0627\u0634\u0627\u0631\u0647 \u0634\u062f\u0647 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634 \u0642\u0628\u0644\u06cc \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0634\u0645\u0627. \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0627\u06cc\u0646 \u0633\u0637\u062d \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0645\u062f\u06cc\u0631\u06cc\u062a \u062e\u0648\u0628 \u0627\u062f\u0627\u0645\u0647 \u062f\u0627\u0631 \u0628\u0627\u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", "\u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633", "\u0686\u0627\u0631\u06a9\u06cc \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0648\u0648\u0648\u0648\u0648\u0648\u0628\u0647 \u060c \u0644\u0637\u0641\u0627 \u0643\u064a\u0641\u064a\u062a\u0634\u0648 \u062a\u063a\u064a\u064a\u0631 \u0646\u062f\u0647\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", 1]}
{"text": ["\u0647\u0631 \u0633\u0647 \u0645\u0648\u0631\u062f \u0639\u0627\u0644\u064a \u060c \u0627\u0633\u0646\u067e \u0647\u0645 \u062e\u064a\u0644\u064a \u0633\u0631\u064a\u0639 \u062a\u062d\u0648\u064a\u0644\u0645 \u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0648 \u0639\u0627\u0644\u06cc\u060c \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 1", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0641\u0627\u062c\u0639\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0645\u06cc\u0634\u0647 \u06af\u0641\u062a \u0647\u06cc\u0686\u06cc \u0627\u0632 \u06a9\u06cc\u06a9 \u0646\u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\n\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u06a9\u0648\u06a9\u06cc \u0633\u06cc\u0628 \u0647\u0648\u06cc\u062c \u0631\u0648 \u0641\u0631\u0627\u0645\u0648\u0634 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u06cc\u062f \u0628\u0630\u0627\u0631\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0627\u0646\u062f\u0627\u0632\u0647 \u0627\u0634 \u0627\u0632 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u06a9\u0648\u0686\u06cc\u06a9\u062a\u0631 \u0628\u0648\u062f. \u0633\u0627\u06cc\u0632 \u0645\u062a\u0648\u0633\u0637\u0634 \u062c\u0648\u0627\u0628\u06af\u0648\u06cc \u06f6 \u0646\u0641\u0631 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0634\u06a9\u0645\u0648 \u0646\u0628\u0627\u0634\u0646 \u0647\u0633\u062a. \u0648 \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0645\u0647\u0645\u0648\u0646\u06cc \u062e\u0627\u0646\u0648\u0627\u062f\u06af\u06cc 4 \u0627\u0644\u06cc 5 \u0646\u0641\u0631\u0647 \u0645\u0646\u0627\u0633\u0628\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0631\u0686\u06cc \u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u062f\u0627\u0634\u062a\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646! \u06a9\u06cc\u06a9 \u062d\u062f\u0627\u0642\u0644 \u0645\u0627\u0644\u0647 2 \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0648 \u0628\u0648\u06cc \u0645\u0648\u0646\u062f\u06af\u06cc \u06cc\u062e\u0686\u0627\u0644 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", -1]}
{"text": ["\u0631\u0627\u0636\u064a\u0645 \u0627\u0632\u062a\u0648\u0646! \u0627\u064a\u0646 \u0686\u064a\u0632\u0643\u064a\u0643 \u0643\u0627\u0631\u0627\u0645\u0644 \u0648 \u0647\u0645\u064a\u0646\u062c\u0648\u0631\u064a \u0628\u0645\u0648\u0646\u0647 \u0645\u0646 \u0645\u0634\u062a\u0631\u064a \u062b\u0627\u0628\u062a \u0645\u064a\u0634\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0633\u0646\u067e \u062e\u06cc\u0644\u06cc\u06cc \u062f\u06cc\u0631 \u06a9\u0631\u062f \u0622\u062e\u0647\u06f5\u06f0 \u062f\u0642\u06cc\u0647 \u0648\u0627\u0633\u0647 \u06a9\u06cc\u06a9 \u06a9\u0644\u0627 \u0631\u0627\u0647\u0634 \u06cc\u0647 \u0631\u0628\u0639 \u0647\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0627\u0646\u062f\u0647 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f\u0646\u062f \u0628\u0631\u062e\u0644\u0627\u0641 \u062e\u0631\u06cc\u062f \u062d\u0636\u0648\u0631\u06cc \u0627\u0632 \u0627\u06cc\u0646 \u0634\u0639\u0628\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647......\u200c\u200c\u200c\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0645\u0627\u062c (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647\u200c\u0627\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0647\u0645 \u06a9\u0647 \u0645\u0634\u062a\u0631\u06cc \u062b\u0627\u0628\u062a\u0634 \u0647\u0633\u062a\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["Awesome service! Delicious fresh bakery!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u06cc\u06a9\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u06a9\u0648\u0686\u06a9 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639\u062a\u0631 \u0627\u0632 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0631\u062f\u0645 \u0631\u0633\u06cc\u062f \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0686\u0631\u0627 \u0642\u06cc\u0645\u062a\u0634 \u0631\u0648 \u062a\u0646\u062f \u06a9\u0631\u062f\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u062e\u0631\u0645\u0627\u06cc\u06cc \u0633\u0648\u062e\u062a\u0647 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0647\u0645 \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0645\u062d\u062a\u0631\u0645 \u0647\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", 1]}
{"text": ["\u062a\u0627\u062e\u06cc\u0631 \u062f\u0648 \u0633\u0627\u0639\u062a\u0647  \n \u0648\u0627\u0642\u0639\u0627 \u0628\u062f  \n \u0633\u0627\u0639\u062a 8/37 \u062f\u0642\u06cc\u0642\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 10/40\u062f\u0642\u06cc\u0642\u0647 \u062a\u062c\u0648\u06cc\u0644 \u06af\u0631\u0641\u062a\u0645 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0648 \u0639\u0627\u0644\u06cc \u0648 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0648\u06a9\u06cc\u0648\u0645 \u0634\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u062f \u060c\u060c \u0647\u0645\u0648\u0627\u0631\u0647 \u062f\u0631 \u0627\u06cc\u0646 \u0631\u0627\u0647 \u0645\u0648\u0641\u0642 \u0648 \u067e\u06cc\u0631\u0648\u0632 \u0628\u0627\u0634\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0686\u0642\u062f\u0631 \u062f\u06cc\u0631 \u0634\u0645\u0627 \u0631\u0648 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0645 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062a\u0648\u0646 \u0628\u06cc\u0646\u0638\u06cc\u0631\u0647 \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (10 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u062e\u0635\u0648\u0635 \u067e\u0648\u0631\u067e\u0648\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0635\u0641 \u062c\u0639\u0628\u0647 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0646\u0635\u0641 \u062c\u0639\u0628\u0647 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u0649 \u0645\u062b\u0644 \u0633\u0646\u06af \u062e\u0634\u0643 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0633\u0631\u0639\u062a \u0639\u0645\u0644 \u0628\u0627\u0644\u0627\u06cc \u0634\u0645\u0627.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0644\u0648\u0686\u0647 \u062e\u0631\u0645\u0627\u06cc\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u0627\u0632 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0647\u0645 \u0645\u0645\u0646\u0648\u0646\u0645 \u0628\u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", 1]}
{"text": ["\u0643\u0631\u0648\u0633\u0627\u0646 \u062e\u064a\u0644\u064a \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u0649 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u064a\u0631\u064a\u0646\u0649 \u0639\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0647\u0631\u0628\u0627\u0631 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u0628\u0644 \u0627\u0641\u062a \u062f\u0627\u0631\u0647...\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0648\u06cc \u0632\u062d\u0645 \u062a\u062e\u0645\u200c\u0645\u0631\u063a \u0645\u06cc\u062f\u0627\u062f..\n\u0634\u0631\u06cc\u0646\u06cc\u0647\u0627 \u06a9\u0644\u0627 \u0633\u0646\u06af\u06cc\u0646 \u0647\u0633\u062a\u0646\u062f \u0648 \u0628\u0639\u062f\u0634\u0622\u062f\u0645\u200c\u06a9\u0627\u0645\u0644\u0627 \u0627\u062d\u0633\u0627\u0633 \u0633\u0646\u06af\u06cc\u0646\u06cc \u0648 \u0628\u062f\u06cc \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0648 \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f...\n\u0628\u0631\u0627\u0646\u06cc \u0647\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0628\u0627\u0641\u062a\u0634\u0648\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0627\u0645\u0627 \u0628\u0631\u0627\u06cc \u0633\u0644\u06cc\u0642\u0647 \u0645\u0627 \u06a9\u0645\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0634\u0648\u0646 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f...\n\u0633\u0641\u0627\u0631\u0634 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u062d\u062a\u06cc \u0632\u0648\u062f\u062a\u0631 \u0628\u0647 \u062f\u0633\u062a\u0645\u0648\u0646 \u0645\u06cc\u0631\u0633\u0647.\n\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062e\u062f\u0645\u0627\u062a\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc :)\n\n\u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0627\u06a9\u06cc\u062f \u0645\u0646 \u0627\u06cc\u0646\u0647 \u06a9\u0647 \u0633\u0648\u0641\u0644\u0647 \u0634\u06a9\u0644\u0627\u062a \u0631\u0648 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0646\u06cc\u062f. \u06a9\u0647 \u062d\u062a\u0645\u0627 \u0628\u0627\u06cc\u062f \u0627\u0648\u0644 \u062a\u0648\u06cc \u0645\u0627\u06a9\u0631\u0648\u06cc\u0648 \u0628\u0630\u0627\u0631\u06cc\u062f \u06a9\u0647 \u0634\u06a9\u0644\u0627\u062a \u062a\u0648\u0634 \u06cc\u06a9\u0645 \u0622\u0628 \u0634\u0647. (\u062d\u062f\u0648\u062f \u06f3\u06f0 \u062b\u0627\u0646\u06cc\u0647) \n\u0641\u0642\u0637 \u0627\u0632 \u0627\u06cc\u0646 \u06a9\u0647 \u062a\u062e\u0641\u06cc\u0641\u0634\u0648 \u0628\u0631\u062f\u0627\u0634\u062a \u0686\u0646\u062f\u0627\u0646 \u062e\u0648\u0634\u062d\u0627\u0644 \u0646\u06cc\u0633\u062a\u0645 :/", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", 1]}
{"text": ["\u0645\u06cc\u06a9\u0633 \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0627\u0646\u0642\u062f\u0631 \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f \u06a9\u0647 \u06cc\u0647 \u062c\u0648\u0631\u0627\u06cc\u06cc \u062a\u0639\u062c\u0628 \u06a9\u0631\u062f\u0645 \u0648\u0642\u062a\u06cc \u062c\u0639\u0628\u0647 \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0645 ! \u0647\u0631 \u06a9\u062f\u0648\u0645 \u0642\u062f \u062f\u0648 \u0628\u0646\u062f \u0627\u0646\u06af\u0634\u062a \u0628\u0648\u062f\u0646. \u0627\u0635\u0644\u0627\u0646\u0645\u06cc \u0627\u0631\u0632\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0631\u0648\u0633\u062a\u064a\u0643 \u0641\u0631\u0646\u0686 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u06cc\u0633\u06a9\u062a", "\u0631\u0648\u0633\u062a\u06cc\u06a9 \u0641\u0631\u0646\u0686", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", -1]}
{"text": ["\u0627\u06af\u0631 \u0637\u0639\u0645 \u0647\u0648\u06cc\u0686\u0634 \u0645\u0634\u0647\u0648\u062f \u062a\u0631 \u0628\u0648\u062f \u0628\u0647\u062a\u0631 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633\u0634  \u062a\u0642\u0631\u06cc\u0628\u0627 \u0627\u0632 \u06f9 \u0637\u0639\u0645 5\u0637\u0639\u0645 \u062f\u0627\u0634\u062a \n\u06cc\u0647 \u06a9\u0645 \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0627\u0634\u0647 \u0639\u0627\u0644\u06cc \u062a\u0631\u06cc\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0642\u06cc\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc\u060c \u062a\u0627\u0632\u0647 \u0628\u0648\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f.\u0628\u0633\u06cc\u0627\u0631 \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0637\u0639\u0645\u0634\u0648\u0646 \u062e\u0648\u0628\u0647 \u0648\u0644\u06cc \u0648\u0627\u0642\u0639\u0627\u064b \u06af\u0631\u0648\u0646\u0647 \u0628\u0627 \u0627\u06cc\u0646 \u062d\u062c\u0645 \u06a9\u0645\u06cc \u06a9\u0647 \u062f\u0627\u0631\u0646 : ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", -1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0648 \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0627\u0632 \u0637\u0639\u0645 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631 \u0645\u0648\u0631\u062f \u067e\u0627\u06cc \u0633\u06cc\u0628 \u062e\u0645\u06cc\u0631 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0646\u0633\u0628\u062a \u0628\u0647 \u062e\u0645\u06cc\u0631 \u067e\u0627\u06cc\u200c \u06a9\u0647 \u0628\u0627\u06cc\u062f \u06a9\u0645\u06cc \u0641\u0642\u0637 \u0646\u0645\u06a9 \u062f\u0631 \u0622\u0646 \u0628\u0627\u0634\u062f \u062f\u0631 \u0627\u06cc\u0646 \u062e\u0645\u06cc\u0631 \u0645\u0642\u062f\u0627\u0631 \u0632\u06cc\u0627\u062f\u062a\u0631\u06cc \u0646\u0645\u06a9 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0632\u0647 \u0634\u0648\u0631\u06cc \u0646\u0633\u0628\u062a \u0628\u0647 \u0633\u06cc\u0628 \u0628\u06cc\u0634\u062a\u0631 \u062d\u0633 \u0645\u06cc\u200c\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0648 \u0633\u0646\u06af\u06cc\u0646 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0627\u0633\u062a \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c\u062a\u0648\u0646...\u0645\u0639\u062a\u0627\u062f \u0634\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u06a9\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648 \u0645\u06cc\u06af\u06cc\u0631\u0645 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f\u0647\u061b \u0627\u0645\u0627 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a\u061b \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u0627\u0645\u0644\u0627 \u0628\u0627 \u062f\u0641\u0639\u0627\u062a \u0642\u0628\u0644 \u0641\u0631\u0642 \u0645\u06cc\u06a9\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0646\u0627\u0646 \u0647\u0627 \u0648 \u067e\u062e\u062a \u0631\u0648\u0632 \u0628\u0648\u062f\u0646 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0622\u0646\u0647\u0627. \u062f\u0631 \u0635\u0648\u0631\u062a \u0627\u0645\u06a9\u0627\u0646 \u062a\u0627\u0631\u06cc\u062e \u067e\u062e\u062a \u0646\u0627\u0646 \u0647\u0627 \u0631\u0648\u06cc \u0628\u0633\u062a\u0647 \u0646\u0627\u0646 \u0647\u0627 \u062c\u0647\u062a \u0646\u06af\u0647\u062f\u0627\u0631\u06cc \u0628\u0647\u06cc\u0646\u0647 \u062f\u0631\u062c \u0634\u0648\u062f \u0648 \u0646\u0627\u0646 \u0647\u0627\u06cc \u0628\u0632\u0631\u06af\u200c\u062a\u0631 \u0646\u06cc\u0632 \u0628\u0647\u062a\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u0648\u062f \u0628\u0647 \u062c\u0627\u06cc \u0642\u0631\u0627\u0631 \u062f\u0627\u062f\u0646 \u062f\u0631 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9 \u0647\u0627\u06cc \u062f\u0633\u062a\u0647 \u062f\u0627\u0631 \u0645\u0639\u0645\u0648\u0644\u06cc.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633", "\u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633", "\u0644\u0642\u0645\u0647 \u0633\u0628\u0648\u0633", 1]}
{"text": ["Ye kuchulu tul keshid ta hazer she befrestan vali peyk dar arze 10 deyghe ovord o kheili khub bud mamnun", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc!\n\u0648\u0644\u06cc \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0633\u06cc\u0631 \u06cc\u0627\u0628\u06cc \u0636\u0639\u06cc\u0641\u06cc \u062f\u0627\u0634\u062a\u0646\u061b\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0631\u0633\u0648\u0646\u062f\u0646!\n\u0641\u062f\u0627\u06cc \u0633\u0631 \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0647\u0627\u0634 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u064a \u0628\u0627 \u0639\u0643\u0633\u0634 \u0641\u0631\u0642 \u062f\u0627\u0634\u062a \u0648 \u062a\u0648 \u0630\u0648\u0642\u0645 \u062e\u0648\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u0643\u0627\u0634 \u0645\u064a\u0634\u062f \u0627\u0632 \u0647\u0631 \u0646\u0648\u0639 \u0634\u064a\u0631\u064a\u0646\u064a \u0645\u0642\u062f\u0627\u0631 \u0643\u0645\u062a\u0631\u064a \u0633\u0641\u0627\u0631\u0633 \u062f\u0627\u062f \u0645\u062b\u0644\u0627 \u06af\u0632\u064a\u0646\u0647 \u0647\u0627 \u0665\u0660\u0660 \u06af\u0631\u0645 \u0648 \u0663\u0660\u0660 \u06af\u0631\u0645\u064a \u064a\u0627 \u062a\u0639\u062f\u0627\u062f\u064a \u0648\u062c\u0648\u062f \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u062d\u062c\u0645 \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc", 1]}
{"text": ["\u0634\u06a9\u0644\u0627\u062a \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0648 \u062e\u0648\u0628\u060c \u062f\u0631 \u062a\u0635\u0648\u06cc\u0631 \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0646\u0638\u0631 \u0645\u06cc\u0627\u062f \u0648\u0644\u06cc \u062a\u0642\u0631\u06cc\u0628\u0627 \u06a9\u0644 \u062c\u0639\u0628\u0647 \u0645\u0631\u0628\u0639 \u0634\u06a9\u0644 \u0634\u06a9\u0644\u0627\u062a \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0641 \u062f\u0633\u062a \u0647\u0633\u062a\u060c \u0634\u06a9\u0644\u0627\u062a\u0647\u0627\u06cc \u06a9\u0648\u0686\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0647 \u062a\u0627\u06cc\u06cc \u0628\u0627 \u0686\u06cc\u062f\u0645\u0627\u0646 \u062e\u0648\u0628. \u062c\u0639\u0628\u0647 \u0645\u06cc\u06a9\u0633 \u0628\u0627 \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc\u060c \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0648 \u0645\u0631\u062a\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0686\u06cc\u062f\u0645\u0627\u0646 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.\u0633\u0647 \u0646\u0648\u0639 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645\u0627\u0646\u0637\u0648\u0631 \u06a9\u0647 \u062f\u0631 \u062a\u0635\u0648\u06cc\u0631 \u0645\u0634\u062e\u0635 \u0647\u0633\u062a \u0628\u0647 \u06cc\u06a9 \u0646\u0633\u0628\u062a \u0642\u0631\u0627\u0631 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc \u0634\u0628\u06cc\u0647 \u0628\u0647 \u0633\u0648\u0647\u0627\u0646 \u0647\u0633\u062a\u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u067e\u0633\u062a\u0647 \u0627\u06cc \u06a9\u0645\u06cc \u0631\u0637\u0648\u0628\u062a \u0628\u0631\u062f\u0627\u0634\u062a\u0647 \u0628\u0648\u062f \u0648 \u0627\u0632 \u062d\u0627\u0644\u062a \u062a\u0631\u062f \u0628\u0648\u062f\u0646 \u062e\u0627\u0631\u062c \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0645\u0648\u0642\u0639 \u0642\u0631\u0627\u0631 \u062f\u0627\u062f\u0646 \u062f\u0631 \u062f\u0647\u0627\u0646 \u06a9\u0647 \u0645\u06cc\u062e\u0648\u0627\u0647\u06cc\u062f \u06af\u0627\u0632 \u0628\u0632\u0646\u06cc\u062f \u06a9\u0634 \u0645\u06cc\u0648\u0645\u062f (\u062f\u0631 \u062d\u0627\u0644\u06cc\u06a9\u0647 \u0630\u0627\u062a\u0627 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0635\u0648\u0631\u062a \u062a\u0631\u062f \u0645\u06cc \u0628\u0627\u06cc\u0633\u062a \u0628\u0627\u0634\u062f) \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0648 \u0648 \u0628\u0627\u062f\u0627\u0645 \u062f\u0631 \u0627\u06cc\u0646 \u062c\u0639\u0628\u0647 \u0645\u06cc\u06a9\u0633 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0631\u0637\u0648\u0628\u062a \u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u0646\u0647 \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u067e\u0633\u062a\u0647 \u0627\u06cc. \u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u0627\u06cc\u0646 \u062c\u0639\u0628\u0647 \u0645\u06cc\u06a9\u0633 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0627 \u0645\u0642\u062f\u0627\u0631 \u0637\u0639\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0645\u0646\u0627\u0633\u0628 \u0647\u0633\u062a. \u062a\u0646\u0647\u0627 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0645\u0646 \u0627\u0632 \u0639\u0632\u06cc\u0632\u0627\u0646 \u0645\u062c\u0645\u0648\u0639\u0647 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0634\u0639\u0628\u0647 \u062c\u0631\u062f\u0646 \u0627\u06cc\u0646 \u0647\u0633\u062a \u06a9\u0647 \u0634\u0631\u0627\u06cc\u0637\u06cc \u0641\u0631\u0627\u0647\u0645 \u06a9\u0646\u0646\u062f \u06a9\u0647 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0637\u0648\u0628\u062a \u0628\u062e\u0648\u062f \u0646\u06af\u06cc\u0631\u0646\u062f \u0648 \u0647\u0645\u0627\u0646 \u0630\u0627\u062a \u062a\u0631\u062f \u062e\u0648\u062f \u0628\u0635\u0648\u0631\u062a \u0635\u062f \u062f\u0631\u0635\u062f \u06a9\u0627\u0645\u0644 \u062d\u0641\u0638 \u06a9\u0646\u0646\u062f.  \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0631 \u062f\u0648 \u062c\u0639\u0628\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0634\u06cc\u06a9 \u0628\u0627 \u062d\u0648\u0635\u0644\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.  \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06a9\u0647 \u0634\u0631\u0627\u06cc\u0637 \u0633\u0641\u0627\u0631\u0634 \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u06cc \u062e\u0648\u0628 \u0641\u0631\u0627\u0647\u0645 \u0645\u06cc\u06a9\u0646\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06a9\u0644\u0627\u062a (9 \u062a\u0627\u06cc\u06cc)", "\u062c\u0639\u0628\u0647 \u0645\u06cc\u06a9\u0633 \u0628\u0627 \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af \u0648 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u062e\u0627\u0645\u0647 \u06af\u06cc\u0644\u0627\u0633\u060c \u06a9\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648 \u0648 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c\u0634 \u062a\u0639\u0631\u06cc\u0641\u06cc \u0646\u062f\u0627\u0634\u062a\u0646\u060c \u062e\u0627\u0645\u0647 \u06af\u06cc\u0644\u0627\u0633 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0628\u06cc \u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u06a9\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0648 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u06a9\u0647 \u0631\u0633\u0645\u0627 \u062a\u0648\u06cc \u0630\u0648\u0642\u0645 \u0632\u062f \u0627\u0648\u0646\u0642\u062f\u0631 \u06a9\u0647 \u0645\u0632\u0647 \u06cc \u062f\u0627\u0631\u0686\u06cc\u0646 \u063a\u0627\u0644\u0628 \u0628\u0648\u062f \u0648 \u0646\u0645\u06cc \u06af\u0630\u0627\u0634\u062a \u0637\u0639\u0645 \u0628\u0627\u0642\u06cc \u0645\u0648\u0627\u062f \u0631\u0648 \u0645\u062a\u0648\u062c\u0647 \u0628\u0634\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062f\u0631 \u0648\u0636\u0639\u06cc\u062a \u0646\u0627\u0645\u0646\u0627\u0633\u0628\u06cc \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u062e\u0635\u0648\u0635\u0627 \u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u0643", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0632\u0631\u0634\u06a9 (\u062f\u0627\u0646\u0647 \u0627\u06cc)", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u0647\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u062f\u0642\u062a \u0644\u0627\u0632\u0645 \u062f\u0631 \u062c\u0627\u0628\u062c\u0627\u06cc\u06cc \u0631\u0648 \u0646\u062f\u0627\u0631\u0646 \u0648 \u0638\u0627\u0647\u0631 \u06a9\u06cc\u06a9 \u0647\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f.\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0631\u0627\u0647 \u062d\u0644\u06cc \u0628\u0631\u0627\u06cc \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u067e\u06cc\u062f\u0627 \u06a9\u0646\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0643\u064a\u0643 \u0647\u0627 \u0642\u0627\u0637\u064a \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0646\u0642\u062f\u0631 \u0643\u0647 \u0628\u062f \u0622\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u062a\u0631\u06cc\u067e\u0644 \u0686\u0627\u06a9\u0644\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", -1]}
{"text": ["\u0645\u0646 \u0641\u0627\u062c \u0628\u0631\u0627\u0646\u064a \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0643\u0647 \u0643\u0644\u0627 \u064a\u0643 \u0645\u062f\u0644 \u0628\u0631\u0627\u0646\u064a \u062f\u064a\u06af\u0631 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647!! \u062f\u0631 \u0635\u0648\u0631\u062a \u0639\u062f\u0645 \u0645\u0648\u062c\u0648\u062f\u064a \u0628\u0627\u064a\u062f \u0627\u0637\u0644\u0627\u0639 \u0631\u0633\u0627\u0646\u064a \u0634\u0648\u062f \u0648 \u062f\u0631 \u0635\u0648\u0631\u062a \u0631\u0636\u0627\u064a\u062a \u0646\u0648\u0639 \u0633\u0641\u0627\u0631\u0634 \u0639\u0648\u0636 \u0634\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0631\u0627\u0646\u0646\u062f\u0647 \u067e\u064a\u0643 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0627\u06cc\u062f \u062e\u0627\u0645\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u0646\u0647 \u067e\u0646\u06cc\u0631 .. \u062a\u0645\u0627\u0645 \u06a9\u06cc\u06a9\u0647\u0627 \u067e\u0631 \u0627\u0632 \u067e\u0646\u06cc\u0631 \u0628\u0648\u062f \u06a9\u0647 \u0633\u0641\u062a \u0647\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u067e\u0631\u062d\u062c\u0645 \u0628\u0648\u062f.. \u062d\u062a\u06cc \u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0627\u0648\u0646\u0642\u062f\u0631 \u0633\u06cc\u0628\u0634 \u0645\u0639\u0644\u0648\u0645 \u0646\u0628\u0648\u062f \u06a9\u0647 \u062f\u0648\u0628\u0627\u0631\u0647 \u0686\u06a9 \u06a9\u0631\u062f\u0645 \u0686\u06cc \u0628\u0648\u062f \u0633\u0641\u0627\u0631\u0634! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0647\u0631 3 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0647 \u062e\u0635\u0648\u0635 \u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u064a\u062f \u0648 \u062e\u064a\u0644\u064a \u062e\u0648\u0634 \u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u067e\u0627\u0633\u062e\u06af\u0648\u06cc\u06cc \u0627\u067e\u0631\u0627\u062a\u0648\u0631\u0647\u0627\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646\n\u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \n\u0648\u0644\u06cc \u062e\u0628 \u06a9\u0634\u0645\u0634\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0632\u0628\u0627\u0646 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u0647\u0627 \u0639\u0627\u0644\u06cc\u0647 \u060c \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0633\u062a\n\u0641\u0642\u0637 \u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u06cc\u06a9\u0645 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\n\u0644\u0637\u0641\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0628\u0641\u0631\u0633\u062a\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 \u0628\u0627 \u0632\u0631\u062f \u0622\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0686\u0631\u0627 \u0628\u06cc \u062f\u0644\u06cc\u0644 25% \u0642\u06cc\u0645\u062a \u06af\u0631\u0627\u0646 \u0634\u062f\u0647 \u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", -1]}
{"text": ["\u0628\u0646\u0638\u0631\u0645 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0646\u0627\u0646\u0648\u0627\u06cc\u06cc \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc....\n\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0648\u0646 \u0647\u0627 \u0648 \u06a9\u06cc\u06a9 \u0647\u0627\u0634\u0648\u0646 \u0639\u0627\u0644\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u06a9\u0648\u0686\u06a9 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0634\u06a9", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0686\u0642\u062f\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0648 \u0639\u0627\u0627\u0627\u0644\u06cc....\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u062e\u0648\u0628\u060c \u062e\u0635\u0648\u0635\u0627\u064b \u0627\u064a\u0646\u0643\u0647 \u0628\u0627 \u0622\u0631\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631\u0647.. \u0641\u0642\u0637 \u0627\u06af\u0631 \u0643\u0645 \u0634\u064a\u0631\u064a\u0646 \u062a\u0631 \u0628\u0627\u0634\u0647 \u0628\u0631\u0627\u064a \u0628\u064a\u0645\u0627\u0631\u0627\u0646 \u0647\u0645 \u0639\u0627\u0644\u064a \u0645\u064a\u0634\u0647.. \u064a\u0647 \u0643\u0645 \u0634\u064a\u0631\u064a\u0646\u064a\u0634 \u0628\u0647 \u0646\u0633\u0628\u062a \u0631\u0698\u064a\u0645\u064a \u0628\u0648\u062f\u0646 \u0632\u064a\u0627\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\u0628\u0639\u0646\u0648\u0627\u0646 \u0627\u0648\u0644\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0631\u0639\u06a9\u0633 \u0647\u0645\u06cc\u0634\u0647\u060c \u0628\u0633\u06cc\u0627\u0631 \u0645\u0627\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0634\u0627\u0647\u062f\u0627\u0646\u0647 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646\u062f\u060c\u06a9\u0627\u0634 \u0627\u062f\u0627\u0645\u0647 \u06cc\u0627\u0628\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627\u0633\u0644\u0627\u0645 \u0648 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a\u062a\u0648\u0646.\u0631\u0627\u0633\u062a\u0634 \u0645\u0646 \u0628\u0647 \u0635\u0648\u0631\u062a \u062d\u0636\u0648\u0631\u06cc \u062e\u06cc\u0644\u06cc \u0627\u0632 \u0646\u0627\u0646 \u062c\u0645 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0648 \u0647\u0631 \u0633\u0631\u06cc \u0647\u0645 \u062a\u0627\u0632\u0647 \u062a\u0631\u06cc\u0646\u0647\u0627 \u0631\u0648 \u0628\u0631\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u062f\u0631\u0646\u0638\u0631 \u0645\u06cc\u06af\u06cc\u0631\u0646\u060c\u062d\u062a\u06cc \u0627\u06af\u0647 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062f\u06cc\u0631\u0648\u0632 \u0648 \u0627\u0645\u0631\u0648\u0632 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0646 \u0628\u0627\u0635\u062f\u0627\u0642\u062a \u0645\u06cc\u06af\u0646 \u0648 \u0627\u0632 \u062a\u0627\u0632\u0647 \u062a\u0631\u06cc\u0646\u0647 \u0645\u06cc\u062f\u0646.\u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u0648 \u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0648 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c\u0645\u062e\u0635\u0648\u0635\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u06a9\u0647 \u0645\u06cc\u0647\u0645\u0627\u0646\u0627\u0646\u0645 \u0628\u0647\u0645 \u0627\u0635\u0631\u0627\u0631 \u062f\u0627\u0634\u062a\u0646 \u0686\u0648\u0646 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a \u0645\u0646 \u06a9\u0647 \u0628\u0627\u0631\u062f\u0627\u0631\u0645 \u0646\u062e\u0648\u0631\u0645...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0639\u062f\u0645 \u0645\u0648\u062c\u0648\u062f\u06cc  \u0633\u0641\u0627\u0631\u0634\n\u062a\u0645\u0627\u0633 \u0646\u0627\u0646 \u062c\u0645\n\u062c\u0627\u06cc\u06af\u0632\u06cc\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u06cc\u06af\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u0628\u0627 \u0634\u0647\u062f \u0627\u0646\u06af\u0648\u0631", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u0647\u0645\u0634\u0648\u0646 \u0648\u0644\u06cc \u0627\u06cc\u06a9\u0627\u0634 \u06cc\u0647 \u06a9\u0648\u0686\u0648\u0644\u0648 \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633 \u0627\u0632 \u0645\u0639\u062f\u0648\u062f \u0634\u064a\u0631\u0628\u0646\u0649 \u0641\u0631\u0648\u0634\u0649 \u0647\u0627\u064a\u0649 \u0647\u0633\u062a \u0643\u0647 \u0634\u064a\u0631\u064a\u0646\u0649 \u0648 \u0643\u064a\u0643 \u0647\u0627\u0649 \u0628\u0633\u064a\u0627\u0631 \u062a\u0627\u0632\u0647 \u0631\u0648 \u062f\u0631 \u0627\u062e\u062a\u064a\u0627\u0631 \u0645\u0634\u062a\u0631\u064a\u0627\u0646 \u0627\u064a\u0646\u062a\u0631\u0646\u062a\u0649 \u0642\u0631\u0627\u0631 \u0645\u064a\u062f\u0647\u062f \u0648\u0627\u064a\u0646 \u0628\u0627\u0639\u062b \u0627\u0639\u062a\u0645\u0627\u062f \u0645\u0627 \u0645\u0634\u062a\u0631\u064a\u0627\u0646 \u0628\u0647 \u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633 \u0647\u0633\u062a \u0648 \u0647\u0645\u0686\u0646\u064a\u0646 \u0639\u0645\u0644\u0643\u0631\u062f \u0648 \u0633\u0631\u0639\u062a \u0648 \u062f\u0642\u062a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u0649 \u0647\u0633\u062a \u0627\u0632 \u0647\u0631 \u062f\u0648\u0649 \u0622\u0646\u0647\u0627 \u0628\u0633\u064a\u0627\u0631 \u0645\u062a\u0634\u0643\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0646\u0648\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0634\u0648\u0631 \u0628\u0648\u062f \u060c\u0646\u0645\u06a9 \u0632\u06cc\u0627\u062f\u06cc \u062f\u0627\u0634\u062a \u0648 \u0645\u0648\u0627\u062f \u062f\u0627\u062e\u0644 \u067e\u0627\u06cc \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f \u060c \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u062f\u0631 \u062f\u0633\u062a\u0648\u0631 \u067e\u062e\u062a\u0634 \u062a\u062c\u062f\u06cc\u062f \u0646\u0638\u0631 \u06a9\u0646\u06cc\u062f. \u0627\u0644\u0628\u062a\u0647 \u0645\u0646 \u0627\u0632 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062f\u06cc\u06af\u0647 \u062a\u0627 \u062d\u0627\u0644\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u062c\u0632 \u0627\u06cc\u0646 \u067e\u0627\u06cc.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0645\u0631\u0628\u0627\u064a \u0632\u0634\u0643 \u0643\u064a\u0641\u064a\u062a \u062e\u0648\u0628\u064a \u0646\u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", -1]}
{"text": ["\u0627\u06af\u0631 \u0631\u0627\u0633\u062a \u0645\u06cc\u06af\u06cc\u062f \u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0628\u0647\u062a\u0631 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0645\u0639\u0631\u0641\u06cc \u06a9\u0646\u06cc\u062f. \n[ \u0645\u06cc\u062f\u0648\u0646\u0645 \u0646\u0645\u06cc\u062a\u0648\u0646\u06cc\u062f. \u062a\u0644\u0627\u0634 \u0646\u06a9\u0646\u06cc\u062f ]", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a\u0632 \u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u0649 \u0645\u062e\u0635\u0648\u0635\u0627 \u0633\u0631\u0639\u062a \u0639\u0645\u0644 \u0627\u0633\u0646\u067e \u0627\u0643\u0633\u067e\u0631\u0633 \u0634\u06af\u0641\u062a \u0627\u0646\u06af\u064a\u0632 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 3", "\u0645\u0631\u0628\u0627 \u0632\u0631\u0634\u06a9 \u06a9\u0648\u0686\u06a9", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a \u0639\u0627\u0644\u064a. \u0645\u0631\u0633\u064a \u0627\u0632 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u06a9\u06cc\u06a9\u200c\u0647\u0630 \u0628\u0647 \u0646\u0638\u0631 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646. \u0645\u0642\u0648\u0627\u06cc \u0632\u06cc\u0631\u0634\u0648\u0646 \u0627\u0632 \u0631\u06cc\u062e\u062a \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u062c\u0648\u0631\u06cc \u06a9\u0647 \u0627\u0646\u06af\u0627\u0631 \u06cc\u0647 \u0647\u0641\u062a\u0633\u062a \u062a\u0648 \u06cc\u062e\u0686\u0627\u0644 \u0628\u0648\u062f\u0646. \u062e\u0627\u0645\u0647 \u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u0647\u0645 \u06a9\u0645\u06cc \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646. \u062e\u0644\u0627\u0635\u0647 \u0627\u0635\u0644\u0627 \u0627\u0646\u062a\u0638\u0627\u0631 \u0646\u062f\u0627\u0634\u062a\u0645! \u0645\u0632\u0647 \u0634\u0648\u0646 \u0648\u0644\u06cc \u0628\u062f \u0646\u0628\u0648\u062f\u060c \u062e\u0627\u0635 \u0647\u0645 \u0646\u0628\u0648\u062f. \u0645\u0639\u0645\u0648\u0644\u06cc...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": ["\u0639\u0627\u0634\u0642 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0627\u062a\u0648\u0646\u0645 ... \u0645\u0631\u0633\u06cc \u06a9\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u0628\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u0627\u0647\u0645\u06cc\u062a \u0645\u06cc \u062f\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0647\u0645 \u0646\u0627\u0646 \u0633\u06cc\u0631 \u0648 \u0632\u06cc\u062a\u0648\u0646\n\u0647\u0645 \u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633\n\u0647\u0645 \u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0639\u0627\u0644\u06cc\n\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0631 \u0648 \u0632\u06cc\u062a\u0648\u0646", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0643\u064a\u0641\u064a\u062a \u0648 \u0633\u0631\u0639\u062a \u0627\u0631\u0633\u0627\u0644 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627\u06cc \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0631\u0627 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0645\u0646\u0627\u0633\u0628 \u0627\u0632 \u0646\u0637\u0631 \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0641\u0631\u0633\u062a\u06cc\u0646 \u06a9\u0647 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u067e\u062e\u0634 \u0648 \u067e\u0644\u0627 \u0646\u0634\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0634\u06a9 \u0641\u0644\u0648\u0631\u0646\u062a\u06cc\u0646\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u06a9\u0632\u06cc\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u0647\u0631 \u0633\u0647 \u0639\u062f\u062f \u06a9\u0627\u0645\u0644\u0627 \u062a\u0644\u062e \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0628\u0631\u0627\u0645 \u062e\u06cc\u0644\u06cc \u0639\u062c\u06cc\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", -1]}
{"text": ["\u062a\u0633\u062a \u0633\u0648\u06cc\u062a\u0627\u0644 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u062a\u0642\u0631\u06cc\u0628\u0627 \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0647 \u0627\u0632 \u0646\u0638\u0631 \u0645\u0646 \u062e\u06cc\u0644\u06cc \u0628\u0639\u06cc\u062f \u0628\u0648\u062f \u0627\u0632  \u0646\u0627\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u062a\u0633\u062a \u0686\u0627\u0648\u062f\u0627\u0631 \u06a9\u0648\u0686\u06a9", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u062a\u0633\u062a \u0633\u0648\u06cc\u062a\u0627\u0644", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u0631.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645\u060c \u0686\u0631\u0627 \u067e\u0646\u06cc\u0631\u06cc \u0628\u0648\u062f\u061f!  \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0633\u0645\u0634 \u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645 \u0646\u06cc\u0633\u062a\u0627\u0627\u0627 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645", "\u0634\u0648\u0631\u06cc\u0646\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u062f\n\u0648\u0644\u06cc \u0639\u06a9\u0633 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0628\u0627 \u0627\u0648\u0646 \u0645\u062f\u0644\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0641\u0627\u0648\u062a \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0628\u0631 \u062e\u0644\u0627\u0641 \u0647\u0645\u064a\u0634\u0647 \u0634\u064a\u0631\u0645\u0627\u0644 \u0641\u0627\u062c\u0639\u0647 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u06a9\u0644\u0627\u0633\u06cc\u06a9", -1]}
{"text": ["\u0698\u0644\u0647 \u0631\u0648\u0634 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u0648\u062f \u0628\u0627\u0641\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u0648\u0647 \u0627\u06cc", 1]}
{"text": ["\u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u0647\u0633\u062a\u06cc\u062f.\u0637\u0639\u0645 \u0647\u0645\u0647 \u0646\u0627\u0646 \u0647\u0627 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0633 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0645\u0644", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", 1]}
{"text": ["\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u062e\u06cc\u0644\u06cc \u0628\u062f\u0645\u0632\u0647 \u0628\u0648\u062f \u062d\u062a\u06cc \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0633\u0648\u067e\u0631 \u0645\u0627\u0631\u06a9\u062a \u0645\u0632\u0634 \u062d\u0631\u0641\u0647 \u0627\u06cc \u062a\u0631\u0647 \u0648\u0644\u06cc \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u062e\u06cc\u0644\u06cc\u06cc\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\n\u0631\u0648\u0644 \u0686\u0627\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f\n\u0627\u0645\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0645\u0646 \u062a\u0642\u0631\u064a\u0628\u0627 \u0647\u0631 \u0663/\u0664 \u0631\u0648\u0632 \u0686\u0646\u062f\u062a\u0627 \u06af\u0627\u062a\u0627 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645\n\u0647\u0645\u064a\u0634\u0647 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0644\u0630\u064a\u0630 \u0648 \u0646\u0631\u0645 \u0628\u0648\u062f \u0648 \u0643\u0627\u0645\u0644\u0627 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0643\u0647 \u062a\u0627\u0632\u0633\u062a\n\u0627\u0645\u0627 \u0627\u064a\u0646 \u0628\u0627\u0631 \u062e\u064a\u0644\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a\u064a \u0643\u0647\u0646\u0647 \u0628\u0648\u062f!!!!!!!!!\n\u0648\u0627\u0642\u0639\u0627 \u062a\u0639\u062c\u0628 \u0643\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", -1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", 1]}
{"text": ["\u062a\u0632\u06cc\u06cc\u0646 \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0634\u0645\u0639 \u0633\u0647", "\u0634\u0645\u0639 \u0686\u0647\u0627\u0631", -1]}
{"text": ["\u0628\u0631\u062e\u0644\u0627\u0641 \u0637\u0639\u0645 \u0686\u064a\u0632 \u0643\u064a\u0643\u0647\u0627\u064a \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0643\u0647 \u062e\u064a\u0644\u064a \u062e\u0648\u0628\u0646 \u067e\u0627\u064a \u0633\u064a\u0628 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u0634\u0627\u064a\u062f \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0646\u0645\u064a\u062f\u0648\u0646\u0645 \u062f\u0631 \u0647\u0631 \u0635\u0648\u0631\u062a \u0646\u0648\u0646\u0634 \u0633\u0641\u062a \u0628\u0648\u062f \u0648 \u0645\u0648\u0627\u062f \u062f\u0627\u062e\u0644\u0634 \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0645\u0627\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0628\u0648\u062f \n\u0627\u0646\u06af\u0627\u0631 \u0628\u0627 \u062c\u0639\u0628\u0647 \u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u067e\u0627\u06cc\u06cc \u0632\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u062f\u0631 \u062c\u0639\u0628\u0647 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u0627\u0635\u0644\u0627\u064b \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u0634 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u060c \u0631\u0648\u064a \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0627\u0632 \u0645\u0648\u0646\u062f\u06af\u064a \u062e\u0634\u0643 \u0634\u062f\u0647 \u0628\u0648\u062f.\n\u062c\u0639\u0628\u0647 \u0627\u0634 \u0647\u0645 \u0646\u0633\u0628\u062a \u0628\u0647 \u062e\u0648\u062f\u0634 \u062e\u064a\u0644\u064a \u0628\u0632\u0631\u06af \u0628\u0648\u062f \u0648 \u0628\u0627\u0639\u062b \u0634\u062f \u062f\u0648 \u0631\u062f\u064a\u0641\u0634 \u0643\u0627\u0645\u0644\u0627\u064b \u0686\u067e\u0647 \u0634\u0647 \u0648 \u062e\u0631\u0627\u0628 \u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 25", -1]}
{"text": ["\u0641\u0643\u0631 \u0645\u064a\u0643\u0646\u0645 \u0627\u064a\u0646 \u062f\u0641\u0639\u0647 \u0646\u0647\u0645 \u0647\u0633\u062a \u0643\u0647 \u0645\u0646 \u0645\u064a\u0646\u064a \u0628\u0627\u0643\u0633 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645 .\u062e\u064a\u0644\u064a \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u062e\u0648\u0634\u06af\u0644\u064a \u062f\u0627\u0631\u0647 \u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0633\u062a .\u0627\u0645\u0627 \u062e\u064a\u0644\u064a \u0639\u062c\u064a\u0628 \u0628\u0648\u062f \u0643\u0647 \u062f\u064a\u0631\u0648\u0632 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0627\u0645\u0627 \u062e\u0627\u0645\u0647 \u0634 \u062e\u064a\u0644\u064a \u062a\u0631\u0634 \u0628\u0648\u062f ..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u06cc\u0644\u0627\u0633\u06cc \u0627\u0635\u0644\u0627 \u0628\u0627\u0628 \u0637\u0628\u0639 \u0645\u0646 \u0646\u0628\u0648\u062f\u060c\u0633\u0648\u0641\u0644\u0647 \u0631\u0648 \u0628\u0632\u0627\u0631\u06cc\u062f \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631 \u062a\u0648 \u0645\u0627\u06cc\u06a9\u0631\u0648\u0641\u0631 \u06af\u0631\u0645 \u0634\u062a \u0648 \u0628\u0627 \u06cc\u0647 \u0627\u0633\u06a9\u0648\u067e \u0628\u0633\u062a\u0646\u06cc \u0645\u06cc\u0644 \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0628\u0627 \u0639\u062c\u0644\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u0631\u0627 \u0645\u06cc \u0622\u0648\u0631\u062f \u0647\u0645\u06cc\u0634\u0647 \u0628\u0647 \u06cc\u06a9 \u062c\u0627\u06cc \u06a9\u06cc\u06a9 \u0636\u0631\u0628\u0647 \u062e\u0648\u0631\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0632\u0645\u0627\u0646 \u0627\u0646\u062a\u0638\u0627\u0631 \u0645\u0648\u0631\u062f \u062a\u0627\u06cc\u06cc\u062f \u0646\u0628\u0648\u062f \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0627\u06cc\u0646\u06a9\u0647 \u06f1\u06f4 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0647 \u06f3\u06f0\u062f\u0642\u06cc\u0642\u0647 \u0627\u0636\u0627\u0641\u0647 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc\u200c\u0647\u0627 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\n\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u06cc\u0646\u0628\u0627\u0631 \u0628\u0647 \u0644\u0637\u0641 \u067e\u06cc\u06a9 \u0639\u0632\u06cc\u0632 \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0627 \u0647\u0645 \u0645\u062e\u0644\u0648\u0637 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646! \u0627\u0646\u06af\u0627\u0631 \u062c\u0639\u0628\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0633\u0631 \u0648 \u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0627\u0632 \u0639\u06a9\u0633\u0634 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9\u062a\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0634\u0645\u0639 \u06a9\u06cc\u06a9 \u06cc\u0627\u062f\u062a\u0648\u0646 \u0631\u0641\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "Don't Even Ask", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c\u0648 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0645\u0631\u0633\u06cc \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f- \u0647\u0645\u06cc\u0634\u0647 \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9\u062a\u0648\u0646 \u0631\u0627\u06cc\u06af\u0627\u0646 \u0628\u0627\u0634\u0647 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 2", 1]}
{"text": ["\u0628\u0647 \u0644\u0637\u0641 \u067e\u06cc\u06a9 \u0639\u0632\u06cc\u0632 \u0627\u0633\u0646\u067e \u062a\u0645\u0627\u0645\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627  \u062f\u0631 \u062c\u0639\u0628\u0647 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0648 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u06a9\u0647 \u0627\u0635\u0644\u0627 \u0642\u0627\u0628\u0644 \u0645\u0635\u0631\u0641 \u0646\u06cc\u0633\u062a\u0646 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u062f\u0631\u200c\u0686\u0645\u062f \u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u0627\u0632 \u0634\u0645\u0627 \u062f\u0627\u0634\u062a\u0645 \u0627\u0632 \u0628\u062f\u062a\u0631\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0631\u0648 \u062f\u0627\u0634\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0648 \u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647\u0646\u062f\u06af\u06cc \u0648 \u0645\u0632\u0647 \u0628\u062f. \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0627\u0646\u062a\u0638\u0627\u0632 \u062f\u06cc\u06af\u0647 \u0627\u06cc \u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0627\u0631\u0633\u0627\u0644 \u0639\u0627\u0644\u064a.. \u067e\u064a\u0643 \u0645\u062d\u062a\u0631\u0645... \u0643\u064a\u0643 \u064a\u0632\u062f\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645.. \u0646\u0627\u0646 \u062c\u0648 \u062f\u0648 \u0633\u0631 \u0647\u0645 \u0643\u0647 \u0639\u0627\u0644\u064a\u0647 \u0648\u0627\u0642\u0639\u0627\u064b\u060c \u0645\u0646 \u062a\u0627\u062d\u0627\u0644\u0627 \u062c\u0627\u064a\u064a \u0646\u062a\u0648\u0646\u0633\u062a\u0647 \u0628\u0648\u062f\u0645 \u067e\u064a\u062f\u0627 \u0643\u0646\u0645 \u0627\u064a\u0646 \u0646\u0648\u0646 \u0631\u0648.. \u062e\u064a\u0644\u064a \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648 \u0633\u0631 \u0631\u0698\u06cc\u0645\u06cc 90%", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0645\u0645\u0646\u0648\u0646  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u0628\u0686\u0647 \u0647\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u067e\u06cc\u06a9 \u062e\u0633\u062a\u0647 \u0628\u0648\u062f \u062d\u0648\u0635\u0644\u0647 \u0646\u062f\u0627\u0634\u062a \u0628\u06cc\u0627\u062f \u0628\u0627\u0644\u0627 \u0633\u0641\u0627\u0631\u0634\u0648 \u062a\u062d\u0648\u06cc\u0644 \u0628\u062f\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628.....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0645\u0646 \u0627\u0632 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u062f\u0631 \u0628\u0631\u062c \u0645\u06cc\u0646\u06cc\u0627\u062a\u0648\u0631\u200c \u0628\u0648\u062f\u06cc\u0646 \u06f6 \u0633\u0627\u0644 \u067e\u06cc\u0634 \u062e\u0631\u06cc\u062f \u0645\u06cc\u06a9\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0645\u06cc\u0646 \u06a9\u06cc\u06a9 \u0631\u0648 \u067e\u0631\u06cc\u0631\u0648\u0632 \u0647\u0645 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u0645 \u0648 \u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0627\u0645\u0627 \u062f\u06cc\u0631\u0648\u0632 \u062a\u0627\u0632\u06af\u06cc \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", "Don't Even Ask", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u067e\u0648\u062f\u064a\u0646\u06af \u0634\u0643\u0644\u0627\u062a \u0643\u0627\u0645\u0644\u0627\u064b \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0643\u064a\u0643\u0634 \u067e\u0648\u062f\u0631 \u0645\u064a\u0634\u062f\n\u0648 \u0628\u0647 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u0645\u0646 \u0627\u0635\u0644\u0627\u064b \u062a\u0648\u062c\u0647 \u0646\u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0645\u0646 \u062e\u0648\u0627\u0633\u062a\u0647 \u0628\u0648\u062f\u0645 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u064a \u062e\u0634\u0643 \u0631\u0648 \u062c\u062f\u0627 \u0628\u0632\u0627\u0631\u0646 \u0643\u0647 \u0647\u0645\u0647 \u062a\u0648 \u064a\u0647 \u062c\u0639\u0628\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0637\u0639\u0645\u0634 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0646\u0628\u0648\u062f \u0648 \u0646\u0648\u062a\u0644\u0627\u064a \u0643\u0645\u062a\u0631\u064a \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0627\u06af\u0647 \u0637\u0639\u0645\u0647\u0627\u0634 \u0631\u0627 \u062a\u0648 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0628\u06af\u0646 \u0628\u0647\u062a\u0631\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0634\u062f\u062a \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0632\u0648\u062f \u0631\u0633\u0648\u0646\u062f \u0628\u062f\u0633\u062a\u0645\u060c \u0645\u0631\u0633\u06cc!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0637\u0639\u0645 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0645\u0627\u0631\u0633 \u0628\u0631 \u062e\u0644\u0627\u0641 \u0647\u0645\u064a\u0634\u0647 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f\n\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a \u0648 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0646\u0648\u062a\u0644\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 1", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0633\u0631\u06cc\u0639 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0627\u0632 \u067e\u06cc\u06a9 \u0647\u0645 \u062a\u0634\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u06a9\u062e \u0647\u0645\u06a9\u0627\u0631\u06cc \u06a9\u0631\u062f \u0648\u0627\u0633\u0647 \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u062f\u0648\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u062f\u0631\u0628\u0627\u0631\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0648\u0627\u0636\u062d \u062a\u0631\u06cc \u0628\u062f\u0646 \u0628\u0647\u062a\u0631\u0647\n\u062e\u06cc\u0644\u06cc \u0641\u0633\u0642\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062f\u0644\u0686\u0633\u0628 \u0628\u0648\u062f... \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0648 \u0631\u062f\u0648\u0644\u0648\u062a \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646...\u0647\u0631 \u062f\u0648 \u067e\u0627\u06cc \u0631\u0648 \u0628\u0631\u0627\u06cc \u0627\u0648\u0644\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645...\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0627\u0632 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0628\u0648\u062f... \u0628\u0627 \u0627\u06cc\u0646 \u06a9\u0647 \u0647\u0631 \u062f\u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u0645\u0648\u0627\u062f \u062f\u0627\u062e\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628  \u0632\u06cc\u0627\u062f \u0648 \u06a9\u0645\u06cc \u0634\u0644 \u0628\u0648\u062f \u06a9\u0647 \u0627\u062d\u0633\u0627\u0633 \u062e\u0648\u0628\u06cc \u0646\u0645\u06cc\u062f\u0627\u062f \u0646\u0647 \u0645\u0648\u0642\u0639 \u0633\u0650\u0631\u0648 \u06a9\u0631\u062f\u0646 \u062f\u0631 \u0628\u0634\u0642\u0627\u0628\u0647\u0627 \u0648 \u0646\u0647 \u0645\u0648\u0642\u0639 taste \u06a9\u0631\u062f\u0646... \u0628\u0647 \u0634\u062e\u0635\u0647 \u062a\u0631\u062c\u06cc\u062d \u0645\u06cc\u062f\u0627\u062f\u0645 \u0633\u06cc\u0628 \u0648 \u062f\u0627\u0631\u0686\u06cc\u0646 \u062f\u0627\u062e\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0637\u0639\u0645 \u0648 \u0645\u0632\u0647 \u062c\u0627 \u0627\u0641\u062a\u0627\u062f\u0647 \u062a\u0631 \u0648 \u0628\u0647\u062a\u0631\u06cc \u062f\u0627\u0634\u062a ... \u0627\u0644\u0628\u062a\u0647 \u0686\u0648\u0646 \u0628\u0627\u0631 \u0627\u0648\u0644\u06cc \u0628\u0648\u062f \u06a9\u0647 \u067e\u0627\u06cc \u0647\u0627 \u0648 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0631\u062f\u06cc\u0645 \u0647\u0646\u0648\u0632 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u062f\u0631 \u0622\u06cc\u0646\u062f\u0647 \u0627\u06af\u0631 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645 \u0637\u0639\u0645 \u0648 \u0645\u0632\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u0647\u062a\u0631\u06cc \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 (\u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u0627\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0648\u0686\u06a9\u062a\u0631\u0634 \u0631\u0648 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u06cc\u0645!!!!)... \u062f\u0631 \u06a9\u0644 \u06a9\u06cc\u0641\u06cc\u062a \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0628\u0647 \u0641\u0642\u0637 \u0627\u06cc \u06a9\u0627\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc \u0647\u0645 \u0628\u0647 \u0645\u0646\u0648 \u0627\u0636\u0627\u0641\u0647 \u0645\u06cc\u0634\u062f \u0645\u062b\u0644 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u060c \u0627\u0646\u0648\u0627\u0639 \u0631\u0648\u0644\u062a \u060c\u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc \u0648...... \u0648 \u0627\u06cc\u0646 \u06a9\u0647 \u062a\u0646\u0648\u0639 \u06a9\u06cc\u06a9\u0647\u0627\u06cc \u062a\u0648\u0644\u062f \u0628\u06cc\u0634\u062a\u0631 \u0645\u06cc\u0634\u062f \u0627\u0648\u0646 \u0648\u0642\u062a \u062f\u06cc\u06af\u0647 \u0648\u0627\u0642\u0639\u0627 \u0645\u06cc\u0634\u062f \u0627\u0648\u0644\u06cc\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u0645\u0646\u0637\u0642\u0647 \u0628\u0631\u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc...\n\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0639\u0632\u06cc\u0632 \u067e\u06cc\u0634\u0631\u0641\u062a \u0648 \u062e\u0648\u0634\u0645\u0632\u06af\u06cc\u062a \u0631\u0648\u0632 \u0627\u0641\u0632\u0648\u0646...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0643\u064a\u0643 \u062e\u0645\u064a\u0631 \u0628\u0648\u062f \u0648\u0644\u0649 \u0628\u0627 \u0627\u064a\u0646 \u062d\u0627\u0644 \u0637\u0639\u0645 \u062e\u0648\u0628\u0649 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u06cc\u06a9", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0634\u0646\u064a\u062f\u0647 \u0628\u0648\u062f\u0645 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0643\u0648\u0686\u064a\u0643\u064a \u062f\u0627\u0631\u0647 \u0648\u0644\u064a \u0641\u0643\u0631 \u0646\u0645\u064a\u0643\u0631\u062f\u0645 \u062a\u0627 \u0627\u064a\u0646 \u062d\u062f  !! \u0648\u0644\u064a \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0628\u0627 \u0643\u064a\u0641\u064a\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u06cc\u06cc\u06cc\u0644\u06cc\u06cc\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0633\u0648\u0631\u067e\u0631\u0627\u06cc\u0632 \u0634\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u06cc\u06a9", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0631\u0648\u0649 \u067e\u0627\u0649 \u0633\u064a\u0628 \u0628\u064a\u0634\u062a\u0631 \u0643\u0627\u0631 \u0643\u0646\u064a\u062f \u062e\u0645\u064a\u0631 \u0628\u0649 \u0643\u064a\u0641\u064a\u062a \u0645\u0632\u0647 \u062a\u0631\u0634 \u0633\u064a\u0628 \u0627\u0632 \u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633 \u062a\u0648\u0642\u0639 \u0628\u064a\u0634\u062a\u0631\u0649 \u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "Don't Even Ask", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u062d\u062a\u0645\u06cc \u06af\u0631\u0645 \u06a9\u0646\u06cc\u062f \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0645\u06cc \u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u067e\u06cc\u06a9 \u06a9\u0645\u06cc \u062f\u06cc\u0631 \u0622\u0645\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06af\u0631\u062f\u0648", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0645\u0646 \u062a\u0648\u06cc \u0645\u0646\u0648 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 30 \u0639\u062f\u062f\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\n\u0648\u0644\u06cc 13 \u0639\u062f\u062f \u0628\u0631\u0627\u0645 \u0622\u0648\u0631\u062f\u0646\u062f..... \u0641\u06a9\u0631 \u06a9\u0646\u0645 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u0646\u0628\u0648\u062f. \n\u0628\u06cc\u200c\u0632\u062d\u0645\u062a \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f \u0645\u0646\u0645 \u0642\u0627\u0646\u0639 \u0634\u0645..... \n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633", -1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u06cc\u0627\u062a\u060c \u0628\u0627 \u0631\u0648\u06a9\u0634 \u0635\u0648\u0631\u062a\u06cc\u060c \u067e\u0633 \u0686\u0631\u0627 \u0646\u0648\u0634\u062a\u06cc\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc!\n\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645\u060c \n\u0647\u0645\u0631\u0648 \u0631\u06cc\u062e\u062a\u0645 \u062f\u0648\u0631\u060c ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0631\u0648\u0644 \u0686\u0627\u06cc", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \n\u0627\u0633\u0646\u067e \u067e\u06cc\u06a9 \u0647\u0645 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0631\u0645\u0627", 1]}
{"text": ["\u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0631\u0645\u0627", 1]}
{"text": ["\u06cc\u0646\u06cc 4 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0646 \u0628\u0631\u0627\u06cc 1 \u062f\u0648\u0646\u0647 \u0645\u0627\u06a9\u0627\u0631\u0648\u0646\u061f\n\u0644\u0627\u0627\u0642\u0644 \u062f\u0627\u062e\u0644 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a\u0634 \u0645\u06cc\u0646\u0648\u0634\u062a\u06cc\u0646 \u06cc\u0647 \u062f\u0648\u0646\u0647 \u0627\u06cc \u0647\u0633\u062a\u0634 \u06a9\u0647 \u0646\u062e\u0631\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u062e\u0627\u0631\u06cc \u062f\u0648 \u0631\u0646\u06af", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", -1]}
{"text": ["\u062e\u064a\u0644\u064a \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0645\u0627\u06a9\u0627\u0631\u0648\u0646 \u0648\u0627\u0642\u0639\u0627 \u0645\u0627\u06a9\u0627\u0631\u0648\u0646 \u0646\u0628\u0648\u062f! \u0628\u0647 \u0647\u06cc\u0686 \u0648\u062c\u0647! \u0628\u0647 \u0633\u062e\u062a\u06cc \u0645\u06cc\u0634\u062f \u062a\u0648 \u062f\u0633\u062a\u0647 \u0644\u0637\u06cc\u0641\u0647 \u0642\u0631\u0627\u0631 \u0628\u06af\u06cc\u0631\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0631 \u0648 \u0632\u06cc\u062a\u0648\u0646", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u06a9\u0631\u0645 \u0648 \u06af\u0631\u062f\u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0627\u0633\u062a \n\u0639\u0627\u0644\u06cc\u0647 \n\u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645", 1]}
{"text": ["\u0643\u0631\u0648\u0633\u0627\u0646 \u062a\u0648\u0646 \u062e\u064a\u0644\u064a \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0633\u067e\u0627\u0633\u06af\u0630\u0627\u0631\u0645 . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0646\u0627\u0646 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u06a9\u06cc\u0641\u06cc\u062a\u06cc \u0645\u062a\u0648\u0633\u0637 \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.\u0628\u0633\u06cc\u0627\u0631 \u0633\u0631\u06cc\u0639 \u0633\u0641\u0627\u0631\u0634 \u0631\u0633\u06cc\u062f.\u06a9\u06cc\u0641\u06cc\u062a \u06af\u0627\u062a\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc.\u06a9\u0627\u0631\u062a\u0648\u0646 \u062f\u0631\u0633\u062a\u0647 \u0648\u0627\u0642\u0639\u0627.\u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0628\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u0627\u0647\u0645\u06cc\u062a \u0645\u06cc\u062f\u06cc\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", 1]}
{"text": ["\u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645 \u060c \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0646\u0627\u067e\u0644\u06cc\u0648\u0646\u06cc \u062e\u0648\u0628 \u0646\u0628\u0648\u062f \u06a9\u0647 \u062a\u0639\u0631\u06cc\u0641 \u06a9\u0646\u0645 \u060c \u062e\u0627\u0645\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0645\u062b\u0644 \u062e\u0627\u0645\u0647 \u0635\u0628\u062d\u0627\u0646\u0647 \u0628\u0648\u062f \u062d\u062c\u06cc\u0645 \u0648 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0634\u06cc\u0631\u06cc\u0646 \u060c \u0646\u0627\u067e\u0644\u06cc\u0648\u0646\u06cc \u0627\u0632 \u0634\u0645\u0627 \u0646\u0645\u06cc\u200c\u062e\u0648\u0631\u0645 \u062f\u06cc\u06af\u0647. \u062d\u062a\u0645\u0627 \u0631\u0633\u06cc\u062f\u06af\u06cc \u06a9\u0646\u06cc\u062f \u0686\u0648\u0646 \u0645\u062d\u0628\u0648\u0628 \u062a\u0631 \u0627\u0632 \u0627\u06cc\u0646 \u062d\u0631\u0641 \u0647\u0627 \u0647\u0633\u062a\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0631\u0645\u0627", 1]}
{"text": ["\u067e\u0627\u064a \u0627\u0644\u0628\u0627\u0644\u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u060c \u0648 \u0686\u064a\u0632\u064a \u0643\u0647 \u062c\u0627\u0644\u0628 \u0628\u0648\u062f \u0627\u0628\u0646 \u0628\u0648\u062f \u0643\u0647 \u062c\u0639\u0628\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648 \u062a\u0627 \u062c\u0627\u064a\u064a \u0643\u0647 \u062c\u0627 \u062f\u0627\u0634\u062a \u067e\u0631 \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u062d\u062a\u064a \u0643\u062c \u0648 \u062a\u062d\u062a \u0641\u0634\u0627\u0631 \u0648\u0633\u0637\u0627\u0634 \u0634\u064a\u0631\u064a\u0646\u064a \u06af\u0630\u0627\u0634\u062a\u0646\u060c \u062d\u062a\u064a \u062a\u0639\u062f\u0627\u062f \u0628\u064a\u0634\u062a\u0631 \u0627\u0632 \u062a\u0639\u062f\u0627\u062f\u064a \u0628\u0648\u062f \u0643\u0647 \u062a\u0648 \u0645\u0646\u0648 \u062a\u0648\u0636\u064a\u062d\u0627\u062a \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a : \u0628\u064a\u0633\u062a\n\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a: \u0628\u064a\u0633\u062a\n\u0645\u0634\u062a\u0631\u064a \u0645\u062f\u0627\u0631\u064a : \u0628\u064a\u0633\u062a\n\u0645\u0631\u0633\u064a \u0648\u0627\u0642\u0639\u0627 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a.\u067e\u0631\u0628\u0631\u0643\u062a \u0628\u0627\u0634\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0633\u06cc\u0628 \u0648 \u0647\u0648\u06cc\u062c \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c\u0648\u0644\u06cc \u0645\u06cc\u0646\u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f\u0646\u060c\u0628\u0647 \u0646\u0638\u0631\u0645\u200c \u06cc\u0627 \u0627\u0632 \u0642\u06cc\u0645\u062a\u0634 \u06a9\u0645 \u06a9\u0646\u06cc\u062f \u06cc\u0627 \u06cc\u06a9\u0645 \u062d\u062c\u0645\u0634\u0648 \u0628\u06cc\u0634\u062a\u0631 \u06a9\u0646\u06cc\u062f.\u062f\u0631 \u06a9\u0644 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u0643\u0648\u0686\u064a\u0643 \u0628\u0648\u062f \u062e\u064a\u0644\u064a.\u0647\u0631 \u0643\u062f\u0648\u0645\u0634 \u0662*\u0662 \u0633\u0627\u0646\u062a\u064a \u0645\u062a\u0631 \u0628\u0648\u062f \u0648 \u0642\u064a\u0645\u062a\u0634 \u0627\u0635\u0644\u0627 \u0646\u0645\u064a \u0627\u0631\u0632\u064a\u062f \u0627\u06af\u0647 \u062d\u0636\u0648\u0631\u064a \u062e\u0631\u064a\u062f \u0643\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0635\u0644\u0627 \u0646\u0645\u064a\u062e\u0631\u064a\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0631\u0648\u06cc \u0647\u0645 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f . \u0638\u0627\u0647\u0631 \u062e\u06cc\u0644\u06cc \u0628\u062f\u06cc \u062f\u0627\u0634\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u0633\u0628\u06a9 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0644\u0627\u06cc\u0645. \u06a9\u0644\u0627 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0639\u0627\u0644\u06cc\u0647 \u06a9\u06cc\u06a9 \u0647\u0627\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u06a9\u0644 \u06a9\u0627\u0631 \u06f2\u06f0 \u06af\u0631\u0645 \u0647\u0645 \u0646\u06cc\u0633\u062a \u06a9\u0647 \u062f\u0627\u0631\u0647 \u0628\u0627\u0628\u062a\u0634 \u062f\u0647 \u0647\u0632\u0627\u0631 \u062a\u0648\u0645\u0646 \u0645\u06cc \u06af\u06cc\u0631\u0647 \u0645\u06af\u0647 \u06a9\u06cc\u06a9 \u0637\u0644\u0627 \u0647\u0633\u062a\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", -1]}
{"text": ["\u0628\u06cc\u0634 \u0627\u0632 \u06f5 \u0633\u062a\u0627\u0631\u0647 \u062d\u0642 \u0627\u06cc\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u062d\u062a\u0631\u0627\u0645\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u0642\u0627\u0626\u0644 \u0647\u0633\u062a\u06cc\u062f ...\u067e\u0627\u06cc\u0646\u062f\u0647 \u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u062b\u0644 \u062f\u0641\u0639\u0627\u062a \u0642\u0628\u0644 \u0646\u0628\u0648\u062f .\n\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u0632\u06cc\u0627\u062f \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f.\n\u0633\u0641\u062a \u0634\u062f\u0647 \u0628\u0648\u062f.\n\u0627\u0644\u0628\u062a\u0647 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0647\u0645\u0634\u0648\u0646 \u0647\u0645\u06cc\u0646\u062c\u0648\u0631\u0645\u061f \u06cc\u0627 \u0628\u0627 \u062a\u062e\u0641\u06cc\u0641 \u0645\u06cc\u062f\u0627\u062f\u06cc\u0646 \u0627\u06cc\u0646 \u0645\u062f\u0644\u06cc \u0628\u0648\u062f\u061f \n\u062f\u0631 \u06a9\u0644 \u0686\u0646\u06af\u06cc \u0628\u0647 \u062f\u0644 \u0646\u0645\u06cc\u0632\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc \u06a9\u06cc\u06a9 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0627\u0632 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u062a\u0648 \u062a\u0635\u0648\u06cc\u0631 \u0647\u0633\u062a \u0628\u0648\u062f\n\u0627\u0648\u0646\u062c\u0627 \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u06a9\u0647 \u06a9\u06cc\u06a9 \u06f6\u06f5\u06f0 \u06af\u0631\u0645 \u0647\u0633\u062a \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u06f3\u06f0\u06f0 \u06af\u0631\u0645 \u0647\u0645 \u0646\u0628\u0648\u062f\n\u0648\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u062a\u0646\u0647\u0627 \u0627\u06cc\u0631\u0627\u062f \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0628\u0648\u062f\u0646 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u06cc\u06a9 \u0628\u0648\u062f \u06cc\u0639\u0646\u06cc \u062a\u0642\u0631\u06cc\u0628\u0627 \u0646\u0635\u0641 \u0627\u0648\u0646\u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0648\u0627\u0642\u0639\u0627 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0643\u064a\u0641\u064a\u062a \u062e\u0648\u0628\u064a \u062f\u0627\u0631\u0647 \u062a\u0627\u0632\u0647 \u0627\u0633 \u0647\u0645\u064a\u0634\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f \u0648 \u0633\u0627\u06cc\u0632\u0634 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u0647 \u0627\u0646\u0635\u0627\u0641\u0627 \n\u067e\u0648\u0644\u0645\u0648 \u0631\u06cc\u062e\u062a\u0645 \u062f\u0648\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u062a\u0627\u062e\u06cc\u0631\u06cc \u06f2\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0627\u06cc \u06cc \u06a9\u06cc\u06a9 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0641 \u062f\u0633\u062a \u0628\u0686\u0647 \u0627\u0648\u0631\u062f \u06a9\u0647 \u0627\u0648\u0646\u0645 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f .\u0648\u0627\u0642\u0639\u0627 \u0633\u0627\u06cc\u0632\u0634 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u06a9\u0648\u0686\u06a9 \u0627\u0633\u062a. \u06a9\u0644\u0627 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0627\u06cc\u0646\u0637\u0648\u0631\u06cc\u0647 \u0638\u0627\u0647\u0631\u0627. \u0639\u06a9\u0633\u0647\u0627 \u0628\u0647 \u0634\u062f\u062a \u0627\u063a\u0631\u0627\u0642 \u0622\u0645\u06cc\u0632 \u0647\u0633\u062a\u0646\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0634\u0645\u0634\u064a \u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0633\u062a \u0641\u0642\u0637 \u0628\u0631\u0627\u0648\u0646\u064a \u0634\u0643\u0631\u0634 \u062e\u064a\u0644\u064a \u0632\u064a\u0627\u0627\u0627\u0627\u062f \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628 \u0648 \u0646\u06a9\u062a\u0647 \u0645\u062b\u0628\u062a \u0627\u06cc\u0646\u06a9\u0647 \u0645\u0628\u0644\u063a\u06cc \u0628\u0631\u0627\u06cc \u062d\u062f\u0627\u0642\u0644 \u062e\u0631\u06cc\u062f \u062f\u0631 \u0646\u0638\u0631 \u06af\u0631\u0641\u062a\u0647 \u0646\u0634\u062f\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0647 \u0646\u0638\u0631\u0645 \u06cc\u06a9\u0645 \u067e\u06cc\u0634 \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645\u0647 \u0686\u06cc \u0628\u0647\u062a\u0631 \u0628\u0648\u062f \u0645\u062b\u0644\u0627 \u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0648\u0627\u0642\u0639\u0627 \u0644\u0630\u06cc\u0630 \u0628\u0648\u062f \u0627\u0645\u0627 \u0627\u0644\u0627\u0646 \u0646\u0648\u0646\u0647 \u0648 \u0634\u06a9\u0644\u0627\u062a .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646. \u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u06af\u0631 \u062f\u0631 \u062e\u0635\u0648\u0635 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0627\u0648\u0646 \u0645\u0627\u062f\u0647 \u062f\u0627\u062e\u0644\u0634 \u0631\u0648 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u06cc\u0627 \u0648\u0633\u0637\u0634 \u0628\u0631\u06cc\u0632\u06cc\u062f \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631\u0647\n\u0686\u0648\u0646 \u0627\u0644\u0627\u0646 \u06a9 \u0632\u06cc\u0631 \u0627\u0648\u0646\u0627 \u0631\u06cc\u062e\u062a\u06cc\u062f \u0647\u0645\u0634\u0648\u0646 \u0645\u0648\u0642\u0639 \u062c\u062f\u0627 \u06a9\u0631\u062f\u0646 \u0627\u0648\u0646 \u06a9\u0627\u063a\u0630 \u06a9\u06cc\u06a9 \u0628 \u0627\u0648\u0646 \u0645\u06cc\u0686\u0633\u0628\u0646 \u0648 \u062e\u0627\u0631\u062c \u0645\u06cc\u0634\u0646\n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0645\u0648\u0644 \u0647\u0646\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u0628\u0645\u0648\u0642\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0647 \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\n\u067e\u06cc\u06a9 \u0647\u0645 \u06a9\u0647 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0647\u0648\u0627 \u0628\u0627\u0631\u0648\u0646\u06cc \u0628\u0648\u062f \u0648 \u0628\u0646\u062f\u0647 \u062e\u062f\u0627 \u0627\u06cc\u0634\u0648\u0646 \u062e\u06cc\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0628\u0631\u062e\u0648\u0631\u062f \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646\u062f \u0647\u0645 \u062a\u0627\u0632\u0647 \u0648 \u0647\u0645 \u062e\u0648\u0634\u0645\u0632\u0647\n\u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u062f\u0628 \u0648 \u0633\u0631\u06cc\u0639 \u0628\u0648\u062f\u0646\u062f \u0645\u062a\u0634\u06a9\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u067e\u0646\u062c \u0645\u063a\u0632", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0648 \u0646\u0627\u0646 \u0643\u0627\u0631\u0627\u0645\u0644 \u0634\u0643\u0644\u0627\u062a \u0639\u0627\u0644\u064a \u0648\u0644\u064a \u0643\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u064a\u0631 \u0628\u062f \u0643\u0644\u0627 \u0643\u0631\u0627\u0633\u0627\u0646 \u062e\u0627\u0644\u064a \u0628\u0648\u062f \u0628\u0627\u064a\u062f \u062f\u0646\u0628\u0627\u0644\u0647 \u0647\u0627\u062a \u062f\u0627\u06af \u0645\u064a \u06af\u0634\u062a\u064a  \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0634\u06a9\u0644\u0627\u062a (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u0627\u06cc \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0645\u06cc\u0646 \u0642\u062f\u0631 \u062e\u0648\u0628 \u0628\u0645\u0648\u0646\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0643\u064a\u0643 \u0647\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0627\u0635\u0644\u0627 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647. \u0637\u0639\u0645 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647. \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u0634\u06a9 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u0628\u0648\u062f. \u0645\u0646 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0631\u0648 \u0647\u0645\u06cc\u0634\u0647 \u0628\u062e\u0627\u0637\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0627\u0646\u062a\u062e\u0627\u0628 \u0645\u06cc\u06a9\u0646\u0645 \u0648 \u062e\u06cc\u0644\u06cc \u0628\u0639\u06cc\u062f \u0628\u0648\u062f \u06a9\u0647 \u06a9\u06cc\u06a9 \u0645\u0648\u0646\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646. \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u0647\u0645 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062c\u0631\u062f\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u0627\u0648\u0646 \u0647\u0645 \u0645\u0648\u0646\u062f\u0647 \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f . \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0627\u06cc\u0646 \u0631\u0648\u0646\u062f \u0628\u0631\u0627\u06cc \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0628\u06cc\u0631\u0648\u0646 \u0628\u0631 \u0627\u062f\u0627\u0645\u0647 \u067e\u06cc\u062f\u0627 \u0646\u06a9\u0646\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u0628\u0644\u0648\u0643\u06cc", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0627\u0631\u0633\u0627\u0644\u06cc \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0628\u062e\u0635\u0648\u0635 \u067e\u0627\u067e \u06a9\u06cc\u06a9 \u06a9\u0647 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u067e\u0627\u067e \u06a9\u06cc\u06a9 \u0634\u0643\u0644\u0627\u062a", -1]}
{"text": ["\u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0633\u06cc\u0627\u0631 \u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u062a\u0627\u0631\u062a \u0633\u064a\u0627\u0647", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u06cc\u06a9\u06cc \u0627\u0632 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc \u06cc\u06a9 \u0642\u0633\u0645\u062a\u0634 \u0633\u06cc\u0627\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0632\u0647 \u062e\u06cc\u0644\u06cc \u0628\u062f\u06cc \u0645\u06cc \u062f\u0627\u062f \u0646\u0645\u06cc \u062f\u0627\u0646\u0645 \u0686\u0647 \u0627\u062a\u0641\u0627\u0642\u06cc \u0628\u0631\u0627\u0634 \u0627\u0641\u062a\u0627\u062f\u0647 \u0628\u0648\u062f \u0627\u0632 \u062a\u0631\u0633 \u0645\u0627\u0646\u062f\u06af\u06cc \u0646\u0635\u0641\u0634 \u0631\u0648 \u0627\u0646\u062f\u0627\u062e\u062a\u0645 \u062f\u0648\u0631.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u06cc! \u06a9\u0627\u0634 \u0686\u06cc\u0632\u0627\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u063a\u0630\u0627 \u0645\u0627\u0646\u0646\u062f \u0645\u062b\u0644 \u0627\u06cc\u0646\u0647\u0627 \u06a9\u0647 \u0641\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u0627\u0633\u0645\u0634\u0648\u0646 \u06af\u0630\u0627\u0634\u062a\u0646 \u0634\u0648\u0631\u06cc\u0646\u06cc \u0647\u0645 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0645\u06cc\u0627\u0648\u0631\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627\u064a \u0643\u0648\u0643 \u0637\u0639\u0645\u064a \u0628\u0647\u0634\u062a\u064a \u062f\u0627\u0631\u0646 \u0648 \u0645\u062b\u0644 \u0631\u0648\u064a\u0627 \u0647\u0633\u062a\u0646\u062f . \u0627\u0633\u0646\u067e \u0627\u0643\u0633\u067e\u0631\u0633 \u0647\u0645 \u0643\u0647 \u0639\u0627\u0644\u064a\u0647 . \n\u0641\u0642\u0637 \u0627\u064a \u0643\u0627\u0634 \u0628\u0631\u0627\u064a \u0633\u0645\u062a \u0634\u0647\u0631\u0643 \u063a\u0631\u0628 \u0647\u0645 \u0625\u0631\u0633\u0627\u0644 \u0645\u064a \u0643\u0631\u062f\u064a\u062f . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc (700 \u06af\u0631\u0645\u06cc)", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u067e\u0648\u062f\u0631 \u067e\u0646\u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 - \u062e\u0648\u0634 \u0639\u0637\u0631 - \u0634\u062f\u06cc\u062f\u0627\u064b \u0633\u0631\u06cc\u0639! \u062f\u0631\u062c\u0647 \u06cc\u06a9", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0631\u0641\u062a\u0627\u0631 \u067e\u06cc\u06a9 \u0648 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639 \u0628\u06cc\u0646\u0638\u06cc\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "Happy birthday", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u067e\u0646\u062c", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u060c \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0631\u0633\u06cc\u062f \u060c \u0644\u0637\u0641 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \u06cc\u06a9 \u06af\u06cc\u0641\u062a \u06af\u0630\u0627\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062d\u0631\u06a9\u062a \u062c\u0627\u0644\u0628\u06cc \u0628\u0648\u062f \u060c \u0627\u06cc\u0646 \u0627\u067e\u0634\u0646 \u062c\u062f\u06cc\u062f \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06a9\u0647 \u067e\u06cc\u06a9 \u0631\u0627 \u062a\u0648 \u0646\u0642\u0634\u0647 \u0627\u0646\u0644\u0627\u06cc\u0646 \u0645\u06cc\u0628\u06cc\u0646\u06cc \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f ! \u062e\u06cc\u0644\u06cc \u0647\u0645 \u062e\u0648\u0628 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\n\u0627\u06af\u0631 \u06cc\u06a9\u0645\u0642\u062f\u0627\u0631 \u0642\u06cc\u0645\u062a \u0647\u0627\u0631\u0648 \u0647\u0645 \u0645\u0646\u0627\u0633\u0628 \u062a\u0631 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u062f\u06cc\u06af\u0647 \u0639\u0627\u0644\u06cc \u0645\u06cc\u0634\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0627\u0628\u062a \u0647\u062f\u06cc\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645. \u0645\u0648\u0641\u0642 \u0628\u0627\u0634\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0627\u0646\u0642\u062f\u0631 \u0633\u0631\u06cc\u0639 \u0645\u06cc \u0641\u0631\u0633\u062a\u0647 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632 \u06a9\u0647 \u0627\u0646\u06af\u0627\u0631 \u0633\u0631 \u06a9\u0648\u0686\u0647 \u0645\u0648\u0646\u0647. \u062e\u06cc\u0644\u06cc \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0634\u0648\u0646 \u0631\u0627\u0636\u06cc\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u0627\u0635\u0644\u0627\u0627\u0627\u0627\u0627\u0627\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a\u0646\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", -1]}
{"text": ["\u0645\u0627\u0641\u06cc\u0646 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0641\u06cc\u0646 \u0633\u0627\u062f\u0647", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633", 1]}
{"text": ["\u0639\u0627\u0644\u064a\u060c\u0645\u0645\u0646\u0648\u0646 \u0643\u0647 \u0628\u0647 \u067e\u064a\u0634\u0646\u0647\u0627\u062f \u062a\u0648\u062c\u0647 \u0643\u0631\u062f\u064a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0648\u0631\u06cc\u0646\u06cc", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645", 1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u06f5 \u062a\u0627\u06cc\u06cc \u0631\u0648 \u0646\u0648\u0634\u062a\u0646 \u0628\u0631\u0627\u06cc \u06f3 \u0646\u0641\u0631! \u0648\u0644\u06cc \u06f5 \u062a\u0627 \u0646\u0648\u0646 \u0628\u0632\u0631\u06af \u0628\u0648\u062f\u060c \u0645\u0646 \u0628\u0627 \u0627\u0639\u062a\u0645\u0627\u062f \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0646\u0648\u0634\u062a\u0647 \u0634\u062f\u0647 \u062f\u0648 \u0628\u0633\u062a\u0647 \u062e\u0631\u06cc\u062f\u0645\u060c \u06f6 \u062a\u0627\u0634 \u0645\u0648\u0646\u062f! \u0628\u0631\u0648\u062a\u0634\u0646 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af \u062a\u0631 \u0627\u0632 \u0627\u0646\u062f\u0627\u0632\u0647 \u0627\u0633\u062a\u0627\u0646\u062f\u0627\u0631\u062f \u0628\u0648\u062f. \u0648\u0644\u06cc \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", "\u0644\u0642\u0645\u0647 \u0628\u0631\u0648\u062a\u0686\u0646", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u0639\u0627\u0644\u064a \u0628\u0648\u062f\u060c \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637", 1]}
{"text": ["\u0686\u0642\u062f\u0631 \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0648\u0646\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062e\u0648\u0646\u06af\u06cc \u0628\u0648\u062f... ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641 \u0634\u062f\u0645! \u0645\u0646 \u0647\u0631 \u0647\u0641\u062a\u0647 \u062f\u0627\u0631\u0645 \u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u0627\u0645\u0627 \u0627\u06cc\u0646 \u0633\u0631\u06cc \u0645\u06cc\u0632\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0628\u0647 \u0637\u0648\u0631 \u0645\u062d\u0633\u0648\u0633 \u06a9\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f! \u0648 \u062d\u062a\u06cc \u0646\u0648\u0639 \u067e\u0646\u06cc\u0631! \u0642\u0628\u0644\u0627 \u0628\u0647 \u06af\u0641\u062a\u0647 \u062e\u0648\u062f\u0634\u0648\u0646 \u067e\u0646\u06cc\u0631 \u0644\u0628\u0646\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc...\n\u0633\u0631\u06cc \u067e\u06cc\u0634 \u0647\u0645 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0627\u0648\u0645\u062f \u0648 \u0639\u0630\u0631\u062e\u0648\u0627\u0647\u06cc \u06a9\u0631\u062f\u06cc\u0646 \u0648\u0644\u06cc  \u0627\u06cc\u0646 \u0633\u0631\u06cc \u0641\u0642\u0637 \u06f5 \u062f\u0642\u06cc\u0642\u0647 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0648 \u0628\u0632\u0646\u06cc\u062f \u0628\u0639\u062f\u0634 \u0647\u0645 \u06f3\u06f3 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0631\u0627\u06cc  \u0627\u0631\u0633\u0627\u0644!!! \u0633\u0641\u0627\u0631\u0634 \u0647\u0645 \u062b\u0627\u0646\u06cc\u0647 \u0647\u0627\u06cc \u0627\u062e\u0631 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0639\u0627\u0644\u06cc\u06cc \u0628\u0648\u062f\u062f\u062f\u062f...\u062e\u0648\u0646\u06af\u06cc \u0628\u0648\u062f \u0641\u06a9\u0631 \u06a9\u0646\u0645 \u0648\u0644\u06cc \u0645\u062d\u0634\u0631 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0648 \u0646\u0627\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0648\u0644 \u0642\u0628\u0644 \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u06cc\u0644  \u0628\u06cc\u0634 \u0627\u0632 \u06f2 \u0633\u0627\u0639\u062a \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u06a9\u0647 \u0648\u0627\u0642\u0639\u0627 \u0628\u0631\u0627\u0645 \u0639\u062c\u06cc\u0628\u0647!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (5 \u0639\u062f\u062f\u06cc)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0648\u0631\u06cc\u0646\u06cc", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645", 1]}
{"text": ["\u0631\u0648\u0644 \u0686\u0627\u06cc \u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0645\u06cc\u0634\u0647\u060c \u06a9\u0627\u0645\u0644\u0627 \u0633\u0648\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a. \u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0686\u0631\u0628 \u0628\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0628\u0648\u062f. \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u0648 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0627 \u062a\u0627\u062e\u06cc\u0631 \u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", 1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0646\u0628\u0648\u062f \u0628\u0633\u06cc\u0627\u0631 \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u06cc\u0631 \u0648 \u0632\u06cc\u062a\u0648\u0646", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9\u200c \u0645\u062d\u062a\u0631\u0645\u0627\u0646\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u0647\u0627 \u0627\u06a9\u062b\u0631\u0634\u0648\u0646 \u062e\u0634\u06a9 \u0628\u0648\u062f\u0646!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u062a\u0633\u062a \u0686\u0627\u0648\u062f\u0627\u0631 \u06a9\u0648\u0686\u06a9", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648  \u0627\u0644\u0628\u062a\u0647 \u0628\u0627 \u062a\u062e\u0641\u06cc\u0641 8 \u062a\u0648\u0645\u0627\u0646\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u0627\u0631\u0633\u0627\u0644 \u0631\u0627\u06cc\u06af\u0627\u0646 \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631 \u0647\u0645 \u0634\u062f\n ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u0643\u064a\u0643 \u0647\u0627\u064a \u0645\u0646 \u0643\u0627\u0645\u0644\u0627\u064b \u0631\u064a\u062e\u062a\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0627\u0646\u062a\u0638\u0627\u0631 \u06cc\u06a9 \u062f\u0633\u0631 \u062a\u0627\u0632\u0647 \u0631\u0648 \u062f\u0627\u0634\u062a\u0645 \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u0627\u0631\u0633\u0627\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0627\u0632 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0647\u0627\u06cc\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062a\u0627 \u062d\u0627\u0644\u0627 \u062e\u0648\u0631\u062f\u0645.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0647\u0633\u062a\u06cc\u062f\u060c \u0644\u0637\u0641\u0627 \u0627\u0632 \u0627\u06cc\u0646 \u067e\u06cc\u0634\u0646\u0647\u0627\u062f\u0647\u0627 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0632\u0627\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u06a9\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0625\u0631\u0633\u0627\u0644 \u0643\u064a\u0643 \u0648\u0627\u0646\u064a\u0644 \u0628\u0647 \u062c\u0627\u064a \u0643\u064a\u0643 \u0647\u0648\u064a\u062c", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633 \u0627\u0632  \u062e\u0648\u062f \u0645\u063a\u0627\u0632\u0647 \u0628\u0627 \u0638\u0627\u0647\u0631 \u0628\u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628.\n\u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062f\u0631 \u0633\u0644\u0627\u0645\u062a \u0648 \u062e\u0648\u0628 \u0631\u0633\u0627\u0646\u062f.\n\u0628\u06cc\u0627\u06cc\u06cc\u062f \u062f\u0631 \u0627\u06cc\u0646 \u0631\u0648\u0632\u0647\u0627\u06cc \u0633\u0631\u062f \u0628\u06cc\u0634\u062a\u0631 \u0647\u0648\u0627\u06cc \u067e\u06cc\u06a9 \u0647\u0627\u06cc \u062e\u0648\u0628 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u0645.\n\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", 1]}
{"text": ["\u062c\u062f\u06cc\u062f\u0627 \u0686\u0631\u0627 \u06a9\u06cc\u06a9 \u0647\u0627 \u0631\u0648 \u062a\u0648 \u0628\u0627\u06a9\u0633 \u0645\u0642\u0648\u0627\u06cc\u06cc \u0646\u0645\u06cc\u0632\u0627\u0631\u06cc\u062f\u061f\u061f\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a\u0634 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u060c \u0628\u0647 \u0645\u0648\u0642\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f \u062e\u0648\u0634\u0628\u062e\u062a\u0627\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u0634\u062a\u0631\u06cc \u0634\u062f\u0645...\n\u0641\u0642\u0637 \u06cc\u0647 \u06a9\u0645 \u0642\u06cc\u0645\u062a \u0647\u0627 \u0628\u0627\u0644\u0627\u0633\u062a \u0628 \u0646\u0638\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 \u0628\u0627 \u0632\u0631\u062f \u0622\u0644\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648\u200c\u062e\u0648\u0634\u0645\u0631\u0647 \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0628\u0647 \u062c\u0627\u06cc \u0628\u0631\u0628\u0631\u06cc \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0645\u0639\u0645\u0648\u0644\u06cc \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647\u060c \u062a\u0631\u062c\u06cc\u062d \u0645\u06cc\u062f\u0627\u062f\u0645 \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0632\u062d\u0645\u0627\u062a \u0634\u0645\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u06cc\u0644\u06cc\u062f\u0634\u06cc\u0648 \u0648 \u062e\u06cc\u0644\u06cc \u0633\u0631 \u0648\u0642\u062a \u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u062f \u0645\u0645\u0646\u0648\u0646 \u0648 \u0645\u0686\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \n\u062f\u0633\u062a \u0645\u0631\u06cc\u0632\u0627\u062f \n\n\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0644\u0627\u062a\u06cc \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \n\u06a9\u06cc\u0641\u06cc\u062a \u0634\u06a9\u0644\u0627\u062a \u0648 \u06a9\u0631\u0645 \u0622\u0646 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0637\u0639\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0632 \u0646\u0638\u0631 \u062a\u0627\u0632\u06af\u06cc \u0648 \u0646\u062d\u0648\u0647 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0648 \u0627\u0631\u0633\u0627\u0644 \u0633\u0631\u06cc\u0639  \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \n\u0641\u0642\u0637 \u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0632\u06cc\u0627\u062f\u06cc \u0686\u0631\u0628 \u0628\u0648\u062f. \u0645\u0645\u0646\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0622\u0631\u062f \u0633\u0648\u062e\u0627\u0631\u06cc (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0622\u0631\u062f \u0633\u0641\u06cc\u062f 21 \u062f\u0631\u0635\u062f (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645)", 1]}
{"text": ["\u062e\u0631\u064a\u062f \u062f\u0648\u0645\u0645 \u0628\u0648\u062f \u0648 \u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u064a \u0648 \u062a\u0627\u0632\u0647 \n\u0641\u0642\u0637 \u0627\u064a \u0643\u0627\u0634  \u0631\u0648\u064a \u067e\u064a\u0631\u0627\u0634\u0643\u064a \u0647\u0627\u062a\u0648\u0646 \u0627\u0632 \u0627\u064a\u0646 \u0642\u0644\u0628 \u0647\u0627\u064a \u0633\u0641\u062a \u0646\u0631\u064a\u0632\u064a\u0646 \u0637\u0639\u0645 \u062e\u0648\u0628 \u067e\u064a\u0631\u0627\u0634\u0643\u064a \u0631\u0648 \u062e\u0631\u0627\u0628 \u0645\u064a\u0643\u0646\u0647. \u0645\u0645\u0646\u0648\u0646 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u062a\u0633\u062a \u06a9\u0648\u0686\u06a9 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627\u0627\u0627\u0627 \u062d\u0631\u0641 \u0646\u062f\u0627\u0634\u062a \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0642\u0628\u0644\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc\u062a\u0648\u0646 \u0628\u0647\u062a\u0631 \u0628\u0648\u062f\n\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u062e\u06cc\u0644\u06cc \u0645\u0632\u0647 \u0631\u0648\u063a\u0646 \u0645\u0648\u0646\u062f\u0647 \u0645\u06cc\u062f\u0627\u062f \u0631\u0648\u063a\u0646 \u062a\u0648\u0634 \u0645\u0627\u0633\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \n\u0628\u0645\u0648\u0642\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f \n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627.\u0641\u0642\u0637 \u06a9\u0627\u0634 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0648\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0647\u0645 \u062c\u0648\u0631\u06cc \u0628\u0627\u0634\u0647 \u06a9 \u0646\u0648\u0646 \u0647\u0627 \u062e\u0648\u0631\u062f \u0646\u0634\u0646.\u062e\u06cc\u0644\u06cc \u0627\u0632 \u0646\u0648\u0646 \u0647\u0627 \u0631\u06cc\u0632 \u0634\u062f\u0646.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u062c\u0648 \u062f\u0648\u0633\u0631 \u0631\u0648\u06af\u0646", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f\u0646\u062f \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0627\u06a9\u0644\u0631 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u06cc\u0647 \u06a9\u0648\u0686\u0648\u0644\u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f. \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u062a\u0648\u0632\u06cc\u0639 \u06a9\u0634\u0645\u0634 \u062f\u0631 \u0627\u0648\u0646 \u0645\u062a\u0646\u0627\u0633\u0628 \u0646\u0628\u0648\u062f \u0648 \u062a\u0645\u0627\u0645\u0634 \u062c\u0645\u0639 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0641 \u06a9\u06cc\u06a9! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0648\u0627\u0642\u0639\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0627\u0633\u062a....", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0647\u0627 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645. \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc\u0647 \u06a9\u0647 \u0628\u0634\u0647 \u0646\u0648\u0646 \u0628\u0627\u06af\u062a \u0648 \u0631\u0698\u06cc\u0645\u06cc \u0631\u0648 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u062a\u0627\u0632\u0647 \u062a\u0627\u0632\u0647 \u062e\u0631\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06cc\u06a9\u06cc \u0627\u0632 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0647\u0627\u06cc\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062a\u0627\u062d\u0627\u0644\u0627 \u062e\u0648\u0631\u062f\u0645. \u0647\u0645 \u0645\u0648\u0627\u062f \u0627\u0648\u0644\u06cc\u0647 \u0627\u0634 \u062e\u06cc\u0644\u06cc \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f \u0647\u0645 \u0638\u0627\u0647\u0631\u0634 \u0647\u0645 \u0637\u0639\u0645\u0634. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u064a\u0644\u0649 \u062e\u064a\u0644\u0649 \u062a\u0627\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0648\u0633\u0631\u064a\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u06cc\u06a9\u0645 \u0642\u06cc\u0645\u062a \u0628\u0627\u0644\u0627\u0633\u062a \u0641\u0642\u0637\u060c\u0627\u0644\u0628\u062a\u0647 \u0686\u06cc \u062a\u0648 \u0627\u06cc\u0646 \u0645\u0645\u0644\u06a9\u062a \u0627\u0631\u0632\u0648\u0646\u0647...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0648\u0627\u0633\u0645 \u0647\u062f\u064a\u0647 \u064a\u0647 \u0643\u0631\u0648\u0633\u0627\u0646 \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0639\u0627\u0644\u0649 \u0628\u0648\u0648\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0642\u064a\u0645\u062a \u0643\u0648\u0643\u064a \u0647\u0627\u064a \u0646\u0633\u0628\u062a \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u0627\u0646 \u0628\u0633\u064a\u0627\u0631 \u0628\u0627\u0644\u0627\u0633\u062a. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u0631\u062f \u0648\u0644\u0648\u062a \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. \u0637\u0648\u0631\u06cc\u06a9\u0647 \u062e\u0627\u0645\u0647 \u0647\u0627\u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9  \u062d\u0627\u0644\u062a \u0633\u0641\u062a \u062f\u0627\u0634\u062a\u0646\u062f \u0648 \u0627\u0632 \u0627\u0633\u0641\u0646\u062c \u06a9\u06cc\u06a9 \u0647\u0645 \u0645\u0634\u062e\u0635 \u0645\u06cc\u0634\u062f \u06a9\u0647 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a. \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0628\u0627 \u0645\u0627 \u0641\u0627\u0635\u0644\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0645\u06cc \u062f\u0627\u0631\u062f \u0648 \u0645\u0627 \u0642\u0628\u0644\u0627 \u062d\u0636\u0648\u0631\u06cc \u062e\u0631\u06cc\u062f \u062f\u0627\u0634\u062a\u06cc\u0645 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u06cc\u0645 \u0627\u0645\u0627 \u0648\u0627\u0642\u0639\u0627 \u062f\u0627\u062f\u0646 \u06a9\u06cc\u06a9 \u0645\u0627\u0646\u062f\u0647 \u0628\u06cc\u0631\u0648\u0646 \u0628\u0631 \u0627\u0646 \u0647\u0645 \u0628\u0627  \u0642\u06cc\u0645\u062a\u06cc \u06a9\u0647 \u0686\u0646\u062f\u0627\u0646 \u0647\u0645 \u06a9\u0645 \u0646\u06cc\u0633\u062a \u06a9\u0627\u0631 \u062e\u06cc\u0644\u06cc \u063a\u06cc\u0631 \u062d\u0631\u0641\u0647 \u0627\u06cc \u0647\u0633\u062a !!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0644\u0637\u0641\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u0631\u0648\u0632\u0627\u0646\u0647 \u0645\u0646\u0648 \u0647\u0627 \u0631\u0627 \u0628\u0647 \u0631\u0648\u0632 \u0631\u0633\u0627\u0646\u064a \u0628\u0641\u0631\u0645\u0627\u064a\u064a\u062f \u0628\u0627 \u062a\u0634\u0643\u0631 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a \u0639\u0627\u0644\u064a \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0642\u06cc\u0645\u062a\u0634 \u0628\u0647 \u0646\u0633\u0628\u062a \u062d\u062c\u0645\u06cc \u06a9\u0647 \u062f\u0627\u0631\u0647\u060c \u06af\u0631\u0648\u0646 \u0647\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0643\u0627\u0645\u0644\u0627 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0643\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u062f\u064a\u0631\u0648\u0632 \u0631\u0648 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0686\u0648\u0646 \u0645\u0646 \u0647\u0645\u064a\u0634\u0647 \u062d\u0636\u0648\u0631\u064a \u0645\u064a\u0631\u0645 \u0645\u064a\u062e\u0631\u0645 \u0648 \u062e\u064a\u0644\u064a \u062a\u0627\u0632\u0633 \n\u0627\u064a\u0646 \u0633\u064a\u0633\u062a\u0645 \u0631\u0648 \u062d\u0627\u0644\u0627 \u0643\u0647 \u062f\u0631\u0633\u062a \u0643\u0631\u062f\u064a\u0646 \u0628\u0627\u064a\u062f \u062a\u0627\u0643\u064a\u062f \u0643\u0646\u064a\u0646 \u0643\u0647 \u062a\u0627\u0632\u0647 \u0628\u062f\u0646 \u062f\u0633\u062a \u0645\u0631\u062f\u0645 \n\u0645\u0646 \u062e\u0648\u062f\u0645 \u0628\u0647 \u0634\u062e\u0635\u0647 \u062f\u064a\u06af\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0646\u0645\u064a\u062e\u0631\u0645 \u0627\u0632\u062a\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", -1]}
{"text": ["\u067e\u0627\u0649 \u0622\u0644\u0628\u0627\u0644\u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0634\u0645\u0627\u0631\u0647 \u062f\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0633\u0641\u0627\u0631\u0634\u06cc \u06a9\u0647 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u0646 \u0632\u062d\u0645\u062a \u06a9\u0634\u06cc\u062f\u0646 \u0648\u0627\u0633\u0645 \u06cc\u06a9 \u0647\u062f\u06cc\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u06cc\u0633\u06a9\u0627\u062a\u06cc \u0633\u0627\u062f\u0647 (\u0648\u0627\u0646\u06cc\u0644 \u067e\u0633\u062a\u0647)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0632\u0631\u062f \u0622\u0644\u0648 \u0648 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0642\u062f\u0645\u062a \u0628\u0627\u0644\u0627\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633 \u0627\u0645\u0631\u0648\u0632\u0647 \u0627\u0632\u0634 \u0628\u064a\u0634\u062a\u0631 \u062a\u0648\u0642\u0639 \u0628\u0627\u064a\u062f \u062f\u0627\u0634\u062a \u0634\u064a\u0631\u064a\u0646\u0649 \u0628\u064a\u0634 \u0627\u0632 \u062d\u062f \u0643\u064a\u0643 \u0642\u0627\u0628\u0644 \u062a\u062d\u0645\u0644 \u0646\u0628\u0648\u062f...\u0643\u0627\u0645\u0644\u0627 \u062a\u063a\u064a\u064a\u0631 \u0631\u0648 \u0645\u064a\u0634\u0647 \u0628\u0627 \u0633\u0627\u0644\u0647\u0627\u0649 \u06af\u0630\u0634\u062a\u0647 \u062d\u0633 \u0643\u0631\u062f \u0628\u0647 \u0647\u0631 \u062d\u0627\u0644 \u0628\u0647 \u0627\u0645\u064a\u062f\u0648\u0627\u0631\u0645 \u0643\u0648\u0643\u0649 \u0628\u0627\u0643\u0633 \u0628\u0647 \u0643\u064a\u0641\u064a\u062a \u0627\u0635\u0644\u0649 \u062e\u0648\u062f\u0634 \u0628\u0631\u06af\u0631\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u06cc\u06a9\u0633 \u06cc\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0627\u0633\u0644\u0627\u0645 \u060c\u062a\u064a\u0631\u0627\u0645\u064a\u0633\u0648\u0646\u0628\u0648\u062f\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u062f\u0627\u0631\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0645\u06cc\u0633\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0627\u06af\u0631 \u0632\u0645\u0627\u0646 \u062a\u062d\u0648\u064a\u0644 \u0633\u0641\u0627\u0631\u0634 \u0631\u0648 \u0641\u0627\u0643\u062a\u0648\u0631 \u0628\u06af\u064a\u0631\u064a\u0645 \u0645\u0627\u0628\u0642\u064a \u0639\u0627\u0644\u064a\n\u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u06cc\u0633\u06a9\u0627\u062a\u06cc \u0633\u0627\u062f\u0647 (\u0648\u0627\u0646\u06cc\u0644 \u067e\u0633\u062a\u0647)", "\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0632\u0631\u062f \u0622\u0644\u0648 \u0648 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0645\u0648\u062f\u0628 \u0648 \u0633\u0631\u06cc\u0639 \u0645\u0631\u0633\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u0648\u06a9\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u0633\u0646\u067e . \u0628\u0647 \u062c\u0627\u064a \u0646\u0627\u0646 \u0648 \u067e\u0646\u064a\u0631 \u0648 \u06af\u0631\u062f\u0648 \u0646\u0627\u0646 \u0648 \u0641\u0644\u0641\u0644 \u0628\u0631\u0627\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0686\u0627\u0648\u062f\u0627\u0631 \u06a9\u0648\u0686\u06a9", "\u062a\u0633\u062a \u0631\u0648\u06cc\u0627\u0644 \u0633\u0628\u0648\u0633", "\u0646\u0627\u0646 \u067e\u0646\u06cc\u0631 \u0648 \u06af\u0631\u062f\u0648", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u06a9\u0648\u0686\u06a9", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0628\u0648\u0633", -1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0645\u0632\u0647 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u0632\u0645\u0644", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686", 1]}
{"text": ["\u0686\u0637\u0648\u0631 \u0645\u0645\u06a9\u0646\u0647 \u067e\u06a9 \u06f2\u06f1 \u0639\u062f\u062f\u06cc \u0628\u0647 \u06f1\u06f8\u0639\u062f\u062f \u06a9\u0627\u0647\u0634 \u067e\u06cc\u062f\u0627 \u06a9\u0646\u0647 !!\n\u062d\u062c\u0645 \u0628\u0633\u062a\u0647 \u0646\u0632\u062f\u06cc\u06a9 \u06cc\u06a9 \u0633\u0648\u0645 \u0646\u0633\u0628\u062a \u0628\u0647 \u0645\u0627\u0647 \u0642\u0628\u0644 \u06a9\u0645 \u0634\u062f\u0647 \u0628\u0627 \u0647\u0645\u0648\u0646 \u0642\u06cc\u0645\u062a \u0648 \u0628\u062f\u0648\u0646 \u062a\u063a\u06cc\u06cc\u0631 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062f\u0631 \u0635\u0641\u062d\u0647 \u0633\u0641\u0627\u0631\u0634 \u0627\u0633\u0646\u067e \u0641\u0648\u062f!!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686", -1]}
{"text": ["\u0646\u0627\u0646 \u062c\u0648 80 \u062f\u0631\u0635\u062f \u062a\u0627\u0631\u06cc\u062e \u062a\u0648\u0644\u06cc\u062f\u0634 \u0628\u0631\u0627\u06cc \u062f\u06cc\u0631\u0648\u0632 \u0628\u0648\u062f \u0648 \u0646\u0627\u0646 \u06a9\u0627\u0645\u0644\u0627 \u0628\u06cc\u0627\u062a \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 100%", "\u0646\u0627\u0646 \u062c\u0648 80%", "\u0686\u0627\u0631\u06a9\u06cc \u0686\u0627\u0648\u062f\u0627\u0631", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0628\u0627\u06af\u062a \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", -1]}
{"text": ["\u0646\u0627\u0646 \u062e\u06cc\u0644\u06cc \u062a\u0631\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u067e\u064a\u0643 \u062e\u064a\u0644\u064a \u062f\u064a\u0631 \u0622\u0648\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0645\u0627\u06a9\u0627\u0631\u0648\u0646 \u062f\u0648 \u062a\u0627 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u06cc\u0647 \u0628\u0633\u062a\u0647 \u062f\u0648\u062a\u0627\u06cc\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u06a9\u0647 \u06cc\u06a9\u06cc\u0634 \u0627\u0632 \u0627\u0648\u0646 \u06cc\u06a9\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u062a\u0631\u0647! \u062d\u0627\u0644\u0627 \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u0648\u0646 \u0628\u0647 \u0637\u0648\u0631 \u067e\u06cc\u0634\u0641\u0631\u0636 \u0641\u0631\u0642 \u062f\u0627\u0631\u0647 \u06cc\u0627 \u062f\u0648\u062a\u0627\u0634 \u0628\u0627 \u0647\u0645 \u06cc\u0647 \u0628\u0633\u062a\u0633 \u0648 \u0627\u0648\u0646 \u06cc\u06a9\u06cc \u0628\u0633\u062a\u0647 \u0631\u0648 \u0646\u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0644\u0637\u0641\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f\n\u06a9\u0631\u0648\u0633\u0627\u0646 \u0648 \u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0648\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc. \u062a\u0645\u0627\u0627\u0627\u0627\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0634\u0648\u0646 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u067e\u064a\u0643 \u0647\u0645 \u062e\u064a\u0644\u064a \u0632\u0648\u062f \u0627\u0648\u0645\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", 1]}
{"text": ["\u0647\u0631 \u062f\u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u0633\u06cc\u0631 \u0648 \u06a9\u0631\u0647 \u0637\u0639\u0645 \u0633\u06cc\u0631 \u0648 \u06a9\u0631\u0647 \u0646\u0645\u06cc\u062f\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0645\u0644", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u0633\u06cc\u0631 \u0648 \u06a9\u0631\u0647", 1]}
{"text": ["\u0647\u06cc\u062c\u0627\u0646 \u0627\u0646\u06af\u06cc\u0632 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f. \u0645\u0631\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0627\u0648\u0645\u062f\n\u0648 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "Don't Even Ask", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0647\u0645 \u0637\u0639\u0645 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0647\u0645 \u062a\u0627\u0632\u06af\u06cc\u0634\u0648\u0646 \u0648 \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a.\n\u0648\u0642\u062a\u06cc \u062e\u0648\u0631\u062f\u0645. \u0627\u062d\u0633\u0627\u0633 \u06a9\u0631\u062f\u0645 \u0645\u0627\u0646\u062f\u0647 \u0627\u0633\u062a.\n\u0634\u0627\u06cc\u062f \u062d\u0633 \u0645\u0646 \u0627\u0633\u062a.\n\u0644\u0637\u0641\u0627 \u062a\u062d\u0642\u06cc\u0642 \u06a9\u0646\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0646\u0649 \u0643\u0648\u0643\u0649 \u0628\u0627\u0631 2", -1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\u062a\u0627\u0633\u0641 \u0628\u0627\u0631 \u0627\u0633\u062a \u06a9\u0647 \u062f\u0631 \u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u06f6 \u0639\u062f\u062f\u06cc \u06a9\u0648\u06a9\u06cc \u060c \u06cc\u06a9 \u0639\u062f\u062f \u06a9\u0645\u062a\u0631 \u0627\u0631\u0633\u0627\u0644 \u06af\u0631\u062f\u06cc\u062f\u0647 \u0628\u0648\u062f\u200c\u200c!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0631\u0648\u0632 \u062e\u0648\u0634\n\u06a9\u0648\u06a9\u06cc \u0631\u0648 \u0627\u0632 \u06a9\u0627\u0641\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc \u062f\u0627\u062f\u0645 \u0627\u06cc\u0646\u0628\u0627\u0631 \u062a\u0635\u0645\u06cc\u0645 \u06af\u0631\u0641\u062a\u0645 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062e\u0631\u06cc\u062f \u06a9\u0646\u0645. \u0686\u0646\u062f \u0646\u0648\u0639 \u06a9\u0648\u06a9\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0647\u0645\u0647 \u0634\u0648\u0646 \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f\u0646 \u0648 \u0627\u0635\u0644\u0627 \u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a\u0646:( \u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u0627\u0631\u0632\u0634 \u0642\u0627\u0626\u0644 \u0646\u06cc\u0633\u062a\u06cc\u062f. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", -1]}
{"text": ["\u0648\u0642\u062a\u064a \u0643\u064a\u0643 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f\u0647 \u0628\u0648\u062f \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u060c \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u062c\u0639\u0628\u0647 \u0627\u0632 \u062f\u0633\u062a \u0627\u0633\u0646\u067e \u0628\u0627\u0643\u0633 \u0627\u0641\u062a\u0627\u062f\u0647 \u060c \u062e\u0648\u0627\u0647\u0634 \u0645\u064a\u0643\u0646\u0645 \u0628\u0647 \u0645\u0627\u0645\u0648\u0631\u0627\u064a \u0627\u0633\u0646\u067e \u0628\u0627\u0643\u0633 \u062a\u0630\u0643\u0631 \u0628\u062f\u064a\u0646 \u0628\u0627 \u0627\u062d\u062a\u064a\u0627\u0637 \u0628\u064a\u0627\u0631\u0646 \u0634\u064a\u0631\u064a\u0646\u064a \u0631\u0648.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0633\u062a. \u0645\u0627 \u0647\u0631 \u0645\u0647\u0645\u0648\u0646\u06cc \u0645\u06cc \u062e\u0648\u0627\u0647\u06cc\u0645 \u0628\u0631\u06cc\u0645\u060c \u0635\u0627\u062d\u0628 \u062e\u0627\u0646\u0647 \u0628\u0647\u0645\u0648\u0646 \u0645\u06cc\u06af\u0647\u060c \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0646\u0632\u062f\u06cc\u06a9 \u0634\u0645\u0627 \u0647\u0633\u062a\u060c \u0628\u0631\u0627\u0645\u0648\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u062e\u0631\u06cc\u062f\u060c \u0628\u06cc\u0627\u0631\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u06cc\u0646 \u0628\u0627\u0631 \u062f\u0648\u0645 \u0647\u0633\u062a \u06a9\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06a9\u06cc\u06a9 \u062e\u0631\u0627\u0628 \u0645\u06cc\u06a9\u0646\u0647 \u0645\u06cc\u0627\u0631\u0647. \u06a9\u06cc\u06a9 \u062a\u06a9\u0648\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u06cc\u06a9\u0637\u0631\u0641 \u06a9\u06cc\u06a9 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647. \u0647\u0645\u0686\u0646\u06cc\u0646 \u0628\u0627\u06cc\u062f \u06a9\u0627\u0648\u0631\u06cc \u0628\u0631\u0627\u06cc \u0631\u0648\u0632\u0647\u0627\u06cc \u0628\u0627\u0631\u0648\u0646\u06cc \u0648 \u0628\u0631\u0641\u06cc \u062f\u0631 \u0646\u0638\u0631 \u0628\u06af\u06cc\u0631\u0646\u062f \u062a\u0627 \u062c\u0639\u0628\u0647 \u06a9\u06cc\u06a9 \u062e\u06cc\u0633 \u0646\u0634\u0647. \u0627\u0644\u0628\u062a\u0647 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645 \u0628\u0647\u062a\u0631\u0647 \u0637\u0631\u0627\u062d\u06cc \u062c\u0639\u0628\u0647 \u0647\u0627\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0639\u0648\u0636 \u06a9\u0646\u0647 \u0686\u0648\u0646 \u06a9\u06cc\u06a9 \u0628\u0631\u0627\u06cc \u062c\u0639\u0628\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0647\u0633\u062a \u0648 \u062a\u06a9\u0648\u0646 \u0645\u06cc\u062e\u0648\u0631\u0647 \n\u0627\u0645\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u062f \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u0647 \u0648 \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0647\u0633\u062a\u0645\n\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0643\u064a\u0643 \u062e\u064a\u0644\u064a \u0627\u0632 \u0627\u0648\u0646\u064a \u0643\u0647 \u0646\u0635\u0648\u0631 \u0645\u064a\u0634\u0647 \u0643\u0648\u0686\u0643\u062a\u0631\u0647 \u0645\u062a\u0648\u0633\u0637 \u0646\u064a\u0633\u062a \u0643\u0648\u0686\u064a\u0643\u0647 \u0647\u0645\u0686\u0646\u064a\u0646 \u062a\u0645\u0627\u0645 \u0643\u064a\u0643 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u062a\u0648 \u0631\u0627\u0647 \u0648 \u0642\u0627\u0628\u0644 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u064a\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 HBD \u0631\u0646\u06af\u06cc", -1]}
{"text": ["\u0628\u0631\u0627\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u0645\u0627\u0644 \u0686\u0646\u062f\u06cc\u0646 \u0631\u0648\u0632 \u067e\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u0645\u06cc\u0646\u06cc\u0627\u062a\u0648\u0631\u06cc \u060c \u0642\u0637\u0631 \u0647\u0631 \u06a9\u062f\u0648\u0645 \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u06cc\u0647 \u0628\u0646\u062f \u0627\u0646\u06af\u0634\u062a\u0647! \n\u0645\u0646 \u0648\u0627\u0633\u0647 \u0631\u0641\u062a\u0646 \u0628\u0647 \u0645\u0647\u0645\u0648\u0646\u06cc \u062e\u0631\u06cc\u062f\u0645 \u0648 \u0641\u06a9\u0631 \u06a9\u0631\u062f\u0645 \u0647\u0631\u06a9\u062f\u0648\u0645 \u06a9\u0645 \u06a9\u0645 \u0627\u0646\u062f\u0627\u0632\u0647 \u06cc\u0647 \u06a9\u0627\u067e\u06a9\u06cc\u06a9 \u06cc\u0627 \u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc\u0647\n\u0628\u0627 \u0627\u06cc\u0646\u0627 \u0628\u0627\u06cc\u062f \u062e\u0627\u0644\u0647 \u0628\u0627\u0632\u06cc \u06a9\u0631\u062f \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0631\u0648 \u0645\u0646 \u0627\u0632 \u0639\u0635\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u062f\u0631 \u0627\u0646\u062a\u0647\u0627\u06cc \u0634\u0628 \u0628\u0627 \u06a9\u0645\u0627\u0644 \u062a\u0639\u062c\u0628 \u0628\u0639\u062f \u0627\u0632 \u0628\u0627\u0632 \u06a9\u0631\u062f\u0646 \u062f\u0631\u0628 \u062c\u0639\u0628\u0647 \u0645\u062a\u0648\u062c\u0647 \u0634\u062f\u0645 \u06a9\u0647 \u067e\u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0631\u0648 \u06a9\u062c \u06a9\u0631\u062f\u0647 \u0648 \u06a9\u06cc\u06a9 \u06cc\u06a9\u0637\u0631\u0641\u0634 \u06a9\u0627\u0645\u0644\u0627 \u0634\u06a9\u0644 \u0646\u0627\u0641\u0631\u0645\u06cc \u062f\u0627\u0634\u062a \u0648 \u062c\u0644\u0648\u06cc \u0645\u0647\u0645\u0648\u0646\u0647\u0627 \u062d\u0627\u0644\u062a \u062e\u0648\u0634\u06cc \u0646\u062f\u0627\u0634\u062a \u060c \u0648\u0642\u062a\u06cc \u0634\u0645\u0627 \u062f\u0627\u0631\u06cc\u062f \u06a9\u0627\u0631 \u062a\u062e\u0635\u0635\u06cc \u0645\u06cc\u06a9\u0646\u06cc\u062f \u06cc\u0639\u0646\u06cc \u062d\u0645\u0644 \u063a\u0630\u0627 \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u06a9\u06cc\u06a9 \u06a9\u0647 \u0628\u0647 \u0645\u0631\u0627\u062a\u0628 \u0627\u0632 \u063a\u0630\u0627 \u0647\u0645 \u06a9\u0627\u0631 \u0638\u0631\u06cc\u0641\u062a\u0631\u06cc \u0627\u0633\u062a \u0628\u0627\u06cc\u062f \u0628\u0647 \u067e\u06cc\u06a9 \u0647\u0627\u06cc \u062e\u0648\u062f \u0627\u0645\u0648\u0632\u0634 \u062f\u0647\u06cc\u062f \u060c \u0645\u0646 \u0647\u0645\u0686\u06cc\u0646 \u0647\u0632\u06cc\u0646\u0647 \u0628\u0627\u0644\u0627\u06cc\u06cc \u06a9\u0631\u062f\u0645 \u0627\u0644\u0627\u0646 \u06a9\u06cc \u062c\u0648\u0627\u0628 \u0628\u06cc\u062f\u0642\u062a\u06cc \u0648 \u0633\u0647\u0644 \u0627\u0646\u06af\u0627\u0631\u06cc \u067e\u06cc\u06a9 \u0634\u0645\u0627 \u0631\u0648 \u0645\u06cc\u062f\u0647 \u061f! \u0648\u0627\u0642\u0639\u0627\u0646\u0627 \u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0645\u062b\u0644 \u0631\u0633\u0648\u0646\u062f\u0646 \u06cc\u06a9 \u067e\u0627\u06a9\u062a \u0646\u0627\u0645\u0647 \u0646\u06cc\u0633\u062a \u060c \u0627\u06cc\u0646 \u0627\u062a\u0641\u0627\u0642 \u0642\u0628\u0644\u0627 \u0647\u0645 \u06f2 \u0628\u0627\u0631 \u0628\u0627 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0631\u0627\u06cc \u0645\u0646 \u0627\u0641\u062a\u0627\u062f\u0647 \u0648 \u0647\u06cc\u0686 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06cc\u0627 \u062a\u0648\u062c\u0647\u06cc \u0647\u0645 \u0627\u0632 \u0633\u0645\u062a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0646\u0634\u062f\u0647 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0628\u0627\u0639\u062b \u062a\u0627\u0633\u0641 \u0627\u0633\u062a \u060c \u0627\u06cc\u0646\u06a9\u0627\u0631 \u0634\u0645\u0627 \u0628\u0627\u0639\u062b \u062a\u0628\u0644\u06cc\u063a \u0645\u0646\u0641\u06cc \u0628\u0631\u0627\u06cc \u0633\u06cc\u0633\u062a\u0645 \u0634\u0645\u0627\u0633\u062a \u0686\u0648\u0646 \u062d\u062a\u0645\u0627 \u0645\u0646 \u0628\u0647 \u062f\u0648\u0633\u062a\u0627\u0646 \u0648 \u0627\u0634\u0646\u0627\u06cc\u0627\u0646 \u0647\u0645 \u062e\u0648\u0627\u0647\u0645 \u06af\u0641\u062a \u06a9\u0647 \u0645\u0628\u0627\u062f\u0627 \u0627\u06cc\u0646 \u0627\u0634\u062a\u0628\u0627\u0647 \u0631\u0648 \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u0647\u0646\u062f \u060c \u0644\u0637\u0641\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u0643\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 \u0643\u0648\u0643\u06cc", -1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0686\u064a\u0632\u0643\u064a\u0643 \u0647\u0648\u064a\u062c \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f. \u0643\u0631\u0627\u0645\u0628\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f.\n \u0627\u0633\u0646\u067e \u0627\u0643\u0633\u067e\u0631\u0633 \u0642\u0628\u0644 \u0627\u0632 \u062a\u062d\u0648\u064a\u0644\u060c \u0627\u0639\u0644\u0627\u0645 \u062a\u062d\u0648\u064a\u0644 \u0643\u0631\u062f \u0643\u0647 \u0627\u0644\u0628\u062a\u0647 \u0627\u064a\u0646 \u0645\u0648\u0636\u0648\u0639 \u062f\u0631 \u062f\u0648 \u0645\u0627\u0647 \u0627\u062e\u064a\u0631 \u0632\u064a\u0627\u062f \u0627\u062a\u0641\u0627\u0642 \u0645\u064a \u0627\u0641\u062a\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u0645\u0646 \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0628\u0631\u0627\u06cc \u0628\u0647 \u0627\u0634\u062a\u0628\u0627\u0647 \u0645\u0646 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u06af\u0631\u0648\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0641\u0627\u062c \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u064a\u0646\u0643\u0647 \u0633\u0641\u0627\u0631\u0634 \u0634\u064a\u0631\u064a\u0646\u064a \u062a\u0631 \u0628\u0648\u062f \u062f\u0631 \u062d\u0645\u0644 \u062c\u0639\u0628\u0647 \u062f\u0642\u062a \u0646\u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0631\u0648\u064a \u0647\u0645 \u0627\u0641\u062a\u0627\u062f\u0647 \u0648 \u0633\u0631 \u0648 \u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u062f\u064a\u06af\u0631 \u0645\u0646\u0627\u0633\u0628 \u067e\u0630\u064a\u0631\u0627\u064a\u064a \u0645\u0647\u0645\u0627\u0646 \u0646\u0628\u0648\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", -1]}
{"text": ["\u0647\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648 \u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f \u0647\u0645\u0647 \u0686\u064a\u0632\u060c \u0641\u0642\u0637 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0628\u0627 \u062a\u0627\u062e\u064a\u0631 \u0631\u0633\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0628\u062f\u0647 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062a\u0648\u06cc \u06cc\u0647 \u0646\u0627\u06cc\u0644\u0648\u0646 \u0628\u0632\u0627\u0631\u06cc\u062f \u062d\u062f\u0627\u0642\u0644 \u0646\u0627\u0646 \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0628\u0627\u06cc\u062f \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0645\u0646\u0627\u0633\u0628 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u06a9\u0647 \u0646\u0627\u06cc\u0644\u0648\u0646 \u067e\u0627\u0631\u0647 \u0645\u06cc\u0634\u0647 \u0646\u0627\u0646 \u06a9\u062b\u06cc\u0641 \u0646\u0634\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0635\u0627\u0641 \u0628\u0627\u06cc\u062f \u062d\u0645\u0644 \u0628\u0634\u0647 \u06a9\u0647 \u0631\u0648\u06cc \u0647\u0645 \u0646\u0631\u06cc\u0632\u0647 \u062e\u0648\u0631\u062f \u0628\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0628\u0646\u0638\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u06cc\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc . \u0639\u0627\u0644\u06cc\u0647 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u062a\u0648\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0645\u062e\u0635\u0648\u0635 \u067e\u0648\u0631\u067e\u0648\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0628\u0631\u0627\u06cc \u067e\u0627\u06cc \u0633\u06cc\u0628 \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631\u0647 \u06a9\u0647 \u0627\u0632 \u062e\u0648\u062f \u0645\u06cc\u0648\u0647 \u0633\u06cc\u0628 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0628\u0634\u0647 \u0646\u0647 \u0634\u0647\u062f \u06cc\u0627 \u0686\u06cc\u0632\u06cc \u0634\u0628\u06cc\u0647 \u0627\u06cc\u0646 ... \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0645\u0627 \u0628\u0627 \u0627\u06cc\u0646 \u062d\u0627\u0644 \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0646\u0627\u0646 \u062c\u0645 \u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0644 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062a\u0633\u0627\u062c", 1]}
{"text": ["\u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\n\u0627\u06cc\u0646 \u062f\u0641\u0639\u0647 \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647\n\u0644\u0637\u0641\u0627\u064b \u0646\u0627\u0646 \u0647\u0627\u06cc \u0686\u0646\u062f \u0631\u0648\u0632 \u0645\u0648\u0646\u062f\u0647 \u0631\u0648 \u0628\u0647 \u062c\u0627\u06cc \u0646\u0648\u0646 \u0631\u0648\u0632 \u0627\u0631\u0633\u0627\u0644 \u0646\u06a9\u0646\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (20 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u0633\u0628\u0648\u0633 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0645\u0637\u0645\u0626\u0646\u0645 \u0627\u06a9\u0647 \u0628\u0627 \u0647\u0645\u06cc\u0646 \u0641\u0631\u0645\u0648\u0646 \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u06cc\u0646 \u0631\u0648\u0632 \u0628\u0631\u0648\u0632 \u0645\u0634\u062a\u0631\u06cc\u0647\u0627\u06cc \u0628\u06cc\u0634\u062a\u0631\u06cc \u062e\u0648\u0627\u0647\u06cc\u062f \u062f\u0627\u0634\u062a \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632 \u062a\u06cc\u0645\u062a\u0648\u0646 \u060c \u0633\u0641\u0627\u0631\u0634\u0627\u062a\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0639\u0627\u0644\u06cc \u0647\u0645 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f .\n\u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u0634\u0647 \u0628\u0647 \u0647\u0645\u0647 \u062f\u0648\u0633\u062a\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u0645\u06a9 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062a\u0627\u0632\u0647\u060c \u0646\u0648\u0622\u0648\u0631\u0627\u0646\u0647\u060c \u062e\u0648\u0634\u0645\u0632\u0647. \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f ..... \u0641\u0642\u0637 \u0634\u06cc\u0631\u06cc\u0646 \u06a9\u0646\u0646\u062f\u0647 \u0627\u06cc \u06a9\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0686\u06cc \u0647\u0633\u062a\u061f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u062c\u0648 \u062f\u0648\u0633\u0631 \u0631\u0648\u06af\u0646", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0627\u0635\u0641\u0647\u0627\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f...\u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0647 \u0645\u0648\u0642\u0639 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f....\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u062e\u0648\u062f\u0686\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0644 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc\u0634 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0627\u0631 \u0642\u0628\u0644 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0648\u0627\u0642\u0646 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0628\u0633\u06cc\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628", -1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u0637\u0639\u0645 \u062a\u062e\u0645 \u0645\u0631\u063a \u0634\u062f\u06cc\u062f\u06cc \u062f\u0627\u0634\u062a\u060c \u0648\u0627\u0642\u0639\u0627 \u0628\u0647 \u0633\u062e\u062a\u06cc \u0645\u06cc\u0634\u062f \u062e\u0648\u0631\u062f \u0648\u0644\u06cc \u0628\u0642\u06cc\u0647 \u0645\u0648\u0627\u0631\u062f \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0646\u0631\u0698\u06cc \u0628\u0627\u0631 \u062e\u06cc\u0644\u0644\u06cc\u06cc\u06cc \u062d\u062c\u0645\u0634 \u06a9\u0645 \u0628\u0648\u062f \u0648 \u0645\u0648\u0627\u062f \u062f\u0627\u062e\u0644\u0634 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u06a9\u0646\u062c\u062f", "\u0627\u0646\u0631\u0698\u06cc \u0628\u0627\u0631", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u0627\u0648\u0644 \u0686\u0627\u06cc \u0639\u0627\u0644\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u06f1\u06f0 \u062f\u0642\u06cc\u0642\u0647 \u0628\u0639\u062f \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u067e\u06cc\u0627\u0645\u06a9 \u062a\u062d\u0648\u06cc\u0644 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u0622\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0628\u0627\u0645\u06cc\u0647", 1]}
{"text": ["\u062f\u0631 \u062a\u0639\u062f\u0627\u062f \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0627\u0634\u062a\u0628\u0627\u0647 \u0643\u0631\u062f\u0647 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u06a9\u0631\u0645 \u062f\u0627\u062e\u0644 \u067e\u06cc\u0631\u0644\u0634\u06af\u06cc \u0627\u0635\u0644\u0627 \u062c\u0627\u0644\u0628 \u0648 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f ! \u0645\u0627\u06a9\u0627\u0631\u0648\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f. \u067e\u06cc\u0631\u0627\u0634\u06af\u06cc \u0634\u06a9\u0631\u06cc \u0647\u0645 \u0645\u0639\u0645\u0648\u0644\u06cc \u0628\u0648\u062f. \u062a\u0627\u0632\u0647 \u0647\u0645 \u0646\u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647...\u062d\u062f\u0648\u062f \u0646\u06cc\u0645 \u0633\u0627\u0639\u062a\u0647 \u0622\u0648\u0631\u062f\u0646....\u0634\u062f \u06cc\u06a9\u06cc \u0627\u0632 \u0627\u0646\u062a\u062e\u0627\u0628\u0647\u0627\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0634\u0645\u0634\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f. \u0631\u0648\u0644 \u0686\u0627\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0646\u0648\u0646 \u0634\u06cc\u0631\u0645\u0627\u0644 \u06a9\u0627\u0645\u0644\u0627 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u062d\u062a\u06cc \u0628\u0648\u0634 \u0639\u0648\u0636 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u062f\u0646\u06cc\u0634 \u0647\u0627\u0634\u0648\u0646 \u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0627\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647", -1]}
{"text": ["\u0644\u0627\u06cc\u0647 \u06a9\u06cc\u06a9 \u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u0632\u06cc\u0631 \u06a9\u0645\u06cc \u062a\u0644\u062e \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062f\u0631 \u0647\u0646\u06af\u0627\u0645 \u0627\u0631\u0633\u0627\u0644 \u0628\u0647 \u062f\u06cc\u0648\u0627\u0631\u0647 \u0647\u0627\u06cc \u062c\u0639\u0628\u0647 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0631\u062e\u0648\u0631\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0645\u06cc \u0627\u0632 \u0632\u06cc\u0628\u0627\u06cc\u06cc \u0638\u0627\u0647\u0631\u06cc \u0622\u0646 \u06a9\u0627\u0633\u062a\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u0648\u062f \u0622\u0642\u0627\u06cc\u06cc \u06a9\u0647 \u067e\u06cc\u06a9 \u0628\u0648\u062f\u0646 \u0627\u0632 \u0645\u0646 \u062e\u0648\u0627\u0633\u062a\u0646 \u06a9\u0647 \u06a9\u06cc\u06a9 \u0631\u0648 \u0686\u06a9 \u06a9\u0646\u0645 \u0648 \u0645\u0646 \u0647\u0645 \u0635\u0631\u0641\u0627 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0635\u062f\u0627\u0642\u062a \u0627\u06cc\u0634\u0648\u0646 \u0642\u0628\u0648\u0644 \u06a9\u0631\u062f\u0645. \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062f\u0631 \u062e\u0635\u0648\u0635 \u062d\u0645\u0644 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062c\u0627\u062a \u0648 \u06a9\u06cc\u06a9 \u0647\u0627 \u0628\u0627\u06cc\u062f \u062f\u0642\u062a \u0628\u06cc\u0634\u062a\u0631\u06cc \u0645\u062f \u0646\u0638\u0631 \u0642\u0631\u0627\u0631 \u0628\u06af\u06cc\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u06a9\u06cc\u06a9 \u0631\u0648\u0634 \u06a9\u0627\u0645\u0644\u0627 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f \u0628\u0647 \u062c\u0639\u0628\u0647\n\u0648 \u0686\u0648\u0646 \u0634\u0631\u0627\u06cc\u0637 \u062e\u0631\u06cc\u062f \u0645\u062c\u062f\u062f \u0646\u062f\u0627\u0634\u062a\u0645 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u0642\u0628\u0648\u0644 \u06a9\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u067e\u06cc\u06a9 \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f\u060c \u0648 \u0645\u0633\u06cc\u0631 \u0631\u0627  \u0631\u0648\u06cc \u0646\u0642\u0634\u0647 \u0627\u0634\u062a\u0628\u0627\u0647 \u0645\u06cc\u0631\u0641\u062a\n\u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0648 \u06a9\u06cc\u06a9 \u0647\u0627 \u062f\u0631 \u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0648\u0642\u062a\u06cc \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f\u0646\u062f \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0646\u0635\u0641 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u0645\u0627\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", -1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645. \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u062d\u0645\u0644 \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u06cc\u06a9\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0648\u0627\u064a\u062a \u0686\u0627\u0643\u0644\u062a \u0643\u0648\u0643\u06cc", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", 1]}
{"text": ["\u067e\u06cc\u06a9 \u06a9\u06cc\u06a9 \u0631\u0648 \u0627\u0646\u062f\u0627\u062e\u062a\u0647 \u0628\u0648\u062f \u06a9\u0627\u0645\u0644\u0627 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af \u0648\u06cc\u0698\u0647 \u06cc\u0644\u062f\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0642\u0628\u0644\u06cc \u0631\u0648 \u0646\u062f\u0627\u0634\u062a .. \u062a\u0631\u06a9\u06cc\u0628 \u062e\u0627\u0645\u0647 \u0627\u0646\u0627\u0631 \u0648 \u0686\u06cc\u0632 \u0627\u0635\u0644\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u06cc\u0633\u062a ..", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0627\u0646\u0627\u0631 \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0643\u064a\u0643 \u0644\u0647 \u0634\u062f\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u0648 \u0627\u0646\u0627\u0631 \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0639\u0627\u0634\u0642 \u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af \u0634\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af (\u0645\u062a\u0648\u0633\u0637)", "\u06a9\u06cc\u06a9 \u0645\u0648\u06a9\u0627 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062e\u0627\u0645\u0634 \u062e\u06cc\u0644\u06cc \u0633\u0641\u062a \u0628\u0648\u062f \u0648 \u0686\u0631\u0628.\n\u0645\u0642\u062f\u0627\u0631 \u06a9\u06cc\u06a9 \u0647\u0645 \u0628\u0647 \u0646\u0633\u0628\u062a \u062e\u0627\u0645\u0647 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0648 \u067e\u0646\u06cc\u0631 \u0632\u06cc\u0631 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", -1]}
{"text": ["\u062e\u0633\u062a\u0647 \u0646\u0628\u0627\u0634\u06cc\u0646\u060c\u0644\u0637\u0641\u0627\u064b \u0622\u0645\u0648\u0632\u0634 \u062a\u062d\u0648\u06cc\u0644 \u06a9\u06cc\u06a9 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648 \u0628\u0647 \u067e\u06cc\u06a9\u0647\u0627\u062a\u0648\u0646 \u0628\u062f\u06cc\u0646\u060c \u062a\u0639\u062f\u0627\u062f\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633\u0647\u0627 \u0628\u0632\u0639\u06a9\u0633 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u06cc\u0646 \u0627\u0635\u0644\u0627\u064b \u062c\u0644\u0648\u0647 \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0631\u0647. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0645\u0648\u06a9\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0639\u0644\u06cc\u0631\u0642\u0645 \u062a\u0648\u0635\u06cc\u0647 \u0627\u06cc \u06a9\u0647 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0627\u0632 \u0647\u0645 \u0628\u062f\u0644\u06cc\u0644 \u062a\u06a9\u0648\u0646 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f.. \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0634 \u0631\u0648 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0645\u0648\u06a9\u0627 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0634\u0645\u0627 \u0639\u0627\u0644\u064a \u062a\u0631\u064a\u0646 \u060c \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631\u064a\u0646 \u0648 \u0628\u0627 \u0643\u064a\u0641\u064a\u062a \u062a\u0631\u064a\u0646 \u0647\u0633\u062a\u064a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0648 \u0633\u0641\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\n\n\u0647\u0645\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u062f.\n\n\u0627\u0644\u0628\u062a\u0647 \u0628\u0647 \u0646\u0638\u0631\u0645 \u0645\u06cc\u06a9\u0633 \u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0628\u0647 \u062a\u0627\u0632\u06af\u06cc \u0628\u0642\u06cc\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u0646\u0628\u0648\u062f \u0648 \u0631\u0648\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0645\u0642\u062f\u0627\u0631\u06cc \u06a9\u062f\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f.\n\n\u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0648 \u0633\u0627\u0644\u0645 \u06a9\u06cc\u06a9 \u0647\u0627 \u0631\u0627 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645 \n \u0645\u0646 \u0627\u0632 \u0645\u0634\u062a\u0631\u06cc\u0647\u0627\u06cc \u062b\u0627\u0628\u062a \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0627\u0645 \n \u06a9\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \n \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c\u062a\u0648\u0646 \u0628\u062f \u0628\u0648\u062f...\u067e\u0646\u06cc\u0631\u0634 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0645\u062b\u0644 \u067e\u0627\u06a9\u06a9\u0646 \u0628\u06a9\u062f \n \u0628\u0631\u0627\u06cc \u0686\u06cc\u0632\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062a\u062e\u0641\u06cc\u0641 \u06af\u0630\u0627\u0634\u062a\u06cc\u062f \u0648\u0644\u06cc \u0633\u0627\u06cc\u0632\u0634 \u0646\u0635\u0641 \u0634\u062f\u0647 ...\u0627\u06cc\u0646 \u06a9\u0627\u0631\u062a\u0648\u0646 \u062a\u0648\u0647\u06cc\u0646 \u0628\u0647 \u0645\u0634\u062a\u0631\u06cc \u062a\u0648\u0646\u0647...\u0648\u0627\u0642\u0639\u0627 \u0645\u062a\u0627\u0633\u0641\u0645 \u0628\u0631\u0627\u062a\u0648\u0646...\u0627\u06af\u0631 \u062a\u062e\u0641\u06cc\u0641 \u0628\u0647\u062a\u0648\u0646 \u0632\u0648\u0631 \u0645\u06cc\u0627\u0631\u0647 \u0634\u0627\u0646 \u062a\u0648\u0646 \u0631\u0648 \u062d\u0641\u0638 \u06a9\u0646\u06cc\u062f \u0648 \u062a\u062e\u0641\u06cc\u0641 \u0646\u062f\u06cc\u062f.. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", -1]}
{"text": ["\u06af\u0627\u062a\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc\u0634 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0631\u0648 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0628 \u0646\u06af\u0647 \u062f\u0627\u0631\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0634 \u0637\u0639\u0645.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062d\u0627\u062c\u06cc \u0628\u0627\u062f\u0627\u0645\u06cc", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0645\u0648\u062f\u0628 \u0648 \u0645\u062d\u062a\u0631\u0645 \u0628\u0648\u062f\u060c \u062f\u0633\u062a \u0634\u0648\u0646 \u062f\u0631\u062f\u0646\u06a9\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0627\u0644\u0628\u062a\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u06a9\u0647 \u0627\u06cc\u0646 \u0622\u062f\u0645\u06a9 \u0646\u0627\u0631\u0627\u0636\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0646\u0634\u0648\u0646 \u0645\u06cc\u062f\u0647 \u0646\u0627\u0631\u0627\u062d\u062a \u0648 \u0639\u0635\u0628\u0627\u0646\u06cc \u0646\u06cc\u0633\u062a\u0645 \u0627\u0645\u0627 \u0646\u0627\u0646 \u062c\u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062c\u062f\u0627\u06af\u0627\u0646\u0647 \u0646\u062f\u0627\u0634\u062a \u0648 \u0627\u06cc\u0646 \u0628\u0627\u0639\u062b \u0634\u062f\u0647 \u0628\u0648\u062f \u062a\u0627 \u0648\u0642\u062a\u06cc \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0645\u06cc\u0631\u0633\u0647 \u062a\u0645\u0627\u0645 \u0633\u0637\u062d \u0631\u0648\u06cc \u0646\u0648\u0646 \u062e\u0634\u06a9 \u0628\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u06a9\u0648\u0686\u06a9 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062d\u062c\u0645\u0634 \u0646\u0627\u0646 \u0647\u0627 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u06a9\u0645 \u0628\u0648\u062f. \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0648\u0631\u0646 \u0627\u0634\u067e\u06cc\u062a\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0631\u062e\u0644\u0627\u0641 \u0647\u0631 \u0631\u0648\u0632 \u06a9\u0647 \u0645\u0646 \u0646\u0648\u0646 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0645 \u062a\u0627\u0632\u0647 \u0648 \u0646\u0631\u0645 \u0647\u0633\u062a \u0627\u0645\u0631\u0648\u0632 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062e\u0634\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0631\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u0648\u0628 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (20 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0641\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0646\u0627\u0646 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0627\u062a \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0644\u0630\u06cc\u0630 \u0628\u0648\u062f \u0639\u0627\u0634\u0642\u0634 \u0634\u062f\u0645 \u060c \u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062a\u0627\u0627\u0627\u0627\u0627\u0627\u0632\u0647 \u061b \u0645\u0631\u0633\u06cc \u0627\u0632\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u067e\u0646\u062c \u0645\u063a\u0632", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u062a \u0631\u0698\u06cc\u0645\u06cc \u0628\u0627 \u0634\u0647\u062f \u0627\u0646\u06af\u0648\u0631", 1]}
{"text": ["\u0632\u0628\u0627\u0646 \u062e\u0634\u06a9 \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0634\u0645\u0634\u064a \u062e\u064a\u0644\u064a \u0643\u0647\u0646\u0647 \u0648 \u0633\u0641\u062a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0686\u0646\u062f \u063a\u0644\u0647 \u062f\u0627\u063a \u0648 \u062a\u0627\u0632\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u06a9\u0647 \u0644\u0630\u062a \u0628\u0631\u062f\u0645 \u0627\u0645\u0627 \u0642\u0628\u0644\u0627 \u0631\u0648\u0634 \u067e\u0631 \u0627\u0632 \u063a\u0644\u0627\u062a \u0648 \u06cc\u06a9 \u0686\u06cc\u06cc\u0632\u0647\u0627\u06cc\u06cc \u0645\u062b\u0644 \u062c\u0648 \u067e\u0631\u06a9 \u0628\u0648\u062f \u06a9\u0647 \u0627\u06cc\u0646\u062f\u0641\u0639\u0647 \u0631\u0648\u0634 \u062e\u0644\u0648\u062a \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0627\u062e\u0644\u0634 \u062f\u0627\u0634\u062a \u0644\u0637\u0641\u0627 \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0647\u0627 \u0647\u0645 \u0645\u062b\u0644 \u0642\u062f\u06cc\u0645 \u0628\u0634\u0647 \n\u06a9\u06cc\u06a9 \u0628\u0631\u0648\u0646\u06cc \u0647\u0645 \u0639\u0627\u0644\u06cc\n\u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0647\u0645 \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0647\u0648\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u0647\u0627\u0634 \u0631\u0648 \u062f\u0627\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0647 \u062e\u0635\u0648\u0635 \u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0647\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0639\u062f\u0627\u062f \u0631\u0648 \u0627\u0634\u062a\u0628\u0627\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u06a9\u0647 \u062f\u0631 \u062a\u0645\u0627\u0633 \u0628\u0627 \u0627\u0633\u0646\u067e \u0645\u0628\u0644\u063a \u0628\u0631\u06af\u0631\u062f\u0627\u0646\u062f\u0647 \u0634\u062f \u0648 \u062f\u0642\u06cc\u0642\u0627 \u0647\u0645\u0648\u0646 \u0622\u06cc\u062a\u0645\u06cc \u0628\u0648\u062f \u06a9\u0647 \u0628\u06cc\u0634\u062a\u0631 \u0645\u06cc\u062e\u0648\u0627\u0633\u062a\u0645\u0634 \u0648 \u062c\u0627\u0644\u0628\u06cc\u0634 \u0627\u06cc\u0646 \u0628\u0648\u062f \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u0627\u0635\u0631\u0627\u0631 \u062f\u0627\u0634\u062a \u062a\u0648 \u062f\u0648\u0631\u0628\u06cc\u0646 \u0686\u06a9 \u06a9\u0631\u062f\u0646 \u062f\u0631\u0633\u062a \u0628\u0648\u062f\u0647 \u06a9\u0647 \u0641\u06a9\u0631 \u06a9\u0646\u0645 \u062f\u0648\u0631\u0628\u06cc\u0646 \u0647\u0627\u0634\u0648\u0646 \u062e\u0631\u0627\u0628 \u0647\u0633\u062a\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u062a\u0648\u067e\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc\u0647 \u0648\u0644\u06cc \u062a\u0627\u0628\u062d\u0627\u0644 \u0646\u0634\u062f\u0647 \u06a9\u0647 \u0645\u0646 \u0633\u0641\u0627\u0631\u0634 \u0628\u062f\u0645 \u0648 \u0628\u0627\u0647\u0627\u0645 \u062a\u0645\u0627\u0633 \u0646\u06af\u06cc\u0631\u0646 \u06a9\u0647 \u062d\u062f\u0627\u0642\u0644 \u06cc\u06a9\u06cc \u0627\u0632 \u0627\u0642\u0644\u0627\u0645 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0648 \u0645\u062c\u0628\u0648\u0631\u0646 \u062a\u063a\u06cc\u06cc\u0631\u0634 \u0628\u0650\u062f\u0646\u060c \u062a\u0627 \u0628\u062d\u0627\u0644 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062e\u0648\u0627\u0633\u062a\u0645 \u0648 \u0628\u0631\u0627\u0645 \u0646\u06cc\u0627\u0648\u0631\u062f\u0646 \u060c \u0627\u06cc\u0646 \u0627\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a \u060c", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u062a\u0633\u062a \u0686\u0627\u0648\u062f\u0627\u0631 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u062f\u0627\u063a \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0647\u0627 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", "\u0646\u0627\u0646 \u062c\u0648 100%", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0686\u0627\u0648\u062f\u0627\u0631", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u06a9\u0646\u062c\u062f", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", 1]}
{"text": ["\u0633\u0644\u0627\u0645\u060c\n\u062f\u0631\u0633\u062a\u0647 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc \u062f\u0631 \u062f\u0633\u062a\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0647\u0627\u06cc \u062e\u0634\u06a9\u0647\u060c \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0631\u0633\u0645\u0627 \u062e\u0634\u06a9 \u0648 \u0633\u0641\u062a\u0647 \u0648 \u0639\u0645\u0644\u0627 \u0645\u0646\u0647\u0627\u06cc \u062f\u0648 \u0639\u062f\u062f\u06cc \u06a9\u0647 \u062e\u0648\u062f\u0645 \u0648 \u0641\u0631\u0632\u0646\u062f\u0645 \u062e\u0648\u0631\u062f\u06cc\u0645 \u0627\u0644\u0628\u0627\u0642\u06cc \u0631\u0648 \u0631\u06cc\u062e\u062a\u06cc\u0645 \u062f\u0648\u0631.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0647\u0645 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f \u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a\u0634\u0648\u0646 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u06a9\u0627\u0634 \u0628\u062a\u0648\u0646\u06cc\u062f \u062c\u0627\u06cc \u0638\u0631\u0641 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9\u06cc \u0627\u0632 \u0638\u0631\u0648\u0641 \u06a9\u0627\u063a\u0630\u06cc \u06cc\u0627 \u0645\u0642\u0648\u0627\u06cc\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f \u0647\u0645 \u0628\u0647\u062f\u0627\u0634\u062a\u06cc \u062a\u0631\u0647 \u0647\u0645  \u0628\u0627\u0632\u06cc\u0627\u0641\u062a\u0634 \u0631\u0627\u062d\u062a \u062a\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0632\u0648\u0644\u0628\u06cc\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646. \u0646\u0627\u0646 \u062e\u06cc\u0644\u06cc \u0637\u0639\u0645 \u0633\u06cc\u0631 \u0646\u0645\u06cc\u062f\u0627\u062f. \u0646\u0627\u0646 \u0645\u0639\u0645\u0648\u0644\u06cc \u062e\u0631\u062f \u0634\u062f\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc \u0622\u0645\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u0633\u06cc\u0631 \u0648 \u06a9\u0631\u0647", 1]}
{"text": ["\u0645\u0631\u0633\u06cc \u0628\u0647 \u0645\u0648\u0642\u0639 \u0648 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0643\u064a\u0641\u064a\u062a \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u067e\u0627\u064a\u064a\u0646 \u0628\u0648\u062f .\u062c\u0646\u0633 \u0645\u0627\u0646\u062f\u0647 \u062a\u062d\u0648\u064a\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0628\u0631 \u0627\u062b\u0631 \u062a\u0643\u0627\u0646 \u0632\u064a\u0627\u062f \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f \u0648 \u0647\u0645\u0647 \u0628\u0627\u0647\u0645 \u0645\u062e\u0644\u0648\u0637 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0643\u064a\u0643 \u0645\u0646 \u0627\u0634\u062a\u0628\u0627\u0647\u0627 \u0628\u0647 \u0648\u0627\u062d\u062f \u062f\u064a\u06af\u0631\u064a \u062a\u062d\u0648\u064a\u0644 \u0634\u062f\u0647 \u0627\u0633\u062a \u0639\u0644\u064a\u0631\u063a\u0645 \u0627\u064a\u0646\u0643\u0647 \u062f\u0631 \u0627\u062f\u0631\u0633 \u0648\u0627\u062d\u062f \u0628\u0647 \u0637\u0648\u0631 \u0645\u0634\u062e\u0635 \u0627\u0639\u0644\u0627\u0645 \u0634\u062f\u0647 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u06a9\u0647 \u0627\u06cc\u0646\u0628\u0627\u0631 \u0628\u0647 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u062a\u0648\u062c\u0647 \u06a9\u0631\u062f\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f! \u0628\u06cc \u0646\u0638\u06cc\u06cc\u06cc\u06cc\u0631...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647\u060c \u0627\u0633\u0646\u067e \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u0645\u0648\u062f\u0628. \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0646\u06af\u0631\u0627\u0646 \u0628\u0648\u062f\u0645 \u06a9\u06cc\u06a9 \u062f\u0631 \u0637\u0648\u0644 \u0645\u0633\u06cc\u0631 \u062f\u0631 \u062c\u0639\u0628\u0647 \u062d\u0631\u06a9\u062a \u06a9\u0646\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u0648\u062f\u060c \u0627\u0635\u0644\u0627 \u062a\u06a9\u0627\u0646 \u0646\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u062d\u062a\u06cc \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0627\u0632 \u0645\u0646 \u062e\u0648\u0627\u0633\u062a \u062a\u0627 \u0633\u0644\u0627\u0645\u062a \u06a9\u06cc\u06a9 \u0631\u0627 \u0686\u06a9 \u06a9\u0646\u0645 . \u0645\u062a\u0634\u06a9\u0631\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", "\u0634\u0645\u0639 HBD \u0646\u0642\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u062f\u0631 \u06a9\u0644 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc  \u0633\u0641\u0627\u0631\u0634 \u0645\u0646  2 \u0639\u062f\u062f\u06a9\u06cc\u06a9 \u06cc\u06a9 \u0646\u0641\u0631\u0647 \u062e\u0627\u0645\u0647 \u06af\u06cc\u0644\u0627\u0633 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0647 \u062a\u0639\u062f\u0627\u062f \u0646\u062f\u0627\u0634\u062a\u0646 \u06a9\u0647 \u0631\u062f\u0648\u0644\u0648\u062a \u0628\u0647 \u062c\u0627\u0634 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0642\u06cc\u0645\u062a \u0627\u06cc\u0646 \u062f\u0648 \u06cc\u06a9\u06cc \u0646\u0628\u0648\u062f \u0648 \u0645\u0627 \u0628\u0647 \u0627\u0644\u062a\u0641\u0627\u0648\u062a \u0628\u0647 \u062d\u0633\u0627\u0628 \u0628\u0631\u06af\u0631\u062f\u0627\u0646\u062f\u0647 \u0646\u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0628\u0647 \u0644\u062d\u0627\u0638 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc\u060c \u0628\u0647 \u0644\u062d\u0627\u0638 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0647\u0645 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0648\u0627\u0642\u0639\u0627\u064b. \u0641\u0642\u0637 \u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0645\u0633\u0627\u0641\u062a \u06a9\u0645 \u0628\u0627 \u0645\u062d\u0644 \u0645\u0627 \u06cc\u0647 \u0645\u0642\u062f\u0627\u0631\u06cc \u0632\u06cc\u0627\u062f \u0647\u0633\u062a\u0634.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0631\u0628\u0627 \u0642\u06cc\u0633\u06cc \u0632\u0631\u062f\u0627\u0644\u0648 \u06a9\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0643\u064a\u0643 \u0633\u064a\u0628 \u0648 \u0643\u0627\u0631\u0627\u0645\u0644 \u062a\u0631\u0634 \u0634\u062f\u0647 \u0648 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f\n\u0643\u0631\u0627\u0633\u0627\u0646 \u0634\u0643\u0644\u0627\u062a\u064a \u0637\u0639\u0645 \u0648 \u0628\u0648\u064a \u062a\u062e\u0645 \u0645\u0631\u063a \u062f\u0627\u0634\u062a \u0648 \u0634\u0643\u0644\u0627\u062a \u0628\u062f\u0645\u0632\u0647 \u0627\u064a \u062f\u0627\u062e\u0644\u0634 \u0628\u0648\u062f\n\u0633\u0648\u0641\u0644\u0647 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0637\u0639\u0645 \u0647\u0645\u064a\u0634\u0647 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\n\u0643\u0631\u0627\u0645\u0628\u0644 \u0633\u064a\u0628 \u062e\u0648\u0628 \u0628\u0648\u062f\n\u0645\u063a\u0627\u064a\u0631\u062a \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0647\u0645 \u062a\u0648\u0633\u0637 \u0627\u0633\u0646\u067e \u0628\u0627 \u062d\u062f\u0648\u062f \u0664\u0660 \u062f\u0642\u064a\u0642\u0647 \u062a\u0627\u062e\u064a\u0631 \u0628\u0631\u0637\u0631\u0641 \u0634\u062f \u0648\u0644\u064a \u0627\u0634\u062a\u0628\u0627\u0647\u0627\u062a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062c\u062f\u064a\u062f\u0627 \u0632\u064a\u0627\u062f \u0634\u062f\u0647\u060c \u0627\u0645\u064a\u062f\u0648\u0627\u0631\u0645 \u0628\u0627 \u062a\u0643\u0631\u0627\u0631 \u0627\u064a\u0646 \u0645\u0648\u0627\u0631\u062f \u0645\u0634\u062a\u0631\u064a \u0647\u0627 \u0631\u0648 \u0627\u0632 \u062f\u0633\u062a \u0646\u062f\u064a\u0646\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u067e\u0646 \u0634\u06a9\u0644\u0627\u062a)", -1]}
{"text": ["\u0628\u0639\u0636\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u067e\u062e\u062a \u062a\u0627\u0632\u0647 \u062f\u0627\u0634\u062a\u0646 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 \u0627\u0645\u0627 \u0628\u0639\u0636\u06cc \u0647\u0627 \u067e\u062e\u062a \u0686\u0646\u062f \u0631\u0648\u0632 \u067e\u06cc\u0634 \u0631\u0648 \u062f\u0627\u0634\u062a\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u06a9\u0631\u0646\u0628\u0631\u06cc \u0648 \u0628\u0627\u062f\u0627\u0645", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", -1]}
{"text": ["\u0633\u0627\u0644\u0645 \u062a\u0627\u0632\u0647 \u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u06a9\u0627\u0631\u0634 \u062d\u0631\u0641 \u0646\u062f\u0627\u0631\u0647 \u0648\u200c\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 1", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627 \u0648 \u0631\u0633\u062a\u0648\u0631\u0627\u0646\u0647\u0627 \u062f\u0631 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648\u0638\u06cc\u0641\u0647 \u062f\u0627\u0631\u0646\u062f \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0645\u0637\u0627\u0628\u0642 \u0639\u06a9\u0633 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u0646\u062f. \u0645\u0646 \u0645\u0634\u062a\u0631\u06cc \u0647\u0645\u06cc\u0634\u06af\u06cc \u0627\u06cc\u0646\u062c\u0627 \u0647\u0633\u062a\u0645  \u0648 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u06a9\u06cc\u062f \u0645\u06cc\u06a9\u0646\u0645 \u06a9\u0647 \u067e\u0646\u06cc\u0631 \u0628\u0631\u0627\u0646\u06cc \u0645\u0637\u0627\u0628\u0642 \u0639\u06a9\u0633 \u0628\u0627\u0634\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0645\u0648\u0627\u0642\u0639 \u062a\u0648\u062c\u0647 \u0645\u06cc\u06a9\u0646\u0646\u062f \u06af\u0627\u0647\u06cc \u0647\u0645 \u0645\u062b\u0644 \u0627\u0645\u0631\u0648\u0632 \u06cc\u06a9 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u062e\u0634\u06a9 \u0628\u0627 \u06cc\u06a9 \u062e\u0637 \u067e\u0646\u06cc\u0631 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u06a9\u0646\u0646\u062f! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646.\u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u062e\u06cc\u0644\u06cc \u0645\u0647\u0645\u0645\u0645\u0645\u0645\u0645 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u064a \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u062f\u0631 \u0645\u0642\u0627\u064a\u0633\u0647 \u0628\u0627 \u0639\u0643\u0633 \u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a \u0643\u0648\u0686\u0643 \u0628\u0648\u062f. \u0628\u0631\u0627\u0646\u064a \u0646\u0648\u062a\u0644\u0627 \u0639\u0627\u0644\u064a \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0648 \u0628\u0647 \u0647\u0645\u06cc\u0646 \u062f\u0644\u06cc\u0644 \u06a9\u06cc\u06a9 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u200c\u0637\u0639\u0645 \u0628\u0648\u062f \u0641\u0642\u0637 \u0627\u0646\u062f\u0627\u0632\u0647\u200c\u0634\u0648\u0646 \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0634\u0648\u06a9\u0647 \u06a9\u0646\u0646\u062f\u0647 \u0628\u0648\u062f :) \u0647\u0631\u06a9\u062f\u0648\u0645 \u0627\u0646\u062f\u0627\u0632\u0647 \u06cc\u06a9 \u0633\u06a9\u0647 \u0628\u0632\u0631\u06af \u0628\u0648\u062f\u0646! :))", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc .\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (20 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u062a\u0631\u062f \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc \u0632\u0648\u062f \u0627\u0632\u0627\u06a9\u0633\u067e\u0631\u0633\u0645 \u0633\u067e\u0627\u0633 \u06af\u0630\u0627\u0631\u0645 \u0641\u0642\u0637 \u06cc\u06a9\u0645 \u062f\u06cc\u0631\u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0631\u0633\u062a \u0645\u062b\u0644 \u0627\u0633\u0645\u0634 \u0645\u062e\u0645\u0644 \u0642\u0631\u0645\u0632 red velvet \u0628\u0633\u06cc\u0627\u0631 \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f. \u0646\u0627\u0646 \u062c\u0645 \u0639\u0627\u0644\u06cc\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0634\u0627\u062a\u0648\u062a", 1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u06a9\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc\u060c \u0642\u0637\u0627\u0628 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c \u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0642\u0637\u0627\u0628", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u0632\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0645\u0646 \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0628\u0631\u0627\u0645 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0622\u0648\u0631\u062f\u0646 \u0627\u0632 \u0627\u06cc\u0646 \u062c\u0647\u062a \u0641\u0642\u0637 \u0646\u0627\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f... \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0644 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0646\u0627\u0646 \u062f\u06cc\u06af\u0631\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u0648\u0628\u06cc \u0646\u062f\u0627\u0634\u062a \u0648 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u062f\u06cc\u0627\u0628\u062a \u0648 \u0686\u0631\u0628\u06cc \u0633\u0648\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0631\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0645\u0645\u0646\u0648\u0646\u0645. \u0627\u0632 \u062a\u0646\u0648\u0639 \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u062a\u0648\u0646 \u062e\u0635\u0648\u0635\u0627 \u0631\u0698\u06cc\u0645\u06cc\u200c\u0647\u0627 \u0645\u062a\u0634\u06a9\u0631\u0645. \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646\u200c\u0647\u0627 \u062e\u0648\u0628 \u0627\u0633\u062a. \u0641\u0642\u0637 \u0644\u0627\u06cc\u0647 \u0631\u0648\u06cc\u06cc \u0646\u0627\u0646 \u0647\u0641\u062a \u06af\u06cc\u0627\u0647 \u06a9\u0627\u0645\u0644\u0627 \u062e\u0634\u06a9 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 \u0631\u0648\u06af\u0646 (20 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0641\u062a \u06af\u06cc\u0627\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0628\u0648\u062f \u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u062e\u06cc\u0644\u06cc \u062e\u0634\u06a9 \u0648 \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0628\u0647 \u0645\u0648\u0642\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u06a9\u0627\u06a9\u0627\u0626\u0648", 1]}
{"text": ["\u0648\u0642\u062a\u06cc \u062f\u0648 \u062a\u0627 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0645\u06cc\u0634\u0647 \u0644\u0637\u0641\u0627 \u062d\u062a\u0645\u0627 \u062f\u0648\u062a\u0627 \u062c\u0639\u0628\u0647 \u0628\u06cc\u0627\u062f \u0686\u0648\u0646 \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u06cc\u0645. \u0627\u0644\u0627\u0646 \u0645\u0634\u06a9\u0644 \u067e\u06cc\u0634 \u0627\u0648\u0645\u062f \u062e\u0648\u0628", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u0627\u0646\u062c\u06cc\u0631", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u06a9\u06cc\u06a9 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f \u0648 \u0627\u0632 \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u0628\u0627 \u0645\u0646 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646\u062f \u0648 \u06af\u0641\u062a\u0646\u062f \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u06cc\u0641\u0631\u0633\u062a\u06cc\u0645 \u0648 \u0645\u0627 \u0628 \u062a\u0641\u0627\u0648\u062a \u062f\u0631\u06cc\u0627\u0641\u062a \u0646\u0645\u06cc\u06a9\u0646\u06cc\u0645...\u0628\u0633\u06cc\u0627\u0631 \u0647\u0645 \u0645\u062d\u062a\u0631\u0645\u0627\u0646\u0647 \u0648\u06a9\u06cc\u06a9 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc \u0644\u0630\u062a \u0628\u0631\u062f\u06cc\u0645 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0646\u0627\u0646 \u062c\u0645 \u0648 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u064a \u0645\u0631\u0633\u064a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0639\u0627\u0644\u06cc \u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0647\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc\n\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0647\u0645 \u0628\u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u062b\u0644\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062e\u0645\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627 \u0646\u06cc\u0645\u0647 \u0622\u0645\u0627\u062f\u0647 \u06a9\u0648\u0686\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u0646\u0631\u0645 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0632\u06cc\u0646\u0647 \u067e\u06cc\u06a9 \u0628\u0631\u0627\u06cc \u0641\u0627\u0635\u0644\u0647 \u06cc \u0645\u0627 \u06a9\u0647 \u06a9\u0645\u062a\u0631 \u0627\u0632 5 \u062f\u0642\u06cc\u0642\u0647 \u0647\u0633\u062a 3 \u0647\u0631\u0627\u0631 \u062a\u0648\u0645\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0632\u06cc\u0627\u062f \u0645\u06cc\u0627\u062f \u0648 \u0628\u0627\u06cc\u062f \u0631\u0627\u06cc\u06af\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0628\u0634\u0647 \u0628\u0631\u0627 \u0645\u062d\u062f\u0648\u062f\u0647 \u0627\u0637\u0631\u0627\u0641 \u062e\u0648\u062f\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f\u060c\u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0622\u0648\u0631\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u06a9\u0644\u0627\u0633\u06cc\u06a9", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \n\u0645\u0648\u0641\u0642 \u0628\u0627\u0634\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0645\u062e\u0644\u0648\u0637", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\n\u062f\u06cc\u06af\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0628\u0647\u062a\u0631 \u0646\u0645\u06cc\u0634\u062f\u060c \u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u062b\u0645\u06cc\u0646", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u062a\u0627 \u062d\u0627\u0644\u0627 \u062f\u0648\u0628\u0627\u0631 \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f\u0645 \u0627\u0632 \u0627\u06cc\u0646\u062c\u0627 \u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0641\u06cc\u0646 \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0647\u0645\u0647 \u0639\u0627\u0644\u06cc   \u0637\u0639\u0645 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc \u0648 \u06af\u0627\u062a\u0627 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\n \u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u062e\u06cc\u0644\u06cc \u0647\u0645 \u0633\u0646\u062a\u06cc \u0646\u0628\u0648\u062f:)) \u0648\u0644\u06cc \u062e\u0648\u0634 \u0637\u0639\u0645 \u0628\u0648\u062f \u0628\u0627\u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0646\u0627\u0646 \u062c\u0648 100%", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0641\u0642\u0637 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u06f4\u06f0\u06f0\u06f0\u062a\u0648\u0645\u0627\u0646 \u0628\u0631\u0627\u06cc \u0645\u0627\u06a9\u0627\u0631\u0648\u0646 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f\u06cc \u0634\u0648\u06cc\u062f", 1]}
{"text": ["\u062e\u064a\u0644\u064a \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0644\u0647 \u0632\u0631\u062f", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646\u0645 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0628\u0639\u062f \u0627\u0632 \u062f\u0648 \u0633\u0627\u0639\u062a \u062a\u0627\u062e\u06cc\u0631\u060c \u0628\u0633\u062a\u0647 \u062a\u062d\u0648\u06cc\u0644\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0634\u0628\u06cc\u0647 \u0628\u0647 \u0622\u0634 \u0628\u0648\u062f \u062a\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u062f. \u067e\u06cc\u06a9 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc\u200c\u0628\u0648\u062f \u062a\u0627\u0632\u0647\u200c \u06cc \u062a\u0627\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u062e\u06cc\u0644\u06cc \u0637\u0639\u0645 \u062e\u0648\u0628 \u0648 \u0645\u0646\u062d\u0635\u0631 \u0628\u0647 \u0641\u0631\u062f\u06cc \u062f\u0627\u0634\u062a  :)\n\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631 \u0647\u0645\u200c \u062e\u0648\u0628 \u0628\u0648\u062f \u0641\u0642\u0637 \u062f\u0644\u06cc\u0644\u0650 \u0633\u0647 \u0627\u0645\u062a\u06cc\u0627\u0632 \u062f\u0627\u062f\u0646\u0645 \u0628\u062e\u0627\u0637\u0631 \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0647\u0645\u200c \u0642\u0628\u0644\u0627\u064b \u0627\u0632 \u062c\u0627\u06cc \u062f\u06cc\u06af\u0631 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645\u200c  \u061b)\n\u0628\u0627\u062a\u0634\u06a9\u0631 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a\u0650 \u0633\u0631\u06cc\u0639 \u0627\u0633\u0646\u067e  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0627\u0634\u062a\u0631\u0648\u062f\u0644 \u067e\u0646\u06cc\u0631", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u062c\u0639\u0628\u0647 \u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u062e\u06cc\u0644\u06cc \u0628\u0632\u0631\u06af\u062a\u0631 \u0627\u0632 \u062e\u0648\u062f \u067e\u0627\u06cc \u0627\u0633\u062a \u0648 \u0628\u0627\u0639\u062b \u0645\u06cc\u0634\u0648\u062f \u06a9\u0647 \u067e\u0627\u06cc \u062f\u0631 \u062c\u0639\u0628\u0647 \u062d\u0631\u06a9\u062a \u06a9\u0646\u062f . \u0645\u0646 \u0647\u0646\u0648\u0632 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0631\u0627 \u0628\u0627\u0632 \u0646\u06a9\u0631\u062f\u0645 \u0686\u0648\u0646 \u0628\u0631\u0627\u06cc \u0647\u062f\u06cc\u0647 \u0627\u06cc \u06a9\u0647 \u0642\u0631\u0627\u0631 \u0627\u0633\u062a \u0641\u0631\u062f\u0627 \u0635\u0628\u062d \u0628\u0628\u0631\u0645 \u060c \u062e\u0631\u06cc\u062f\u0627\u0631\u06cc \u06a9\u0631\u062f\u0647 \u0627\u0645 . \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u062a\u0627 \u0641\u0631\u062f\u0627 \u0633\u0627\u0644\u0645 \u0628\u0647 \u0645\u0642\u0635\u062f \u0628\u0631\u0633\u062f. \u067e\u06cc\u0634\u0646\u0647\u0627\u062f \u0645\u06cc\u06a9\u0646\u0645 \u062c\u0639\u0628\u0647 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0633\u0627\u06cc\u0632 \u067e\u0627\u06cc \u062a\u0647\u06cc\u0647 \u06a9\u0646\u06cc\u062f . \u0628\u0627 \u062a\u0634\u06a9\u0631 . ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0632\u0631\u06af", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", 1]}
{"text": ["\u0645\u0646 \u0627\u06cc\u0646 \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0647\u062f\u06cc\u0647 \u0628\u0631\u0627\u06cc \u06cc\u06a9\u06cc \u0627\u0632 \u062f\u0648\u0633\u062a\u0627\u0646 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u0645. \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062f\u0631 \u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u062a\u0648\u0633\u0637 \u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633\u060c \u062c\u0639\u0628\u0647 \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u067e\u062e\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u062c\u0639\u0628\u0647 \u062f\u0631 \u0645\u0642\u0635\u062f \u0628\u0627\u0632 \u0634\u062f\u060c \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0648\u0636\u0639\u06cc\u062a \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0645\u0646\u0627\u0633\u0628\u06cc \u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0644\u06cc \u0633\u0627\u06cc\u0632 \u0645\u062a\u0648\u0633\u0637 \u06a9\u0647 \u06af\u0641\u062a\u0647 \u0634\u062f \u0628\u0631\u0627\u06cc 6 \u0646\u0641\u0631 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u0645 \u06a9\u0645 \u0633\u0647 \u0631\u0648\u0632 \u0645\u0627\u0646\u062f\u0647 \u0628\u0648\u062f\u200c...\u062e\u06cc\u0644\u06cc \u0628\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0643\u064a\u0641\u064a\u062a \u0648 \u0627\u0631\u0633\u0627\u0644 \u062e\u064a\u0644\u064a \u062e\u064a\u0644\u064a\u064a\u064a \u062e\u0648\u0628 \u0628\u0648\u062f.\n\u0639\u0627\u0644\u064a\u064a\u064a\u064a\u064a..\n\u0641\u0642\u0637 \u0647\u0632\u064a\u0646\u0647 \u0627\u0631\u0633\u0627\u0644\u0634 \u0628\u0631\u0627\u064a \u0627\u0631\u0633\u0627\u0644 \u062f\u0631 \u0645\u062d\u062f\u0648\u062f\u0647 \u0643\u0645\u064a \u0628\u064a\u0634\u062a\u0631 \u0627\u0632 \u0631\u0633\u062a\u0648\u0631\u0627\u0646 \u0647\u0627\u064a \u0645\u0634\u0627\u0628\u0647 \u0628\u0648\u062f.. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0627\u0632 \u0622\u0646\u0686\u0647 \u062f\u0631 \u062a\u0635\u0648\u06cc\u0631 \u0645\u06cc\u0628\u06cc\u0646\u06cc\u062f \u06a9\u0648\u0686\u06a9 \u062a\u0631 \u0647\u0633\u062a\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u06a9\u0627\u0634 \u0627\u0645\u062a\u06cc\u0627\u0632 \u0635\u0641\u0631\u0645 \u062f\u0627\u0634\u062a\u06cc\u0646:(\n\u0646\u0647 \u0645\u0632\u0647 \u062a\u0627\u0631\u062a \u0645\u06cc\u062f\u0627\u062f \u0646\u0647 \u0627\u0644\u0628\u0627\u0644\u0648\u060c \u0686\u0634\u0645\u062a\u0648\u0646\u0648 \u0628\u0628\u0646\u062f\u06cc\u0646 \u062a\u0627 \u0622\u062e\u0631\u0634 \u0641\u0642\u0637 \u0645\u062a\u0648\u062c\u0647 \u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f \u0645\u06cc\u0634\u06cc\u0646! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u064a \u0628\u0647 \u0646\u0638\u0631\u0645 \u064a\u0643\u0645 \u062a\u063a\u064a\u064a\u0631 \u0643\u0631\u062f\u0647 \u0648 \u0634\u0643\u0644\u0627\u062a\u0634 \u0637\u0639\u0645 \u0642\u0628\u0644 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a \u0627\u0644\u0628\u062a\u0647 \u0643\u0647 \u0647\u0646\u0648\u0632\u0645 \u062e\u0648\u0628\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "Don't Even Ask", 1]}
{"text": ["\u0647\u0645\u064a\u0634\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645 \u0628\u0647 \u0635\u0648\u0631\u062a \u062a\u0627\u0632\u0647 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0645\u064a\u0631\u0633\u064a\u062f \u0648\u0644\u064a \u0627\u064a\u0646 \u0628\u0627\u0631 \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0634\u0645\u0634\u064a \u0628\u0633\u064a\u0627\u0631 \u062e\u0634\u0643 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f. \u0631\u0698\u06cc\u0645\u06cc \u06cc\u0639\u0646\u06cc \u0634\u06a9\u0631\u0634 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0633\u062a\u061f\n\u0627\u0632 \u0686\u0646\u062f \u0646\u0648\u0628\u062a\u06cc \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645\u060c \u0647\u0645\u06cc\u0634\u0647 \u0628\u0631\u0627\u0646\u06cc\u062a\u0648\u0646 \u0628\u0647\u062a\u0631 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0647.\n\u0627\u06cc\u0646\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0628\u0647 \u067e\u0627\u06cc \u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc \u0646\u0645\u06cc\u0631\u0633\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0627\u0627\u0644\u06cc \u0628\u0648\u062f...\u0645\u0631\u0633\u06cc \u0627\u0632\u062a\u0648\u0646...\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0627\u0627\u0632\u0647 \u0648 \u0644\u0630\u062a \u0628\u062e\u0634 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u062f\u06cc\u0627\u0628\u062a \u0648 \u0686\u0631\u0628\u06cc \u0633\u0648\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06af\u0631\u062f\u0648\u06cc\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u06af\u06cc\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0631\u0648 \u0646\u062f\u0627\u0634\u062a \u0648\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645 \u0648 \u0628\u0627\u0632 \u0647\u0645 \u0633\u0641\u0627\u0631\u0634 \u062e\u0648\u0627\u0647\u0645 \u062f\u0627\u062f\n\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0641\u0642\u0637 \u0645\u06cc\u062a\u0648\u0646\u0645 \u0628\u06af\u0645\n\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f\n\u0633\u0631\u062f \u0634\u062f \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u0647\u0645\u200c \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc \u062e\u0634\u06a9 \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f. \u06a9\u06cc\u0641\u06cc\u062a \u0645\u0646\u0627\u0633\u0628\u06cc \u0646\u062f\u0627\u0634\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0622\u0644\u0645\u0627\u0646\u06cc", "\u067e\u0627\u06cc \u0633\u06cc\u0628", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u06a9\u0645\u06cc\u062a \u0647\u0645\u0647 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0627\u0633\u062a. \u0641\u0642\u0637 \u0634\u06a9\u0644\u0627\u062a \u0631\u0648\u06cc \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0637\u0639\u0645 \u0645\u0648\u0631\u062f \u067e\u0633\u0646\u062f \u0627\u064a\u0646\u062c\u0627\u0646\u0628 \u0646\u06cc\u0633\u062a \u0648 \u0634\u06a9\u0644\u0627\u062a \u0631\u0648\u06cc \u0622\u0646 \u062f\u0631 \n \u062f\u0647\u0627\u0646 \u0645\u06cc\u0645\u0627\u0633\u062f. \u0648\u062c\u0627\u0644\u0628 \u0646\u06cc\u0633\u062a. \u0628\u0627 \u0633\u067e\u0627\u0633 \u0641\u0631\u0627\u0648\u0627\u0646\u060c \u0627\u0641\u0634\u064a\u0646 \u0645\u0633\u062a\u0642\u06cc\u0645\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u062e\u0634\u06a9 \u062a\u062e\u0645 \u0622\u0641\u062a\u0627\u0628 \u06af\u0631\u062f\u0627\u0646 \u0628\u0627 \u06a9\u0646\u062c\u062f", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0632\u0646\u062c\u0628\u06cc\u0644\u06cc", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0637\u0639\u0645 \u062e\u0648\u0628 \u062f\u0627\u0634\u062a\u0646 \u0648\u0644\u06cc \u0628\u0627 \u0645\u0627\u0631\u0645\u0627\u0644\u0627\u062f \u0633\u06cc\u0628 \u062f\u0631\u0633\u062a \u0634\u062f\u0647 \u0628\u0648\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0627\u0632 \u0646\u0627\u0646 \u062c\u0645 \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633. \u067e\u06cc\u0631\u0648\u0632 \u0628\u0627\u0634\u06cc\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc \u0628\u0627 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0648 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647\u060c \u0645\u0645\u0646\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u0627\u0646 \u0647\u0627 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0633\u062a . \u06af\u0627\u062a\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0641\u062a \u06af\u06cc\u0627\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0648\u0631\u0646 \u0627\u0634\u067e\u06cc\u062a\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0648\u0631\u0646 \u0627\u0634\u067e\u06cc\u062a\u0632 \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u062f\u0647 \u0627\u0633\u062a!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648", "\u0646\u0627\u0646 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 \u0631\u0698\u06cc\u0645\u06cc \u0647\u0641\u062a \u06af\u06cc\u0627\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u0645\u063a\u0632 \u062f\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0648\u0631\u0646 \u0627\u0634\u067e\u06cc\u062a\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0632\u0648\u062f \u0631\u0633\u06cc\u062f \u062f\u0633\u062a\u0645\n\u0631\u0627\u0636\u06cc \u0647\u0633\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u0634 \u0647\u0645\u06cc\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u067e\u0644\u0626\u0648\u0646\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645.\u062c\u0641\u062a\u0634 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u067e\u0627\u0646\u0627\u06a9\u0648\u062a\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u067e\u0627\u0646\u0627\u06a9\u0648\u062a\u0627", 1]}
{"text": ["\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647 \u0644\u0647 \u0634\u062f\u0647 \u0648 \u0622\u0628\u06a9\u06cc \u0628\u0648\u062f \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u06cc\u0645 \u0628\u0631\u06cc\u0632\u06cc\u0645 \u062f\u0648\u0631 \u0648 \u0628\u0647 \u062c\u0627\u06cc \u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc \u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u0645\u0627\u0634\u06cc\u0646\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u062a\u0627\u0631\u062a \u0645\u06cc\u0648\u0647", -1]}
{"text": ["\u0628\u0627 \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0646\u0627\u0646 \u0648 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0631\u0648\u0632 \u06a9\u0647 \u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0627\u0632 \u062d\u0633\u0646 \u0627\u062e\u0644\u0627\u0642 \u0648 \u0645\u0634\u062a\u0631\u06cc \u0645\u062f\u0627\u0631\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0627\u062f\u06cc \u0628\u0631\u062e\u0648\u0631\u062f\u0627\u0631 \u0647\u0633\u062a\u0646\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0648\u0631\u06cc\u0646\u06cc", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u0648\u0628 \n \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 \u062e\u0634\u06a9 \u0628\u0648\u062f \n\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635\u060c \u062b\u0645\u06cc\u0646\u060c \u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 \u062e\u0648\u0628 \u0628\u0648\u062f \n\u067e\u06cc\u06a9 \u0645\u0648\u062f\u0628 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u062b\u0645\u06cc\u0646", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", 1]}
{"text": ["\u0643\u064a\u0643 \u0647\u0648\u064a\u062c \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0645\u0627 \u0647\u0645 \u067e\u0631\u0633\u0646\u0644 \u0642\u0646\u0627\u062f\u0649 \u0648 \u0647\u0645 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0686\u0646\u062f\u064a\u0646 \u0628\u0627\u0631 \u067e\u064a\u06af\u064a\u0631\u0649 \u0643\u0631\u062f\u0646\u062f \u062a\u0627 \u062c\u0627\u064a\u06af\u0632\u064a\u0646\u0649 \u0645\u0646\u0627\u0633\u0628 \u0628\u062c\u0627\u0649 \u0622\u0646 \u0627\u0631\u0633\u0627\u0644 \u0634\u0648\u062f. \u0648 \u0647\u0645\u0647 \u0686\u0649 \u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f. \n \u0641\u0642\u0637 \u064a\u0643 \u067e\u064a\u0634\u0646\u0647\u0627\u062f\u0649 \u062f\u0627\u0634\u062a\u0645 \u0643\u0647 \u062a\u0644\u0641\u0646\u0649 \u0647\u0645 \u062e\u062f\u0645\u062a \u062f\u0648\u0633\u062a\u0627\u0646 \u0639\u0631\u0636 \u0643\u0631\u062f\u0645: \u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u06af\u0632\u064a\u0646\u0647 \u0647\u0627\u0649 \u0646\u064a\u0645 \u0643\u064a\u0644\u0648 \u0648 \u0663\u0660\u0660 \u06af\u0631\u0645 \u0647\u0645 \u0628\u0647 \u0645\u0646\u0648\u0649 \u0634\u064a\u0631\u064a\u0646\u0649 \u0647\u0627 \u0627\u0636\u0627\u0641\u0647 \u0634\u0648\u062f \u062a\u0627 \u0627\u0645\u0643\u0627\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u0628\u0627 \u062a\u0646\u0648\u0639 \u0628\u064a\u0634\u062a\u0631 \u062f\u0631 \u0633\u0641\u0627\u0631\u0634\u0627\u062a \u0641\u0631\u0627\u0647\u0645 \u06af\u0631\u062f\u062f. \u0628\u0627 \u062a\u0634\u0643\u0631 \u0648 \u0627\u062d\u062a\u0631\u0627\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0648\u0644\u06cc \u0646\u0648\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0628\u0648\u062f.\u0647\u0631 \u0686\u0642\u062f\u0631 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0646\u0648\u0646 \u0647\u0627 \u062e\u0634\u06a9 \u0648 \u0634\u06a9\u0646\u0646\u062f\u0647 \u0648 \u0628\u062f \u0628\u0648\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u0647\u0645\u0628\u0631\u06af\u0631 \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", 1]}
{"text": ["\u0628\u0627\u0632 \u0647\u0645 \u0628\u0647 \u062c\u0627\u06cc \u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631 100% \u0646\u0627\u0646 \u062c\u0648 100% \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0634\u062f\u0647 \u0648 \u0628\u0631\u0686\u0633\u0628 \u0646\u0648\u0639 \u0646\u0627\u0646 \u0647\u0645 \u0631\u0648\u06cc\u0634 \u0627\u0644\u0635\u0627\u0642 \u0646\u0634\u062f\u0647. \u0645\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0627\u06cc\u0646 \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u0631\u0627\u0636\u06cc\u0645 \u0627\u0645\u0627 \u062f\u0631 \u0627\u0631\u0633\u0627\u0644 \u0646\u0648\u0639 \u0645\u062d\u0635\u0648\u0644 \u062f\u0642\u062a \u0646\u062f\u0627\u0631\u0646\u062f \u0648 \u0647\u0645\u06cc\u0634\u0647 \u06cc\u06a9 \u0645\u063a\u0627\u06cc\u0631\u062a\u06cc \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u062a\u0633\u062a \u0627\u0631\u062f\u0648\u0631 \u0633\u06cc\u0627\u0647", "\u0646\u0627\u0646 \u062c\u0648 80%", "\u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631", "\u062c\u0648 \u062f\u0648 \u0633\u0631 100%", -1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0627\u0631\u0633\u0628\u0627\u0646\u06cc", 1]}
{"text": ["\u0646\u0648\u062a\u0644\u0627 \u06af\u0631\u0627\u0646\u0648\u0644 \u062e\u06cc\u0644\u06cc \u0646\u0627\u0645\u0646\u0627\u0633\u0628 \u0628\u0648\u062f \u0686\u0648\u0646 \u0637\u0639\u0645 \u062a\u0631\u0634 \u0645\u0627\u0633\u062a \u0628\u0627 \u0646\u0648\u062a\u0644\u0627 \u0647\u06cc\u0686 \u0647\u0645\u062e\u0648\u0646\u06cc \u0646\u062f\u0627\u0634\u062a \n\u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0645\u0648\u0646\u062f\u0647 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f\u0646 \n\u0648\u0644\u06cc \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0648\u062a\u0644\u0627 \u06af\u0631\u0627\u0646\u0648\u0644", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", -1]}
{"text": ["\u0633\u0631\u06cc\u0639 \u0631\u0633\u06cc\u062f .\u0631\u0648\u0644 \u0686\u0627\u06cc\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627\u064b \u0645\u062a\u0627\u0633\u0641\u0645 \u06a9\u0647 \u0627\u06cc\u0646\u0642\u062f\u0631 \u06a9\u06cc\u0641\u06cc\u062a\u0634\u0648\u0646 \u0627\u0641\u062a \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0647 \u060c\u062a\u0645\u0627\u0645 \u0633\u0641\u0627\u0631\u0634 \u0647\u0627 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f \u060c\u0646\u0627\u0646 \u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a \u06a9\u0647 \u062e\u0634\u06a9 \u0628\u0648\u062f \u0648 \u0633\u0641\u062a \u060c\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u0647\u0645 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0634\u062f\u0646 \u0647\u0645 \u062f\u06cc\u06af\u0647 \u0647\u06cc\u0686 \u0641\u06cc\u0644\u06cc\u0646\u06af\u06cc \u0646\u062f\u0627\u0631\u0646 \u0647\u0645 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0635\u0644\u0627\u064b \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0646 \u0648 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f\u0646\u060c\u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u062c\u0627\u06cc \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0627\u0632\u0634\u0648\u0646 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u060c\u0641\u0642\u0637 \u0645\u06cc\u0634\u0647 \u062a\u0627\u0633\u0641 \u062e\u0648\u0631\u062f\n\u0641\u06a9\u0631 \u0646\u0645\u06cc\u06a9\u0646\u0645 \u0628\u062e\u0648\u0627\u0645 \u062f\u0648\u0628\u0627\u0631\u0647 \u0627\u0632\u0634\u0648\u0646 \u062e\u0631\u06cc\u062f\u06cc \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", -1]}
{"text": ["\u0639\u06a9\u0633\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0628\u0631 \u0627\u0633\u0627\u0633 \u0627\u0648\u0646 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u06cc\u0645  \u0628\u0627 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0645\u06cc\u0641\u0631\u0633\u062a\u06cc\u062f \u0645\u063a\u0627\u06cc\u0631\u062a \u0632\u06cc\u0627\u062f\u06cc \u062f\u0627\u0631\u062f !!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0627\u0642\u0644\u0648\u0627", "\u062f\u0633\u0631 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": ["\u062f\u0648\u0628\u0627\u0631 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0648 \u0647\u0631 \u062f\u0648\u0628\u0627\u0631 \u0628\u062e\u0634\u06cc \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0645 \u062a\u0645\u0648\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u062c\u0628\u0648\u0631 \u0634\u062f\u0645 \u062a\u063a\u06cc\u06cc\u0631 \u0628\u062f\u0645 \u060c \u0632\u0628\u0627\u062f \u062c\u0627\u0644\u0628 \u0646\u06cc\u0633\u062a \u0627\u06cc\u0646\u062c\u0648\u0631\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062f\u0648\u0646\u0627\u062a", "\u0632\u0648\u0644\u0628\u06cc\u0627 \u0631\u0698\u06cc\u0645\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", 1]}
{"text": ["\u0634\u064a\u0631\u064a\u0646\u064a \u0632\u0628\u0627\u0646 \u0643\u0645 \u0634\u064a\u0631\u064a\u0646 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f .\u0627\u0633\u0646\u067e \u0627\u0643\u0633\u067e\u0631\u0633 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u062a\u0627\u0632\u0647\u060c \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u062a\u0633\u062a \u0633\u0648\u06cc\u062a\u0627\u0644", 1]}
{"text": ["\u0645\u063a\u0627\u06cc\u0631\u062a \u0628\u0627 \u0633\u0641\u0644\u0631\u0634 \u0627\u0635\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686", 1]}
{"text": ["\u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0641\u0631\u0648\u0634\u06af\u0627\u0647 \u062a\u0634\u06a9\u0631 \u0645\u06cc\u06a9\u0646\u0645 \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0645\u0648\u0627\u0631\u062f\u06cc \u06a9\u0647 \u062e\u0631\u06cc\u062f\u0627\u0631\u06cc \u0646\u0645\u0648\u062f\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f\u0647 \u0627\u0633\u062a.\n\u0627\u0644\u0628\u062a\u0647 \u062f\u0633\u0631 \u06a9\u06cc\u06a9 \u0647\u06cc\u062c \u062a\u0645\u0648\u0645 \u0634\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u062c\u0627\u0634 \u06cc\u06a9 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0646\u062f \u06a9\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f.\n\u0628\u0627 \u062a\u0634\u06a9\u0631", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u06cc\u0633\u06a9\u0648\u06cc\u06cc\u062a \u062c\u0648", "\u062f\u0633\u0631 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0622\u062e\u0647 \u0686\u0642\u062f\u0631 \u0634\u0645\u0627 \u062e\u0648\u0628\u06cc\u062f.\u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646\u0645 \u0627\u0632\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0643\u064a\u0643 \u062e\u064a\u0644\u064a \u0643\u0648\u0686\u0643 \u0647\u0633\u062a \u0627\u0635\u0644\u0627 \u0628\u0647 \u0645\u062a\u0648\u0633\u0637 \u0646\u0645\u064a\u062e\u0648\u0631\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f!!!!! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0628\u0649 \u0646\u0638\u064a\u0631 \u0648 \u062e\u0648\u0634 \u0633\u0644\u064a\u0642\u0647 \u0628\u0647\u062a\u0648\u0646 \u062a\u0628\u0631\u064a\u0643 \u0645\u064a\u06af\u0645 \u0643\u0647 \u0627\u064a\u0646 \u0647\u0645\u0647 \u062e\u0648\u0628\u064a\u0646 \u062a\u0648\u0649 \u0634\u064a\u0631\u064a\u0646\u0649 \u067e\u0632\u0649... \u0628\u0627 \u064a\u0647 \u0631\u0648\u0634\u0649 \u0628\u0627\u064a\u062f \u0643\u064a\u0643 \u0631\u0648 \u062f\u0627\u062e\u0644 \u062c\u0639\u0628\u0647 \u0641\u064a\u0643\u0633 \u0643\u0646\u064a\u062f \u0644\u0637\u0641\u0627 \u0628\u0647 \u062f\u064a\u0648\u0627\u0631\u0647 \u0646\u062e\u0648\u0631\u0647.. \u0628\u0627\u0632\u0645 \u0645\u0631\u0633\u0649 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0643\u0647 \u0628\u0627 \u062d\u0631\u0641\u0647 \u0627\u0649 \u0647\u0627 \u0643\u0627\u0631 \u0645\u064a\u0643\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f . \u0645\u062a\u0641\u0627\u0648\u062a \u0648 \u0647\u06cc\u062c\u0627\u0646 \u0627\u0646\u06af\u06cc\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062a\u0646\u0647\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u0628\u0633\u062a\u0647 \u06a9\u0647 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0628\u0648\u062f \u0633\u0631 \u0648 \u062a\u0647 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0644 \u062a\u0627\u067e\u06cc\u0646\u06af \u0627\u0646 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u06cc\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u0627\u0628\u0627\u062a\u0627 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", -1]}
{"text": ["\u06cc\u06a9\u0645 \u062f\u06cc\u0631 \u0627\u0648\u0645\u062f\u060c \u06a9\u06cc\u06a9 \u06a9\u0645\u06cc \u0686\u067e\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f. \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0647\u0645 \u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0646\u06af\u0631\u0627\u0646\u06cc \u0648\u0627\u0633\u0647 \u0631\u0641\u062a\u0646 \u0628\u0631\u0627\u06cc \u062e\u0631\u06cc\u062f \u06a9\u06cc\u06a9 \u0631\u0648 \u0646\u062f\u0627\u0631\u0645 \u0647\u0645 \u062e\u0648\u062f \u06a9\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u0633\u0631 \u0648\u0642\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "Don't Even Ask", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0642\u064a\u0645\u062a \u0628\u0647 \u0646\u0633\u0628\u062a \u062d\u062c\u0645 \u0643\u064a\u0643 \u0628\u0633\u064a\u0627\u0631 \u0628\u0627\u0644\u0627 \u0628\u0648\u062f. \u0637\u0639\u0645 \u062e\u0648\u0628\u064a \u062f\u0627\u0634\u062a. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645 \u0631\u0648\u063a\u0646\u0634 \u0627\u062d\u0633\u0627\u0633 \u0646\u0634\u0647 \u0648 \u06a9\u0645\u062a\u0631 \u0628\u0627\u0634\u0647 \u0645\u0648\u0642\u0639 \u067e\u062e\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", "\u0622\u0631\u062f \u0633\u0648\u062e\u0627\u0631\u06cc (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0646\u06af\u0634\u062a\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \n\u0647\u0645\u0686\u06cc \u0628\u0627 \u0628\u0647\u062a\u0631\u06cc\u0646 \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062a\u0633\u062a \u06a9\u0648\u0686\u06a9 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0646\u0627\u0632\u06a9 \u06a9\u0631\u0647 \u0627\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc \u062e\u06cc\u0644\u06cc \u0628\u062f \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u0627\u0646 \u062a\u062e\u062a \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0648\u0644\u06a9\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", -1]}
{"text": ["\u0627\u0635\u0644\u0627\u0627\u0627\u0627\u0627 \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u062a\u0648\u0646 \u06a9\u06cc\u0641\u06cc\u062a \u0646\u062f\u0627\u0631\u0646 \u0648 \u062a\u0627\u0632\u0647 \u0646\u06cc\u0633\u062a\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u0627\u06af\u0647 \u06cc\u062e\u0648\u0631\u062f\u0647 \u0628\u0632\u0631\u06af\u062a\u0631\u0628\u0627\u0634\u0647 \u06a9\u0647 \u0634\u0628\u06cc\u0647 \u062c\u0627\u0647\u0627\u06cc \u062f\u06cc\u06af\u0647 \u0628\u0627\u0634\u0647 \u0628\u0647\u062a\u0631\u0647\n\u0648\u0644\u06cc \u0627\u0632 \u0646\u0638\u0631 \u062a\u0627\u0632\u06af\u06cc \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", 1]}
{"text": ["\u06a9\u0627\u0634 \u0628\u062c\u0627\u06cc \u0645\u0631\u0628\u0627\u06cc \u0633\u06cc\u0628 \u0648\u0627\u0642\u0639\u0627 \u06cc\u0647 \u062a\u06cc\u06a9\u0647 \u0633\u06cc\u0628 \u062f\u0627\u062e\u0644 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0628\u0648\u062f \u0627\u0645\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u062f\u0633\u062a\u062a\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0646\u0645\u06cc\u0634\u0647 \u06af\u0641\u062a \u06a9\u0647\u0646\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u062a\u0627\u0632\u0647 \u0647\u0645 \u0646\u0628\u0648\u062f \u0627\u0635\u0644\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\n\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0633\u06cc\u062a\u0631\u0648\u0644 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062f\u0648\u0645\u06cc\u0646 \u0628\u0627\u0631 \u0627\u0633\u062a \u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u062f\u0647\u0645. \u0637\u0639\u0645 \u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc \u0639\u0627\u0644\u06cc \u0627\u0633\u062a. \u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0647\u0645\u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. \u0646\u0627\u0646 \u0647\u0627 \u0647\u0645\u0647 \u062a\u0627\u0632\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u0647\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u0627\u062f\u0647", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0631\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0641\u0631\u0627\u0646\u0633\u0648\u06cc", "\u0646\u0627\u0646 \u0633\u06cc\u0645\u06cc\u062a \u062a\u0631\u06a9\u06cc\u0647 \u0627\u06cc", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f \u062e\u0634\u06a9 \u0628\u0648\u062f \u062e\u06cc\u0644\u06cc \u0648\u200c\u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u0647\u0645\u200c\u0646\u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", -1]}
{"text": ["\u06a9\u0644 \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u062a\u0627\u0632\u0647 \u0648 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0628\u0647\u062f\u0627\u0634\u062a\u06cc \u0628\u0648\u062f.\n\u0633\u0631\u06cc\u0639 \u0647\u0645 \u0631\u0633\u06cc\u062f \u0627\u0632 \u0647\u0631  \u0646\u0627\u0646 \u062c\u0645  \u0648\u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0628\u0633\u06cc\u0627\u0631 \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u0628\u0632\u0631\u06af \u062c\u0648 \u0631\u0648\u06af\u0646 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f \n\u0633\u067e\u0627\u0633 \u0628\u06cc\u06a9\u0631\u0627\u0646 \u0627\u0632 \u0644\u0637\u0641\u062a\u0648\u0646  ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u0646\u0627\u0646 \u0628\u0631\u0628\u0631\u06cc \u06a9\u0646\u062c\u062f\u06cc \u0641\u0627\u0646\u062a\u0632\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0644\u0648\u0686\u0647 \u062e\u0631\u0645\u0627\u06cc\u06cc", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u062a\u0627\u0632\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u06cc\u0647 \u062f\u0648\u0646\u0647 \u062f\u0648\u0646\u0627\u062a \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0646 \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u067e\u0648\u0644 \u062f\u0648\u062a\u0627\u0634 \u062d\u0633\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u06a9\u0627\u062f\u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631\u06cc\u0646 \u06af\u0627\u062a\u0627\u06cc\u06cc \u06a9\u0647 \u062e\u0648\u0631\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f\n\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0645\u062a\u0646\u0627\u0633\u0628 \u0628\u0627 \u0647\u0631 \u0645\u062d\u0635\u0648\u0644 \u0628\u0648\u062f\n\u0632\u0648\u062f\u062a\u0631 \u0647\u0645 \u0631\u0633\u06cc\u062f\n\u0647\u0645\u0647 \u0634 \u0627\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", 1]}
{"text": ["\u0627\u0632 \u0627\u06cc\u0646\u06a9\u0647 \u0633\u0641\u0627\u0631\u0634 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u06a9\u0648\u0686\u06a9", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u062f\u0627\u0645 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648", 1]}
{"text": ["\u062a\u0631\u0627\u0645\u06cc\u0633\u0648 \u0648 \u06a9\u0632\u0648\u0633\u062a\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0631\u0648 \u0646\u062f\u0627\u0634\u062a\u0646 \u0648 \u062c\u0627\u0634 \u0686\u06cc\u0632\u06cc \u0646\u06cc\u0648\u0645\u062f. \u0628\u0642\u06cc\u0647 \u0645\u0648\u0627\u0631\u062f \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0647\u0631 \u0645\u062d\u0635\u0648\u0644 \u062f\u0631 \u06cc\u06a9 \u0628\u0633\u062a\u0647 \u062c\u062f\u0627\u060c \u0645\u0646\u0627\u0633\u0628 \u0648  \u0645\u0631\u062a\u0628\n\u0646\u0627\u0646 \u062b\u0645\u06cc\u0646 \u0648 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\n\u06a9\u0631\u0648\u0633\u0627\u0646 \u06a9\u0645\u06cc \u062f\u0627\u062e\u0644 \u0633\u0641\u062a \u0648 \u0631\u0648\u06cc\u0647 \u062a\u0631\u062f \u0628\u0648\u062f. \u0628\u0631\u0634 \u062f\u0627\u062f\u0645 \u0631\u0648\u0647\u0627\u06cc\u0634 \u0647\u0645\u0647 \u062c\u062f\u0627 \u0634\u062f.\n\u0627\u0633\u0646\u067e \u0645\u0648\u062f\u0628 \u0648 \u0632\u0648\u062f\u062a\u0631 \u0627\u0632 \u0645\u0648\u0639\u062f \u0631\u0633\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062b\u0645\u06cc\u0646", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", 1]}
{"text": ["\u062e\u062f\u0645\u0627\u062a \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0627\u0633\u062a \u0627\u0645\u0627 \u0628\u0647 \u062c\u0627\u06cc \u0646\u0627\u0646 \u062c\u0648 \u062f\u0648\u0633\u0631 \u0646\u0627\u0646 \u062c\u0648 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u0646\u0627\u0646 \u062c\u0648 80%", "\u0644\u0642\u0645\u0647 \u0628\u0631\u0648\u062a\u0686\u0646", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647 \u0628\u0627\u06cc\u062f \u062f\u0648 \u0639\u062f\u062f \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u0634\u062f \u06a9\u0647 \u06f1 \u0639\u062f\u062f \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0627\u0633\u062a \u0648 \u0647\u0632\u06cc\u0646\u0647 \u0627\u0646 \u0647\u0645 \u062f\u0631 \u067e\u0646\u0644 \u0646\u0628\u0648\u062f(\u0628\u0647 \u0639\u0644\u062a \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f\u0646 \u0628\u0631\u0627\u0646\u06cc \u0633\u0641\u0627\u0631\u0634 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0627\u062f\u0647 \u0634\u062f \u06a9\u0647 \u0646\u0647\u0627\u06cc\u062a\u0627 \u0635\u062d\u06cc\u062d \u0627\u0631\u0633\u0627\u0644 \u0646\u0634\u062f)", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0628\u0627\u06af\u062a \u0633\u0628\u0648\u0633 \u062f\u0627\u0631", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0646\u0628\u0648\u062f\n\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u06a9\u0646\u062c\u062f\u06cc", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647", "\u067e\u0627\u0646\u0627\u06a9\u0648\u062a\u0627", 1]}
{"text": ["\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u062e\u0634\u06a9 \u062e\u0634\u06a9 \u0628\u0648\u062f\u060c \u0637\u0648\u0631\u06cc \u06a9\u0647 \u0645\u0633\u062a\u0642\u06cc\u0645 \u0627\u0646\u062f\u0627\u062e\u062a\u06cc\u0645 \u062f\u0648\u0631.\n\u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0627\u06a9\u06cc\u062f \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u06cc\u0645 \u0646\u0627\u0646 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0627\u0634\u062f \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0645\u06cc\u0646\u06cc \u0633\u0627\u0646\u062f\u0648\u06cc\u0686 \u06a9\u0646\u062c\u062f\u06cc", "\u0646\u0627\u0646 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627", -1]}
{"text": ["\u062f\u06cc\u0631 \u0627\u0648\u0645\u062f \u0648\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0627\u0646\u0645\u0627\u0631\u06a9\u06cc \u0645\u062e\u0644\u0648\u0637", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \n\u0645\u0686\u06a9\u0631\u0645 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0648\u0631\u06cc\u0646\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062a\u0633\u062a \u0633\u06cc\u0627\u0647 \u06a9\u0648\u0686\u06a9", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0634\u0648\u0631\u06cc\u0646\u06cc \u0639\u0627\u0644\u06cc\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0648\u0631\u06cc\u0646\u06cc", 1]}
{"text": ["\u0628\u0647 \u0645\u0639\u0646\u064a \u0648\u0627\u0642\u0639\u064a \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u062e\u062f\u0627 \u0628\u0631\u0643\u062a \u0628\u062f\u0647 \u0628\u0647\u062a\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06cc\u0632\u062f\u06cc", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645 \u0627\u0645\u0627 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u064a\u0643\u064a \u0627\u0632 \u0645\u0627\u0643\u0627\u0631\u0648\u0646 \u0647\u0627 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0631\u06cc\u0632", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", 1]}
{"text": ["\u0639\u0627\u0644\u06cc ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0646\u0627\u0646 \u062a\u0627 \u0628\u0633\u06cc\u0627\u0631 \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0631\u0648\u0644 \u0686\u0627\u06cc", "\u0628\u0631\u0628\u0631\u06cc \u06a9\u0631\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u06cc\u06a9\n\u0633\u0641\u0627\u0631\u0634\u0627\u062a\u0645 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a\n\u0641\u0642\u0637 \u0648 \u0641\u0642\u0637 ...\n\u0633\u0641\u0627\u0631\u0634\u0627\u062a\u0645 \u06a9\u0627\u0645\u0644 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0646\u0631\u0633\u06cc\u062f !!\n\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0647 \u062c\u0627\u06cc \u062f\u0648 \u062a\u0627 \u06cc\u06a9\u06cc \u0628\u0631\u0627\u0645 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f\n\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u06cc\u0645 \u0628\u0627\u06af\u062a \u06a9\u0646\u062c\u062f\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0631\u0647\u200c\u0627\u06cc\u060c \u06a9\u0647\u0646\u0647 \u0628\u0627 \u0637\u0639\u0645\u06cc \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u062a\u062d\u0645\u0644. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", -1]}
{"text": ["\u0636\u0639\u06cc\u0641", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u06a9\u0627\u0645\u0644\u0627 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645\u060c \u0641\u0642\u0637 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f \u062d\u062f\u0648\u062f \u06f1 \u0633\u0627\u0639\u062a \u0628\u0639\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc\u06cc\u06cc\u06cc \u062f\u06cc\u0631 \u0631\u0633\u06cc\u062f! : ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u062d\u062c\u0645 \u0645\u0631\u0628\u0627 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u06a9\u0645 \u0628\u0648\u062f \u0648\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062e\u0648\u0628 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u062f\u0647 \u0628\u0648\u062f\n\u0627\u0633\u0646\u067e \u0628\u0627\u06a9\u0633 \u0647\u0645 \u0633\u0631 \u062a\u0627\u06cc\u0645 \u0648 \u0628\u062f\u0648\u0646 \u0645\u0634\u06a9\u0644 \u0622\u0648\u0631\u062f\n\u0633\u067e\u0627\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0631\u0628\u0627 \u0642\u06cc\u0633\u06cc \u0632\u0631\u062f\u0627\u0644\u0648 \u0628\u0632\u0631\u06af", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645.... \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0686\u0648\u0646 \u0642\u06cc\u0645\u062a \u062f\u0627\u0646\u0647 \u0627\u06cc \u062d\u0633\u0627\u0628 \u0645\u06cc\u0634\u0647.... \u06cc\u06a9\u06cc \u0627\u0632 \u0634\u06cc\u0631\u06cc\u0646\u0647\u0627 \u06a9\u0627\u0645\u0644\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u0644\u0647 \u0634\u062f\u0647 \u062f\u0631 \u062c\u0639\u0628\u0647 \u0642\u0631\u0627\u0631 \u062f\u0627\u0634\u062a. \u06cc\u0639\u0646\u06cc \u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0648 \u063a\u06cc\u0631 \u0641\u0627\u0628\u0644 \u0633\u0631\u0648 \u0628\u0631\u0627\u06cc \u0645\u0647\u0645\u0627\u0646 \u062d\u062a\u06cc \u063a\u06cc\u0631 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", -1]}
{"text": ["\u062a\u0634\u06a9\u0631 \u0627\u0632 \u067e\u06cc\u06a9\u0650 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06a9\u0647 \u062f\u0631\u062e\u0648\u0627\u0633\u062a\u0650 \u0645\u0631\u0627\u0642\u0628 \u0628\u0648\u062f\u0646 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0631\u0627 \u062f\u0631\u0647\u0646\u06af\u0627\u0645\u0650 \u062a\u062d\u0648\u06cc\u0644 \u0631\u0639\u0627\u06cc\u062a \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0646\u0627\u0646 \u06af\u0631\u062f \u0633\u0628\u0648\u0633 \u062f\u0627\u0631\u0634\u0648\u0646 \u062e\u0648\u0628 \u0628\u0648\u062f \u0646\u0645\u06cc\u062f\u0648\u0646\u0645 \u0648\u0627\u0642\u0639\u0627 \u0631\u0698\u06cc\u0645\u06cc \u0628\u0648\u062f \u06cc\u0627 \u0646\u0647 \u0648\u0644\u06cc \u0627\u0635\u0644\u0627 \u0627\u0648\u0646 \u062a\u0635\u0648\u0631 \u0645\u0632\u0647 \u0628\u062f\u06cc \u06a9\u0647 \u0627\u0632 \u0646\u0648\u0646\u0627\u06cc \u0631\u0698\u06cc\u0645\u06cc \u062f\u0627\u0634\u062a\u0645\u0648 \u0639\u0648\u0636 \u06a9\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u06af\u0631\u062f \u062a\u062e\u062a \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0644\u0648\u0686\u0647 \u0641\u0648\u0645\u0646 \u0628\u062f\u062a\u0631\u06cc\u0646 \u06a9\u0644\u0648\u0686\u0647 \u0641\u0648\u0645\u0646\u06cc.\u0628\u0648\u062f \u06a9\u0647 \u062a\u0648 \u0639\u0645\u0631\u0645.\u062e\u0648\u0631\u062f\u0645. \u06a9\u0627\u0645\u0644\u0627 \u0645\u0639\u0644\u0648\u0645 \u0628\u0648\u062f \u0686\u0646\u062f\u06cc\u0646 \u0631\u0648\u0632 \u0627\u0632 \u067e\u062e\u062a\u0634 \u0645\u06cc\u06af\u0630\u0631\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0644\u0648\u0686\u0647 \u0641\u0648\u0645\u0646 (\u067e\u0646\u062c \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0634\u06a9", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 \u0641\u0642\u0637 \u062f\u0627\u062e\u0644 \u06cc\u0647 \u0633\u0644\u0641\u0646 \u0648 \u06a9\u0641\u06cc \u06a9\u0627\u063a\u0630\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062a\u0648 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0645\u06cc \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u0642\u0627\u0628\u0644\u06cc\u062a \u0646\u06af\u0647 \u062f\u0627\u0631\u06cc \u062f\u0631 \u0645\u0646\u0632\u0644\u0634 \u0637\u0628\u06cc\u0639\u062a\u0627\u064b \u067e\u0627\u0626\u06cc\u0646 \u0627\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0648 \u067e\u0627\u06cc \u0633\u06cc\u0628 \u0627\u06af\u0631 \u062e\u0648\u062f \u0645\u06cc\u0648\u0647 \u0646\u06cc\u0645 \u062e\u0634\u06a9 \u0634\u062f\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0645\u06cc\u0634\u0647 \u062d\u062f\u0627\u0642\u0644 \u0645\u0631\u0628\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u06a9\u0646\u06cc\u062f \u0645\u0631\u0628\u0627\u06cc \u06cc\u0628 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u0646 \u0627\u06cc\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0634\u0628\u06cc\u0647 \u0645\u0631\u0628\u0627\u06cc \u0647\u0648\u06cc\u062c \u0628\u0648\u062f \u0648\u0644\u06cc \u0627\u0632 \u067e\u0627\u06cc\u0647 \u0633\u06cc\u0628 \u0628\u06af\u0630\u0631\u06cc\u0645 \u0627\u0648\u0646 \u062f\u0648 \u06a9\u06cc\u06a9 \u062f\u06cc\u06af\u0647 \u062e\u0648\u0628 \u0628\u0648\u062f \u0627\u0646\u062a\u0638\u0627\u0631 \u06af\u0631\u062f\u0648\u06cc \u0632\u06cc\u0627\u062f \u0646\u062f\u0627\u0634\u062a\u0645 \u0648 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u062a\u0628\u0644\u06cc\u063a\u0627\u062a\u06cc \u0628\u0648\u062f\u0646 \u06af\u0648\u06cc\u0634 \u06cc\u06a9 \u0633\u0631\u06cc \u0645\u06a9\u0627\u0646 \u0647\u0627 \u0627\u0632 \u06af\u0631\u062f\u0648 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f \u0648 \u06a9\u0627\u0645\u0644\u0627\u064b \u062d\u0633 \u0645\u06cc\u0634\u062f \u0648 \u0637\u0639\u0645 \u0647\u0627\u06cc \u062e\u0648\u0628\u06cc \u0631\u0648 \u0628\u0631\u0627\u06cc \u0645\u0646 \u06cc\u0627\u062f \u0622\u0648\u0631 \u0634\u062f \u0627\u06af\u0631 \u0627\u0632 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631 \u062a\u0627 \u062d\u0627\u0644\u0627 \u062c\u0627\u0626\u06cc \u062a\u0648 \u0639\u0645\u0631\u0645 \u0646\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u0642\u0637\u0639\u0627\u064b \u0627\u0632 \u06f5 \u067e\u0646\u062c \u0627\u0645\u062a\u06cc\u0627\u0632 \u0631\u0648 \u0645\u06cc\u062f\u0627\u062f\u0645 \u0648 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0627\u067e \u062e\u0648\u0628\u062a\u0648\u0646 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u06a9\u06cc\u06a9 \u06a9\u0634\u0645\u0634 \u0648 \u06af\u0631\u062f\u0648", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u060c\u0645\u062e\u0635\u0648\u0635\u0627 \u0646\u0648\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc\u060c\u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u062f\u06cc\u0627\u0628\u062a \u0648 \u0686\u0631\u0628\u06cc \u0633\u0648\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0648\u06cc\u0698\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u0627\u0646\u06af\u0634\u062a\u06cc \u062c\u0648 \u0631\u0648\u06af\u0646 (20 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0627 \u0633\u0644\u0627\u0645\u060c \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0633\u0631\u06cc\u0639 \u0648 \u0628\u0647 \u0645\u0648\u0642\u0639 \u0628\u0648\u062f\u060c \u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0648\u0627\u0642\u0639\u0627 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0641\u0642\u0637 \u0627\u06af\u0631 \u0630\u06a9\u0631 \u0634\u0648\u062f \u0627\u0632 \u0686\u0647 \u0634\u06cc\u0631\u06cc\u0646 \u06a9\u0646\u0646\u062f\u0647 \u0627\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u062f\u0647 \u0645\u0645\u0646\u0648\u0646 \u0645\u06cc\u0634\u0645\u060c \u0646\u0627\u0646 \u062c\u0648 \u0648 \u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0647\u0645 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0647\u0633\u062a\u0646\u060c \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0645\u062f\u06cc\u0632\u06cc\u062a \u0646\u0627\u0646 \u062c\u0645 \u0648 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u06a9\u0648\u0631\u0646 \u0627\u0634\u067e\u06cc\u062a\u0632 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u0627\u0644\u0627\u062f \u0633\u0632\u0627\u0631 \u0633\u06cc\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0627\u0648\u0627\u06cc\u0644 \u06cc \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0634\u06cc\u06a9 \u0628\u0648\u062f \n\u0627\u0644\u0627\u0646 \u062f\u0648\u062a\u0627 \u062f\u0648\u0646\u0627\u062a \u0633\u0631\u062f\u062f\u062f \u062a\u0648 \u067e\u0644\u0627\u0633\u062a\u06cc\u06a9 \u0627\u0635\u0635\u0635\u0644\u0627 \u062e\u0648\u0628 \u0646\u06cc\u0633\u0633\u0633\u0633", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0631\u0698\u06cc\u0645\u06cc \u0644\u06cc\u062f\u06cc \u0645\u062e\u0635\u0648\u0635 \u0628\u0627\u0646\u0648\u0627\u0646 (5 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0645\u0627\u062c (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (2 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u0648\u067e\u06cc \u0633\u06cc\u0631 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0647\u0645\u0647 \u0686\u06cc \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0644\u0648\u0686\u0647 \u0641\u0648\u0645\u0646 (\u067e\u0646\u062c \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0634\u06a9", "\u0646\u0627\u0646 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0645\u062f\u062a \u0647\u0627 \u0628\u0648\u062f \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc \u0646\u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f \u0648 \u0645\u062f\u0644 \u0645\u0648\u0631\u062f \u0639\u0644\u0627\u0642\u0645\u0647 \u062a\u0627\u0632\u06af\u06cc \u0647\u0627 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0647\u0648\u0633 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0645 \u062a\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0645\u0631\u0648\u0632 \u0634\u0645\u0627 \u0631\u0648 \u0627\u06cc\u0646\u062c\u0627 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0645. \u0622\u0642\u0627 \u0647\u0631 \u0686\u06cc \u0627\u0632 \u062e\u0648\u0634\u0645\u0632\u06af\u06cc\u0634 \u0628\u06af\u0645 \u06a9\u0645 \u06af\u0641\u062a\u0645. \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0646\u0631\u0645 \u0628\u0648\u062f \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648\u0644\u06cc \u0642\u06cc\u0645\u062a \u0645\u0642\u062f\u0627\u0631\u06cc \u0628\u0627\u0644\u0627\u0633\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u067e\u0627\u06cc \u0633\u06cc\u0628", 1]}
{"text": ["\u0646\u0648\u0646 \u0628\u0631\u0646\u062c\u06cc \u0647\u0627\u0634 \u06cc\u06a9\u0645 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u0628\u0627\u0646 (\u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648)", "\u0646\u0627\u0646 \u0628\u0631\u0646\u062c\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u06cc\u06a9 \u0645\u0642\u062f\u0627\u0631 \u0631\u0648\u063a\u0646\u06cc.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u0628\u062c\u0632 \u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 \u06a9\u0647 \u06a9\u0645\u06cc \u062e\u0634\u06a9 \u0628\u0648\u062f \u0628\u0642\u06cc\u0647 \u06cc \u0645\u0648\u0627\u0631\u062f \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u062c\u0648 \u0627\u0635\u0641\u0647\u0627\u0646 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u062c\u0648 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u062c\u0648 \u062e\u0634\u06a9 \u0631\u0698\u06cc\u0645\u06cc \u0634\u0648\u06cc\u062f (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645)", "\u0646\u0627\u0646 \u0647\u0645\u0628\u0631\u06af\u0631 \u062c\u0648 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0641\u0642\u0637 \u062f\u0631 \u0635\u0648\u0631\u062a \u0627\u0645\u06a9\u0627\u0646 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0647\u0645 \u0627\u0631\u0627\u064a\u0647 \u0634\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0648\u06a9\u06cc \u0631\u0698\u06cc\u0645\u06cc \u0686\u0646\u062f \u063a\u0644\u0647 \u0633\u0628\u0648\u0633 \u0648 \u062c\u0648", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646 \u0641\u0642\u0637 \u0627\u06af\u0631 \u062f\u0631 \u0645\u0642\u062f\u0627\u0631 \u0648\u0632\u0646\u06cc \u06a9\u0647 \u062f\u0631\u062d\u062f \u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u062f\u0631\u062c \u0634\u062f\u0647 \u0628\u0647 \u0645\u0642\u062f\u0627\u0631 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648 \u0647\u0645 \u0628\u0634\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f \u062a\u0646\u0648\u0639 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0645\u06cc\u0634\u0647 \u062e\u0631\u06cc\u062f \u06a9\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0633\u0648\u062e\u0627\u0631\u06cc \u0634\u06cc\u0631\u06cc\u0646 (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0631\u062f (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u0647\u0633\u062a\u06cc\u062f \u060c \u062f\u0644\u0628\u0631\u062a\u0631\u06cc\u0646 \u0646\u0648\u0646 \u0647\u0627\u06cc \u062a\u0647\u0631\u0627\u0646 \u0648 \u062f\u0627\u0631\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u06cc\u0636\u06cc \u062c\u0648 \u06a9\u0646\u062c\u062f\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u0645\u06a9 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0644 \u062c\u0627\u06cc \u06cc\u06a9 \u0633\u0648\u067e\u0631 \u0646\u0627\u0646 \u062e\u0648\u0628 \u06a9\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9  (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0642\u062a\u0627\u0628 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u0637\u0639\u0645 \u0644\u0637\u06cc\u0641\u0647 \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0648\u062a\u0627\u0632\u0647\n\u06af\u0627\u062a\u0627 \u0639\u0627\u0644\u06cc\n\u0647\u0645\u06cc\u0646 \u0637\u0648\u0631 \u0628\u0645\u0627\u0646\u06cc\u062f\n\u06a9\u0627\u0634 \u0646\u06cc\u0645 \u06a9\u06cc\u0644\u0648\u06cc\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc\u06af\u0631\u0641\u062a\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0644\u0642\u0645\u0647 \u0628\u0631\u0648\u062a\u0686\u0646", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647", 1]}
{"text": ["\u0631\u0648\u0627\u062a \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0648 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0641\u0642\u0637 \u064a\u0647 \u0627\u064a\u0631\u0627\u062f \u062f\u0627\u0634\u062a \u0627\u0648\u0646\u0645 \u0627\u064a\u0646 \u0628\u0648\u062f \u0643\u0647 \u062e\u0627\u0645\u0634 \u0628\u064a\u0634 \u0627\u0632 \u062d\u062f \u0634\u064a\u0631\u064a\u0646 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06a9 \u0631\u0648\u0644\u062a \u067e\u06cc\u0686", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u0647\u0645\u06af\u06cc \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647\u060c\u0645\u0645\u0646\u0648\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", 1]}
{"text": ["\n\u0628\u0631\u062e\u0648\u0631\u062f \u0639\u0627\u0644\u06cc \n\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647 \u0628\u06cc \u0631\u0642\u06cc\u0628 \u0628\u0648\u062f \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0637\u06cc\u0641\u0647", 1]}
{"text": ["\u0628\u0631 \u062e\u0644\u0627\u0641 \u0627\u0633\u0645\u0634 \u0627\u0635\u0644\u0627 \u06af\u0631\u0645 \u0646\u0628\u0648\u062f \u0648 \u0636\u0645\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0635\u0644\u0627 \u062a\u0627\u0632\u0647 \u0647\u0645  \u0646\u0628\u0648\u062f /", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0646\u06cc\u0634 \u06a9\u0631\u0645", -1]}
{"text": ["\u062e\u0648\u0628 \u0648 \u062e\u0648\u0628 \u0648...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0646\u0639\u0644 \u0627\u0633\u0628\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc", 1]}
{"text": ["\u0639\u06a9\u0633 \u0645\u0631\u0628\u0648\u0637 \u0628\u0647 \u0645\u0646\u0648\u06cc \u0627\u0646\u062a\u062e\u0627\u0628\u06cc \u0647\u0631 \u062f\u0648 \u0646\u0648\u0639 \u0646\u0648\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc \u0633\u0627\u062f\u0647 \u0648 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0628\u0648\u062f  \u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u062a\u0646\u0647\u0627 \u0645\u062f\u0644 \u0633\u0627\u062f\u0647 \u0622\u0646 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0631\u0648\u0644 \u0686\u0627\u06cc", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u062a\u0631 \u0645\u06cc\u0648\u0647 \u0627\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u0645\u0645\u0646\u0648\u0646\u0645 \u06a9\u0647 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \u0627\u0646\u0635\u0627\u0641\u0627 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0646\u0627\u0646 \u0648 \u067e\u0646\u06cc\u0631", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc", 1]}
{"text": ["\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u0647\u0645\u06af\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u060c\u0644\u0637\u0641\u0627\u064b \u06a9\u06cc\u0641\u06cc\u062a \u0645\u062d\u0635\u0648\u0644\u0627\u062a \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u062f\u0645\u0627\u062a\u062a\u0648\u0646 \u0631\u0648 \u0628\u0647 \u0647\u0645\u06cc\u0646 \u0634\u06a9\u0644 \u062d\u0641\u0638 \u06a9\u0646\u06cc\u062f\u060c\u0645\u0645\u0646\u0648\u0646\n\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635 \u0648 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648 \u0631\u0648 \u0628\u06cc\u0634\u062a\u0631 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645\n\u0641\u0642\u0637 \u0646\u0627\u0646 \u0647\u0627 \u0622\u0645\u0627\u062f\u0647 \u0646\u0628\u0648\u062f \u0648 \u0645\u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0634\u062a\u0646 \u06a9\u0647 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646 \u06af\u0641\u062a\u0645 \u0628\u062c\u0627\u0634 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0628\u0632\u0627\u0631\u0646 \u060c\u062f\u0633\u062a\u0634\u0648\u0646 \u062f\u0631\u062f \u0646\u06a9\u0646\u0647\n\u0633\u0631\u0648\u06cc\u0633 \u062f\u0647\u06cc \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0647\u0645 \u062e\u0648\u0628 \u0639\u0627\u0644\u06cc\n\u0639\u06a9\u0633 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc \u0631\u0648 \u0647\u0645 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u0645 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062a\u0627\u06cc\u06cc\u062f \u0646\u06a9\u0631\u062f\u0646!!!\u0639\u06a9\u0633 \u062f\u0627\u062e\u0644 \u0645\u0646\u0648 \u0645\u063a\u0627\u06cc\u0631\u062a \u062f\u0627\u0631\u0647 \u0628\u0627 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u06af\u06cc\u0633\u0648", "\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644", "\u0646\u0627\u0646 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", 1]}
{"text": ["\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648 \u0633\u0631\u06cc\u0639 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0644\u0642\u0645\u0647 \u0628\u0631\u0648\u062a\u0686\u0646", "\u062a\u0633\u062a \u0633\u0641\u06cc\u062f \u06a9\u0648\u0686\u06a9", "\u0628\u0631\u0628\u0631\u06cc \u0633\u0646\u062a\u06cc", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0633\u0641\u0627\u0631\u0634 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u06a9\u0627\u0645\u0644 \u0644\u0647 \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u06cc\u062f! \u0627\u0635\u0644\u0646 \u0631\u0627\u0636\u06cc \u0646\u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u062e\u0627\u0645\u0647 \u0627\u06cc", "\u0645\u0627\u06a9\u0627\u0631\u0648\u0646", -1]}
{"text": ["\u06af\u0627\u062a\u0627  \u0647\u0645\u0686\u0646\u0627\u0646 \u0628\u06cc \u0631\u0642\u06cc\u0628\u0647 \n\u0646\u0627\u0646 \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u0644\u0642\u0645\u0647 \u0631\u06cc\u0632 \u06a9\u0646\u062c\u062f\u06cc", 1]}
{"text": ["\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648 \u0628\u062f \u0628\u0648\u062f \u06a9\u06cc\u06a9 \u0648 \u0628\u0633\u062a\u0646\u06cc \u0631\u0648 \u0645\u062e\u0644\u0648\u0637 \u06a9\u0631\u062f\u0647 \u0628\u0648\u062f\u0646 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "\u062a\u06cc\u0631\u0627\u0645\u06cc\u0633\u0648", -1]}
{"text": ["\u0634\u0645\u0627 \u0628\u0647 \u062c\u0627\u06cc \u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 \u060c\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0641\u0631\u0633\u062a\u0627\u062f\u06cc\u0646.\u0627\u0634\u06a9\u0627\u0644\u06cc \u0646\u062f\u0627\u0631\u0647 \u0648\u0644\u06cc \u06af\u0641\u062a\u0645 \u0627\u0637\u0644\u0627\u0639 \u0628\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u0627\u06cc \u0622\u0646\u0627\u0646\u0627\u0633", "\u0631\u0648\u0644 \u0686\u0627\u06cc", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648 \u0628\u06cc \u0646\u0638\u06cc\u0631 \u0628\u0648\u062f \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0647\u0645\u06cc\u0646 \u0637\u0648\u0631 \u0628\u0645\u0648\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u0631\u0648\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u062a\u0645\u0627\u0645 \u0646\u0627\u0646 \u0647\u0627 \u0648 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u060c\u0628\u0639\u0636\u06cc \u0647\u0627\u0634\u0648\u0646 \u0647\u0645 \u062f\u0627\u063a \u062f\u0627\u063a \u0631\u0633\u06cc\u062f\u0646 \u0628\u0647 \u062f\u0633\u062a\u0645\u060c\u0637\u0639\u0645 \u0645\u0632\u0647 \u0634\u0648\u0646 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0647 \u062e\u0648\u0628\u06cc \u067e\u062e\u062a \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u060c\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644 \u0648 \u0633\u0628\u0632\u06cc\u062c\u0627\u062a \u0648 \u067e\u0646\u06cc\u0631 \u067e\u06cc\u062a\u0632\u0627 \u0631\u0648 \u0628\u06cc\u0634\u062a\u0631 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0645\n\u0634\u06cc\u0631\u0645\u0627\u0644 \u0647\u0627 \u0647\u0645 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u060c\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0647\u0627 \u0647\u0645 \u0647\u0645\u06af\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \n\u0641\u0642\u0637 \u06a9\u0645\u06cc \u0645\u0632\u0647 \u0631\u0648\u063a\u0646 \u0628\u0647 \u062e\u0648\u062f\u0634\u0648\u0646 \u06af\u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u0646 \u060c\u06a9\u0647 \u0627\u0644\u0628\u062a\u0647 \u0686\u0648\u0646 \u062a\u0648 \u0631\u0648\u063a\u0646 \u0633\u0631\u062e \u0645\u06cc\u0634\u0646 \u0646\u0645\u06cc\u0634\u0647 \u062e\u06cc\u0644\u06cc \u0627\u06cc\u0631\u0627\u062f \u06af\u0631\u0641\u062a :( \n\u0641\u0642\u0637 \u06a9\u0645\u06cc \u0632\u0645\u0627\u0646 \u062a\u0627\u06cc\u06cc\u062f \u0633\u0641\u0627\u0631\u0634 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u0648 \u0627\u06cc\u0646\u06a9\u0647 \u0639\u06a9\u0633 \u062f\u0627\u062e\u0644 \u0645\u0646\u0648 \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0634\u06a9\u0631\u06cc \u0627\u0634\u062a\u0628\u0627\u0647 \u0647\u0633\u062a\u0634 \u0644\u0637\u0641\u0627\u064b \u062a\u0635\u062d\u06cc\u062d \u06a9\u0646\u06cc\u062f\u060c\u0627\u06af\u0631 \u062a\u0645\u0627\u0645 \u0645\u0646\u0648 \u062a\u0648\u0646 \u0639\u06a9\u0633 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0631\u0627\u062d\u062a \u062a\u0631 \u0645\u06cc\u0634\u0647\u060c\u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0647\u0645 \u0644\u0637\u0641\u0627\u064b \u0645\u0642\u062f\u0627\u0631 \u062e\u0631\u06cc\u062f \u0631\u0648 \u0628\u0647 \u0635\u0648\u0631\u062a \u0645\u062a\u063a\u06cc\u06cc\u0631 \u0628\u0632\u0627\u0631\u06cc\u062f \u062a\u0627 \u0627\u06af\u0631 \u06a9\u0645\u062a\u0631 \u06cc\u0627 \u0628\u06cc\u0634\u062a\u0631 \u06cc\u0627 \u0645\u062a\u0646\u0648\u0639 \u062a\u0631 \u062e\u0648\u0627\u0633\u062a\u06cc\u0645 \u0628\u062a\u0648\u0646\u06cc\u0645 \u062e\u0631\u06cc\u062f \u06a9\u0646\u06cc\u0645 \n\u062f\u0631 \u0647\u0631 \u0635\u0648\u0631\u062a \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0645 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0645\u0631\u062a\u0628 \u0648 \u0645\u0646\u0638\u0645 \u0648 \u0628\u062f\u0648\u0646 \u06a9\u0645 \u06a9\u0627\u0633\u062a\u06cc \u0628\u0648\u062f\u0634 \u060c\u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633 \u0647\u0645 \u0633\u0631 \u062a\u0627\u06cc\u0645 \u0648 \u0628\u0647 \u062f\u0631\u0633\u062a\u06cc \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f \u0645\u0645\u0646\u0648\u0646\u0645\n\u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u06a9\u0645\u06cc\u062a \u0648 \u0642\u06cc\u0645\u062a \u0634\u0648 \u0628\u0647 \u0647\u0645\u06cc\u0646 \u0645\u0646\u0648\u0627\u0644 \u062d\u0641\u0638 \u06a9\u0646\u0647\n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0648\u06cc\u0698\u0647", "\u0646\u0627\u0646 \u067e\u06cc\u0627\u0632 \u0648 \u0641\u0644\u0641\u0644", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0645\u062e\u0635\u0648\u0635", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u062e\u0631\u0645\u0627 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", "Don't Even Ask", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", 1]}
{"text": ["\u0633\u067e\u0627\u0633\u06af\u0632\u0627\u0631\u0645\u060c \u0639\u0627\u0644\u06cc \u0627\u0646\u062c\u0627\u0645 \u0634\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0643\u0644\u0627\u062a \u062a\u0631\u0627\u0641\u0644", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", 1]}
{"text": ["\u0645\u06cc\u06a9\u0633 \u0645\u06cc\u0646\u06cc \u062a\u0648\u06cc \u062c\u0639\u0628\u0647 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0628\u0648\u062f \u0648 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u067e\u0646\u06cc\u0631\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u062f\u0631 \u06a9\u0645\u0627\u0644 \u062a\u0639\u062c\u0628 \u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646.\u0648\u0644\u06cc \u06a9\u0631\u0627\u0633\u0627\u0646 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f..\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0628\u0647 \u0634\u062f\u062a \u0628\u06cc\u0627\u062a \u0648 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062a\u0639\u0631\u06cc\u0641\u06cc \u0646\u062f\u0627\u0634\u062a..\u062f\u0631\u06a9\u0644 \u0628\u0633\u06cc\u0627\u0631 \u0636\u0639\u06cc\u0641...\u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0645\u0634\u062a\u0631\u06cc \u062b\u0627\u0628\u062a \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u062f\u06cc\u06af\u0647 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0633\u0641\u0627\u0631\u0634 \u0646\u062e\u0648\u0627\u0647\u0645 \u062f\u0627\u062f...\u0648\u0627\u0642\u0639\u0627 \u0646\u0627 \u0627\u0645\u06cc\u062f \u06a9\u0646\u0646\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0633\u0627\u062f\u0647", -1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0631\u062f \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f\u0646\u062f\u060c \u0637\u0639\u0645 \u06a9\u0631\u0647 \u0627\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0645\u0644\u0627\u06cc\u0645 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 . \n\u0627\u0632 \u067e\u06cc\u06a9 \u0627\u0633\u0646\u067e \u0628\u0627\u06cc\u062f \u062a\u0634\u06a9\u0631 \u06a9\u0646\u0645 \u06a9\u0647 \u0628\u0627 \u0648\u062c\u0648\u062f \u0627\u06cc\u0646\u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0631\u062f \u0648 \u0644\u0637\u06cc\u0641 \u0628\u0648\u062f\u0646\u062f\u060c \u062f\u0631 \u0633\u0644\u0627\u0645\u062a \u06a9\u0627\u0645\u0644 \u062d\u0645\u0644 \u0648 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f.\n\u0622\u0631\u0632\u0648\u06cc \u0634\u0627\u062f\u06cc \u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648 \u0645\u062c\u0645\u0648\u0639\u0647 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0639\u0632\u06cc\u0632.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 3", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u062d\u062c\u0645\u0634 \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f \u0648\u0644\u06cc \u062f\u0631 \u06a9\u0644 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0631\u0627\u0649 \u0643\u0633\u0627\u064a\u0649 \u0643\u0647 \u0639\u0627\u0634\u0642 \u0637\u0639\u0645 \u0634\u0643\u0644\u0627\u062a \u0647\u0633\u062a\u0646\u062f \u0627\u064a\u0646 \u0643\u064a\u0643 \u0645\u062b\u0644 \u064a\u0643 \u0645\u0627\u0626\u062f\u0647 \u0628\u0647\u0634\u062a\u0649 \u0645\u0649 \u0645\u0648\u0646\u0647!! \u0648\u0627\u0642\u0639\u0627\u0627\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u0647\u0645\u0647 \u0686\u064a\u0632 \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647. \u0633\u0644\u064a\u0642\u0647 \u0634\u062e\u0635\u0649 \u0645\u0646 \u0643\u0645\u0649 \u0643\u0645\u062a\u0631 \u0634\u064a\u0631\u064a\u0646 \u0647\u0633\u062a \u0627\u0645\u0627 \u0628\u0647 \u0647\u064a\u0686 \u0648\u062c\u0647 \u0634\u064a\u0631\u064a\u0646\u0649 \u0622\u0632\u0627\u0631\u062f\u0647\u0646\u062f\u0647 \u0627\u0649 \u0646\u062f\u0627\u0634\u062a. \u062f\u0631 \u0639\u0631\u0636 \u0667 \u062f\u0642\u064a\u0642\u0647 \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f . \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u062d\u0644\u06cc\u0645 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0627\u062f\u0647 \u0634\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", -1]}
{"text": ["\u0628\u06cc\u0634\u062a\u0631 \u06a9\u06cc\u06a9 \u0628\u0648\u062f \u062a\u0627 \u067e\u0648\u062f\u06cc\u0646\u06af \u0628\u0627\u06cc\u062f \u0627\u0633\u0645\u0634\u0648 \u0628\u0632\u0627\u0631\u0646 \u06a9\u06cc\u06a9 \u067e\u0648\u062f\u06cc\u0646\u06af\n\u0648\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": [" \u0647\u0631 4 \u06a9\u06cc\u06a9 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628 \u062f\u0627\u0631\u0686\u06cc\u0646 \u06a9\u0645\u06cc \u062f\u0627\u0634\u062a \u062e\u0634\u06a9 \u0628\u0648\u062f \u06a9\u0645\u06cc \u0647\u0645\n\u06a9\u06cc\u06a9 \u0647\u0645 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0648\u0627\u0648 \u0646\u0628\u0648\u062f\n\u0627\u0645\u0627 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0628\u0627 \u0648 \u062f\u0648\u0633 \u062f\u0627\u0634\u062a\u0646\u06cc \u062f\u0627\u0634\u062a \u0628\u0633\u06cc\u0627\u0631 \u0645\u0645\u0646\u0648\u0646 \u0627\u0632\u0634\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0645\u0627\u0631\u0633 \u0648 \u06a9\u0627\u067e\u0648", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0642\u0628\u0644 \u0627\u0632  \u0631\u0633\u06cc\u062f\u0646 \u0627\u0639\u0644\u0627\u0645 \u062a\u062d\u0648\u06cc\u0644 \u06a9\u0631\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0642\u064a\u0645\u062a \u0643\u0648\u0643\u064a \u0647\u0627 \u0628\u0627\u0644\u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0634\u0643\u0644\u0627\u062a\u06cc", "\u0628\u06cc\u0633\u06a9\u0627\u062a\u06cc \u0648\u0627\u0646\u06cc\u0644 \u0628\u0627 \u062a\u06a9\u0647 \u0647\u0627\u06cc \u0634\u06a9\u0644\u0627\u062a", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0648\u0627\u064a\u062a", "\u0643\u0648\u0643\u06cc \u062f\u0648 \u0631\u0646\u06af \u0641\u0627\u062c", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u06a9\u0627\u0645\u0644\u0627 \u0644\u0647 \u0648. \u0644\u0648\u0631\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0646 \u0631\u0633\u06cc\u062f\u0647\u062d\u06cc\u0641 \u067e\u0648\u0644\n\u06f2\u06f0\u06f0\u06af\u0631\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0645 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u06af\u0627\u062a\u0627 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627 \u0644\u0627\u06cc\u0647 \u06cc \u0631\u0648\u06cc\u06cc\u0634 \u0628\u0648\u06cc \u062a\u062e\u0645 \u0645\u0631\u063a \u0645\u06cc\u062f\u0646 \u0648\u0644\u06cc \u0633\u0627\u06cc\u0632\u0634\u0648\u0646 \u0628\u0632\u0631\u06af\u0647. \u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc\u0647\u0627 \u06cc\u06a9 \u06a9\u06cc\u0644\u0648\u0634 \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f\u0647 \u0648 \u06a9\u0645\u06cc \u0647\u0645 \u0628\u0648\u06cc \u0631\u0648\u063a\u0646 \u0645\u0648\u0646\u062f\u0647 \u0645\u06cc\u062f\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u06cc\u0631\u0627\u0634\u06a9\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc (\u06cc\u06a9 \u06a9\u06cc\u0644\u0648 \u06af\u0631\u0645)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0627\u06cc \u062a\u0645\u06cc\u0632 \u0648 \u0645\u0646\u0627\u0633\u0628. \u062a\u0634\u06a9\u0631 \u0627\u0632 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0648 \u067e\u06cc\u06a9 \u0647\u0627\u06cc \u0645\u0634\u062a\u0631\u06cc \u0645\u062f\u0627\u0631 \u0648 \u0645\u062d\u062a\u0631\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0642\u0646\u062f\u06cc \u062e\u0631\u0645\u0627\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0628\u0648\u0633 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0631\u062f\u0648\u0631 \u062c\u0648 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", 1]}
{"text": ["\u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646\u060c\u0633\u0631\u06cc\u0639 \u0647\u0645 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f.\u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0686\u0627\u0628\u0627\u062a\u0627 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u0628\u0631\u0646\u062c\u06cc (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0628\u0647\u062a\u0631\u06cc\u0646 \u06a9\u06cc\u06a9 \u0634\u06a9\u0644\u0627\u062a\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c  \u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648 \u0627\u0633\u0646\u067e ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u0646 \u0627\u0646\u06af\u0627\u0631 \u06af\u0648\u0634\u062a \u06a9\u0648\u0628\u06cc\u062f\u0647 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u0645  \u062a\u0645\u0627\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0644\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0633\u0644\u0627\u0645 \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u064a \u0647\u0627 \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u064a\u0645 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0641\u0642\u0637 \u0628\u064a\u0633\u0643\u0627\u062a\u064a \u0634\u0643\u0644\u0627\u062a\u064a\u0648 \u062e\u0648\u0627\u0633\u062a\u064a\u0645 \u0627\u0645\u062a\u062d\u0627\u0646 \u0643\u0646\u064a\u0645 \u0643\u0647 \u062e\u064a\u0644\u064a \u0633\u0641\u062a \u0648 \u062e\u0634\u0643 \u0628\u0648\u062f \u0628\u0647 \u0637\u0648\u0631\u064a \u0643\u0647 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0628\u0644 \u0686\u0627\u06a9\u0644\u062a \u06a9\u0648\u06a9\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0634\u0643\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0643\u064a\u0643 \u0628\u0647 \u062c\u0639\u0628\u0647 \u0686\u0633\u0628\u064a\u062f\u0647 \u0628\u0648\u062f \u0648 \u0638\u0627\u0647\u0631\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0643\u064a\u0643 \u0633\u064a\u0628 \u0648 \u0643\u0627\u0631\u0627\u0645\u0644 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0627\u064a\u0646 \u0628\u0627\u0631 \u062f\u0648\u0645\u064a \u0647\u0633\u062a \u0643\u0647 \u0643\u064a\u0643 \u0627\u0632 \u0637\u0631\u064a\u0642 \u0627\u0633\u062a\u067e \u0641\u0648\u062f \u0627\u0648\u0631\u062f\u0647 \u0645\u064a\u0634\u0647 \u0648 \u0643\u064a\u0643 \u0628\u0647 \u0628\u063a\u0644 \u0647\u0627\u064a \u062c\u0639\u0628\u0647 \u06af\u0631\u0641\u062a\u0647 \u0634\u062f\u0647 \u0648 \u0627\u0632 \u0634\u0643\u0644 \u0637\u0628\u064a\u0639\u064a \u062f\u0631\u0645\u064a\u0627\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", 1]}
{"text": ["\u0633\u06cc\u0628 \u06af\u0631\u062f\u0648 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc\u0647...", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u06a9\u0648\u0686\u06cc\u06a9\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0628\u0647 \u0645\u0648\u0642\u0639 \u0631\u0633\u06cc\u062f \u0648 \u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u0686\u064a\u0632 \u0643\u064a\u0643 \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u0649 \u0645\u0634\u062e\u0635 \u0628\u0648\u062f \u0643\u0647 \u067e\u064a\u0643 \u0627\u0632 \u062f\u0633\u062a\u0634 \u0627\u0641\u062a\u0627\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0643\u0631\u0627\u0645\u0628\u0644 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0645\u0645\u0646\u0648\u0646\n\u0686\u064a\u0632\u0643\u064a\u0643 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637 \u060c \u0627\u0644\u0628\u062a\u0647 \u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0631\u0648\u0633\u062a\u06cc\u06a9 \u0641\u0631\u0646\u0686", "\u0627\u0648\u062a \u0643\u0648\u0643\u06cc \u0686\u0627\u0643\u0644\u062a", "\u06a9\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0647\u0631 \u0628\u0627\u0631 \u0643\u0647 \u0633\u0641\u0627\u0631\u0634 \u0645\u064a\u062f\u0645 \u0628\u0647 \u0646\u0633\u0628\u062a \u062f\u0641\u0639\u0647 \u0642\u0628\u0644 \u062d\u062c\u0645 \u0628\u0631\u0627\u0646\u064a \u0643\u0645\u062a\u0631 \u0645\u064a\u0634\u0647. \u062f\u0631\u0633\u062a\u0647 \u0642\u064a\u0645\u062a \u0631\u0648 \u062b\u0627\u0628\u062a \u0646\u06af\u0647 \u062f\u0627\u0634\u062a\u0646\u060c \u0648\u0644\u064a \u0627\u0632 \u062d\u062c\u0645 \u0628\u0647 \u0637\u0631\u0632 \u0642\u0627\u0628\u0644 \u062a\u0648\u062c\u0647\u064a \u0643\u0645 \u0643\u0631\u062f\u0646. \n\u0627\u0644\u0628\u062a\u0647 \u0637\u0639\u0645\u0634 \u0639\u0627\u0644\u064a\u0647. \u0648\u0644\u064a \u0628\u0647 \u0646\u0633\u0628\u062a \u0627\u064a\u0646 \u062d\u062c\u0645 \u0643\u0645( \u0642\u062f\u0631 \u064a\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0645\u0639\u0645\u0648\u0644\u064a) \u0669\u0660\u0660\u0660 \u062a\u0648\u0645\u0646 \u062e\u064a\u0644\u064a \u0632\u064a\u0627\u062f\u0647. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u0628\u0633\u062a\u0647 \u062e\u06cc\u0644\u06cc \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0647 \u0631\u0648\u06cc \u0647\u0645\u0647 \u06a9\u06cc\u06a9 \u0647\u0627 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0647\u0645\u0647 \u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062a\u0648\u0633\u0637 \u067e\u06cc\u06a9 \u062a\u06a9\u0627\u0646 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u06cc\u0631\u06cc\u0646\u06cc \u06a9\u0634\u0645\u0634\u06cc", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646.\u062e\u06cc\u0644\u06cc\u0645 \u062e\u0648\u0628\u0647 \u06a9 \u062d\u062f\u0627\u0642\u0644 \u0633\u0641\u0627\u0631\u0634\u0634 \u06f5 \u062a\u0648\u0645\u0646\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u0635\u062f\u0641\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f\u0646\u062f ..\u062f\u0648\u0646\u0627\u062a \u0647\u0627 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f \u0648\u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0645\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u0644 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0631\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0633\u06cc\u0646\u06cc \u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u06a9\u0647 \u0646\u0648\u0634\u062a\u0647 \u0628\u0648\u062f \u06f1\u06f0 \u0639\u062f\u062f\u06cc \u0648\u0644\u06cc \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0627\u0648\u0631\u062f\u0646 \u06f5 \u062a\u0627\u06cc\u06cc\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0645\u06cc\u0646\u06cc \u0644\u0642\u0645\u0647 \u0627\u06cc \u0628\u0644\u0646\u062f \u0645\u06a9  (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06a9\u0631\u0627\u0633\u0627\u0646 \u0647\u0627\u062a \u062f\u0627\u06af \u0628\u0627 \u067e\u0646\u06cc\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u062f \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u062f\u0648\u0646\u0627\u062a \u0634\u06a9\u0644\u0627\u062a\u06cc \u06a9\u0631\u0645 \u062f\u0627\u0631 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0646\u0627\u0646 \u0647\u0627 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u0646\u062f\n\u0648 \u0628\u0627 \u0622\u0631\u062f \u0628\u0633\u06cc\u0627\u0631 \u0628\u0627\u06a9\u06cc\u0641\u06cc\u062a\u06cc \u062a\u0647\u06cc\u0647 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0686\u0627\u0631\u06a9\u06cc \u062c\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0646\u0627\u0646 \u062a\u0633\u062a \u0627\u0631\u062f\u0648\u0631 \u0633\u0627\u062f\u0647 (\u06cc\u06a9 \u0639\u062f\u062f)", "\u06af\u0627\u062a\u0627 \u06a9\u0631\u0647 \u0627\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", "\u0634\u06cc\u0631\u0645\u0627\u0644 \u06af\u06cc\u0633\u0648 (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc \u0639\u0627\u0644\u06cc\u06cc\u0647\u0647\u0647\u0647\u0647\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0646\u0627\u0646 \u0644\u0642\u0645\u0647 \u0627\u06cc \u06af\u0631\u062f \u062c\u0648 (\u06cc\u06a9 \u0628\u0633\u062a\u0647)", "\u0628\u0627\u06af\u062a \u0633\u0627\u0646\u062f\u0648\u06cc\u0686\u06cc \u0633\u0627\u062f\u0647", "\u06af\u0627\u062a\u0627 \u06af\u0631\u062f\u0648\u06cc\u06cc (\u06cc\u06a9 \u0639\u062f\u062f)", 1]}
{"text": ["\u0628\u0631\u0627\u0646\u064a \u0643\u0627\u0631\u0627\u0645\u0644 \u0643\u064a\u0641\u064a\u062a \u0628\u0633\u064a\u0627\u0631 \u067e\u0627\u064a\u064a\u0646\u064a \u062f\u0627\u0634\u062a \u0648 \u0639\u0644\u064a \u0631\u063a\u0645 \u0642\u064a\u0645\u062a \u0668\u0660\u0660\u0660 \u062a\u0648\u0645\u0646\u060c \u062d\u062c\u0645 \u062e\u064a\u0644\u064a \u0643\u0648\u0686\u0643 \u0628\u0648\u062f \u0648 \u0627\u0632 \u0642\u0633\u0645\u062a\u0647\u0627\u064a \u062a\u0647 \u062f\u064a\u06af \u0634\u062f\u0647 \u0643\u064a\u0643 \u0628\u0631\u0627\u064a \u0645\u0646 \u0627\u0631\u0633\u0627\u0644 \u0643\u0631\u062f\u0647 \u0628\u0648\u062f\u0646\u062f. \n\u0642\u064a\u0645\u062a \u067e\u064a\u0643 (\u0665\u0660\u0660\u0660) \u0647\u0645 \u0639\u0644\u064a \u0631\u063a\u0645 \u0627\u064a\u0646\u0643\u0647 \u0645\u0646 \u062f\u0631 \u062c\u0631\u062f\u0646 \u0648 \u0686\u0646\u062f \u0643\u0648\u0686\u0647 \u067e\u0627\u064a\u064a\u0646 \u062a\u0631 \u0647\u0633\u062a\u0645 \u062e\u064a\u0644\u064a \u0628\u0627\u0628\u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0647\u0645\u0647 \u0686\u064a\u0632 \u0639\u0627\u0644\u0649 \u0628\u0648\u062f \u0645\u0631\u0633\u0649", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0648 \u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639 \u0647\u0645 \u0622\u0648\u0631\u062f\u0646\u062f. \u062a\u0634\u06a9\u0631 \u0641\u0631\u0627\u0648\u0627\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc \u0634\u0639\u0644\u0647 \u0631\u0646\u06af\u06cc", "\u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c", 1]}
{"text": ["\u0647\u0631\u0686\u0646\u062f \u0645\u0646 \u067e\u0648\u062f\u06cc\u0646\u06af \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0632\u0646\u06af \u0632\u062f\u0646 \u0648 \u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0641\u0644 \u0628\u0631\u0627\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0627\u0645\u0627 \u0637\u0639\u0645\u0634 \u062e\u0648\u0628 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0633\u0647", "\u0634\u0645\u0639 \u067e\u0646\u062c", "\u06a9\u06cc\u06a9 \u062a\u0631\u0627\u0641\u0644 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0631\u0627 \u062f\u0631 \u0627\u06cc\u0646 \u0628\u0627\u06a9\u0633 \u0628\u0627\u0634\u062f \u062e\u06cc\u0644\u06cc \u0628\u0647\u062a\u0631 \u0647\u0633\u062a\n\u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0628\u0631\u0627\u06cc \u062f\u06cc\u06af\u0631\u0627\u0646 \u0622\u0634\u0646\u0627 \u0646\u06cc\u0633\u062a \u0648 \u0628\u0627\u0628 \u0646\u06cc\u0633\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645 \u0627\u0645\u0627 \u067e\u0633 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634 \u0628\u0627 \u0645\u0646 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u06cc\u062f \u06a9\u0647 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0631\u06cc \u0628\u0631\u0627\u062a\u0648\u0646 \u0645\u06cc\u0641\u0631\u0633\u062a\u06cc\u0645! \u0648\u0642\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u0627\u0646\u0644\u0627\u06cc\u0646\u0647 \u0628\u0627\u06cc\u062f \u0645\u0648\u062c\u0648\u062f\u06cc \u0627\u067e\u062f\u06cc\u062a \u0628\u0627\u0634\u0647 \u06a9\u0647 \u0627\u06af\u0631 \u0686\u06cc\u0632\u06cc \u0645\u0648\u062c\u0648\u062f \u0646\u06cc\u0633\u062a \u0627\u06cc\u06a9\u0648\u0646\u0634 \u062e\u0627\u0645\u0648\u0634 \u0628\u0634\u0647!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u067e\u0627\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u060c \u0628\u0647 \u0631\u0627\u062d\u062a\u06cc \u062a\u0648 \u0645\u0627\u06a9\u0631\u0648 \u06af\u0631\u0645 \u0634\u062f\u060c \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0639\u0627\u0644\u06cc \u0648 \u0632\u06cc\u0628\u0627 \u062f\u0627\u0634\u062a\n\u0632\u0645\u0627\u0646 \u0627\u0631\u0633\u0627\u0644 \u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f\u060c \u062d\u062f\u0648\u062f\u0627 \u067e\u0627\u0646\u0632\u062f\u0647 \u062f\u0642\u06cc\u0642\u0647 \u0632\u0648\u062f\u062a\u0631 \u0627\u0632 \u0645\u0648\u0639\u062f \u0631\u0633\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0628\u0627\u0642\u06cc \u0645\u062d\u0635\u0648\u0644\u0627\u062a\u0634\u0648\u0646 \u0627\u0632 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0637\u0639\u0645 \u067e\u0627\u06cc\u06cc\u0646\u200c\u062a\u0631\u06cc \u0628\u0631\u062e\u0648\u0631\u062f\u0627\u0631 \u0628\u0648\u062f \u0648 \u062e\u0627\u0645\u0647\u200c\u06cc \u0631\u0648\u06cc \u06a9\u06cc\u06a9 \u0634\u062f\u06cc\u062f\u0627 \u0632\u06cc\u0627\u062f \u0628\u0648\u062f\u0634", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u06a9\u0627\u067e\u0648\u0686\u06cc\u0646\u0648 (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645\u060c \u0633\u0631\u06cc\u0639 \u0648 \u06a9\u0627\u0645\u0644\u0627 \u0647\u0645 \u0633\u0627\u0644\u0645 \u0631\u0633\u06cc\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", 1]}
{"text": ["\u0633\u0647 \u0628\u0627\u0631 \u062a\u0645\u0627\u0633 \u06af\u0631\u0641\u062a\u0646\u062f \u0627\u06cc\u0646\u0648 \u0646\u062f\u0627\u0631\u06cc\u0645 \u062c\u0627\u0634 \u0627\u0648\u0646\u0648 \u0628\u0641\u0631\u0633\u062a\u06cc\u0645. \u0627\u0635\u0644\u0627 \u062e\u0648\u0634\u0645 \u0646\u06cc\u0648\u0645\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u067e\u0627\u0649 \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u062e\u0648\u0634\u0645\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0647\u0645\u0647 \u0645\u0647\u0645\u0627\u0646\u0647\u0627 \u0646\u0638\u0631\u0634\u0648\u0646 \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648\u200c\u06a9\u0627\u0631\u0627\u0645\u0644 \u0632\u06cc\u0627\u062f\u06cc \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 (\u0645\u062a\u0648\u0633\u0637)", "\u0634\u0645\u0639 \u0645\u062f\u0627\u062f\u06cc \u0637\u0644\u0627\u06cc\u06cc", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u200c\u0637\u0639\u0645 \u060c \u062a\u0627\u0632\u0647 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f \n\u0628\u0633\u062a\u0647\u200c\u0628\u0646\u062f\u06cc \u0632\u06cc\u0628\u0627 \u0648 \u0628\u0627 \u0633\u0644\u06cc\u0642\u0647 \n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", "\u0645\u0631\u0628\u0627 \u0642\u06cc\u0633\u06cc \u0632\u0631\u062f\u0627\u0644\u0648 \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0645\u0639\u0645\u0648\u0644\u06cc :", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u067e\u064a\u0646\u0627\u062a \u0628\u0627\u062a\u0631", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", -1]}
{"text": ["\u0646\u0635\u0628\u062a \u0628\u0647 \u0639\u06a9\u0633 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0645\u0645\u0646\u0648\u0646 \u0627\u0632 \u0647\u0645\u0627\u0647\u0646\u06af\u06cc\u0647\u0627\u06cc \u0634\u0639\u0628\u0647 \u062c\u0631\u062f\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f.\u0628\u0647\u062a\u0631\u06cc\u0646\u200c \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u06cc \u0628\u0648\u062f \u06a9\u0647\u200c\u062a\u0627 \u062d\u0627\u0644\u0627 \u062e\u0648\u0631\u062f\u0647 \u0628\u0648\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062f\u0631 \u062a\u0635\u0627\u0648\u06cc\u0631 \u0628\u0631\u0627\u0648\u0646\u06cc \u0631\u0627 \u062f\u0648 \u0639\u062f\u062f \u0646\u0634\u0627\u0646 \u0645\u06cc\u062f\u0647\u062f \u0627\u0645\u0627 \u0648\u0642\u062a\u06cc \u0633\u0641\u0627\u0631\u0634 \u0645\u06cc \u062f\u0647\u06cc\u062f \u0641\u0642\u0637 \u06cc\u06a9\u06cc \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc \u0634\u0648\u062f \u0628\u0627 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0635\u0648\u06cc\u0631 \u0627\u06cc\u0646 \u0641\u0631\u0636 \u0631\u0627 \u0627\u06cc\u062c\u0627\u062f \u0645\u06cc \u06a9\u0646\u062f \u06a9\u062e \u062f\u0648 \u062a\u06a9\u0647 \u0627\u0633\u062a. \u062a\u06a9\u0647 \u0647\u0627\u06cc \u0628\u0631\u0627\u0646\u06cc \u0647\u0645 \u0622\u0646\u0642\u062f\u0631\u200c \u06a9\u0648\u0686\u06a9 \u0647\u0633\u062a\u0646\u062f \u06a9\u0647 \u0622\u062f\u0645 \u062d\u06cc\u0641\u0634 \u0645\u06cc\u0627\u062f \u0628\u062e\u0648\u0631\u0647 ! \u062a\u0642\u0631\u06cc\u0628\u0627 \u06cc\u06a9 \u0645\u0631\u0628\u0639 4 \u062f\u0631 4 \u0633\u0627\u0646\u062a\u06cc\u0645\u062a\u0631 \u0628\u0647 \u0636\u062e\u0627\u0645\u062a 2 \u0633\u0627\u0646\u062a.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u0647\u0645 \u06a9\u06cc\u0641\u06cc\u062a \u0639\u0627\u0644\u06cc \u0647\u0645 \u0633\u0631\u0639\u062a \u062f\u0644\u06cc\u0648\u0631\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0628\u0642\u062f\u0631\u06cc \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0642\u0627\u0628\u0644 \u062e\u0648\u0631\u062f\u0646 \u0646\u0628\u0648\u062f . \u0648\u0627\u0642\u0639\u0627 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645\u0686\u06cc\u0646 \u062a\u0648\u0642\u0639\u06cc \u0646\u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", "\u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06a9\u0627\u0631\u0627\u0645\u0644", -1]}
{"text": ["\u0628\u0647 \u062c\u0631\u0627\u062a \u0645\u06cc\u062a\u0648\u0646\u0645 \u0628\u06af\u0645 \u0628\u0647\u062a\u0631\u06cc\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u06cc \u0628\u0648\u062f \u06a9\u0647 \u062e\u0648\u0631\u062f\u0645. \u06a9\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644: \u0628\u0633\u06cc\u0627\u0631 \u0647\u06cc\u062c\u0627\u0646 \u0627\u0646\u06af\u06cc\u0632 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647. \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0648 \u0637\u0639\u0645 \u0628\u0633\u06cc\u0627\u0631 \u0639\u0627\u0644\u06cc \u062f\u0627\u0634\u062a. \u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u062e\u0648\u0628 \u0628\u0631\u0627\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u062f\u0631 \u06a9\u0646\u0627\u0631 \u0686\u0627\u06cc\u06cc \u0648 \u0642\u0647\u0648\u0647. \u0641\u0642\u0637 \u06cc\u06a9 \u0645\u0648\u0631\u062f \u0645\u06cc\u062e\u0648\u0627\u0645 \u0628\u0647 \u062f\u0648\u0633\u062a\u0627\u0646\u06cc \u06a9\u0647 \u0645\u062b\u0644 \u0645\u0646 \u0634\u06a9\u0645\u0648 \u0646\u06cc\u0633\u062a\u0646\u062f \u0627\u0634\u0627\u0631\u0647 \u06a9\u0646\u0645 \u06a9\u0647 \u0647\u0645\u06cc\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06cc\u06a9 \u0646\u0641\u0631\u0647 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u0627\u0646\u062f\u0627\u0632\u0647 \u062e\u0648\u0628 \u0648 \u0628\u0632\u0631\u06af\u0634 \u0645\u06cc\u062a\u0648\u0646\u0647 \u0628\u0631\u0627\u06cc \u062f\u0648 \u0646\u0641\u0631 \u06a9\u0647 \u0634\u06a9\u0645\u0648 \u0646\u06cc\u0633\u062a\u0646\u062f \u06a9\u0627\u0645\u0644\u0627 \u06a9\u0641\u0627\u06cc\u062a \u06a9\u0646\u0647. \u0646\u06a9\u062a\u0647 \u062e\u0648\u0628 \u062f\u06cc\u06af\u0631 \u0627\u06cc\u0646\u06a9\u0647 \u0628\u0627 \u062e\u0648\u0631\u062f\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u06cc \u06a9\u0627\u0631\u0627\u0645\u0644\u06cc\u060c \u0627\u0632 \u0637\u0639\u0645 \u0632\u062f\u0647 \u0646\u0645\u06cc\u0634\u06cc\u0645 \u060c \u0628\u0639\u0636\u06cc \u0627\u0648\u0642\u0627\u062a \u0637\u0639\u0645 \u0628\u0631\u062e\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627 \u062c\u0648\u0631\u06cc \u0645\u06cc\u0634\u0647 \u06a9\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0632\u062f\u0647 \u0645\u06cc\u0634\u06cc\u0645 \u0648\u0644\u06cc \u062f\u0631 \u0645\u0648\u0631\u062f \u0627\u06cc\u0646 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9\u060c \u0647\u0645\u0647 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0645 \u062e\u0648\u0631\u062f\u0647 \u0628\u0634\u0647 \u0644\u0630\u062a \u0637\u0639\u0645 \u0628\u0627\u0642\u06cc \u0645\u06cc\u0645\u0648\u0646\u0647 . \n\u0633\u0648\u0641\u0644\u0647 \u0634\u06a9\u0644\u0627\u062a: \u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0627 \u0686\u06af\u0627\u0644\u06cc \u0632\u06cc\u0627\u062f \u0648 \u0627\u0646\u0628\u0627\u0634\u062a\u0647 \u0627\u0632 \u0634\u06a9\u0644\u0627\u062a \u062e\u0648\u0634\u0645\u0632\u0647. \u0637\u0639\u0645 \u0634\u06a9\u0644\u0627\u062a\u0634 \u0646\u0647 \u0628\u0647 \u0634\u06a9\u0644\u0627\u062a \u0634\u06cc\u0631\u06cc \u0645\u06cc\u0632\u062f \u0646\u0647 \u0628\u0647 \u0634\u06a9\u0644\u0627\u062a \u062a\u0644\u062e \u0648\u0644\u06cc \u06cc\u06a9 \u0637\u0639\u0645 \u0634\u06a9\u0644\u0627\u062a\u06cc \u0645\u0644\u0627\u06cc\u0645 \u062f\u0627\u0634\u062a \u06a9\u0647 \u062a\u0634\u0648\u06cc\u0642 \u0645\u06cc\u0634\u06cc\u0645 \u062a\u0627 \u0627\u0646\u062a\u0647\u0627 \u0628\u062e\u0648\u0631\u06cc\u0645. \u0627\u0646\u062f\u0627\u0632\u0647 \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0646\u0641\u0631 \u06a9\u0647 \u0634\u06a9\u0645\u0648 \u0646\u0628\u0627\u0634\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628\u0647 . \u0627\u0644\u0628\u062a\u0647 \u0686\u06af\u0627\u0644\u06cc \u0632\u06cc\u0627\u062f \u0634\u06a9\u0644\u0627\u062a \u06a9\u0627\u0645\u0644\u0627 \u0633\u06cc\u0631 \u0645\u06cc\u06a9\u0646\u0647\u060c \u062e\u0648\u0634\u0645\u0632\u0647 \u0644\u0630\u062a \u0628\u062e\u0634\u06cc \u0628\u0648\u062f.\n\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634\u06cc \u0648 \u0647\u0648\u06cc\u062c \u0628\u0644\u0648\u06a9\u06cc:  \u06a9\u06cc\u06a9\u0647\u0627\u06cc \u0635\u0628\u062d\u0627\u0646\u0647 \u062f\u0631 \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u0647\u0627\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0634\u06cc\u06a9. \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u0648\u0646 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0646\u0635\u0641 \u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0647\u0627\u06cc\u06cc \u0647\u0633\u062a \u06a9\u0647 \u062f\u0631 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0647\u0627\u06cc \u0639\u0627\u062f\u06cc \u0645\u06cc\u0628\u06cc\u0646\u06cc\u0645 \u0648\u0644\u06cc \u0686\u06af\u0627\u0644\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u0622\u0646\u0647\u0627 \u0647\u0633\u062a \u0628\u0646\u0627\u0628\u0631\u0627\u06cc\u0646 \u0628\u0627 \u062c\u062b\u0647 \u06a9\u0648\u0686\u06a9 \u0648\u0632\u0646 \u0628\u06cc\u0634\u062a\u0631\u06cc \u062f\u0627\u0631\u0646\u062f. \u0627\u0648\u0644\u06cc\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0628\u0627 \u062f\u06cc\u062f\u0646 \u0627\u06cc\u0646 \u06a9\u06cc\u06a9 \u0647\u0627\u06cc \u0635\u0628\u062d\u0627\u0646\u0647 \u062f\u0648\u0633\u062a \u062f\u0627\u0634\u062a\u0646\u06cc \u0628\u0647 \u0630\u0647\u0646\u0645 \u0631\u0633\u06cc\u062f \u0627\u06cc\u0646 \u0628\u0648\u062f \u06a9\u0647 \u0648\u0642\u062a\u06cc \u0645\u06cc\u062e\u0648\u0627\u0645 \u0628\u0631\u0627\u06cc \u062f\u06cc\u062f\u0627\u0631 \u0628\u0647 \u062e\u0648\u0646\u0647 \u062f\u0648\u0633\u062a\u06cc \u0648 \u0622\u0634\u0646\u0627\u06cc\u06cc \u0628\u0631\u0645 \u0645\u06cc\u062a\u0648\u0646\u0645 \u0647\u0645\u0631\u0627\u0647 \u062e\u0648\u062f\u0645 \u06cc\u062f\u0648\u0646\u0647 \u0627\u0632 \u0627\u06cc\u0646\u0647\u0627 \u062a\u0647\u06cc\u0647 \u06a9\u0646\u0645 \u0647\u0645 \u062f\u0633\u062a \u062e\u0627\u0644\u06cc \u0646\u0645\u06cc\u0631\u0645 \u0647\u0645 \u06cc\u0647 \u0633\u0648\u067e\u0631\u0627\u06cc\u0632 \u062e\u06cc\u0644\u06cc \u0634\u06cc\u06a9 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u06a9\u0645 \u0647\u0632\u06cc\u0646\u0647 \u0647\u0645\u0631\u0627\u0647\u0645 \u0645\u06cc\u0628\u0631\u0645.\n\u067e\u0627\u06cc \u0633\u06cc\u0628: \u0645\u0646\u0627\u0633\u0628 \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0646\u0641\u0631 \u0647\u0633\u062a \u060c \u0638\u0627\u0647\u0631 \u06af\u0648\u0646\u062c\u0648\u0644\u06cc! \u062f\u0627\u0631\u0647 \u0648 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0647\u0633\u062a. \n\u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u062f\u0631 \u0633\u0644\u0627\u0645\u062a \u06a9\u0627\u0645\u0644 \u0631\u0633\u06cc\u062f.\n\u0628\u0631\u0627\u06cc \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u06cc \u062e\u0648\u0628\u062a\u0648\u0646 \u06a9\u0647 \u0644\u062d\u0638\u0627\u062a \u0642\u0634\u0646\u06af \u0648 \u062e\u0648\u0628\u06cc \u062f\u0631 \u062f\u0648\u0631\u0647\u0645\u06cc \u0639\u06cc\u062f\u0645\u0648\u0646 \u0633\u0628\u0628 \u0634\u062f\u0646 \u062b\u0628\u062a \u06a9\u0646\u06cc\u0645 \u0627\u0632\u062a\u0648\u0646 \u0645\u0645\u0646\u0648\u0646\u0645\u060c \u067e\u0627\u06cc\u062f\u0627\u0631 \u0648 \u0634\u0627\u062f \u0628\u0627\u0634\u06cc\u062f.\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u0628\u0644\u0648\u0643\u06cc", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u067e\u0627\u064a \u0622\u0644\u0628\u0627\u0644\u0648 \u0639\u0627\u0644\u064a \u0628\u0648\u062f. \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634 \u0637\u0639\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0633\u0631\u06cc\u0639\u062a\u0631 \u0627\u0632 \u0648\u0642\u062a \u067e\u06cc\u0634\u200c\u0628\u06cc\u0646\u06cc \u0634\u062f\u0647 \u0631\u0633\u06cc\u062f \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u0648 \u062a\u0627\u0632\u06af\u06cc \u0631\u0636\u0627\u06cc\u062a \u0628\u062e\u0634 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u0628\u0631\u0627\u0648\u0646\u06cc \u062a\u0648 \u0639\u06a9\u0633 \u06cc\u0637\u0648\u0631\u06cc \u0627\u0646\u062f\u0627\u062e\u062a\u0647 10*10 \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc\u0627\u062f \u0622\u0648\u0631\u062f 4*4 \u0628\u0648\u062f \u062e\u0648\u0631\u062f \u062a\u0648 \u0630\u0648\u0642\u0645...\n\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0627\u0632 \u0628\u062f \u0646\u0628\u0648\u062f \u0627\u0646\u062f\u0627\u0632\u0634 \u062c\u0627 \u062f\u0627\u0634\u062a \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0627\u0634\u0647.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u0627\u0635\u0644\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f \u0648 \u0645\u0632\u0647 \u0643\u064a\u0643 \u0647\u0627\u064a \u062d\u0627\u0636\u0631\u064a \u0645\u064a\u062f\u0627\u062f \u0627\u0632 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0627\u0646\u062a\u0638\u0627\u0631 \u0628\u064a\u0634\u062a\u0631\u064a \u062f\u0627\u0634\u062a\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u062e\u0627\u0645\u0647 \u06a9\u06cc\u06a9 \u062e\u06cc\u0644\u06cc \u062a\u0631\u0634 \u0634\u062f\u0647 \u0628\u0648\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", -1]}
{"text": ["\u067e\u0627\u06cc \u0633\u06cc\u0628\u062a\u0648\u0646 \u0639\u0627\u0627\u0627\u0627\u0627\u0627\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0648 \u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u067e\u0627\u06cc \u0627\u0644\u0628\u0627\u0644\u0648 \u0639\u0627\u0644\u06cc\u0647 \u06a9\u0631\u0627\u0645\u0628\u0644 \u0648 \u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0631\u0648 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0634\u062a\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u0633\u064a\u0628 \u0648 \u062f\u0627\u0631\u0686\u064a\u0646", 1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u0628\u0631\u0627\u0646\u06cc \u0627\u06cc \u06a9\u0647\u200c\u0645\u06cc\u0634\u0647 \u062a\u0648 \u06a9\u0644 \u062a\u0647\u0631\u0627\u0646 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u0641\u0627\u062c \u0643\u0648\u0643\u06cc", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u062e\u0645\u064a\u0631  \u0646\u0631\u0645 \u0648 \u062a\u0627\u0632\u0647 \u0627\u064a \u062f\u0627\u0634\u062a \u0648 \u0643\u0645\u064a \u0637\u0639\u0645 \u0632\u0646\u062c\u0628\u064a\u0644 \u0645\u064a \u062f\u0627\u062f \u062f\u0627\u062e\u0644\u0634 \u0647\u0645 \u067e\u0631 \u0627\u0632 \u0633\u064a\u0628 \u0628\u0648\u062f \u062f\u0631 \u0645\u062c\u0645\u0648\u0639 \u0627\u0632 \u0633\u0641\u0627\u0631\u0634\u0645 \u0631\u0627\u0636\u064a \u0628\u0648\u062f\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u062f\u0648\u200c\u0645\u062f\u0644 \u06a9\u06cc\u06a9 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0645\u060c \u062a\u0645\u0627\u0633 \u06a9\u0631\u0641\u062a\u0646\u062f \u06af\u0641\u062a\u0646\u062f \u0646\u062f\u0627\u0631\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u0635\u0641\u0631", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", 1]}
{"text": ["\u06af\u06cc\u0641\u062a\u06cc \u06a9\u0647 \u0628\u0631\u0627\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0646 \u0628\u0633\u06cc\u0627\u0631 \u0645\u0646\u0648 \u062e\u0648\u0634\u062d\u0627\u0644 \u06a9\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\u0646 . \u062e\u0645\u06cc\u0631 \u067e\u0627\u06cc \u0647\u0627 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0648 \u0646\u0631\u0645 \u0648 \u062a\u0631\u062f \u0628\u0648\u062f . \u062e\u06cc\u0644\u06cc \u0647\u0645 \u067e\u0631 \u0645\u0644\u0627\u062a \u0628\u0648\u062f\u0646 . \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u0639\u0627\u0644\u06cc \u0628\u0648\u062f . \u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u06cc \u0646\u0633\u0628\u062a \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0634 \u060c \u06af\u0631\u0648\u0646\u0647 .", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": [" \u062a\u0646\u0648\u0639 \u062f\u0631 \u0627\u0646\u062a\u062e\u0627\u0628 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062f\u0631 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0646\u06cc\u0633\u062a\u060c \u0628\u0633\u062a\u0646\u06cc \u0647\u0645 \u0647\u0645\u06cc\u0646\u0637\u0648\u0631\n\u0627\u06af\u0631 \u062a\u0646\u0648\u0639 \u0627\u06cc\u0646 \u06f2 \u062a\u0627 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0634\u0648\u062f \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0627\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0641\u0642\u0637 \u0627\u064a\u0646\u0643\u0647 \u0642\u064a\u0645\u062a\u0627\u0634 \u0645\u0642\u062f\u0627\u0631\u064a \u0628\u0627\u0644\u0627\u0633\u062a \u0648 \u0627\u064a\u0646\u0643\u0647 \u0628\u0627 \u0648\u0636\u0639\u064a\u062a \u067e\u064a\u0634 \u0627\u0648\u0645\u062f\u0647 \u0627\u0642\u062a\u0635\u0627\u062f\u064a \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633\u0645 \u0642\u064a\u0645\u062a\u0627\u0634 \u0631\u0648 \u0628\u0627\u0644\u0627\u062a\u0631 \u0628\u0631\u062f\u0647\n\u0645\u062b\u0644\u0627 \u0643\u064a\u0643 \u0635\u0628\u062d\u0627\u0646\u0647 \u0633\u064a\u0628 \u06af\u0631\u062f\u0648 \u0643\u0647 \u0645\u0646 \u0627\u0632\u0634 \u0645\u0637\u0644\u0639 \u0628\u0648\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0632\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc \u0639\u0627\u0644\u06cc. \u062f\u0631 \u0636\u0645\u0646 \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0639\u0632\u06cc\u0632 \u0628\u0631\u0627\u06cc \u0645\u0627 \u0647\u0645\u0631\u0627\u0647 \u0633\u0641\u0627\u0631\u0634\u200c\u0645\u0648\u0646 \u06cc\u0647 \u0646\u0648\u0646 \u0686\u0627\u067e\u0627\u062a\u0627 \u0647\u0645 \u0641\u0631\u0633\u062a\u0627\u062f\u0647 \u0628\u0648\u062f\u0646 \u06a9\u0647 \u0647\u0645 \u0641\u0648\u0642\u200c\u0627\u0644\u0639\u0627\u062f\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u0628\u0647\u0645\u0648\u0646 \u0686\u0633\u0628\u06cc\u062f. \u0648\u0627\u0642\u0639\u0646 \u0645\u0645\u0646\u0648\u0646. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u0627\u062f\u0647", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u06a9\u0627\u0634 \u0647\u0645\u0631\u0627\u0647 \u0628\u0631\u0627\u0646\u06cc \u0686\u0646\u06af\u0627\u0644 \u062f\u0627\u0634\u062a ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0627\u0644\u06cc \u0648 \u062a\u0627\u0632\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0643\u0648\u0686\u06a9)", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u062e\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u063a\u06cc\u0631 \u0627\u0632 \u0645\u0632\u0647 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f\u060c \u0646\u06a9\u062a\u0647 \u0627\u06cc \u06a9\u0647 \u0628\u0627\u06cc\u062f \u062f\u0631 \u0645\u0648\u0631\u062f \u0627\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0628\u06af\u0645 \u0627\u06cc\u0646 \u0647\u0633\u062a \u06a9\u0647 \u0639\u06a9\u0633 \u0648 \u062a\u0648\u0635\u06cc\u0641\u06cc \u06a9\u0647 \u0627\u0632 \u06a9\u06cc\u06a9 \u06cc\u0627 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u06af\u0630\u0627\u0634\u062a\u0647 \u0627\u0646\u062f \u062f\u0642\u06cc\u0642\u0627 \u0645\u0637\u0627\u0628\u0642 \u0647\u0645\u0627\u0646 \u0686\u06cc\u0632\u06cc \u0627\u0633\u062a \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0634\u0645\u0627 \u0645\u06cc \u062f\u0647\u0646\u062f \u0648 \u0627\u06cc\u0646 \u062e\u06cc\u0644\u06cc \u0645\u0647\u0645 \u0647\u0633\u062a\u060c \u0686\u0648\u0646 \u0628\u0631\u0627\u06cc \u0645\u0646 \u067e\u06cc\u0634 \u0622\u0645\u062f\u0647 \u06a9\u0647 \u0627\u0632 \u06cc\u06a9 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u0631\u0648\u06cc \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u06a9\u06cc\u06a9 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0647 \u0627\u0645 \u0648\u0644\u06cc \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0622\u0646\u0686\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u0646 \u062f\u0627\u062f\u0647 \u0627\u0646\u062f \u0645\u0637\u0627\u0628\u0642 \u0628\u0627 \u062a\u0648\u0635\u06cc\u0641 \u0646\u0628\u0648\u062f\u0647! \u0648\u0644\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0647\u0645\u06cc\u0634\u0647 \u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0647 \u0627\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c (\u0628\u0632\u0631\u06af)", 1]}
{"text": ["\u0645\u06cc\u0632\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u06cc\u0634 \u0627\u0632 \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0648\u062f!\n\u0645\u062a\u0631\u06cc\u0627\u0644 \u062e\u06cc\u0644\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u0648 \u0642\u06cc\u0645\u062a \u0628\u0647 \u0646\u0633\u0628\u062a \u062e\u06cc\u0644\u06cc \u06af\u0631\u0627\u0646!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u0632\u06cc\u0628\u0627, \u0634\u06a9\u06cc\u0644 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647, \u0628\u0647 \u0645\u0648\u0642\u0639 \u0647\u0645 \u062a\u062d\u0648\u06cc\u0644 \u0634\u062f\n\n\u062a\u0634\u06a9\u0631 \u0627\u0632 \u0645\u062f\u06cc\u0631\u06cc\u062a \u0645\u062c\u0645\u0648\u0639\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", "Don't Even Ask", 1]}
{"text": ["\u0628\u0647\u062a\u0631\u06cc\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0641\u0631\u0648\u0634\u06cc \u062a\u0647\u0631\u0627\u0646 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u062e\u06cc\u0644\u06cc \u0628\u0627\u0644\u0627 \u0627\u0635\u0644\u0627 \u0646\u0645\u06cc \u0627\u0631\u0632\u06cc\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0647\u0644\u0648", -1]}
{"text": ["\u062e\u064a\u0644\u064a \u0645\u0645\u0646\u0648\u0646 \u0643\u0647 \u0628\u0627 \u0643\u064a\u0641\u064a\u062a \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u060c \u0628\u0633\u062a\u0647 \u0628\u0646\u062f\u064a \u0632\u064a\u0628\u0627 \u0648 \u062a\u0627\u0632\u06af\u064a \u0648 \u0637\u0639\u0645 \u0628\u064a \u0646\u0638\u064a\u0631 \u0628\u0647 \u0645\u0634\u062a\u0631\u064a\u0627\u0646\u062a\u0648\u0646 \u0627\u062d\u062a\u0631\u0627\u0645 \u0645\u064a\u06af\u0630\u0627\u0631\u064a\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", "\u067e\u0648\u062f\u064a\u0646\u06af (\u0643\u0648\u0686\u06a9)", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", 1]}
{"text": ["\u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u06a9\u06cc\u0641\u06cc\u062a \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0627\u06cc\u062f \u0628\u0647 \u0633\u0631\u0639\u062a \u0628\u0627\u0644\u0627\u06cc \u067e\u06cc\u06a9 \u0647\u0645 \u0627\u0634\u0627\u0631\u0647 \u06a9\u0631\u062f. \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f \u0648\u0644\u0649 \u0641\u0643\u0631 \u0646\u0645\u064a\u0643\u0631\u062f\u0645 \u0627\u064a\u0646\u0642\u062f\u0631 \u0643\u0648\u0686\u064a\u0643 \u0628\u0627\u0634\u0646! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", 1]}
{"text": ["Kheili khob bood cheese cake", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0633\u0627\u06cc\u0632 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0648\u0686\u06a9\u062a\u0631 \u0627\u0632 \u0645\u0639\u0645\u0648\u0644 \u0628\u0648\u062f! \u0627\u062d\u062a\u0645\u0627\u0644\u0627 \u0628\u0647 \u062e\u0627\u0637\u0631 \u062a\u062e\u0641\u06cc\u0641 \u0628\u0648\u062f\u0647!!!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", 1]}
{"text": ["\u067e\u06cc\u06a9 \u0639\u0627\u0644\u06cc \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0631\u0627\u0636\u06cc \u0628\u0648\u062f\u0645 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f\n\u062f\u0633\u062a\u0645 \u0627\u0634\u062a\u0628\u0627\u0647\u06cc \u0631\u0648\u06cc \u0646\u0627\u0631\u0627\u0636\u06cc \u062e\u0648\u0631\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0648\u0627\u0642\u0639\u0627 \u062a\u0627\u0632\u0647 \u0647\u0645 \u0628\u0648\u062f , \u06cc\u06a9\u0645 \u06af\u0631\u0648\u0646 \u0628\u0648\u062f \u0641\u0642\u0637 D:", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u06a9\u06cc\u06a9 \u0622\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f \u0627\u0632 \u06af\u0631\u0645\u0627 !!", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", -1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0648 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u067e\u0648\u062f\u06cc\u0646\u06af \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", 1]}
{"text": ["\u0633\u0631\u0648\u064a\u0633 \u062f\u0647\u064a \u0628\u0633\u064a\u0627\u0631 \u0639\u0627\u0644\u064a \u0628\u0648\u062f \u0645\u0631\u0633\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0631\u0646\u06af\u06cc\u0646 \u06a9\u0645\u0627\u0646 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0644\u0637\u0641\u0627 \u062f\u06cc\u06af\u0647 \u06af\u0648\u0634\u0647 \u0647\u0627\u06cc \u06a9\u06cc\u06a9 \u06a9\u0647 \u0633\u0641\u062a \u0648 \u0628\u06cc \u06a9\u06cc\u0641\u06cc\u062a \u0647\u0633\u062a\u0646\u062f \u0646\u0641\u0631\u0633\u062a\u06cc\u062f\n\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", 1]}
{"text": ["\u062d\u062c\u0645 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f \u0628\u0627\u06cc\u062f \u0627\u0628\u0639\u0627\u062f \u06a9\u06cc\u06a9 \u0647\u0627 \u0630\u06a9\u0631 \u0628\u0634\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0628\u0646\u062f \u0627\u0646\u06af\u0634\u062a \u0628\u0648\u062f \u0647\u0631 \u06a9\u062f\u0648\u0645 \u0648 \u0628\u063a\u06cc\u0631 \u0627\u0632 \u06cc\u06a9\u06cc \u062f\u0648\u062a\u0627\u0634 \u0628\u0642\u06cc\u0647 \u0628\u0633\u06cc\u0627\u0631 \u0628\u062f\u0637\u0639\u0645 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9 \u0628\u0648\u062f\u0646 \u06a9\u06cc\u06a9\u0627 .\u062a\u0648 \u0639\u06a9\u0633 \u0645\u0634\u062e\u0635 \u0646\u0628\u0648\u062f \u0627\u06cc\u0646\u0642\u062f \u0631\u06cc\u0632\u0646 .\u0647\u0631 \u06a9\u062f\u0648\u0645 \u062a\u0642\u0631\u06cc\u0628\u0627 \u0627\u0646\u062f\u0627\u0632\u0647 \u06cc\u0647 \u0644\u0642\u0645\u0647 \u0628\u0648\u062f \u06a9\u0647 \u0628\u0627 \u0642\u06cc\u0645\u062a\u06cc \u06a9\u0647 \u062f\u0627\u0634\u062a \u0627\u0646\u062a\u0638\u0627\u0631 \u0645\u06cc\u0631\u0641\u062a \u0628\u0632\u0631\u06af\u062a\u0631 \u0628\u0627\u0634\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u0646 \u0628\u064a\u0634 \u0627\u0632 \u0661\u0660 \u0628\u0627\u0631 \u0628\u0647 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u0633\u0641\u0627\u0631\u0634 \u062f\u0627\u062f\u0645! \u0647\u0645\u064a\u0634\u0647 \u0628\u0644\u0627 \u0627\u0633\u062a\u062b\u0646\u0627\u0621 \u064a\u0643 \u0686\u064a\u0632\u064a \u0631\u0648 \u0646\u062f\u0627\u0631\u0647! \u0643\u064a\u0643 \u0633\u0627\u062f\u0647 \u0645\u064a \u062e\u0648\u0627\u064a \u060c \u0634\u0643\u0644\u0627\u062a\u064a \u062f\u0627\u0631\u0647! \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0645\u064a \u062e\u0648\u0627\u064a \u060c \u0647\u0648\u064a\u062c \u062f\u0627\u0631\u0647! \u0647\u0645\u064a\u0634\u0647\u0647\u0647\u0647\u0647\u0647! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u064a\u0633\u0643\u0627\u062a\u06cc \u0633\u0627\u062f\u0647", "\u0643\u064a\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u0634\u0643\u0644\u0627\u062a\u06cc", -1]}
{"text": ["\u0628\u0631\u06cc\u0648\u0634 \u0647\u0627 \u0645\u0642\u062f\u0627\u0631 \u06a9\u0645\u06cc \u062f\u0627\u0631\u0686\u06cc\u0646 \u0648 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0634\u062a\u0646\u062f\u060c \u0635\u0631\u0641\u0627 \u0646\u0627\u0646 \u0647\u0627 \u0637\u0639\u0645 \u062f\u0627\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f\u0646\u062f \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u062e\u0648\u0628 \u0628\u0648\u062f \u0648 \u0628\u0631\u0627\u06cc \u0627\u0648\u0646 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0646\u0645\u06cc \u062e\u0648\u0627\u0646 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0686\u0631\u0628 \u0648 \u067e\u0631\u0642\u0646\u062f \u0628\u062e\u0648\u0631\u0646\u060c\u200c\u0639\u0627\u0644\u06cc\u0647.\n\u062e\u0648\u062f \u0646\u0648\u0646\u0634 \u0647\u0645 \u062e\u06cc\u0644\u06cc \u062e\u06cc\u0644\u06cc \u062a\u0627\u0632\u0647 \u0628\u0648\u062f.\n\u0641\u06a9\u0631 \u06a9\u0646\u0645 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0645\u0648\u0631\u062f \u0639\u0644\u0627\u0642\u0647 \u0627\u0645 \u0631\u0648 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0645.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0648 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0628\u0631\u06cc\u0648\u0634 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0628\u0633\u06cc\u0627\u0631 \u062e\u0648\u0634 \u0637\u0639\u0645 \u0648 \u0628\u0627 \u06a9\u06cc\u0641\u06cc\u062a \u0628\u0648\u062f. ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u062a\u0627\u0631\u062a \u0645\u0627\u0631\u0633", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f \n\u0627\u0644\u0628\u062a\u0647 \u0646\u0648\u062a\u0644\u0627 \u0648 \u06a9\u0631\u0647 \u0648 \u062f\u0627\u0631\u0686\u06cc\u0646\u0634 \u062e\u06cc\u0644\u06cc \u06a9\u0645 \u0628\u0648\u062f \u0648 \u0641\u0642\u0637 flavor \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0634\u062a. \u0627\u0644\u0628\u062a\u0647 \u0645\u0627 \u062f\u0648\u0633 \u062f\u0627\u0634\u062a\u06cc\u0645 \u0686\u0648\u0646 \u0633\u0627\u0644\u0645 \u062a\u0631 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0648 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0628\u0631\u06cc\u0648\u0634 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0628\u0631\u062e\u0648\u0631\u062f \u0639\u0627\u0644\u064a \u0628\u0631\u0627\u064a \u067e\u064a\u06af\u064a\u0631\u064a \u0648 \u0647\u0645\u0686\u0646\u064a\u0646 \u0643\u064a\u0641\u064a\u062a \u0639\u0627\u0644\u064a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0634\u0645\u0639 \u0633\u0647", "\u0634\u0645\u0639 \u062f\u0648", 1]}
{"text": ["I love cookie box   ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c (\u0645\u062a\u0648\u0633\u0637)", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \n\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u0645\u0639 \u062f\u0648", "\u0634\u0645\u0639 \u0686\u0647\u0627\u0631", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0627\u0646\u062a\u0638\u0627\u0631 \u062f\u0627\u0634\u062a\u0645 \u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633 \u062a\u0627\u0632\u0647 \u062a\u0631 \u0646\u0648\u0646 \u0647\u0627\u0634 \u0648 \u0628\u0641\u0631\u0633\u062a\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0648 \u062f\u0627\u0631\u0686\u06cc\u0646", "\u0628\u0631\u06cc\u0648\u0634 \u06a9\u0631\u0647 \u0628\u0627\u062f\u0627\u0645 \u0632\u0645\u06cc\u0646\u06cc \u0648 \u0645\u0631\u0628\u0627", "\u0628\u0631\u06cc\u0648\u0634 \u0646\u0648\u062a\u0644\u0627", "\u0647\u0648\u0644 \u0645\u06cc\u0644 \u0644\u0648\u0641 \u067e\u0646\u06cc\u0631\u0648 \u0632\u06cc\u062a\u0648\u0646", 1]}
{"text": ["\u0637\u0639\u0645 \u062e\u0648\u0628\u06cc \u062f\u0627\u0634\u062a \u0627\u0645\u0627 \u0628\u0634\u062f\u062a \u06a9\u0631\u0645 \u0631\u0648\u0634 \u0634\u0644 \u0634\u062f\u0647 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0643\u064a\u0643 \u0628\u0633\u064a\u0627\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062a\u0627\u0632\u0647 \u0628\u0648\u062f\u060c \u062e\u064a\u0644\u0649 \u0633\u0631\u064a\u0639 \u0647\u0645 \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u064a\u062f\u060c \u0645\u0645\u0646\u0648\u0646\u0645 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0645\u062a\u0648\u0633\u0637", "\u0634\u0645\u0639 \u0635\u0641\u0631", 1]}
{"text": ["\u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0645\u062d\u0635\u0648\u0644 \u06a9\u0627\u0645\u0644 \u0646\u0628\u0648\u062f\n", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0628\u0644\u06a9 \u0641\u0627\u0631\u0633\u062a", -1]}
{"text": ["\u0639\u0627\u0644\u0649 \u0645\u062a\u0634\u0643\u0631\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0643\u0627\u067e\u0648\u0686\u064a\u0646\u0648", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", 1]}
{"text": ["\u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0628\u0627 \u0622\u0646 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u062a\u062d\u0648\u06cc\u0644 \u0645\u06cc \u062f\u0647\u0646\u062f \u0632\u0645\u06cc\u0646 \u062a\u0627 \u0622\u0633\u0645\u0627\u0646 \u0645\u062a\u0641\u0627\u0648\u062a \u0627\u0633\u062a\u060c \u062a\u0648\u06cc \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0645\u06cc\u0632\u0646\u0646 \u06f4\u060c \u06f5 \u0646\u0641\u0631\u0647 \u062f\u0631 \u0622\u062e\u0631 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0628\u0647 \u062f\u0633\u062a\u062a\u0648\u0646 \u0645\u06cc\u0631\u0633\u0647 \u0634\u0627\u06cc\u062f \u0628\u0647 \u0632\u0648\u0631 \u06cc\u06a9 \u0646\u0641\u0631\n\u0642\u06cc\u0645\u062a \u0627\u0644\u06a9\u06cc \u06af\u0631\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u062e\u06cc\u0644\u06cc \u0632\u0648\u062f \u0628\u0647 \u062f\u0633\u062a\u0645 \u0631\u0633\u06cc\u062f \u0648 \u0628\u0633\u06cc\u0627\u0631 \u062a\u0627\u0632\u0647 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u0628\u0648\u062f.\u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u06a9\u0648\u0686\u06a9", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", 1]}
{"text": ["\u0633\u067e\u0627\u0633 \u0627\u0632 \u0632\u062d\u0645\u062a \u0634\u0645\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 3 (700 \u06af\u0631\u0645)", "\u06a9\u06cc\u06a9 \u0635\u0628\u062d\u0627\u0646\u0647 \u06a9\u0634\u0645\u0634", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", 1]}
{"text": ["\u06cc\u06a9 \u062c\u0639\u0628\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0627\u0632 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 = \u0686\u0646\u062f\u06cc\u0646 \u0631\u0648\u0632 \u062e\u0648\u0634\u062d\u0627\u0644\u06cc \u06a9\u0646\u0627\u0631 \u0686\u0627\u06cc \u0635\u0628\u062d \u0648 \u0639\u0635\u0631! ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u06cc\u0646\u06cc \u06a9\u0648\u06a9\u06cc \u0628\u0627\u0631 2", 1]}
{"text": ["\u06a9\u0648\u06a9\u06cc \u0647\u0627 \u0648 \u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f. \u0645\u062e\u0635\u0648\u0635\u0627 \u06a9\u0648\u06a9\u06cc \u0647\u0627 \u06a9\u0647 \u0628\u06cc\u0627\u062a \u0628\u0648\u062f\u0646\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u0648\u0643\u06cc \u0633\u064a\u0628 \u0648 \u0647\u0648\u064a\u062c", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0633\u0648\u0641\u0644\u0647 \u0634\u0643\u0644\u0627\u062a", 1]}
{"text": ["\u0628\u0631\u062e\u0648\u0631\u062f \u067e\u06cc\u06a9 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0645\u0648\u062f\u0628\u0627\u0646\u0647 \u0648 \u0632\u06cc\u0628\u0627 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (\u06cc\u06a9 \u0646\u0641\u0631\u0647)", 1]}
{"text": ["\u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u062a\u0627\u0632\u0647 \u0648 \u0644\u0630\u06cc\u0630", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u06a9\u06cc\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0633\u06cc\u0628", 1]}
{"text": ["\u0645\u0631\u0633\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc \u06a9\u0647  \u06a9\u0645\u06a9\u0645 \u06a9\u0631\u062f\u06cc\u0646 \u06a9\u0647 \u06a9\u0633\u06cc \u0631\u0648 \u0633\u0648\u067e\u0631\u0627\u06cc\u0632 \u06a9\u0646\u0645....\u0634\u06cc\u0631\u06cc\u0646\u06cc \u0647\u0627\u062a\u0648\u0646\u0645 \u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u0647", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u067e\u0627\u064a \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637 \u0648\u0627\u0642\u0639\u0627 \u0627\u0646\u062f\u0627\u0632\u0647 \u064a\u0643 \u0643\u064a\u0644\u0648 \u0646\u0628\u0648\u062f \u0648 \u062d\u062a\u064a \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u0666 \u0646\u0641\u0631 \u0647\u0645 \u0646\u0628\u0648\u062f ... \u0645\u0648\u0642\u0639 \u0628\u0631\u0634 \u062f\u0627\u062f\u0646 \u0647\u0645 \u062e\u064a\u0644\u064a \u0633\u0631\u064a\u0639 \u062e\u0631\u062f \u0645\u064a\u0634\u062f \u0648 \u0627\u0646\u06af\u0627\u0631 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f..\n\u0627\u0645\u0627 \u0643\u064a\u0643 \u0647\u0648\u064a\u062c \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u0628\u0644\u0648\u0643\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["The best", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u064a\u0643\u0633 \u064a\u062e\u0686\u0627\u0644\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062b\u0644 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0634\u0645\u0632\u0647 \u060c \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 16", 1]}
{"text": ["\u0639\u0627\u0644\u06cc \u0628\u0648\u062f \u0645\u0645\u0646\u0648\u0646", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0634\u064a\u0631\u064a\u0646\u06cc \u0643\u0631\u0647 \u0627\u06cc 2", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u062a\u0631\u06a9\u06cc\u0628 \u062c\u0627\u0644\u0628\u06cc \u0628\u0648\u062f. \u0648\u0644\u06cc \u06a9\u06cc\u06a9 \u0633\u06cc\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0648 \u06a9\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648 \u0628\u0627 \u0648\u062c\u0648\u062f \u062a\u0627\u0632\u06af\u06cc \u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0634\u06cc\u0631\u06cc\u0646 \u0628\u0648\u062f\u0646 \u0648 \u062f\u0644 \u0631\u0648 \u0645\u06cc\u0632\u062f \u0634\u06cc\u0631\u06cc\u0646\u06cc\u0634\u0648\u0646.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0643\u064a\u06a9 \u0633\u064a\u0628 \u0648 \u06af\u0631\u062f\u0648 \u0628\u0644\u0648\u0643\u06cc", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u0647 \u0639\u0627\u0644\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a \u0628\u0632\u0631\u06af (\u0628\u0631\u0627\u06cc 8 \u062a\u0627 10 \u0646\u0641\u0631)", 1]}
{"text": ["\u0645\u0646 \u0639\u0627\u0634\u0642 \u0686\u06cc\u0632\u06a9\u06cc\u06a9\u0647\u0627\u06cc \u0634\u0645\u0627 \u0634\u062f\u0645. \u0639\u0627\u0627\u0627\u0627\u0627\u0644\u06cc\u0647. \u0645\u0631\u0633\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0647\u0645 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0648 \u0647\u0645 \u067e\u0648\u062f\u064a\u0646\u06af\u060c \u062a\u0648 \u062c\u0639\u0628\u0647 \u0628\u0631\u06af\u0634\u062a\u0647 \u0628\u0648\u062f\u0646 \u0648 \u0643\u0644\u0646 \u0638\u0627\u0647\u0631\u0634 \u062e\u0631\u0627\u0628 \u0634\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0628\u0632\u0631\u06af", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", -1]}
{"text": ["\u0643\u0648\u0643\u064a \u0628\u0627\u0643\u0633  \u0645\u062b\u0644 \u0647\u0645\u064a\u0634\u0647 \u0628\u0647\u062a\u0631\u064a\u0646 \u0648 \u062e\u0648\u0634\u0645\u0632\u0647 \u062a\u0631\u064a\u0646 \u0686\u064a\u0632\u0643\u064a\u0643 \u0647\u0627\u0631\u0648 \u062a\u0648\u0644\u064a\u062f \u0645\u064a \u0643\u0646\u0647 ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u0643 \u0631\u0632\u0628\u0631\u06cc (\u0643\u0648\u0686\u06a9)", 1]}
{"text": ["\u0648\u0627\u0642\u0639\u0627 \u0628\u062f \u0628\u0648\u062f! \u0627\u0646\u062f\u0627\u0631\u0647 \u0645\u062a\u0648\u0633\u0637\u0634 \u0628\u0647 \u0632\u0648\u0631 \u0628\u0647 \u06f5 \u0646\u0641\u0631 \u0645\u06cc\u0631\u0633\u0647 \u062e\u06cc\u0644\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u200c\u0628\u0648\u062f \u0648 \u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u0645\u0648\u0646\u062f\u0647 \u0628\u0648\u062f! \u0645\u0646 \u0627\u0635\u0644\u0627 \u062a\u0648\u0635\u06cc\u0647 \u0646\u0645\u06cc\u06a9\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0627\u0635\u0644\u0627 \u0645\u0632\u0647 \u0646\u0648\u062a\u0644\u0627 \u0646\u0645\u06cc\u062f\u0627\u062f \u0648 \u0646\u0633\u0628\u062a \u0628\u0647 \u0633\u0627\u06cc\u0632 \u0648 \u06a9\u06cc\u0641\u06cc\u062a\u0634 \u0627\u0635\u0644\u0627 \u0646\u0645\u06cc \u0627\u0631\u0632\u06cc\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 (\u0645\u062a\u0648\u0633\u0637)", -1]}
{"text": ["\u06a9\u0644\u0627 \u06a9\u0648\u06a9\u06cc \u0628\u0627\u06a9\u0633 \u0646\u06cc\u0627\u0632 \u0628\u0647 \u062a\u0639\u0631\u06cc\u0641\u200c \u0646\u062f\u0627\u0631\u0647 \u0648 \u0686\u0642\u062f\u0631 \u062e\u0648\u0628\u0647 \u06a9\u0647 \u062a\u0648 \u0627\u0633\u0646\u067e \u0641\u0648\u062f \u0647\u0633\u062a\u06a9\u06cc\u06a9 \u06a9\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648 \u0641\u0648\u0642 \u0627\u0644\u0639\u0627\u062f\u0647 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u06af\u0631\u0627\u0646\u0648\u0644\u0627 \u062a\u0648\u062a \u0641\u0631\u0646\u06af\u06cc", 1]}
{"text": ["\u06a9\u06cc\u0641\u06cc\u062a \u0648 \u0645\u0632\u0647 \u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u0627\u0635\u0644\u0627 \u0645\u0646\u0627\u0633\u0628 \u0646\u0628\u0648\u062f. \u0628\u0647 \u0639\u0644\u0627\u0648\u0647 \u0641\u0642\u0637 \u0628\u0647 \u0627\u0633\u0645 \u067e\u0648\u062f\u06cc\u0646\u06af \u0628\u0647\u0634 \u0627\u0634\u0627\u0631\u0647 \u0634\u062f\u0647\u060c \u062f\u0631 \u062d\u0627\u0644\u06cc \u06a9\u0647 \u06cc\u06a9 \u06a9\u06cc\u06a9 \u0628\u0627 \u0631\u0648\u06a9\u0634 \u067e\u0648\u062f\u06cc\u0646\u06af.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0648\u062f\u064a\u0646\u06af \u0645\u062a\u0648\u0633\u0637", -1]}
{"text": ["\u067e\u06cc\u0634 \u062f\u0648\u0633\u062a\u0645 \u0631\u0648 \u0633\u0641\u06cc\u062f \u0634\u062f\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c", "\u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u0643\u0648\u0686\u06a9", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", "\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0628\u0647 \u0642\u06cc\u0645\u062a\u0634 \u0646\u0645\u06cc\u0627\u0631\u0632\u0647 \n\u06a9\u06cc\u0641\u06cc\u062a\u0634 \u062e\u0648\u0628\u0647 \u0628\u062f\u0646\u06cc\u0633\u062a", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", "\u0643\u064a\u06a9 \u0643\u0631\u0627\u0645\u0628\u0644 \u0622\u0644\u0628\u0627\u0644\u0648", 1]}
{"text": ["\u0639\u0627\u0644\u064a \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0643\u064a\u0643 \u062e\u0627\u0645\u0647 \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u062e\u0648\u0628 \u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u0631\u0627\u0633\u062a\u0634 \u06a9\u06cc\u0641\u06cc\u062a \u0631\u062f\u0648\u0644\u0648\u062a \u0646\u0633\u0628\u062a \u0628\u0647 \u062f\u0641\u0639\u0647 \u06cc \u0627\u0648\u0644\u06cc \u06a9\u0647 \u06af\u0631\u0641\u062a\u0645 \u062e\u06cc\u0644\u06cc \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0648\u062f. \u0647\u0645 \u067e\u0646\u06cc\u0631\u06cc \u06a9\u0647 \u062f\u0627\u0634\u062a \u0647\u0645 \u062e\u0648\u062f \u06a9\u06cc\u06a9. \u0645\u0632\u0647 \u06cc\u200c\u062e\u0627\u0635\u06cc\u200c \u0646\u062f\u0627\u0634\u062a \u06a9\u0644\u0627.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u06a9\u06cc\u06a9 \u0631\u062f\u0648\u0644\u0648\u062a", -1]}
{"text": [" \u0639\u0643\u0633 \u0645\u0646\u0627\u0633\u0628 \u062a\u0631\u064a \u0627\u0632 \u0634\u064a\u0631\u064a\u0646\u064a \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u0648\u062f \u062a\u0627 \u0645\u0634\u062a\u0631\u064a \u0628\u062f\u0627\u0646\u062f \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u064a\u0631\u064a\u0646\u064a \u0686\u0642\u062f\u0631 \u0643\u0648\u0686\u0643 \u0627\u0633\u062a.\n\u0669 \u0639\u062f\u062f \u0634\u064a\u0631\u064a\u0646\u064a \u0643\u0648\u0686\u0643\u064a \u0643\u0647 \u062f\u0648\u062a\u0627\u064a \u0622\u0646\u0647\u0627 \u0647\u0645 \u0628\u0627 \u0647\u0645 \u062a\u0631\u0643\u064a\u0628 \u0634\u062f\u0647 \u062c\u0644\u0648\u0647 \u0642\u0634\u0646\u06af\u064a \u0646\u062f\u0627\u0631\u062f \u0627\u0635\u0644\u0627\u064b.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", -1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u062f\u0644\u06cc\u0644 \u0627\u0645\u062a\u06cc\u0627\u0632 \u067e\u0627\u06cc\u06cc\u0646 \u0645\u0646 \u060c \u0627\u0631\u0633\u0627\u0644 \u0633\u0641\u0627\u0631\u0634 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646 \u0628\u0648\u062f \u0686\u0648\u0646 \u0633\u0641\u0627\u0631\u0634 \u0628\u0646\u062f\u0647 \u0645\u0648\u062c\u0648\u062f \u0646\u0628\u0648\u062f ", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627", 1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0633 \u0648\u0644\u06cc \u062f\u06cc\u06af\u0647 \u062e\u062f\u0627\u06cc\u06cc \u0627\u0632 \u0645\u06cc\u0646\u06cc \u0647\u0645 \u0645\u06cc\u0646\u06cc \u062a\u0631 \u0628\u0648\u062f\u0627\u0627\u0627", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u064a\u0643\u0633 \u0645\u064a\u0646\u06cc \u0643\u0648\u0643\u06cc \u0628\u0627\u0643\u0633 9", 1]}
{"text": ["\u0639\u0627\u0644\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc\u06cc", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u067e\u0627\u067e \u0643\u064a\u0643 \u0634\u0643\u0644\u0627\u062a", "\u0628\u0631\u0627\u0646\u06cc \u0643\u0627\u0631\u0627\u0645\u0644", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0647\u0648\u064a\u062c \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0628\u0631\u0627\u0646\u06cc \u06af\u064a\u0644\u0627\u0633", 1]}
{"text": ["\u0645\u0648\u0633 \u0643\u0627\u0645\u0644\u0627 \u0645\u0632\u0647 \u0643\u0627\u0643\u0627\u0626\u0648 \u0646\u0627\u0645\u0631\u063a\u0648\u0628 \u0645\u064a\u062f\u0627\u062f \u060c \u0686\u064a\u0632 \u0643\u064a\u0643 \u0628\u064a\u0634\u062a\u0631 \u0634\u0628\u064a\u0647 \u0643\u064a\u0643 \u062a\u0648\u0644\u062f \u0628\u0648\u062f \u0627\u0635\u0644\u0627 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0648\u062f \u0647\u0645 \u0647\u0648\u064a\u062c \u0647\u0645 \u0628\u0644\u0648\u0628\u0631\u064a \u060c \u062f\u064a\u06af\u0647 \u062e\u0631\u064a\u062f \u0646\u0645\u064a\u0643\u0646\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u06a9\u0648\u0686\u06a9", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0647\u0648\u06cc\u062c \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0645\u06cc\u0634\u0647 \u0627\u0646\u0642\u062f\u0631 \u062e\u0648\u0634\u0645\u0632\u0647 \u0646\u0628\u0627\u0634\u06cc \u0639\u062c\u0628\u0627\u0627\u0627\u0627 \u0647\u06cc \u0628\u0627\u06cc\u062f \u0628\u062e\u0648\u0631\u06cc\u0645 \u0648 \u0647\u06cc \u0628\u0627\u06cc\u062f \u0628\u0627\u0632\u0645 \u0628\u062e\u0648\u0631\u06cc\u0645", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u06a9\u0627\u0631\u0627\u0645\u0644 \u0645\u062a\u0648\u0633\u0637", 1]}
{"text": ["\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u0631\u0648 \u0627\u0632 \u062f\u0633\u062a \u0646\u062f\u06cc\u062f. foody lady", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0645\u0627\u0631\u0628\u0644 \u0628\u0631\u0627\u0646\u06cc", "\u0645\u0648\u0633 \u0634\u0643\u0644\u0627\u062a \u0633\u064a\u0627\u0647 \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0633\u0644\u0627\u0645\n\u0645\u0646 \u062e\u064a\u0644\u0649 \u0686\u064a\u0632 \u0643\u064a\u0643 \u0645\u0627\u0631\u0633 \u0627\u0632\u062a\u0648\u0646 \u0645\u064a\u06af\u064a\u0631\u0645\u060c\u0647\u0645 \u062d\u0636\u0648\u0631\u0649 \u0647\u0645 \u062c\u062f\u064a\u062f\u0627 \u0628\u0627 \u0627\u0633\u0646\u067e \u0641\u0648\u062f\n\u0648\u0644\u0649 \u0627\u064a\u0646\u062f\u0641\u0639\u0647 \u0627\u0646\u06af\u0627\u0631 \u067e\u0646\u064a\u0631\u0633 \u0631\u0648 \u062e\u064a\u0644\u0649 \u0647\u0645 \u0632\u062f\u0647 \u0628\u0648\u062f\u0646 \u0628\u0627 \u0627\u064a\u0646\u0643\u0647 \u062f\u0631 \u064a\u062e\u0686\u0627\u0644 \u0647\u0645 \u0645\u0648\u0646\u062f\u0647\n\u0628\u0627\u0632 \u067e\u0646\u064a\u0631\u0634 \u0634\u0644\u0647 \u0648 \u0627\u0632 \u0647\u0631 \u062f\u0641\u0639\u0647 \u0634\u0648\u0631\u062a\u0631 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633 \u0628\u0632\u0631\u06af", -1]}
{"text": ["\u0628\u06cc \u0646\u0638\u06cc\u0631.....\u062a\u062d\u0648\u06cc\u0644 \u0633\u0631\u06cc\u0639", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0686\u064a\u0632 \u0643\u064a\u06a9 \u0645\u0627\u0631\u0633  \u062f\u0627\u0646\u0647 \u0627\u06cc", 1]}
{"text": ["\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0647\u0627 \u062a\u0627\u0632\u0647 \u0646\u0628\u0648\u062f\u0647  \u0648 \u062a\u0642\u0631\u064a\u0628\u0627 \u062e\u0634\u0643 \u0634\u062f\u0647 \u0628\u0648\u062f\u0647 \u0648 \u0663 \u062a\u0627\u0634 \u062e\u0648\u0631\u062f \u0634\u062f\u0647 \u0628\u0647 \u062f\u0633\u062a \u0645\u0627 \u0631\u0633\u064a\u062f.", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u0627\u0643\u0644\u062a \u0686\u064a\u067e \u0643\u0648\u0643\u06cc", "\u067e\u0627\u06cc \u0633\u064a\u0628 \u0643\u0648\u0686\u06a9", -1]}
{"text": ["\u062e\u0648\u0634\u0645\u0632\u0647 \u0648 \u062f\u0644\u064a\u0634\u0632", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0628\u0644\u0648\u0628\u0631\u06cc \u06a9\u0648\u0686\u06a9", 1]}
{"text": ["\u0646\u0633\u0628\u062a \u0628\u0647 \u0642\u06cc\u0645\u062a \u0633\u0627\u06cc\u0632 \u0627\u0646\u062f\u0627\u0632\u0647 \u0634\u06cc\u0631\u06cc\u0646\u06cc \u0628\u0633\u06cc\u0627\u0631 \u0646\u0627\u0686\u06cc\u0632 \u0628\u0648\u062f", "\u0627\u0631\u0633\u0627\u0644 \u0628\u0627 \u0627\u0633\u0646\u067e \u0627\u06a9\u0633\u067e\u0631\u0633", "\u0686\u064a\u0632\u0643\u064a\u0643 \u062f\u0648\u0628\u0644 \u0628\u0631\u0634\u06cc", "\u0686\u06cc\u0632 \u06a9\u06cc\u06a9 \u0646\u0648\u062a\u0644\u0627 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u067e\u0627\u06cc \u0622\u0644\u0628\u0627\u0644\u0648 \u062f\u0627\u0646\u0647 \u0627\u06cc", "\u0633\u0648\u0641\u0644\u0647 \u0646\u0648\u062a\u0644\u0627", -1]}
